import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as D}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(v,[["render",x],["__scopeId","data-v-71fafc74"]]),P=JSON.parse(`[{"page_url":"https://en.wikipedia.org/wiki/Svenstrup_(manor_house)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Joachim_Wedell-Neergaard_by_Laurberg.jpg","page_title":"Svenstrup (manor house)","context_page_description":"Svenstrup is a manor house and estate located close to Borup, Køge Municipality, some 50 kilometres southwest of Copenhagen, Denmark. It has belonged to members of the Neergaard/Wedell-Neergaard family since 1751."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%91%9E%E5%A3%AB%E5%9F%8E%E5%A0%A1%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/SchlossSchadau_6383.jpg","page_title":"瑞士城堡列表","context_page_description":"本表列舉瑞士聯邦各州現存的各類城堡建築。"},{"page_url":"https://sv.wikipedia.org/wiki/Dinoderus_minutus","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Dinoderus_minutus_%28lateral_view%29.jpg","page_title":"Dinoderus minutus","context_page_description":"Dinoderus minutus är en skalbaggsart som först beskrevs av Fabricius 1775. Dinoderus minutus ingår i släktet Dinoderus och familjen kapuschongbaggar. Arten förekommer tillfälligt i Sverige, men reproducerar sig inte. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Ma%C5%82opolski_Piknik_Lotniczy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Malopolski_Piknik_Lotniczy_2007.JPG","page_title":"Małopolski Piknik Lotniczy","context_page_description":"Małopolski Piknik Lotniczy – największy organizowany w południowej Polsce pokaz lotniczy. Pierwszy raz został zorganizowany w 2004. Impreza odbywa się na terenie jednego z najstarszych lotnisk w Europie – Rakowice-Czyżyny, które znajduje się w Krakowie. Lotnisko, rozformowane, z 1900-metrową betonową drogą startową przedzieloną ulicą i częściowo wkomponowaną w teren osiedla mieszkaniowego, zostało ponownie uruchomione jako lądowisko o wymiarach 720 x 60 m z betonową nawierzchnią m.in. na potrzeby pikniku. Piknik jest organizowany przez Krakowskie Muzeum Lotnictwa Polskiego, które znajduje się na terenie dawnego lotniska. Jego celem jest przybliżenie odbiorcom historii i tradycji polskiego lotnictwa.\\nW trakcie imprezy prowadzone są pokazy lotnicze - niskie przeloty oraz akrobacyjne - prowadzone przez polskich i zagranicznych pilotów. Wśród gości byli dotychczas m.in. Jurgis Kairys, Marek Szufa, Peter Besenyei oraz polski zespół akrobacyjny Biało-Czerwone Iskry.\\nPo zakończeniu VI edycji, 28 czerwca 2009 roku miał miejsce wypadek turystycznego samolotu Cessna 172. Zginęły w nim dwie osoby, a dwie zostały ranne."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B5%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%B8%D0%B4%D0%B8%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Phencyclidine-from-xtal-3D-balls.png","page_title":"Фенциклидин","context_page_description":"Фенциклиди́н — синтетический фармакологический препарат для внутривенного наркоза, антагонист NMDA-рецептора; диссоциативное вещество. Создан в 1950-х годах в США и применявшийся в медицинских целях под маркой SERNYL до 1965 года. Применение в клинической практике было прекращено из-за чрезмерной токсичности, в том числе нейротоксичности. Некоторое время применялся в ветеринарии, но с 1979 года РСР был запрещен к использованию и производству, в том числе, из-за немедицинского применения препарата.\\nВ настоящее время Фенциклидин включен в Список I контролируемых веществ в России как наркотическое средство. В США отнесен DEA к списку II наркотических средств. Также входит в список II Конвенции о психотропных веществах.\\nУличные и сленговые обозначения препарата: Peace pill, ангельская пыль, HOG, Killer weed, KJ, Embalming fluid, Rocker fuel, Sherms и др."},{"page_url":"https://en.wikipedia.org/wiki/Tobacco_packaging_warning_messages","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Warning_on_the_French_Cigarettes_Pack.jpg","page_title":"Tobacco packaging warning messages","context_page_description":"Tobacco package warning messages are warning messages that appear on the packaging of cigarettes and other tobacco products concerning their health effects. They have been implemented in an effort to enhance the public's awareness of the harmful effects of smoking. In general, warnings used in different countries try to emphasize the same messages. Warnings for some countries are listed below. Such warnings have been required in tobacco advertising for many years, with the earliest mandatory warning labels implemented in Iceland in 1969. Implementing tobacco warning labels has been strongly opposed by the tobacco industry, most notably in Australia following the implementation of plain packaging laws.\\nThe WHO Framework Convention on Tobacco Control, adopted in 2003, requires such package warning messages to promote awareness against smoking.\\nA 2009 review summarises that \\"There is clear evidence that tobacco package health warnings increase consumers' knowledge about the health consequences of tobacco use.\\" The warning messages \\"contribute to changing consumers' attitudes towards tobacco use as well as changing consumers' behavior.\\""},{"page_url":"https://en.wikipedia.org/wiki/Non-monogamy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Paarc.png","page_title":"Non-monogamy","context_page_description":"Non-monogamy is an umbrella term for every practice or philosophy of non-dyadic intimate relationship that does not strictly hew to the standards of monogamy, particularly that of having only one person with whom to exchange sex, love, and/or affection. In that sense, \\"nonmonogamy\\" may be accurately applied to extramarital sex, group marriage, or polyamory. It is not synonymous with infidelity, since all parties are consenting to the relationship structure, partners are often committed to each other as well as to their other partners and cheating is still considered problematic behavior with many non-monogamous relationships.\\nMore specifically, \\"nonmonogamy\\" indicates forms of interpersonal relationship, intentionally undertaken, in which demands for exclusivity are attenuated or eliminated, and individuals may form multiple and simultaneous sexual and/or romantic bonds. This stands in contrast to monogamy, yet may arise from the same psychology."},{"page_url":"https://en.wikipedia.org/wiki/Niagara_Falls","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Charles.Blondin.jpg","page_title":"Niagara Falls","context_page_description":"Niagara Falls is a group of three waterfalls at the southern end of Niagara Gorge, spanning the border between the province of Ontario in Canada and the state of New York in the United States. The largest of the three is Horseshoe Falls, also known as Canadian Falls, which straddles the international border of the two countries. The smaller American Falls and Bridal Veil Falls lie within the United States. Bridal Veil Falls are separated from Horseshoe Falls by Goat Island and from American Falls by Luna Island, with both islands situated in New York.\\nLocated on the Niagara River, which drains Lake Erie into Lake Ontario, the combined falls have the highest flow rate of any waterfall in North America that has a vertical drop of more than 50 metres. During peak daytime tourist hours, more than 168,000 m³ of water goes over the crest of the falls every minute. Horseshoe Falls is the most powerful waterfall in North America, as measured by flow rate.\\nThe falls are 27 kilometres north-northwest of Buffalo, New York, and 121 kilometres south-southeast of Toronto, between the twin cities of Niagara Falls, Ontario, and Niagara Falls, New York."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D1%96%D1%86%D0%BA%D0%B0-%D0%92%D0%B0%D0%BB%D1%8B%D0%BD%D1%81%D0%BA%D0%B0%D0%B5_%D0%BA%D0%BD%D1%8F%D1%81%D1%82%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Alex_K_Yuri_Boleslav_seal.png","page_title":"Галіцка-Валынскае княства","context_page_description":"Галіцка-Валынскае княства або Рускае каралеўства — адно з буйнейшых княстваў Русі, размешчанае у вярхоўях Днястра, Віслы, Нарава і Прыпяці. Узнікла ў выніку аб'яднання Галіцкага і Уладзіміра-Валынскага княстваў уладзіміра-валынскім князем Раманам Мсціславічам."},{"page_url":"https://vi.wikipedia.org/wiki/Obruby","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Obruby%2C_usedlost_%C4%8Dp.25.jpg","page_title":"Obruby","context_page_description":"Obruby là một làng thuộc huyện Mladá Boleslav, vùng Středočeský, Cộng hòa Séc."},{"page_url":"https://sl.wikipedia.org/wiki/Jo%C5%BEe_Pu%C4%8Dnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Dvorana_Jo%C5%BEeta_Pu%C4%8Dnika_Jo%C5%BEe_Pu%C4%8Dnik_Hall.jpg","page_title":"Jože Pučnik","context_page_description":"Jože Pučnik, slovenski politik in sociolog, * 9. marec 1932, Črešnjevec, Slovenska Bistrica, † 11. januar 2003, Nemčija.\\nŽe kot dijaku so mu na Gimnaziji Maribor zaradi kritičnega razmišljanja onemogočili opravljati maturo, ki jo je zato moral opravljati kot zasebnik. Po študiju na Filozofski fakulteti v Ljubljani so ga konec petdesetih, ko je bil pomožni asistent pri Borisu Ziherlu zaradi objav v Reviji 57 in nato spet v šestdesetih letih zaradi kritik kmetijske politike v reviji Perspektive zaprli za skupno sedem let.\\nPo vrnitvi iz zapora je emigriral v Nemčijo. Ker mu slovenske oblasti niso hotele izdati potrdila o diplomi, se je v Nemčiji preživljal kot pristaniški delavec v Hamburgu in ponovno doštudiral ter doktoriral. Kot docent je bil zaposlen na Znanstveni visoki šoli v Lüneburgu, kjer si je tudi ustvaril družino. Tam je živel od leta 1966 do 1989.\\nKonec 80. let se je vrnil v Slovenijo in postal vodja Demokratične Opozicije Slovenije, koalicije novonastalih slovenskih demokratičnih političnih strank, ki je na prvih svobodnih volitvah leta 1990 zmagala in povedla Slovenijo na pot demokratizacije in tržnega gospodarstva."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A2%E5%8D%A1%E6%96%AF%C2%B7%E6%81%A9%E8%AE%B7%E8%B4%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Lukas_Enembe_Official.jpg","page_title":"卢卡斯·恩讷贝","context_page_description":"卢卡斯·恩讷贝，或作路加·俄南贝 、伊年比，印度尼西亚政治人物，现任巴布亚省省长。\\n2017年9月27日，恩讷贝被肃贪委员会视为贪污嫌犯。他的支持者向印尼国家人权委员会抗议，主张此议题因2018 年的巴布亚省长选举而政治化。 肃贪委员会后将恩讷被列为挪用巴布亚奖学金贪腐案的证人，恩讷贝当面对委员会澄清其财产申报。"},{"page_url":"https://en.wikipedia.org/wiki/Palais_Garnier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Monumental_stairway_of_the_palais_Garnier_opera_in_Paris.jpg","page_title":"Palais Garnier","context_page_description":"The Palais Garnier or Opéra Garnier, is a 1,979-seat opera house at the Place de l'Opéra in the 9th arrondissement of Paris, France. It was built for the Paris Opera from 1861 to 1875 at the behest of Emperor Napoleon III. Initially referred to as \\"le nouvel Opéra de Paris\\", it soon became known as the Palais Garnier, \\"in acknowledgment of its extraordinary opulence\\" and the architect Charles Garnier's plans and designs, which are representative of the Napoleon III style. It was the primary theatre of the Paris Opera and its associated Paris Opera Ballet until 1989, when a new opera house, the Opéra Bastille, opened at the Place de la Bastille. The company now uses the Palais Garnier mainly for ballet. The theatre has been a monument historique of France since 1923.\\nThe Palais Garnier has been called \\"probably the most famous opera house in the world, a symbol of Paris like Notre Dame Cathedral, the Louvre, or the Sacré Coeur Basilica.\\" This is at least partly due to its use as the setting for Gaston Leroux's 1910 novel The Phantom of the Opera and, especially, the novel's subsequent adaptations in films and the popular 1986 musical."},{"page_url":"https://hu.wikipedia.org/wiki/Tolo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/GR_08-04-21_Tolo2.JPG","page_title":"Tolo","context_page_description":"Tolo egy kis falu Görögországban a Peloponnészosz félsziget Argolída prefektúrájában. A Nafpliótól 10 km-re délkeletre, a Tolói-öböl partján fekvő egykori halászfalu ma nyaralóhelyként nevezetes. Ez része az Asini önkormányzati egységnek, az Argolisban."},{"page_url":"https://en.wikipedia.org/wiki/Convex_hull_of_a_simple_polygon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Convex_hull_of_a_simple_polygon.svg","page_title":"Convex hull of a simple polygon","context_page_description":"In discrete geometry and computational geometry, the convex hull of a simple polygon is the polygon of minimum perimeter that contains a given simple polygon. It is a special case of the more general concept of a convex hull. It can be computed in linear time, faster than algorithms for convex hulls of point sets.\\nThe convex hull of a simple polygon can be subdivided into the given polygon itself and into polygonal pockets bounded by a polygonal chain of the polygon together with a single convex hull edge. Repeatedly reflecting an arbitrarily chosen pocket across this convex hull edge produces a sequence of larger simple polygons; according to the Erdős–Nagy theorem, this process eventually terminates with a convex polygon."},{"page_url":"https://ast.wikipedia.org/wiki/NGC_6826","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/NGC_6826HSTFull.jpg","page_title":"NGC 6826","context_page_description":"NGC 6826 ye una nebulosa planetaria na constelación de Cygnus a unos 2200 años lluz de distancia de la Tierra. Ye la fase final d'una estrella similar al Sol, una fase bien curtia en comparanza cola edá de la estrella.\\nCola apariencia d'un güeyu con dos enllordies coloraes a los llaos ye conocida tamién como Nebulosa del Güeyu que Ceguña, tamién llamada, na fala inglesa, Blinking Nebula. La parte circundante de color verde maciu piénsase que ye gas equivalente a la metá de la masa de la estrella. El remanente de la estrella produz un vientu estelar qu'emburria al material más antiguo, formando una burbuya caliente interior. La estrella ye una de les más brilloses nuna nebulosa planetaria.\\nAfayóse en 1793 por William Herschel."},{"page_url":"https://en.wikipedia.org/wiki/Ngo_Dinh_Diem","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/5_v%E1%BB%8B_Th%C6%B0%E1%BB%A3ng_th%C6%B0_t%E1%BB%AB_tr%C3%A1i_qua_ph%E1%BA%A3i_H%E1%BB%93_%C4%90%E1%BA%AFc_Kh%E1%BA%A3i%2C_Ph%E1%BA%A1m_Qu%E1%BB%B3nh%2C_Th%C3%A1i_V%C4%83n_To%E1%BA%A3n%2C_Ng%C3%B4_%C4%90%C3%ACnh_Di%E1%BB%87m%2C_B%C3%B9i_B%E1%BA%B1ng_%C4%90o%C3%A0n.jpg","page_title":"Ngo Dinh Diem","context_page_description":"Ngô Đình Diệm was a Vietnamese politician. He was the final prime minister of the State of Vietnam, and then served as President of South Vietnam from 1955 until he was deposed and assassinated during the 1963 military coup.\\nDiệm was born into a prominent Catholic family, the son of a high-ranking civil servant, Ngô Đình Khả. He was educated at French-speaking schools and considered following his brother Ngô Đình Thục into the priesthood, but eventually chose to pursue a civil-service career. He progressed rapidly in the court of Emperor Bảo Đại, becoming governor of Bình Thuận Province in 1929 and interior minister in 1933. However, he resigned the latter position after three months and publicly denounced the emperor as a tool of the French. Diệm came to support Vietnamese nationalism, promoting an anti-communist and anti-colonialist \\"third way\\" opposed to both Bảo Đại and communist leader Hồ Chí Minh. He established the Can Lao Party to support his political doctrine of Person Dignity Theory.\\nAfter several years in exile, Diệm returned home in July 1954 and was appointed prime minister by Bảo Đại, the head of the Western-backed State of Vietnam."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D9%86%D8%A8%D9%8A%D9%84_%D8%A8%D9%86%D8%B9%D8%A8%D8%AF_%D8%A7%D9%84%D9%84%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Nabil_Benabdallah_2012_%28cropped%29.jpg","page_title":"محمد نبيل بنعبد الله","context_page_description":"محمد نبيل بنعبد الله، سياسي مغربي، شغل منصب وزير للاتصال، والناطق الرسمي باسم حكومة إدريس جطو بين نوفمبر 2002 - أكتوبر 2007، وشغل منصب وزير السكنى والتعمير وسياسة المدينة منذ 2012 في حكومة بنكيران، و وفي عام 2017 عُين وزير إعداد التراب الوطني والتعمير والإسكان وسياسة المدينة في حكومة سعد الدين العثماني، وبقي فيها إلى غاية 24 أكتوبر2017."},{"page_url":"https://it.wikipedia.org/wiki/J%C3%BCrgen_Marcus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Eurovisie_Songfestival_76_Den_Haag_Jurgen_Marcus_%28Luxemburg%29%2C_Bestanddeelnr_928-5031.jpg","page_title":"Jürgen Marcus","context_page_description":"Jürgen Marcus, all'anagrafe Jürgen Beumer, è stato un cantante tedesco, che era dedito principalmente ai generi pop-Schlager e professionalmente in attività dall'inizio degli anni settanta.\\nNel corso della sua carriera, pubblicò una quarantina di album e si aggiudicò una Goldene Schalplatte, 4 BRAVO Otto, e 4 Goldene Löwen. Tra i suoi singoli di maggiore successo, figurano Eine neue Liebe ist wie ein neues Leben, Ein Festival der Liebe, Schmetterlinge können nicht weinen, Ein Lied zieht hinaus in die Welt, ecc."},{"page_url":"https://hu.wikipedia.org/wiki/1988-as_labdar%C3%BAg%C3%B3-Eur%C3%B3pa-bajnoks%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Olympiastadion_Muenchen.jpg","page_title":"1988-as labdarúgó-Európa-bajnokság","context_page_description":"Az 1988-as labdarúgó-Európa-bajnokság a futball történetének 8. Európa-bajnoksága volt. Nyugat-Németországban rendezték június 10. és 25. között. Az Eb-t a holland csapat nyerte, története során először. Valamennyi mérkőzésen esett legalább egy gól, nem volt hosszabbítás és kiállítás."},{"page_url":"https://it.wikipedia.org/wiki/Po%C5%A1echon%27e","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Poshekhonye_COA_%28Yaroslavl_Governorate%29_%281778%29.png","page_title":"Pošechon'e","context_page_description":"Pošechon'e è una cittadina della Russia europea centrale."},{"page_url":"https://en.wikipedia.org/wiki/Maverick_(TV_series)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Jack_Kelly_Richard_Long_Maverick_1960.JPG","page_title":"Maverick (TV series)","context_page_description":"Maverick is an American Western dramatic television series with comedic overtones created by Roy Huggins and originally starring James Garner. The show ran for five seasons from September 22, 1957, to July 8, 1962, on ABC."},{"page_url":"https://en.wikipedia.org/wiki/Clarice_Cliff","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/The_Bizarre_girls_1986.jpg","page_title":"Clarice Cliff","context_page_description":"Clarice Cliff was an English ceramic artist active from 1922 to 1963. She became a ceramic artist, becoming the head of the factory artistic department."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Indian_state_trees","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Cedrus_deodara_Himalajazeder.JPG","page_title":"List of Indian state trees","context_page_description":"India, officially the Republic of India is a country in South Asia. It is made up of 28 states and 8 union territories. All Indian states have their own government and the Union territories come under the jurisdiction of the Central Government. As most of the other countries India too has a national emblem—the Lion Capital of Sarnath.\\nApart from India's national emblem, each of its States and Union Territories have their own state seals and symbols which include state animals, birds, trees, flowers etc. A list of state trees of India is given below. See Symbols of Indian states and territories for a complete list of all State characters and seals."},{"page_url":"https://hu.wikipedia.org/wiki/Eml%C3%A9kt%C3%A1bl%C3%A1k_Balassagyarmaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kenessey_Albert_plaque_%28Balassagyarmat_R%C3%A1k%C3%B3czi_fejedelem_%C3%BAt_125%29.jpg","page_title":"Emléktáblák Balassagyarmaton","context_page_description":"A Wikimédia Commons tartalmaz Emléktáblák Balassagyarmaton témájú kategóriát.\\nBalassagyarmat szócikkhez kapcsolódó képgaléria, mely helyi, országos vagy nemzetközi hírű személyekkel, valamint épületekkel, műtárgyakkal, helynevekkel és eseményekkel összefüggő emléktáblákat tartalmaz."},{"page_url":"https://en.wikipedia.org/wiki/Archduke_(butterfly)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Illustrations_of_new_species_of_exotic_butterflies_Adolias_III.jpg","page_title":"Archduke (butterfly)","context_page_description":"The archdukes are a genus, Lexias, of tropical forest-dwelling butterflies that are common throughout Southeast Asia and Australasia. Members of the brush-footed butterfly family Nymphalidae, the genus is represented by about 17 species. Two very similar and coexisting genera are Tanaecia and Euthalia, the latter previously including some Lexias species. The largest species reach a wingspan of about 10 cm."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D0%BB%D0%B0%D1%81%D1%81%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Allassac_%C3%A9glise_%285%29.JPG","page_title":"Аллассак","context_page_description":"Алласса́к — коммуна во Франции, находится в регионе Лимузен. Департамент — Коррез. Входит в состав кантона Донзнак. Округ коммуны — Брив-ла-Гайярд.\\nКод INSEE коммуны — 19005.\\nКоммуна расположена приблизительно в 410 км к югу от Парижа, в 70 км южнее Лиможа, в 23 км к западу от Тюля."},{"page_url":"https://cs.wikipedia.org/wiki/Vlado_Goreski","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/01_let_tus.JPG","page_title":"Vlado Goreski","context_page_description":"Vlado Goreski je makedonský a slovinsky grafik, scénograf a návrhář divadelních plakátů."},{"page_url":"https://en.wikipedia.org/wiki/Trinity,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Trinity-Old-Red-Schoolhouse.jpg","page_title":"Trinity, Texas","context_page_description":"Trinity is a city in Trinity County, Texas, United States. The population was 2,697 at the 2010 census."},{"page_url":"https://it.wikipedia.org/wiki/Mercedes_(Camarines_Norte)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Ph_locator_camarines_norte_mercedes.png","page_title":"Mercedes (Camarines Norte)","context_page_description":"Mercedes è una municipalità di Quarta classe delle Filippine, situata nella Provincia di Camarines Norte, nella Regione del Bicol.\\nMercedes è formata da 26 baranggay:\\nApuao\\nBarangay I\\nBarangay II\\nBarangay III\\nBarangay IV\\nBarangay V\\nBarangay VI\\nBarangay VII\\nCaringo\\nCatandunganon\\nCayucyucan\\nColasi\\nDel Rosario\\nGaboc\\nHamoraon\\nHinipaan\\nLalawigan\\nLanot\\nMambungalon\\nManguisoc\\nMasalongsalong\\nMatoogtoog\\nPambuhan\\nQuinapaguian\\nSan Roque\\nTarum"},{"page_url":"https://en.wikipedia.org/wiki/Souk_Sidi_Boumendil","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Rue_Sidi_Boumendil1_Tunis.JPG","page_title":"Souk Sidi Boumendil","context_page_description":"Souk Sidi Boumendil is one of the popular souks of the medina of Tunis."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Kapelle-op-den-Bos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Station_Kapelle-op-den-Bos_-_Foto_2_%282010%29.png","page_title":"Gare de Kapelle-op-den-Bos","context_page_description":"La gare de Kapelle-op-den-Bos est une gare ferroviaire belge de la ligne 53, de Schellebelle à Louvain, située sur le territoire de la commune de Kapelle-op-den-Bos, dans la province du Brabant flamand en Région flamande.\\nElle est mise en service en 1837 par l'administration des chemins de fer de l'État belge. C'est un arrêt sans personnel de la Société nationale des chemins de fer belges desservi par des trains Omnibus et Heure de pointe."},{"page_url":"https://en.wikipedia.org/wiki/Hibiscus_tiliaceus","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Fleur_de_p%C5%ABrau_%28hibiscus_tiliaceus%29.jpg","page_title":"Hibiscus tiliaceus","context_page_description":"Hibiscus tiliaceus is a species of flowering tree in the mallow family, Malvaceae, that is native to the Old World tropics. Common names include sea hibiscus, beach hibiscus, coastal hibiscus, coastal cottonwood, green cottonwood, native hibiscus, native rosella, cottonwood hibiscus, kurrajong, sea rosemallow, balibago, malabago or malbago, maribago, waru, baru or bebaru, pagu, hau, fau, purau, and vau tree. The specific epithet, \\"tiliaceus\\", refers to its resemblance of the leaves to those of the related Tilia species."},{"page_url":"https://nn.wikipedia.org/wiki/Dei_fjorten_naudhjelparane","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Saintdenis.gif","page_title":"Dei fjorten naudhjelparane","context_page_description":"Dei fjorten naudhjelparane er ei nemning på ei gruppe med sentrale kristne helgenar som ein kunne be til for særskild hjelp og vern. Naudhjelparane har minnedag den 8. august i den katolske kyrkja."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E5%BC%97%E9%87%8C%E5%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Flag_of_Nova_Friburgo.png","page_title":"新弗里堡","context_page_description":"新弗里堡一译新富丽堡，是巴西东南部里约热内卢州一座山区城市，位于里约热内卢东北136公里。\\n1818年，在得到了葡萄牙摄政王约翰六世的同意下，来自瑞士弗里堡州的2006名移民定居此地。这些瑞士移民之所以选择此地，是因为此地风景秀丽，气候宜人，十分类似瑞士。后来又有德国、意大利的移民陆续来此定居。1890年1月8日设市。\\n2011年1月该市受到了大规模洪水和泥石流的严重影响。\\n{Brazil-geo-stub}}"},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_2005_der_Bundesrepublik_Deutschland","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/DPAG_2005_2461_Schillerjahr.jpg","page_title":"Briefmarken-Jahrgang 2005 der Bundesrepublik Deutschland","context_page_description":"Der Briefmarken-Jahrgang 2005 der Bundesrepublik Deutschland umfasste 53 einzelne Sondermarken, eine Blockausgabe mit einer Einzelmarke, sechs selbstklebende Sondermarken und die ersten zehn Dauermarken der neuen Serie Blumen. Der Nominalwert für die Sondermarken inklusive Zuschlag betrug 58,15 Euro.\\nAnlässlich des Todes von Papst Johannes Paul II., am 2. April, wurde am 12. Mai kurzfristig eine Sondermarke ins Ausgabeprogramm aufgenommen."},{"page_url":"https://no.wikipedia.org/wiki/Frank_Aresti","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Frank_Aresti.jpg","page_title":"Frank Aresti","context_page_description":"Frank Aresti er en amerikansk heavy metal gitarist.\\nFrank begynte med bandet Damonax og ga ut en demo, før han ble med i progressiv metal bandet Fates Warning som gitarist ifra 1986 til 1995, og deltok på 5 album. Han erstattet Victor Arduini, men ble selv ikke erstattet da Jim Matheos etter 1995 har spilt all gitar selv. Aresti har derimot vært med på diverse turneer med Fates Warning som gjestemusiker på 2000-tallet.\\nAresti hadde et band som han kalte All That Is på slutten av 90-tallet. Han hadde et soloprosjekt i 2006 som han kalte Dragonspoon, og ga ut et album med samme navn. Han var gjesteartist samme år på albumet The Parallel Otherworld med bandet Eidolon. Han er fortiden involvert i thrash metalbandet Dark Day Sunday."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1951","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Jill_Biden_official_portrait_crop.jpg","page_title":"Lijst van personen geboren in 1951","context_page_description":"Dit is een lijst van personen die geboren zijn in 1951.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E8%99%AB%E7%A5%9E%E7%A4%BE_(%E8%B6%8A%E5%89%8D%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Oiwa_shrine.jpg","page_title":"大虫神社 (越前市)","context_page_description":"大虫神社は、福井県越前市大虫町にある神社である。式内社で、旧社格は県社。\\n天津日高彦火火出見命を祭神とする。"},{"page_url":"https://en.wikipedia.org/wiki/Distinctive_unit_insignia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/197_Inf_Bde_DUI.jpg","page_title":"Distinctive unit insignia","context_page_description":"A distinctive unit insignia is a metallic heraldic badge or device worn by soldiers in the United States Army. The DUI design is derived from the coat of arms authorized for a unit. DUIs may also be called \\"distinctive insignia\\" or, imprecisely, a \\"crest\\" or a \\"unit crest\\" by soldiers or collectors. The U.S. Army Institute of Heraldry is responsible for the design, development and authorization of all DUIs."},{"page_url":"https://it.wikipedia.org/wiki/Storia_dei_Castelli_Romani","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Marino_tutto_1.jpg","page_title":"Storia dei Castelli Romani","context_page_description":"In età protostorica, i Colli Albani furono abitati da popolazioni indoeuropee di cultura villanoviana chiamati Latini, o Albani, che diedero vita ad una particolare civiltà, chiamata Civiltà Laziale.\\nSono stati rinvenuti i resti di diversi insediamenti preistorici nel territorio dei comuni castellani, risalenti a varie epoche: al periodo laziale I e II A sono riconducibili i reperti rinvenuti ad Albano Laziale nelle località Tor Paluzzi, Castel Savello e Colle dei Cappuccini, sul Tuscolo, a Lanuvio, a Grottaferrata in località Boschetto e a Velletri; al periodo laziale II B risalgono i reperti del Villaggio delle Macine sulle sponde del Lago Albano, i resti riconducibili alla mitica Alba Longa tra Palazzolo e i Tofelli di Ariccia, e resti di vari abitati sciolti a Lanuvio. Al periodo laziale III risalgono i resti delle necropoli di Marino Riserva del Truglio e Costa Caselle e di Grottaferrata Villa Cavalletti, mentre all'ultima fase della Civiltà Laziale, la IV A e B risalgono alcuni spettacoli reperti come un carro rinvenuto a Velletri e una cinquantina di sepolture nell'area di Marino."},{"page_url":"https://nl.wikipedia.org/wiki/Bob_Roll","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Bob_Roll_DC_2003.jpg","page_title":"Bob Roll","context_page_description":"Bob Roll is een voormalig Amerikaans wielrenner en mountainbiker. Hij reed voor onder meer 7 Eleven en Motorola.\\nNa zijn wielercarrière werd Roll analist voor onder meer NBC Sports."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D1%82-%D0%92%D0%BE%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/St.Tit.jpg","page_title":"Тит-Воин","context_page_description":"Тит-Воин — монах Киево-Печерского монастыря, преподобный Русской православной церкви живший в XIV веке."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BB%D0%B0_(%D0%B0%D0%BF%D0%BE%D1%81%D1%82%D0%BE%D0%BB)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Silvanus-Crescens-Silas.jpg","page_title":"Сила (апостол)","context_page_description":"Сила или Силван e сподвижник на апостолите Павел и Петър през 1 век.\\nСила е юдео-християнин и уважаван с пророчески способности член на първата християнска общност в Йерусалим.\\nСлед Апостолския събор в Йерусалим Сила е определен да отиде с Павел в Антиохия и да съобщи на тамошната древна общност решенията на събора..\\nВръща се обратно в Йерусалим. Разделя се от Барнабас.\\nСлед това Павел го взема със себе си при неговото второ мисионско пътуване. По време на престоя им във Филипи двамата са затворени в затвор.\\nВ Beröa те се раделят временно, понеже Павел си тръгва, заради едно бунтуване. Сила и Тимотей остават в Beröa. Той се среща с Павел отново в Коринт. Съосновател е на Коринтската община, където става епископ.\\nСила е споменат в Първото послание на апостол Петър като Силван, секретар, който написал писмото на Петър."},{"page_url":"https://uk.wikipedia.org/wiki/UPP1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Protein_UPP1_PDB_3EUE.png","page_title":"UPP1","context_page_description":"UPP1 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 7-ї хромосоми. Довжина поліпептидного ланцюга білка становить 310 амінокислот, а молекулярна маса — 33 934.\\nКодований геном білок за функціями належить до трансфераз, глікозилтрансфераз.\\nЗадіяний у такому біологічному процесі, як альтернативний сплайсинг."},{"page_url":"https://zh.wikipedia.org/wiki/2018%E5%B9%B4%E4%B8%96%E7%95%8C%E7%94%B7%E5%AD%90%E6%8E%92%E7%90%83%E9%8C%A6%E6%A8%99%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Bulstrad_Arena_in_Rousse.jpg","page_title":"2018年世界男子排球錦標賽","context_page_description":"2018年世界男子排球錦標賽，於2018年9月9日－9月30日在義大利和保加利亞舉行，是世界男排錦標賽首屆由兩個國家共同主辦。其中半決賽和決賽在義大利舉行。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_climbers_and_mountaineers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Edmund_Hillary_by_Kubik_2004.jpg","page_title":"List of climbers and mountaineers","context_page_description":"This list of climbers and mountaineers is a list of people notable for the activities of mountaineering, rock climbing and ice climbing."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B8%D0%BF%D1%96%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Scipione%2C_eva_%28scena_apocalittica%29%2C_1930_%28macerata%2C_palazzo_ricci%29.jpg","page_title":"Шипіоне","context_page_description":"Джино Бонікі, відомий як Шипіоне, — італійський художник, письменник, поет, карикатурист та ілюстратор книг."},{"page_url":"https://de.wikipedia.org/wiki/Immersierte_Mannigfaltigkeit","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Immersedsubmanifold_selfintersection.jpg","page_title":"Immersierte Mannigfaltigkeit","context_page_description":"Eine immersierte Mannigfaltigkeit oder immersierte Untermannigfaltigkeit ist ein Objekt aus dem mathematischen Teilgebiet der Differentialtopologie. Seltener wird dieses Objekt auch immergierte Mannigfaltigkeit genannt, im Englischen spricht man meistens von einer immersed submanifold.\\nHat man eine differenzierbare Abbildung zwischen zwei Mannigfaltigkeiten, so ist das Bild im Allgemeinen keine Untermannigfaltigkeit von. Falls die Ableitung von jedoch injektiv ist, ist eine Mannigfaltigkeit, die aber keine Untermannigfaltigkeit von sein muss. Dieses Objekt wird immersierte Mannigfaltigkeit genannt."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Katarzyny_Aleksandryjskiej_i_%C5%9Bw._Ma%C5%82gorzaty_w_Krakowie","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Church_of_St._Catherine_in_Krak%C3%B3w_01.JPG","page_title":"Kościół św. Katarzyny Aleksandryjskiej i św. Małgorzaty w Krakowie","context_page_description":"Kościół św. Katarzyny Aleksandryjskiej i św. Małgorzaty – kościół rzymskokatolicki wraz z klasztorem oo. Augustianów Eremitów znajdujący się na krakowskim Kazimierzu przy ul. Augustiańskiej 7-9. Konwent augustianów i kościół mieszczą się między ulicami Skałeczną, Augustiańską, Paulińską oraz Skałką.\\nKościół jest jednym z najlepszych przykładów średniowiecznej kamieniarki w Polsce. Smukła i strzelista sylwetka świątyni, różnorodność form i detalu architektonicznego, bogactwo pamiątek średniowiecznych wyróżniają ten zespół w europejskim budownictwie z czasów dojrzałego gotyku."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%AC%E9%83%BD%E7%B8%B1%E8%B2%AB%E8%87%AA%E5%8B%95%E8%BB%8A%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ayabe_Miyazu_Road_in_Maizuru-Oe_2014.JPG","page_title":"京都縱貫自動車道","context_page_description":"京都縱貫自動車道是京都府宮津市至同府乙訓郡大山崎町，長93.5公里的國土交通大臣指定高規格幹線道路。此外，法律上的京都縱貫自動車道包含京滋繞道使用的大山崎系統交流道/交流道～久御山交流道間路段。高速公路路線編號與鳥取豐岡宮津自動車道、山陰自動車道共同被編為 E9。"},{"page_url":"https://sv.wikipedia.org/wiki/Drottning_Christina_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Garbo_-_Queen_Christina.JPG","page_title":"Drottning Christina (film)","context_page_description":"Drottning Christina är en amerikansk film från 1933 i regi av Rouben Mamoulian. Titelrollen spelas av Greta Garbo."},{"page_url":"https://fr.wikipedia.org/wiki/Germigny-des-Pr%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Map_commune_FR_insee_code_45153.png","page_title":"Germigny-des-Prés","context_page_description":"Germigny-des-Prés est une commune française située dans le département du Loiret en région Centre-Val de Loire. Ses habitants s'appellent les Germignons.\\nLa commune est située dans le périmètre du Val de Loire inscrit au patrimoine mondial de l'UNESCO."},{"page_url":"https://fr.wikipedia.org/wiki/Bethl%C3%A9em","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/16-03-31-Bethlehem-Mauer-RalfR-WMA_1109.jpg","page_title":"Bethléem","context_page_description":"Bethléem est une ville située en Cisjordanie à environ 10 km au sud de Jérusalem. Cette ville compte 30 000 habitants, principalement des Palestiniens musulmans. Elle abrite aussi une petite communauté de chrétiens palestiniens, une des plus anciennes communautés chrétiennes au monde. L'agglomération de Bethléem s'étend aux villes de Beit Jala et Beit Sahour.\\nLa ville est un important centre religieux. La tradition juive, qui l'appelle aussi Éphrata, en fait le lieu de naissance et de couronnement de David, roi d'Israël. Elle est considérée par les chrétiens comme le lieu de naissance de Jésus de Nazareth. C'est un lieu de pèlerinage qui génère une activité économique importante à la période de Noël. La ville est également le siège d'un lieu saint du judaïsme, le tombeau de Rachel, situé à l'entrée de la ville.\\nDepuis 1995, aux termes des accords d'Oslo, la ville est théoriquement sous administration de l'Autorité palestinienne, bien que la majeure partie de l'agglomération soit en réalité administrée par Israël."},{"page_url":"https://gl.wikipedia.org/wiki/Celso_Bugallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Celso_Bugallo_%28Crop%29.jpg","page_title":"Celso Bugallo","context_page_description":"Celso Bugallo Aguiar, nado en Vilalonga o 12 de marzo de 1947, é un actor galego."},{"page_url":"https://en.wikipedia.org/wiki/Chakra","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Cosmic_Man_with_Diagrams_of_Newar_Yogic_Six_Chakra_Transformation_LACMA_M.91.118.jpg","page_title":"Chakra","context_page_description":"Chakra are various focal points used in a variety of ancient meditation practices, collectively denominated as Tantra, or the esoteric or inner traditions of Hinduism.\\nThe concept is found in the early traditions of Hinduism. Beliefs differ between the Indian religions, with many Buddhist texts consistently mentioning five chakras, while Hindu sources offer six or even seven. Early Sanskrit texts speak of them both as meditative visualizations combining flowers and mantras and as physical entities in the body. Some modern interpreters speak of them as complexes of electromagnetic variety, the precise degree and variety of which directly arise from a synthetic average of all positive and negative so-called \\"fields\\", thus eventuating the complex Nadi. Within kundalini yoga, the techniques of breath exercises, visualizations, mudras, bandhas, kriyas, and mantras are focused on manipulating the flow of subtle energy through chakras."},{"page_url":"https://en.wikipedia.org/wiki/P._J._Krouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Temple_Beth_Israel_Meridian%2C_Mississippi.jpg","page_title":"P. J. Krouse","context_page_description":"Penn Jeffries Krouse, usually known as P. J. Krouse was a prolific architect in the state of Mississippi. Many of his buildings were located in the Meridian area."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%86%D8%AA%D8%A7%DB%8C%DA%A9%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Mentaiko_Chazuke_%2815442101167%29.jpg","page_title":"منتایکو","context_page_description":"منتایکو اشپل زغال‌ماهی آلاسکا است که در ژاپن، کره و روسیه به عنوان یک ماده غذایی محبوب است."},{"page_url":"https://fr.wikipedia.org/wiki/Tunnels_de_C%E1%BB%A7_Chi","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/VietnamCuChiTunnelstrapopen.jpg","page_title":"Tunnels de Củ Chi","context_page_description":"Les tunnels de Củ Chi sont un immense système de tunnels souterrains situés dans la zone de Củ Chi, un des cinq districts suburbains de Hô-Chi-Minh-Ville au Viêt Nam. Ils sont situés à une quarantaine de kilomètres au Nord-Ouest du centre ville et à 25 km seulement de l'aéroport Tân Sơn Nhất."},{"page_url":"https://fi.wikipedia.org/wiki/Christian_Keller","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Dorint_Charity_Sports_Night_2018-1681.jpg","page_title":"Christian Keller","context_page_description":"Christian Keller on entinen saksalainen uimari, joka edusti kotimaataan kolmissa olympialaisissa, alkaen vuodesta 1992. Vuoden 1996 kesäolympialaisissa Keller voitti pronssia 4x200 metrin vapaauintiviestissä. Aikaisemmin hän oli jo voittanut lyhyellä radalla MM-kultaa 200 metrin sekauinnissa Palma de Mallorcalla 1993, ja EM-kultaa pitkällä radalla 4x200 metrin vapaauintiviestissä Wienissä 1995. Toisen EM-kultansa Keller voitti neljä vuotta myöhemmin samalla matkalla Istanbulissa 1999. Lisäksi hän voitti uransa aikana lukuisia muita mitaleja.\\nKeller voitti 1980-luvun lopulla useita mestaruuksia juniorien EM-kilpailuissa. Hänet valittiin kahdesti Saksan parhaaksi miesuimariksi, vuosina 1994 ja 1995."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BA%D0%BE%D1%9E%D1%87%D1%8B%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Tama%C5%A1_Zan._%D0%A2%D0%B0%D0%BC%D0%B0%D1%88_%D0%97%D0%B0%D0%BD.jpg","page_title":"Какоўчына","context_page_description":"Како́ўчына — вёска ў Сеньненскім раёне Віцебскай вобласьці, разьмешчаная за 56 км на паўднёвы ўсход ад г. Сенна, за 6 км ад чыгуначнай станцыі Смальяны на лініі Ворша — Лепель, за 62 км ад Віцебску. Зьяўляецца цэнтрам Какоўчынскага сельсавету.\\nНа тэрыторыі сучаснай вёскі ў канцы XIX стагодзьдзя месьціўся маёнтак Кахачын, дзе разам зь сям’ёй пражыў апошнія гады свайго жыцьця ўдзельнік вызвольнага руху, дасьледнік прыроды, літаратар, філямат і філярэт Тамаш Зан."},{"page_url":"https://en.wikipedia.org/wiki/Oron-le-Ch%C3%A2tel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Oron_Ch%C3%A2teau_-_2011_-_01.jpg","page_title":"Oron-le-Châtel","context_page_description":"Oron-le-Châtel is a former municipality in the district of Lavaux-Oron in the canton of Vaud in Switzerland. The municipalities of Bussigny-sur-Oron, Châtillens, Chesalles-sur-Oron, Ecoteaux, Oron-la-Ville, Oron-le-Châtel, Palézieux, Les Tavernes, Les Thioleyres and Vuibroye merged on 1 January 2012 into the new municipality of Oron."},{"page_url":"https://es.wikipedia.org/wiki/Kunitachi_(Tokio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Yahoten_shrine.jpg","page_title":"Kunitachi (Tokio)","context_page_description":"Kunitachi es una ciudad que se encuentra al centro de Tokio, Japón.\\nSegún datos del 2010, la ciudad tiene una población estimada de 73.865 habitantes y una densidad de 9.060 personas por km². El área total es de 8,15 km².\\nLa ciudad fue fundada el 1 de enero de 1967, luego de que fuese creada como villa con el nombre de Yaho en 1889 y promovida a pueblo en 1951, tomando el nombre de Kunitachi. Es una de las ciudades que conforma la zona de Tokio Occidental.\\nEs la segunda ciudad más pequeña de Tokio, después de Komae. Su relieve está dominado por la terraza de Musashino. El río Tama recorre el suroeste.\\nSu nombre proviene de la fusión de los primeros caracteres de las localidades de Kokubunji y Tachikawa, que se encuentran a una distancia equidistante de Kunitachi."},{"page_url":"https://la.wikipedia.org/wiki/Robertus_Walser","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Robert_walser_1890er.jpg","page_title":"Robertus Walser","context_page_description":"Robertus Walser fuit scriptor et poeta Helveticus."},{"page_url":"https://hu.wikipedia.org/wiki/Leander_oszt%C3%A1ly_(k%C3%B6nny%C5%B1cirk%C3%A1l%C3%B3k)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/HMS_Ajax.jpg","page_title":"Leander osztály (könnyűcirkálók)","context_page_description":"A Leander könnyűcirkáló osztályba nyolc hajó tartozott, melyeket a Brit Királyi Haditengerészet számára építettek az 1930-as évek elején. Az osztályba tartozó könnyűcirkálók részt vettek a második világháborúban is. A hajók eredetileg mitológiai alakok nevét viselték, de az Amphion-alosztályba tartozó három könnyűcirkáló később az Ausztrál Királyi Haditengerészethez került, ahol átkeresztelték őket és ausztrál városok nevét kapták. A Leander osztály tagjait 1933 és 1936 között állították hadrendbe."},{"page_url":"https://lv.wikipedia.org/wiki/Zelta_kar%C5%ABsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Welon_%28ryba%29.JPG","page_title":"Zelta karūsa","context_page_description":"Zelta karūsa jeb zelta zivtiņa ir karpu dzimtas saldūdens zivs, kas savvaļā sastopama Austrumāzijā: Japānā, Korejā, Ķīnā, Honkongā un Taivānā, sākot ar Amūras upes baseinu un beidzot ar Honas baseinu. Zinātniskais nosaukums Carassius auratus atvasināts no latīņu valodas un latviski nozīmē \\"karūsa\\" un \\"zelts\\", \\"zeltains\\".\\nĶīnā pirms vairāk nekā 1000 gadiem zelta karūsa tika domesticēta un izveidota dekoratīvā zelta zivtiņa, kurai šajā laika periodā izveidotas daudzas atšķirīgas šķirnes. Tās atšķiras gan ar krāsām, gan izmēriem, gan ķermeņa apjomiem un spuru garumiem. Mūdienās abas formas ir plaši izplatītas un izmantotas visā pasaulē: dekoratīvos parku dīķos, dabīgās ūdenstilpēs un akvārijos."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%9C%E6%96%B9%E7%BA%A2_(%E6%AD%8C%E6%9B%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Li_Youyuan.jpg","page_title":"东方红 (歌曲)","context_page_description":"《东方红》，中国著名红色歌曲，曲调源自民歌《芝麻油》，二十世纪三四十年代在陕北地区流行的一首情歌《白马调》使用了这一曲调，并影响了歌曲《东方红》的最初创作。《东方红》的原作者和创作经历存在争议。后来公木等人对其进行了修改，成为如今通行的三段歌词版。现在通行的合唱版是由著名作曲家李焕之编曲。该曲是一首歌颂中国共产党、歌颂毛泽东的革命颂歌。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%82%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/KCON_2015_Sistar_2.jpg","page_title":"Систар","context_page_description":"Систар са момичешка южнокорейска група, активна от 2010 до 2017. Първия им албум „So Cool“ излиза през 2011 година, а следващия „Give It to Me“ през 2013 постигайки успех на родна земя и голяма популярност сред международните кей поп фенове. През годините групата реализира няколко мини албума, които включват хитовете „Alone“, „Touch My Body“ и „Shake It“, утвърждавайки се като една от популярните групи в кей поп. В края на месец май 2017, групата потвърждава последен проект, след който се разделя."},{"page_url":"https://fr.wikipedia.org/wiki/Elio_De_Angelis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Elio_De_Angelis_Silverstone.JPG","page_title":"Elio De Angelis","context_page_description":"Elio De Angelis est un pilote automobile italien né le 26 mars 1958 à Rome en Italie et mort l’après-midi du jeudi 15 mai 1986, à l'hôpital de la Timone à Marseille des suites d'un accident survenu la veille lors d'essais privés sur le circuit Paul-Ricard.\\nIl a notamment disputé 108 Grands Prix de championnat du monde de Formule 1 de 1979 à 1986, inscrit 122 points, signé deux victoires, neuf podiums et trois pole positions."},{"page_url":"https://it.wikipedia.org/wiki/Husby_(Germania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Husby-Wappen.png","page_title":"Husby (Germania)","context_page_description":"Husby è un comune di 2.209 abitanti dello Schleswig-Holstein, in Germania.\\nAppartiene al circondario di Schleswig-Flensburgo ed è parte della comunità amministrativa di Hürup."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%85%88%E9%A9%B1%E8%80%8510%E5%8F%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Pioneer_10_-_p144.jpg","page_title":"先驱者10号","context_page_description":"先驱者10号是NASA在1972年3月2日发射的一艘重258公斤的非载人航天器，用意是为了研究小行星带、木星的周遭环境、太阳风、宇宙射线以及太阳系与太阳圈之中最远能够到达的地方。它是人类史上第一个安然通过火星与木星之间的小行星带，以及第一个拜访木星的航天器。1983年6月13日，它飞越海王星轨道，成为第一个离开八大行星范围的人造物体。当时的速度高达每秒钟近十四公里。2003年1月23日，由于发射功率不足，它在距离地球122.3亿千米处与地球失去联络。\\n先驱者者10号曾是离地球最远的飞行器，这一纪录一直保持到1998年2月17日，那天，旅行者1号与太阳的距离和先驱者10号相同。因为旅行者1号速度的优势，与太阳的距离上超过先驱者10号。\\n和先驱者11号一样，先驱者10号携带一块人类向可能存在的外星人表明我们在银河系位置的镀金铝板。"},{"page_url":"https://en.wikipedia.org/wiki/Khaleda_Zia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Mr_and_Mrs_Zia_1979.jpg","page_title":"Khaleda Zia","context_page_description":"Khaleda Zia is a Bangladeshi politician who served as the Prime Minister of Bangladesh from 1991 to 1996, and again from 2001 to 2006. She was the first woman in the country's history and second in the Muslim majority countries to head a democratic government as prime minister. She was the wife of a former President of Bangladesh Ziaur Rahman. She is the current chairperson and leader of the Bangladesh Nationalist Party which was founded by Rahman in the late 1970s.\\nAfter a military coup in 1982, led by Army Chief General Hussain Muhammad Ershad, Zia helped lead the movement for democracy until the fall of Ershad in 1990. She became the prime minister following the BNP party win in the 1991 general election. She also served briefly in the short-lived government in 1996, when other parties had boycotted the first election. In the next round of general elections of 1996, the Awami League came to power. Her party came to power again in 2001. She has been elected to five separate parliamentary constituencies in the general elections of 1991, 1996 and 2001."},{"page_url":"https://ms.wikipedia.org/wiki/LionsXII","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/LionsXII_supporters_at_a_home_game_-_2013.jpg","page_title":"LionsXII","context_page_description":"LionsXII, juga dikenali sebagai Singapore LIONSXII, merupakan kelab bola sepak Singapura yang dibubarkan berasal dari Kallang, Singapura. Diasaskan pada 2011, mereka bermain untuk Liga Super Malaysia dan banyak menghabiskan sejarah di dalam setara tertinggi di dalam bolasepak Malaysia. Kawasan bermain mereka ialah Stadium Jalan Besar yang mempunyai 8,000 tempat duduk, di mana mereka bermain sepanjang perlawanan sejak penubuhan mereka.\\nDiuruskan oleh Persatuan Bola Sepak Singapura, skuad menandakan kembalinya Singapura ke arena bola sepak Malaysia selepas meninggalkan Piala Malaysia pada tahun 1994. Nama ini adalah gabungan Lions XII dan, yang merupakan satu penghormatan khas untuk peminat, yang secara amnya diiktiraf sebagai \\"Man-12\\" bola sepak. Motto adalah \\"Untuk Negara, Untuk Peminat. Untuk Keghairahan, Untuk Bola Sepak\\"\\nKit rumah LionsXII adalah dalam merah diraja, menggunakan warna-warna bendera kebangsaan. Kit mereka jauh adalah biru, yang direka untuk membangkitkan kenangan jersi yang digunakan pada 1980-an dan lebih awal. Lambang kelab, direka untuk menyerupai cakar singa, menunjukkan singa garang dan agresif yang berpandangan antara garisan berbulu putih."},{"page_url":"https://ceb.wikipedia.org/wiki/Aizu-wakamatsu_Shi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Aizuwakamatsu%2C_Fukushima_Oka.jpg","page_title":"Aizu-wakamatsu Shi","context_page_description":"Distrito ang Aizu-wakamatsu Shi sa Hapon. Nahimutang ni sa prepektura sa Fukushima-ken, sa sentro nga bahin sa nasod, 200 km sa amihanan sa Tokyo ang ulohan sa nasod.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Pebrero, sa -4 °C. Ang kasarangang pag-ulan 1,649 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 245 milimetro nga ulan, ug ang kinaugahan Enero, sa 57 milimetro."},{"page_url":"https://es.wikipedia.org/wiki/Robots_(pel%C3%ADcula)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Greg_Kinnear%2C_Robots_premiere%2C_2005.jpg","page_title":"Robots (película)","context_page_description":"Robots es una película de animación estadounidense de 2005 producida por Blue Sky Studios y distribuida por 20th Century Fox, dirigida por Chris Wedge y Carlos Saldanha, estrenada el 4 de marzo de 2005. Se basa en una historia del escritor de libros para niños William Joyce y cuenta con las voces en su versión original de Ewan McGregor, Halle Berry, Greg Kinnear, Mel Brooks, Amanda Bynes, Drew Carey y Robin Williams. La película recaudó más de 260 millones de dólares con un presupuesto de 75 millones."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9A%E0%B8%B5%E0%B9%80%E0%B8%A7%E0%B8%AD%E0%B8%A3%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/American_beaver_map.png","page_title":"บีเวอร์","context_page_description":"บีเวอร์ เป็นสัตว์กินพืชเลี้ยงลูกด้วยนมจัดเป็นสัตว์ฟันแทะชนิดหนึ่งเช่นเดียวกับหนูยักษ์ พวกมันมีอยู่ด้วยกันสองสายพันธุ์คือ พันธุ์ยูเรเชียน กับพันธุ์อเมริกาเหนือ ถึงแม้จะมีขนาดและรูปร่างหน้าตาที่คล้ายคลึงกัน แต่ทั้งสองสายพันธุ์แยกขาดจากกันตั้งแต่เมื่อ 24,000 ปีที่แล้ว พวกมันจึงไม่สามารถผสมพันธุ์กันเองได้อีก บีเวอร์มีขนาดตัวที่ใหญ่ตัวโตเต็มวัยจะมีขนาดใหญ่พอ ๆ กับเด็กอายุ 8 ขวบ ตัวผู้สามารถมีน้ำหนักได้มากกว่า 25 กิโลกรัมส่วนตัวเมียอาจมีขนาดใหญ่กว่าตัวผู้ในช่วงอายุเท่ากัน นอกจากนี้บีเวอร์มีอายุยืนยาวได้ถึง 24 ปี พวกมันยังมีอีกสายพันธุ์หนึ่งในอดีตคือสายพันธุ์บีเวอร์ยักษ์ ที่สูญพันธุ์ไปเมื่อประมาณ 10,000 ปีก่อน\\nพวกมันส่วนมากอาศัยอยู่ในบริเวณซีกโลกเหนือมีจำนวนประชากรในแถบอเมริกาเหนือมากกว่า 60 ล้านตัว แต่เมื่อปี ค.ศ. 1988 มีจำนวนลดลงเหลือเพียง 6-12 ล้านตัวซึ่งเป็นผลมาจากการล่าสัตว์ที่กว้างขวางเนื่องจากนำมาใช้ทำเป็นยาและน้ำหอมซึ่งสกัดมาจากสารคัดหลั่งในตัวของบีเวอร์ที่เรียกว่าคาสโตเรียน นอกจากนี้ยังมีการใช้ขนของบีเวอร์มาทำเครื่องนุ่งห่มรวมไปถึงการใช้ประโยชน์บริเวณหน้าดินที่พวกมันทำเขื่อนที่ทำให้เกิดระบบนิเวศใหม่ในธรรมชาติขึ้นอีกด้วย"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Wijnegem","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Wijnegem_Turnhoutsebaan_381-385_-_155881_-_onroerenderfgoed.jpg","page_title":"Lijst van onroerend erfgoed in Wijnegem","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Wijnegem. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://en.wikipedia.org/wiki/Toru%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Stare_Miasto%2C_Ratusz_Staromiejski_w_Toruniu.jpg","page_title":"Toruń","context_page_description":"Toruń is a historical city on the Vistula River in north-central Poland, and a UNESCO World Heritage Site. Its population was 201,447 as of December 2019. Previously, it was the capital of the Toruń Voivodeship and the Pomeranian Voivodeship. Since 1999, Toruń has been a seat of the self-government of the Kuyavian-Pomeranian Voivodeship and, as such, is one of its two capitals, together with Bydgoszcz. The cities and neighboring counties form the Bydgoszcz–Toruń twin city metropolitan area.\\nToruń is one of the oldest cities in Poland, with the first settlement dated back to the 8th century and later having been expanded in 1233 by the Teutonic Knights. Over centuries, it was the home for people of diverse backgrounds and religions. From 1264 until 1411 Toruń was part of the Hanseatic League and by the 17th century it was one of the elite trading points, which greatly affected the city's architecture ranging from Brick Gothic to Mannerism and Baroque. In the early-modern age, Toruń was a royal city of Poland and it was one of the four largest cities in the country at the time. After the partitions of Poland it was part of Prussia and later the German Empire."},{"page_url":"https://de.wikipedia.org/wiki/Purkinjezelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Cerebellum_PurkinjeCells.jpg","page_title":"Purkinjezelle","context_page_description":"Purkinjezellen oder Purkyně-Zellen sind die charakteristischen großen multipolaren Nervenzellen mit stark verästeltem Dendritenbaum in der Rinde des Kleinhirns, deren Axone die Efferenzen der Kleinhirnrinde darstellen.\\nAnalog dem Großhirn ist im Kleinhirn ebenfalls eine Rinde ausgebildet, mit nur dreischichtigem Aufbau. In der mittleren Kleinhirnrindenschicht, dem Stratum purkinjense, liegen die Zellkörper von Purkinjezellen. Diese einschichtig im Abstand von 50–100 µm angeordneten Nervenzellen sind mit einem Perikaryon von rund 50–70 µm die größten Zellen im Kleinhirn. Sie zeichnen sich durch einen äußerst verzweigten Dendritenbaum aus, der spalierartig nahezu plan in der äußeren Kleinhirnrindenschicht, dem Stratum moleculare, ausgerichtet ist. Das menschliche Kleinhirn verfügt über etwa 15 Millionen Purkinjezellen mit je einem Axon.\\nAxone der Purkinjezellen, die einzigen Ausgänge der Kleinhirnrinde, projizieren überwiegend auf die Kleinhirnkerne, daneben auf die lateralen Vestibulariskerne. Sie bilden hier jeweils inhibitorische Synapsen und nutzen dafür γ-Aminobuttersäure als Neurotransmitter."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D0%BC%D0%B5%D0%B4%D0%BE%D0%B2_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Principio_di_Archimede_galleggiamento.png","page_title":"Архимедов закон","context_page_description":"Архимедов закон гласи: на свако тело потопљено у течност делује сила потиска која је једнака тежини телом истиснуте течности и делује у смеру нагоре у центру масе истиснуте течности. Другим речима, тело потопљено у течност бива лакше за колико износи тежина истиснуте течности. Ово је основни закон хидростатике. Овај закон је општи и важи за све флуиде, значи и гасове, али је прво откривен код течности.\\nОвај принцип је разлог зашто чамци пливају и ваздушни балони лете. Ако је сила потиска једнака тежини тела, тело је у мировању. Овај закон је формулисао Архимед из Сиракузе."},{"page_url":"https://en.wikipedia.org/wiki/Security_Council_of_Armenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Armen_V._Grigoryan_2.jpg","page_title":"Security Council of Armenia","context_page_description":"The Security Council of Armenia is the highest decision-making defence and law enforcement body in the Republic of Armenia. The offices of the Security Council is located on 24 Marshal Baghramyan Avenue in Yerevan."},{"page_url":"https://de.wikipedia.org/wiki/1316","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/COA_of_Gediminai%C4%8Diai_dynasty_Lithuania.svg","page_title":"1316","context_page_description":"Am 5. Juni stirbt überraschend König Ludwig X. der Zänker im Schloss Vincennes an einer Fiebererkrankung und hinterlässt eine problematische Erbfolge in Frankreich und Navarra. Zum Zeitpunkt seines Todes hinterlässt er seine Tochter Johanna und seine schwangere Ehefrau Klementine von Ungarn. Ludwigs Bruder Philipp übernimmt im Juli die Regentschaft. Damit verdrängt er den dreiköpfigen Regentschaftsrat um seine Onkel Karl von Valois, Ludwig von Évreux und seinen jüngeren Bruder Karl von La Marche, den der König noch vor seinem Tod eingesetzt hat. Gleichzeitig bestreitet er Johannas Erbrecht in Frankreich, während es ihrem Onkel Odo von Burgund gelingt, seine Zustimmung für eine weibliche Erbfolge in Navarra und der Grafschaft Champagne zu erreichen.\\nAm 15. November bringt die Königinwitwe den neuen König Johann I. zur Welt, für den Philipp weiterhin die Regentschaft führen soll, doch der junge König stirbt bereits vier Tage nach seiner Geburt. Philipp trifft daraufhin Vorbereitungen, sich zum König von Frankreich und unter Bruch seiner Abmachung mit Odo auch zum König von Navarra krönen zu lassen."},{"page_url":"https://lt.wikipedia.org/wiki/Teodoro_Ruzvelto_nacionalinis_parkas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Wild_Horses_In_Theodore_Roosevelt_National_Park.jpg","page_title":"Teodoro Ruzvelto nacionalinis parkas","context_page_description":"Teodoro Ruzvelto nacionalinis parkas – JAV, Šiaurės Dakotos valstijoje esantis nacionalinis parkas, sudarantis tris bedlendų dalis. Parkas pavadintas 26-tojo JAV prezidento Teodoro Ruzvelto vardu. Per parką teka Misūrio intakas Mažasis Misūris.\\n2017 m. parką aplankė virš 700 000 lankytojų.\\nT. Ruzveltas čia pirmą kartą apsilankė 1883 m. medžiojant bizonus. Jau pirmos kelionės metu jam labai patiko laukinė gamta ir jis už 14 000 JAV dolerių nusipirko rančą. Vėliau jis pasistatė dar vieną rančą už 35 mylių nuo Medoros miesto. Būsimas prezidentas labai rūpinosi savo rančomis ir medžioklėmis šiose teritorijose.\\nPo prezidento mirties 1919 m. buvo pradėtos galimo nacionalinio parko šiose teritorijose paieškos. Iki 1941 m. buvo pastatyti keliai ir infrastruktūra, naudojama ir iki šiol. 1935 m. teritorija tapo Ruzvelto rekreacijos parku, kuris 1946 m. perėjo į Jungtinių Valstijų Žuvų ir Laukinės gamtos tarnybos rankas. 1947 m. ši teritorija tapo Teodoro Ruzvelto memorialiniu nacionaliniu parku. 1978 m. išplėtus teritoriją parkas tapo Teodoro Ruzvelto nacionaliniu parku."},{"page_url":"https://it.wikipedia.org/wiki/Strade_statali_in_Finlandia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Finland_road_sign_F29-2.svg","page_title":"Strade statali in Finlandia","context_page_description":"Le strade statali in Finlandia, sono le principali vie di comunicazione della rete stradale finlandese, e percorrono lunghi percorsi attraverso più regioni.\\nSecondo il sistema di numerazione delle strade finlandesi, alle strade statali sono riservati i numeri dall'1 a 39, di cui in uso al 2009 sono solo quelli dall'1 al 29. La segnaletica verticale di tali strade è costituita dal numero della strada in bianco su sfondo rosso.\\nStoricamente le principali strade statali partono da Helsinki e Turku, e la loro lunghezza complessiva al 2008 è di 8 569 km.\\nNon esistendo una classificazione separata per le autostrade in Finlandia, le strade statali possono comprendere anche sezioni a più corsie. Nel caso in cui la strada diventi a due corsie con carreggiate separate, il tratto di strada viene identificato con il simbolo verde di autostrada, ma la numerazione resta in rosso. In Finlandia non esistono strade a pedaggio."},{"page_url":"https://sv.wikipedia.org/wiki/J%C3%A1kup_Frederik_%C3%98regaard","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/JF_Oregaard.jpg","page_title":"Jákup Frederik Øregaard","context_page_description":"Jákup Frederik Øregaard, född 29 juni 1906 i Leirvík, död 6 mars 1980 i Norðragøta, var en färöisk politiker och köpman.\\nJákup var Javnaðarflokkurins partiledare mellan åren 1969 och 1972."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A2%85%E5%B7%9E%E5%B8%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Meizhou_Xuegong_2013.10.02_12-06-13.jpg","page_title":"梅州市","context_page_description":"梅州市，簡稱梅，古稱嘉應、程鄉，是中華人民共和國廣東省下轄地級市，位於廣東省東北部，粵閩贛三省交界處。市境西界河源市，南鄰汕尾市、揭陽市、潮州市，東毗福建省漳州市，北接福建省龍巖市、江西省贛州市。地處蓮花山脈北段，韓江中上游丘陵及河谷盆地區，東部為鳳凰山。境內最高峰銅鼓嶂為梅江谷地與韓江谷地之分界。梅江自西南向東北流過市境，於大埔縣三河壩與汀江匯合後稱韓江，並於東南出境。\\n轄梅江區、梅縣區、平遠縣、蕉嶺縣、大埔縣、豐順縣、五華縣，代管興寧市。總面積15864.50平方千米。 2019年末戶籍人口545.85萬人。，市人民政府駐梅江區。梅州是客家人比較集中的聚居地，被譽為「世界客都」，亦是國家歷史文化名城。\\n梅州是原中央蘇區、革命老區，是閩粵贛邊區域性中心城市、全國生態文明建設試驗區、廣東綠色崛起先行區和文化旅遊特色區、沿海經濟開放區，也是海西經濟區的重要成員，享有地方立法權。\\n梅州亦是明清以來客家人衍播四海的主要出發地，旅居港澳台同胞和海外僑胞達700多萬人，是全國重點僑鄉，也是港澳台同胞的重要祖籍地之一，其中台灣500萬客家人中就有180萬祖籍在梅州。 2013年，由聯合國教科文組織設立的中國唯一的移民紀念項目中國移民紀念廣場在梅縣區鬆口鎮落成，世界客僑移民展覽館也正式開館，並於2013年成功舉辦了央視中秋晚會。"},{"page_url":"https://es.wikipedia.org/wiki/Biblioteca_de_la_Junta_General_del_Principado_de_Asturias","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Dep%C3%B3sito_de_Archivo_.jpg","page_title":"Biblioteca de la Junta General del Principado de Asturias","context_page_description":"La Biblioteca de la Junta General del Principado de Asturias es una biblioteca que forma parte de la estructura administrativa de la Junta General del Principado de Asturias. Está integrada en un servicio denominado de Biblioteca, Documentación y Archivo. Entre sus funciones destacan la organización del fondo bibliográfico, del archivo de la Cámara y la compilación documental necesaria para el desarrollo de las competencias legislativas y de control al gobierno propias del parlamento.\\nLa Comunidad Autónoma del Principado de Asturias tuvo estatuto de autonomía propio por la Ley orgánica 7/1981, de 30 de diciembre.​ Según la Ley orgánica el parlamento asturiano recibe la denominación de Junta General del Principado de Asturias. El nombre procede de una histórica institución regional que subsistió desde el final de la Edad Media hasta la organización provincial del Estado hacia 1835, fecha en la que fue sustituida por la Diputación Provincial que, a su vez quedó disuelta cuando el Estatuto de Autonomía creó la Comunidad Autónoma."},{"page_url":"https://ca.wikipedia.org/wiki/Uni%C3%B3_banc%C3%A0ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Frankfurt_Main_Japan_Tower_6240a.jpg","page_title":"Unió bancària","context_page_description":"La unió bancària és un sistema de supervisió i resolució bancàries a escala de la UE, creat amb l'objectiu de trencar la relació entre el risc bancari i el risc sobirà. Aquest sistema es basa en el codi normatiu únic, el Mecanisme Únic de Supervisió i el Mecanisme Únic de Resolució."},{"page_url":"https://eu.wikipedia.org/wiki/Sabin_Arana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Euskeldun_Batzokijaren_egoitza_1894-1895.jpg","page_title":"Sabin Arana","context_page_description":"Sabin Polikarpo Arana Goiri edo —berak idatzi bezala— Arana ta Goiri'taŕ Sabin politikaria, ideologo abertzalea, jeltzalea, idazlea eta euskalaria izan zen.\\n1892. urtean Bizkaya por su Independencia liburua idatzi zuen. Haren pentsamoldearen oinarriak independentismoa, abertzaletasuna, euskaldun arrazaren garbitasuna, katolizismoa eta euskararen garbizalekeria izan ziren eta ideia multzo hori Jaun-goikua eta Lagi-zaŕa leloan laburbildu zuen. Aranak Bizkaiaren independentzia eskatzen zuen, beste gainerako euskal herriekin batera Euzkadi izeneko euskal herritarren konfederazio edo nazio federalean batzeko. Gaur egun aski ospetsua den eta garai hartan Euskal Herriko gizartean asaldura eragin zuen esaldi berritzailea eta apurtzailea honako hau izan zen:\\nEuskal Herriko proiektu nazional hura gauzatzeko asmoz, eusko abertzaletasunari ikur, ideologia, alderdi, aldizkari eta esaera edo lelo multzo bat eman nahi izan zizkion, horien artean Ikurrina, Euzko Alderdi Jeltzalea edota Euzko Abendaren Ereserkija daudelarik.\\nNikolasa Atxika-Allenderekin ezkondu zen eta ez zuten seme-alabarik izan. Gazte hil zen, espetxean preso egondako denboraldian bereganatutako Addisonen gaixotasunak jota."},{"page_url":"https://pt.wikipedia.org/wiki/Gaut%C3%A9guiz_de_Arteaga","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Bizkaia_municipalities_Gautegiz_Arteaga.PNG","page_title":"Gautéguiz de Arteaga","context_page_description":"Gautéguiz de Arteaga ou Gautegiz Arteaga é um município da Espanha na província da Biscaia, comunidade autónoma do País Basco, com 13,57 km² de área. Em 2016 tinha 851 habitantes."},{"page_url":"https://eo.wikipedia.org/wiki/Listo_de_francaj_ministroj_pri_justico","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Fran%C3%A7ois_Mitterrand_1959.JPG","page_title":"Listo de francaj ministroj pri justico","context_page_description":"En Francio, la titolo « ministro pri justico » estis kreita per la leĝo de 1791, kiu nuligas la titolojn \\"Chancelier\\" kaj \\"Garde des sceaux\\", anstataŭitaj per « ministro pri justico, ŝtatsigelila gardisto ».\\nPli detalaj informoj troveblas en artikolo Listo de kancelieroj de Francio.\\nTiu artikolo listigas la ministrojn pri justico en la historio de Francio."},{"page_url":"https://es.wikipedia.org/wiki/Coudehard","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Map_commune_FR_insee_code_61120.png","page_title":"Coudehard","context_page_description":"Coudehard es una población y comuna francesa, situada en la región de Baja Normandía, departamento de Orne, en el distrito de Argentan y cantón de Trun."},{"page_url":"https://it.wikipedia.org/wiki/Alu_(runico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Bracteate_from_Funen%2C_Denmark_%28DR_BR42%29.jpg","page_title":"Alu (runico)","context_page_description":"Alu è un termine germanico raffigurato su numerose iscrizioni runiche trovate in Europa centro-settentrionale, e datate tra il 200 e l'800. La parola, la più comune tra i primi termini runici, appare solitamente da sola o come parte di quella che sembra essere una formula. A volte viene abbreviato, cifrato o scritto con espansioni grammaticali. La sua origine ed il significato sono tuttora discussi, nonostante esista un certo accordo tra gli studiosi sul fatto che rappresenti un amuleto magico, o che sia una metafora dello stesso. L'uso del termine non resistette a lungo in seguito al periodo delle invasioni, probabilmente a causa della cristianizzazione dei Germani."},{"page_url":"https://en.wikipedia.org/wiki/Henk_Weerink","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Henk_Weerink_%281976%29.jpg","page_title":"Henk Weerink","context_page_description":"Hendrik \\"Henk\\" Weerink was a Dutch association football referee. He refereed between 1967 and 1983 for more than 450 matches in national and international matches. He was born in Coevorden, Drenthe.\\nWeerink died on 13 March 2014 in his hometown of Coevorden. He was 77 years old."},{"page_url":"https://en.wikipedia.org/wiki/Soyuz_TMA-12M","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Expedition_39_Launch_%28201403260006HQ%29.jpg","page_title":"Soyuz TMA-12M","context_page_description":"Soyuz TMA-12M was a 2014 flight to the International Space Station. It transported three members of the Expedition 39 crew to the International Space Station. TMA-12M was the 121st flight of a Soyuz spacecraft since the first in 1967 and the 38th Soyuz mission to the ISS.\\nAfter a successful launch on 25 March 2014, docking was scheduled to occur on 26 March via the relatively new six-hour duration orbital trajectory. In the event, one of the orbital burns scheduled to refine the trajectory did not occur as planned, due to an attitude control problem in which the spacecraft was incorrectly oriented. The rendezvous phase was subsequently replanned to the formerly-used two-day trajectory. Accordingly, TMA-12M arrived at the ISS on 27 March. The Soyuz remained docked to the ISS to serve as an emergency escape vehicle until undocking and landing as scheduled on 11 September 2014."},{"page_url":"https://es.wikipedia.org/wiki/Turda","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Turda_jud_Cluj.png","page_title":"Turda","context_page_description":"Turda es una ciudad y municipio de Rumania en la provincia de Cluj, situada a orillas del río Arieș."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BA%D5%A1%D5%BD%D6%80%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Mairie_Jasseron_4.jpg","page_title":"Ժասրոն","context_page_description":"Ժասրոն, կոմունա Ֆրանսիայում, գտնվում է Ռոն-Ալպյան շրջանում։ Մարզը՝ Էն։ Մտնում է Սեյզերյա կանտոնի կազմի մեջ։ Մտնում է Բուրկ ան Բրես շրջանի կազմի մեջ։\\nԿոմունայի INSEE կոդը՝ 01195"},{"page_url":"https://sv.wikipedia.org/wiki/Glavendrupstenen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Glavendrup_stone_01.JPG","page_title":"Glavendrupstenen","context_page_description":"Glavendrupstenen är en 188 cm hög runsten av granit i Glavendrup, Skamby socken och Nordfyns kommun på Fyn i Danmark. Stenen har Danmarks längsta runinskrift och ingår som stävsten i en 60 meter lång skeppssättning."},{"page_url":"https://en.wikipedia.org/wiki/Fang","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Fangs_01_rfc1036.jpg","page_title":"Fang","context_page_description":"A fang is a long, pointed tooth. In mammals, a fang is a modified maxillary tooth, used for biting and tearing flesh. In snakes, it is a specialized tooth that is associated with a venom gland. Spiders also have external fangs, which are part of the chelicerae.\\nFangs are most common in carnivores or omnivores, but some herbivores, such as fruit bats, have them as well. They are generally used to hold or swiftly kill prey, such as in large cats. Omnivorous animals, such as bears, use their fangs when hunting fish or other prey, but they are not needed for consuming fruit. Some apes also have fangs, which they use for threats and fighting. However, the relatively short canines of humans are not considered to be fangs."},{"page_url":"https://es.wikipedia.org/wiki/Stefanello_Bottarga","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Stefanello_Bottarga%2C_grabado_s.XVII.JPG","page_title":"Stefanello Bottarga","context_page_description":"Stefanello Bottarga, ​ más conocido como Botarga, fue un actor, director y escritor teatral italiano de la Commedia dell'arte. Su nombre real era Abagaro Francesco Baldi, contemporáneo en España de Zan Ganassa y autor de un «zibaldone» conservado en la Biblioteca de Palacio, de Madrid, con guiones y situaciones escénicas protagonizadas por el personaje \\"Bottarga\\".​"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%88%D9%82_%DA%AF%D8%B1%D9%85%D8%A7%DB%8C%D8%B4_(%D8%A7%D9%84%DA%A9%D8%AA%D8%B1%DB%8C%DA%A9%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Crossed_wires.JPG","page_title":"فوق گرمایش (الکتریکی)","context_page_description":"فوق گرمایش پدیده افزایش دما در یک مدار الکتریکی است. فوق گرمایش باعث آسیب به اجزای مدار می‌شود و می‌تواند باعث آتش سوزی، انفجار و آسیب شود. خسارت ناشی از فوق گرمایش معمولاً غیر قابل برگشت است. تنها راه تعمیر آن جایگزینی برخی از قطعات است."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BB%D1%8C%D0%BC%D0%B0%D0%BD_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%86%D1%81%D0%B0%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Golden_Mask_Award_for_Outstanding_Contribution_to_Theatre_Arts_2019_13.jpg","page_title":"Гельман Олександр Ісаакович","context_page_description":"Олександр Ісаакович Гельман — російський драматург, сценарист, публіцист, громадський і політичний діяч.\\nУ 1966 приїхав до Ленінграда. З 1967 по 1971 працював кореспондентом ленінградських газет «Зміна» та «Будівельний робітник».\\nУ 1989 був обраний народним депутатом Верховної Ради СРСР, входив до Міжрегіональну депутатську групу з незалежних демократів. У 1993 році підписав «Лист 42-х» автори якого зажадали від уряду президента Єльцина заборонити «всі види комуністичних і націоналістичних партій, фронтів та об'єднань». Входив до складу Конституційної наради, яка розробляла проект нині діючої Конституції РФ.\\nУ березні 2014 року підписав лист російського «Союзу кінематографістів і професійних кінематографічних організацій та об'єднань», що засуджує російську військову інтервенцію в Україну. У травні 2018 приєднався до заяви російських літераторів на захист українського режисера Олега Сенцова, незаконно засудженого у РФ."},{"page_url":"https://en.wikipedia.org/wiki/Pulmonary_artery_catheter","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Pulmonary_artery_catheter_english.JPG","page_title":"Pulmonary artery catheter","context_page_description":"Pulmonary artery catheterization, or right heart catheterization, is the insertion of a catheter into a pulmonary artery. Its purpose is diagnostic; it is used to detect heart failure or sepsis, monitor therapy, and evaluate the effects of drugs. The pulmonary artery catheter allows direct, simultaneous measurement of pressures in the right atrium, right ventricle, pulmonary artery, and the filling pressure of the left atrium. The pulmonary artery catheter is frequently referred to as a Swan-Ganz catheter, in honor of its inventors Jeremy Swan and William Ganz, from Cedars-Sinai Medical Center."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%A4%E1%83%A0%E1%83%90%E1%83%9C%E1%83%92%E1%83%94%E1%83%97%E1%83%98%E1%83%A8_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%96%E1%83%98%E1%83%93%E1%83%94%E1%83%9C%E1%83%A2%E1%83%94%E1%83%A4%E1%83%98%E1%83%A8_%E1%83%94%E1%83%A0%E1%83%99%E1%83%94%E1%83%91%E1%83%A3%E1%83%9A%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Patrice_de_Mac_Mahon.jpg","page_title":"საფრანგეთიშ პრეზიდენტეფიშ ერკებული","context_page_description":"საფრანგეთიშ პრეზიდენტეფიშ ერკებული"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%DB%8C%D8%B1%D8%AF%D8%B1%DB%8C%D8%A7%DB%8C%DB%8C_%DA%A9%D9%84%D8%A7%D8%B3_%D8%B3%DB%8C%E2%80%8C%D9%88%D9%84%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Defense.gov_News_Photo_960703-N-00000-001.jpg","page_title":"زیردریایی کلاس سی‌ولف","context_page_description":"زیردریایی کلاس سی‌ولف یک کلاس از زیردریایی است که طول آن ۳۵۳ ft می‌باشد."},{"page_url":"https://fr.wikipedia.org/wiki/Calvinisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Lettre_de_bapt%C3%AAme_calviniste-1698.jpg","page_title":"Calvinisme","context_page_description":"Le calvinisme est une doctrine théologique protestante et une approche de la vie chrétienne qui reposent sur le principe de la souveraineté de Dieu en toutes choses. Bien qu’elle ait été développée par plusieurs théologiens tels que Martin Bucer, Wolfgang Musculus, Heinrich Bullinger, Pierre Martyr Vermigli, Ulrich Zwingli et Théodore de Bèze, elle porte le nom du réformateur français Jean Calvin en raison de l’influence dominante qu’il a sur elle et du rôle déterminant qu’il exerce dans les débats confessionnels et ecclésiastiques du XVIᵉ siècle. Aujourd’hui ce terme fait référence aux doctrines et aux pratiques des Églises réformées, presbytériennes et congrégationalistes. Plus rarement, il désigne l’enseignement de Calvin lui-même. Le calvinisme est aussi connu pour les doctrines de la prédestination et de la corruption totale."},{"page_url":"https://it.wikipedia.org/wiki/Penisola_di_Coromandel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Coromandel_Peninsula.jpg","page_title":"Penisola di Coromandel","context_page_description":"La penisola di Coromandel è una penisola montagnosa protesa per 85 chilometri nell'oceano Pacifico situata nel nord-ovest dell'Isola del Nord della Nuova Zelanda. La penisola, con i suoi quasi 40 chilometri di larghezza, divide la Baia dell'Abbondanza dal Firth of Thames, parte del più esteso Golfo di Hauraki. Distante soli 55 chilometri da Auckland, la principale città neozelandese, la penisola di Coromandel fa parte del distretto di Thames-Coromandel nella regione di Waikato. I principali centri della penisola sono le cittadine di Thames, nel sud-ovest, e di Whitianga, a nord-est."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BD%D1%82%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D1%80%D0%B3%D1%83%D0%BC%D0%B5%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/David_Hume.jpg","page_title":"Онтологический аргумент","context_page_description":"Онтологи́ческий аргуме́нт, или Онтологическое доказательство бытия Бога, — одна из категорий аргументов, относящихся к вопросу существования Бога, появившаяся в христианской теологии. Не существует точных критериев для классификации онтологических аргументов, но аргументы типично начинаются с определения Бога, а заканчиваются подведением итогов о необходимости его существования, используя главным образом причины априори и эмпирические наблюдения.\\nОбщепризнано, что первый онтологический аргумент был предложен Ансельмом Кентерберийским в 1078 в его Прослогионе. Ансельм описал Бога, как «нечто, лучше которого ничего нельзя вообразить», аргументируя это тем, что оно существует в нашем разуме. Он предположил, что, если более идеальное существо могло бы существовать в нашем разуме, то оно также должно существовать и в реальности. Если оно присутствует в нашем разуме, то лучшее существо, возможно, одно из тех, что существует в сознании и реальности. Французский философ 17 века Рене Декарт выдвинул аналогичные аргументы."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E5%B1%B1%E7%94%B0%E9%A7%85_(%E5%A4%A7%E5%88%86%E7%9C%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Kyushu_Railway_-_Kita-Yamada_Station_-_01.JPG","page_title":"北山田駅 (大分県)","context_page_description":"北山田駅は、大分県玖珠郡玖珠町大字戸畑にある、九州旅客鉄道久大本線の駅である。"},{"page_url":"https://en.wikipedia.org/wiki/Ceracris","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Colorful_Little_%2857355049%29.jpg","page_title":"Ceracris","context_page_description":"Ceracris is a genus of grasshoppers in the family Acrididae, subfamily Oedipodinae, found in tropical Asia. C. kiangsu is the yellow-spined bamboo locust which infests Indo-China and southern China."},{"page_url":"https://ro.wikipedia.org/wiki/Parcul_Tivoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Tivoli_Gardens_birds_view.JPG","page_title":"Parcul Tivoli","context_page_description":"Parcul Tivoli este un parc de distracții din centrul capitalei Danemarcei, Copenhaga.\\nParcul Tivoli a fost construit în anul 1843, de Georg Carstensen. Proprietarul acestui loc de distracții a primit aprobarea de a pune bazele acestui parc de la regele Danemarcei Christian al VIII-lea în anul 1841. Construcția parcului a început pe data de 1 mai 1843. Chiar de la deschiderea sa, la 15 august 1843, parcul a avut un succes deosebit, cu un număr de 175.000 de vizitatori în sezonul de deschidere. Unul din renumiții vizitatori de atunci a fost chiar bine cunoscutul scriitor de povești Hans Christian Andersen, care a fost plăcut impresionat de acest loc de distracții.\\nTivoli are în componența sa și o sală de concerte."},{"page_url":"https://es.wikipedia.org/wiki/Johann_Sebastian_Bach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/BWV1001-cropped.jpg","page_title":"Johann Sebastian Bach","context_page_description":"Johann Sebastian Bach fue un compositor, organista, clavecinista, violinista, violagambista, maestro de capilla y cantor alemán del período barroco.\\nFue el miembro más importante de una de las familias de músicos más destacadas de la historia, con más de 35 compositores famosos. Tuvo una gran fama como organista y clavecinista en toda Europa por su gran técnica y capacidad de improvisar música al teclado. Además del órgano y del clavecín, tocaba el violín y la viola da gamba.\\nSu fecunda obra es considerada la cumbre de la música barroca; destaca en ella su profundidad intelectual, su perfección técnica y su belleza artística, además de la síntesis de los diversos estilos nacionales de su época y del pasado. Bach es considerado el último gran maestro del arte del contrapunto​ y fuente de inspiración e influencia para posteriores compositores y músicos, tales como como Joseph Haydn, Wolfgang Amadeus Mozart, Ludwig van Beethoven, Felix Mendelssohn, Robert Schumann y Frédéric Chopin, entre muchos otros."},{"page_url":"https://it.wikipedia.org/wiki/Kelly_Ripa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Kelly_Ripa_by_Keith_Wills_cropped.jpg","page_title":"Kelly Ripa","context_page_description":"Kelly Maria Ripa è un'attrice, doppiatrice, conduttrice televisiva e produttrice cinematografica statunitense."},{"page_url":"https://en.wikipedia.org/wiki/Nazif_Cungu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Nazif_Cungu.jpg","page_title":"Nazif Cungu","context_page_description":"Nazif Cungu is a Montenegrin-Albanian politician, the leader of the biggest Albanian political party in Montenegro FORCA."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%95%E0%A6%AC%E0%A7%87%E0%A6%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Banquo.jpg","page_title":"ম্যাকবেথ","context_page_description":"ম্যাকবেথ হল উইলিয়াম শেকসপিয়র কর্তৃক রচিত একটি ট্র্যাজেডি। অনুমিত হয়, ১৬০৬ সালে এই নাটকটি প্রথম মঞ্চায়িত হয়েছিল। যাঁরা নিজেদের স্বার্থে ক্ষমতা কেড়ে নিতে চান, তাদের উপর রাজনৈতিক উচ্চাকাঙ্ক্ষার বাস্তব ও মানসিক প্রভাব এই নাটকে দৃশ্যায়িত হয়েছে। ইংল্যান্ডের রাজা প্রথম জেমস ছিলেন শেকসপিয়রের নাট্য কোম্পানির পৃষ্ঠপোষক। তাঁর রাজত্বকালে শেকসপিয়র যে নাটকগুলি রচনা করেছিলেন, সেগুলির মধ্যে ম্যাকবেথ নাটকটিতেই নাট্যকারের সঙ্গে তার পৃষ্ঠপোষকের সম্পর্ক সবচেয়ে স্পষ্টভাবে প্রতিফলিত হয়েছিল। নাটকটি প্রথম প্রকাশিত হয়েছিল ১৬২৩ সালের ফোলিও সংস্করণে। সম্ভবত একটি প্রম্পট বই থেকে এই সংস্করণের পাঠটি গৃহীত হয়েছিল। ম্যাকবেথ নাটকটিই শেকসপিয়রের সংক্ষিপ্ততম ট্র্যাজেডি।\\nস্কটল্যান্ডের দুঃসাহসী সেনাপ্রধান ম্যাকবেথ তিন ডাইনির ভবিষ্যৎবাণী থেকে জানতে পারেন যে, একদিন তিনি স্কটল্যান্ডের রাজা হবেন। উচ্চাকাঙ্ক্ষার দ্বারা প্রলুব্ধ এবং নিজের স্ত্রীর কৃতকর্মের দ্বারা তাড়িত হয়ে ম্যাকবেথ রাজা ডানকানকে হত্যা করেন এবং স্কটল্যান্ডের সিংহাসন অধিকার করে বসেন। কিন্তু তারপরই অপরাধবোধ-প্রসূত এক মানসিক বিকৃতির বশে শত্রুতা ও সন্দেহের হাত থেকে নিজেকে রক্ষে করতে একের পর এক খুন করতে বাধ্য হন তিনি। সেই সঙ্গে ম্যাকবেথ হয়ে ওঠেন এক স্বৈরাচারী শাসক।"},{"page_url":"https://en.wikipedia.org/wiki/Shahi_Hammam","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/It_contains_the_world%27s_largest_Mughal_fresco_painting.jpg","page_title":"Shahi Hammam","context_page_description":"The Shahi Hammam, also known as the Wazir Khan Hammam, is a Persian-style bath which was built in Lahore, Pakistan, in 1635 C.E. during the reign of Emperor Shah Jahan. It was built by chief physician to the Mughal Court, Ilam-ud-din Ansari, who was widely known as Wazir Khan. The baths were built to serve as a waqf, or endowment, for the maintenance of the Wazir Khan Mosque.\\nNo longer used as a hammam, the baths were restored between 2013 and 2015 by the Aga Khan Trust for Culture and the Walled City of Lahore Authority, with much of the funding provided by the government of Norway. The restoration project was given an Award of Merit by UNESCO in 2016 for the hammam's successful conservation which returned it to its \\"former prominence.\\""},{"page_url":"https://en.wikipedia.org/wiki/Rajiv_Chowk_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Rajiv_Chowk_metro_station.jpg","page_title":"Rajiv Chowk metro station","context_page_description":"The 'Connaught Place is a Delhi Metro station in Delhi, on the Blue and Yellow Lines. It is a transfer station between the Blue Line on the upper level and the Yellow Line on the lower level.\\nIt is one of the busiest stations on the network, serving Connaught Place in the heart of Delhi. It handles 5 lakh passengers every day. Commaught Place metro station has area of about 39,503 square feet.\\nMany businesses and important buildings, restaurants, and cinemas are situated just outside the station. The station is constructed below Central Park.\\nConnaught Place is officially known as Connaught Place, formerly known as Connaught Circus. In September 1995, the Home Ministry decreed that henceforth, the 75-year-old Connaught Place will be known as Rajiv Chowk and Connaught Circus as Indira Chowk."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B0%D0%BD%D0%B5%D1%86,_%D0%99%D0%BE%D0%B7%D0%B5%D1%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Schnelle_Division_1941_1942.jpg","page_title":"Туранец, Йозеф","context_page_description":"Йозеф Туранец — словацкий военный деятель периода марионеточного правительства Йозефа Тисо.\\nУчился в гимназии в Ружомберке, проучился 8 семестров на юридическом факультете в Братиславе, в 1920 году закончил военные курсы. В 1919—1939 годах — в армии Чехословакии, с 1939 года — в армии Первой Словацкой республики. Командовал «Быстрой дивизией», воевавшей на территории СССР. С января — командующий войсками в Банской Быстрице, участвовал в подавлении Словацкого народного восстания, с 25 августа 1944 года — главнокомандующий словацкой армии. 29 августа 1944 года взят в плен на аэродроме Три Дуба и вместе с Чатлошем перевезен в СССР. Возвращён в Чехословакию в 1947 году, осуждён народным судом к 30 годам заключения. Умер в тюрьме."},{"page_url":"https://it.wikipedia.org/wiki/Auggen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Auggen_2004.jpg","page_title":"Auggen","context_page_description":"Auggen è un comune tedesco di 2.457 abitanti, situato nel land del Baden-Württemberg."},{"page_url":"https://en.wikipedia.org/wiki/1973_ICF_Canoe_Sprint_World_Championships","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Paddling-1973.jpg","page_title":"1973 ICF Canoe Sprint World Championships","context_page_description":"The 1973 ICF Canoe Sprint World Championships were held in Tampere, Finland.\\nThe men's competition consisted of six Canadian and nine kayak events. Three events were held for the women, all in kayak.\\nThis was the tenth championships in canoe sprint."},{"page_url":"https://en.wikipedia.org/wiki/Songrim_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/DPRK-Songrim_Line.png","page_title":"Songrim Line","context_page_description":"The Songrim Line is a partially electrified standard-gauge secondary line of the Korean State Railway in South Hwanghae Province, North Korea, running from Hwangju on the P'yŏngbu Line to Songrim.\\nThe line continues past Songrim Ch'ŏngnyŏn Station to the freight-only Songrim Hwamul Station and the Hwanghae Iron & Steel Complex."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Seitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Chris_Seitz_catch.jpg","page_title":"Chris Seitz","context_page_description":"Christopher \\"Chris\\" Seitz is an American soccer player who currently plays for D.C. United in Major League Soccer."},{"page_url":"https://it.wikipedia.org/wiki/Monte_Tavagnone","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/SentieroperTavagnone2.jpg","page_title":"Monte Tavagnone","context_page_description":"Il monte Tavagnone è una montagna delle Prealpi Bresciane e Gardesane appartenente al gruppo del Tombea-Manos e con la sua cima del Dos di Sas, raggiunge i 1.010 m.s.l.m..\\nSituato nel territorio comunale di Valvestino fa parte del Parco Alto Garda Bresciano. Il luogo è stato fino agli anni settanta del secolo scorso, prima dell'abbandono dell'agricoltura di montagna degli ultimi contadini, una zona d'alpeggio e coltivazione del foraggio, un'area dedicata alla produzione del formaggio e si può considerare il più appartato della Val Vestino."},{"page_url":"https://fr.wikipedia.org/wiki/Chemins_de_fer_rh%C3%A9tiques","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/RhB11.jpg","page_title":"Chemins de fer rhétiques","context_page_description":"Les Chemins de fer rhétiques, parfois désignés par le sigle RhB, sont une entreprise ferroviaire de Suisse, basée à Coire dans le canton des Grisons.\\nLes RhB exploitent un réseau à voie métrique de 384 km qui s'étend entre les principaux centres urbains et touristiques du canton. C'est le troisième réseau de Suisse par sa longueur, après celui des Chemins de fer fédéraux et du Chemin de fer du Lötschberg.\\nLe réseau ferroviaire des RhB est connu pour la beauté des paysages que ses trains traversent. Il joue également le rôle de chemin de fer touristique. C'est dans ce cadre que les lignes de l'Albula et de la Bernina ont été inscrites au patrimoine mondial de l'UNESCO depuis juillet 2008.\\nEn 2007, les RhB employaient 1 378 personnes et avaient des revenus de 300,108 millions de francs suisses pour un bénéfice de 16,148 millions.\\nEn 2010, les RhB ont investi 320 millions et terminent avec un léger déficit de 75 000 frs. Les investissements pour les infrastructures se sont élevés à 210 millions de francs.\\nEn 2008, l'entreprise a transporté :\\n10 654 000 passagers ;\\n436 000 automobiles par train d'automobiles accompagnées ;\\n813 000 tonnes de marchandises."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%B9%D8%A9_%D9%85%D8%B1%D9%8A%D8%A7%D9%86%D8%BA%D8%B3%D8%AC%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Muryangsujeon2.jpg","page_title":"قاعة مريانغسجون","context_page_description":"قاعة مرياغنسجون في معبد بسوكسا هي الكنز الوطني لكوريا الجنوبية رقم 18."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CF%8E%CF%83%CE%BF%CE%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/RedSquare_SaintBasile_%28pixinn.net%29.jpg","page_title":"Ρώσοι","context_page_description":"Η ονομασία Ρώσοι έχει διπλή σημασία, εθνική και πολιτική. Οι Ρώσοι είναι ένας σλαβικός λαός με κοιτίδα την Ανατολική Ευρώπη. Μιλούν τη ρωσική, που ανήκει στις ινδοευρωπαϊκές γλώσσες. Η πλειοψηφία τους είναι χριστιανοί ορθόδοξοι ή άθεοι. Οι περισσότεροι ζουν στη Ρωσία, ενώ αξιοσημείωτες μειονότητες υπάρχουν σε άλλα πρώην Σοβιετικά κράτη όπως η Λευκορωσία, το Καζακστάν, η Ουκρανία και τα Βαλτικά κράτη. Μια μεγάλη Ρωσική διασπορά υπάρχει επίσης σε όλο τον κόσμο, με αξιόλογους αριθμούς στις Ηνωμένες Πολιτείες, τη Γερμανία, το Ισραήλ και τον Καναδά. Οι Ρώσοι είναι η πολυπληθέστερη εθνική ομάδα στην Ευρώπη.\\nΟι Ρώσοι μοιράζονται πολλά πολιτιστικά χαρακτηριστικά με τους υπόλοιπους Ανατολικούς Σλαβικούς, συγκεκριμένα τους Λευκορώσους και τους Ουκρανούς, καθώς και με τους Ανατολικούς νότιους Σλάβους όπως τους Βούλγαρους, τους Σλαβομακεδόνες, τους Μαυροβούνιους και τους Σέρβους. Είναι κατά κύριο λόγο ορθόδοξοι χριστιανοί στη θρησκεία. Η ρωσική γλώσσα είναι επίσημη στη Ρωσία, τη Λευκορωσία, το Καζακστάν, το Κιργιζιστάν και το Τατζικιστάν, και ομιλείται επίσης ως δευτερεύουσα γλώσσα σε πολλά πρώην σοβιετικά κράτη."},{"page_url":"https://en.wikipedia.org/wiki/RAAF_Base_Townsville","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/7_Sqn_%28AWM_NEA0032%29.jpg","page_title":"RAAF Base Townsville","context_page_description":"RAAF Base Townsville is a Royal Australian Air Force air base located in Garbutt, 2 nautical miles west of Townsville in Queensland, Australia. It is the headquarters for No. 1 Wing Australian Air Force Cadets and, along with Lavarack Barracks, establishes Townsville as a key military centre. The base's airfield is shared with the Townsville Airport."},{"page_url":"https://de.wikipedia.org/wiki/Kartenausrichtung","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Kabold_castle_cum_north_arrow.jpg","page_title":"Kartenausrichtung","context_page_description":"Die Kartenausrichtung beschreibt, welche Richtung „oben“ auf der geografischen Karte ist. Moderne Karten sind meist nach Norden ausgerichtet. Erkennbar ist die Ausrichtung an einem Nordpfeil oder einer Kompassrose. Die Beschriftung von Orten erfolgt unabhängig von der Kartenausrichtung meist waagrecht. Die Beschriftung von Straßen, Flüssen oder Bergrücken folgt deren Verlauf. Die Bezeichnung der Kartenausrichtung erfolgt meistens in Englisch."},{"page_url":"https://en.wikipedia.org/wiki/French_franc","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Twenty_franc_banknote_claude_debussy-back.jpg","page_title":"French franc","context_page_description":"The franc, also commonly distinguished as the French franc, was a currency of France. Between 1360 and 1641, it was the name of coins worth 1 livre tournois and it remained in common parlance as a term for this amount of money. It was reintroduced in 1795. After two centuries of inflation, it was revalued in 1960, with each new franc being worth 100 old francs. The NF designation was continued for a few years before the currency returned to being simply the franc; some mostly older French continued to reference and value items in terms of the old franc until the introduction of the euro in 1999 and 2002. The French franc was a commonly held international reserve currency of reference in the 19th and 20th centuries."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%B5%D1%81%D0%BA%D1%96%D0%BD%D0%B4%D0%B5%D0%BC%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Isleworthml.JPG","page_title":"Кескіндеме","context_page_description":"Кескіндеме, кескіндеу өнері — бейнелеу өнерінің бір саласы, белгілі бір заттың бетіне бояу арқылы салынатын көркем шығармалар атауы.\\nКескіндеме заттың сыр-сипатын, нәрсе мен кеңістіктің қарым-қатынасын, сәуле мен көлеңкенің құлпырымын үндестіре бейнелейтін көркемдік және танымдық қуатымен ерекшеленеді. Ол көрерменнің сезіміне, ойына әсер ету арқылы эстетикалық ләззат береді. Кескіндеме туындылары жеке бір тұлғаны, дара көріністі бейнелеп қана қоймай, күрделі сюжетке, оқиғаларға құрылған шытырман соқтығыстарды да бейнелеп, олардың мәнін ашады. Кескіндеме дәуірдің рухани мазмұны мен әлеуметтік дамуын бейнелеп қана қоймай, көрерменнің сезіміне, ойына әсер ету арқылы бейнеленген шындықтан тәлім алып, өзінше қорытынды жасауына себепкер болады. Сондықтан да Кескіндеменің қоғамдық-тәрбиелік мәні зор және ол деректемелік мағлұматта береді.\\nКескіндеменің пайдаланатын құралы - сәуле, бояу, рең. Сәулені бояу реңдерімен нәзік астастыру арқылы өмір құбылыстарының айқын да шынайы көріністері жасалады. Суретші шеберлігінің көрінер жері де осында."},{"page_url":"https://en.wikipedia.org/wiki/Oughtmama","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Pasture_alongside_Corker_Pass_road_-_Oughtmama_Townland_-_geograph.org.uk_-_1312977.jpg","page_title":"Oughtmama","context_page_description":"Oughtmama is a civil parish in County Clare. It lies in the Burren, a region in the northwest of the county. It contains many antiquities, including three early-medieval Christian churches, ruined castles, prehistoric cairns and ring forts and two Martello Towers built in the early 19th century."},{"page_url":"https://az.wikipedia.org/wiki/%C6%8Fn_h%C3%BCnd%C3%BCr_binalar%C4%B1n_siyah%C4%B1s%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/The_Pinnacle_%28Guangzhou%2C_China%29_indexxrus.JPG","page_title":"Ən hündür binaların siyahısı","context_page_description":"Ən hündür binaların siyahısına hündürlüyü 300 metr və daha artıq olan göydələnlər daxil edilmişdir."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%90%E1%83%A1%E1%83%98%E1%83%90%E1%83%9C%E1%83%98_(%E1%83%9D%E1%83%A1%E1%83%94%E1%83%97%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Map_of_Georgia_by_Prince_Vakhushti_Bagrationi.41.jpg","page_title":"ბასიანი (ოსეთი)","context_page_description":"ბასიანი — ვახუშტი ბატონიშვილის „საქართველოს გეოგრაფიული“ აღწერის მიხედვით ოსეთის უკიდურესი ხეობა, რომელიც მდებარეობდა ჩრდილო კავკასიაში მდინარე თერგის ერთ ერთ ხეობაში."},{"page_url":"https://sk.wikipedia.org/wiki/Bourg-Saint-Bernard","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Map_commune_FR_insee_code_31082.png","page_title":"Bourg-Saint-Bernard","context_page_description":"Bourg-Saint-Bernard je francúzska obec, ktorá sa nachádza v departemente Haute-Garonne, v regióne Midi-Pyrénées."},{"page_url":"https://fr.wikipedia.org/wiki/Statue_du_Colleone","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bartolomeo_Colleoni_by_Andrea_del_Verrocchio.jpg","page_title":"Statue du Colleone","context_page_description":"La Statue du Colleone est une statue équestre en bronze représentant le condottiere Bartolomeo Colleoni. Elle se dresse sur le campo dei Santi Giovanni e Paolo à Venise, face à la basilique de San Zanipolo. Elle est l’œuvre du sculpteur florentin Andrea Del Verrochio qui y travailla de 1483 à 1488, et d'Alessandro Leopardi, qui l'a fondue après son décès."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Giovannino_degli_Scolopi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Scolopi%2C_altare_dx_04_Sant%27Ignazio_di_Lojola_di_Antonio_Puglieschi.JPG","page_title":"Chiesa di San Giovannino degli Scolopi","context_page_description":"La chiesa di San Giovannino degli Scolopi è un luogo di culto cattolico che si trova nel centro storico di Firenze, in via de' Martelli all'angolo con via Gori."},{"page_url":"https://en.wikipedia.org/wiki/Air_India","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Air_India_2.jpg","page_title":"Air India","context_page_description":"Air India is the flag carrier airline of India, headquartered at New Delhi. It is owned by Air India Limited, a government-owned enterprise, and operates a fleet of Airbus and Boeing aircraft serving 102 domestic and international destinations. The airline has its hub at Indira Gandhi International Airport, New Delhi, alongside several focus cities across India. Air India is the largest international carrier out of India with an 18.6% market share. Over 60 international destinations are served by Air India across four continents. The airline became the 27th member of Star Alliance on 11 July 2014.\\nThe airline was founded by J. R. D. Tata as Tata Airlines in 1932; Tata himself flew its first single-engine de Havilland Puss Moth, carrying air mail from Karachi's Drigh Road Aerodrome to Bombay's Juhu aerodrome and later continuing to Madras. After World War II, it became a public limited company and was renamed as Air India. On 21 February 1960, it took delivery of its first Boeing 707 named Gauri Shankar and became the first Asian airline to induct a jet aircraft in its fleet."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D0%BB%D0%B5%D1%80%D1%88%D1%82%D0%B0%D0%B9%D0%BD_(%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D1%96%D1%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Wallerstein.jpg","page_title":"Валлерштайн (Баварія)","context_page_description":"Валлерштайн — громада в Німеччині, знаходиться в землі Баварія. Підпорядковується адміністративному округу Швабія. Входить до складу району Донау-Ріс. Центр об'єднання громад Валлерштайн.\\nПлоща — 19,45 км². Населення становить 3387 ос."},{"page_url":"https://de.wikipedia.org/wiki/Apollinariskirche_(Remagen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Apollinariskirche_Remagen_-_Krypta_%282008-07-21%29.JPG","page_title":"Apollinariskirche (Remagen)","context_page_description":"Die Apollinariskirche liegt oberhalb der Stadt Remagen etwa 40 m über dem Rhein auf einer Anhöhe, die heute Apollinarisberg heißt. Die heutige Kirche wurde um die Mitte des 19. Jahrhunderts im neugotischen Stil erbaut und im Nazarenerstil ausgemalt. Am Fuß des Berges wurden 1892 christliche Gräber aus der Römerzeit entdeckt. Seit dem frühen Mittelalter waren Benediktiner auf dem Apollinarisberg ansässig."},{"page_url":"https://en.wikipedia.org/wiki/Ie_Ch%C5%8Dchoku","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ie_Ch%C5%8Dchoku.PNG","page_title":"Ie Chōchoku","context_page_description":"Ie Wōji Chōchoku, also known by the Chinese-style name Shō Ken, was a prince of Ryukyu Kingdom. Sometimes he was called Prince Ie for short.\\nPrince Ie was the fifth son of King Shō Kō. He served as sessei from 1872 to 1875. After Ryukyu was annexed by Japan in 1879, Prince Ie was incorporated into the newly established kazoku peerage; and in 1890, he was granted the title of baron."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F_(1943%E2%80%941945)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/1944-07-01GerWW2BattlefrontAtlas.jpg","page_title":"Итальянская кампания (1943—1945)","context_page_description":"Итальянская кампания (1943—1945) — военные действия вооружённых сил США, Великобритании и их союзников против войск Германии и Италии во время Второй мировой войны с целью разгрома и вывода Италии из войны и захвата её территории. Кампания началась в июле 1943 года, со вторжения на Сицилию, концом военных действий считается капитуляция немецких войск в северной Италии в мае 1945 года.\\nОбщие потери союзных войск в кампании составили порядка 320 000 человек, у стран «Оси» — около 658 000 человек. Никакая другая кампания в Западной Европе не стоила воюющим сторонам дороже Итальянской кампании, по количеству погибших и раненых солдат."},{"page_url":"https://hu.wikipedia.org/wiki/Boulaincourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Population_-_Municipality_code_88066.svg","page_title":"Boulaincourt","context_page_description":"Boulaincourt település Franciaországban, Vosges megyében. Boulaincourt Bouzanville, Forcelles-sous-Gugney, Fraisnes-en-Saintois és Frenelle-la-Grande községekkel határos."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%A0%D7%92%D7%94%D7%9E%D7%98%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Binghamton_Montage.jpg","page_title":"בינגהמטון","context_page_description":"בינגהמטון היא עיר בניו יורק שבארצות הברית ובירת מחוז ברום. העיר שוכנת באזור הדרומי של המדינה ליד הגבול עם פנסילבניה. בינגהמטון היא המרכז התרבותי של מטרופולין בינגהמטון ובירתה, במטרופולין מתגוררים 251,725 תושבים. אוכלוסיית העיר עצמה על פי מפקד האוכלוסין של ארצות הברית לשנת 2010, היא 47,376. אוניברסיטת בינגהמטון הוקמה בשנת 1946 ומאז משמשת כמרכז החינוך העיקרי באזור.\\nמאז ימי התחבורה המסילתית, בינגהמטון נחשבה למרכז ייצור ותחבורה. העיר מוכרת כמרכז ייצור סיגרים, נעליים ומחשבים. חברת IBM נוסדה באזור וסימולטור הטיסה הומצא בעיר, מה שהוביל לריכוז בולט של חברות עם אוריינטציה ביטחונית ואלקטרונית. שגשוג כלכלי מתמשך זה זיכה את בינגהמטון בכינוי 'עמק ההזדמנויות'. אולם, עקב קיצוצים שנעשו על ידי חברות ביטחון לאחר סיום המלחמה הקרה, האזור איבד חלק משמעותי מתעשיית הייצור.\\nכיום, יש ריכוז מתמשך של חברות היי-טק באזור ובינגהמטון עולה כעיר שמתרכזת בעיקר בבריאות ובחינוך."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%A3%E3%83%B3%E3%83%97_(%E3%83%95%E3%82%A9%E3%83%BC%E3%82%AF%E3%83%A9%E3%83%B3%E3%83%89%E8%AB%B8%E5%B3%B6)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Camp-Settlement.jpg","page_title":"キャンプ (フォークランド諸島)","context_page_description":"キャンプは、フォークランド諸島において、唯一の町であるスタンリーと、多くの場合にはイギリス空軍のマウント・プレザント基地の広大な敷地を除いた、残りすべての領域を指す用語である。この言葉は、スペイン語で「畑」や「野原」を意味する campo に由来している。"},{"page_url":"https://nl.wikipedia.org/wiki/Ford_C1-platform","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Ford_C-Max_vl_silver.jpg","page_title":"Ford C1-platform","context_page_description":"Het Ford C1-platform is het platform van Ford voor de compacte auto klasse. Het vervangt het C170-platform van Ford en het BJ platform van Mazda. Het C1-platform debuteerde met de Europese Ford C-MAX compacte MPV begin 2004. Het platform is ontwikkeld voor zowel voor- als vierwielaandrijving. Dit platform is bij Volvo gekend als Volvo P1-platform.\\nHet C-platform is ontwikkeld in Keulen, Duitsland, onder de naam \\"C Technologies Program\\". Dertig ingenieurs van Ford, Mazda en Volvo hebben samengewerkt bij de ontwikkeling. Dit gaf de mogelijkheid om de kracht van de verschillende fabrikanten te combineren: Volvo op het gebied van veiligheid, Mazda op het gebied van de stijfheid van de koets en Ford op het gebied van wegligging.\\nHet C1-platform is verlengd tot het EUCD-platform, dat staat voor: EUropa, C en D klasse. Dit wordt gebruikt in grotere modellen zoals de Ford Mondeo, de Volvo S60 II, Volvo V60, Volvo V70 III en de Volvo S80 II.\\nAlle auto's gebaseerd op dit model delen de voor- en achtersubframes, vering, stuurinrichting, reminrichting, veiligheidsystemen en elektrische installatie."},{"page_url":"https://tr.wikipedia.org/wiki/Panzer_38(t)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Bundesarchiv_Bild_101I-265-0037-10%2C_Russland%2C_Panzer_38t.jpg","page_title":"Panzer 38(t)","context_page_description":"Panzerkampfwagen 38(t), Çekoslovakya tarafından LT-38 adıyla imal edilen ve Almanların Çekoslovakya'yı ele geçirmesinden sonra Alman ordusu tarafından II. Dünya Savaşı sırasında kullanılan tanktır. Üreticilerin TNH serileri, TNHPS, LTP ve LTH adlandırmaları vardır. Alman ordusu içerisinde mühimmat envanter tanımı SdKfz.140'tır."},{"page_url":"https://en.wikipedia.org/wiki/Republican_Party_(United_States)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Richard_Nixon_presidential_portrait.jpg","page_title":"Republican Party (United States)","context_page_description":"The Republican Party, also referred to as the GOP, is one of the two major contemporary political parties in the United States, along with its main, historic rival, the Democratic Party.\\nThe GOP was founded in 1854 by opponents of the Kansas–Nebraska Act, which allowed for the potential expansion of slavery into the western territories. The party supported classical liberalism, opposed the expansion of slavery, and supported economic reform. Abraham Lincoln was the first Republican president. Under the leadership of Lincoln and a Republican Congress, slavery was banned in the United States in 1865. The Party was generally dominant during the Third Party System and the Fourth Party System. After 1912, the Party underwent a social ideological shift to the right. Following the Civil Rights Act of 1964 and the Voting Rights Act of 1965, the party's core base shifted, with Southern states becoming more reliably Republican in presidential politics. The party's 21st-century base of support includes people living in rural areas, men, the Silent Generation, and white evangelical Christians."},{"page_url":"https://es.wikipedia.org/wiki/Delicias_(Madrid)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Estaci%C3%B3n_Delicias_1.jpg","page_title":"Delicias (Madrid)","context_page_description":"Las Delicias es el nombre de uno de los barrios administrativos del distrito de Arganzuela, en Madrid. Tiene forma trapezoidal y está situado en el centro del distrito, encontrándose delimitado por las calles de Bustamante y Ferrocarril al norte, Méndez Álvaro al este, Bolívar, Bronce y la avenida del Planetario al sur y las calles de Embajadores y Delicias al oeste. Está rodeado por los barrios, pertenecientes al mismo distrito, de Palos de Moguer, Atocha, Legazpi, La Chopera y Las Acacias. Dentro del sistema actual de división de la ciudad, el distrito de Arganzuela tiene el código 02 y Delicias el 25."},{"page_url":"https://eo.wikipedia.org/wiki/Baroko","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Scaldis_and_Antwerpia_by_Abraham_Janssens.jpg","page_title":"Baroko","context_page_description":"Baroko estas kultura movado inter 16-a kaj 18-a jarcentoj, kiu en historio pri arto sekvas Renesancon. Pli precize, baroko situas inter manierismo kaj rokoko, kiam Kontraŭreformacio de katolikismo reagis al la novaj kulturaj movadoj, kiuj produktis Reformacion kaj novan sciencon.\\nLa termino baroko, el la itala lingvo, origine signifis \\"stranga, ekstravaganca\\", kaj verŝajne devenas de la portugala vorto barroco, kiu signifis \\"neperfekta perlo\\"."},{"page_url":"https://pt.wikipedia.org/wiki/Fabiola_da_Silva","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Fabiola_da_Silva11.jpg","page_title":"Fabiola da Silva","context_page_description":"Fabiola de Oliveira Simões da Silva é uma atleta de patinação Inline brasileira.\\nÉ considerada uma das maiores atletas deste esporte da história.\\nEla foi 8 vezes campeã dos X Games e uma vez medalhista de prata; além de conquistar várias medalhas no LG Action Sports US Championship. Fabiola participou da primeira edição dos X Games em 1996, ela tinha apenas 15 anos de idade e aquela foi a sua primeira viagem internacional. Nos X Games ela começou competindo na categoria vertical, mas depois passou a disputar também o street e chegou a conquistar medalhas de ouros nas duas categorias."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D1%84%D1%80%D0%B0%D0%BD%D0%BA%D0%B8%D1%81%D0%BA%D0%B8_%D0%BA%D1%80%D0%B0%D0%BB%D0%B5%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Tiers_de_sous_d%27or_de_Clovis_II.jpg","page_title":"Список на франкиски кралеви","context_page_description":"Франките на почетокот биле предводени од страна на војводи и регули. Салиските Меровинзи завладеале меѓу Франките и го освоиле поголемиот дел на Римска Галија. Тие воедно ги поразиле и Визиготите во 507. Синовите на Клодовик го освоиле Кралството Бургундија и ги поразиле Алеманите. Ја земале Прованса и ги покориле Баварите и Турингите. Меровинзите подоцна биле заменети со нова династија наречена Каролинзи во 8 век. До крајот на 9 век, Каролинзите биле заменувани од други династии. Идејата за \\"Крал на Франките\\" или Rex Francorum постепено исчезнала докај 12 и 13 век.\\nВременската табела на франкиските водачи е тешко да се определи бидејќи кралството, согласно старата германска практика, честопати било делено меѓу синовите на водачот после неговата смрт а потоа повторно било и обединувано."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%B6bing","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/B%C3%B6bing_-_Hohenleithen_n%C3%B6rdl_-_B%C3%B6bing_v_NW%2C_Bay_Voralpen_05.jpg","page_title":"Böbing","context_page_description":"Böbing ist eine Gemeinde im oberbayerischen Landkreis Weilheim-Schongau sowie Mitglied der Verwaltungsgemeinschaft Rottenbuch. Böbing liegt in der Region Oberland. Es existiert nur die Gemarkung Böbing."},{"page_url":"https://es.wikipedia.org/wiki/Marcilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Virgendelplu.jpg","page_title":"Marcilla","context_page_description":"Marcilla es una villa y un municipio español de la Comunidad Foral de Navarra, situado en la merindad de Olite, en la comarca de la Ribera Arga-Aragón y a 60 km de la capital de la comunidad, Pamplona. Su población en 2017 fue de 2828 habitantes."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DB%8C%D9%84%D8%A7%D8%B1%D8%AF_%D8%B3%D9%88%D9%84%D8%B3%D8%A8%D9%88%D8%B1%DB%8C%D8%8C_%D8%AC%D9%88%D9%86%DB%8C%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Willardsaulsburyjr.jpg","page_title":"ویلارد سولسبوری، جونیور","context_page_description":"ویلارد سولسبوری، جونیور سناتور سابق عضو حزب دموکرات ایالات متحده آمریکا بود. وی در سال ۱۹۱۳ تا ۱۹۱۹ میلادی سناتور ایالت دلاویر در سنای ایالات متحده آمریکا بود."},{"page_url":"https://es.wikipedia.org/wiki/Gueorgui_Rodi%C3%B3nenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/George_Rodionenko.jpg","page_title":"Gueorgui Rodiónenko","context_page_description":"Gueorgui Ivánovich Rodiónenko es un botánico ruso. Fue un colaborador conspicuo sobre el género Iris de Flora de URSS. Trabajó académicamente en el Instituto Botánico Komarov de la Academia de Ciencias de la URSS. Fue Director del Jardín Botánico del Instituto Botánico V.L. Komarov"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A4%D7%95%D7%AA_%D7%99%D7%A9%D7%A8%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/%D7%9E%D7%97%D7%95%D7%96_%D7%94%D7%9E%D7%A8%D7%9B%D7%96.JPG","page_title":"נפות ישראל","context_page_description":"מדינת ישראל מחולקת ל-16 נפות, שהן הדרג השני של המנהל המקומי. הממשל המרכזי מחולק למחוזות, ומחוזות מחולקים לנפות. שבעת מחוזות ישראל, המהווים יחידות מנהליות ראשיות במדינה, מחולקים לנפות - יחידות מנהליות משניות.\\nאין בישראל מערכת שלטון נפתי תת-מדיני אלא כל משרד ממשלתי מרכזי הנדרש לקיים פעילות ברמה המקומית, מקיים מערך של נציגויות במחוזות ובנפות לפי שיקולים פנימיים של המשרד, ולחלופין מקיים מערך שירותים מקומיים באמצעות שותפות עם השלטון המקומי.\\nלשלושה מחוזות יש נפה אחת החופפת את שטחי המחוז, ליתר המחוזות יותר מנפה אחת. גבולות המחוזות והנפות נקבעו בהחלטת ממשלה ומתפרסמים בשנתון הלשכה המרכזית לסטטיסטיקה."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B5%CF%81%CE%B1%CE%BC%CE%AF_%CE%9D%CE%AC%CE%BE%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Tower_Kalavrou_in_Kerami_on_Naxos%2C_late_18th_c%2C_13M453.jpg","page_title":"Κεραμί Νάξου","context_page_description":"Το Κεραμί αποτελεί μικρό οικισμό της Νάξου που βρίσκεται κοντά στον οικισμό του Χαλκείου. Για πρώτη φορά ορίζεται σαν οικισμός το 1935, με 205 κατοίκους. Το 1981 καταργείται σαν ανεξάρτητος οικισμός και αποτελεί μέρος του οικισμού του Χαλκείου. Στην τελευταία απογραφή του οικισμού, το 1971, είχε 96 κατοίκους. Έχει χαρακτηριστεί από το 1988 παραδοσιακός οικισμός. Κοντά στον οικισμό υπήρξε, μέχρι το 1928, ένας παλαιότερος οικισμός, το Μετόχι."},{"page_url":"https://en.wikipedia.org/wiki/St._Mary_Roman_Catholic_Church_(Detroit)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/StMarysGreektownDetroit.jpg","page_title":"St. Mary Roman Catholic Church (Detroit)","context_page_description":"St. Mary Roman Catholic Church, formally the Church of the Immaculate Conception of the Blessed Virgin Mary, is in the third oldest Roman Catholic parish in Detroit, Michigan. Designed by German-born Peter Dederichs and built for the formerly ethnic German parish of the 19th century, it is located at 646 Monroe Street in what is now considered the heart of the Greektown Historic District in downtown Detroit. It is often called \\"Old St. Mary's Church\\" to avoid confusion with other St. Mary's parishes: in the Redford neighborhood of Detroit, or in nearby Royal Oak, Monroe, or Wayne.\\nThe former church was built in 1841. The school, built in 1868, was the first of the new buildings of the current complex. The rectory; new church, and convent, completed in 1922, comprised the remainder. The convent was demolished in the early 2000s and replaced with a community center designed to resemble the 1841 church building.\\nSt. Mary Parish has been staffed by the Spiritans or Holy Ghost Fathers since 1893. It was previously administered by the Franciscan Fathers and the Redemptorist Fathers."},{"page_url":"https://fr.wikipedia.org/wiki/Lamesley","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/St._Andrew%2C_Lamesley_-_geograph.org.uk_-_94786.jpg","page_title":"Lamesley","context_page_description":"Lamesley est un village et une paroisse civile du Tyne and Wear, en Angleterre. Il est situé au sud de la ville de Gateshead."},{"page_url":"https://en.wikipedia.org/wiki/Apple_Mouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Apple_desktop_mouse.jpg","page_title":"Apple Mouse","context_page_description":"The Apple Mouse began as one of the first commercial mice available to consumers. Over the years Apple has maintained a distinct form and function with its mice that reflects its design philosophies."},{"page_url":"https://eo.wikipedia.org/wiki/Riano","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Stazione_Riano1.JPG","page_title":"Riano","context_page_description":"Riano estas komunumo de Italio. Fine de 2018 en la komunumo vivis 10 649 loĝantoj. Kristana patrono de la komumo estas la Sankta Georgo, kies memortago, la 23-a de aprilo, sekve estas la komunuma festotago."},{"page_url":"https://lb.wikipedia.org/wiki/Vincey","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Vincey.jpg","page_title":"Vincey","context_page_description":"Vincey ass eng franséisch Gemeng an de Vogesen an der Regioun Grand Est.\\nVincey läit op engem Plateau um lénksen Museluwänner, a laanscht d'Gemeng leeft de Canal de l'Est."},{"page_url":"https://en.wikipedia.org/wiki/Wendell_Young","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Wendell_Young_Banner.JPG","page_title":"Wendell Young","context_page_description":"Wendell Edward Young is a Canadian former professional ice hockey goaltender. He is currently the general manager of the Chicago Wolves of the American Hockey League.\\nWendell's moniker is \\"Ringmaster\\" as he is currently the only player in hockey history to have won all four cups: The Memorial Cup, The Calder Cup, The Turner Cup & The Stanley Cup.\\nHis Chicago Wolves Jersey #1 was retired in a ceremony at their home rink, The Allstate Arena, on December 1, 2001. All four cups were on hand to honor his history making achievements. This marked the first time The Chicago Wolves had retired a number since their inception into the then titled IHL in 1994."},{"page_url":"https://ca.wikipedia.org/wiki/Jeri_Ryan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Jeri_Ryan_%282012%29.jpg","page_title":"Jeri Ryan","context_page_description":"Jeri Lynn Zimmermann, més coneguda com a Jeri Lynn Ryan, és una actriu estatunidenca coneguda principalment pel seu paper de Borg alliberada Set de Nou a la sèrie Star Trek: Voyager pel que va guanyar dos Premis Saturn.\\nTambé és coneguda pel seu paper de Veronica \\"Ronnie\\" Cooke a Boston Public. Va aparèixer de forma regular a la sèrie de ciència-ficció Dark Skies i al drama legal Shark. De 2011 a 2013 va protagonitzar com a Dra. Kate Murphy la sèrie dramàtica Body of Proof i l'any 2009 va fer el paper de Tara Cole a Leverage com a actriu convidada."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Lone_Tree_-_Mongolia_Landscape.jpg","page_title":"Монголия","context_page_description":"Монго́лия – Көнчыгыш-Үзәк Азиядәге, диңгезгә чыгышы булмаган, төньякта Русия, көньякта Кытай белән чиктәш дәүләт.\\nРәсми тел – монгол теле, язу – кирил әлифбасы. Монгол телендә халыкның 95 % сөйләшә. Урта мәктәпләрдә искемонгол язуын өйрәнәләр."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%82%89%E5%B0%BC%E5%B8%82%E6%94%BF%E5%8E%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Sydney_Town_Hall_Roof_Detail.jpg","page_title":"悉尼市政厅","context_page_description":"雪梨市政廳是一座地標砂岩建築，位於雪梨市中心. 與維多利亞女王大廈相對，毗鄰聖安德烈座堂。市政廳的台階是熱門的聚會地點。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_the_oldest_buildings_in_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Wing_Fort_House_exterior.jpg","page_title":"List of the oldest buildings in Massachusetts","context_page_description":"Some dates are approximate and based on architectural studies and historical records, while other dates are based on dendrochronology. All entries should include citation with reference to: 17th century architectural features; a report by an architectural historian; or dendrochronology. Sites on the list are generally from the First Period of American architecture. Only First Period houses built prior to 1700 are suitable for inclusion on this list or the building must be the oldest of its type.\\nThe Fairbanks House is the oldest house verified using dendrochronology, followed by the James Blake House, but most First Period structures in Massachusetts have not yet been tested with dendrochronology surveys. The town of Ipswich, Massachusetts, is believed to have approximately 60 First Period houses, purportedly more than any other town in America."},{"page_url":"https://ast.wikipedia.org/wiki/Charles_Maurras","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Charles_Maurras_-_photo_Fr%C3%A9d%C3%A9ric_Boissonnas.jpg","page_title":"Charles Maurras","context_page_description":"Charles Maurras foi un políticu d'estrema derecha, poeta y escritor francés, principal fundador ya ideólogu d'Action Française."},{"page_url":"https://en.wikipedia.org/wiki/Brig_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Boats%2CIMG_0105.JPG","page_title":"Brig Bay","context_page_description":"Brig Bay is a small traditional fishing village in Newfoundland and Labrador. It was first mapped by Captain James Cook in September 1764. The name \\"Brig\\" was adopted by the French who occupied the bay prior to English occupation. It provided a safe and well-sheltered harbor."},{"page_url":"https://en.wikipedia.org/wiki/Albano_Sorbelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Sorbelli%2C_Albano_%E2%80%93_Statuti_dell%27Appennino_tosco-modenese%2C_1913_%E2%80%93_BEIC_1027564.jpg","page_title":"Albano Sorbelli","context_page_description":"Albano Sorbelli was an Italian historian, bibliographer and librarian. He was the director of the Biblioteca Comunale of the Archiginnasio of Bologna from 1904 until 1943."},{"page_url":"https://de.wikipedia.org/wiki/Ala-Too-Platz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bishkek_square.jpg","page_title":"Ala-Too-Platz","context_page_description":"Der Ala-Too-Platz ist ein Platz im Zentrum Bischkeks, der Hauptstadt Kirgisistans. Er wurde 1984 angelegt, war jedoch seitdem stetig zentraler Schauplatz von politischen Auseinandersetzungen in der kirgisischen Republik."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%AF%D9%84%DB%8C%D9%81%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Deadlift-phase_3.JPG","page_title":"ددلیفت","context_page_description":"ددلیفت یا لیفت كُشنده یکی از تمرینات با وزنه است که در آن یک هالتر که با صفحه‌های فلزی سنگین شده از زمین برداشته شده و تا جلوی ران بالا آورده و سپس به سمت زمین برگردانده می‌شود.\\nددلیفت از پایه‌ای‌ترین حرکات بدنسازی است و در کنار اسکات و پرس سینه بخشی از مسابقات وزنه‌برداری قدرتی است.\\nدر این تمرین تقریباً تمام عضلات بدن مشارکت دارند اما بیشترین وزن را معمولاً عضلات فیله کمر، عضله بزرگ باسن و عضلات همسترینگ تحمل می‌کنند. شکل‌های مختلفی از این حرکت وجود دارد که تفاوت‌هایی در زمینه نوع فشار بر عضلات درگیر در آن‌ها وجود دارد."},{"page_url":"https://zh.wikipedia.org/wiki/1922%E5%B9%B43%E6%9C%8828%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/SE1921Apr08A.png","page_title":"1922年3月28日日食","context_page_description":"1922年3月28日日食是一次日環食，發生於1922年3月28日。新月當天，地球上觀測到月球和太陽的角距離極小，此時月球如果恰好在月球交點附近，穿過太陽和地球之間，與地球、太陽接近一直線，則會出現日食。月球穿過太陽和地球之間，但距地球較遠，本影未能接觸地表，而使偽本影覆蓋的區域內看到月球的角直徑小於太陽，就形成日環食，同時在偽本影兩側數千公里的半影範圍內形成日偏食。此次日環食經過了秘魯、巴西、法屬西非、英屬甘比亞、法屬阿爾及利亞、義屬利比亞、埃及、漢志王國、內志蘇丹國、英屬科威特，日偏食則覆蓋了拉丁美洲大部、歐洲大部、非洲中北部及周邊部分地區。"},{"page_url":"https://ast.wikipedia.org/wiki/Guerra_de_la_Independencia_Espa%C3%B1ola","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/First_French_Empire_1812.svg","page_title":"Guerra de la Independencia Española","context_page_description":"Plantía:Campaña Guerra de la independencia.\\nLa guerra de la Independencia española foi un conflicto bélicu desenvueltu ente 1808 y 1814 dientro del contestu de les Guerres Napoleóniques, qu'enfrentó a les potencies aliaes d'España, Reinu Xuníu y Portugal contra'l Primer Imperiu francés, que la so pretensión yera la d'instalar nel tronu español al hermanu de Napoleón, Xosé Bonaparte, tres les abdicaciones de Bayona.\\nLa guerra de la Independencia, tamién conocida n'español y n'asturianu como la francesada, Guerra Peninsular, Guerra d'España, Guerra del Francés, Guerra de los Seis Años o «llevantamientu y revolución de los españoles», asolápase y confunde colo que la historiografía anglosaxona llapada Peninsular War, empecipiada en 1807 al declarar Francia y España la guerra a Portugal, tradicional aliáu del Reinu Xuníu. Tamién tuvo un importante componente de guerra civil a nivel nacional ente francesaos y patriotes."},{"page_url":"https://es.wikipedia.org/wiki/Sensor_inductivo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Inductivo_histeresis.jpg","page_title":"Sensor inductivo","context_page_description":"Los sensores inductivos son una clase especial de sensores que sirve para detectar materiales ferrosos"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A5%A5%E6%96%AF%E5%8D%A1%C2%B7%E5%BE%B7%E9%A9%AC%E7%A7%91%E6%96%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Oscar_de_Marcos_2012.jpg","page_title":"奥斯卡·德马科斯","context_page_description":"奧斯卡·德馬科斯·阿拉納是一名西班牙足球運動員，目前效力西甲俱樂部畢爾包競技，司職中場。"},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E5%92%8C%E5%BB%A3%E6%BF%9F%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/%E4%B8%AD%E5%92%8C%E5%BB%A3%E6%BF%9F%E5%AE%AE%E6%AD%A3%E9%9D%A2%E7%85%A7.jpg","page_title":"中和廣濟宮","context_page_description":"中和廣濟宮，是位於臺灣新北市中和區廟美里的開漳聖王廟，與一旁的中和福和宮合稱「中和大廟」。"},{"page_url":"https://ceb.wikipedia.org/wiki/God%C4%99towo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Pa%C5%82ac_God%C4%99towo.jpg","page_title":"Godętowo","context_page_description":"Lungsod ang Godętowo sa Polskowa. Nahimutang ni sa powiat sa Powiat wejherowski ug gingsakopan sa Województwo Pomorskie, sa amihanang bahin sa nasod, 300 km sa amihanan-kasadpan sa Warsaw ang ulohan sa nasod. 31 metros ibabaw sa dagat kahaboga ang nahimutangan sa Godętowo, ug adunay 216 ka molupyo.\\nAng yuta palibot sa Godętowo kay kasagaran patag. Godętowo nahimutang sa usa ka walog. Dunay mga 48 ka tawo kada kilometro kwadrado sa palibot sa Godętowo medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Lębork, 8.5 km sa habagatan-kasadpan sa Godętowo. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Godętowo. Sa rehiyon palibot sa Godętowo, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -8 °C."},{"page_url":"https://it.wikipedia.org/wiki/Force_H","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Hms-eagle-1942.jpg","page_title":"Force H","context_page_description":"La Forza H fu una forza navale britannica istituita nel 1940 durante la seconda guerra mondiale con lo scopo di rimpiazzare la forza navale francese nel Mediterraneo occidentale dopo la firma dell'armistizio tra Francia e Germania.\\nLa Forza H - con base a Gibilterra - occupava una posizione insolita nella catena di comando della Royal Navy; solitamente le basi navali britanniche sparse per il mondo comunicavano con il Primo Lord del Mare tramite il loro comandante che inviava le informazioni al Flag Officer Commanding, North Atlantic, la Forza H al contrario fu durante tutto il periodo di attività direttamente a contatto con il Primo Lord del Mare."},{"page_url":"https://de.wikipedia.org/wiki/Claude_Dauphin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Claude_Dauphin_in_A_Salute_to_France.jpg","page_title":"Claude Dauphin","context_page_description":"Claude Dauphin war ein französischer Schauspieler."},{"page_url":"https://da.wikipedia.org/wiki/BTS_(musikgruppe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/KOCIS_Korea_Mnet_BTS_01_%2812986916653%29.jpg","page_title":"BTS (musikgruppe)","context_page_description":"BTS er en sydkoreansk drengegruppe, dannet af Big Hit Entertainment. De debuterede i 2013, og er siden blevet den største K-pop gruppe nogensinde, med en af de største fanbaser, både nationalt og internationalt. De har slået en række rekorder, blandt andet blev deres album \\"Love Yourself: Her\\" det første album i 16 år der havde solgt en million kopier i Sydkorea. Man regner med, at de i dag har solgt omkring fem millioner albummer over hele verden.\\nSpecielt deres tilstedeværelse på de sociale medier har hjulpet BTS' popularitet, og i 2016 satte Forbes BTS på listen over de mest retweetede kunstnere. Efter dette, udgav Twitter for første gang nogensinde en K-pop Twitter emoji i samarbejde med BTS i maj. I oktober 2016, blev BTS, som den første K-pop gruppe, sat på Billboards Social 50 hitliste, hvor de i dag har brugt 74 uger som nummer 1. I maj 2017 vandt de Top Social Artist prisen hos Billboard Music Awards, og vandt som den første koreanske gruppe en BBMA. I juni 2017 nævnte Time Magazine dem som en del af de 25 mest indflydelsesrige mennesker på internettet."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9C%E3%83%8B%E3%83%BC%E3%83%BB%E3%82%B5%E3%83%9E%E3%83%BC%E3%83%B4%E3%82%A3%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bonnie_Somerville_adjusted.jpg","page_title":"ボニー・サマーヴィル","context_page_description":"ボニー・サマーヴィルは、アメリカ合衆国の女優・歌手。ニューヨーク市ブルックリン出身。"},{"page_url":"https://fr.wikipedia.org/wiki/Kigali","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/KigaliAirport.jpg","page_title":"Kigali","context_page_description":"Kigali est la capitale du Rwanda, centre économique et administratif du pays. Sa population est d'environ un million d'habitants. La ville est construite sur plusieurs collines."},{"page_url":"https://ca.wikipedia.org/wiki/Osem_Investments_Limited","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Israel_National_TrailDSCN4412.JPG","page_title":"Osem Investments Limited","context_page_description":"Osem Investments Limited juntament amb les seves empreses filials, desenvolupa, fabrica, ven, comercialitza, i distribueix productes alimentaris a Israel, Europa, i Estats Units. El departament d'alimentació de la companyia produeix pasta, cuscús, sopa, productes per fornejar, salses, productes enllaunats, menjars preparats, substituts de la carn, i amanides.\\nEl departament de forn de pa, begudes, snacks i cereals per esmorzar produeix: productes de forn de pa, crackers, pastissos, galetes, cafè instantani, càpsules de cafè, xarop per a begudes, xocolata desfeta, cereals per esmorzar, barres de cereals i snacks amb: blat, cacauet, patata, i blat de moro.\\nEl departament internacional de la companyia fabrica productes alimentaris congelats i refrigerats, entre ells les amanides de la marca Tribe.\\nEl departament d'aliments infantils produeix productes de nutrició infantil, cereals per a nadons, puré, galetes, i pasta per a infants. El departament de regals de la companyia fabrica productes que es venen en indrets com: hotels, cafeteries, restaurants, empreses de càtering, i en comerços. El departament de serveis produeix te, gelats, menjar per animals, i altres productes."},{"page_url":"https://it.wikipedia.org/wiki/Mo%C5%A1nov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Mo%C5%A1nov_CoA.jpg","page_title":"Mošnov","context_page_description":"Mošnov è un comune della Repubblica Ceca facente parte del distretto di Nový Jičín, nella regione della Moravia-Slesia."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%91%D0%B0%D0%B0%D0%BB%D0%BE%D0%BD_(%D0%9C%D0%B5%D0%B7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ba%C3%A2lon%2C_Eglise_Saint-Blaise.jpg","page_title":"Баалон (Мез)","context_page_description":"Баалон — Францин гӀала-коммуна, лаьтта Гранд-Эст регионехь. Коммунан департамент — Мез. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://de.wikipedia.org/wiki/Iosif_Papp-Szil%C3%A1gyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Iosif_Papp-Szil%C3%A1gyi_1.jpg","page_title":"Iosif Papp-Szilágyi","context_page_description":"Iosif Papp-Szilágyi war Bischof von Oradea Mare der Rumänischen griechisch-katholischen Kirche."},{"page_url":"https://en.wikipedia.org/wiki/Nageshvara-Chennakeshava_Temple_complex,_Mosale","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Kannada_inscription_%281577_AD%29_at_Nageshvara_and_Chennakeshava_temples_in_Mosale.jpg","page_title":"Nageshvara-Chennakeshava Temple complex, Mosale","context_page_description":"The Nageshvara-Chennakeshava temple complex is an elegant example of Hoysala architecture of the early 12th century. It is located in the village of Mosale, about 10 km from Hassan city, in Hassan district of Karnataka state, India. The temple was built in 1200 A.D. during the reign of Hoysala King Veera Ballala II. According to art historian Gerard Foekema, the two temples that are built in the same complex, in an idyllic rural setting, form a \\"perfect twin\\". This temple complex is protected as a monument of national importance by the Archaeological Survey of India."},{"page_url":"https://cy.wikipedia.org/wiki/Gorsaf_reilffordd_Penalun","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Penally_Railway_Station.jpg","page_title":"Gorsaf reilffordd Penalun","context_page_description":"Mae gorsaf reilffordd Penalun yn orsaf reilffordd sy'n gwasanaethu pentref Penalun yn Sir Benfro, Cymru. Mae'r orsaf yn gorwedd ar Reilffordd Gorllewin Cymru ac fe'i rheolir gan Trafnidiaeth Cymru."},{"page_url":"https://hu.wikipedia.org/wiki/Milna","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Milna%2C_Bra%C4%8D%2C_Hrvatska_-_pogled_na_marinu_s_juga.jpg","page_title":"Milna","context_page_description":"Milna falu és község Horvátországban, Split-Dalmácia megyében. Közigazgatásilag Milnán kívül Bobovišća, Bobovišća na Moru, Ložišća és Podhume települések tartoznak hozzá."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Verwaltungseinheiten_Indonesiens","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Locator_kota_surabaya.png","page_title":"Liste der Verwaltungseinheiten Indonesiens","context_page_description":"Diese Liste führt die administrativen Einheiten Indonesiens auf. Die Liste sortiert die Provinzen nach der geographischen Lage der Regionen Indonesiens. Hier werden die ersten und zweiten Ebenen aufgezählt. Für die unteren Verwaltungsebenen gibt es für jede Provinz eine eigene Liste."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D0%BB%D0%B0%D1%86_%D0%B2_%D0%90%D1%80%D0%B0%D0%BD%D1%85%D1%83%D0%B5%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Palacio_Real_de_Aranjuez_-_Interior_05.jpg","page_title":"Королівський палац в Аранхуесі","context_page_description":"Королівський палац в Аранхуесі — одна з іспанських королівських резиденцій, розташована у місті Аранхуес, автономне співтовариство Мадрид, Іспанія. Палац відкритий для відвідувачів як одна з Іспанських королівських резиденцій. Палац разом з садами включений до Світової Спадщини ЮНЕСКО як видатна пам'ятка, що демонструє комплекс зв'язків між природою та діяльністю людини — звивисті природні водні шляхи та геометричний парковий ландшафт, поєднання сільського та міського середовища, між лісами та архітектурою палацових будівель. Триста років розвитку ландшафту під наглядом монархії, палацовий комплекс «демонструє еволюцію концепцій від гуманізму та політичної централізації, до характеристик французького саду бароко 18 ст., до міського стилю життя, який розвився поруч з наукою про акліматизацію рослин та тваринництва в епоху Просвітництва»."},{"page_url":"https://es.wikipedia.org/wiki/F%C3%A1brica_de_cer%C3%A1mica_Loebnitz","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Ancienne_fa%C3%AFencerie_Loebnitz_c%C3%A9ramique.jpg","page_title":"Fábrica de cerámica Loebnitz","context_page_description":"La Fábrica de cerámica Loebnitz es una antigua manufactura de cerámica, cuyo edificio fue construido en 1884 por el arquitecto Paul Sédille. La fábrica está ubicada al noroeste del XI Distrito de París. La entrada se encuentra por la calle de Pierre-Levée"},{"page_url":"https://en.wikipedia.org/wiki/Palazzo_Vecchio","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Palazzo_Vecchio_-_grand_hall.jpg","page_title":"Palazzo Vecchio","context_page_description":"The Palazzo Vecchio is the town hall of Florence, Italy. It overlooks the Piazza della Signoria, which holds a copy of Michelangelo's David statue, and the gallery of statues in the adjacent Loggia dei Lanzi.\\nOriginally called the Palazzo della Signoria, after the Signoria of Florence, the ruling body of the Republic of Florence, this building was also known by several other names: Palazzo del Popolo, Palazzo dei Priori, and Palazzo Ducale, in accordance with the varying use of the palace during its long history. The building acquired its current name when the Medici duke's residence was moved across the Arno River to the Palazzo Pitti."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%BF%CF%85%CE%BB%CE%B9%CE%AD%CE%BB%CE%BC%CE%BF%CF%82_%CE%92%CE%84_%CF%84%CE%BF%CF%85_%CE%9D%CE%B5%CE%B2%CE%AD%CF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Nevers1.jpg","page_title":"Γουλιέλμος Β΄ του Νεβέρ","context_page_description":"Ο Γουλιέλμος Β΄, γαλλ. Guillaume II από τον Οίκο του Νεβέρ ήταν σταυροφόρος κατά τη Σταυροφορία του 1101. Έγινε κόμης του Νεβέρ & του Ωσέρ."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%82%BC%EA%B0%81%EA%B5%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/H2checkers_366.png","page_title":"삼각군","context_page_description":"군론과 기하학에서, 삼각군은 음 또는 양 또는 0의 곡률을 갖는 평면에서, 삼각형을 이루는 세 개의 직선에 대한 반사들로 생성되는 군이다."},{"page_url":"https://en.wikipedia.org/wiki/Ant%C3%B3nio_Jos%C3%A9_de_%C3%81vila,_2nd_Marquis_of_%C3%81vila_and_Bolama","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Armas_duques_%C3%A1vila.png","page_title":"António José de Ávila, 2nd Marquis of Ávila and Bolama","context_page_description":"António José de Ávila was a military officer, politician, member of the Portuguese nobility and benemerit."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%98%D7%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Aletsch_Glacier.jpg","page_title":"אלטש","context_page_description":"אלטש הוא קרחון יבשתי ברכס האלפים הברניים שבהרי האלפים הממוקם על גבולו הצפוני של קנטון ואלה עם קנטון ברן בשווייץ. שטחו כ-120 קילומטר רבוע וממדים אלו הופכים אותו לקרחון הגדול ביותר באלפים. בשיאו מגיע הקרח בקונקורדיהפלאץ לעומק של 900 מטר. בשנת 2001 הוכרז אזור הקרחון כאתר מורשת עולמית ביחד עם הר יונגפראו והר ביטשהורן.\\nקרחון אלטש נע מצפון לדרום בתוואי בצורת פרסה. הוא מתחיל את תנועתו מדרום להר יונגפראו, חותר מזרחה, עובר ממזרח להר אלטשהורן וממערב לאגם מריילן וחוזר לכיוון מערב. עומקו של הקרח יורד בהדרגה עד שהוא נמס בסמוך להר ביטשהורן ומשם זורמים מימיו לעבר נהר הרון.\\nלקרחון אלטש יובלים רבים שהם קרחונים בעצמם. שלושת היובלים המרכזיים הם זרוע אלטש הגדולה, המגיעה ממערב באורך של 9 קילומטר ורוחב של 1.5 קילומטר, זרוע יונגפראו, המגיעה מצפון מערב באורך 7 קילומטר ורוחב של שני קילומטר, וזרוע אוויגשנייפלד, המגיעה מצפון באורך 8 קילומטר ורוחב 1.2 קילומטר.\\nקרחון אלטש נע כ-180 מטר בשנה וסוחף איתו חלקי סלע הנאספים לכל אורך התוואי ומגיעים אף מיובליו. בחלקו המרכזי של הקרחון, החל בקונקורדיהפלאץ, ניתן לראות רצועות כהות של סחף הנמתחות לאורך מסלול הקרחון. רצועות אלו מכונות בגאולוגיה מורנה.\\nקרחון אלטש סובל מההתחממות העולמית."},{"page_url":"https://en.wikipedia.org/wiki/John_Fortescue_(Captain_of_Meaux)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/FortescueMuralMonumentWeareGiffardDevon.jpg","page_title":"John Fortescue (Captain of Meaux)","context_page_description":"John Fortescue, of Shepham in the parish of Modbury in Devon, was an English landowner and administrator. He is said in most ancient sources to have been appointed in 1422 by King Henry V as Captain of the captured Castle of Meaux, 25 miles north-east of Paris, following the Siege of Meaux during the Hundred Years' War, although this appointment is questioned by Ives."},{"page_url":"https://it.wikipedia.org/wiki/%C3%89ider_Ar%C3%A9valo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/CAMPEON_COLMBIANO_10k_JUVENIL.jpg","page_title":"Éider Arévalo","context_page_description":"Éider Orlando Arevalo Truque è un marciatore colombiano."},{"page_url":"https://pl.wikipedia.org/wiki/Zbrodnia_katy%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/AGAD_Katy%C5%84_%E2%80%93_niemiecki_afisz_propagandowy.jpg","page_title":"Zbrodnia katyńska","context_page_description":"Zbrodnia katyńska – zbrodnia kwalifikowana jako zbrodnia wojenna, zbrodnia przeciwko ludzkości, zbrodnia przeciwko pokojowi, zbrodnia komunistyczna i zbrodnia ludobójstwa, popełniona przez NKWD przez rozstrzelanie wiosną 1940 roku co najmniej 21 768 obywateli Polski, na mocy decyzji najwyższych władz ZSRR zawartej w tajnej uchwale Biura Politycznego KC WKP z 5 marca 1940 roku. Egzekucji ofiar, uznanych za „wrogów władzy sowieckiej”, NKWD dokonywało przez strzał w tył głowy z broni krótkiej.\\nPrzez 50 lat władze ZSRR zaprzeczały swojej odpowiedzialności za zbrodnię katyńską. 13 kwietnia 1990 roku oficjalnie przyznały, że była to „jedna z ciężkich zbrodni stalinizmu”. Wiele kwestii związanych z tą zbrodnią nie zostało jak dotąd wyjaśnionych.\\nW języku mniej oficjalnym na określenie zbrodni katyńskiej używane są metonimiczne wyrażenia „Katyń” i „Las Katyński”.\\nW polskim piśmiennictwie ofiary zbrodni katyńskiej są określane jako katyniacy i katyńczycy."},{"page_url":"https://pl.wikipedia.org/wiki/Mitsubishi_Space_Wagon","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Mitsubishi_Space_Wagon_front_20071025.jpg","page_title":"Mitsubishi Space Wagon","context_page_description":"Mitsubishi Space Wagon – samochód typu van produkowany w latach 1983-2004 przez Mitsubishi Motors. Space Wagon został wyprodukowany jako odpowiedź na Renault Espace i Chryslera Voyagera. Model miał trzy generacje. W 2004 roku produkcja została wstrzymana a Space Wagona zastąpił na rynku Mitsubishi Grandis."},{"page_url":"https://it.wikipedia.org/wiki/Storia_dei_Detroit_Lions","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/SPARTANSTADIUM.JPG","page_title":"Storia dei Detroit Lions","context_page_description":"La storia dei Detroit Lions, una franchigia professionistica di football americano con sede a Detroit, Michigan, risale al 1929 quando la squadra giocava a Portsmoth, Ohio con il nome di Portsmouth Spartans. I Lions inizieranno nel 2020 la loro 87ª stagione, che li rende uno dei club più antichi della National Football League."},{"page_url":"https://nl.wikipedia.org/wiki/Inessa_Kaagman","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Inessa_Kaagman_-_signeersessie_-_20180527.png","page_title":"Inessa Kaagman","context_page_description":"Inessa Kaagman is een Nederlands voetballer die sinds de zomer van 2018 uitkomt voor LFC Everton dat uitkomt in de Super Leaugue. Daarnaast is ze twee keer uitgekomen voor het Nederlands vrouwenvoetbalelftal. Naast haar voetbalcarrière studeert Kaagman Geneeskunde aan de VU."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Sakralbauten_in_Freiburg_im_Breisgau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/St._Konrad_und_Elisabeth_%28Freiburg%29.jpg","page_title":"Liste der Sakralbauten in Freiburg im Breisgau","context_page_description":"Die Liste der Sakralbauten in Freiburg im Breisgau umfasst alle Sakralbauten in der Stadt Freiburg unabhängig von der Religion, geordnet nach Stadtbereichen. Die Nummern in der letzten Spalte geben die Lage auf nebenstehender Karte an."},{"page_url":"https://it.wikipedia.org/wiki/HMS_Laforey_(G99)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/HMS_Laforey_secured.jpg","page_title":"HMS Laforey (G99)","context_page_description":"Lo HMS Laforey fu un cacciatorpediniere della Royal Navy, parte della classe L ed entrato in servizio nell'agosto 1941.\\nAttivo durante la seconda guerra mondiale, operò principalmente nel mar Mediterraneo finendo affondato il 30 marzo 1944 a nord-est di Palermo dopo essere stato silurato dal sommergibile tedesco U-223."},{"page_url":"https://sv.wikipedia.org/wiki/Beddinge_strandhed","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Beddinge_strandhed_2016.jpeg","page_title":"Beddinge strandhed","context_page_description":"Beddinge strandhed är ett naturvårdsområde i Trelleborgs kommun. Det bildades 1996 och omfattar 24 hektar varav 18 vatten. Området ligger i Beddingestrand cirka 20 kilometer öster om Trelleborg.\\nFram till år 1994 var området golfbana och tillhörde Bedinge Golfklubb och blev i slutet på år 1996 klassat som ett naturvårdsområde. Det var när miljöbalken ändrades som området blev klassat som ett naturreservat,\\nDet mesta av naturen består av öppen hedmark, och till viss del av tallskog. Många olika sorters fåglar och insekter trivs där, bland annat finns de sårbara fjärilsarterna malörts-kapuschongfly och klocksäckspinnare i området.\\nUte på hedmarken så växer det mycket blommor och andra växter. Där finns även en del fridlysta växter, bland annat fältsippa och hedblomster."},{"page_url":"https://es.wikipedia.org/wiki/Avillers_(Vosgos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Map_commune_FR_insee_code_88023.png","page_title":"Avillers (Vosgos)","context_page_description":"Avillers es una población y comuna francesa, en la región de Lorena, departamento de Vosgos, en el distrito de Épinal y cantón de Charmes."},{"page_url":"https://pl.wikipedia.org/wiki/Belluno","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Belluno-Schiara.jpg","page_title":"Belluno","context_page_description":"Belluno – miasto i gmina we Włoszech, w regionie Wenecja Euganejska, w prowincji Belluno. Według danych na styczeń 2009 gminę zamieszkiwało 36 618 osób przy gęstości zaludnienia 248,8 os./1 km².\\n18 września 1765 w Belluno urodził się Bartolomeo Alberto Cappellari, przyszły papież Grzegorz XVI."},{"page_url":"https://mg.wikipedia.org/wiki/Campagne,_H%C3%A9rault","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Blason_ville_fr_Campagne_%28H%C3%A9rault%29.svg","page_title":"Campagne, Hérault","context_page_description":"I Campagne, Hérault dia kaominina ao amin'ny fivondronan'i Montpellier, ao amin'ny departemantan'i Hérault, ao amin'ny faritr'i Languedoc-Roussillon, ao Frantsa.\\nNy INSEE dia mampiasa ny kaodim-paositra 34048.\\nI Jacques Gravegeal no ben'ny tanàna mandritry ny taona 2008–2014. Ilay kaominina dia kaominina mpikambana amin'ny fivondronan-kaominin'i Ceps et Sylves"},{"page_url":"https://en.wikipedia.org/wiki/Holy_Rosary_Catholic_Church_(St._Marys,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Catholic_Church_and_School_%2816260455506%29.jpg","page_title":"Holy Rosary Catholic Church (St. Marys, Ohio)","context_page_description":"Holy Rosary Catholic Church is a Roman Catholic parish on the east side of St. Marys, Ohio, United States. Established in 1852, the church has been recognized for its historic 1860s church building, which was demolished amid a period of growth in the 1970s and replaced with a modernist structure."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D0%BE_%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/BASA-968-1-6-14-Simo_Sokolov.jpg","page_title":"Симо Соколов","context_page_description":"Симо Соколов е български революционер и офицер от сръбската армия. Участник в Сръбско-турската от 1876 и Руско-турската война от 1877 – 1878 година и предводител на освободителното въстание в Трънско и Кумановско. След Освобождението на България е офицер от българската армия и народен представител в I Обикновено народно събрание."},{"page_url":"https://sv.wikipedia.org/wiki/Negative_Temperature_Coefficient","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Heissleiter2.jpg","page_title":"Negative Temperature Coefficient","context_page_description":"Negative Temperature Coefficient eller NTC är ett motstånd som är temperaturberoende. Den ger låg resistans då det är varmt och hög resistans då det är kallt. Detta temperaturberoende av elektrisk motstånd är typisk för halvledare."},{"page_url":"https://en.wikipedia.org/wiki/Samuel_Swinton_Jacob","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Rajasthan-Jaipur-Albert-Hall-Museum-cupola-towers-Apr-2004-00.JPG","page_title":"Samuel Swinton Jacob","context_page_description":"Sir Samuel Swinton Jacob, KCIE, CVO was a British Army officer and colonial engineer, architect and writer, best known for the numerous Indian public buildings he designed in the Indo-Saracenic style."},{"page_url":"https://en.wikipedia.org/wiki/Fiat_Mirafiori","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Stabilimento_Fiat_Mirafiori%2C_veduta_aerea%2C_Torino_1942_-_san_dl_SAN_IMG-00001319.jpg","page_title":"Fiat Mirafiori","context_page_description":"The Stabilimento di Mirafiori is the headquarters and industrial district of the Italian automobile manufacturer Fiat a subsidiary of FCA Italy, which is part of Fiat Chrysler Automobiles, and is the headquarters of CNH Industrial Group.\\nThe name Mirafiori derives from the homonymous district in which it is located.\\nIn the past, it was the largest Italian industrial complex, as well as the oldest automobile factory in Europe, still partially in operation today. It occupies an area of 2,000,000 m². Twenty kilometers of railway lines and 11 kilometers of underground roads link the various warehouses. The office building, which overlooks Corso Giovanni Agnelli, is a 5-storey building 220 meters long, covered with white Finale stone. The self-consumed electricity production of the plant was around 210 GWh/year in 2011. Today around 18,000 workers are working in the area and in 2012 there were about 41,600 cars produced. Actually produced the luxury crossover Maserati Levante.\\nIn 80 years since the inauguration over 35 types of cars and 28.7 million vehicles has been produced at the Mirafiori plant."},{"page_url":"https://id.wikipedia.org/wiki/Dinasti_Tang","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Dunhuang_star_map.jpg","page_title":"Dinasti Tang","context_page_description":"Dinasti Tang, dalam romanisasi Wade-Giles ditulis Dinasti T‘ang, adalah salah satu dinasti Tiongkok yang menggantikan Dinasti Sui dan mendahului periode Lima Dinasti dan Sepuluh Kerajaan. Dinasti ini didirikan oleh keluarga Li, yang mengambil alih kekuasaan pada masa kemunduran dan keruntuhan dinasti Sui. Keberlangsungan dinasti ini sempat terputus saat Maharani Wu Zetian mengambil alih takhta dan mengumandangkan berdirinya dinasti Zhou Kedua, dan menjadi satu-satunya kaisar perempuan dalam sejarah Tiongkok. Dinasti ini berkuasa selama rentang waktu 289 tahun dengan 21 kaisar.\\nDinasti Tang, dengan ibu kota di Chang'an yang saat itu merupakan kota terpadat di dunia, dianggap sebagai salah satu titik puncak dalam sejarah Tiongkok, sebuah zaman keemasan budaya kosmopolitan. Luas wilayahnya, yang diperoleh melalui kampanye militer penguasa-penguasa awalnya, menyaingi luas dinasti Han. Berdasarkan dua sensus pada abad ke-7 dan abad ke-8, catatan-catatan Tang memperkirakan jumlah penduduk sekitar 50 juta jiwa. Pada abad ke-9, karena kekaisaran sedang mengalami kemunduran dan tidak dapat mengadakan sensus yang akurat, diperkirakan jumlah penduduk Tang tercatat sekitar 80 juta jiwa."},{"page_url":"https://en.wikipedia.org/wiki/Gurramkonda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Gurramkonda-Maqbara_Tomb-1.jpg","page_title":"Gurramkonda","context_page_description":"Gurramkonda is a village in Chittoor district of the Indian state of Andhra Pradesh. It is the Mandal headquarters of Gurramkonda Mandal. Gurramkonda Fort is one of the oldest fort in the district. Gurramkonda is a village in the Kurramkonda Mandal of the state of Andhra Pradesh, Chittoor District. It is located at a distance of 0 km from the center of the zones, Horamkonda. It is 35 km from the nearest town, Madanapalle. Is also in the distance. As per the 2011 census of India, the village is spread over 3111 hectares with 2501 houses and a population of 10642. The number of males in the village is 5480, the number of females is 5162. The Scheduled Castes population is 511 and the Scheduled Tribes population is 126. The census location code of the village is 595648. [1]. 13.7833 ° N 78.5833 ° E. on the road to Kadapa, Kadapa, Bangalore [2] The sea can reach 647 meters. The town is a tourist hotspot. It is also historically known as Jaffarabad. Located on Kadapa-Bengaluru Road, this horse-hill is a popular tourist attraction with its historical background. It is a communal harmony with the Hindu and Muslim cultures of the day."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_9_du_m%C3%A9tro_de_Paris","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Subway-Saint-Martin-00.jpg","page_title":"Ligne 9 du métro de Paris","context_page_description":"La ligne 9 du métro de Paris est une des seize lignes du réseau métropolitain de Paris. Elle relie la station Pont de Sèvres située à Boulogne-Billancourt, à l'ouest de Paris, seconde ville de la région pour sa population, à la station Mairie de Montreuil à Montreuil, deuxième commune la plus peuplée de la Seine-Saint-Denis après Saint-Denis, à l'est de la capitale. Cette ligne est une des plus longues et des plus fréquentées du réseau, avec 143 millions de voyageurs en 2018, ce qui la place en troisième position de l'ensemble des lignes de métro de la RATP, après la ligne 1 et la 4.\\nSon parcours traverse le sud-ouest, le centre-nord et l'est de la capitale française avec un tracé parabolique, commun avec la ligne 8 sur une partie de son itinéraire. Elle relie deux secteurs socialement très opposés, les quartiers bourgeois de l'ouest parisien et les quartiers populaires de l'est en voie de gentrification. Elle est également en correspondance avec toutes les autres lignes de métro, à l'exception des courtes lignes 3 bis et 7 bis ; toutefois, avec la ligne 12 et avec la ligne 14, cette correspondance nécessite d'emprunter un couloir de liaison entre Saint-Augustin et Saint-Lazare)."},{"page_url":"https://zh.wikipedia.org/wiki/2099%E5%B9%B49%E6%9C%8814%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/SE2099Sep14T.png","page_title":"2099年9月14日日食","context_page_description":"2099年9月14日日食为一次在协调世界时2099年9月14日出现的一次日全食。该次日食食分为1.0684，食甚维持时间5分18秒。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%80%D0%B0%D0%BC%D0%B8%D0%B4%D0%BA%D0%B0_%D0%9C%D0%B5%D1%84%D1%84%D0%B5%D1%80%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Pyraminx_disassembled_1.png","page_title":"Пирамидка Мефферта","context_page_description":"Пирамидка Мефферта, «Молдавская пирамидка» или «Японский тетраэдр» — головоломка в форме правильного тетраэдра, подобная кубику Рубика. Каждая грань тетраэдра поделена на 9 правильных треугольников. Задача состоит в том, чтобы перевести пирамидку в конфигурацию с одноцветными гранями.\\nИногда за схожесть с кубическим аналогом называют также «Тетраэдр Рубика», хотя Эрнё Рубик не имеет никакого отношения к созданию этой головоломки."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BB%D0%BE_%D0%BE_%D0%BA%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D1%85_%D1%81%D0%BD%D0%B0%D0%B9%D0%BF%D0%B5%D1%80%D0%B0%D1%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Ukraine-Kyiv-Chrestjatyk-Hotel_%22Ukraine%22.JPG","page_title":"Дело о киевских снайперах","context_page_description":"Дело о киевских снайперах — вопрос об организаторах и исполнителях снайперской стрельбы по участникам Евромайдана и одновременно по сотрудникам правоохранительных органов в Киеве 20 февраля 2014 года, в результате которой погибло 53 человека.\\nУчастники протестов и новые украинские власти обвиняют в этих событиях режим Януковича, а также Россию. Российские официальные власти и тогдашние украинские руководители, в свою очередь, считают, что стрельба была организована представителями Евромайдана для создания «сакральных жертв» и обострения революционной ситуации.\\n24 февраля и. о. министра внутренних дел Арсен Аваков сообщил на своей странице в одной из социальных сетей о возбуждении уголовного дела по факту массовых убийств мирных граждан, в связи с чем Янукович и ряд других должностных лиц объявлены в розыск. В ходе расследования также выдвинуты обвинения сотрудникам правоохранительных органов.\\nВ то же время в начале марта 2014 года появились предположения о том, что стрельбу могли организовать другие стороны конфликта в провокационных целях, в частности, представители спецслужб России."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E6%98%8C%E7%9C%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Yingxian_Bridge_05_2019-12.jpg","page_title":"新昌県","context_page_description":"新昌県は中華人民共和国浙江省紹興市に位置する県。"},{"page_url":"https://ht.wikipedia.org/wiki/Sugar_Hill,_Georgie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/GAMap-doton-SugarHill.PNG","page_title":"Sugar Hill, Georgie","context_page_description":"Sugar Hill, Georgie se yon vil Etazini. Li sitye nan leta Georgie.\\nChèf-lye li se?\\n."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D1%98%D0%B0,_%D0%BF%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BB%D0%BE%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%BD%D0%B8%D1%86%D0%B0_%D0%A8%D0%B2%D0%B5%D0%B4%D1%81%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Kronprinsessan_Victoria%2C_prinsessan_Estelle_och_Prins_Daniel-5.jpg","page_title":"Викторија, престолонаследница Шведске","context_page_description":"Викторија, престолонаследница Шведске, војвоткиња од Вестерготланда, пуним именом Викторија Ингрид Алис Дезире, најстарија је кћи краља Карла XVI Густафа и краљице Силвије од Шведске, и наследница шведског престола."},{"page_url":"https://sk.wikipedia.org/wiki/Garrosse","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Map_commune_FR_insee_code_40107.png","page_title":"Garrosse","context_page_description":"Garrosse je francúzska obec, ktorá sa nachádza v departemente Landes, v regióne Akvitánsko."},{"page_url":"https://sv.wikipedia.org/wiki/Cant%C3%B3n_Quijos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Baeza_Thunderstorm.JPG","page_title":"Cantón Quijos","context_page_description":"Cantón Quijos är en kanton i Ecuador. Den ligger i provinsen Napo, i den centrala delen av landet, 50 km sydost om huvudstaden Quito. Antalet invånare är 6 224. Arean är 1 557 kvadratkilometer.\\nTerrängen i Cantón Quijos är huvudsakligen bergig, men åt sydväst är den kuperad.\\nÅrsmedeltemperaturen i trakten är 4 °C. Den varmaste månaden är januari, då medeltemperaturen är 6 °C, och den kallaste är juni, med 0 °C. Genomsnittlig årsnederbörd är 1 907 millimeter. Den regnigaste månaden är april, med i genomsnitt 208 mm nederbörd, och den torraste är juli, med 90 mm nederbörd."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%AE%D8%B3%D9%88%D9%81%D8%A7%D8%AA_%D8%A7%D9%84%D9%82%D9%85%D8%B1_%D9%81%D9%8A_%D8%A7%D9%84%D9%82%D8%B1%D9%86_21","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Lunar_eclipse_from_moon-2041Nov08.png","page_title":"قائمة خسوفات القمر في القرن 21","context_page_description":"يشهد القرن الواحد والعشرين 230 خسوفًا قمريًا منهم 85 خسوفًا كاملًا و 58 خسوفًا جزئيًا و 87 خسوفًا شبه ظل.\\nوتنشأ ظاهرة خسوف القمر في منتصف الشهر القمري عندما تحجب الأرضُ ضوءَ الشمس أو جزءاً منه عن القمر.\\nبمعدل خسوفين لكل سنة.\\nويمكن رؤية الخسوف في المناطق التي يكون فيها القمر فوق الأفق. وتحدث تلك الظاهرة عبر المراحل التالية\\nيبدأ القمر بدخول منطقة شبه ظل الأرض فيبدأ ضوءه بالخفوت دون أن يخسف. ومنطقة شبه الظل التي ينحجب فيها بعض ضوء الشمس عن القمر بسبب الأرض.\\nيبدأ القمر بدخول منطقة ظل الأرض فيبدأ الخسوف الجزئي. ومنطقة ظل الأرض هي المنطقة التي تنحجب فيها الشمس كاملة بسبب الأرض.\\nيخسف كامل قرص القمر عند اكتمال دخوله إلى منطقة ظل الأرض.\\nيبدأ القمر بالخروج من منطقة ظل الأرض فينتهي الخسوف الكلي.\\nتم تقسيم خسوفات القمر في الجدول التالي إلي مجموعات حسب التقويم القمري الذي تتم فيه السنة القمريًا بمرور 12 شهر وذلك بإتمام العقدة المدارية، وبالنسبة للخسوفات أثناء العقدة المدارية التصاعدية فتم وسمها باللون أحمر في خلفية الجدول."},{"page_url":"https://es.wikipedia.org/wiki/Universidad_de_Oklahoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/PriceHall.jpg","page_title":"Universidad de Oklahoma","context_page_description":"La Universidad de Oklahoma, también conocida como OU es una universidad pública situada en Norman en la parte central del estado de Oklahoma, en los Estados Unidos. Con 30.447 estudiantes matriculados, es el centro de estudios superiores más importante en el estado de Oklahoma. Junto al campus principal en Norman, también dispone de un hospital clínico y una facultad de medicina en Oklahoma City, así como una sede en Tulsa con aproximadamente 3500 estudiantes. La universidad es especialmente famosa por su investigación y docencia en las áreas de arquitectura, geología, historia de las ciencias, meteorología, estudios americanos nativos, ingeniería de petróleos, derecho y danza."},{"page_url":"https://fr.wikipedia.org/wiki/Fleur_des_champs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Ranunculus_acris.jpg","page_title":"Fleur des champs","context_page_description":"Fleur des champs est un tableau peint par Louis Janmot en 1845 et conservé au musée des Beaux-Arts de Lyon."},{"page_url":"https://fr.wikipedia.org/wiki/Greta_Garbo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Ninotchka_lobby_card.jpg","page_title":"Greta Garbo","context_page_description":"Greta Lovisa Gustafsson, dite Greta Garbo /ˈɡrêːta ˈɡǎrːbʊ/ est une actrice suédoise naturalisée américaine, née le 18 septembre 1905 à Stockholm et morte le 15 avril 1990 à New York.\\nD'origine modeste, son père étant balayeur de rue à Stockholm, elle quitte l'école en 1920 pour des raisons financières et devient savonneuse chez un barbier, puis vendeuse dans un grand magasin. Elle pose alors comme modèle pour le catalogue de ce magasin et joue dans des films publicitaires, produits par ce grand magasin, jusqu'à sa démission, « pour faire des films » et son inscription au Conservatoire royal d'Art dramatique de Suède. Elle fait à cette occasion la rencontre de Mauritz Stiller, à la recherche de jeunes comédiennes pour son prochain film et qui devient son mentor.\\nEn 1923, elle prend pour nom de scène Garbo, multiplie les rôles au théâtre et tourne avec Stiller la Légende de Gösta Berling, qui sort en 1924. Elle est alors repérée par le réalisateur autrichien Georg Wilhelm Pabst qui l'emploie dans la Rue sans joie en 1925, tourné à Berlin."},{"page_url":"https://en.wikipedia.org/wiki/1967_in_Norway","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Karin_S%C3%B8raunet.jpg","page_title":"1967 in Norway","context_page_description":"Events in the year 1967 in Norway."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Martory","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/269_St-Martory.JPG","page_title":"Saint-Martory","context_page_description":"Saint-Martory är en kommun i departementet Haute-Garonne i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Saint-Martory som tillhör arrondissementet Saint-Gaudens. År 2009 hade Saint-Martory 881 invånare."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EB%8B%88%EC%95%84_(%EA%B0%80%EC%88%98)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/DabrowskaAnia.jpg","page_title":"아니아 (가수)","context_page_description":"아니아는 폴란드의 싱어송라이터이다."},{"page_url":"https://de.wikipedia.org/wiki/Nikola_Portner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/20150106_1902_Handball_AUTSUI_7418.jpg","page_title":"Nikola Portner","context_page_description":"Nikola Portner ist ein Schweizer Handballspieler serbischer Abstammung.\\nNikola Portners Vater ist der ehemalige Handballspieler Zlatko Portner.\\nMit acht Monaten zog die Familie aus Frankreich nach Bern. Mit 11 Jahren spielte er für den Schweizer Verein BSC Grosshöchstetten. Bei Handball Grauholz, wo sein Vater Trainer war, debütierte er in der NLB. Seit 2008 besitzt Portner die Schweizer Staatsbürgerschaft.\\nDer 1,94 m große und 96 kg schwere Torwart spielte ab 2010 beim Schweizer Verein BSV Bern Muri in der NLA. Nach der Saison 2011/12 wurde er mit dem Swiss Handball Award als bester Newcomer des Jahres ausgezeichnet. International erreichte er mit Bern das Viertelfinale im Europapokal der Pokalsieger 2011/12, die 3. Runde im EHF Challenge Cup 2010/11 und 1. Runde im EHF Europa Pokal 2012/13. Zur Saison 2014/15 wechselte er zu den Kadetten Schaffhausen. Mit den Kadetten Schaffhausen gewann er 2015 und 2016 die Schweizer Meisterschaft sowie 2016 den SHV-Cup. Seit dem Sommer 2016 steht er beim französischen Erstligisten Montpellier AHB unter Vertrag. Mit Montpellier gewann er 2018 die EHF Champions League. Zur Saison 2020/21 wechselt er zum Ligakonkurrenten Chambéry Savoie HB."},{"page_url":"https://sv.wikipedia.org/wiki/Dovania_poecila","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Dovania_poecila_poecila_BMNHE274210_male_up.jpg","page_title":"Dovania poecila","context_page_description":"Dovania poecila är en fjärilsart som beskrevs av Rothschild och Jordan 1903. Dovania poecila ingår i släktet Dovania och familjen svärmare. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://da.wikipedia.org/wiki/Anthony_Jackson","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Anthony_Jackson.jpg","page_title":"Anthony Jackson","context_page_description":"Anthony Jackson er en amerikansk elbassist.\\nJackson er en af de mest indspillede elbassister. Han har spillet på mere end 3000 plader og var en af de første bassister til at spille med seks strenge på bassen, kontra de normale fire strenge.\\nJackson, der er en alsidig bassist, har spillet med bl.a. Buddy Rich, Chick Corea, Steve Gadd, Dave Weckl, Michel Petrucciani, Dizzy Gillespie, Paul Simon, Pat Metheny, Chaka Khan, Al Di Meola, Dennis Chambers, Michael Brecker, Michel Camilo, Harvey Mason, Lee Ritenour, Dave Grusin, Vinnie Colaiuta, Billy Cobham, Bill Watrous etc."},{"page_url":"https://da.wikipedia.org/wiki/Rationering","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Danske_Rationeringsmaerker_%28ubt%29.jpg","page_title":"Rationering","context_page_description":"Rationering går ud på at styre salget af en vare der er mangel på, for eksempel ved at uddele rationeringsmærker til begrænset indkøb af varer."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Salvatore_alle_Coppelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/San_Salvatore_alle_Coppelle.JPG","page_title":"Chiesa di San Salvatore alle Coppelle","context_page_description":"La chiesa di San Salvatore alle Coppelle, è una chiesa di Roma, nel rione Sant'Eustachio, in piazza delle Coppelle."},{"page_url":"https://ms.wikipedia.org/wiki/Bangsa_Han","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Hanfu_man_and_lady.jpg","page_title":"Bangsa Han","context_page_description":"Bangsa Han ialah kelompok etnik yang berasal dari China. Sebagai kelompok etnik yang merupakan kaum Cina yang terbesar, ia juga merupakan kelompok etnik yang terbesar di dunia, dengan bilangan melebihi 1.3 bilion orang. Bangsa Han merupakan lebih kurang 92% daripada jumlah penduduk tanah besar China dan sekitar 19% daripada jumlah penduduk dunia. Terdapat perbezaan genetik, linguistik, kebudayaan, dan sosial yang amat besar antara berbagai-bagai subkumpulannya, khususnya disebabkan oleh beribu-ribu tahun asimilasi pelbagai kelompok etnik serta puak-puak di China. Bangsa Han secara tradisi dilambangkan dengan warna merah."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%81%D0%BA%D0%BE%D0%BD%D1%96%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Maule.jpg","page_title":"Басконія","context_page_description":"Баско́нія — історико-культурний регіон у Європі, на південному заході Франції і півночі Іспанії. Це територія традиційного розселення басків, де поширені баскійська мова, культура, традиції або де вони були поширені у минулому.\\nУ складі Іспанії існує баскійська автономія під назвою Країна Басків, яка охоплює лише західну частину історичного регіону. Тому в іспанській мові термін País Vasco зазвичай стосується лише баскійської автономії, а весь регіон називають Vasconia або баскійським терміном Euskal Herria."},{"page_url":"https://fr.wikipedia.org/wiki/Plouarzel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Pointe_de_Corsen.jpg","page_title":"Plouarzel","context_page_description":"Plouarzel [pluaʁzɛl] est une commune du département du Finistère, dans la région Bretagne, en France."},{"page_url":"https://en.wikipedia.org/wiki/Panamanian_white-faced_capuchin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Cebus_capucinus%2C_Costa_Rica.JPG","page_title":"Panamanian white-faced capuchin","context_page_description":"The Panamanian white-faced capuchin, also known as the Panamanian white-headed capuchin or Central American white-faced capuchin, is a medium-sized New World monkey of the family Cebidae, subfamily Cebinae. Native to the forests of Central America, the white-faced capuchin is important to rainforest ecology for its role in dispersing seeds and pollen.\\nAmong the best known monkeys, the Panamanian white-faced capuchin is recognized as the typical companion to the organ grinder. In recent years the species has become popular in North American media, particularly in the Pirates of the Caribbean film series. It is a highly intelligent monkey and has been trained to assist paraplegic persons. It is a medium-sized monkey, weighing up to 3.9 kg. It is mostly black, but with a pink face and white on much of the front part of the body, giving it its common name. It has a distinctive prehensile tail that is often carried coiled up and is used to help support the monkey when it is feeding beneath a branch."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B0%D1%80%D0%BD%D0%B0_(%D0%B3%D0%BC%D0%B8%D0%BD%D0%B0,_%D0%9B%D0%B0%D0%BD%D1%8C%D1%86%D1%83%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%8F%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/POL_gmina_Czarna_COA.png","page_title":"Чарна (гмина, Ланьцутский повят)","context_page_description":"Чарна — сельская гмина в Польше, входит как административная единица в Ланьцутский повят, Подкарпатское воеводство. Население — 10 770 человек."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%AC%D8%B2%D8%B1_%D8%A3%D9%84%D9%85%D8%A7%D9%86%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Schloss_Ralswiek_2_crop.jpg","page_title":"قائمة جزر ألمانيا","context_page_description":"هذه قائمة قائمة بجميع المناطق البحرية الجزيرة التي تنتمي إلى ألمانيا، والتي توجد في الشمال و بحر البلطيق.\\nبالإضافة إلى ذلك، يتم سرد بعض الجزر في المياه الداخلية أيضا."},{"page_url":"https://de.wikipedia.org/wiki/St._Johannis_(Magdala)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Magdala-Kirche-4-CTH.JPG","page_title":"St. Johannis (Magdala)","context_page_description":"Die evangelische Stadtkirche St. Johannis steht in der Stadt Magdala im Landkreis Weimarer Land in Thüringen. Sie gehört zum Kirchspiel Magdala/Bucha im Kirchenkreis Jena der Evangelischen Kirche in Mitteldeutschland."},{"page_url":"https://de.wikipedia.org/wiki/Linuron","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Linuron_USA_2011.png","page_title":"Linuron","context_page_description":"Linuron ist ein Wirkstoff zum Pflanzenschutz und eine chemische Verbindung aus der Gruppe der organischen Chlorverbindungen und Harnstoffderivate."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%86%D8%AA%D8%B1%DA%A9%D9%88%D9%B9_%D8%A2%D8%A8%D8%B4%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Chitrakot_Falls1.JPG","page_title":"چترکوٹ آبشار","context_page_description":"چترکوٹ آبشار آبشار ہے جو بھارت میں واقع ہے اس کے مقام بہاؤ کی مجموعی بلندی 29 میٹر ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Washington_County,_Maryland","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Map_of_Maryland_highlighting_Washington_County.svg","page_title":"Washington County, Maryland","context_page_description":"Washington County is located in the western part of the U.S. state of Maryland. As of the 2010 census, the population was 147,430. Its county seat is Hagerstown. Washington County was the first county in the United States to be named for the Revolutionary War general George Washington. Washington County is one of three Maryland counties recognized by the Appalachian Regional Commission as being part of Appalachia.\\nThe county borders southern Pennsylvania to the north, Northern Virginia to the south, and the Eastern Panhandle of West Virginia to the south and west.\\nWashington County is included in the Hagerstown-Martinsburg, MD-WV Metropolitan Statistical Area, which is also included in the Washington-Baltimore-Arlington, DC-MD-VA-WV-PA Combined Statistical Area."},{"page_url":"https://pl.wikipedia.org/wiki/Okuniew","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/PL_Okuniew_Church.jpg","page_title":"Okuniew","context_page_description":"Okuniew – dawne miasto, obecnie wieś w Polsce położona w województwie mazowieckim, w powiecie mińskim, w gminie Halinów.\\nOkuniew uzyskał lokację miejską w 1538 roku, zdegradowany w 1870 roku.\\nOkuniew położony był w 1580 roku w powiecie warszawskim ziemi warszawskiej województwa mazowieckiego. Do 1954 roku Okuniew był siedzibą gminy Okuniew, a w latach 1815–1831 powiatu okuniewskiego. W latach 1975–1998 miejscowość administracyjnie należała do województwa warszawskiego."},{"page_url":"https://cs.wikipedia.org/wiki/Alice_Masarykov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Masarykova-Photo.jpg","page_title":"Alice Masaryková","context_page_description":"Alice Garrigue Masaryková byla veřejná činitelka, zakladatelka a první předsedkyně Československého červeného kříže, bojovala za zlepšení sociální situace a vzdělávaní žen. Byla dcerou Charlotty Garrigue-Masaryk a Tomáše Garrigua Masaryka."},{"page_url":"https://cy.wikipedia.org/wiki/Collinsville,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Julia_Carson_Stockett.jpg","page_title":"Collinsville, Illinois","context_page_description":"Dinas yn Madison County, St. Clair County, yn nhalaith Illinois, Unol Daleithiau America yw Collinsville, Illinois."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Bussi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Bussi_sul_Tirino_bahnhof_01.jpg","page_title":"Stazione di Bussi","context_page_description":"La stazione di Bussi è una stazione ferroviaria, ubicata sulla ferrovia Roma-Pescara, a servizio del comune di Bussi sul Tirino."},{"page_url":"https://fr.wikipedia.org/wiki/Sid_Ahmed_Belkedrouci","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Sid_Ahmed_Belkedrouci_%282015%29.jpg","page_title":"Sid Ahmed Belkedrouci","context_page_description":"Sid Ahmed Belkedrouci né le 20 décembre 1950 à Oujda au Maroc est un footballeur international algérien des années 1970. Jouant au poste de milieu, il a fait les beaux jours du MC Oran.\\nIl compte vingt sélections en équipe nationale entre 1974 et 1979.il a joué a l'èquipe nationale militaire"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Bornem","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Kapel_Luipegem.jpg","page_title":"Lijst van onroerend erfgoed in Bornem","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Bornem. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://de.wikipedia.org/wiki/%C3%9Cber_Land_und_Meer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/UeberLandUndMeerGesellschaftsspiel2017_11_25_M.jpg","page_title":"Über Land und Meer","context_page_description":"Über Land und Meer war ein illustriertes Unterhaltungsblatt, das von 1858 bis 1923 wöchentlich in Stuttgart zunächst im Folio-Format, später auch zusätzlich im Oktav-Format erschien. Das Wochenblatt trug den Untertitel Allgemeine Illustrirte Zeitung und wies damit auf das Vorbild, die erfolgreiche Illustrirte Zeitung hin."},{"page_url":"https://ca.wikipedia.org/wiki/Barranc_de_l%27Alberca","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Barranc_de_l%27Alberca_per_Ondara.JPG","page_title":"Barranc de l'Alberca","context_page_description":"El riu de l'Alberca és un torrent fluvial de la Marina Alta que creua Ondara d'oest a l'est i es desemboca al mediterrani al sud de Els Poblets i al nord de Dénia. Naix en Pedreguer, en una llacuna anomenada \\"el forat de l'alberca\\" A l'entrada a la vila d'Ondara l'Alberca es troba amb un assut que durant la majoria de l'any deixa sec la resta del seu recorregut natural. Eixe assut és una presa a la qual dóna aigua una font, la van construir els musulmans. L'Alberca es desemboca a la platja de les Deveses."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Pierre-%C3%A8s-Liens_de_Cond%C3%A9court","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Cond%C3%A9court_%2895%29%2C_%C3%A9glise_Saint-Pierre-%C3%A8s-Liens%2C_nef%2C_plafond_1.JPG","page_title":"Église Saint-Pierre-ès-Liens de Condécourt","context_page_description":"L'église Saint-Pierre-ès-Liens, ou Saint-Pierre-aux-Liens, est une église catholique paroissiale située à Condécourt, dans le département français du Val-d'Oise. Elle remonte, dans ses parties les plus anciennes, à la fin du XIᵉ siècle : il s'agit de la base du clocher avec ses arcades en plein cintre retombant sur des impostes décorés de dents-de-scie, et sa voûte d'arêtes. Cette travée n'est pas visible depuis l'extérieur, car englobée dans des constructions plus récentes. Le premier étage du clocher octogonal est lui aussi d'un style roman archaïque, et ne devrait pas être antérieur au tout début du XIIᵉ siècle. Le second étage, plus simple, a été ajouté à la période gothique. Globalement, l'église Saint-Pierre-ès-Liens est d'une architecture assez simple, avec un seul niveau d'élévation, et se caractérise par la juxtaposition de quatre espaces carrés issues de quatre campagnes de construction distinctes, à savoir la nef rustique du XVIIIᵉ siècle ; la base du clocher déjà signalée ; le chœur gothique du second quart du XIIIᵉ siècle ; et la travée droite de la chapelle de la Vierge, au nord du clocher."},{"page_url":"https://en.wikipedia.org/wiki/President_of_the_League_of_Communists_of_Macedonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%D0%90%D0%BD%D0%B3%D0%B5%D0%BB_%D0%A7%D0%B5%D0%BC%D0%B5%D1%80%D1%81%D0%BA%D0%B8.jpg","page_title":"President of the League of Communists of Macedonia","context_page_description":"The Secretary of the Central Committee of the League of Communists of Macedonia was the head of the League of Communists of Macedonia, heading the Central Committee of the Party. The holder of the office was, for a significant period, the de facto most influential politician in the Socialist Republic of Macedonia, a constituent republic of Yugoslavia. The official name of the office was changed in May 1982 from \\"Secretary of the Central Committee\\" to President of the Presidency of the Central Committee of the League of Communists of Macedonia.\\nThe League of Communists of Macedonia was also an organization subordinate to the federal-level League of Communists of Yugoslavia. Between March 1943 and September 1952, the former was named the Communist Party of Macedonia, until both parties were renamed \\"League of Communists\\" in 1952."},{"page_url":"https://eu.wikipedia.org/wiki/Rhinopoma_hardwickii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Lesser_Mouse-tailed_Bat_area.png","page_title":"Rhinopoma hardwickii","context_page_description":"Rhinopoma hardwickii Rhinopoma generoko animalia da. Chiropteraren barruko Rhinopomatidae familian sailkatuta dago."},{"page_url":"https://en.wikipedia.org/wiki/Herron_Hill_Pumping_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/HerronHill2.jpg","page_title":"Herron Hill Pumping Station","context_page_description":"The Herron Hill Pumping Station is located at 4501 Centre Avenue in the North Oakland neighborhood of Pittsburgh, Pennsylvania. Built in the Classical Revival architectural style, the building was instrumental in distributing water throughout Pittsburgh’s East End neighborhoods, such as the Hill District and Squirrel Hill. In May 2020, Preservation Pittsburgh nominated the structure for City of Pittsburgh Historic Landmark status. In July 2020, the City of Pittsburgh's Historic Review Commission determined that the structure's nomination to be a City of Pittsburgh Historic Landmark was viable."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%A9l%C3%A8ne_de_Gr%C3%A8ce","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Famille_royale_de_Gr%C3%A8ce.jpg","page_title":"Hélène de Grèce","context_page_description":"Hélène de Grèce, princesse de Grèce et de Danemark puis reine mère de Roumanie, est née le 20 avril 1896 à Athènes, en Grèce, et morte le 28 novembre 1982 à Lausanne, en Suisse. Épouse malheureuse du futur Carol II de Roumanie, Hélène joue un certain rôle durant le second règne de son fils, le roi Michel Iᵉʳ, entre 1940 et 1947. Son action en faveur des Juifs roumains durant la Seconde Guerre mondiale lui vaut le titre posthume de Juste parmi les nations en 1993.\\nFille du roi Constantin Iᵉʳ de Grèce et de son épouse la reine Sophie de Prusse, la princesse Hélène partage son enfance entre la Grèce, le Royaume-Uni et l'Allemagne. Le déclenchement de la Première Guerre mondiale et le renversement de son père par les Alliés en 1917 marquent durablement la jeune fille, par ailleurs séparée de son frère préféré, le jeune Alexandre Iᵉʳ de Grèce. Exilée en Suisse avec la plupart des membres de la famille royale, Hélène passe alors plusieurs mois à s'occuper de son père, sujet à la maladie et à la dépression. En 1920, la princesse fait la connaissance de l'héritier du trône de Roumanie, qui ne tarde pas à lui demander sa main."},{"page_url":"https://fr.wikipedia.org/wiki/Tour_de_l%27Horloge_de_Montr%C3%A9al","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Tour_Horloge_Montreal_vue.JPG","page_title":"Tour de l'Horloge de Montréal","context_page_description":"adresse = 1 Rue Quai de l'Horloge, Montréal, QC H2L 5C1\\nLa tour de l’Horloge est une tour horloge située sur le Quai de l’horloge au Vieux-Port de Montréal. On l’appelait aussi Sailors’ Memorial Tower. Elle a été classée édifice fédéral du patrimoine en 1996."},{"page_url":"https://cs.wikipedia.org/wiki/D%C4%9Bjiny_Spojen%C3%A9ho_kr%C3%A1lovstv%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/MunichAgreement.jpg","page_title":"Dějiny Spojeného království","context_page_description":"Spojené království Velké Británie a Severního Irska je západoevropský stát, který zahrnuje Anglii, Skotsko, Wales na ostrově Velká Británie, a severovýchodní část ostrova Irsko, Severní Irsko. Zbytek tohoto ostrova byl součástí Spojeného království více než sto let.\\nStát se prakticky zformoval do dnešní podoby Zákonem o unii z roku 1707, které spojily Anglický a Skotský parlament a vytvořily tak Spojené království Velké Británie. Roku 1800 pak následoval Zákon o unii z roku 1800, jímž bylo k tomuto státu připojeno Irské království, čímž vzniklo Spojené království Velké Británie a Irska.\\nRoku 1922 získal nezávislost Irský svobodný stát, který však ponechal Severní Irsko jako součást Spojeného království. Výsledkem bylo, že od roku 1927 nese tento stát oficiální název Spojené království Velké Británie a Severního Irska. Často se ale nepřesně zkracuje na „Británie“, „Anglie“, „VB“ nebo „UK“."},{"page_url":"https://it.wikipedia.org/wiki/Alice_Hamilton","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Alice_Hamilton.jpg","page_title":"Alice Hamilton","context_page_description":"Alice Hamilton è stata un medico statunitense, meglio conosciuta come una dei maggiori esperti nel campo della salute sul lavoro e una pioniera nel campo della tossicologia industriale."},{"page_url":"https://sh.wikipedia.org/wiki/Matej_Me%C5%A1trovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Matej_Mestrovic.jpg","page_title":"Matej Meštrović","context_page_description":"Matej Meštrović, hrvatski pijanist i skladatelj. Sin je pijanistice Sretne Meštrović."},{"page_url":"https://it.wikipedia.org/wiki/General_Motors_Building_(New_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Apple_store_fifth_avenue.jpg","page_title":"General Motors Building (New York)","context_page_description":"Il General Motors Building è un grattacielo situato nella Quinta Strada Vicino Central Park. È stato costruito tra il 1964 e il 1968 e raggiunge un'altezza di 215 m. Il nome deriva da uno Showroom automobilistico della General Motors presente a piano terra, in seguito sostituito fino al 2015 da un negozio di punta della FAO Schwarz. Alla base del grattacielo è presente anche un Apple Store a forma di cubo di vetro paragonato alla Piramide del Louvre."},{"page_url":"https://en.wikipedia.org/wiki/Outline_of_Munich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/M%C3%BCnchner_Philharmoniker_im_Gasteig.jpg","page_title":"Outline of Munich","context_page_description":"The following outline is provided as an overview of and topical guide to Munich:\\nMunich – capital and the most populated city in the German state of Bavaria. With over 1,450,000 residents in 310.43 km2 it is also Germany's third most populated Großstadt. Munich is considered a global city as of 2015, one of the most prosperous and fastest growing cities in Germany."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%BE%D0%BD%D0%B8%D0%BA%D0%B0_%D0%9F%D0%B5%D1%80%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Guanacos-llamas-el-primero-imagen-en-europa-1553.jpg","page_title":"Хроника Перу","context_page_description":"«Хроника Перу» или «Перуанская хроника» — фундаментальное произведение по истории и географии Южной Америки XVI века. Автор книги — испанский историк Педро де Сьеса де Леон. Книга состоит из четырёх частей, и составляет примерно 8000 листов размера 13 х 16 дюймов. Впервые «Первая часть» была опубликована 15 марта 1553 года.\\nВ книге даны описания множества индейских этносов и их языков, в том числе приведена доколумбовая история Америки. Сведения из Хроники Перу стали важнейшим источником по истории империи инков для большинства позднейших историков, которые часто не указывали источники, — в особенности это относится к рукописям, опубликованным после смерти автора в 1554 году. В книге впервые сообщается о геоглифах Наски и грандиозных постройках Тиауанако, и археологических достопримечательностях доинкской поры, расположенных в провинциях: Чиму, Гуамачуко, Чачапояс, Колья и др; а также ряд городов: Куско, Учуй-Коско, Пачакамак, Ило, Пасто и многие другие."},{"page_url":"https://is.wikipedia.org/wiki/%C3%8Dslam","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Age_of_Caliphs.png","page_title":"Íslam","context_page_description":"Íslam, einnig nefnt múhameðstrú, er eingyðistrú og er guð þeirra nefndur Allah á arabísku og rekur uppruna sinn til arabíska spámannsins Múhameðs sem var uppi á 6. og 7. öld eftir Krist. Fylgjendur íslams kallast múslimar. Íslam er af abrahamískum stofni og talin næst fjölmennustu trúarbrögð heims á eftir kristni. Í samanburði við önnur trúarbrögð á íslam einna mest skylt við kristni og sækir ýmislegt til gyðingdóms þar sem lifað er eftir reglum svo sem hvað varðar matarvenjur, föstu á ákveðnum tímum, umskurn á kynfærum, reglulegar bænir og fleira. Margir trúarsiðir í íslam eru upprunnir úr heiðnum trúarbrögðum araba frá því fyrir tíma Múhameðs. Íslam er ekki einungis trúarbrögð heldur er þeim oft lýst sem allsherjar lífsreglum sem taka til allra þátta lífs múslima, bæði félagslegra, efnahagslegra, siðferðislegra og andlegra. Stjórnskipan, réttarfar, löggjöf, refsingar og almennar lífsvenjur múslima taka mið af trúartextum íslams og lífi spámannsins Múhameðs.\\nÍslam er stundum nefnd múhameðstrú á íslensku. Samsvarandi heiti voru notuð í flestum Evrópumálum en eru nú óðum á undanhaldi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B0%D1%80%D1%82%D0%B0%D0%BA_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1960)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Spartacus_-_1960_-_poster.png","page_title":"Спартак (фильм, 1960)","context_page_description":"«Спарта́к» — художественный фильм, пеплум режиссёра Стэнли Кубрика, поставленный по одноимённому роману Говарда Фаста в 1960 году. Первый высокобюджетный, цветной фильм Кубрика, сделавший имя молодому режиссёру. Сюжет картины рассказывает о восстании под предводительством раба-гладиатора Спартака, бросившем вызов власти Рима в лице консула Марка Лициния Красса. Кубрик не считал фильм своей авторской работой, так как был ограничен в принятии решений в ходе производства, оставшись в положении наёмного студийного режиссёра.\\nС бюджетом в 12 млн долларов картина стала самым дорогостоящим проектом компании Universal на 1960 год. Производство фильма оказалось сложным, в основном, из-за трудностей со сценарием, который полностью переписывался несколько раз, и цензурных правок. Несмотря на то что действие картины разворачивается в античное время, она затронула острые проблемы современности: расовую дискриминацию, преследование коммунистически настроенных деятелей культуры, однополую любовь. Сценаристом картины стал писатель из «Чёрного списка Голливуда» Далтон Трамбо."},{"page_url":"https://ca.wikipedia.org/wiki/Daddy-Long-Legs_(pel%C2%B7l%C3%ADcula_de_1919)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Daddy_Long_Legs_Poster.jpg","page_title":"Daddy-Long-Legs (pel·lícula de 1919)","context_page_description":"Daddy-Long-Legs és una pel·lícula muda dirigida per Marshall Neilan i protagonitzada per Mary Pickford entre altres. La pel·lícula, basada en la novel·la i obra de teatre homònima de Jean Webster, es va estrenar l'11 de maig de 1919. Era la primera pel·lícula que Pickford interpretava per a la First National i va suposar un dels grans èxits de l’any 1919 als Estats Units obtenint uns beneficis de 1.250.000 dòlars."},{"page_url":"https://vi.wikipedia.org/wiki/Sceloporus_horridus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sceloporus_horridus.jpg","page_title":"Sceloporus horridus","context_page_description":"Sceloporus horridus là một loài thằn lằn trong họ Phrynosomatidae. Loài này được Wiegmann mô tả khoa học đầu tiên năm 1834."},{"page_url":"https://es.wikipedia.org/wiki/Banda_de_M%C3%BAsica_Santa_Cecilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Banda_de_M%C3%BAsica_Santa_Cecilia.jpg","page_title":"Banda de Música Santa Cecilia","context_page_description":"La Banda de Música Santa Cecilia es una banda de música española natural de Elda, Alicante que hizo su presentación oficial en el 1852 por Joaquín Beltran, panadero y fundador la banda de música oficial de Elda.\\nSe trata de una de las bandas de música más jóvenes y con mayor éxito de crítica. Todo ello le ha servido, para pronto comenzar a participar en numerosos eventos nacionales e internacionales, así como para conseguir numerosos premios en diferentes certámenes de bandas de música populares."},{"page_url":"https://fi.wikipedia.org/wiki/Punaisen_Ristin_ja_Punaisen_Puolikuun_yhdistysten_kansainv%C3%A4linen_liitto","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Emblem_of_the_IFRC.svg","page_title":"Punaisen Ristin ja Punaisen Puolikuun yhdistysten kansainvälinen liitto","context_page_description":"Punaisen Ristin ja Punaisen Puolikuun yhdistysten kansainvälinen liitto toimii Punaisen Ristin ja Punaisen Puolikuun kansallisten yhdistysten keskusjärjestönä. Se perustettiin vuonna 1919, jolloin sen nimi oli Punaisen Ristin kansainvälinen liiga. IFRC:n tehtäviin kuuluu kansainvälisen Punaisen Ristin liikkeen katastrofiavun koordinoiminen luonnonkatastrofeissa. IFRC muodostaa yhdessä Punaisen Ristin kansainvälisen komitean ja 186 kansallisen yhdistyksen kanssa Punaisen Ristin ja Punaisen Puolikuun kansainvälisen liikkeen.\\nJärjestön päämaja sijaitsee Sveitsissä, Geneven lähellä Vernierissä."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%DB%8C%D8%B1%D9%86%D8%B1%D8%A7%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/New_Pudsey_Stn_2.jpg","page_title":"کایرنراین","context_page_description":"کایرنراین بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 142 نفر دیر. بۇ شهر ایسکاتلند اؤلکه‌سینده یئرلشیب."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1977","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/SamanthaMorton09TIFF.jpg","page_title":"Lijst van personen geboren in 1977","context_page_description":"Dit is een lijst van personen die geboren zijn in 1977.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Ipiales","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Virgen_de_las_Lajas.jpg","page_title":"Ipiales","context_page_description":"Ipiales es un municipio colombiano ubicado en el departamento de Nariño. Situado en la frontera con Ecuador, en el nudo de los Pastos, en el altiplano andino, relativamente cerca de la costa del océano Pacífico, al pie de monte amazónico y a la línea equinoccial, siendo una región panamazónica.\\nLa cabecera municipal forma parte de la conurbación binacional Tulcán-Ipiales, donde viven aproximadamente 196 630 habitantes, aunque estos datos podrían ser más elevados ya que la cifra dada para el municipio de Ipiales corresponde al censo 2005 y la del cantón de Tulcán del censo 2010. Según estimaciones, para el 2012 la población de ambas ciudades aglomeradas era de alrededor de 260 000 de habitantes, y es por tanto el área metropolitana fronteriza más poblada de la frontera ecuatoriana y la segunda más poblada de fronteras colombianas; teniendo Ipiales para el año 2016 una población estimada de 141 863 habitantes aproximadamente según las proyecciones del DANE."},{"page_url":"https://eu.wikipedia.org/wiki/How_Green_Was_My_Valley","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/How_Green_Was_My_Valley_4.jpg","page_title":"How Green Was My Valley","context_page_description":"How Green Was My Valley 1941ean John Fordek zuzendutako filma da, Richard Llewellynen izen bereko eleberrian oinarrituta. 10 Oscar Sarietarako izendapenak izan zituen, 5 lortuz."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%82%A4%E3%83%86%E6%B2%96%E6%B5%B7%E6%88%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/USS_Birmingham_comes_alongside_the_burning_USS_Princeton.jpg","page_title":"レイテ沖海戦","context_page_description":"レイテ沖海戦は、第二次世界大戦中の1944年10月20日から同25日にかけて、フィリピン周辺の広大な海域を舞台にして、日本海軍とアメリカ海軍及びオーストラリア海軍の間で交わされた一連の海戦の総称である。フィリピン奪回を目指して侵攻するアメリカ軍を、日本海軍が総力を挙げて迎撃する形で発生した。\\nレイテ沖海戦という呼称は、アメリカ軍が揚陸地点に定めた作戦上の要地であるレイテ湾に因んでいるが、戦争当時の日本はフィリピン沖海戦と呼んでおり、後にアメリカ側の呼称を採用した。双方合わせて20万人以上の海上兵員が参加し、日米共に稼働艦艇と航空機を総動員した膨大な数の兵器が投入されている事から史上最大の海戦と称される事もある。\\nこの6日間の海上戦役は、シブヤン海海戦、スリガオ海峡海戦、エンガノ岬沖海戦、サマール沖海戦といった四つの海戦で構成されており、その他に基地航空部隊による交戦も頻繁に行われていた。また、神風特別攻撃隊が初めて組織的に運用されている。連合艦隊の残存戦力の全てをつぎ込んだ決死の海上展開は「捷一号作戦」として発動された。日本海軍の艦隊戦力はこのレイテ沖海戦を最後にして事実上消滅し、10月20日にレイテ島に上陸したアメリカ軍のマッカーサーは、25日に同島に司令部を設置した。"},{"page_url":"https://nl.wikipedia.org/wiki/The_Birthday_Massacre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/The_Birthday_Massacre_2011.jpeg","page_title":"The Birthday Massacre","context_page_description":"The Birthday Massacre is een Canadese rockband uit Toronto, Ontario. Ze werd in 1999 opgericht als Imagica. In 2001 werd de nieuwe naam The Birthday Massacre, omdat Imagica al in gebruik bleek te zijn.\\nZe staan bekend om hun catchy muziek, die op zich vrolijk klinkt maar eigenlijk een duistere tekst bevat."},{"page_url":"https://fr.wikipedia.org/wiki/Sarrancolin","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Sarrancolin_la_mairie.jpg","page_title":"Sarrancolin","context_page_description":"Sarrancolin est une commune française située dans le département des Hautes-Pyrénées, en région Occitanie.\\nSes habitants sont les Sarrancolinois et les Sarrancolinoises."},{"page_url":"https://lt.wikipedia.org/wiki/Necuk%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Raijin%2C_God_of_Thunder_LACMA_M.87.263.34.jpg","page_title":"Necukė","context_page_description":"Necukė- maža skulptūra, kuri palaipsniui susikūrė Japonijoje, per daugiau nei 300 metų. Japonijoje pirmą kartą atsirado XVI a. antroje pusėje- XVII a. pradžioje, Edo laikotarpiu. Necukė plėtros aukso amžius prasidėjo nuo XVIII a. antros pusės ir tęsėsi iki XIX a. pradžios. Tuomet jie pelnė didžiausią palankumą ir tapo labai populiarūs.\\nPirmųjų necukė formos buvo labai paprastos ir mažai dekoruotos, paprastai jie priminė sagas. Vėliau necukė pradėjo keistis, tapdavo vis sudėtingesnio dizaino, rafinuoti.\\nTradiciniai Japonų apdarai – kimono ir kosode – neturėjo kišenių. Moterys savo smulkius asmeninius daiktus dėdavo į rankoves, tačiau vyrai savo daiktus, pavyzdžiui: tabako maišelius, pinigus ar vaistus dėdavo į sagemono. Įvairių rūšių sagemono kabindavo ant juosmens diržo, kad jis neslystų, buvo pridėtas pakabukas-svarmuo necukė. Visi trys objektai dažnai buvo dekoruojami sudėtingais drožiniais, lakuojami.\\nNuo Europietiškų drabužių mados atėjimu į Japoniją necukė ir sagemono naudojimas sumažėjo, beveik išnyksta laikotarpiu nuo XIX a. pabaigos - XX amžiaus pirmojo ketvirčio.\\nNecukė nederėtų maišyti su okimono- miniatiūrine, dekoratyvine statulėle."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%90%D1%88%D0%BE%D1%82_%D0%9D%D0%B0%D0%B4%D0%B0%D0%BD%D1%98%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Nadanian_Ashot_%282%29.jpg","page_title":"Ашот Наданјан","context_page_description":"Ашот Наданјан е ерменски шаховски меѓународен мајстор, теоретичар и шаховски тренер. Во 1998 станал заслужен тренер на Ерменија, а во 2007 официјален ФИДЕ тренер. Познат е и по неговиот придонес во развојот на шаховската теорија. Во 1996, Наданјан вовел нова варијанта во Гринфелдовата одбрана, која по него е наречена Наданјанова варијанта."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CF%81%CF%89%CF%84%CE%AC%CE%B8%CE%BB%CE%B7%CE%BC%CE%B1_%CF%80%CE%BF%CE%B4%CE%BF%CF%83%CF%86%CE%B1%CE%AF%CF%81%CE%BF%CF%85_%CE%9F%CF%85%CE%B3%CE%B3%CE%B1%CF%81%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Blu_e_Rosso_%28Strisce%292.png","page_title":"Πρωτάθλημα ποδοσφαίρου Ουγγαρίας","context_page_description":"Η Α' Κατηγορία του Ουγγρικού Πρωταθλήματος είναι η ανώτερη κατηγορία των επαγγελματικών ποδοσφαιρικών ομάδων της Ουγγαρίας. Αναφέρεται και ως OTP Bank Liga για εμπορικούς λόγους. H Φερεντσβάρος είναι η πιο επιτυχημένη ομάδα του θεσμού με 31 κατακτήσεις, με τις άλλες παραδοσιακές δυνάμεις, την ΜΤΚ Βουδαπέστης και την Ούιπεστ ΦΚ, να ακολουθούν με 23 και 20 κατακτήσεις αντίστοιχα."},{"page_url":"https://la.wikipedia.org/wiki/Rimbach-pr%C3%A8s-Guebwiller","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Rimbach_pr%C3%A8s_Guebwiller_098.JPG","page_title":"Rimbach-près-Guebwiller","context_page_description":"Rimbach-près-Guebwiller est commune Francicum 234 incolarum praefecturae Rheni Superioris in regione orientali Alsatia."},{"page_url":"https://ca.wikipedia.org/wiki/Hist%C3%B2ria_del_judo_a_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/2014_World_Judo_Championships_1.jpeg","page_title":"Història del judo a Catalunya","context_page_description":"Breu història del judo a Catalunya."},{"page_url":"https://zh.wikipedia.org/wiki/2008%E5%B9%B4%E6%9F%AC%E5%9F%94%E5%AF%A8%E5%A4%A7%E9%81%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Sam_Rainsy.jpg","page_title":"2008年柬埔寨大選","context_page_description":"2008年7月27日，柬埔寨举行大选。结果是执政的柬埔寨人民党获胜，赢得了123个席位中的90个席位。"},{"page_url":"https://de.wikipedia.org/wiki/RM_(Rapper)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Rap_Monster_at_Seoul_Music_Awards_on_January_19%2C_2017_%281%29.jpg","page_title":"RM (Rapper)","context_page_description":"Kim Nam-joon, seit November 2017 bekannt als RM ist ein südkoreanischer Rapper, Songwriter und Musikproduzent. Der Korea Music Copyright Association zufolge wirkte RM bei mehr als 130 Liedern mit. Er ist der Leader der südkoreanischen Boygroup BTS, mit der er seit 2013 bei Big Hit Entertainment unter Vertrag steht. 2015 brachte er sein erstes Solo–Mixtape RM heraus. Im Dezember 2018 folgte sein zweites Mixtape mono., welches die höchste Chartplatzierung eines koreanischen Solo-Künstlers auf den Billboard 200 erreichte, als es auf Platz 26 debütierte. Neben seiner Muttersprache Koreanisch spricht er fließend Englisch."},{"page_url":"https://en.wikipedia.org/wiki/Buttle_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Buttle_kyrka_view1.jpg","page_title":"Buttle Church","context_page_description":"Buttle Church is a medieval church in Buttle on the Swedish island of Gotland. It is one of the more well-preserved Romanesque churches on Gotland, and contains both a number of medieval furnishings as well medieval murals. Buttle Church belongs to the Diocese of Visby of the Church of Sweden."},{"page_url":"https://de.wikipedia.org/wiki/Synagoge_(Gleusdorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Gleusdorf-Synagoge1.jpg","page_title":"Synagoge (Gleusdorf)","context_page_description":"Die Synagoge in Gleusdorf, einem Ortsteil der unterfränkischen Gemeinde Untermerzbach im Landkreis Haßberge, wurde Mitte des 19. Jahrhunderts errichtet. Sie ist als Baudenkmal in der Bayerischen Denkmalliste eingetragen."},{"page_url":"https://it.wikipedia.org/wiki/Zeki_M%C3%BCren","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Zeki_M%C3%BCren_-_costumes_3.jpg","page_title":"Zeki Müren","context_page_description":"Zeki Müren, ricordato anche come \\"San'at Güneşi\\", \\"Batmayan Güneş\\", \\"Paşa\\" e \\"Güneşin oğlu\\", è stato un cantante, compositore, attore e poeta turco.\\nFamoso per la sua voce potente e la precisa articolazione delle parole, Müren è considerato una delle voci più grandi della musica classica turca."},{"page_url":"https://eu.wikipedia.org/wiki/Paruzzaro","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Paruzzaro_Chiesa_San_Marcello_02.JPG","page_title":"Paruzzaro","context_page_description":"Paruzzaro Italiako udalerri bat da. Novarako probintzian kokatuta dago, Piemonte eskualdean. 2.211 biztanle ditu, 5,23 kilometro koadroko azaleran banatuta."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5_%D0%A1%D0%B0%D0%BD_%D0%94%D0%B6%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8_%D0%9A%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Map_of_comune_of_Monte_San_Giovanni_Campano_%28province_of_Frosinone%2C_region_Lazio%2C_Italy%29.svg","page_title":"Монте Сан Джовани Кампано","context_page_description":"Мо̀нте Сан Джова̀ни Кампа̀но е град и община в Централна Италия, провинция Фрозиноне, регион Лацио. Разположен е на 438 m надморска височина. Населението на общината е 12 796 души."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%88%E0%B9%89%E0%B8%B2%E0%B8%AD%E0%B8%99%E0%B9%82%E0%B8%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Baekje-monarchs%281-5%29.PNG","page_title":"พระเจ้าอนโจ","context_page_description":"พระเจ้าอนโจ ปฐมกษัตริย์แห่งอาณาจักรแพ็กเจ หนึ่งในสามก๊กแห่งเกาหลี ทรงสร้างเมืองวิเรซองเป็นราชธานีของอาณาจักรแพกเจและทรงเป็นบรรพบุรุษของกษัตริย์ของราชวงศ์แพ็กเจทุกพระองค์"},{"page_url":"https://en.wikipedia.org/wiki/Piazza_San_Marco","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Procuratie_vecie_dettaglio_finestre_a_Venezia.jpg","page_title":"Piazza San Marco","context_page_description":"Piazza San Marco, often known in English as St Mark's Square, is the principal public square of Venice, Italy, where it is generally known just as la Piazza. All other urban spaces in the city are called campi. The Piazzetta is an extension of the Piazza towards San Marco basin in its south east corner. The two spaces together form the social, religious and political centre of Venice and are commonly considered together.\\nA remark usually attributed to Napoleon calls the Piazza San Marco \\"the drawing room of Europe\\"."},{"page_url":"https://fi.wikipedia.org/wiki/Espanjan_lippu","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Flag_es-regi%C3%B3n_de_murcia_300.png","page_title":"Espanjan lippu","context_page_description":"Espanjan lippu on Espanjan kuningaskunnan kansallistunnus vaakunan, moton ja kansallishymnin ohella. Se otettiin käyttöön 19. joulukuuta 1981. Lipussa on kolme poikittaista suorakaidetta, punainen, keltainen ja punainen, joista keltainen on kaksi kertaa punaisten levyinen. Vasemmassa reunassa keltaista suorakaidetta on Espanjan vaakuna, mutta lipusta on käytössä myös siviiliversio ilman vaakunaa.\\nVanhin vastine Espanjan nykyiselle lipulle voidaan jäljittää vuoteen 1785 ja Bourbon-sukuiseen kuningas Kaarle III:een. Kuningas etsi lippua, joka erottaisi Espanjan kahdesta muusta suuresta Bourbonien hallitsemasta valtakunnasta, Ranskasta ja Molempain Sisiliain kuningaskunnasta. Lipusta järjestettiin suunnittelukilpailu. Kansallislipuksi valitussa lipussa oli viisi keltaista ja punaista raitaa järjestyksessä keltainen-punainen-keltainen-punainen-keltainen ja suhteessa 1:1:2:1:1. Nykyisen lipun esi-isä otettiin aluksi käyttöön vain sotalippuna.\\nLipun väritys on pysynyt samana läpi vuosisatojen. Värien alkuperä on hieman kiistanalainen, mutta yleisin teoria on, että ne perustuvat Espanjan muinaisten kuningaskuntien kuten Aragonian ja Kastilian tunnuksissaan käyttämiin väreihin."},{"page_url":"https://cs.wikipedia.org/wiki/Blavor_%C5%BElut%C3%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Ophisaurus_apodus_%284%29.jpg","page_title":"Blavor žlutý","context_page_description":"Blavor žlutý je největší druh slepýše. Jeho domovem je jižní a jihovýchodní Evropa, přední a střední Asie."},{"page_url":"https://pt.wikipedia.org/wiki/Blanchard_(Oklahoma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Blanchard_2004.jpg","page_title":"Blanchard (Oklahoma)","context_page_description":"Blanchard é uma cidade localizada no estado norte-americano de Oklahoma, no Condado de Grady e Condado de McClain."},{"page_url":"https://en.wikipedia.org/wiki/%CE%91r35_RNA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/PromotersB35.png","page_title":"Αr35 RNA","context_page_description":"αr35 is a family of bacterial small non-coding RNAs with representatives in a reduced group of α-proteobacteria from the order Rhizobiales. The first member of this family was found in a Sinorhizobium meliloti 1021 locus located in the symbiotic plasmid B. Further homology and structure conservation analysis have identified full-length SmrB35 homologs in other legume symbionts, as well as in the human and plant pathogens Ochrobactrum anthropi and Agrobacterium tumefaciens, respectively. αr35 RNA species are 139-142 nt long and share a common secondary structure consisting of two stem loops and a well conserved rho independent terminator. Most of the αr35 transcripts can be catalogued as trans-acting sRNAs expressed from well-defined promoter regions of independent transcription units within intergenic regions of the α-proteobacterial genomes."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A0%D0%B8%D0%B2_(%D0%9B%D0%BE_%D0%B0,_%D0%93%D0%B0%D1%80%D0%BE%D0%BD%D0%BD%D0%B0_%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Rives_-_%C3%89glise_Saint-Pierre-%C3%A8s-Liens_-1.JPG","page_title":"Рив (Ло а, Гаронна а)","context_page_description":"Рив — Францин гӀала-коммуна, лаьтта Аквитани регионехь. Коммунан департамент — Ло а, Гаронна а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/Rosetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/%D8%A7%D9%84%D9%85%D8%B9%D8%A7%D9%84%D9%85_%D8%A7%D9%84%D8%A7%D8%AB%D8%B1%D9%8A%D8%A9_%D9%85%D9%86_%D8%B1%D8%AD%D9%84%D8%A9_%D8%B1%D8%B4%D9%8A%D8%AF_5.jpg","page_title":"Rosetta","context_page_description":"Rosetta or Rashid is a port city of the Nile Delta, 65 km east of Alexandria, in Egypt's Beheira governorate. The Rosetta Stone was discovered there in 1799.\\nFounded around in the 9th century, Rosetta boomed with the decline of Alexandria following the Ottoman conquest of Egypt in 1517, only to wane in importance after Alexandria's revival. During the 19th century, it was a popular British tourist destination, known for its charming Ottoman mansions, citrus groves and relative cleanliness."},{"page_url":"https://fr.wikipedia.org/wiki/Albert_II_de_Dabo-Moha","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Dabo-vue2.jpg","page_title":"Albert II de Dabo-Moha","context_page_description":"Albert II de Dabo-Moha, qui se fait aussi appeler Albert de Lichtenberg en 1197, décédé en 1212. Il est fils du comte Hugues II de Metz et de Luitgarde de Sulzbach, veuve du duc Godefroid II de Brabant, et fille de Bérenger II, comte palatin de Sulzbach, et de sa femme Adèle de Wolfratshausen.\\nResté seul héritier, il réunit entre ses mains quatre comtés, de nombreuses seigneuries et l'avouerie de beaucoup d'abbayes: il est comte de Metz, de Dabo, d'Eguisheim et de Moha de 1178 à 1212, il est également avoué d'Andlau, d'Altdorf, de Neuvillers, de Hesse et d'Herbitzheim.\\nIl est également demi frère par sa mère du duc Godefroid III de Louvain, margrave de Brabant, oncle du duc Henri Iᵉʳ de Brabant.\\nLa famille de Dabo, seigneurs du lieu, de Moha et d'Eguisheim, est une puissante famille, qui compte parmi ses membres le pape Léon IX, et qui reçoit, en 1153, la charge de comte de Metz."},{"page_url":"https://fr.wikipedia.org/wiki/Displacement_mapping","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Displacementmapping.jpg","page_title":"Displacement mapping","context_page_description":"Le « displacement mapping » est une technique similaire au bump mapping, normal mapping, et au parallax mapping, mais qui utilise, contrairement aux autres techniques, une texture ou ce que l'on appelle une « height map » qui modifiera la position géométrique des points de la surface à laquelle on applique cette « displacement map ». Ces positions géométriques seront déterminées selon la valeur affectée à la texture. Cet effet donnera à la surface une grande précision et un grand nombre de détails. En revanche, c'est, parmi les autres techniques citées plus haut, celle qui demande le plus de ressources à l'ordinateur, gourmandise due à la grande quantité de « nouvelle géométrie ».\\nPendant des années, le displacement mapping était une technique réservée aux moteurs de rendu haut-de-gamme, tels que RenderMan, tandis que des APIs en temps réél, comme OpenGL ou DirectX n'étaient pas capable de supporter une telle technique."},{"page_url":"https://nl.wikipedia.org/wiki/Gert_Jonke","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Gert_Jonke.jpg","page_title":"Gert Jonke","context_page_description":"Gert Friedrich Jonke was een Oostenrijks dichter en toneelschrijver.\\nIn 2001 werd hem de Grote Oostenrijkse Staatsprijs toegekend."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/St_Peter%2C_St_Mary_Bourne_-_geograph.org.uk_-_1488897.jpg","page_title":"Grade I listed buildings in Hampshire","context_page_description":"There are over 9000 Grade I listed buildings in England. This page is a list of the 215 Grade I listed buildings in the county of Hampshire. There are also five Grade I listed parks and gardens which are nota listed here."},{"page_url":"https://de.wikipedia.org/wiki/Collonge-Bellerive","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Collonge-Mairie.jpg","page_title":"Collonge-Bellerive","context_page_description":"Collonge-Bellerive ist eine politische Gemeinde des Kantons Genf in der Schweiz.\\nDie Gemeinde umfasst die Dörfer Collonge, Vésenaz und Saint-Maurice sowie die Weiler Cherre, Bellerive, La Repentance und La Capite."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%A1%D5%B4_%D5%88%D6%82_%D5%80%D5%B5%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Woohyun_at_Dilemma_Tour_in_Tokyo_on_May_2015_01.jpg","page_title":"Նամ Ու Հյոն","context_page_description":"Նամ Ու Հյոն, հարավկորեացի երգիչ, երգահան և դերասան։ Woollim Entertainment լեյբլին պատկանող Infinite բոյ բենդի անդամ է։"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%96%E5%8B%99%E5%A4%A7%E8%87%A3_(%E6%97%A5%E6%9C%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Hachir%C5%8D_Arita.jpg","page_title":"外務大臣 (日本)","context_page_description":"外務大臣是主管日本外務省的國務大臣，簡稱外相。為內閣中最重要的職位之一，通常由執政黨內的實力派國會議員擔任，有時還會兼任副首相。在日本歷史上，許多曾擔任過外務大臣的議員到後來成為首相。由於外務大臣的重要性，還有許多首相任內兼任外務大臣。\\n外務大臣的職權有：\\n主持外務省業務，協助首相擬定對外政策和計劃，並予以貫徹執行；\\n協助對外關係的各種日常事務；\\n指導、檢查、監督外務省和駐外使館館員的工作；\\n向國會報告外交工作等。\\n外務大臣和內閣總理大臣是自1885年實行內閣制以後僅有的名稱沒有變更過的國務大臣職位。\\n如果首相有事、出訪或生病，在沒有副首相的情況下，有可能會指定外務大臣代理首相職務。"},{"page_url":"https://de.wikipedia.org/wiki/Delmenhorst","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Einwohnerentwicklung_von_Delmenhorst.svg","page_title":"Delmenhorst","context_page_description":"Delmenhorst ist eine kreisfreie Stadt im Oldenburger Land. Sie gehört zur Metropolregion Nordwest und zum Kommunalverbund Niedersachsen/Bremen.\\nIn Niedersachsen ist Delmenhorst nicht nur eine von acht kreisfreien Städten, sondern nimmt dort auch einen Platz unter den zehn größten Städten des Landes ein. Bereits 1371 erhielt Delmenhorst die Stadtrechte durch den Grafen. Mit der 1867 erfolgten Einweihung der Bahnstrecke Bremen–Oldenburg entwickelte sich die Stadt bis 1898 zur größten Industriestadt zwischen Weser und Ems. Seit 1903 ist Delmenhorst kreisfrei."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B8%A0%E7%8E%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/The_Plumber_King%2C_hand-scrawled_advertisement%2C_Choi_Ha_Road_%28Hong_Kong%29.jpg","page_title":"渠王","context_page_description":"渠王，原名严照棠，是香港一名男性通渠匠，以在香港街头上的涂鸦著名，他的涂鸦作品在香港随处可见，深入民心，已经成为了香港集体回忆的一部分。"},{"page_url":"https://en.wikipedia.org/wiki/Capys_(butterfly)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/CramerAndStoll-uitlandsche_kapellen_vol._2-_plate_182.jpg","page_title":"Capys (butterfly)","context_page_description":"Capys is a genus of butterflies in the family Lycaenidae. The species of this genus are found in the Afrotropical realm."},{"page_url":"https://es.wikipedia.org/wiki/Catedral_de_Santo_Domingo_de_la_Calzada","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/San_Emeterio_-_Catedral_de_Santo_Domingo_de_la_Calzada.jpg","page_title":"Catedral de Santo Domingo de la Calzada","context_page_description":"La catedral del Salvador de Santo Domingo de la Calzada está situada en la Ciudad de Santo Domingo de la Calzada, en la Comunidad Aútonoma de La Rioja.\\nActualmente, está considerada como BIC.​"},{"page_url":"https://cs.wikipedia.org/wiki/Husitsk%C3%A9_v%C3%A1lky","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Tabor_CZ_Zizka_Memorial_323.jpg","page_title":"Husitské války","context_page_description":"Husitské války bylo období bojů mezi husity a jejich protivníky vedenými králem Zikmundem Lucemburským i mezi husitskými frakcemi navzájem, které probíhaly na českém území v letech 1419 až 1434 a ještě nějakou dobu poté. Do českých zemí mimo jiné proti husitům zamířily postupně čtyři křížové výpravy. Počet křížových výprav se někdy uvádí odlišný, když je např. jako třetí křížová výprava uváděno v podstatě neuskutečněné tažení z roku 1422, které mělo zanedbatelný význam. Občas je za třetí křižácké tažení nesprávně označována také výprava Sasů, která byla poražena v bitvě u Ústí roku 1426.\\nTento článek se věnuje obranným válkám českých husitů proti křížovým výpravám, tedy proti převážně zahraničnímu nepříteli. Celkový přehled bitev z období husitských válek naleznete v článku Seznam husitských bitev."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A3%D1%98%D0%B5%D0%B4%D0%B8%D1%9A%D0%B5%D0%BD%D0%B8_%D0%90%D1%80%D0%B0%D0%BF%D1%81%D0%BA%D0%B8_%D0%95%D0%BC%D0%B8%D1%80%D0%B0%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/UAE_Regions_map.png","page_title":"Уједињени Арапски Емирати","context_page_description":"Уједињени Арапски Емирати су нафтом богата блискоисточна држава која заузима територију југоисточног дела Арабијског полуострва уз Персијски залив у региону југозападне Азије. Граничи се копнено са Оманом и Саудијском Арабијом, а поморски са Катаром и Ираном. Шест емирата у Персијском заливу: Абу Даби, Дубаи, Шарџа, Ум ел Кајвејн и Фуџејра склопило је споразум о оснивању федерације Уједињени Арапски Емирати. Споразум је на снагу ступио у децембру 1971, а у фебруару 1972. се федерацији прикључио и емират Рас ел Хајма.\\nThe United Arab Emirates, sometimes simply called the Emirates, is a country in Western Asia at the northeast end of the Arabian Peninsula on the Persian Gulf, bordering Oman to the east and Saudi Arabia to the south and west, as well as sharing maritime borders with Qatar to the west and Iran to the north. The sovereign constitutional monarchy is a federation of seven emirates consisting of Abu Dhabi, Ajman, Dubai, Fujairah, Ras Al Khaimah, Sharjah and Umm Al Quwain. Their boundaries are complex, with numerous enclaves within the various emirates. Each emirate is governed by a ruler; together, they jointly form the Federal Supreme Council."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A5%BF%E6%97%A5%E6%9C%AC%E3%82%B8%E3%82%A7%E3%82%A4%E3%82%A2%E3%83%BC%E3%83%AB%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%E5%B0%8F%E6%B5%9C%E6%94%AF%E6%89%80.jpg","page_title":"西日本ジェイアールバス","context_page_description":"西日本ジェイアールバス株式会社は、路線バス・貸切バス事業者で、西日本旅客鉄道の完全子会社である。本社は大阪府大阪市此花区北港一丁目3番23号。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%B4%D0%BE%D0%B1%D0%B8%D1%82%D0%BD%D0%B8%D0%BA%D0%B0_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%BE%D0%B2%D0%B5_%D0%BD%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D0%B5_%D0%B7%D0%B0_%D1%84%D0%B8%D0%B7%D0%B8%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Wh-bragg.jpg","page_title":"Списак добитника Нобелове награде за физику","context_page_description":"Нобелова награда за физику додељује се сваке године научницима који раде на разним пољима физике. Једна је од пет Нобелових награда које су основане 1895. године по тестаменту Алфреда Нобела, а додељује је Шведска краљевска академија наука за изузетне доприносе у физици. Како је настала вољом Алфреда Нобела, наградом управља Нобелова фондација, а додељује је одбор који се састоји од пет чланова изабраних од стране Шведске краљевске академије наука. Додељује се у Стокхолму на годишњој церемонији 10. децембра, на годишњицу смрти Алфреда Нобела. Сваки добитник добија медаљу, диплому и новчану награду која се мењала током година."},{"page_url":"https://en.wikipedia.org/wiki/Fast_Mail_(Southern_Railway)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Old_97_wreck_at_Stillhouse_Trestle_in_Virginia_-_1903_%282%29.jpg","page_title":"Fast Mail (Southern Railway)","context_page_description":"The Fast Mail was a Southern Railway mail and express train that operated between Washington, D.C. and New Orleans, Louisiana. The southbound Fast Mail carried the train number of 97, and was later known by the nickname of \\"Old 97\\". One such trip made by the train, on September 27, 1903, derailed at Stillhouse Trestle in Danville, Virginia, and was later known as the \\"Wreck of the Old 97\\", which the service was most well known for.\\nThe train's normal consist was two railway post office cars, one express car, and one baggage car. It was the first exclusively mail and express train in the southern United States, and it was the last fast mail train in the United States to receive a subsidy for its fast service schedule."},{"page_url":"https://tr.wikipedia.org/wiki/Lancashire","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ormskirk_market.JPG","page_title":"Lancashire","context_page_description":"Lancashire, Birleşik Krallık İngiltere ülkesinin Kuzey-Batı bölgesinde birinci seviyede yerel idare \\"shire\\" kontluğu ve kraliyet seremonileri için törensel kontluktur. Merkezi Preston şehrindedir.\\nLancashire Kontluğu yüzölçümü 3.075 km²; 2005 tahminine göre nüfusu 1.439.200 ve nüfus yoğunluğu km² başına 468 kişdir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B7%D1%8D%D0%BD_%D0%9F%D1%8D%D0%B9%D1%8F%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Zeng_Peiyan_%28cropped%29.jpg","page_title":"Цзэн Пэйянь","context_page_description":"Цзэн Пэйя́нь, председатель Госкомитета по делам планирования и развития КНР, вице-премьер Госсовета КНР, член Политбюро ЦК КПК.\\nЧлен КПК с сентября 1978 года, член ЦК 15 созыва, член Политбюро 16 созыва."},{"page_url":"https://en.wikipedia.org/wiki/MV_Andrew_J._Barberi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Andrew_J_Barberi_Collision.PNG","page_title":"MV Andrew J. Barberi","context_page_description":"The MV Andrew J. Barberi is one of two Barberi-class ferry boats operated as part of the Staten Island Ferry between Manhattan and Staten Island in New York City, besides MV Samuel I. Newhouse. With a capacity of 6,000, she is among the highest-capacity boats in the ferry's fleet. Since her introduction in 1981, she has had a history of incidents, including a 2003 crash that killed eleven people and a 2010 crash that injured thirty-seven.\\nAndrew J. Barberi was named after the longtime coach of Curtis High School's football team, who had died shortly before the ship was commissioned. Barberi coached throughout the 1950s, '60s and '70s and was instrumental in the development of scholastic football on Staten Island."},{"page_url":"https://pt.wikipedia.org/wiki/Batalha_de_Quatre_Bras","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Wollen%2C_Battle_of_Quatre_Bras.jpg","page_title":"Batalha de Quatre Bras","context_page_description":"A Batalha de Quatre Bras pôs frente a frente aos contingentes anglo-aliados com a ala esquerda do exército francês próximo do cruzamento de Quatre Bras, na atual Bélgica, poucos dias antes da decisiva Batalha de Waterloo."},{"page_url":"https://en.wikipedia.org/wiki/Neoclassical_architecture_in_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/3_Suwalki_01.jpg","page_title":"Neoclassical architecture in Poland","context_page_description":"Neoclassical architecture in Poland was centered on Warsaw under the reign of Stanisław August Poniatowski, while the modern concept of a single capital city was to some extent inapplicable in the decentralized Polish–Lithuanian Commonwealth. Classicism came to Poland in the 18th century as the result of French infiltrations into the Polish millieu. The best-known architects and artists who worked in Poland were Dominik Merlini, Jan Chrystian Kamsetzer, Szymon Bogumił Zug, Stanisław Zawadzki, Efraim Szreger, Antonio Corazzi, Jakub Kubicki, Hilary Szpilowski, Christian Piotr Aigner, Wawrzyniec Gucewicz, Bonifacy Witkowski and Danish Bertel Thorvaldsen.\\nThe first stage, called the Stanislavian style, followed by an almost complete inhibition and a period known as the Congress Kingdom classicism. The palladian patterns were independently interpreted by Szymon Bogumił Zug, who followed an influence of radical French classicism. A palladian by influence was also Piotr Aigner - author of the facade of St. Anne's Church in Warsaw and St. Alexander Church. Palladian ideas were implemented in a popular type of a palace with a pillared portico."},{"page_url":"https://la.wikipedia.org/wiki/Catharina_Babineaux_Blanco","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Kathleen_Blanco_in_St.Bernard.jpg","page_title":"Catharina Babineaux Blanco","context_page_description":"Catharina Babineaux Blanco fuit rerum politicarum perita Americana factionis Democraticae, quae inter alia ab anno 2004 usque ad annum 2008, prima mulier, Ludovicianae gubernatrix fuit."},{"page_url":"https://en.wikipedia.org/wiki/2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Alan_Rickman_cropped_and_retouched.jpg","page_title":"2016","context_page_description":"2016 was a leap year starting on Friday of the Gregorian calendar, the 2016th year of the Common Era and Anno Domini designations, the 16th year of the 3rd millennium, the 16th year of the 21st century, and the 7th year of the 2010s decade.\\n2016 was designated as:\\nInternational Year of Pulses by the sixty-eighth session of the United Nations General Assembly.\\nInternational Year of Global Understanding by the International Council for Science, the International Social Science Council, and the International Council for Philosophy and Human Sciences."},{"page_url":"https://ca.wikipedia.org/wiki/Art_cristi%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Eug%C3%A8ne_Delacroix_Christ_on_the_Cross_%28sketch%29_1845.jpg","page_title":"Art cristià","context_page_description":"L'art cristià és l'art religiós del cristianisme, les obres d'art inspirades per sentiments religiosos cristians, o creades per il·lustrar, suplementar i representar en una forma tangible el missatge cristià.\\nEn ser el cristianisme la religió dominant en la civilització occidental des del segle iv, l'art cristià s'identifica amb la major part de les produccions artístiques de l'edat mitjana a Europa i va seguir sent molt important durant tota l'Edat Moderna, a més d'estendre's geogràficament. La secularització de la societat ha restringit a l'art cristià dins dels principals corrents artístics de l'Edat Contemporània.\\nCom art sacre, el fi essencial que té l'art cristià pels creients és el culte. Edificis, imatges i objectes litúrgics es consagren, amb el qual deixen de ser simples obres d'art. Des del cristianisme primitiu, i sobretot a l'edat mitjana, els temples i monestirs s'identificaven amb les relíquies dels sants i màrtirés que contenien i que els denominaven."},{"page_url":"https://tr.wikipedia.org/wiki/NGC_4005","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/NGC4005_-_SDSS_DR14.jpg","page_title":"NGC 4005","context_page_description":"NGC 4005, Yeni Genel Katalog'da yer alan bir tekrarlanmış NGC cismidir. Gökyüzünde Aslan takımyıldızı yönünde bulunur. S? tipi bir sarmal galaksidir. Rus/Amerikan astronom Otto Struve tarafından 1869 yılında 38,1 cm çaplı mercekli tip bir teleskopla keşfedilmiştir."},{"page_url":"https://sl.wikipedia.org/wiki/Bobbie_van_de_Graaff","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Robert_and_Freek_van_de_Graaff_1967.jpg","page_title":"Bobbie van de Graaff","context_page_description":"Robert »Bobbie« van de Graaf, nizozemski veslač, * 17. marec 1944, Macclesfield, Združeno kraljestvo.\\nvan de Graaff je za Nizozemsko nastopil na Poletnih olimpijskih igrah 1964 v Tokiu, kjer je v četvercu s krmarjem osvojil bronasto medaljo."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD%D0%B8%D0%BA_%D0%B6%D1%80%D1%82%D0%B2%D0%B0%D0%BC%D0%B0_%D1%80%D0%B0%D1%86%D0%B8%D1%98%D0%B5_%D1%83_%D0%9D%D0%BE%D0%B2%D0%BE%D0%BC_%D0%A1%D0%B0%D0%B4%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Spomenik_%C5%BErtvama_racije.jpg","page_title":"Споменик жртвама рације у Новом Саду","context_page_description":"Споменик жртвама рације у Новом Саду је подигнут 1971. године и представља знаменито место као непокретно културно добро од великог значаја."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%88%D8%B1%D8%AF_%D8%A7%DB%8C%DA%A9%D8%B3%E2%80%8C%D8%AF%D8%A8%D9%84%DB%8C%D9%88_%D9%81%D8%A7%D9%84%DA%A9%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/1970_Ford_Falcon_XW_Futura_Sedan.jpg","page_title":"فورد ایکس‌دبلیو فالکون","context_page_description":"فورد ایکس‌دبلیو فالکون خودرویی است که در سال‌های June ۱۹۶۹ تا October ۱۹۷۰تولید شده‌است.\\nطراحی آن خودروهای موتور جلو-محور عقب بوده است. سیستم جعبه‌دندهٔ آن به دو صورت خودکار و دستی است."},{"page_url":"https://en.wikipedia.org/wiki/National_Defense_Act_of_1916","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Julius_Kahn.jpg","page_title":"National Defense Act of 1916","context_page_description":"The National Defense Act of 1916, Pub.L. 64–85, 39 Stat. 166, enacted June 3, 1916, was a United States federal law that updated the Militia Act of 1903, which related to the organization of the military, particularly the National Guard. The 1916 act included an expansion of the Army and the National Guard, the creation of an Officers' and an Enlisted Reserve Corps, and the creation of a Reserve Officers' Training Corps. The President was also given expanded authority to federalize the National Guard, with changes to the duration and the circumstances under which he could call it up. The Army began the creation of an Aviation arm, and the federal government took steps to ensure the immediate availability of wartime weapons and equipment by contracting in advance for production of gunpowder and other material."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jacques_de_Brno","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Mesto_Brno_-_nahrobek_Louise_Raduita_de_Souches_v_kostele_Sv._Jakuba.jpg","page_title":"Église Saint-Jacques de Brno","context_page_description":"L'église Saint-Jacques est un édifice religieux catholique située à Brno, en République tchèque, sur la place Jakubské dans le quartier de Brno-Centre. Cette église gothique du XIIIᵉ siècle fut déclarée monument culturel national, en 1995. [1]\\nL'église abrite le cénotaphe du fameux défenseur de Brno Jean-Louis Raduit de Souches."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%B0%D0%BD%D0%BE%D1%80%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BB%D1%96%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/%D0%9D%D0%B8%D0%BA%D0%B0%D0%BD%D0%BE%D1%80%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B5_%D1%83%D1%80%D0%BE%D1%87%D0%B8%D1%89%D0%B5.JPG","page_title":"Никанорівський ліс","context_page_description":"Никано́рівський ліс — заповідне урочище місцевого значення.\\nРозташоване в південно-східній частині Добропільського району Донецької області, біля села Никанорівка. Відноситься до Красноармійського держлісгоспу.\\nПлоща — 39 га. Статус заповідного урочища надано рішенням обласної ради від 25 березня 1995 року.\\nСтворене з метою збереження умов зростання 4 видів рослин, занесених до Червоної книги України, — ковила дніпровська, орнітогалум Буше, сон лучний, тюльпан дібровний.\\nНа узліссі є озеро, яке живиться підземними водами і джерелами на поверхні."},{"page_url":"https://fr.wikipedia.org/wiki/Stoneham-et-Tewkesbury","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/StonehamStationAutomne.jpg","page_title":"Stoneham-et-Tewkesbury","context_page_description":"Stoneham-et-Tewkesbury est une municipalité de cantons unis de la province de Québec située dans la municipalité régionale de comté de La Jacques-Cartier, région administrative de la Capitale-Nationale. Elle est située à la porte de la réserve faunique des Laurentides et sur la route qui relie Québec à la région du Saguenay–Lac-Saint-Jean."},{"page_url":"https://eo.wikipedia.org/wiki/Traktato_de_Nystad","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Border_changes_in_Finland_1721.jpg","page_title":"Traktato de Nystad","context_page_description":"La Traktato de Nystad, estas paca traktato inter la Rusa carlando kaj la Reĝlando de Svedio subskribita la 10-an de septembro 1721 en urbo Nystad. Reĝo de Svedio Frederiko la Unua komisiis al diplomatoj Johan Lillienstedt kaj Otto Strömfeld subskribi la tekston. Same rusa caro Petro la Unua ordonis efektivigi subskribon al Jakobo Brjus kaj Andrej Osterman.\\nLa traktato ŝanĝis la rus-svedan landlimon, tiel ke Svedio agnoskis la anekson de Livonio, Estonio, Ingrio, parto de Karelio kaj aliaj teritorioj por ĉiam al Rusujo, kiu siavice promesis pagi monan kompenson.\\nLa traktato konsistis el enkonduko kaj 24 artikoloj. La ĉefaj punktoj de la Traktato estis la jenaj:\\nLa eterna kaj nediskutebla paco inter la rusa caro kaj la reĝo de Svedio kaj iliaj posteuloj;\\nKompleta amnestio ambaŭflanke, escepte pri la kozakoj, kiujn gvidis Ivan Mazepa kaj Kost Gordijenko;\\nĈiuj militagoj ĉesos dum 14 tagoj;\\nLa svedoj cedas al la eterna posedo de Rusio: Livonion, Estonion, Ingrion, parton de Karelio;\\nSvedio reprenas Finnlandon;\\nLa praktiko de kredo en ĉi tiuj teritorioj estas libera;\\nLa 20-an de septembro 1721 Rusio ratifikis la traktaton, samtempe okazis grandiozaj festoj en Moskvo kaj aliloke."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F_(%D1%84%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%D0%A3%D0%B6%D0%B8%D0%BD_%D0%BD%D0%B0_%D1%84%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB%D0%B5_%22%D0%91%D1%80%D0%B0%D1%82%D1%8C%D1%8F%22.jpg","page_title":"Братья (фестиваль)","context_page_description":"Правосла́вный молодёжный междунаро́дный фестива́ль «Бра́тья» — русскоязычный православный молодёжный фестиваль и форум, организованный группой активистов из Можайска и проводимый при поддержке различных православных объединений, общественных организаций и частных лиц. Хотя фестиваль заявлен как международный, традиционно «Братья» объединяют православную молодёжь стран бывшего СССР.\\nВ основу фестиваля положены дополняющие друг друга составляющие: познавательная часть, неформальное общение участников как со священнослужителями, так и друг с другом и фестивальные выступления. В рамках фестиваля проводятся творческие выступления православных молодёжных коллективов и исполнителей разных направлений, богослужения, тематические беседы со священнослужителями, экскурсии, балы, спортивные конкурсы и различные игры, мастер-классы различной направленности.\\nВпервые фестиваль «Братья» был проведён в июле 2005 года и с тех пор проводится каждое лето. С 2008 года также ежегодно в феврале проводится и зимний фестиваль, также именуемый «Братья Зимой»."},{"page_url":"https://en.wikipedia.org/wiki/Environmental_impact_of_aviation","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Cirrus_clouds_cold_day.jpg","page_title":"Environmental impact of aviation","context_page_description":"The environmental impact of aviation occurs because aircraft engines emit heat, noise, particulates and gases which contribute to climate change and global dimming. Airplanes emit particles and gases such as carbon dioxide, water vapor, hydrocarbons, carbon monoxide, nitrogen oxides, sulfur oxides, lead, and black carbon which interact among themselves and with the atmosphere.\\nDespite more fuel-efficient and less polluting turbofan and turboprop engines, the rapid growth of air travel contributes to an increase in total pollution attributable to aviation. From 1992 to 2005, passenger kilometers increased 5.2 percent per year. In the European Union, greenhouse gas emissions from aviation increased by 87 percent between 1990 and 2006.\\nComprehensive research shows that despite anticipated efficiency innovations to airframes, engines, aerodynamics and flight operations, there is no end in sight, even many decades out, to rapid growth in CO₂ emissions from air travel and air freight, due to projected continual growth in air travel."},{"page_url":"https://it.wikipedia.org/wiki/Pont-du-Ch%C3%A2teau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Pont_du_Chateau.jpg","page_title":"Pont-du-Château","context_page_description":"Pont-du-Château è un comune francese di 10.867 abitanti situato nel dipartimento del Puy-de-Dôme nella regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%A7%D9%84%D8%A7%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/RO_GJ_Balani_%282%29.JPG","page_title":"بالانى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبالانى, قريه فى رومانيا."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B5%87%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%BD_%E0%B4%95%E0%B5%8B%E0%B4%9F%E0%B5%8D%E0%B4%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Bakel4.jpg","page_title":"ബേക്കൽ കോട്ട","context_page_description":"കേരളത്തിലെ കാസർഗോഡ് ജില്ലയിൽ സ്ഥിതി ചെയ്യുന്ന കോട്ടയാണ് ബേക്കൽ കോട്ട. കേരളത്തിലെ വലിയ കോട്ടയും ഏഷ്യ വൻകരയിലെ ഒരു പ്രധാന കോട്ടയും ആണിത്.\\nഅറബിക്കടലിന്റെ തിരത്തായി 35 ഏക്കറിൽ പരന്നു കിടക്കുന്ന ഈ കോട്ട പതിനേഴാം നൂറ്റാണ്ടിന്റെ മദ്ധ്യത്തിൽ പണികഴിപ്പിച്ചതാണ്. ഈ കോട്ട നിർമ്മിച്ചിരിക്കുന്നത് ചെങ്കല്ലുകൊണ്ടാണ്."},{"page_url":"https://es.wikipedia.org/wiki/Historia_contempor%C3%A1nea_de_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Jose_Canalejas.jpg","page_title":"Historia contemporánea de España","context_page_description":"La historia contemporánea de España es la disciplina historiográfica y el periodo histórico de la historia de España que corresponde a la Edad Contemporánea en la Historia Universal. Sin embargo, convencionalmente la historiografía española suele considerar como hito inicial no a la Revolución francesa, ni la Independencia de Estados Unidos o la Revolución industrial inglesa, sino un acontecimiento local decisivo: el inicio de la guerra de la Independencia de España.​"},{"page_url":"https://lv.wikipedia.org/wiki/Latvijas_okup%C4%81cija_(1940)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Bundesarchiv_Bild_137-054436%2C_Riga%2C_Umsiedlung_Baltendeutscher.jpg","page_title":"Latvijas okupācija (1940)","context_page_description":"Latvijas okupācija 1940. gadā bija Latvijas Republikas bruņota sagrābšana ar tai sekojošu aneksiju, ko 1940. gada vasarā Baltijas valstu okupācijas ietvaros īstenoja PSRS.\\nVēsturnieki Latvijas okupāciju sadala 3 posmos:\\npolitiskās augsnes sagatavošana,\\npastāvīgas PSRS militārās klātbūtnes uzspiešana,\\nkaraspēka ievešana un politiskās varas pārņemšana.\\nViens no pirmajiem starptautisko tiesību jēdzienu occupatio bellicara un occupatio pacifica, balstoties uz juristu atzinumiem, lietoja Latvijas sūtnis Londonā Kārlis Zariņš 1943. gada 27. oktobra memorandā Lielbritānijas Ārlietu ministrijai par situāciju ar Latvijas valsti."},{"page_url":"https://en.wikipedia.org/wiki/Christian_Klingberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Klingberg_signatur.jpg","page_title":"Christian Klingberg","context_page_description":"Christian Klingberg was a Danish Supreme Court attorney and chief legal officer of the Danish Asia Company."},{"page_url":"https://es.wikipedia.org/wiki/Planetario_de_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/20171004112624_057A0614-1500x1000.jpg","page_title":"Planetario de Madrid","context_page_description":"El Planetario de Madrid es un planetario, obra del arquitecto madrileño Salvador Pérez Arroyo, perteneciente al Ayuntamiento de Madrid y ubicado dentro del Parque de Enrique Tierno Galván. Ofrece jornadas al aire libre gratuitas y tiene sesiones individuales y en grupo sobre la divulgación de la astronomía. Durante los años 2016 y 2017 fue sometido a una profunda renovación tanto tecnológica como de las instalaciones y edificio, posible en virtud de un acuerdo de colaboración entre el Ayuntamiento de Madrid y la Obra Social “la Caixa” – que incluía dotación de contenidos, renovación de exposiciones y la realización de actividades varias en el campo de la divulgación científica."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%BE%D0%B3_%D0%A1%D0%B0%D0%B2%D0%B5_%D1%83_%D0%9C%D0%B8%D0%BB%D0%B2%D0%BE%D0%BA%D0%B8%D1%98%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/The_St._Sava_Serbian_Orthodox_Cathedral_in_Milwaukee%2C_Wisconsin.jpg","page_title":"Црква Светог Саве у Милвокију","context_page_description":"Црква Светог Саве у Милвокију највећа је српска православна црква у Милвокију. Припада епархији новограчаничко-средњозападноамеричкој. Црквена заједница основана је 1912, а изградња цркве је завршена 1956. године. Црква је украшена традиционалним зидним мозаицима, а у оквиру црквеног комлекса налази се истоимена школа и центар за догађаје, познатији као Дворана америчких Срба."},{"page_url":"https://sv.wikipedia.org/wiki/Hecatesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Hecatesia_fenestrata_m.jpg","page_title":"Hecatesia","context_page_description":"Hecatesia är ett släkte av fjärilar. Hecatesia ingår i familjen nattflyn.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Benelli_MR1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/ARMS_%26_Hunting_2010_exhibition_%28331-09%29.jpg","page_title":"Benelli MR1","context_page_description":"The Benelli MR1 is a rifle developed and manufactured by the Benelli Armi SpA of Italy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%81%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D0%BB-%D1%82%D0%A0%D0%9D%D0%9A-%D1%81%D0%B8%D0%BD%D1%82%D0%B0%D0%B7%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/PBB_GE_DARS_201623_s_at_fs.png","page_title":"Аспартил-тРНК-синтаза","context_page_description":"Аспартил-тРНК-синтаза – білок, який кодується геном DARS, розташованим у людей на короткому плечі 2-ї хромосоми. Довжина поліпептидного ланцюга білка становить 501 амінокислот, а молекулярна маса — 57 136.\\nЦей білок за функціями належить до лігаз, аміноацил-тРНК-синтетаз.\\nЗадіяний у такому біологічному процесі як біосинтез білка.\\nБілок має сайт для зв'язування з АТФ, нуклеотидами.\\nЛокалізований у цитоплазмі."},{"page_url":"https://pl.wikipedia.org/wiki/Nesselande_(stacja_metra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Nsl2.jpg","page_title":"Nesselande (stacja metra)","context_page_description":"Nesselande – stacja metra w Rotterdamie, położona na linii B. Została otwarta 29 sierpnia 2005. Stacja znajduje się w Nesselande, w dzielnicy Prins Alexander."},{"page_url":"https://en.wikipedia.org/wiki/Texas%27s_5th_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Alan_Steelman.jpg","page_title":"Texas's 5th congressional district","context_page_description":"Texas's 5th congressional district of the United States House of Representatives is in an area that includes a northeast portion of the City of Dallas, Dallas County including Mesquite plus a number of smaller counties south and east of Dallas including Anderson, Cherokee, Henderson, Van Zandt, and Kaufman counties. As of the 2000 census, the 5th district represents 651,620 people. The current Representative from the 5th district is Lance Gooden.\\nCarolyn Salter was the only Democrat to run in the Democratic primary for the race, and it is assumed she will face him in the November election. Republican Don Hill is running against Gooden in the Republican primary."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B9%8C%E7%94%B0%E7%BA%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/UtenaStone.jpg","page_title":"乌田纳","context_page_description":"乌田纳是立陶宛东北部的一座城市，是乌田纳区和乌田纳县的行政中心。乌田纳是立陶宛最早出现的聚居地之一，地名最早见于1261年，可能取自一个水文名称。\\n乌田纳是工业城市，以生产服装、食品和饮品闻名。近年市内的街道、广场和公园都经过重建，以吸引游客。2007年，乌田纳获得联合国颁发的“全球最适宜居住城市国际大奖”B类银奖。\\n乌田纳的周年纪念是9月的最后一个周末。"},{"page_url":"https://es.wikipedia.org/wiki/Cancosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Cancosa.jpg","page_title":"Cancosa","context_page_description":"Cancosa es un poblado aimara altiplanico la Región de Tarapacá, a las faldas del volcán Sillajhuay, próximo a la frontera con Bolivia.\\nSegún se indica en el Conservador de Bienes Raíces de la comuna de Iquique.\\nEl pueblo fue fundado por las familias: Moscoso, Challapa, Ticuna y Mamani.\\nEl poblado cuenta con escuela, biblioteca, junta de vecinos, albergue turístico, club deportivo y retén de Carabineros de Chile.​ Sus habitantes viven de la agricultura de quinoa y ganadería de llamas y alpacas, además del turismo y la artesanía. También hay cuatro campos minados y que en cumplimiento del tratado de Otawa, deben ser retirados antes del año 2020, por parte del estado del Chile."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%88%D0%B8%D0%BC%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Tan_Son_Nhat_International_Airport.jpg","page_title":"Хошимин","context_page_description":"Хошими́н — город на юге Вьетнама; крупнейший город страны.\\nС 1887 по 1901 год — столица Французского Индокитая. С 1955 по 1975 год — столица Южного Вьетнама."},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Historic_Landmarks_in_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Piscataway_park.jpg","page_title":"List of National Historic Landmarks in Maryland","context_page_description":"This is a List of National Historic Landmarks in Maryland. There are currently 74 National Historic Landmarks in Maryland. Also included are short lists of former NHLs and of other historic sites of national importance administered by the National Park Service."},{"page_url":"https://fr.wikipedia.org/wiki/Cuisine_gambienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Gambia_Banjul_Breweries_0006.jpg","page_title":"Cuisine gambienne","context_page_description":"La cuisine gambienne est une cuisine ouest-africaine."},{"page_url":"https://ro.wikipedia.org/wiki/Siegfried_Selberherr","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Siegfried_Selberherr.jpg","page_title":"Siegfried Selberherr","context_page_description":"Siegfried Selberherr, este un om de știință austriac cu cu experiență în domeniul microelectronicii, profesor la Institutul de Microelectronică al Universității Tehnice din Viena. Interesul său principal în cercetare îl reprezintă modelarea și simularea fenomenelor fizice în domeniul microelectronicii."},{"page_url":"https://it.wikipedia.org/wiki/Denis_Diderot","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/DiderotPhilosophicalThoughts.jpg","page_title":"Denis Diderot","context_page_description":"Denis Diderot è stato un filosofo, enciclopedista, scrittore e critico d'arte francese.\\nFu uno dei massimi rappresentanti dell'Illuminismo e uno degli intellettuali più rappresentativi del XVIII secolo, amico e collaboratore di Voltaire e del barone d'Holbach, col quale scrisse numerose opere anonime di intonazione antireligiosa e anticlericale.\\nFu promotore, direttore editoriale ed editore dell'Encyclopédie, avvalendosi inizialmente dell'importante collaborazione di d'Alembert, che però alle prime difficoltà con la censura si ritirerà.\\nSarà Diderot, dirigendo l'opera e scrivendo circa 1500 voci, spesso anonime, che porterà avanti quasi da solo grazie a vari finanziamenti. l'impresa, sino all'uscita degli ultimi volumi nel 1772.\\nOltre al colossale lavoro enciclopedico e alle pubblicazioni anonime per aggirare la censura, Diderot scrisse numerose opere filosofiche e teatrali, romanzi, articoli e saggi su disparati argomenti, occupandosi di arte, storia, politica e società."},{"page_url":"https://en.wikipedia.org/wiki/Richmond%E2%80%93San_Rafael_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Richmond-San_Rafeal_Bridge.jpg","page_title":"Richmond–San Rafael Bridge","context_page_description":"The Richmond–San Rafael Bridge is the northernmost of the east–west crossings of the San Francisco Bay in California, USA. Officially named after California State Senator John F. McCarthy, it bridges Interstate 580 from Richmond on the east to San Rafael on the west. It opened in 1956, replacing ferry service by the Richmond–San Rafael Ferry Company."},{"page_url":"https://vi.wikipedia.org/wiki/H%E1%BB%87_%C4%91%E1%BB%99ng_v%E1%BA%ADt_Vi%E1%BB%87t_Nam","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Eoperipatus_totoro.jpg","page_title":"Hệ động vật Việt Nam","context_page_description":"Hệ động vật ở Việt Nam là tổng thể các quần thể động vật bản địa sinh sống trong lãnh thổ Việt Nam hợp thành hệ động vật của quốc gia này. Việt Nam là đất nước nhiệt đới thuộc vùng Đông Nam Á có sự đa dạng sinh học cao. Sự đa dạng của động vật ở Việt Nam phản ánh sự phong phú của hệ thực vật nơi đây. Do sự khác biệt lớn về khí hậu từ vùng gần xích đạo tới giáp vùng cận nhiệt đới, cùng với sự đa dạng về địa hình đã tạo nên sự đa dạng về thiên nhiên. Một dải rộng các thảm thực vật bao gồm nhiều kiểu rừng phong phú đã được hình thành ở các độ cao khác nhau. Nhiều loại môi trường sống khác nhau tạo ra nhiều cơ hội cho các sinh vật phát triển vì nó cho phép chúng phân tách khỏi những loài khác bằng cách thay đổi nơi ở và thức ăn.\\nTừ đó, hệ động vật Việt Nam hết sức phong phú và đa dạng cả về chủng loài lẫn sinh khối và số lượng. Hệ động vật Việt Nam không những giàu về thành phần loài mà còn có nhiều nét độc đáo, đại diện cho vùng Đông Nam Á và có nhiều loài đặc hữu."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A8%E0%B8%B8%E0%B8%A0%E0%B8%8A%E0%B8%B1%E0%B8%A2_%E0%B8%A8%E0%B8%A3%E0%B8%B5%E0%B8%A7%E0%B8%B4%E0%B8%88%E0%B8%B4%E0%B8%95%E0%B8%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Suphachai_Sriwichit.JPG","page_title":"ศุภชัย ศรีวิจิตร","context_page_description":"ศุภชัย ศรีวิจิตร มีชื่อเล่นว่า เอ หรือ เอเอ ทำงานคนเบื้องหลังวงการบันเทิง เป็นผู้จัดการนักแสดงชาวไทย ศุภชัยเติบโตมาในสังคมชนบทที่อำเภอพรหมคีรี จังหวัดนครศรีธรรมราช บ้านของเขาทำสวนยางพารา มีบิดาประกอบอาชีพครู ศุภชัยมีเชื้อสายจีนจากมารดา\\nศุภชัย เป็นผู้จัดการของนักแสดงที่มีชื่อเสียงแถวหน้าของประเทศไทย อาทิ เช่น พัชราภา ไชยเชื้อ, ณัฐวุฒิ สกิดใจ, กันตพงศ์ บำรุงรักษ์, ณเดชน์ คูกิมิยะ, มาริโอ้ เมาเร่อ, ศุกลวัฒน์ คณารศ เป็นต้น\\nศุภชัยจบการศึกษาระดับมัธยมศึกษาที่ โรงเรียนเบญจมราชูทิศ นครศรีธรรมราช และสำเร็จการศึกษาระดับอุดมศึกษา ที่มหาวิทยาลัยรังสิต คณะวิศวกรรมศาสตร์\\nเริ่มเข้าสู่วงการบันเทิง เมื่อได้เข้ามาศึกษาในระดับอุดมศึกษา ที่กรุงเทพมหานคร คณะวิศวกรรมศาสตร์ มหาวิทยาลัยรังสิต เอ ศุภชัย ได้มาพักอาศัยอยู่กับน้าสาวของปัทมวรรณ เค้ามูลคดี ที่เป็นญาติห่าง ๆ กัน และได้เข้ามาเล่นบทตัวประกอบในโฆษณารวมทั้งละคร"},{"page_url":"https://sk.wikipedia.org/wiki/Les_Rousses","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Map_commune_FR_insee_code_39470.png","page_title":"Les Rousses","context_page_description":"Les Rousses je francúzska obec, ktorá sa nachádza v departemente Jura, v regióne Franche-Comté."},{"page_url":"https://eu.wikipedia.org/wiki/Nith_ibaia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Devorgilla_Bridge_%28c._15th_Century%29-_Dumfries_-_geograph.org.uk_-_194537.jpg","page_title":"Nith ibaia","context_page_description":"Nith ibaia Eskoziako seigarren ibai luzeena da. Ibaiak zeharkatzen duen eremuari Nithsdale izena ematen zaio."},{"page_url":"https://ru.wikipedia.org/wiki/Europa_Tower","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Happy_Wedding_%3F_%28Vilnius%29_%287661000414%29.jpg","page_title":"Europa Tower","context_page_description":"Europa Tower — небоскрёб в Вильнюсе высотой 149 метров. Является самым высоким зданием в Прибалтике. Общая площадь здания составляет 17 100 м².\\nЗдание было построено в 2004 году. Находится на проспекте Конституции. Спроектирован архитектурной группой «Audriaus Ambarasas Architects». Здание было построено и официально открыто 1 мая 2004 года, как часть празднования вступления Литвы в ЕС. Небоскреб вызвал много споров из-за искажения исторического образа Старого города Вильнюса. Небоскрёб имеет смотровую площадку на высоте 144 метров.\\n1 сентября 2006 года Ален Робер, более известный как «Человек-паук», забрался на крышу данного высотного сооружения."},{"page_url":"https://hsb.wikipedia.org/wiki/Piwo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/%C5%A0umavsk%C3%BD_kout_-_nefiltrovan%C3%BD.JPG","page_title":"Piwo","context_page_description":"Piwo je alkoholiski napoj, kiž nastawa přez fermentaciju přetworjenych zornješkow. Nětko jako dodaće do piwa wužiwa so chmjel, kiž daje hórkosć, móžne su tež druhe wobstatki jako na přikład korjeniny, płody abo měd. Fermentacija bu typisce wot piwarskich droždźow wuwabjena.\\nW Němskej ma wjetšina sortow piwa mjezy 4,5% a 6% alkohola.\\nSłowo \\"piwo\\" je wuznamjeniło w prasłowjanskej rěči jednorje \\"piće\\", potom je so přeměniło k zapřimnjenju alkoholiskeho napoja."},{"page_url":"https://en.wikipedia.org/wiki/Agni_Yoga","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/From_Beyond.jpg","page_title":"Agni Yoga","context_page_description":"Agni Yoga or the Living Ethics, or the Teaching of Life, is a Neo-Theosophical religious doctrine transmitted by Helena Roerich and Nicholas Roerich from 1920. The term Agni Yoga means \\"Mergence with Divine Fire\\" or \\"Path to Mergence with Divine Fire\\". This term was introduced by the Roerichs. The followers of Agni Yoga believe that the teaching was given to the Roerich family and their associates by Master Morya, the guru of the Roerichs and of Helena Blavatsky, one of the founders of the modern Theosophical movement and of the Theosophical Society.\\nAgni Yoga is a path of practice in daily life. It is the yoga of fiery energy, of consciousness, of responsible, directed thought. It teaches that the evolution of the planetary consciousness is a pressing necessity and that, through individual striving, it is an attainable aspiration for mankind. According to Helena Roerich, Agni Yoga is the synthesis of all yogas. In all the ancient Hindu scriptures, the approaching Fiery Age was predicted. Agni–Fire, which to a varying degree is at the heart of all yogas, will saturate the atmosphere of our planet, and all the branches of yoga will be merged into a fiery synthesis."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre-Jean_David_d%27Angers","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Philopoemen_David_Angers_Louvre_LP1556.jpg","page_title":"Pierre-Jean David d'Angers","context_page_description":"Pierre-Jean David, dit David d’Angers, né à Angers le 12 mars 1788 et mort à Paris le 6 janvier 1856, est un sculpteur et médailleur français, représentatif du romantisme dans la sculpture française du XIXᵉ siècle."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D8%A7%D9%88_%D8%B3%D9%8A%D9%85%D9%88%D9%8A%D8%B3_%D9%84%D9%88%D8%A8%D8%B3_%D9%86%D9%8A%D8%AA%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Jo%C3%A3o_Sim%C3%B5es_Lopes_Neto.jpg","page_title":"جواو سيمويس لوبس نيتو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجواو سيمويس لوبس نيتو كان صحفى من البرازيل."},{"page_url":"https://pl.wikipedia.org/wiki/Eneco_Tour_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/2016_Eneco_Tour_-_Stage_6_%2829991479195%29.jpg","page_title":"Eneco Tour 2016","context_page_description":"12. edycja Eneco Tour odbyła się w dniach 19–25 września 2016 roku. Trasa tego siedmioetapowego wyścigu kolarskiego liczyła 998,2 km ze startem w Bolsward i metą w Geraardsbergen."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%90%EB%A0%88%EC%9D%B4%EC%8B%9C%EC%95%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Nasi_Lemak%2C_Mamak%2C_Sydney.jpg","page_title":"말레이시아","context_page_description":"말레이시아는 동남아시아에 있는 연방제 입헌 군주국이다. 말레이시아는 13개의 주와 3개의 연방 직할구로 구성되어 있고, 남중국해로 나뉜 말레이 반도 지역과 보르네오 섬 지역으로 구성되어 있다. 태국, 인도네시아, 브루나이와 국경을 맞대고 있고, 해상 국경은 싱가포르와 베트남, 필리핀과 맞대고 있다. 수도는 쿠알라룸푸르이지만, 연방정부는 푸트라자야에 있다.\\n말레이시아의 역사는 18세기부터 대영 제국의 식민지가 된 말레이 왕국으로 거슬러 올라간다. 처음 영국의 식민지가 된 곳은 해협식민지로 불리었고, 다른 곳들은 보호령이 되었다. 1946년 말레이 반도의 주들이 연합하여 말라야 연합을 세웠고, 1948년 연합을 재편성하여 말라야 연방이 설립되었다. 1957년 8월 31일 영국으로부터 완전히 독립을 하게 되었으며, 1963년 9월 16일 말라야 연방은 사바, 사라왁, 싱가포르와 연합하면서 Malaya란 이름에 si를 추가해 Malaysia가 되었다. 그러나 2년도 채 지나지 않은 1965년, 싱가포르는 정부와의 마찰로 연방에서 승급하게 되었다. 말레이시아는 독립 이후 아시아에서 최고의 경제적인 기록을 가지고 있는데, 거의 50년동안의 GDP 성장률이 평균 6.5%라는 것이다. 말레이시아의 경제는 전통적으로 천연 자원에 거의 의존하고 있었으나, 최근에 과학, 관광, 무역, 의료관광 등의 산업이 성장하고 있다.\\n말레이시아는 입헌군주국이며, 국가 원수인 군주은 9개 주에 있는 술탄에 의하여 5년에 한 번씩 호선으로 선출한다. 군주의 칭호는 양디-퍼르투안 아공이며, 지금 군주는 파항주의 술탄 압둘라이다. 정부의 장은 수상이다. 정부체제는 웨스트민스터 체제에 가깝고, 법체계는 영국의 법에 기초한다. 말레이시아는 민족과 문화가 다양하고 그 다양성이 정치에도 큰 영향을 미친다. 국교는 이슬람교이지만, 헌법상 종교의 노에는 인정되고 있다.\\n말레이시아에는 유라시아 본토의 최남단 지역인 탄중피아이가 있고, 적도 근처에 위치하고 있어 열대 기후의 국가이다. 다양한 서식물군이 있어 생물 다양성이 큰 국가이다. ASEAN, 이슬람 회의 기구의 창립멤버이며, APEC, 영국연방, 비동맹 운동의 회원국이다.\\n2018년을 기점으로 말레이시아의 구매력 평가는 1인당 $30,860로 평가되었다."},{"page_url":"https://sl.wikipedia.org/wiki/Gradenc","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Gradenc%2C_spredaj_baraka_za_%22vahtanje%22_divjih_pra%C5%A1i%C4%8Dev_1957.jpg","page_title":"Gradenc","context_page_description":"Gradenc je gručasta vas v Občini Žužemberk, ki stoji na hribovitem območju v južnem delu Suhe krajine. V bližini sta vzpetini Trški Boršt in Plešivica ter plitva kraška kotanja Dole. Pod Gradenc spada tudi razložen vinogradniški zaselek Gradenška Gora vzhodno nad vasjo, ki ga sestavljajo večinoma zidanice. Vaška cerkev v gotskem slogu je posvečena sv. Nikolaju, njena prva pisna omemba sega v leto 1382, v 18. stoletju je bila obširneje predelana.\\nProti koncu druge svetovne vojne, 9. marca 1945, je na polje v bližini Gradenca strmoglavil ameriški bombnik Boeing B-17 Flying Fortress, ki je bil poškodovan med napadom na avstrijski Gradec. Vseh deset članov posadke je pravočasno izskočilo in preživelo strmoglavljenje, nakar so se ob pomoči domačinov ter partizanov varno vrnili v bazo v Italiji. V spomin na ta dogodek so leta 2017 postavili obeležje s spominsko ploščo."},{"page_url":"https://vi.wikipedia.org/wiki/X%C3%A3_Lower_Nazareth,_Qu%E1%BA%ADn_Northampton,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Louise_W._Moore_Point_of_View.jpg","page_title":"Xã Lower Nazareth, Quận Northampton, Pennsylvania","context_page_description":"Xã Lower Nazareth là một xã thuộc quận Northampton, tiểu bang Pennsylvania, Hoa Kỳ. Năm 2010, dân số của xã này là 5.674 người."},{"page_url":"https://en.wikipedia.org/wiki/Conus_bengalensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Conus_bengalensis_001.jpg","page_title":"Conus bengalensis","context_page_description":"Conus bengalensis, common name the Bengal cone, is a species of sea snail, a marine gastropod mollusk in the family Conidae, the cone snails and their allies.\\nLike all species within the genus Conus, these snails are predatory and venomous. They are capable of \\"stinging\\" humans, therefore live ones should be handled carefully or not at all."},{"page_url":"https://de.wikipedia.org/wiki/Stadion_Poljud","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/2010_IAAF_Continental_Cup_-_Poljud%2C_Split.JPG","page_title":"Stadion Poljud","context_page_description":"Das Stadion Poljud ist ein Fußballstadion mit Leichtathletikanlage in der kroatischen Hafenstadt Split. Es ist die Heimstätte des traditionsreichen Fußballvereins HNK Hajduk Split. Es trägt auch den Beinamen Poljudska ljepotica. Auch die kroatische Fußballnationalmannschaft nutzt die Spielstätte gelegentlich für ihre Partien."},{"page_url":"https://en.wikipedia.org/wiki/David_MacNaughton","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/David_MacNaughton_at_2017_MIFF_%28cropped%29.jpg","page_title":"David MacNaughton","context_page_description":"David MacNaughton is a Canadian diplomat, business leader, political strategist, and strategy consultant who most recently was the Chairman of StrategyCorp, a communications, public affairs, and management consulting firm. He was Canada's ambassador to the United States from 2016 to 2019, succeeding Gary Doer. MacNaughton presented his diplomatic papers to US President Barack Obama on March 2, 2016.\\nMacNaugton is credited by Canadian Business with \\"changing the face of public affairs in Canada\\" through the co-creation of the firm Public Affairs Resource Group, which in 1987 brought the services of public affairs and the polling firm Decima Research under one roof."},{"page_url":"https://de.wikipedia.org/wiki/Louveciennes","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Louveciennes_Ch%C3%A2teau_de_Voisins.JPG","page_title":"Louveciennes","context_page_description":"Louveciennes ist eine französische Kleinstadt mit 7099 Einwohnern im Département Yvelines in der Region Île-de-France etwa 20 Kilometer westlich von Paris."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D0%BD%D0%B8,_%D0%9B%D1%8E%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Luke_Varney_-_2.jpg","page_title":"Варни, Люк","context_page_description":"Люк Варни — английский футболист, нападающий клуба «Бертон Альбион»."},{"page_url":"https://en.wikipedia.org/wiki/Parvati_Valley","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Tosh_in_Monsoon%2C_July_2017.jpg","page_title":"Parvati Valley","context_page_description":"Parvati Valley is situated in the northern Indian state of Himachal Pradesh. From the confluence of the Parvati River with the River Beas, the Parvati Valley runs eastwards, through a steep-sided valley from the town of Bhuntar, in the Kullu district of Himachal Pradesh in Northern India."},{"page_url":"https://eo.wikipedia.org/wiki/Glacirompilo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Polarstern.gif","page_title":"Glacirompilo","context_page_description":"Glacirompilo estas speciale ekipita ŝipo, kiu povas veturi tra glacikovrita maro kaj dumtempe rompi vojon por si aŭ aliaj ŝipoj.\\nLa efikan glacirompadon ebligas, tio ke la mara glacio ofte enhavas enfermaĵojn pro la marakvo pro kiuj ĝi ne estas tiel dura kaj kompakta kiel la glaĉera flosanta glacio."},{"page_url":"https://eo.wikipedia.org/wiki/Sornac","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sornac%2C_le_parvis_de_l%27%C3%A9glise.jpg","page_title":"Sornac","context_page_description":"Sornac estas franca komunumo lokita en la departemento Corrèze kaj en la regiono Limoĝio. Ĝi havis 815 loĝantojn laŭ censo plenumita en 2006.\\nĜi situas en la natura regiona parko Millevaches."},{"page_url":"https://pt.wikipedia.org/wiki/Giro_d%27Italia_de_1911","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Giro_Italia_1911-map.png","page_title":"Giro d'Italia de 1911","context_page_description":"Giro d'Italia de 1911 foi a terceira edição da prova ciclística Giro d'Italia, realizada entre os dias 15 de maio e 6 de junho de 1911.\\nA competição foi realizada em 12 etapas com um total de 3.530 km.\\nO vencedor foi o ciclista Carlo Galetti. Largaram 86 competidores cruzaram a linha de chegada 24 corredores."},{"page_url":"https://en.wikipedia.org/wiki/John_F._Dryden","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Portrait_of_John_Fairfield_Dryden.jpg","page_title":"John F. Dryden","context_page_description":"John Fairfield Dryden was the founder of the Prudential Insurance Company and a United States Senator from New Jersey. He was known as the \\"father of industrial insurance\\"."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BC%80%E5%85%83%E5%AF%BA_(%E6%B3%89%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Quanzhou_Kaiyuan_Si_20120229-83.jpg","page_title":"开元寺 (泉州)","context_page_description":"開元寺位於中國福建省泉州市鯉城區西街，是始建於唐代的漢傳佛教寺院，1982年被列為第二批全國重點文物保護單位，1982年被列為漢族地區佛教全國重點寺院。"},{"page_url":"https://it.wikipedia.org/wiki/Andy_Merrill","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Andy_Merrill-silly..jpg","page_title":"Andy Merrill","context_page_description":"Andy Ronald Merrill è uno sceneggiatore, produttore televisivo e doppiatore statunitense.È noto per la sua celebre interpretazione comica del personaggio di Brak, delle serie animate Space Ghost Coast to Coast e Cartoon Planet, e di altre voci correlate al mondo di Space Ghost.\\nMerrill è noto anche per essere il creatore della serie animata The Brak Show, di Adult Swim, con Jim Fortier e Pete Smith."},{"page_url":"https://pl.wikipedia.org/wiki/J%C3%B3zef_Trenkwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/J._TRENKWALD_%28Poland%29_on_Lwi_Pazur.png","page_title":"Józef Trenkwald","context_page_description":"Józef Piotr Trenkwald – major kawalerii Wojska Polskiego, kawaler Orderu Virtuti Militari, medalista olimpijski w jeździectwie."},{"page_url":"https://es.wikipedia.org/wiki/Movimiento_de_independencia_indio","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/SepoyMutiny.jpg","page_title":"Movimiento de independencia indio","context_page_description":"La independencia de India consistió en revoluciones que comenzaron en 1857 y que llegaron a su fin bajo el liderazgo de Mahatma Gandhi entre 1942 y 1947, así como con la invasión a la India británica por el Ejército Nacional Indio comandado por Subbash Chandra Bose durante la Segunda Guerra Mundial. La independencia finalmente se logró el 15 de agosto de 1947."},{"page_url":"https://fr.wikipedia.org/wiki/Alireza_Jahanbakhsh","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Alireza_Jahanbakhsh_2018.jpg","page_title":"Alireza Jahanbakhsh","context_page_description":"Alireza Jahanbakhsh, né le 11 août 1993 à Jirandeh en Iran, est un footballeur international iranien. Évoluant au poste d'ailier, il joue actuellement avec Brighton & Hove Albion."},{"page_url":"https://lt.wikipedia.org/wiki/R%C5%ABdai%C4%8Di%C5%B3_piliakalnis","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/R%C5%ABdai%C4%8Diai2009061507.JPG","page_title":"Rūdaičių piliakalnis","context_page_description":"Rūdaičių piliakalnis, vadinamas Pilale, Pilalių kalnu – piliakalnis pietvakarinėje Kretingos rajono savivaldybės teritorijos dalyje, Rūdaičių kaime, Žibos upelio kairiajame krante.\\nPasiekiamas keliu Rūdaičiai–Vydmantai, nuo Mokyklos gatvės pavažiavus 450 m Pilalės gatve, yra jos dešinėje, pervažiavus Žibos upelį."},{"page_url":"https://it.wikipedia.org/wiki/Throop_(Pennsylvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Throop%2C_PA_Holy_Trinity_Polish_Catholic.jpg","page_title":"Throop (Pennsylvania)","context_page_description":"Throop è un comune degli Stati Uniti d'America, situato nello stato della Pennsylvania, nella contea di Lackawanna."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AD%89%E6%8C%81%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Toji-in_Temple_Japanese_garden140512NI4.JPG","page_title":"等持院","context_page_description":"等持院は、京都市北区にある臨済宗天龍寺派の寺院。山号は萬年山。足利氏の菩提寺であり、足利尊氏の墓所としても知られる。"},{"page_url":"https://eo.wikipedia.org/wiki/Kamie%C5%84_Pomorski","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Wussow-tomb.JPG","page_title":"Kamień Pomorski","context_page_description":"Kamień Pomorski - estas kuracloka urbo en Okcidenta Pomerio en Pollando nur 7 km de la Balta Maro. Ĝi apartenas al komunumo Kamień Pomorski en distrikto Kamieński.\\nKamień Pomorski estis la unua konata ĉefurbo de Pomerio.\\nLa 31an de decembro 2012 en la urbo havis 9190 da loĝantoj."},{"page_url":"https://sv.wikipedia.org/wiki/Berosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Reitter-1908_table79.jpg","page_title":"Berosus","context_page_description":"Berosus är ett släkte av skalbaggar som beskrevs av Leach 1817. Berosus ingår i familjen palpbaggar."},{"page_url":"https://fr.wikipedia.org/wiki/Rylsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/RYLSKY_%28Ahu%29_Montmartre_1926_huile_sur_toile.jpg","page_title":"Rylsky","context_page_description":"Ferdinand Albert François Joseph Ladislas Ścibor-Rylski, dit Rylsky, également connu sous le pseudonyme de Ahü, né à Paris le 17 juillet 1901 et mort dans la même ville le 12 mai 1970, est un peintre et graveur français de la nouvelle École de Paris."},{"page_url":"https://it.wikipedia.org/wiki/Kirchdorf_in_Tirol","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Kirchdorf_i_Tirol.jpg","page_title":"Kirchdorf in Tirol","context_page_description":"Kirchdorf in Tirol è un comune austriaco di 3889 abitanti nel distretto di Kitzbühel, in Tirolo."},{"page_url":"https://es.wikipedia.org/wiki/Puntarenas_(ciudad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Ferri_Tambor.JPG","page_title":"Puntarenas (ciudad)","context_page_description":"Puntarenas es una ciudad de Costa Rica, y capital del cantón de Puntarenas y la provincia de Puntarenas, la más extensa del país. Es la ciudad más grande y poblada del Pacífico costarricense. Su área metropolitana está conformada por tres distritos del cantón al que pertenece: Puntarenas, El Roble y Chacarita.​ Está ubicada en la costa oriental del golfo de Nicoya, frente a la península de Nicoya, en el océano Pacífico, sobre una lengua de tierra que da origen a su nombre.\\nLa ciudad de Puntarenas es rica en historia, tradiciones y costumbres. Históricamente, fue el puerto más importante del Pacífico costarricense, por el que se dieron las principales exportaciones que permitieron el desarrollo del país durante el siglo XIX y parte del siglo XX. Por su posición costera, fue un importante centro de llegada de inmigrantes hacia la mitad del siglo XX. Su auge como destino turístico data de 1940.\\nPuntarenas es uno de los puertos marítimos más importantes del país; las principales exportaciones incluyen plátanos, café y pescado procesado entre otros productos, las cuales se hacen a través del puerto de Caldera."},{"page_url":"https://de.wikipedia.org/wiki/1727","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Max_III_Joseph_als_Prinz.jpg","page_title":"1727","context_page_description":"17. Mai: Nach dem Tod der Kaiserin Katharina I. übernimmt dem Willen der Kaiserin entsprechend der Enkel Peters I., der minderjährige Peter II., den russischen Thron. Der erst 12-jährige Zar steht gemäß Katharinas Testament unter der Vormundschaft ihres Vertrauten Alexander Danilowitsch Menschikow und ihrer beiden Töchter Anna und Elisabeth. Elisabeth zeigt jedoch keine politischen Ambitionen, und der ehrgeizige Menschikow bewirkt die Ausreise von Anna nach Kiel, um seine Machtstellung am Hof weiter auszubauen.\\n20. September: Alexander Danilowitsch Menschikow, der bisher allmächtige Berater am Kaiserhof, wird durch den Einfluss von Wassili Wladimirowitsch Dolgorukow verhaftet und mit seiner Familie nach Berjosow im Gouvernement Tobolsk in Westsibirien verbannt. Sein Vermögen verfällt der Krone.\\n21. Oktober: Im ersten Vertrag von Kjachta zwischen China und Russland wird unter anderem der Grenzverlauf zwischen den beiden Reichen festgelegt und der Grenzhandel geregelt. Den zuvor gültigen Vertrag von Nertschinsk aus dem Jahr 1689 hat das Qing-Reich im Jahr 1722 wegen inhaltlicher Streitigkeiten gekündigt und die Grenze geschlossen."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_barroca_en_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Le_Palais_Barberini_%28Rome%29_%285970342674%29.jpg","page_title":"Arquitectura barroca en Italia","context_page_description":"La arquitectura barroca italiana se refiere a la arquitectura barroca practicada en la península itálica, en lo que hoy es Italia, en una época en que las ciudades-estado gradualmente habían ido perdiendo su independencia y estuvieron bajo la dominación extranjera, primero bajo España y después Austria. Se inició en Roma a principios del siglo XVII, se difundió primero por las ciudades italianas y, luego en al resto de Europa y América y ejerció su influencia en todo el mundo católico. Precedido por el Renacimiento y el manierismo, se desarrolló a lo largo de todo el siglo XVII, durante el período del absolutismo, ​ y fue sucedido por el rococó y el neoclasicismo.​ El término barroco, originalmente despectivo, indicaba la falta de regularidad y orden, que los defensores del neoclasicismo, influenciados por el racionalismo de la Ilustración, consideraban una indicación de mal gusto.​ De hecho, las características fundamentales de la arquitectura barroca, altamente decorativa y teatral, fueron las líneas curvas, con patrones sinuosos, como elipses, espirales o curvas con una construcción policéntrica, a veces con motivos que se entrelazan entre sí, para ser casi indescifrables."},{"page_url":"https://cs.wikipedia.org/wiki/Antick%C3%A1_%C5%99eck%C3%A1_filosofie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Latin_philo.JPG","page_title":"Antická řecká filosofie","context_page_description":"Antická řecká filosofie tvoří nejdůležitější součást antické filosofie. Rozvíjela se zhruba v období od 6. stol. př. n. l. do konce starověku. Starořečtí filosofové se považují za zakladatele západního vědeckého myšlení a mají pro filosofii dodnes zásadní význam, neboť otevřeli hlavní filosofické otázky a vypracovali základy filosofické metody. Už ve starověku se z filosofie vydělila astronomie, matematika a geometrie a filosofové položili základy většiny dalších věd."},{"page_url":"https://en.wikipedia.org/wiki/Lions_of_the_East_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Lions_of_the_East_Army_rocket_artillery.png","page_title":"Lions of the East Army","context_page_description":"The Lions of the East Army is a Syrian rebel group formerly affiliated with the Free Syrian Army's Southern Front that was formed in August 2014 and is based in southeastern Syria. Many of the group's fighters are al-Shaitat tribesmen from the Deir ez-Zor Governorate. The group was also active in Damascus city between January and July 2015, when its unit in Damascus merged into Jaysh al-Islam's 8th Brigade. It mainly focused on defeating the Islamic State of Iraq and the Levant in the eastern Syrian Desert, where it gained control over large areas since 2016."},{"page_url":"https://en.wikipedia.org/wiki/Stadio_Artemio_Franchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Soccer_in_Florence%2C_Italy%2C_2007.jpg","page_title":"Stadio Artemio Franchi","context_page_description":"The Stadio Artemio Franchi is a football stadium in Florence, Italy. It is currently the home of ACF Fiorentina. The stadium was temporarily used as the host of Italy's Six Nations matches from 2012. The old nickname of the stadium was \\"Comunale.\\" When it was first constructed, it was known as the Stadio Giovanni Berta, after Florentine fascist Giovanni Berta.\\nThe stadium was officially opened on 13 September 1931 with a match between Fiorentina and Admira Wien, though it took until 1932 for the stadium to be completely finished and currently holds 47,282. The architect is Pier Luigi Nervi and it is one of the most relevant examples of 20th-century architecture in the city. It hosted some of the matches of the 1934 World Cup, as well as football preliminaries for the 1960 Summer Olympics in Rome. In 1945, it hosted the Spaghetti Bowl between American service teams.\\nThe stadium is built entirely of reinforced concrete with a 70-meter tower that bears the stadium's flagstaff. The tower is called the \\"Tower of Marathon\\". Around the base of the tower, spiral ramps lead from the ground floor to the upper edge of the grandstand."},{"page_url":"https://en.wikipedia.org/wiki/Johann_Michael_Wittmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Koch%2C_Joseph_Anton_%E2%80%94_Portrait_von_Johann_Michael_Wittmer_%E2%80%94_mid-1830s.jpg","page_title":"Johann Michael Wittmer","context_page_description":"Johann Michael Wittmer was a German painter who came from a family of painters and sculptors and was associated with the \\"Deutschrömer\\". He is often referred to as \\"Johann Michael Wittmer II\\", to distinguish him from an earlier family member of the same name."},{"page_url":"https://lt.wikipedia.org/wiki/Gaston_Maspero","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Gaston_Maspero_Reutlinger_BNF_Gallica.jpg","page_title":"Gaston Maspero","context_page_description":"Gastonas Maspero – prancūzų egiptologas, Egipto senienų tarnybos vadovas."},{"page_url":"https://sl.wikipedia.org/wiki/Corr%C3%A8ze_(naselje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Port_Margot.jpg","page_title":"Corrèze (naselje)","context_page_description":"Corrèze je naselje in občina v južnem francoskem departmaju Corrèze regije Limousin. Leta 2006 je naselje imelo 1.175 prebivalcev."},{"page_url":"https://hu.wikipedia.org/wiki/Brabant_uralkod%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Vaclav_johana.jpg","page_title":"Brabant uralkodóinak listája","context_page_description":"A Brabanti Hercegséget hivatalosan 1183/1184-ban hozták létre, amikor Barbarossa Frigyes a Brabant hercege címet adományozta I. Henriknek, III. Gottfried leuveni gróf fiának. A brabanti hercegi cím lényegében a 10. századtól létező brabanti tartományi grófi címből származott. A Német-Római Császárság fennhatósága alá tartozó területet III. Henrik leuveni gróf kapta meg az előző gróf, II. Hermann brabanti palotagróf halála után. Bár a brabanti tartományi grófság területe aránylag kicsi volt, mégis ezt a nevet vették fel a hercegek a 13. századtól kezdve. 1190-ben, III. Gottfried halála után I. Henrik megkapta Alsó-Lotaringiát is, bár a címmel együtt nem járt közvetlen fennhatóság a hercegség területei felett.\\n1288-ban a worringeni csata során a I. János brabanti herceg megszerezte a Limburgi Hercegséget is. 1430. után a brabanti hercegi cím és a hercegség összes területe a burgundi hercegek kezébe került, akiktől előbb a Habsburg-ház spanyol, majd később osztrák ága örökölte. A címet jelenleg is használják, Belgiumban a trónörökös kapta, míg Spanyolországban a spanyol királyok egyik címe."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A8%D7%9B%D7%96_%D7%97%D7%A1%D7%99%D7%93%D7%99_%D7%A0%D7%93%D7%91%D7%95%D7%A8%D7%A0%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/%D7%91%D7%A0%D7%99%D7%99%D7%9F_%D7%A0%D7%93%D7%91%D7%95%D7%A8%D7%A0%D7%94.jpg","page_title":"מרכז חסידי נדבורנה","context_page_description":"מרכז חסידי נדבורנה - היכלי רוזנטל הוא שמו הרשמי של בניין בית המדרש ובית הכנסת המרכזי ומוסדותיה של חסידות נדבורנה בקריית נדבורנה בבני ברק. מבתי הכנסת הגדולים בבני ברק.\\nבית המדרש וביתו של האדמו\\"ר הסמוך לו נבנו במתחם בפינת הרחובות עזרא וחזון איש, שבו הוקמו גם מבני מגורים ומוסדות חינוך. לאחר הקמתו שונה שמו של הקטע האחרון ברחוב עזרא לרחוב האדמו\\"ר מנדבורנה. גג הקשתות הגבוה של המבנה בולט ונצפה מאזורים גדולים בסביבתו."},{"page_url":"https://it.wikipedia.org/wiki/Telfs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Wappen_at_telfs.png","page_title":"Telfs","context_page_description":"Telfs è un comune austriaco di 15 361 abitanti nel distretto di Innsbruck-Land, in Tirolo, del quale è centro maggiore; ha lo status di comune mercato.\\nLa sua località Mösern è nota per la presenza della Friedensglocke des Alpenraumes e per essere la località dove nel 1972 fu fondata la Comunità di Lavoro delle Regioni Alpine.\\nTelfs ha ospitato alcune gare della XXII Universiade invernale ed è anche sede di tornei internazionali di tennis e di golf."},{"page_url":"https://ast.wikipedia.org/wiki/Justo_Rufino_Barrios","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/OrdoIC.jpg","page_title":"Justo Rufino Barrios","context_page_description":"Justo Rufino Barrios Auyón foi un militar y políticu guatemalianu, presidente de la República ente 1873 y 1885.\\nMientres el so mandatu, fundó'l bancu hipotecariu, l'Hospital d'Oriente en Chiquimula, desenvolvió'l mercáu de La Reforma, robló'l contratu pa la construcción del Ferrocarril Sur, promulgó'l códigu penal, militar y fiscal, y mandó a construyir el campusantu xeneral de Guatemala."},{"page_url":"https://fr.wikipedia.org/wiki/Rennes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Rennes-018.jpg","page_title":"Rennes","context_page_description":"Rennes /ʁɛn/ est une commune de l'Ouest de la France, chef-lieu du département d’Ille-et-Vilaine et de la région Bretagne. La ville se situe en Haute-Bretagne — partie orientale de la Bretagne — à la confluence de l’Ille et de la Vilaine. Ses habitants sont appelés les Rennais et les Rennaises.\\nSituée sur l'arc atlantique européen, à 55 kilomètres des côtes de la Manche, Rennes compte 216 815 habitants intra-muros, ce qui fait d'elle la première ville de la région Bretagne, la deuxième ville du Grand Ouest et la onzième commune la plus peuplée de France en nombre d'habitants. L'unité urbaine est peuplée de 335 092 habitants en 2017 et son aire urbaine, qui comprend 727 357 habitants en 2016, est la dixième au niveau national. Rennes est le siège d'une métropole de 447 429 habitants, faisant ainsi partie des onze grandes métropoles françaises de droit commun.\\nL’histoire de Rennes couvre une période de plusieurs siècles. À l’époque gallo-romaine, la cité fondée par les Riedones porte le nom gaulois de Condate. La ville voit son pouvoir politique s’accroitre au Moyen Âge en devenant successivement forteresse des Marches de Bretagne puis capitale du duché de Bretagne."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%84%D9%8A%D9%86_%D8%B1%D9%88%D8%B3_%D9%83%D9%88%D9%84%D8%A8%D9%8A%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/AllenRossCulpepper.jpg","page_title":"ألين روس كولبيبر","context_page_description":"ألين روس كولبيبر ‏ هو عسكري أمريكي، ولد في 21 يوليو 1944 في ألاباما في الولايات المتحدة، وتوفي في 19 مايو 1969 في Long Khánh في فيتنام."},{"page_url":"https://en.wikipedia.org/wiki/Youth_detention_center","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/HarrisCoJuvenileDetentionCenter.JPG","page_title":"Youth detention center","context_page_description":"In criminal justice systems a youth detention center, also known as a juvenile detention center, juvenile detention, juvenile hall, or more colloquially as juvie/juvy, is a prison for people under the age of majority, often termed juvenile delinquents, to which they have been sentenced and committed for a period of time, or detained on a short-term basis while awaiting trial or placement in a long-term care program. Juveniles go through a separate court system, the juvenile court, which sentences or commits juveniles to a certain program or facility."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_bus_models","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Bendy_bus_at_the_university_of_bath_arp.jpg","page_title":"List of bus models","context_page_description":"The following is a list of buses. It is not complete. The different types of bus, used in this chart, are:\\nSingle-deck\\nDouble-decker\\nCoach\\nSchool bus\\nMinibus\\nThere are over 300 buses in this list.\\nThe year that is displayed refers to the first year of the model."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%AC-%D5%84%D5%B8%D6%82%D5%A9%D5%A1%D5%B6%D5%A1%D5%A2%D5%A2%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Shiraz_Botanical_Garden.jpg","page_title":"Ալ-Մութանաբբի","context_page_description":"Ալ-Մութանաբբի ամբողջական անուն՝ արաբ․՝ أحمد بن الحسين بن الحسن بن عبد الصمد الجعفي أبو الطيب الكندي‎‎, Ահմադ իբն ալ-Հուսեյն իբն ալ-Հասան իբն Աբդուլ Սամադ ալ-Ջաաֆի աբու աթ-Թայյիբ ալ-Քինդի, խոշորագույն արաբ բանաստեղծ։ Իր 326 բանաստեղծությունների մեծ մասը այն թագավորների գովերգումն էր, ում հյուրընկալել էր իր կյանքի ընթացքում։ Մեծատաղանդ բանաստեղծը իր հանճարով մշտապես գրավել է ժամանակի մուսուլման տիրակալների ուշադրությունը, ովքեր նրան հաճախ հրավիրել են պալատ՝ որպես պալատական ձոներգու։ Ալ-Մութանաբբին սկսել է բանաստեղծություններ գրել 9 տարեկանից։ Իր բանաստեղծություններում շատ են իմաստուն խոսքերը, ասացվածքները, հատկապես ընդգծվում են ոճը և շարադրանքը։ Գեղեցիկ գույներով են նկարագրված ճակատամարտերը, պատմական մի շարք դրվագներ, շատ են փիլիսոփայական մտքերը։ Նրա բանաստեղծական ժառանգությունը բաժանվում է 4 շրջանների, որոնցից յուրաքանչյուրը ներառում է նրա գործունեության առանձին փուլ։ Դրանք են՝ շամմիյաթ, սայֆիյաթ, քաֆուրիյաթ, ադուդիյաթ: Բանաստեղծություններից շատերը առ այսօր լայնորեն տարածված են արաբական աշխարհում։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_military_aircraft_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Atlantic_C-2A_refuelled_by_Douglas_C-1_USAF.JPG","page_title":"List of military aircraft of the United States","context_page_description":"This list of military aircraft of the United States includes prototype, pre-production, and operational types. Prototypes are normally prefixed with \\"X\\" and are often unnamed, while pre-production models are usually prefixed with \\"Y\\".\\nThe United States military employs a designation and naming system to provide identifications to all aircraft types. Until 1962, the United States Army, United States Air Force, and United States Navy all maintained separate systems. In September 1962, these were unified into a single system heavily reflecting the Air Force method. For more complete information on the workings of this system, refer to United States Department of Defense Aerospace Vehicle Designations.\\nThis list does not include aircraft used by the U.S. military services prior to the establishment of a numerical designation system. It also does not include aircraft designated under the pre-1962 United States Navy designation system."},{"page_url":"https://fr.wikipedia.org/wiki/Gonyosoma_prasinum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Rhadinophis_prasinus_-_Rhynchophis_prasinus_-_%281%29.png","page_title":"Gonyosoma prasinum","context_page_description":"Gonyosoma prasinum est une espèce de serpents de la famille des Colubridae."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%81%E0%B8%B8%E0%B8%A5%E0%B8%84%E0%B8%A3%E0%B8%B2%E0%B8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Gardenology.org-IMG_0047_rbgm10dec.jpg","page_title":"สกุลคราม","context_page_description":"สกุลครามหรือIndigofera เป็นสกุลขนาดใหญ่ที่มีสมาชิกมากกว่า 750 สปีชีส์ อยู่ในวงศ์ถั่ว มีการกระจายพันธุ์ทั่วเขตร้อนและกึ่งเขตร้อน หลายสปีชีส์โดยเฉพาะ Indigofera tinctoria และ Indigofera suffruticosa เป็นพืชให้สีย้อมที่สำคัญ"},{"page_url":"https://fi.wikipedia.org/wiki/Mykola_Mihnovskyi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Mihnovsky.jpg","page_title":"Mykola Mihnovskyi","context_page_description":"Mykola Mihnovskyi oli ukrainalainen nationalistinen poliitikko ja Ukrainan itsenäisyysliikkeen tärkeä ideologi.\\nMihnovskyi opiskeli lakimieheksi Kiovan yliopistossa ja osallistui opiskeluaikanaan vuonna 1891 kansallismielisen Tarasilaisen veljeskunnan perustamiseen. Hän julkaisi vuonna 1900 pamfletin Samostijna Ukrajina, jossa hän vaati Karpaateilta Kaukasukselle ulottuvan itsenäisen Ukrainan valtion perustamista. Samana vuonna perustettu Ukrainan ensimmäinen nykyaikainen puolue, Vallankumouksellinen ukrainalainen puolue, omaksui sen ohjelmakseen. Puolue kuitenkin luopui kiistanalaisena pidetystä itsenäisyysvaatimuksesta jo vuonna 1902, jolloin Mihnovskyi perusti uuden, entistä jyrkemmän Ukrainan kansallispuolueen. Hän levitti itsenäisyysaatetta seuraavina vuosina useissa julkaisemissaan lyhytikäisissä lehdissä. Yhteiskunnallisilta mielipiteiltään hän oli vasemmistolainen.\\nHelmikuun vallankumouksen jälkeen vuonna 1917 Mihnovskyi oli ensimmäisten joukossa organisoimassa Ukrainalle omaa armeijaa. Hän liittyi nyt porvarilliseen Ukrainan demokraattiseen talonpoikaispuolueeseen."},{"page_url":"https://uk.wikipedia.org/wiki/Austin-Healey_3000","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/1967_Austin_Healey_3000_Mk_III_DSCN1706.jpg","page_title":"Austin-Healey 3000","context_page_description":"Austin-Healey 3000 — британський спортивний автомобіль, що виготовлявся у 1959—1967 рр. Найвідоміший з «великих Хіллі». Кузов легковика виконувався компанією Jensen Motors, а решта збиральних робіт проводились заводами MG у Абінгтоні, паралельно з автомобілями MG.\\nНа протязі виробництва легковик перетворився з відкритого спортивного автомобіля у спортивний кабріолет.\\nУ 1963 р. 91,5 % обсягу виготовлених Austin Healey 3000 експортувались. Переважно до Північної Америки.\\nМодель 3000 з 3-літровим двигуном була дуже успішною, у свої кращі дні мала перемоги на багатьох європейських ралі, і нині бере участь у перегонах класичних автомобілів.\\nBritish Leyland припинили виробництво у 1967 р., замінивши Austin-Healey подібним сучаснішим автомобілем з тримальним кузовом — MGS."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%97%E0%B2%B8%E0%B2%97%E0%B2%B8%E0%B3%86_%E0%B2%B9%E0%B2%A3%E0%B3%8D%E0%B2%A3%E0%B2%BF%E0%B2%A8_%E0%B2%AE%E0%B2%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Singapur_cherry_Muntingia_calabura_leaves_%26_fruits_in_Secunderabad%2C_AP_W_IMG_6646.jpg","page_title":"ಗಸಗಸೆ ಹಣ್ಣಿನ ಮರ","context_page_description":"ಗಸಗಸೆ ಹಣ್ಣಿನ ಮರಟೀಲಿಯೇಸೀ ಕುಟುಂಬಕ್ಕೆ ಸೇರಿದ ಒಂದು ಮಧ್ಯಮಗಾತ್ರದ ಮರ. ಇದರ ಹಣ್ಣಿನಲ್ಲಿ ಗಸಗಸೆ ಬೀಜವನ್ನು ಹೋಲುವ ನೂರಾರು ಬೀಜಗಳು ಇರುವುದರಿಂದ ಇದಕ್ಕೆ ಈ ಹೆಸರು. ಇದನ್ನು ಸಾಮಾನ್ಯ ಬಳಕೆಯ ಇಂಗ್ಲಿಷಿನಲ್ಲಿ ಸಿಂಗಪುರ ಚೆರಿ ಅಥವಾ ಜಪಾನೀಸ್ ಚೆರಿ ಎನ್ನಲಾಗುತ್ತದೆ. ಮುಂಟಿಂಜಿಯ ಕ್ಯಾಲಬುರ ಶಾಸ್ತ್ರೀಯ ನಾಮ. ಇದು ಮೂಲತಃ ದಕ್ಷಿಣ ಅಮೆರಿಕದ್ದು. ಉಷ್ಣವಲಯ ದೇಶಗಳಲ್ಲೆಲ್ಲ ಇದನ್ನು ಹಣ್ಣಿಗಾಗಿ ಮತ್ತು ಉದ್ಯಾನವನಗಳಲ್ಲಿ ಅಲಂಕಾರಕ್ಕಾಗಿ ಬೆಳೆಸುತ್ತಾರೆ. ಎಲ್ಲ ದಿಕ್ಕುಗಳಲ್ಲಿಯೂ ಹರಡಿ ಬೆಳೆಯುವ ಕೊಂಬೆಗಳು, ಭರ್ಜಿಯಾಕಾರದ ಹಾಗೂ ಗರಗಸ ಅಂಚುಳ್ಳ ಎಲೆಗಳು ಮತ್ತು ಸಣ್ಣಗಾತ್ರದ ಬಿಳಿಯಬಣ್ಣದ ಹೂಗಳು ಇದರ ಮುಖ್ಯ ಲಕ್ಷಣಗಳಲ್ಲಿ ಕೆಲವು. ಹಣ್ಣು ಬೆರಿ ಮಾದರಿಯದು. ಇದು ಗುಂಡಾಗಿಯೂ ನುಣುಪಾಗಿಯೂ ಇದೆ. ಇದರ ಬಣ್ಣ ಕೆಂಪು. ರುಚಿ ಸಿಹಿ. ಹಣ್ಣಿನಲ್ಲಿ ರಸಭರಿತ ತಿರುಳಿದೆ. ಇದರಿಂದ ಮುರಬ್ಬ ತಯಾರಿಸಬಹುದು. ಗಸಗಸೆ ಹಣ್ಣಿನ ಮರವನ್ನು ಕಾಂಡತುಂಡುಗಳಿಂದ ವೃದ್ಧಿಸುತ್ತಾರೆ. ಮರಳುಭೂಮಿ ಇದರ ಬೆಳವಣಿಗೆಗೆ ಉತ್ತಮ. ಈ ಮರದ ಎಲೆಗಳಿಂದ ಒಂದು ಬಗೆಯ ಕಷಾಯ ಮಾಡುವುದುಂಟು. ಹೂಗಳನ್ನು ತಲೆನೋವು ಮತ್ತು ನೆಗಡಿಗೆ ಔಷಧಿಯಾಗಿ ಉಪಯೋಗಿಸುತ್ತಾರೆ. ಇದರ ತೊಗಟೆಯಿಂದ ನಾರು ತೆಗೆದು ಹಗ್ಗಗಳನ್ನು ತಯಾರಿಸುವುದಿದೆ."},{"page_url":"https://nl.wikipedia.org/wiki/Balkanika","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Sanja_Ili%C4%87_%26_Balkanika_%283%29_20180510_EuroVisionary.jpg","page_title":"Balkanika","context_page_description":"Balkanika is een Servische band."},{"page_url":"https://fr.wikipedia.org/wiki/Oksana_Baiul","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Stamp_of_Ukraine._Baiul.jpg","page_title":"Oksana Baiul","context_page_description":"Oksana Baïul est une patineuse artistique née le 16 novembre 1977 à Dnipropetrovsk, Ukraine en URSS."},{"page_url":"https://it.wikipedia.org/wiki/Eclissi_solare_del_23_ottobre_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/SE2014Oct23P.gif","page_title":"Eclissi solare del 23 ottobre 2014","context_page_description":"L'eclissi solare del 23 ottobre 2014 è stato un evento astronomico avvenuto dalle ore 19:37 UTC alle 23:51 UTC.\\nÈ stato visibile da quasi tutta l'America del Nord.\\nL'eclissi maggiore è stata visibile alle coordinate 71.2N 97.2W, nell'arcipelago artico canadese, vicino alle isole Dixon e Tasmania, alle ore 21:45 UTC."},{"page_url":"https://en.wikipedia.org/wiki/Islam_in_Hungary","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Hungary_Eger_minaret.jpg","page_title":"Islam in Hungary","context_page_description":"Islam in Hungary has a long history that dates back to at least the 10th century. The influence of Sunni Islam was especially pronounced in the 16th century during the Ottoman period in Hungary."},{"page_url":"https://ceb.wikipedia.org/wiki/Higashinaruse-mura","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/%E6%9D%B1%E6%88%90%E7%80%AC%E6%9D%91%E5%BD%B9%E5%A0%B4.jpg","page_title":"Higashinaruse-mura","context_page_description":"Subdistrito ang Higashinaruse-mura sa Hapon. Nahimutang ni sa distrito sa Ogachi-gun ug prepektura sa Akita-ken, sa amihanan-sidlakang bahin sa nasod, 400 km sa amihanan sa Tokyo ang ulohan sa nasod. Adunay 2,750 ka molupyo. Naglangkob kin og 204 ka kilometro kwadrado. Higashinaruse-mura mopakigbahin sa usa ka utlanan sa Yokote-shi, Yuzawa, Kurihara, Ichinoseki, Ōshū, ug Waga-gun.\\nAng yuta sa Higashinaruse-mura kay medyo kabukiran.\\nHigashinaruse-mura may sa mosunod nga mga subdibisyon:\\nNishiwaga-machi\\nAng klima klima sa kontinente. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Agosto, sa 18 °C, ug ang kinabugnawan Enero, sa -10 °C. Ang kasarangang pag-ulan 1,952 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 298 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 97 milimetro."},{"page_url":"https://et.wikipedia.org/wiki/Konnarohulaadsed","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/AlismaPlant1.jpg","page_title":"Konnarohulaadsed","context_page_description":"Konnarohulaadsed on õistaimede selts üheiduleheliste klassist.\\nAPG III süsteemi järgi kuulub seltsi 13 sugukonda:\\nAlismataceae – Konnarohulised\\nAponogetonaceae\\nAraceae – Võhalised\\nButomaceae – Luigelillelised\\nCymodoceaceae\\nHydrocharitaceae – Kilbukalised\\nJuncaginaceae – Õisluhalised\\nPosidoniaceae\\nPotamogetonaceae – Penikeelelised\\nRuppiaceae – Heinmudalised\\nScheuchzeriaceae – Rabakalised\\nTofieldiaceae\\nZannichelliaceae – Haneheinalised"},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_skip_bygget_ved_Meyer_verft","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Celebrity_Reflection-Ueberfuehrung.jpg","page_title":"Liste over skip bygget ved Meyer verft","context_page_description":"Liste over skip bygget ved Meyer verft inneholder et utvalg skip som er bygget ved Meyer verft i Papenburg, Tyskland.\\nOppgitte data er ved levering fra verftet til kunde."},{"page_url":"https://en.wikipedia.org/wiki/2014_Winter_Olympics","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Vladimir_Putin_23_February_2008-14.jpg","page_title":"2014 Winter Olympics","context_page_description":"The 2014 Winter Olympics, officially called the XXII Olympic Winter Games and commonly known as Sochi 2014, was an international winter multi-sport event that was held from 7 to 23 February 2014 in Sochi, Krasnodar Krai, Russia. Opening rounds in certain events were held on 6 February 2014, the day before the opening ceremony.\\nThese were the first Olympic Games under the International Olympic Committee presidency of Thomas Bach. Both the Olympics and Paralympics were organized by the Sochi Organizing Committee. Sochi was selected as the host city in July 2007, during the 119th IOC Session held in Guatemala City. It was the first Olympics to be held in a CIS state after the breakup of the Soviet Union in 1991. The Soviet Union was previously the host nation for the 1980 Summer Olympics in Moscow.\\nA record ninety-eight events in fifteen winter sport disciplines were held during the Games. A number of new competitions—a total of twelve accounting for gender—were held during the Games, including biathlon mixed relay, women's ski jumping, mixed-team figure skating, mixed-team luge, half-pipe skiing, ski and snowboard slopestyle, and snowboard parallel slalom."},{"page_url":"https://uk.wikipedia.org/wiki/Rockstar_Advanced_Game_Engine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Rockstar_Advanced_Game_Engine_Logo.svg","page_title":"Rockstar Advanced Game Engine","context_page_description":"Rockstar Advanced Game Engine — гральний рушій, розроблений RAGE Technology Group в Rockstar San Diego за сприяння інших студій Rockstar. Рушій було використано на декількох різних платформах, таких як Microsoft Windows, Nintendo Wii, PlayStation 3, PlayStation 4, Xbox 360 і Xbox One. RAGE є подальшим розвитком Angel Game Engine, спочатку розроблена Angel Studios для Midtown Madness і пізніших версій серії Midnight Club та інших ігор Rockstar San Diego для консолей шостого покоління.\\nRockstar об'єднала кілька компонентів стороннього проміжного програмного забезпечення в RAGE, серед яких власницька характерна анімація рушія Euphoria та фізичний рушії з відкритим вихідним кодом. До RAGE Rockstar переважно використовувала RenderWare-рушії Criterion Games для розробки різних ігор, включно з PlayStation 2, Xbox і Microsoft Windows розстрочку франшизи Grand Theft Auto. Починаючи з виходу Max Payne 3, рушій підтримує DirectX 11 і стереоскопічної 3D-рендеринг на платформі ПК."},{"page_url":"https://it.wikipedia.org/wiki/Procuratore_generale_degli_Stati_Uniti_d%27America","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/EbenezerRHoar.jpg","page_title":"Procuratore generale degli Stati Uniti d'America","context_page_description":"Il Procuratore generale degli Stati Uniti d'America è il capo del Dipartimento della Giustizia."},{"page_url":"https://en.wikipedia.org/wiki/Uttar_Kumar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Uttar-Kumar.jpg","page_title":"Uttar Kumar","context_page_description":"Uttar Kumar is an Indian film actor, writer, director who mainly works in Haryanvi films. Kumar has acted in more than forty films including Dhakar Chhora released in 2004 which broke box office records by earning around 85 million for film worth of around 450,000.\\nKumar is from the Ghaziabad district of Western Uttar Pradesh. He is an alumnus of the Asian Academy of Film & Television."},{"page_url":"https://en.wikipedia.org/wiki/48th_Guldbagge_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Benny_Andersson_Aula_Magna_2008-3.jpg","page_title":"48th Guldbagge Awards","context_page_description":"The 48th Guldbagge Awards ceremony, presented by the Swedish Film Institute, honored the best Swedish films of 2012 and took place January 21, 2013, at Cirkus in Stockholm. During the ceremony, the jury presented Guldbagge Awards in 19 categories. The ceremony was televised in the Sweden by SVT, with actress and comedian Babben Larsson hosting the show.\\nEat Sleep Die won four awards including Best Film and Best Director for Gabriela Pichler. Call Girl also won four awards, all in the technical categories. Other winners included Palme and Avalon with two awards each, and The Last Sentence, Searching for Sugar Man, Dance Music Now, Amour, Easy Money II: Hard to Kill and Isdraken with one."},{"page_url":"https://es.wikipedia.org/wiki/Festival_Internacional_de_Jazz_de_Montreal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Ray_Charles_FIJM_2003.jpg","page_title":"Festival Internacional de Jazz de Montreal","context_page_description":"El Festival internacional de jazz de Montréal es un festival de jazz que desde 1980 se celebra anualmente durante el mes de julio en la ciudad de Montréal, Québec Canadá.\\nEste festival ostenta el récord Guiness como el festival en su género más importante del mundo. Cada año el festival presenta a 3,000 artistas provenientes de 30 países diferentes los cuales ofrecen más de 650 conciertos y atrae a más de 2.5 millones de espectadores."},{"page_url":"https://pl.wikipedia.org/wiki/Tarragona_(prowincja)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/La_vall_del_Seniol_des_de_Segura.jpg","page_title":"Tarragona (prowincja)","context_page_description":"Tarragona – prowincja Hiszpanii współtworząca wspólnotę autonomiczną Katalonii. Powstała w roku 1833. Stolicą jest miasto o tej samej nazwie. Graniczy z prowincjami: Lleida, Barcelona, Castellón, Teruel i Saragossa oraz z Morzem Śródziemnym."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Stuttgart-West","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/20181024_20181024_Stuttgart%2C_Augustenstra%C3%9Fe_84abc.jpg","page_title":"Liste der Kulturdenkmale in Stuttgart-West","context_page_description":"In der Liste der Kulturdenkmale in Stuttgart-West sind alle unbeweglichen Bau- und Kunstdenkmale in Stuttgart-West aufgelistet, die in der Liste der Kulturdenkmale. Unbewegliche Bau- und Kunstdenkmale der Unteren Denkmalschutzbehörde für diesen Stadtbezirk Stuttgarts verzeichnet sind. Stand dieser Liste ist der 25. April 2008.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Stuttgart erhältlich."},{"page_url":"https://et.wikipedia.org/wiki/Raffaeli_teoste_loend","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Raffaello%2C_ritratto_di_maria_pia_da_montefeltro.jpg","page_title":"Raffaeli teoste loend","context_page_description":"Itaalia kõrgrenessansi maalikunstnikule ja arhitektile Raffaelile omistatavate teoste loend."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Royal_Consorts_der_englischen_Monarchen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Guildford_Dudley.jpg","page_title":"Liste der Royal Consorts der englischen Monarchen","context_page_description":"Die Liste der Royal Consorts der englischen Monarchen listet chronologisch alle uns bis heute bekannten Ehepartner der englischen Monarchen auf, wobei dazu sowohl die Monarchen der angelsächsischen Kleinkönigreiche während der Heptarchie, als auch die des seit circa 926 bestehenden Königreiches England zählen. Nicht in der Liste enthalten sind die aus eigenem Recht regierenden Königinnen von England, diejenigen Ehepartner der englischen Monarchen, die vor deren Thronbesteigung starben, sowie Isabel von Gloucester, deren Ehe mit Johann Ohneland kurz vor oder nach dessen Thronbesteigung annulliert wurde.\\nDie Ehegattin des englischen Königs wird in der Regel als Queen Consort bzw. oftmals auch nur als Queen bezeichnet. Frauen als regierende Königinnen sind seltener, weshalb es für die Position eines männlichen Royal Consort auch an einer festgelegten Bezeichnung fehlt. Der übliche Titel für die englischen Queens Consort war Queen consort of England und ab 1543 Queen consort of England and Ireland. Ab 1603 lautete der Titel Queen consort of England, Scotland and Ireland, da von diesem Zeitpunkt an England und Schottland in Personalunion regiert wurden."},{"page_url":"https://it.wikipedia.org/wiki/XIII_Korpus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Ljubo_Vuckovic_XIII_Korpus_Nis_novembre_1944.jpg","page_title":"XIII Korpus","context_page_description":"Il XIII Corpus, in cirillico Тринаести српски корпус in serbo-croato Trinaesti srpski korpus, è stata una formazione militare dell'Esercito Popolare di Liberazione della Jugoslavia che venne costituita il 7 settembre 1944 in Serbia meridionale per contribuire alla liberazione di quella regione della Jugoslavia, durante la Seconda guerra mondiale sul Fronte jugoslavo.\\nIl XIII Korpus, formato con i distaccamenti partigiani serbi, raggiunse alcuni importanti successi e partecipò alla liberazione di Niš; venne sciolto alla fine dell'anno 1944 dopo la completa liberazione della Serbia."},{"page_url":"https://nl.wikipedia.org/wiki/Evanna_Lynch","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Evanna_Lynch_at_HBP_signing_in_London_-_Dec_09_cropped.jpg","page_title":"Evanna Lynch","context_page_description":"Evanna Patricia Lynch is een Ierse actrice, bekend van haar rol als Loena Leeflang in de Harry Potter-films."},{"page_url":"https://en.wikipedia.org/wiki/Blind_deconvolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Original_img.png","page_title":"Blind deconvolution","context_page_description":"In electrical engineering and applied mathematics, blind deconvolution is deconvolution without explicit knowledge of the impulse response function used in the convolution. This is usually achieved by making appropriate assumptions of the input to estimate the impulse response by analyzing the output. Blind deconvolution is not solvable without making assumptions on input and impulse response. Most of the algorithms to solve this problem are based on assumption that both input and impulse response live in respective known subspaces. However, blind deconvolution remains a very challenging non-convex optimization problem even with this assumption."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Amerongen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Amerongen_-_Donkerstraat_27.jpg","page_title":"Lijst van rijksmonumenten in Amerongen","context_page_description":"De plaats Amerongen telt 144 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%BA%E3%82%AD%E3%83%BB%E3%82%A8%E3%82%B9%E3%82%AF%E3%83%BC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Osaka_Motor_Show_2015_%28104%29_-_Suzuki_ESCUDO_%28DBA-YE21S%29.JPG","page_title":"スズキ・エスクード","context_page_description":"エスクードは、スズキが製造・販売するSUVである。"},{"page_url":"https://pl.wikipedia.org/wiki/Saint-Philippe_du_Roule","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Metro_9_Saint-Philippe_du_Roule.JPG","page_title":"Saint-Philippe du Roule","context_page_description":"Saint-Philippe du Roule – stacja linii nr 9 metra w Paryżu. Stacja znajduje się w 8. dzielnicy Paryża. Została otwarta 27 maja 1923 r."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%B2%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%BE%D0%BB%D0%BB%D0%B5%D0%B9%D0%B1%D1%83%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/LAZ_52522_Trolleybus_in_Chernivtsi_2.jpg","page_title":"Черновицкий троллейбус","context_page_description":"Черновицкий троллейбус — система троллейбусного движения в Черновцах. В 2011 году троллейбусами города было перевезено 46 111 тыс. чел., что на 1,9 % больше чем в 2010 году, когда было перевезено 45 252 тыс. пассажиров."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B4%D5%A2%D6%80%D5%AB%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Marum_sept_2009.jpg","page_title":"Ամբրիմ","context_page_description":"Ամբրիմ, կղզի Խաղաղ օվկիանոսում, Նոր Հիբրիդներ կղզեխմբում։ Մտնում է Վանուատու պետության կազմի մեջ։ Վանուտաուի կղզիների մեջ տարածքով զբաղեցնում հինգերորդ տեղը։ Հայտնի է իր չափազանց բարձր հրաբխային ակտիվությամբ և լավային լճերի ձևավորմամբ։ Իր հարևան Մալակուլա կղզու և մի քանի ավելի փոքր կղզիների հետ կազմում է Մալամպա գավառը։"},{"page_url":"https://en.wikipedia.org/wiki/RMMV_TG_MIL_range_of_trucks","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/TG_MIL_TGS_%288x8%29_with_hooklift.jpg","page_title":"RMMV TG MIL range of trucks","context_page_description":"Rheinmetall MAN Military Vehicles TG MIL range of trucks is based on MAN TG range commercial chassis that are militarised to suit individual customer requirements. The TG MIL was introduced from 2010 when RMMV was established in January of that year. RMMV is essentially the merger of Rheinmetall's wheeled military vehicle activities with those of the military truck activities of the now MAN Truck & Bus AG. Prior to 2010 militarised TGM and TGA range trucks were products of the now MAN Truck & Bus AG."},{"page_url":"https://pl.wikipedia.org/wiki/Armada_Espa%C3%B1ola","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Mar_Caribe_%28A-101%29.jpg","page_title":"Armada Española","context_page_description":"Armada Española – morski rodzaj Hiszpańskich Sił Zbrojnych, jedna z najstarszych ciągle aktywnych formacji morskich na świecie. Jej początki sięgają końca XV i początku XVI wieku, gdy hiszpańskie królestwa Kastylii i Aragonii zjednoczyły się za panowania \\"Monarchów Katolickich\\". Hiszpańska marynarka odegrała istotną rolę w historii Hiszpanii, w czasach hiszpańskiego imperium kolonialnego. Wśród istotnych osiągnięć marynarki są odkrycia Ameryki, pierwsze opłynięcie kuli ziemskiej przez Juan Sebastián Elcano i odkrycie drogi morskiej między Azją i Ameryką przez Andrés de Urdaneta. Hiszpańska Armada była najsilniejsza w XVI wieku, kres jej panowania na rzecz Royal Navy trwał stopniowo od porażki Wielkiej Armady do połowy XVII wieku. Do XIX wieku pozostawała jednak trzecią siłą morską.\\nDzisiejsza Armada pozostaje w gronie pięciu największych marynarek w Europie, jest zdolna do operowania na otwartym oceanie przez ograniczony czas. Obecnie liczy ok. 20 000 żołnierzy i 54 zasadnicze jednostki, w tym 11 fregat, 3 okręty podwodne, 3 desantowce, 6 trałowców, 23 patrolowce i jednostki pomocnicze o łącznej wyporności łącznej ok. 220 tysięcy ton."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B5%D0%B9%D1%81%D1%8C%D0%BA%D0%B0_%D0%BC%D1%96%D1%84%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Portrait_of_Dangun.jpg","page_title":"Корейська міфологія","context_page_description":"Корейська міфологія — сукупність легенд і переказів, що від стародавніх часів усно передавались від покоління до покоління на Корейському півострові й були записані лише в історичні часи.\\nКорейська міфологія, в силу географічного розташування, зазнавала значного впливу з боку китайської та японської міфологій, а також з боку традицій та вірувань острівних тихоокеанських народів.\\nБільшість корейських міфів оповідають не про богів, а пояснюють, наприклад, походження світу, природні та соціальні явища тощо. Часто корейські міфи є вузько локалізованими та стосуються лише конкретних поселень чи родів.\\nСюжети й образи корейської міфології часто використовували в своїй творчості митці різних часів."},{"page_url":"https://de.wikipedia.org/wiki/St%C3%A4dteregion_Aachen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/SuperC_RWTH.JPG","page_title":"Städteregion Aachen","context_page_description":"Die Städteregion Aachen ist ein Kommunalverband besonderer Art im Südwesten Nordrhein-Westfalens und liegt am Dreiländereck mit den Niederlanden und Belgien. Verwaltungssitz ist Aachen.\\nDie Städteregion ist seit dem 21. Oktober 2009 Rechtsnachfolger des Kreises Aachen, der aufgelöst wurde und dessen neun Gemeinden mit der kreisfreien Stadt Aachen die neue Städteregion bilden. Mit der Bildung der Städteregion Aachen wird zum ersten Mal ein Regionsmodell in Nordrhein-Westfalen erprobt. In Niedersachsen existierte bereits zuvor die Region Hannover sowie im Saarland der Regionalverband Saarbrücken und in Baden-Württemberg die Region Stuttgart."},{"page_url":"https://de.wikipedia.org/wiki/P%C3%BCtzchens_Markt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Puetzchensmarkt06.jpg","page_title":"Pützchens Markt","context_page_description":"Pützchens Markt ist ein traditionsreicher Jahrmarkt, der seit Anfang des 18. Jahrhunderts hauptsächlich auf den Marktwiesen des heute zu Bonn gehörenden Pützchen-Bechlinghoven stattfindet, stets ab dem zweiten Wochenende im September.\\nDer Besucherrekord wurde mit rund 1,4 Millionen Personen im Jahr 2018 aufgestellt. Pützchens Markt ist zwar nicht das größte Volksfest im Rheinland, aber der „umsatzstärkste 5-Tage-Markt in Deutschland“."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82_%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B_(%D0%92%D0%BE%D0%BB%D0%BE%D0%B3%D0%B4%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Vologda_-_Prospekt_Pobedy%2C_9.jpg","page_title":"Проспект Победы (Вологда)","context_page_description":"Проспе́кт Побе́ды — проспект в Вологде. Начинается от памятника В. И. Ленину на площади Свободы и пролегает до железной дороги на Архангельск."},{"page_url":"https://sv.wikipedia.org/wiki/Leucopogon_setiger","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Epacriswentfalls1.jpg","page_title":"Leucopogon setiger","context_page_description":"Leucopogon setiger är en ljungväxtart som beskrevs av Robert Brown. Leucopogon setiger ingår i släktet Leucopogon och familjen ljungväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://et.wikipedia.org/wiki/Charles_II_Paljaspea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Carlo_calvo.jpg","page_title":"Charles II Paljaspea","context_page_description":"Charles II Paljaspea ehk Charles Paljaspea oli Lääne-Frangi riigi esimene kuningas alates 843 ning Frangi keiser alates 875 kuni surmani.\\nCharles oli Frangi keisri Ludwig Vaga noorim poeg ning sai endale oma kuningriigi hoolimata sellest, et isa Ludwig Vaga oli oma vanematele poegadele Lotharile ja Ludwigile lubanud, et nemad kahekesi pärivad riigi. See tekitas mõistagi pingeid.\\nWormsi riigipäeval aastal 839 jagati keisririik ümber järgmiselt: Charles II Paljaspeale anti keisririigi lääneosa, Lotharile kesk- ja idaosa, samas Ludwig Sakslasele jäi vaid Baieri."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%AF%D1%9E%D1%85%D1%96%D0%BC_%D0%A5%D1%80%D0%B0%D0%BF%D1%82%D0%BE%D0%B2%D1%96%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Ja%C5%ADchim_Chraptovi%C4%8D._%D0%AF%D1%9E%D1%85%D1%96%D0%BC_%D0%A5%D1%80%D0%B0%D0%BF%D1%82%D0%BE%D0%B2%D1%96%D1%87_%281800%29.jpg","page_title":"Яўхім Храптовіч","context_page_description":"Яўхім Ігнаці Юзэф Храптовіч — дзяржаўны, гаспадарчы, навуковы і культурны дзяяч Вялікага Княства Літоўскага. Сакратар сьвецкі, падканцлер і апошні канцлер вялікі літоўскі.\\nБыў старостам аршанскім, жосьлінскім, старадубскім. Кавалер ордэнаў Сьвятога Станіслава і Белага Арла.\\nПа сьмерці бацькі атрымаў маёнткі Шчорсы ў Наваградзкім павеце, Зэмбін у Менскім павеце, Пышну ў Полацкім ваяводзтве, Халопенічы ў Аршанскім павеце і іншыя, пазьней набыў Бешанковічы і Пачаевічы ў Полацкім ваяводзтве, Вішнеў і Славенск у Ашмянскім павеце, Грыцкавічы і Нежыцы ў Аршанскім павеце."},{"page_url":"https://it.wikipedia.org/wiki/Viktor_Kozlov","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Viktor_Kozlov.jpg","page_title":"Viktor Kozlov","context_page_description":"Viktor Nikolaevič Kozlov è un ex hockeista su ghiaccio russo."},{"page_url":"https://pl.wikipedia.org/wiki/Oscar_Francisco_Nascimento","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Nascimento_Palestra_It%C3%A1lia.jpg","page_title":"Oscar Francisco Nascimento","context_page_description":"Oscar Francisco Nascimento – brazylijski piłkarz grający na pozycji bramkarza."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%A4%A7%E5%86%9B%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Shenyang_Military_Region.svg","page_title":"大军区","context_page_description":"大军区是中国人民解放军曾经存在的一级组织军事组织。1985年百万大裁军后，设置北京军区、沈阳军区、济南军区、南京军区、广州军区、成都军区和兰州军区等七大军区。2016年1月16日，七大军区编制正式撤销；2月1日，改组成立五大战区。"},{"page_url":"https://en.wikipedia.org/wiki/Quinn_Methodist_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/CommunityCenterQuinnSD.jpg","page_title":"Quinn Methodist Church","context_page_description":"Quinn Methodist Church is a historic church at the junction of Elm and Main Streets in Quinn, South Dakota. The Methodist church was built from 1908 to 1909 and the inside remodeled in 1961. As one of two churches in the small community, it also housed Lutheran services and a school.\\nThe building was added to the National Register of Historic Places in 2007 and now serves as the Quinn Community Center."},{"page_url":"https://ceb.wikipedia.org/wiki/Villanueva_de_la_Jara_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ayuntamientojara.jpg","page_title":"Villanueva de la Jara (munisipyo)","context_page_description":"Munisipyo ang Villanueva de la Jara sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Cuenca ug rehiyon sa Castilla-La Mancha, sa sentro nga bahin sa nasod, 180 km sa habagatan-sidlakan sa Madrid ang ulohan sa nasod. Adunay 2,390 ka molupyo.\\nAng klima bugnaw nga ugahon. Ang kasarangang giiniton 16 °C. Ang kinainitan nga bulan Hulyo, sa 30 °C, ug ang kinabugnawan Disyembre, sa 4 °C. Ang kasarangang pag-ulan 477 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 68 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 11 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Subaru_B9_Scrambler","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/SUBARU_B9_SCRAMBLER_at_TMS2003_001.jpg","page_title":"Subaru B9 Scrambler","context_page_description":"The Subaru B9 Scrambler is an open two-seat concept sports car from Subaru featuring classic styling. It is 4.2 metres long and powered by a 140 hp gasoline-electric hybrid engine. It was designed by Andreas Zapatinas."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Magny-en-Bessin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Magny-en-Bessin_ch%C3%A2teau.JPG","page_title":"Château de Magny-en-Bessin","context_page_description":"Le château de Magny-en-Bessin est un château français situé sur la commune de Magny-en-Bessin, dans le département du Calvados. Il fait l'objet d’une inscription au titre des monuments historiques par arrêté du 31 mai 1946. Abandonné depuis le XXᵉ siècle, il est partiellement détruit par deux incendies successifs en mars 2016. Le château a été sélectionné par Stéphane Bern, à la tête de la Mission d'identification et de sauvegarde du patrimoine en péril, en vue de bénéficier d'une aide financière d'urgence issue du loto du patrimoine dont le tirage aura lieu les 15 et 16 septembre 2018, à l'occasion des journées européennes du patrimoine."},{"page_url":"https://vi.wikipedia.org/wiki/N%C3%BAi_Ng%E1%BB%8Dc_M%E1%BB%B9_Nh%C3%A2n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ng%E1%BB%8Dc_M%E1%BB%B9_Nh%C3%A2n_Mountain_1.jpg","page_title":"Núi Ngọc Mỹ Nhân","context_page_description":"Núi Ngọc Mỹ Nhân, còn có tên là núi Cánh Diều, là di tích lịch sử văn hóa nằm ở phía đông thành phố Ninh Bình, thuộc địa phận phường Thanh Bình. Cũng giống như núi Non Nước, núi Ngọc Mỹ Nhân nằm gần bên sông Đáy. Ở trung tâm thành phố, trông núi có 3 đỉnh, đỉnh giữa cao, hai đỉnh tả hữu chĩa ra như cánh chim. Bên núi có chùa Cánh Diều, phủ Mẫu và đền Thánh Cả thờ thần Thiên Tôn, xung quanh núi có nhiều hang động u minh, dưới núi có sông ngầm xuyên thủy. Hiện nay, tỉnh Ninh Bình đang thực hiện dự án xây dựng khu du lịch sinh thái lâm viên núi Ngọc Mỹ Nhân với diện tích 25 ha nhằm mục tiêu biến nơi đây thành điểm đến hấp dẫn của thành phố Ninh Bình."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%B0%8F%E5%B2%9B%E5%8C%BB%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Inselspital_Berne_September_2008_01.jpg","page_title":"小岛医院","context_page_description":"小島醫院全稱伯爾尼大學醫院，是瑞士首都伯爾尼的一座公立醫院，是該國最大的醫院之一，也是瑞士五座大學醫院之一。醫院隸屬於同名基金會，與伯爾尼州政府關係緊密，並在臨床和研究活動中與伯爾尼大學保持密切合作。"},{"page_url":"https://es.wikipedia.org/wiki/Facultad_de_Ciencias_Sociales_(Universidad_de_Buenos_Aires)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/241361_Ojk6_TLbfSm7U7HzH776_DdopUl2OQsj18kGdBFPPWM.jpg","page_title":"Facultad de Ciencias Sociales (Universidad de Buenos Aires)","context_page_description":"La Facultad de Ciencias Sociales forma parte de la Universidad de Buenos Aires como su alta casa de estudios e investigaciones en las ciencias sociales. Consta de dos sedes: la Sede Marcelo T. de Alvear, ubicada en la calle Marcelo T. de Alvear 2230, en el barrio porteño de Recoleta; y la Sede Constitución en la calle Santiago del Estero 1029, en el barrio porteño de Constitución.\\nFundada hace 31 años, se trata de una de las facultades con mayor matrícula estudiantil de la UBA. Aquí se dictan las carreras de grado de Trabajo Social, Sociología, Ciencia Política, Relaciones de Trabajo y Ciencias de la Comunicación. También se dictan carreras de posgrado como el Doctorado en Ciencias Sociales y varias maestrías y especializaciones.\\nEn lo que se refiere a la investigación, por la cantidad de proyectos acreditados y becas es la cuarta en capacidad dentro de la Universidad. Dispone de dos reconocidos institutos de investigación: el Instituto de Investigaciones Gino Germani; y el Instituto de Estudios de América Latina y el Caribe y una gran variedad de centros y observatorios.​​"},{"page_url":"https://es.wikipedia.org/wiki/Universidad_de_Antioquia","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/FACULTAD_DE_MEDICINA%2C_UNIVERSIDAD_DE_ANTIOQUIA%2C_BLOQUE_DE_BIOQU%C3%8DMICA.jpg","page_title":"Universidad de Antioquia","context_page_description":"La Universidad de Antioquia​ es la institución de educación superior más importante del departamento de Antioquia en Colombia. Fundada en 1803, la Universidad de Antioquia es reconocida como una de las mejores universidades del país​.\\nSu campus principal, Ciudad Universitaria, está ubicado en la ciudad de Medellín, y cuenta además con las sedes de Ciudadela Universitaria de Robledo, Edificio San Ignacio y Área de la Salud. También tiene sedes alternas en los municipios de Puerto Berrío, Caucasia, Santa Fe de Antioquia, Segovia, Amalfi, Carmen de Viboral, Sonsón, Andes, Carepa, Apartadó, Turbo y Yarumal.​\\nEs una entidad descentralizada del departamento de Antioquia, organizada como un ente universitario autónomo con régimen especial, vinculada al Ministerio de Educación Nacional en lo que tiene que ver con las políticas y la planeación del sector educativo y en relación con el Sistema Nacional de Ciencia y Tecnología.​\\nEstá integrada por 26 unidades académicas divididas en 14 facultades, cuatro escuelas, cuatro institutos y tres corporaciones que ofrecen cerca de 130 programas de pregrado."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B6%D0%BD%D0%BE%D0%BD%D0%BE%D1%81%D0%BD%D0%B8_%D0%BF%D1%80%D0%B8%D0%BC%D0%B0%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Propithecus_verreauxi.JPG","page_title":"Влажноносни примати","context_page_description":"Гранката на Strepsirrhini е една од двата подреда на примати. Една од најзабележителните особини на 118-те вида од овој подред се нивните влажни носеви по кои оваа група го добила своето име. Грчкото име означува поседување на извиткан или совиен нос. Единствените примати на Мадагаскар припаѓаат во оваа група, иако други можат да се најдат во југоисточна Азија и Африка.\\nСе смета дека влажноносните имаат попримитивни особини и адаптации отколку нивните хаплорински роднини. Нивниот влажен нос е поврзан со горната усна, која е поврзана со непцето, што го ограничува фацијалниот израз. Кај нив, односот мозок наспроти тело е помал, што укажува на помала интелигнција. Олфакторните лобуси на мозокот се поголеми, што дава до знаење дека тие повеќе зависат од сетилото за мирис. Нивните нушки се најчесто издолжени, давајќи им кучевиден изглед, иако оваа карактеристика е застапена и кај некои мајмуни. Влажноносните поседуваат и посторбитална плочка, што уште еднаш ја потврдува попримитивната природа на овие примати. Тие исто така ја задржале способноста за ензимско производство на витаминот С, која е изгубена кај сувоносните, вклучувајќи ги и Tarsiidae."},{"page_url":"https://af.wikipedia.org/wiki/Irannese_tale","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Iranian_tongues.svg","page_title":"Irannese tale","context_page_description":"Die Irannese tale is 'n ondergroep van die Indo-Irannese tak van die Indo-Europese taalfamilie en word veral deur Irannese volke gebesig. Daar is altesaam sowat vyftig Nieu-Irannese tale met sowat 150 miljoen moedertaalsprekers, terwyl tussen 30 en 50 miljoen sprekers 'n Irannese taal as tweede of derde taal praat. Die grootste tale is: Persies, Pasjtoe, Koerdies, Dari, Tadjiks, Beloetsji en Zazaki. Van die ander tale sluit in Avesties en Osseties.\\nHulle is inheems aan die Irannese hoogland tussen die Eufraat-Tigrisrivier in die weste, die Kaukasus in die noordweste, die Kaspiese See en Sentraal-Asië in die noorde, die Indus in die ooste en die Persiese Golf in die suide met lande soos Iran, Afghanistan, Pakistan en Tadjikistan. Die verspreiding van beide die Irannese tale en Irannese volke het met die uitbreiding van die Persiese Ryk gepaard gegaan."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A1%D7%98%D7%9C_(%D7%9E%D7%92%D7%93%D7%9C_%D7%90%D7%A0%D7%95%D7%A9%D7%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Primer-7-de-8-descarregat-dels-Marrecs-de-Salt-1-d-octubre-de-2016.jpg","page_title":"קסטל (מגדל אנושי)","context_page_description":"קסטל הוא מגדל אנושי, הנבנה באופן מסורתי בקטלוניה ובאזורים סמוכים, אם בחגים ובפסטיבלים כלליים, ואם בתחרויות ייעודיות המתארגנות לשם כך.\\nמי שעוסק במסורת זו מכונה קסטלייר, והמועדונים שהוקמו לשם כך נקראים קולייס קסטליירס. מקורה של המסורת בסוף המאה ה-18 באזור העיר טרגונה שעדיין נחשבת למובילה בתחום, ומשם היא התפשטה ליתר חלקיה של קטלוניה ועד לאיים הבלאריים.\\nבשנת 2010 הכיר ארגון אונסק\\"ו במגדל האנושי כמורשת תרבותית בלתי מוחשית."},{"page_url":"https://it.wikipedia.org/wiki/Oktjabr%27sk","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Flag_of_Oktyabrsk_%28Samara_oblast%29.png","page_title":"Oktjabr'sk","context_page_description":"Oktjabr'sk è una città della Russia europea sudorientale di circa 28.000 abitanti.\\nSorge nella parte sudoccidentale della oblast', sulla sponda destra del Volga in corrispondenza del bacino artificiale di Samara, circa 150 chilometri a ovest del capoluogo regionale Samara.\\nLa città attuale venne creata nel 1956, con l'accorpamento sotto un'unica entità amministrativa dei preesistenti insediamenti di Pervomajskij, Pravaja Volga e Batraki."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D1%81%D0%BE%D0%BD,_%D0%91%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Ben_Nicholson_by_Mabel_Pryde.jpg","page_title":"Николсон, Бен","context_page_description":"Бен Николсон — английский художник и скульптор-абстракционист."},{"page_url":"https://sv.wikipedia.org/wiki/Kinnefj%C3%A4rdings_h%C3%A4rad","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Koll%C3%A4ngens_tingshus_02.jpg","page_title":"Kinnefjärdings härad","context_page_description":"Kinnefjärding var ett härad i norra Västergötland vars område numera utgör en del av Lidköpings kommun och Götene kommun. Häradets areal var 215,84 kvadratkilometer varav 215,19 land. Kinnefjärdings tingsställe låg från 1684 i Kollängen i Husaby socken fram till 1904 då häradet uppgick i ett gemensamt tingslag med tingställe i Lidköping."},{"page_url":"https://de.wikipedia.org/wiki/Srinagar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Srinagar.jpg","page_title":"Srinagar","context_page_description":"Srinagar ist eine Stadt im indischen Unionsterritorium Jammu und Kashmir. Sie ist Verwaltungssitz des Distrikts Srinagar und in den Sommermonaten auch die Hauptstadt des Unionsterritoriums.\\nDie Stadt hat etwa 1,2 Millionen Einwohner. Srinagar befindet sich auf einer Höhe von 1730 m über dem Meeresspiegel zentral im Hochbecken von Kaschmir, am Fluss Jhelam, der das gesamte Becken entwässert."},{"page_url":"https://en.wikipedia.org/wiki/Ranks_and_insignia_of_the_Confederate_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Csn_cover_flag.png","page_title":"Ranks and insignia of the Confederate States","context_page_description":"The ranks and insignia of the Confederate States were a rank insignia system devised for the Military of the Confederate States of America during the American Civil War."},{"page_url":"https://he.wikipedia.org/wiki/S-200","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/S-200_operators.png","page_title":"S-200","context_page_description":"S-200 אנגרה/וגה/דוּבְּנה היא מערכת טילי קרקע־אוויר נייחת לטווחים בינוניים עד ארוכים מתוצרת ברית המועצות. המערכת מיועדת ליירט מטוסי בקרה אווירית, מטוסי צילום ומפציצים בטווחים ארוכים. נתוניו הטכניים של הטיל אינם מאפשרים יירוט של מטרות מתמרנות ולכן אינו מיועד ליירוט מטוסי קרב. סוללת טילי S-200 כוללת 6 משגרי מסילה שעל כל אחד מהם טיל בודד, מכ\\"ם גילוי אווירי מסוג P-14 בעל טווח גילוי של כ־600 ק\\"מ.\\nנוכח גודלו הפיזי של הטיל וריבוי מערכות תומכות הכרחיות בסוללת הטילים, המערכת סובלת מחוסר ניידות. על פי הדוקטרינה הצבאית הסובייטית יש לפצות על חוסר ניידותה של המערכת בהקמת מערכות דמה סמוכות אשר יקשו על תוקף לזהות את הסוללה האמיתית. לכן על פי רוב ניתן למצוא סמוך לסוללת הטילים מרכיבי סוללה דמה מסוגים שונים."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%84%D0%BD%D1%87%D0%B5%D0%BF%D1%96%D0%BD%D0%B3_(%D0%BA%D0%BE%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Jonkoping_flygplats.JPG","page_title":"Єнчепінг (комуна)","context_page_description":"Комуна Єнчепінг — адміністративно-територіальна одиниця місцевого самоврядування, що розташована в лені Єнчепінг у південній Швеції. З півночі омивається водами озера Веттерн.\\nЄнчепінг 51-а за величиною території комуна Швеції. Адміністративний центр комуни — місто Єнчепінг."},{"page_url":"https://cy.wikipedia.org/wiki/Tartu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Tartu%2C_botanick%C3%A1_zahrada.jpeg","page_title":"Tartu","context_page_description":"Dinas ail fwyaf Estonia yw Tartu, ar ôl Tallinn. Prifysgol Tartu ydy prifysgol hynaf Estonia. Mae'n cael ei gwasanaethu gan Faes Awyr Tartu."},{"page_url":"https://es.wikipedia.org/wiki/Geograf%C3%ADa_de_la_Rep%C3%BAblica_Popular_China","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Yunnan-Landschaft.JPG","page_title":"Geografía de la República Popular China","context_page_description":"La República Popular China se extiende desde los 80 °O hasta los 120 °O, queriendo decir que China abarca una doceava parte de la longitud del mundo, siendo el tercer país más extenso en superficie terrestre del mundo, y donde más habitantes hay una sexta parte.\\nLas ciudades más grandes de China se encuentran muy bien estructuradas pero, sin embargo, el resto de la red urbana está muy mal estructurada. Apenas existen ciudades medias, más allá de las capitales de las treinta provincias con que cuenta: unas provincias muy grandes a las cuales no sirven en su totalidad la mayoría de las capitales. Pero, en los últimos tiempos, ha comenzado la emigración del campo a la ciudad y empiezan a sentirse los primeros signos de superpoblación. Para evitar esto, las autoridades chinas han comenzado a primar a las capitales y a las ciudades nuevas como centro urbano, con similares oportunidades que las grandes urbes. Estas ciudades medias tratan de canalizar y ordenar el mundo rural inmediato: proporcionando productos a los grandes centros urbanos. Cada ciudad lleva a cabo un fuerte programa de desarrollo; lo que le obliga a drenar fuerza de trabajo y capitales del campo."},{"page_url":"https://en.wikipedia.org/wiki/Melrose_Abbey","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Melrose_Abbey_Interior_of_the_Eastern_End%2CRW_Billings_approx_1850.jpg","page_title":"Melrose Abbey","context_page_description":"St Mary's Abbey, Melrose is a partly ruined monastery of the Cistercian order in Melrose, Roxburghshire, in the Scottish Borders. It was founded in 1136 by Cistercian monks at the request of King David I of Scotland and was the chief house of that order in the country until the Reformation. It was headed by the abbot or commendator of Melrose. Today the abbey is maintained by Historic Environment Scotland as a scheduled monument.\\nThe east end of the abbey was completed in 1146. Other buildings in the complex were added over the next 50 years. The abbey was built in the Gothic manner and in the form of a St. John's Cross. A considerable portion of the abbey is now in ruins. A structure dating from 1590 is maintained as a museum open to the public.\\nAlexander II and other Scottish kings and nobles are buried at the abbey. A lead container believed to hold the embalmed heart of Robert the Bruce was found in 1921 below the Chapter House site; it was found again in a 1998 excavation. This was documented in records of his death. The rest of his body is buried in Dunfermline Abbey."},{"page_url":"https://it.wikipedia.org/wiki/Franz_Reichelt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Early_flight_02561u_%283%29.jpg","page_title":"Franz Reichelt","context_page_description":"Franz Reichelt è stato un inventore austriaco, conosciuto anche come il «sarto volante».\\nDi mestiere sarto, Reichelt è conosciuto per la morte accidentale, filmata dai giornalisti, mentre tentava di volare lanciandosi dal lato interno del primo piano della Torre Eiffel con un paracadute di sua invenzione. Erano le 8:30 del mattino e Reichelt, salito su di uno sgabello posto vicino alla spalletta, dopo qualche esitazione si lanciò nel vuoto. Fu il primo a tentare questa ardua impresa, ma il paracadute non si aprì e l'uomo si sfracellò al suolo. Alcune fonti riportano che non sarebbe stato l'urto a essere fatale all'uomo; secondo un'autopsia, infatti, Reichelt avrebbe impattato il suolo già cadavere, morto durante la caduta per un attacco cardiaco."},{"page_url":"https://tr.wikipedia.org/wiki/Kuzey_Kaliforniya","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/San_Leandro_Marina_07830.JPG","page_title":"Kuzey Kaliforniya","context_page_description":"Kuzey Kaliforniya, Amerika Birleşik Devletleri'nin Kaliforniya eyaletindenin kuzeyini kapsayan bir bölgedir. Eyaletin kuzeyinde 48 ilçe güneyinde ise Güney Kaliforniya'nın 10 ilçesi bulunmaktadır.\\nDoğusunda ise Colorado Çölü ve Colorado Nehri olup sınırında ise Arizona ve Mojave Çölü bulunup diğer sınırında ise Nevada eyaletleri bulunur. Güneyinde ise de ABD-Meksika sınır hattı bulunmaktadır. En büyük metropol alanı ise San Francisco Körfez Bölgesi ve Sacramento metropolitan alanı'dır."},{"page_url":"https://de.wikipedia.org/wiki/NSCAD_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/NSCAD_Halifax_street.jpg","page_title":"NSCAD University","context_page_description":"Das Nova Scotia College of Art & Design ist eine kanadische Kunsthochschule in Halifax. Sie bietet seit ihrer Gründung Unterricht in freier und angewandter Kunst und industriellem Design an. Lehrer werden für das Fach Kunsterziehung für öffentliche und private Schulen ausgebildet. Präsidentin ist Dianne Taylor-Gearing."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%84%D9%88%DB%8C%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Melvins_live_20061013.jpg","page_title":"ملوینز","context_page_description":"ملوینز موسیقیچی - چئشیتلی موسیقی ژانرلاریندا اثرلر یارادیب."},{"page_url":"https://tl.wikipedia.org/wiki/San_Jacinto,_Masbate","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Ph_locator_masbate_san_jacinto.png","page_title":"San Jacinto, Masbate","context_page_description":"Ang Bayan ng San Jacinto ay isang ika-4 na klaseng bayan sa lalawigan ng Masbate, Pilipinas. Ayon sa 2015 senso, ito ay may populasyon na 30,372 sa may 7,060 na kabahayan."},{"page_url":"https://de.wikipedia.org/wiki/Cand%C3%A9-sur-Beuvron","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Cand%C3%A9-sur-Beuvron_%28Loir-et-Cher%29_Vieux_pont_sur_le_Beuvron.JPG","page_title":"Candé-sur-Beuvron","context_page_description":"Candé-sur-Beuvron ist eine französische Gemeinde mit 1.549 Einwohnern im Département Loir-et-Cher in der Region Centre-Val de Loire; sie gehört zum Arrondissement Blois und ist Teil des Kantons Blois-3. Die Einwohner werden Candéens genannt."},{"page_url":"https://es.wikipedia.org/wiki/Epibulus_brevis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Latent_slingjaw_wrasse_%28Epibulus_brevis%29_%2842972598334%29.jpg","page_title":"Epibulus brevis","context_page_description":"Epibulus brevis es una especie de peces de la familia Labridae en el orden de los Perciformes."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Island","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Moku%27ume%27ume.png","page_title":"Ford Island","context_page_description":"Ford Island is an islet in the center of Pearl Harbor, Oahu, in the U.S. state of Hawaii. It has been known as Rabbit Island, Marín's Island, and Little Goats Island, and its native Hawaiian name is Mokuʻumeʻume. The island had an area of 334 acres when it was surveyed in 1825, which was increased during the 1930s to 441 acres with fill dredged out of Pearl Harbor by the United States Navy to accommodate battleships.\\nIt was the site of an ancient Hawaiian fertility ritual, which was stopped by Christian missionaries during the 1830s. The island was given by Kamehameha I to Spanish deserter Francisco de Paula Marín, and later returned to the monarchy. After the island was bought at auction by James Isaac Dowsett and sold to Caroline Jackson, it became the property of Dr. Seth Porter Ford by marriage and was renamed Ford Island. After Ford's death, his son sold the island to the John Papa ʻĪʻī estate and it was converted into a sugarcane plantation.\\nIn 1916, part of Ford Island was sold to the U.S. Army for use by an aviation division in Hawaii, and by 1939 it was taken over by the U.S. Navy as a station for battleship and submarine maintenance."},{"page_url":"https://it.wikipedia.org/wiki/Operazione_Power_Pack","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/DR1965-2_%288161964547%29.jpg","page_title":"Operazione Power Pack","context_page_description":"Operazione Power Pack fu il nome in codice di un'operazione militare condotta dagli Stati Uniti d'America nell'aprile 1965 nel territorio della Repubblica Dominicana.\\nPaese soggetto a una forte instabilità politica dopo l'assassinio del dittatore Rafael Leónidas Trujillo nel 1961, la Repubblica Dominicana cadde preda di una violenta guerra civile a partire dal 24 aprile 1965. Le fazioni che si contendevano il potere erano rappresentate da un lato dai cosiddetti \\"costituzionalisti\\" e dall'altro dai cosiddetti \\"lealisti\\"; la guerra civile si concentrò principalmente nelle strade della capitale Santo Domingo, teatro di sanguinosi scontri e massacri.\\nIl collasso dell'ordine interno e la presenza di esponenti dei movimenti comunisti dominicani nei ranghi dei costituzionalisti fecero paventare all'amministrazione statunitense del presidente Lyndon B."},{"page_url":"https://sk.wikipedia.org/wiki/Kladka","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Polispasto2.jpg","page_title":"Kladka","context_page_description":"Kladka je jednoduchý mechanizmus alebo stroj zložený z kolesa, ktoré má po obvode drážku, v ktorej sa pohybuje lano, príp. kábel. Rozlišujeme pevné a voľné kladky."},{"page_url":"https://la.wikipedia.org/wiki/Columbia_(Missuria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Mizzou_Jesse.jpg","page_title":"Columbia (Missuria)","context_page_description":"Columbia est urbs Civitatum Foederatarum, in civitate Missuria sita, et sedes Boone Comitatus. Urbs anno 1821 condita est. Aestimatione anno 2018 facta, 123 180 incolas habuit. Hic Universitas Missuriensis sita est."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%95%D7%A8%D7%90%D7%A7%D7%95_%D7%90%D7%93%D7%95%D7%9D_%D7%A6%D7%99%D7%A6%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Red-crested_Turaco_JZ190613_01.jpg","page_title":"טוראקו אדום ציצית","context_page_description":"טוראקו אדום ציצית או טוראקו אדום רכס הוא מין של עוף טרופי במשפחת הטוראקיים. לטוראקו מספר מאפיינים מיוחדים כגון צבע ירוק אמיתי והזזת האצבע הרביעית קדימה ואחורה. הטוראקו חי באזור אנגולה וקונגו ואף נקרא באנגלית גם \\"טוראקו אנגולי\\". בית הגידול המועדף על הטוראקו הוא היער, שם יוכל להשיג פירות בשפע."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Willson_Peale","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/C_W_Peale_-_The_Artist_in_His_Museum.jpg","page_title":"Charles Willson Peale","context_page_description":"Charles Willson Peale was an American painter, soldier, scientist, inventor, politician and naturalist. He is best remembered for his portrait paintings of leading figures of the American Revolution, and for establishing one of the first museums in the United States."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%88%E3%82%AE%E3%83%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Terebra_pretiosa_from_Conchologia_Iconica_v.12_%28Reeve%2C_1860%29.jpg","page_title":"フトギリ","context_page_description":"フトギリ、学名 Cinguloterebra pretiosa は、タケノコガイ科に分類される海産の巻貝の一種。タケノコガイ科としては大型で、殻長150mm以上になる。殻は細長い錐形で、黄色がかった地に濃褐色の方形斑をめぐらす。本州中部以南からフィリピンにかけての西太平洋に生息する。\\n属名 Cinguloterebra はラテン語の cingulumとタケノコガイ属の学名 Terebra とを合わせたもの。種小名の pretiosa はラテン語の pretiōsaで、「価値ある、貴重な、高価な」などの意味の形容詞。この種小名は英国のスタインフォース牧師の発案によるもので、その当時はホロタイプとなった牧師所蔵の標本が唯一のものだと信じられており、彼のコレクションの目玉の一つであったことに由来する。"},{"page_url":"https://en.wikipedia.org/wiki/Cotherstone_(horse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Cotherstone_1.jpg","page_title":"Cotherstone (horse)","context_page_description":"Cotherstone was a British Thoroughbred racehorse and sire. In a career that lasted from September 1841 to July 1843 he ran eleven times and won eight races. After being beaten on his debut, Cotherstone won his next six races including the 1843 2000 Guineas and Epsom Derby. A narrow defeat in the St. Leger Stakes prevented him from being recognised as the first winner of the English Triple Crown. He was regarded by contemporary experts as one of the best British racehorses of his era. After sustaining a serious injury in his only race in 1844 he was retired to stud where he had moderate success."},{"page_url":"https://nl.wikipedia.org/wiki/Nyceryx_stuarti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Nyceryx_stuarti_MHNT_CUT_2010_0_198_Guyane_fran%C3%A7aise_route_de_l%27Est_N2_Pk_77_male_dorsal.jpg","page_title":"Nyceryx stuarti","context_page_description":"Nyceryx stuarti is een vlinder uit de familie van de pijlstaarten. De wetenschappelijke naam van de soort werd in 1894 gepubliceerd door Lionel Walter Rothschild."},{"page_url":"https://cs.wikipedia.org/wiki/Ludomi%C5%82_German","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Ludomi%C5%82_German_%28-1907%29.jpg","page_title":"Ludomił German","context_page_description":"Ludomił German byl rakouský a polský politik z Haliče, na počátku 20. století poslanec Říšské rady."},{"page_url":"https://sk.wikipedia.org/wiki/Jouy-en-Josas","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Jouy-en-Josas_Mairie.jpg","page_title":"Jouy-en-Josas","context_page_description":"Jouy-en-Josas je francúzska obec, ktorá sa nachádza v departemente Yvelines, v regióne Île-de-France."},{"page_url":"https://es.wikipedia.org/wiki/Vicente_Vald%C3%A9s_(estaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Cenefa_Metro_Vicente_Valdes.png","page_title":"Vicente Valdés (estación)","context_page_description":"Vicente Valdés es una estación de combinación ferroviaria y terminal por una línea que forma parte de la red del Metro de Santiago de Chile. Se encuentra por subterráneo entre las estaciones Vicuña Mackenna y Rojas Magallanes en la Línea 4, y es antecededida por la estación Bellavista de La Florida en la Línea 5."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B4%D0%BE%D0%BC%D0%B8%D1%80_%D0%A0%D1%83%D0%B6%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Zache%C5%82mie_dom_Ludomira_R%C3%B3%C5%BCyckiego.jpg","page_title":"Людомир Ружицький","context_page_description":"Людомир Олександр Ружицький — польський композитор, представник Молодої Польщі у музиці."},{"page_url":"https://fr.wikipedia.org/wiki/Jascha_Heifetz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Leopold_Auer.jpg","page_title":"Jascha Heifetz","context_page_description":"Jascha Heifetz, né le 2 février 1901 à Vilnius et mort le 10 décembre 1987 à Los Angeles, est un violoniste russe, naturalisé américain.\\nLe nom de Heifetz est devenu synonyme de perfection violonistique."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_kulturminner_i_Lesja","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Lesjaverk_kirke.jpg","page_title":"Liste over kulturminner i Lesja","context_page_description":"Liste over kulturminner i Lesja er en oversikt over fredede og/eller bevaringsverdige bygninger og elementer i Lesja. Data er hentet fra Riksantikvarens liste over kulturminner.\\nID-nummer består av et lenket tall som går direkte til det aktuelle kulturminnet i Kulturminnesøk."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E5%8D%B0%E8%8D%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Hydrastis_fruit.jpg","page_title":"金印草","context_page_description":"金印草，又名白毛茛或北美黃蓮，是多年生的毛茛科植物，原產於加拿大東南部及美國東北部。它們的根莖粗壯及呈黃色。在地上的莖略帶紫色及有毛，地底下的呈黃色，連接著根莖。金印草的葉子呈手掌狀及有毛，葉子上有5-7塊雙鋸齒的小葉，並會在春末長出單支細小的花朵。在夏天會長出單一個草莓，外觀像山莓，有10-30顆種子。\\n金印草有多種醫藥療效，包括可以作為抗菌藥、內服幫助消化、或是用來漱口清除口腔潰瘍。\\n日本的白根葵以往被分類在金印草屬中，現已改為分類在白根葵屬。"},{"page_url":"https://ca.wikipedia.org/wiki/Coeficient_de_dilataci%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Joint_de_dilatation_gi%C3%A8res.JPG","page_title":"Coeficient de dilatació","context_page_description":"Un coeficient de dilatació és una relació que mesura el canvi relatiu de longitud o volum que es produeix quan un cos sòlid o un fluid experimenta un canvi en algun paràmetre com ara la temperatura, la pressió o la concentració."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Agnant","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/2008-08-StAgnant-church.JPG","page_title":"Saint-Agnant","context_page_description":"Saint-Agnant es una población y comuna francesa, situada en la región de Poitou-Charentes, departamento de Charente Marítimo, en el distrito de Rochefort y cantón de Saint-Agnant."},{"page_url":"https://en.wikipedia.org/wiki/Burg_Lockenhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/L%C3%A9ka_l%C3%A9gifot%C3%B31.jpg","page_title":"Burg Lockenhaus","context_page_description":"Burg Lockenhaus is a castle and medieval fortress in the Güns Valley in the southeastern part of Lockenhaus, in Burgenland, eastern Austria. Burg Lockenhaus is 368 metres above sea level. The castle was built in Romanesque and Gothic architectural styles around 1200, and was initially called \\"Leuca\\" or Léka. It is part of the Naturpark Geschriebenstein."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BA%D1%81,_%D0%A5%D0%B0%D0%BD%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Hannah_Marks_by_Gage_Skidmore.jpg","page_title":"Маркс, Ханна","context_page_description":"Ханна Маркс — американская актриса."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%B1%CE%BC%CE%AF%CE%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/LAMIA_B.C._400%E2%80%94344b.jpg","page_title":"Λαμία","context_page_description":"Η Λαμία είναι πόλη και πρωτεύουσα της Περιφερειακής Ενότητας Φθιώτιδας. Έχει πληθυσμό 52.006 κατοίκους και βρίσκεται στις πλαγιές του όρους Όθρυς, κοντά στον ποταμό Σπερχειό. Αποτελεί κέντρο εύφορης αγροτικής και κτηνοτροφικής περιοχής. Με την εφαρμογή, την 1η Ιανουαρίου του 2011, του αυτοδιοικητικού Προγράμματος «Καλλικράτης», η Λαμία παρέμεινε ως έδρα του διευρυμένου Δήμου Λαμιέων, ο οποίος έχει πληθυσμό 75.235 κατοίκους. Επίσης, παρέμεινε έδρα της Περιφέρειας Στερεάς Ελλάδας, συσσωρεύοντας όλες τις προβλεπόμενες υπηρεσίες."},{"page_url":"https://de.wikipedia.org/wiki/Flemming_Meyer","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/1331-ri-47-Flemming_Meyer_SSW.jpg","page_title":"Flemming Meyer","context_page_description":"Flemming Meyer ist ein deutsch-dänischer Politiker des Südschleswigschen Wählerverbands und war von 2009 bis 2020 Mitglied des Landtags von Schleswig-Holstein."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%88%D8%B2%D8%B1%D8%A7%D8%A1_%D8%A7%D9%84%D9%85%D8%A7%D9%84%D9%8A%D8%A9_(%D9%85%D8%B5%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Hussein_Roushdi.jpg","page_title":"قائمة وزراء المالية (مصر)","context_page_description":"قائمة وزراء المالية في مصر، وزارة المالية هي إحدى الوزارات الحالية في مصر وتتبع مجلس الوزراء.\\nبدأ تنظيم أول وزارة للأمور المالية في مصر في عهد محمد علي باشا الذي اهتم بمالية الدولة وتنظيمها بناء على مشورة مستشاريه من الأجانب حتى يتسنى له الحصول على الأموال اللازمة في سبيل خلق مملكه له ولأسرته من بعده، ومن ثم فقد أهتم بتقسيم الحكومة إلى إدارات مختلفة وأنشأ بتتابع دواوين أو نظارات كان من بينها نظارة المالية التي كان عل رأسها محمد لاظوغلي باشا ووضع في عهده أول ميزانية بدائية إيمانا منه أن عصب الدولة في ميزانياتها، وسار على نهجه خلفاؤه فحول محمد سعيد بعض النظارات أو الدواوين إلى وزارات وأصدر في 26 فبراير 1856 مرسوما يشتمل على النظام الجديد الذي أدخله في الإدارة العامة ويتضمن أنشاء أول وزارة للمالية برئاسة الأمير مصطفى فاضل بعد أن كانت نظارة للمالية، وفي عهد الخديوى إسماعيل تولى وزارة المالية إسماعيل صديق المعروف باسم إسماعيل المفتش في الفترة من سنة 1868 إلى سنة 1876."},{"page_url":"https://de.wikipedia.org/wiki/Mittelpunkt_(Schriftzeichen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Hyphenation_point_in_Merriam-Webster%E2%80%99s_Collegiate_Dictionary_11th_ed_p.105.png","page_title":"Mittelpunkt (Schriftzeichen)","context_page_description":"Der Mittelpunkt ist ein Schriftzeichen, das in Gestalt und Größe dem als Satzzeichen verwendeten Punkt gleicht, jedoch deutlich über der Grundlinie liegt. Im lateinschriftlichen Fließtext liegt er üblicherweise auf etwa halber Großbuchstabenhöhe – also etwa in der Mitte der Schriftzeile.\\nDas Zeichen wird als Rechenzeichen für die Grundrechenart Multiplikation, außerdem zur Gliederung von Wortfolgen und in einigen Orthografien für spezielle Markierungen innerhalb von Wörtern verwendet; in einigen nichtlateinischen Schriftsystemen auch als Satzzeichen. In der Chemie wird es in speziellen Formeln verwendet. Häufig wird es zur Darstellung ähnlicher Zeichen verwendet, wenn diese auf der verwendeten Tastatur oder in der gewählten Schriftart nicht zur Verfügung stehen."},{"page_url":"https://en.wikipedia.org/wiki/Heidenau%E2%80%93Kurort_Altenberg_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bahnhof_Glash%C3%BCtte_Empfangsgeb%C3%A4ude.jpg","page_title":"Heidenau–Kurort Altenberg railway","context_page_description":"The Heidenau–Kurort Altenberg railway, also known in German as the Müglitztalbahn is a German railway in Saxony. Branching off the Elbe Valley Railway, it connects the town of Heidenau near Dresden with the towns of Glashütte and Altenberg in Erzgebirge, where it terminates. The total length is 38 km, with a total incline of 634 meters. The scenic track follows primarily the Müglitz river, passing the towns of Dohna, Glashütte and Geising.\\nThe railway was initially a narrow gauge railway, which was opened on November 17, 1890. Between 1935 and 1938, the tracks were graded and converted to standard gauge.\\nPassenger transport services are operated on behalf of Verkehrsverbund Oberelbe by Städtebahn Sachsen since 12 December 2010 following a retendering of the transport services. The rail infrastructure is operated by DB Netz, the stations are run by DB Station&Service."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Gr%C3%A4fenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Kirchplatz_10_%28Gr%C3%A4fenberg%29.JPG","page_title":"Liste der Baudenkmäler in Gräfenberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Stadt Gräfenberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 7. März 2015 und enthält 112 Baudenkmäler."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Roaix","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Map_commune_FR_insee_code_84098.png","page_title":"Roaix","context_page_description":"Roaix sī ūi-tī Hoat-kok Provence-Alpes-Côte d'Azur toā-khu Vaucluse koān ê chi̍t ê commune."},{"page_url":"https://fi.wikipedia.org/wiki/Puolalanm%C3%A4ki","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Puolalanpuisto.jpg","page_title":"Puolalanmäki","context_page_description":"Puolalanmäki on Turun keskustassa, VI:n ja VII:n kaupunginosan rajalla sijaitseva kukkula. Se on yksi Turun seitsemästä kukkulasta ja korkeudeltaan 35,2 metriä merenpinnan yläpuolella. Mäen päällä sijaitsee Turun taidemuseo, jota ympäröi Puolalanpuisto. Mäki on saanut nimensä Puolalan kylästä, joka liitettiin Turkuun Maariasta 1600-luvulla. Yhdessä Turun taidemuseon kanssa Puolalanmäki on yksi Museoviraston määrittelemistä valtakunnallisesti merkittävistä rakennetuista kulttuuriympäristöistä.\\nVuoden 1775 palon jälkeen Puolalanmäelle rakennettiin runsaasti matalia puumökkejä, joissa asui merimiehiä, käsityöläisiä ja kisällejä. Alueen puutalot säilyivät Turun palosta 1827 ja aina 1900-luvun alkuun asti. Keskiajalla täällä kaupunkialueen ulkopuolella sijaitsi spitaalisten laitos ”Pyhän Yrjänän hospitaali”, josta ensimmäinen tunnettu maininta on vuodelta 1355. Vasta vuonna 1623 spitaalilaitos siirrettiin Seilin saarelle Nauvoon.\\nVanha rakennuskanta, mukaan lukien 1838 valmistunut palotorni, purettiin 1900-luvun alkupuolella. Tällöin rakennettiin sekä Taidemuseon rakennus että sitä ympäröivät kivitalot."},{"page_url":"https://cs.wikipedia.org/wiki/Soudy_v_%C4%8Cesku","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/VS_Olomouc.jpg","page_title":"Soudy v Česku","context_page_description":"Soudy v Česku jsou nezávislé státní orgány vykonávající podle hlavy čtvrté Ústavy soudní moc. Tedy zákonem stanoveným způsobem zajišťují v občanskoprávním řízení ochranu subjektivních práv, v trestním řízení rozhodují o vině a trestu za trestné činy a ve správním soudnictví přezkoumávají akty orgánů veřejné správy, případně rozhodují i o dalších věcech, které jsou jim zákonem svěřeny.\\nMimo soustavu těchto obecných soudů jako zvláštní ústavní orgán soudního typu stojí Ústavní soud, který v ústavním soudnictví rozhoduje o souladu obecných právních předpisů i individuálních rozhodnutí s ústavou."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Guf-Guz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Coa_fam_ITA_guiccioli.jpg","page_title":"Armoriale delle famiglie italiane (Guf-Guz)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Guf a Guz."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D0%B5%D0%BC%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Anemone_drummondii.jpg","page_title":"Анемоне","context_page_description":"Анемоне, известен и като съсънка, е род цъфтящи растения от семейство Ranunculaceae, родом от умерените зони. Родът е тясно свързан с няколко други рода като Pulsatilla и Hepatica, като някои ботаници включват и двата рода в рамките на Anemone."},{"page_url":"https://no.wikipedia.org/wiki/Jenny_Nystr%C3%B6m","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Jenny_Nystr%C3%B6m_3.JPG","page_title":"Jenny Nyström","context_page_description":"Jenny Nyström var en svensk billedkunstner og illustratør. Hun er mest kjent for en mengde dekorative og romantiske julekort og nissetegninger som i stor grad har preget hvordan fjøsnisser og tradisjonell juleidyll har blitt framstilt i Sverige."},{"page_url":"https://es.wikipedia.org/wiki/Cr%C3%A1teres_Mono-Inyo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Mono_Crater_closeup-1000px.jpeg","page_title":"Cráteres Mono-Inyo","context_page_description":"Los cráteres Mono-Inyo constituyen una cadena volcánica que corre con una tendencia de norte a sur en California del este, se extiende a lo largo de 40 km desde la costa noroccidental del lago Mono hasta el sur del monte Mammoth. La cadena está localizada en el condado de Mono en el estado de California de los Estados Unidos de América.\\nEl campo volcánico del lago Mono fue designado como área forestal escénica nacional de la cuenca Mono en 1984 y es gestionado por el Servicio Forestal de los Estados Unidos como parte del bosque nacional Inyo. Están permitidas las actividades de excursionismo, avistamiento de aves, canotaje, esquí y ciclismo de montaña."},{"page_url":"https://gl.wikipedia.org/wiki/Alberto_Larroque","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Alberto_Larroque.JPG","page_title":"Alberto Larroque","context_page_description":"Alberto Larroque, nado en Baiona en 1819 e finado en Bos Aires en xullo de 1881, foi un xurista, xornalista e docente francés que se radicou na Arxentina, onde foi reitor do Colexio de Concepción do Uruguai, pioneiro na educación secundaria no interior do seu país de adopción."},{"page_url":"https://pt.wikipedia.org/wiki/B%C3%A2rs%C4%83ne%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Barsanesti_jud_Bacau.png","page_title":"Bârsănești","context_page_description":"Bârsăneşti é uma comuna romena localizada no distrito de Bacău, na região de Moldávia. A comuna possui uma área de 70.38 km² e sua população era de 5199 habitantes segundo o censo de 2007."},{"page_url":"https://en.wikipedia.org/wiki/Pontiac","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Pontiac_Six_2-Door_Sedan_1928.jpg","page_title":"Pontiac","context_page_description":"Pontiac was a car brand owned, made, and sold by General Motors. Introduced as a companion make for GM's more expensive line of Oakland automobiles, Pontiac overtook Oakland in popularity and supplanted its parent brand entirely by 1933.\\nSold in the United States, Canada, and Mexico by GM, Pontiac was advertised as the performance division of General Motors from the 1960s onward. In the hierarchy of GM's five divisions, it slotted above Chevrolet, but below Oldsmobile, Buick, and Cadillac.\\nAmid late 2000s financial problems and restructuring efforts, GM announced in 2008 it would follow the same path with Pontiac as it had with Oldsmobile in 2004 and discontinued manufacturing and marketing vehicles under that brand by the end of 2010. The last Pontiac-badged cars were built in December 2009, with one final vehicle in January 2010. Franchise agreements for Pontiac dealers expired on October 31, 2010, leaving GM to focus on its four remaining North American brands: Chevrolet, Buick, Cadillac, and GMC."},{"page_url":"https://no.wikipedia.org/wiki/Malgassoclanis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Malgassoclanis_suffuscus_JH369_male_up_edi.jpg","page_title":"Malgassoclanis","context_page_description":"Malgassoclanis er en slekt av sommerfugler som tilhører familien svermere."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E8%8C%A8%E7%9B%AE%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/20060416_ibarame_n.jpg","page_title":"茨目站","context_page_description":"茨目站是東日本旅客鐵道信越本線的鐵路車站，位於日本新潟縣柏崎市茨目二丁目。"},{"page_url":"https://it.wikipedia.org/wiki/The_Teng_Chun","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/JIF_logo%2C_Star_Magazine_2.20_%28August_1940%29%2C_p50.jpg","page_title":"The Teng Chun","context_page_description":"The Then Cung è stato un regista, produttore cinematografico, sceneggiatore, direttore della fotografia e montatore sonoro indonesiano.\\nNoto anche con il nome indonesiano Tahyar Idris, fu figlio di un ricco uomo d'affari cinese etnico e si interessò al cinema fin dalla giovane età. Dopo un periodo come esportatore, nel 1930 fondò la Cino Motion Picture per produrre film nelle Indie orientali olandesi. In poco più di un decennio, lui e la sua compagnia avevano realizzato almeno 31 film, tra cui alcuni dei primi sonori del Paese. Sebbene avesse vissuto una breve rinascita negli anni '50, dopo che l'Indonesia era diventata indipendente, trascorse gli ultimi anni della sua vita come insegnante di inglese."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%9C%E9%95%B7%E7%9F%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/LvMS-Lvm.jpg","page_title":"斜長石","context_page_description":"斜長石はケイ酸塩鉱物の中の長石の一種であり、固溶体の一つである。ドイツの鉱物学者であるヨハン・F・C・ヘッセルが1826年に発見した。この鉱物は曹長石から灰長石までの一連の鉱物の端成分を占めており、ナトリウムやカルシウムなどの原子が結晶格子に入ることができるようになっている。斜長石はその抱合的な双晶か「レコードの溝効果」の観察で特定される。\\n斜長石は地殻の主要な構成成分であるため、岩石学で岩石の組成を特定し、火成岩の起源と成長を調べるために使われる。斜長石はまた月の石の主成分である。"},{"page_url":"https://pt.wikipedia.org/wiki/Alice_de_Battenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Bundesarchiv_Bild_101I-521-2142-29%2C_Athen%2C_Panzer_IV.jpg","page_title":"Alice de Battenberg","context_page_description":"Vitória Alice Isabel Júlia Maria foi a esposa do príncipe André da Grécia e Dinamarca e mãe do príncipe Filipe, Duque de Edimburgo.\\nAlice era bisneta da rainha Vitória do Reino Unido e cresceu na Alemanha, Inglaterra e no Mediterrâneo. Ela se casou em 1903 com o príncipe André da Grécia e Dinamarca e foi viver na Grécia até ser exilada junto com toda a família real em 1917. Seu marido foi culpado pela derrota na Guerra Greco-Turca de 1919–1922 depois de voltarem para país alguns anos depois, com a família sendo forçada a se exilar novamente até a restauração da monarquia em 1935.\\nPortadora de surdez congênita, foi diagnosticada em 1930 com esquizofrenia e internada em um sanatório na Suíça; assim ela passou a viver separada de André. Ela se recuperou e dedicou o restante de seus anos realizando trabalhos de caridade na Grécia. Alice ficou em Atenas durante a Segunda Guerra Mundial protegendo judeus, sendo reconhecida postumamente pelo Yad Vashem como Justa Entre as Nações. Ela continuou na Grécia depois da guerra e fundou uma ordem de enfermagem ortodoxa de freiras conhecida como a Irmandade Cristã de Marta e Maria."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D0%BE%D0%B2_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8_%D0%A1%D0%B8%D0%BD%D0%B3%D0%B0%D0%BF%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Tony_Tan_20110623.jpg","page_title":"Список президентов Республики Сингапур","context_page_description":"Президент Республики Сингапур является главой государства и избирается всенародным голосованием на 6 лет. До реформы 1991 года президент назначался парламентом и являлся чисто церемониальной фигурой. В настоящее время он имеет полномочия в финансовых и кадровых вопросах."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D6%84%D5%BD_%D5%A5%D5%B2%D5%A2%D5%A1%D5%B5%D6%80%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Marx_Brothers_1931.jpg","page_title":"Մարքս եղբայրներ","context_page_description":"Մարքս եղբայրներ, ամերիկացի կատակերգու հանրաճանաչ հինգ եղբայրներ, որոնք մասնագիտացել են ծեծկռտուքներից, ապտակներից, սիրախաղից և «տորթերի նետումից» բաղկացած «աբսուրդի կատակերգությունում»։\\nԾնվել են Նյու Յորքում՝ հրեա ներգաղթյալների ընտանիքում։ Նրանց մայրը՝ Մինի Շենբերգը, ծնվել է Ռեյնյան Պրուսիայում, իսկ հայրը՝ Սեմուել Մարքսը, ֆրանսիական Էլզաս բնակավայրում։ Խաղացել են վոդևիլներում և թատերական ներկայացումներում, բայց համաշխարհային ճանաչում են ձեռքբերել կինեմատոգրաֆիայի շնորհիվ։ Մարքս եղբայրներին համեմատում են այնպիսի աստղերի հետ, ինչպիսիք են Չարլի Չապլինն ու Բաստեր Քիթոնը։"},{"page_url":"https://en.wikipedia.org/wiki/Music_of_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Sesimbra3.jpg","page_title":"Music of Portugal","context_page_description":"Portuguese music includes many different styles and genres, as a result of its history. These can be broadly divided into classical music, traditional/folk music and popular music and all of them have produced internationally successful acts, with the country seeing a recent expansion in musical styles, especially in popular music.\\nIn traditional/folk music, fado has had a significant impact, with Amália Rodrigues still the most recognizable Portuguese name in music, and with more recent acts, like Dulce Pontes and Mariza. The genre is one of two Portuguese music traditions in the UNESCO Intangible Cultural Heritage Lists, with the other being Cante Alentejano. Regional folk music remains popular too, having been updated and modernized in many cases, especially in the northeastern region of Trás-os-Montes. Some more recent successful fado/folk-inspired acts include Madredeus and Deolinda, the latter being part of a folk revival that has led to a newfound interest in this type of music.\\nIn popular music, there is a significant number of popular genres. These include rock, with popular acts including Xutos & Pontapés, The Gift, Fingertips, Blasted Mechanism, Noctivagus and Wraygunn."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%92%E1%83%A0%E1%83%98%E1%83%92%E1%83%9D%E1%83%9A_XIII","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Gregory_XIII.jpg","page_title":"გრიგოლ XIII","context_page_description":"გრიგოლ XIII, ერისკაცობაში უგო ბონკომპანი — რომის პაპი 1572 წლის 13 მაისიდან 1585 წლის 10 აპრილამდე."},{"page_url":"https://et.wikipedia.org/wiki/Vladimir_Melanin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/RUSMARKA-1753.jpg","page_title":"Vladimir Melanin","context_page_description":"Vladimir Mihhailovitš Melanin oli Nõukogude Liidu laskesuusataja. Olümpiavõitja ja kolmekordne maailmameister.\\nVladimir Melanin oli Nõukogude Liidu esimene laskesuusatajast maailmameister ja olümpiavõitja. Esimest korda tuli ta maailmameistriks 1959. aasta maailmameistrivõistlustel Courmayeuris 20 km distantsil, kus tema koondisekaaslane Dmitri Sokolov kaotas talle ainult 10 sekundiga. 1962. aasta MM-il Hämeenlinnas tuli ta teist korda maailmameistriks, kuigi tegi esimeses tiirus kaks möödalasku. Edasi laskis ta puhtalt ja võitis teiseks tulnud soomlast Antti Tyrväinenit 38 sekundiga, kuigi tegi ühe möödalasu rohkem kui soomlane. Kolmandat korda tuli ta maailmameistriks 1963. aasta MM-il Seefeldis, kus jõudis jälle finišisse enne Türväinenit ühe minuti ja 40 sekundise edumaaga, kuigi mõlemad tegid neli möödalasku.\\nMelanini esimesel olümpiavõistlusel 1960. aasta olümpiamängudel Squaw Valleys ebaõnnestus laskmine, ta sai kaheksa trahviminutit, kaotas võitjale Klas Lestanderile 2,5 minutiga ja pidi leppima neljanda kohaga. 1964. aasta OM-il Innsbruckis lasi Melanin puhtalt ja tuli üle kolmeminutilise edumaaga Aleksandr Privalovi ees olümpiavõitjaks."},{"page_url":"https://en.wikipedia.org/wiki/Alister_Clark_Memorial_Rose_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Billy_Boiler_ACMRG_17-11-2013_0250.jpg","page_title":"Alister Clark Memorial Rose Garden","context_page_description":"The Alister Clark Memorial Rose Garden is the only complete collection in Australia of the surviving roses of \\"the great Australian rose breeder, Alister Clark\\". It is situated near \\"Glenara\\", his old house and garden in Bulla, Victoria, 10 km NW of Melbourne Airport. There are at least 150 named roses by Alister Clark and many more plausibly attributed to him. Of these 83 are known to survive, though the authenticity of some is disputed and another eight only survive outside Australia.\\nThe garden is maintained by volunteers coordinated by the Hume City Council."},{"page_url":"https://sl.wikipedia.org/wiki/Vulkanska_jama","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Classic_lava_tube_passage.jpg","page_title":"Vulkanska jama","context_page_description":"Vulkanska jama je velika luknja v zemeljski skorji, v kateri se nahaja magma. Če je magme v vulkanski jami preveč, vulkan izbruhne."},{"page_url":"https://en.wikipedia.org/wiki/Effigy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Lightmatter_burningman.jpg","page_title":"Effigy","context_page_description":"An effigy is an often life-size sculptural representation of a specific person, or a prototypical figure. Lately, the term is mostly used for the make-shift dummies used for symbolic punishment in political protests and for the figures burned in certain traditions around New Year, Carnival and Easter. In European cultures, effigies were in the past also used for punishment in formal justice, when the perpetrator could not be apprehended, and in popular justice practices of social shaming and exclusion. Additionally, “effigy” is used for certain traditional forms of sculpture, namely tomb effigies, funeral effigies and coin effigies.\\nThere is a lot of overlap and exchange between the ephemeral forms of effigies. Traditional holiday effigies are often politically charged, for instance, when the generalised figures Año Viejo or Judas in Latin America are substituted by the effigy of a despised politician. Traditional forms are also borrowed for political protests. In India, for instance, effigies in protests regularly take the form of the ten-headed demon king Ravana, as they figure in the traditional Ramlila."},{"page_url":"https://vi.wikipedia.org/wiki/Pel%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Pel%C3%A9-Lula-Marisa.jpg","page_title":"Pelé","context_page_description":"Edson Arantes do Nascimento, được biết đến nhiều nhất với tên Pelé, là một cựu cầu thủ bóng đá nổi tiếng người Brasil. Với biệt danh \\"Vua bóng đá\\", ông được coi là một trong những cầu thủ bóng đá xuất sắc nhất mọi thời đại. Vào năm 1999, ông được bầu chọn là Cầu thủ xuất sắc nhất thế kỉ 20 bởi hiệp hội IFFHS. Cũng trong năm đó, ông được IOC bầu chọn là Vận động viên của thế kỉ và được tạp chí TIME đưa vào danh sách 100 người có ảnh hưởng lớn nhất thế giới. Vào năm 2013, ông được FIFA trao tặng giải thưởng Quả bóng vàng danh dự.\\nĐược phát hiện tài năng từ khi còn rất trẻ, Pelé bắt đầu chơi bóng cho Santos Futebol Clube khi mới 15 tuổi, vào đội tuyển quốc gia khi 16 tuổi và lần đầu đoạt Cúp Thế giới khi mới ở tuổi 17. Trong sự nghiệp quốc tế của mình, ông đã giành được ba Cúp thế giới của FIFA vào các năm 1958, 1962 và 1970, và là cầu thủ duy nhất từng làm như vậy. Pelé là cầu thủ ghi bàn hàng đầu mọi thời đại của Brasil với 77 bàn thắng trong 92 trận đấu. Ở cấp câu lạc bộ, ông là cầu thủ ghi bàn nhiều nhất cho Santos, và đưa đội bóng đến chức vô địch Copa Libertadores năm 1962 và 1963."},{"page_url":"https://hu.wikipedia.org/wiki/Sokolac_v%C3%A1ra","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Sokolac_Brinje_07_3.jpg","page_title":"Sokolac vára","context_page_description":"Sokolac vára, várrom Horvátországban Brinje központjában."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_6412","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/NGC6412-HST-R814GB450.jpg","page_title":"NGC 6412","context_page_description":"NGC 6412 galaxia bat da, Draco konstelazioan. William Herschelek aurkitu zuen 1797ko abenduaren 12an."},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_de_la_ligne_62_du_tramway_de_Bruxelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Place_Emile_Bockstael.jpg","page_title":"Architecture de la ligne 62 du tramway de Bruxelles","context_page_description":"Cette page reprend une partie des bâtiments remarquables se trouvant sur le trajet de la ligne 62 du tramway de Bruxelles."},{"page_url":"https://da.wikipedia.org/wiki/Vierwaldst%C3%A4tters%C3%B8en","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Vierwaldst%C3%A4ttersee_Pilatus.JPG","page_title":"Vierwaldstättersøen","context_page_description":"Vierwaldstättersøen er en sø omgivet af bjerge i Centralschweiz. Navnet kommer af de fire omkransende Waldstätten: Uri, Unterwalden, Schwyz og Luzern. Søen blev blev dannet af Reuss-gletsjeren ved slutningen af sidste istid for 12.000 år siden.\\nFra Gotthardmassivet flyder Reuss-floden mod søen og fører store mængder materiale med sig, så deltaet i tidens løb har flyttet sig 10 km mod nord ud i Urnersee. I Luzerns \\"Gletschergarten\\" vises Alpernes historie, istiderne og deres gletsjere.\\nVierwaldstättersøen kaldes af og til Luzernsøen eller Lucernesøen."},{"page_url":"https://sv.wikipedia.org/wiki/Franciszek_Karpi%C5%84ski","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Franciszek_Karpi%C5%84ski_%E2%80%94_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%96%D1%88%D0%B0%D0%BA_%D0%9A%D0%B0%D1%80%D0%BF%D1%96%D0%BD%D1%81%D0%BA%D1%96.gif","page_title":"Franciszek Karpiński","context_page_description":"Franciszek Karpiński, född 4 oktober 1741, död 16 september 1825, var en polsk poet.\\nKarpiński skrev elegier, idyller och visor i naiv och intim stil. Några av hans religiöst inspirerade dikter levde länge kvar som kyrkosånger. Karpiński gjorde även en omdiktning av Davids Psalmer och försökte sig även på dramatiken, varibland främst märks tragedin Judit, men utan större framgång."},{"page_url":"https://es.wikipedia.org/wiki/Museo_Ferroportuario","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Zorra_fcr.37.jpg","page_title":"Museo Ferroportuario","context_page_description":"Museo Ferroportuario es un museo ubicado en el centro de la ciudad de Comodoro Rivadavia, Argentina. Está formado por seis salas de exposición que muestran a través de fotografías, planos, y otros objetos, aspectos históricos de la ciudad, relacionados con el Ferrocarril de Comodoro Rivadavia y el Puerto Antonio Morán. Su objetivo principal es mostrar el vínculo que tuvo el ferrocarril con el puerto.​​\\nEl edificio en el cual se emplaza corresponde a la antigua Estación Comodoro Rivadavia del Ferrocarril de Comodoro Rivadavia. El museo funciona en la planta alta de la antigua estación, además, funciona en el lugar la Agencia Comodoro Cultura y otras dependencias municipales y el Archivo Ferroportuario.​"},{"page_url":"https://pl.wikipedia.org/wiki/G%C3%B3ry_Peloryta%C5%84skie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Rocca_Salvatesta.JPG","page_title":"Góry Pelorytańskie","context_page_description":"Góry Pelorytańskie – masyw górski w północno-wschodniej części Sycylii, stanowiący strukturalne przedłużenie Apeninów Południowych. Najwyższy szczyt, Montagna Grande, wznosi się na wysokość 1374 m n.p.m. Masyw zbudowany jest głównie z gnejsów i łupków krystalicznych. Zbocza są strome i głęboko rozcięte dolinami rzek, porośnięte makią. Region aktywny sejsmicznie."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CF%81%CF%8E%CF%84%CE%BF_%CE%B5%CF%80%CE%AF%CF%80%CE%B5%CE%B4%CE%BF_NUTS_%CF%84%CE%B7%CF%82_%CE%95%CF%85%CF%81%CF%89%CF%80%CE%B1%CF%8A%CE%BA%CE%AE%CF%82_%CE%88%CE%BD%CF%89%CF%83%CE%B7%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/NUTS-1_Austria.png","page_title":"Πρώτο επίπεδο NUTS της Ευρωπαϊκής Ένωσης","context_page_description":"Η κοινή ονοματολογία των εδαφικών στατιστικών μονάδων είναι γεωκωδική τυποποίηση για την αναφορά των διοικητικών διαιρέσεων των χωρών για στατιστικούς λόγους. Το πρότυπο αναπτύχθηκε από την Ευρωπαϊκή Ένωση.\\nΥπάρχουν τρία επίπεδα γεωκωδικών NUTS, με δυο επίπεδα να αφορούν τις τοπικές διοικητικές μονάδες. Δεν έχουν όλεςGR οι χώρες όλα τα επίπεδα κωδικών NUTS, το οποίο εξαρτάται από τον πληθυσμό των κρατών. Μια από τις πιο ακραίες περιπτώσεις, είναι το Λουξεμβούργο, που έχει μόνο μια μορφή διαίρεσης, αφού κάθε ένα από τα τρία επίπεδα γεωκωδικών NUTS, αντιστοιχούν στο ίδιο το κράτος.\\nΠαρακάτω αναφέρονται τα πρώτα επίπεδα NUTS στατιστικών περιοχών της Ευρωπαϊκής Ένωσης."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-%C3%89tienne-du-Vigan","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Map_commune_FR_insee_code_43180.png","page_title":"Saint-Étienne-du-Vigan","context_page_description":"Saint-Étienne-du-Vigan är en kommun i departementet Haute-Loire i regionen Auvergne-Rhône-Alpes i centrala Frankrike. Kommunen ligger i kantonen Pradelles som tillhör arrondissementet Le Puy-en-Velay. År 2009 hade Saint-Étienne-du-Vigan 113 invånare."},{"page_url":"https://nl.wikipedia.org/wiki/Achter_de_Muur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Overzicht_-_Groningen_-_20094239_-_RCE.jpg","page_title":"Achter de Muur","context_page_description":"Achter de Muur is de naam die oorspronkelijk werd gegeven aan de straat die aan de binnenzijde van de stadsmuur van de stad Groningen liep. Tegenwoordig draagt enkel nog het deel tussen de Poelestraat en het Gedempte Kattendiep die naam. In de middeleeuwen begon Achter de Muur bij de Aa en volgde de huidige Vischhoek, de Hoekstraat, de Muurstraat, de Hardewikerstraat, de Hofstraat, de Singelstraat, de Schoolstraat, de huidige Achter de Muur, de Burchtstraat, de Nieuwstad en de Torenstraat."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%AF%D9%88%D8%AF_%D8%A7%D9%84%D8%A3%D8%B1%D8%AF%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/PalestineandTransjordan1922.jpg","page_title":"حدود الأردن","context_page_description":"حدود الأردن هي الحدود الدوليّة للمملكة الأردنيّة الهاشميّة. تتضمن الحدود البريّة والبحريّة وحدود مع أراضٍ مُحتلة أو أراضٍ محدودة الاعتراف دوليًا. لقد تغيّرت هذه الحدود من وقت لآخر مع التطورات في الوضع السياسي للأردن مع جواره.\\nيحدّ الأردن من الشمال سوريا وهضبة الجولان المُحتلة، ومن الشرق العراق، وتحدّه السعودية من الجنوب الشرقي والجنوب، بينما تحدّه فلسطين التاريخية من الغرب. وللأردن حدود بحريّة قصيرة مع مصر والسعودية وإسرائيل في خليج العقبة بالجنوب الغربي. وتُعد الحدود مع الضفة الغربية في فلسطين أقرب الحدود الدوليّة مسافةً عن العاصمة الأردنية عمّان، حيث تبلغ المسافة 27 كيلومترًا.\\nباستثناء جزء صغير من حدود الأردن الطبيعيّة مع فلسطين التاريخيّة وسوريا، وتحديدًا في الغرب والشمال الغربي عند نهر الأردن ونهر اليرموك، فإن معظم حدوده الصحراويّة الأخرى قد تم رسمها بشكل خطوط مستقيمة في بداية القرن العشرين."},{"page_url":"https://pt.wikipedia.org/wiki/Phoolan_Devi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Phoolan_Devi.jpg","page_title":"Phoolan Devi","context_page_description":"Phoolan Devi ou Phulan Devi, popularmente conhecida como a Rainha dos bandidos, foi uma ladra e política Indiana. Ela era notória em toda a Índia, durante seu tempo como bandida.\\nPhoolan nasceu na casta shudra, numa família do clã mallaah, na pequena aldeia de Gorha ka Purwa no estado do Uttar Pradesh. Era a segunda filha de uma família muito pobre de quatro meninas e um menino. Foi casada com onze anos a troco de um pequeno dote e passou a uma rotina de espancamentos, sendo violentada e forçada a um árduo trabalho no campo. Já adolescente, passou a ser assediada por jovens de um clã poderoso na região, pertencente à casta dos guerreiros ou nobres. Para fugirem da acusação, eles acusam-na de tentar seduzi-los, fazendo com que fosse expulsa da aldeia. Recusada também pela família paterna, é abrigada por um parente próximo até o dia em que sua casa é invadida por um grupo de assaltantes que vieram raptá-la. Presa nas montanhas, alguns começam a solidarizar-se com seu sofrimento. O líder da gangue é morto por um membro do grupo de nome Vikram, que se torna o protetor de Phoolan. Ambos assumem a dianteira do grupo e começam a atacar o comércio e as castas superiores."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Zagarolo_Scalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Stazione_di_Zagarolo_Scalo_1.jpg","page_title":"Stazione di Zagarolo Scalo","context_page_description":"La stazione di Zagarolo Scalo era uno dei quattro impianti ferroviari al servizio del comune di Zagarolo, capolinea della breve diramazione Zagarolo Bivio-Zagarolo Scalo della ferrovia Roma-Fiuggi-Alatri-Frosinone alla progressiva chilometrica 31+488."},{"page_url":"https://en.wikipedia.org/wiki/715_series","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/JNR_EC_M714_side_view.png","page_title":"715 series","context_page_description":"The 715 series was an electric multiple unit train type introduced in February 1984 by Japanese National Railways, and later operated by East Japan Railway Company and Kyushu Railway Company on local services in Japan. They were converted from former 581/583 series sleeping car EMUs."},{"page_url":"https://eo.wikipedia.org/wiki/Ekzemplaj_noveloj","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Monumento_a_Cervantes_%28Madrid%29_07.jpg","page_title":"Ekzemplaj noveloj","context_page_description":"La Ekzemplaj noveloj estas verkaro de Miguel de Cervantes. La Ekzemplaj noveloj estas dekdu noveloj kiuj sekvas la modelon establitan en Italio kaj ili grupiĝas en du serioj: tiuj de idealisma kaj tiuj de realisma karakteroj. Tiuj idealismaj, kiuj estas plej proksimaj al la influo itala, karakteriziĝas pro traktado de intrigoj de amaferaj implikoj kun granda abundo de okazaĵoj, pro la apero de roluloj idealigitaj kaj sen psikologia evoluo kaj pro la malabunda montro de la realo.\\nLa nomoj de la verkoj en la hispana lingvo estas:\\nLa Gitanilla\\nEl amante liberal\\nRinconete y Cortadillo\\nLa española inglesa\\nEl licenciado Vidriera\\nLa fuerza de la sangre\\nLa ilustre fregona\\nEl casamiento engañoso\\nEl celoso extremeño\\nEl coloquio de los perros\\nLas dos doncellas\\nLa señora Cornelia\\nEn Esperanto estis tradukitaj la du lastaj noveloj Bonekzemplaj noveloj, kun la titoloj \\"Du junaj knabinoj\\" kaj \\"Korneliino\\", fare de Julio Mangada Rosenörn"},{"page_url":"https://en.wikipedia.org/wiki/Game_pie","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Game_pie.jpg","page_title":"Game pie","context_page_description":"Game pie is a form of meat pie featuring game. The dish dates from Roman times when the main ingredients were wild birds and animals such as partridge, pheasant, deer, and hare. The pies reached their most elaborate form in Victorian England, with complex recipes and specialized moulds and serving dishes. Modern versions are simpler but savoury combinations of rabbit, venison, pigeon, pheasant, and other commercially available game."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Falkenstein/Vogtl.","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/25.9.2018_Falkenstein_Vogtl._Plauensche_Stra%C3%9Fe_45.JPG","page_title":"Liste der Kulturdenkmale in Falkenstein/Vogtl.","context_page_description":"In der Liste der Kulturdenkmale in Falkenstein/Vogtl. sind die Kulturdenkmale der sächsischen Stadt Falkenstein/Vogtl. verzeichnet, die bis Juni 2019 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Vogtlandkreis."},{"page_url":"https://fi.wikipedia.org/wiki/Kiinalainen_filosofia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/SFEC_BritMus_Asia_021.JPG","page_title":"Kiinalainen filosofia","context_page_description":"Kiinalaisella filosofialla eli kiinalaisessa kulttuuripiirissä harjoitetulla filosofialla on monituhatvuotinen historia. Sen katsotaan usein alkaneen Yijingistä, muinaisesta ennustamisen käsikirjasta, joka esitteli monet kiinalaisen filosofian perusajatukset. Sen iästä voidaan esittää vain arvioita – se on tunnettu kirjallisena ainakin 500-luvulla eaa., mutta se perustuu neoliittiseltä kaudelta kulkeutuneeseen suulliseen perimätietoon.\\nLänsimaisen filosofian tavoin kiinalainen filosofia on käsittänyt monenlaisia osa-alueita ja siihen kuuluu useita eri suuntauksia. Monia merkittäviä filosofisia koulukuntia syntyi erityisesti Kevättä ja syksyä ja Taistelevat läänitysvaltiot -kausilla. Tämän vuoksi aikakaudesta käytetään nimitystä Sata koulukuntaa. Tuona aikana alkunsa saaneista koulukunnista merkittävimmät ovat kungfutselaisuus, taolaisuus, mohismi ja legalismi. Myöhemmin Intiasta levinneestä buddhalaisuudesta tuli myös merkittävä filosofinen ja uskonnollinen oppi Kiinassa.\\nUudella ajalla kiinalainen filosofia on omaksunut aineksia myös länsimaisesta ajattelusta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D0%BC%D0%B0%D1%80%D1%80%D0%B0,_%D0%A1%D0%B5%D0%B1%D0%B0%D1%81%D1%82%D1%8C%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bolivia_squad_2015_%282%29.jpg","page_title":"Гамарра, Себастьян","context_page_description":"Себастья́н Гама́рра Руи́с — боливийский футболист, полузащитник клуба «Милан» и сборной Боливии."},{"page_url":"https://en.wikipedia.org/wiki/Simulation","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Christer_Fuglesang_underwater_EVA_simulation_for_STS-116.jpg","page_title":"Simulation","context_page_description":"A simulation is an approximate imitation of the operation of a process or system; that represents its operation over time.\\nSimulation is used in many contexts, such as simulation of technology for performance tuning or optimizing, safety engineering, testing, training, education, and video games. Often, computer experiments are used to study simulation models. Simulation is also used with scientific modelling of natural systems or human systems to gain insight into their functioning, as in economics. Simulation can be used to show the eventual real effects of alternative conditions and courses of action. Simulation is also used when the real system cannot be engaged, because it may not be accessible, or it may be dangerous or unacceptable to engage, or it is being designed but not yet built, or it may simply not exist.\\nKey issues in simulation include the acquisition of valid sources of information about the relevant selection of key characteristics and behaviors, the use of simplifying approximations and assumptions within the simulation, and fidelity and validity of the simulation outcomes."},{"page_url":"https://en.wikipedia.org/wiki/Terence_Tchiknavorian","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/FIS_Ski_Cross_World_Cup_2015_-_Meg%C3%A8ve_-_20150313_-_Terence_Tchiknavorian.jpg","page_title":"Terence Tchiknavorian","context_page_description":"Terence Tchiknavorian is a French freestyle skier.\\nHe competed in the 2018 Winter Olympics."},{"page_url":"https://it.wikipedia.org/wiki/Campo_Real","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Campo_Real_-_Santa_Maria_del_Castillo4.jpg","page_title":"Campo Real","context_page_description":"Campo Real è un comune spagnolo di 2.993 abitanti situato nella comunità autonoma di Madrid."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%A1%91%E5%9D%A6%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Ayuntamientodesantander4.JPG","page_title":"桑坦德","context_page_description":"桑坦德（西班牙文：Santander）係西班牙坎塔布里亞首府，住18萬人。"},{"page_url":"https://en.wikipedia.org/wiki/Cairoli_III_Cabinet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Benedetto_Cairoli_iii.jpg","page_title":"Cairoli III Cabinet","context_page_description":"The Cairoli III Cabinet held office from 25 November 1879 until 29 May 1881, a total of 551 days, or 1 year, 6 months and 4 days."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%BF%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85%D1%83_%D0%98%D0%BE%D1%81%D0%B8%D1%84%D1%83_%D0%A1%D0%BB%D0%B8%D0%BF%D0%BE%D0%BC%D1%83_(%D0%A2%D0%B5%D1%80%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/%D0%A2%D0%B5%D1%80%D0%BD%D0%BE%D0%BF%D1%96%D0%BB%D1%8C_-_%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%9F%D0%B0%D1%82%D1%80%D1%96%D0%B0%D1%80%D1%85%D1%83_%D0%A3%D0%93%D0%9A%D0%A6_%D0%99%D0%BE%D1%81%D0%B8%D1%84%D0%BE%D0%B2%D1%96_%D0%A1%D0%BB%D1%96%D0%BF%D0%BE%D0%BC%D1%83_-_14101461.jpg","page_title":"Памятник патриарху Иосифу Слипому (Тернополь)","context_page_description":"Памятник патриарху Иосифу Слипому — монумент, посвященный Митрополиту Галицкому — предстоятелю Украинской грекокатолической Церкви и архиепископу Львовскому Иосифу Слипому, установленный в городе Тернополь в 2004 году."},{"page_url":"https://es.wikipedia.org/wiki/Caille_(Alpes_Mar%C3%ADtimos)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Caillewiki2.jpg","page_title":"Caille (Alpes Marítimos)","context_page_description":"Caille es una población y comuna francesa, en la región de Provenza-Alpes-Costa Azul, departamento de Alpes Marítimos, en el distrito de Grasse y cantón de Saint-Auban."},{"page_url":"https://fi.wikipedia.org/wiki/Dan_B%C4%83lan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Dan_Balan.jpg","page_title":"Dan Bălan","context_page_description":"Dan Mihai Bălan on moldovalais-romanialainen laulaja. Bălan tuli tunnetuksi eurodance-yhtye O-Zonen jäsenenä."},{"page_url":"https://fr.wikipedia.org/wiki/Travers%C3%A9e_de_Paris_%C3%A0_la_nage","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Jean_Rebeyrol%2C_vainqueur_%C3%A0_trois_reprises_cons%C3%A9cutives_de_la_travers%C3%A9e_de_Paris_%C3%A0_la_nage.jpg","page_title":"Traversée de Paris à la nage","context_page_description":"La Traversée de Paris à la nage est une course de nage en eau libre sur la Seine, organisée par le journal L'Auto et Georges Moëbs, qui a lieu pour la première fois en 1905. Elle fait alors 11,6 km, du pont National au viaduc d'Auteuil. À partir de 1906, une scission se fait au sein de l'organisation, et une seconde course, elle « amateur », est organisée concurremment, mise sur pied par Moëbs et le journal Les sports.\\nAlors nageur de haut niveau, Henri Decoin participe à l'édition amateur de 1913 mais, après avoir été longtemps deuxième, il abandonne. L'aviateur Charles Nungesser participe à celle de 1918."},{"page_url":"https://es.wikipedia.org/wiki/Fran_Drescher","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Fran_Drescher_CSM.jpg","page_title":"Fran Drescher","context_page_description":"Francine Joy «Fran» Drescher es una actriz, comediante, guionista, productora, directora y activista estadounidense.​ Se hizo mundialmente famosa por haber interpretado a la niñera Fran Fine en la comedia de situación The Nanny, que se transmitió originalmente entre 1993 y 1999 por la cadena CBS., ​ además de por su voz nasal y su marcado acento de Queens. En el 2000 se le diagnosticó cáncer de útero, por lo que se mantuvo relativamente alejada de la interpretación hasta que en 2005 volvió a la televisión con una nueva serie, Living with Fran.​ Nominada a varios premios Emmy, en 2010 fue la presentadora del programa The Fran Drescher Show y desde 2011 hasta 2012 fue protagonista de la comedia Happily Divorced.​"},{"page_url":"https://sq.wikipedia.org/wiki/Hiperboloidi","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Hyperboloid1.png","page_title":"Hiperboloidi","context_page_description":"Hiperboloidi është sipërfaqe e gradës së dytë e cila klasifikohet në bazë të napëve. Varrësisht se ka një apo dy napë flitet për:\\nHiperboloidin me një napë gjegjësisht sipërfaqen e gradës së dytë që përcaktohet me ekuacionin në formulën kanonike: dhe Hiperboloidi me dy napë gjegjësisht sipërfaqja e gradës së dytë që përcaktohet me ekuacionin kanonik:"},{"page_url":"https://fr.wikipedia.org/wiki/Majestic_(paquebot_de_1922)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/RMS_Majestic_%28Magic_stick%29.jpg","page_title":"Majestic (paquebot de 1922)","context_page_description":"Le Majestic est un paquebot britannique de la White Star Line mis en service en 1922. Sa construction est plus ancienne puisqu'il est mis en chantier en Allemagne en 1913 pour le compte de la Hamburg America Line sous le nom de Bismarck, après ses sister-ships, l'Imperator et le Vaterland. Lancé en juin 1914, il n'est pas achevé lorsque débute la Première Guerre mondiale, et sa construction cesse jusqu'à la fin du conflit. Il est alors cédé au Royaume-Uni en 1919, comme dommage de guerre, et est récupéré par la White Star Line avant d'être achevé.\\nÀ sa mise en service en 1922, le Majestic est le plus gros paquebot au monde avec ses 56 500 tonneaux environ, et le reste treize ans, jusqu'à l'arrivée du Normandie. Affecté à la ligne de New York en compagnie de l'Olympic et de l'Homeric, le Majestic devient navire amiral de sa compagnie, et son luxe lui permet d'être un des navires les plus populaires des années 1920. Il montre cependant des signes prématurés d'usure après quelques années de service.\\nLorsque la Grande Dépression éclate, le Majestic, de moins en moins rentable, sert également pour des croisières. En 1934, la White Star fusionne avec sa rivale, la Cunard."},{"page_url":"https://en.wikipedia.org/wiki/WorkNC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/WorkNC-Audi_concept_car.jpg","page_title":"WorkNC","context_page_description":"WorkNC is a Computer aided manufacturing software developed by Sescoi for multi-axis machining."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A9%AC%E8%80%B6%E8%AE%B7%E6%B2%B3%E7%95%94%E8%B4%A1%E6%8D%B7%E5%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/%C3%89glise_Saint-Jean-Baptiste_-_Ch%C3%A2teau-Gontier_64.JPG","page_title":"马耶讷河畔贡捷堡","context_page_description":"马耶讷河畔贡捷堡，法国西北部城市，卢瓦尔河地区大区马耶讷省的一个市镇，同时也是该省的一个副省会，下辖贡捷堡区，其市镇面积为68.49平方千米，2017年1月1日时人口数量为16,776人，是该省人口第二多的市镇，仅次于省会拉瓦勒，在所有法国城市中排名第560位。\\n马耶讷河畔贡捷堡位于马耶讷省东南部，马耶讷河两岸，是一个区域性的中心城市。成立于2019年1月1日，由贡捷堡、阿泽和圣福尔三个市镇合并而成，其中贡捷堡为政府驻地。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%82%A3%E3%83%AA%E3%82%A2%E3%83%A0%E3%83%BBO%E3%83%BB%E3%83%96%E3%83%A9%E3%83%83%E3%83%89%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Parker-Watkins-Hardin.jpg","page_title":"ウィリアム・O・ブラッドリー","context_page_description":"ウィリアム・オコーネル・ブラッドリーは、19世紀後半のアメリカ合衆国の政治家、弁護士であり、1895年から1899年まで第32代ケンタッキー州知事を務めた。その後ケンタッキー州議会からアメリカ合衆国上院議員に選ばれた。ケンタッキー州では初めて共和党からの知事であり、ケンタッキー州共和党の父と呼ばれるようになった。\\n民主党の強いケンタッキー州にあって、共和党員としてのその政歴初期ではあまり功績を挙げられなかった。アメリカ合衆国下院議員と上院議員の選挙に2度ずつ出馬して悉く落選した。1880年共和党全国大会でユリシーズ・グラントを大統領候補に推す演説で全国的に注目された後、1887年の州知事選挙で共和党公認候補になった。このときは民主党のサイモン・B・バックナーに敗れたが、それまでの民主党圧倒的有利の形勢を一変させた。1895年に再度州知事候補となった。民主党が自由銀の問題で分裂したことに乗じ、民主党候補のパーカー・ワトキンス・ハーディンを破って当選した。その任期は政治的闘争と暴力沙汰で彩られた。州内で黒人の地位向上を訴え、かなりの前進を果たしたが、州議会で民主党が多数派だったために、その改革の多くを法制化するには至らなかった。\\n論議の多かった次の1899年州知事選挙で、ブラッドリーの後継者ウィリアム・S・テイラーが当選した。民主党候補だったウィリアム・ゴーベルとその副知事候補J・C・W・ベッカムが選挙の結果に異議申し立てを行い、ブラッドリーは共和党のために弁護師団の一部を結成した。その裁判はアメリカ合衆国最高裁判所まで持ち込まれ、最後は民主党有利の判決になった。1907年、ブラッドリーは議会で少数党の共和党員ではあったが、アメリカ合衆国上院議員に選ばれた。このときも民主党内の分裂が奏功した。ブラッドリーは禁酒法に反対しており、そのことは民主党候補のベッカムよりも民主党に対する受けが良かった。ベッカムは妥協の候補者に折れることを拒み、上院議員選びの投票が2か月続けられた後、4人の民主党議員が党派を超えてブラッドリーに投票し、上院議員に選んだ。ブラッドリーの上院議員任期はあまり傑出した働きが見られなかった。次の上院議員選挙で再選を求めないと宣言したその日に、路面電車の事故に巻き込まれた。ブラッドリーは現職のままの1914年5月23日、事故の傷がもとで死んだ。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_Wuppertaler_Sakralbauten","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/W_Gemeindehaus_Platz_der_Republik.jpg","page_title":"Liste Wuppertaler Sakralbauten","context_page_description":"Die Bewohner der Stadt Wuppertal gehören über 50 unterschiedlichen Religionen und Konfessionen an. Der explosionsartige Bevölkerungszuwachs im 19. Jahrhundert begünstigte auch den Bau vieler Sakralgebäude, insbesondere für die in der Stadt besonders stark vertretenen protestantischen Freikirchen. Durch die Tatsache, dass die Gemeinden der Evangelischen Kirche im Rheinland erst in den 1980er Jahren uniert wurden, steht praktisch in jedem Stadtteil eine katholische und je eine ursprünglich lutherische und reformierte Kirche, von denen mittlerweile viele angesichts des Bevölkerungsrückgangs in der Stadt profaniert wurden. Zum Ende des 20. Jahrhunderts kamen vor allem muslimische Gebäude hinzu. Eine weitere Besonderheit der Stadt sind die rund fünfzig, fast ausschließlich konfessionellen Friedhöfe Wuppertals, die ebenfalls zahlreiche Sakralgebäude beherbergen.\\nDiese Liste versammelt die historischen und aktuellen Gottesdienst- und Versammlungsgebäude der verschiedenen Religionen und Konfessionen in Wuppertal, dazu gehören aktuell knapp 130 Bauten. Einige dieser Bauten sind werden nicht mehr als Kirchen genutzt, so sind in den letzten Jahren bis 2015 30 Kirchen zur Entwidmung gelangt."},{"page_url":"https://de.wikipedia.org/wiki/Burgas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Bay_of_Burgas.jpg","page_title":"Burgas","context_page_description":"Burgas, auch Bourgas, ist mit 203.017 Einwohnern die viertgrößte Stadt Bulgariens. Die Stadt ist der Verwaltungssitz der gleichnamigen Provinz Burgas sowie der Gemeinde Burgas. Als Industrie- und Hafenstadt ist sie das wirtschaftliche, kulturelle und politische Zentrum des gesamten Südostens von Bulgarien.\\nWestlich der Stadt ist mit LUKoil Neftochim die größte Erdölraffinerie Südosteuropas und der größte Arbeitgeber Bulgariens angesiedelt. Durch die gute Verkehrsanbindung auf Straßen, Schienen und Gewässern ist Burgas einer der wichtigsten Verkehrsknotenpunkte des Landes. Der Hafen Burgas ist der größte Hafen und einzige Rohölhafen Bulgariens sowie der Heimathafen der bulgarischen Übersee-Fischfangflotte, der Schwarzmeermarine und der Küstenwache. Die Stadt ist das Zentrum der bulgarischen Fischfang- und Fischverarbeitungsindustrie. Der Flughafen Burgas ist nach dem Flughafen Sofia der meistfrequentierte Flughafen Bulgariens.\\nBurgas ist eine touristisch überregional bekannte Stadt."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Pray_(Piemonte)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Pray_panorama_sfondo_monte_barone.jpg","page_title":"Pray (Piemonte)","context_page_description":"Pray sī Italia Piemonte toā-khu Biella Séng ê chi̍t ê comune."},{"page_url":"https://en.wikipedia.org/wiki/Strawbery_Banke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/StrawberyBankeEntrance.jpg","page_title":"Strawbery Banke","context_page_description":"Strawbery Banke is an outdoor history museum located in the South End historic district of Portsmouth, New Hampshire. It is the oldest neighborhood in New Hampshire to be settled by Europeans, and the earliest neighborhood remaining in the present-day city of Portsmouth. It features more than 37 restored buildings built between the 17th and 19th centuries in the Colonial, Georgian, and Federal style architectures. The buildings once clustered around a waterway known as Puddle Dock, which was filled in around 1900. Today the former waterway appears as a large open space."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%92%D7%9C%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Windmill_and_Cart.JPG","page_title":"עגלה","context_page_description":"עגלה היא אמצעי תחבורה ללא יכולת הנעה עצמית, המיועד לגרירה על ידי אדם, בהמה, או רכב ממונע. לעגלות יש בדרך כלל שניים עד ארבעה גלגלים והן מיועדת לנשיאת משאות כבדים ונוסעים."},{"page_url":"https://ru.wikipedia.org/wiki/Nissan_Xterra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Nissan_XTerra_XE_2001_%2810392813403%29.jpg","page_title":"Nissan Xterra","context_page_description":"Nissan Xterra — автомобиль SUV, выпускавшийся компанией Nissan Motors в двух поколениях, и построенный на платформе Nissan F-Alpha, совместно с пикапом Nissan Frontier.\\nНазвание Xterra происходит от одноименных соревнований XTERRA по триатлону, проводимых под эгидой компании Nissan с 1998 по 2006 годы."},{"page_url":"https://en.wikipedia.org/wiki/Sheikh_Zayed_Cricket_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Sheikh_Zayed_Cricket_Stadium_Abudhabi_UAE_-_panoramio.jpg","page_title":"Sheikh Zayed Cricket Stadium","context_page_description":"The Sheikh Zayed Stadium is a cricket ground located in Abu Dhabi, United Arab Emirates. The stadium cost $23 million to build and was opened in May 2004, with its inaugural first-class match being an Intercontinental Cup fixture between Scotland and Kenya in November of that year.\\nThe stadium has a large stand at either end, with the areas square of the wicket offering grass banks for additional seating. It can hold 20,000 people."},{"page_url":"https://nl.wikipedia.org/wiki/Kopstal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Map_Kopstal.PNG","page_title":"Kopstal","context_page_description":"Kopstal is een gemeente in het Luxemburgse Kanton Capellen. De gemeente heeft een totale oppervlakte van 7,9 km² en telde 3102 inwoners op 1 januari 2007."},{"page_url":"https://ca.wikipedia.org/wiki/El_Hajeb","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/El_Hajeb_Lac_%28Maroc%29.JPG","page_title":"El Hajeb","context_page_description":"El Hajeb és un municipi de la província d'El Hajeb de la regió de Fes-Meknès. Segons el cens de 2014 tenia una població total de 35.282 persones."},{"page_url":"https://hr.wikipedia.org/wiki/Komska_pokrajina","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Qom-map-notext.PNG","page_title":"Komska pokrajina","context_page_description":"Komska pokrajina je jedna od 31 iranske pokrajine. Smještena je na sjevernom dijelu zemlje, a omeđena je Teheranskom pokrajinom na sjeveru, Semnanskom pokrajinom na istoku, Isfahanskom pokrajinom na jugu, te Markazijem na zapadu. Komska pokrajina ima površinu od 11.526 km², a prema popisu stanovništva iz 2006. godine u njoj je živjelo 1,064.546 stanovnika. Sjedište pokrajine smješteno je u gradu Komu."},{"page_url":"https://ca.wikipedia.org/wiki/Bob_Jungels","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bob_Jungels-Toscana_2013.jpg","page_title":"Bob Jungels","context_page_description":"Bob Jungels és un ciclista luxemburguès, professional des del 2013. Actualment corre a l'equip Quick-Step Floors. Com a ciclista amateur destaca la seva victòria al Campionats del món júnior en contrarellotge del 2010 que es van disputar a Offida, Itàlia. Com a professional ha guanyat diversos campionats nacionals i sobretot la Lieja-Bastogne-Lieja de 2018."},{"page_url":"https://de.wikipedia.org/wiki/Schmalfl%C3%BCgelige_Bandeule","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Noctua_orbona.jpg","page_title":"Schmalflügelige Bandeule","context_page_description":"Die Schmalflügelige Bandeule, auch Graubraune Bandeule, Kleine Bandeule, Heckenkräuterflur-Bandeule oder Trockenwald-Bandeule genannt, ist ein Schmetterling aus der Familie der Eulenfalter."},{"page_url":"https://de.wikipedia.org/wiki/T%C3%A4uffelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/2012-05-26-Seeland_%28Foto_Dietrich_Michael_Weidmann%29_295.JPG","page_title":"Täuffelen","context_page_description":"Täuffelen ist eine politische Gemeinde im Verwaltungskreis Seeland des Kantons Bern in der Schweiz."},{"page_url":"https://es.wikipedia.org/wiki/Luisa_de_Orleans","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Louise_of_France_Princess_of_Bourbon.jpg","page_title":"Luisa de Orleans","context_page_description":"Luisa Francisca María Laura de Orleáns ​ fue princesa de Orleáns por nacimiento, infanta de España por concesión del rey Alfonso XIII y princesa de Borbón por matrimonio. Es la abuela materna del rey Juan Carlos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Image-ZeyrekCamii20061230_02.jpg","page_title":"История Константинополя","context_page_description":"История Константино́поля охватывает период от освящения в 330 году города, ставшего новой столицей Римской империи, до его захвата османами в 1453 году.\\nПостроенный фактически заново на месте античного Виза́нтия, благодаря гигантским по масштабам тех времён строительным работам, стремительному росту населения, развитию торговли и ремёсел, столичному статусу и усилиям первых римских императоров Константинополь за полвека превратился в один из крупнейших городов Европы и Ближнего Востока. Богатому и процветающему «мегаполису средневековья» была уготована роль крупнейшего политического, культурного и экономического центра обширной империи, правда, стремившейся к закату. После падения в V веке Рима Константинополь стал столицей просуществовавшей около десяти веков Восточной Римской империи, которая старалась сохранить приверженность римским и эллинистическим традициям. История Константинополя византийской эпохи была наполнена бурными политическими событиями — народными восстаниями и дворцовыми интригами, убийствами императоров и сменами правящих династий, многомесячными осадами и походами против могущественных западных и восточных соседей."},{"page_url":"https://en.wikipedia.org/wiki/Cozy_MK_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/CozyIII.jpg","page_title":"Cozy MK IV","context_page_description":"The Cozy Mark IV is a 4-seat, single engine, homebuilt light aircraft designed by Nat Puffer, with parts and plans supplied by Aircraft Spruce & Specialty Co. The aircraft is built from plans using basic raw materials. It is not a kit aircraft, though many small parts are available prefabricated. The Cozy is similar in design and construction to the 2-seat Rutan Long-EZ, from which it is derived, with approval from Burt Rutan.\\nThe Cozy Mark IV utilizes foam and fiberglass sandwich construction, with foam suited to the usage, fiberglass oriented for the stresses, and epoxy to bond them together.\\nNat Puffer designed the aircraft as a high speed cross-country VFR aircraft, although many builders equip their planes with IFR capabilities."},{"page_url":"https://en.wikipedia.org/wiki/Erskine_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Erskine-bridge-south.jpg","page_title":"Erskine Bridge","context_page_description":"The Erskine Bridge is a multi span cable-stayed box girder bridge spanning the River Clyde in west central Scotland. The bridge connects West Dunbartonshire with Renfrewshire and can be used by all types of motor vehicles, cyclists and pedestrians. As well as crossing the Clyde, the bridge also crosses the Forth and Clyde Canal and the North Clyde railway line. A small part of Kilpatrick railway station is situated underneath the bridge at the north side. The bridge is part of the A898 road. On completion the bridge replaced the Erskine to Old Kilpatrick ferry service."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%84%E3%83%BC%E3%83%AB%E3%83%BB%E3%83%89%E3%83%BB%E3%83%95%E3%83%A9%E3%83%B3%E3%82%B9%E5%90%84%E9%83%A8%E9%96%80%E8%B3%9E%E5%8F%97%E8%B3%9E%E8%80%85%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Jan_Ullrich%2C_Tour_de_France_2003.jpg","page_title":"ツール・ド・フランス各部門賞受賞者一覧","context_page_description":"ツール・ド・フランス各部門賞受賞者一覧は、1903年より実施されているツール・ド・フランスのマイヨ・ジョーヌ及び、マイヨ・ブラン・ア・ポワ・ルージュ、マイヨ・ヴェール、マイヨ・ブランの各受賞者の一覧を示したものである。"},{"page_url":"https://de.wikipedia.org/wiki/Oszilloskop","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Digitaloszilloskop_Schnittstellen_IMGP1974_WP.jpg","page_title":"Oszilloskop","context_page_description":"Ein Oszilloskop ist ein elektronisches Messgerät, das in seiner bevorzugten Anwendung für eine oder mehrere elektrische Spannungen deren zeitlichen Verlauf auf einem Bildschirm sichtbar macht. Das Oszilloskop stellt einen Verlaufsgraphen in einem zweidimensionalen Koordinatensystem dar, wobei üblicherweise die x-Achse die Zeitachse ist und die y-Achse die Spannungsachse. Das so entstehende Bild wird als Oszillogramm bezeichnet.\\nEs gibt analoge und digitale Oszilloskope, wobei die analogen Geräte von den digitalen fast vollständig vom Markt verdrängt worden sind. Das Oszilloskop ist neben dem Multimeter eines der wichtigsten Messgeräte in der Elektronik und der Elektrotechnik. Der Bereich messbarer Spannungen reicht einerseits von Gleichspannung über niederfrequente Spannung, wie sie im elektrischen Versorgungsnetz auftritt, Spannung in der Tontechnik bis hin zum hochfrequenten Signal bei Radios, Fernsehern oder Computern; andererseits reicht der Bereich unter Verwendung von Standardzubehör von wenigen Millivolt bis zu einigen hundert Volt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B6%D0%B0%D0%BA%D0%BE%D0%BF%D0%BE_%D0%9F%D0%B5%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jacopo_Peri_1.jpg","page_title":"Джакопо Пери","context_page_description":"Джакопо Пери, известен с псевдонима Il Zazzerino, е италиански композитор и певец, член на Флорентийската камерáта, автор на произведения, които се считат за първата опера, която не се е съхранила, и най-старата съхранила се опера „Евридика“.\\nПери учи музика при Кристофано Малвеци във Флоренция. Работи като певец и органист в местните църкви. Служи в двора на Медичите, първо като певец, после като придворен композитор. Първите му съчинения са мадригали."},{"page_url":"https://en.wikipedia.org/wiki/England_cricket_team_Test_results_(1946%E2%80%931959)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Denis_Compton_1954.jpg","page_title":"England cricket team Test results (1946–1959)","context_page_description":"International cricket, which had been suspended since 1939 due to the Second World War, resumed in 1946. From then until the end of 1959, the England cricket team, which represented England, Scotland and Wales in Test cricket, played 115 Test matches, resulting in 45 victories, 39 draws and 31 defeats. During this period, England faced Pakistan for the first time, when they toured England in 1954. During that tour, they became the first team to win a Test match on their first visit to England. England were the dominant team in international cricket during the 1950s; they did not lose a Test series between March 1951 and December 1958, and featured an array of stars such as Colin Cowdrey, Denis Compton, Fred Trueman, Brian Statham and Jim Laker.\\nEngland faced Australia most frequently during this period—playing 35 matches against them—followed by South Africa. England won more matches than they lost against India, New Zealand and South Africa, but against Australia they won seven and lost seventeen Ashes matches, while against the West Indies they won six and lost seven. They faced newcomers Pakistan in just four matches, winning one, losing one and drawing the others."},{"page_url":"https://pt.wikipedia.org/wiki/Evgenia_Tarasova","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Evgenia_Tarasova_and_Vladimir_Morozov_at_2016-17_GP_Final_2.jpg","page_title":"Evgenia Tarasova","context_page_description":"Evgenia Maximovna Tarasova é uma patinadora artística russa. Com Vladimir Morozov ela conquistou uma medalha de prata e uma de bronze em campeonatos mundiais, duas medalhas de ouro, uma de prata e duas de bronze em campeonatos europeus e foi bicampeã do campeonato nacional russo. Nos Jogos Olímpicos de Inverno de 2018 em PyeongChang, Tarasova e Morozov receberam a medalha de prata na competição por equipes, e terminaram na quarta posição na competição de duplas."},{"page_url":"https://es.wikipedia.org/wiki/Diego_Rivera","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Fragmento_del_Mural.JPG","page_title":"Diego Rivera","context_page_description":"Diego Rivera ​ fue un destacado muralista mexicano de ideología comunista, famoso por plasmar obras de alto contenido político y social en edificios públicos. Fue creador de diversos murales en distintos puntos del ahora llamado Centro Histórico de la Ciudad de México, así como en la Escuela Nacional de Agricultura de Chapingo, ​ y en otras ciudades mexicanas, norteamericanas y sudamericanas."},{"page_url":"https://hu.wikipedia.org/wiki/Tisztvisel%C5%91telep_(Kaposv%C3%A1r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Kaposv%C3%A1r_Temesv%C3%A1r_utca.jpg","page_title":"Tisztviselőtelep (Kaposvár)","context_page_description":"Tisztviselőtelep Kaposvár egyik városrésze, mely a megyeszékhely belvárosától északra, az Északnyugati városrésztől keletre helyezkedik el. Városképi szempontból fontos része Kaposvárnak, mert villáival és fasoraival kedvező képet nyújt."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B1%CF%8C%CF%82_%CE%A0%CE%B1%CF%83%CE%BF%CF%85%CF%80%CE%B1%CF%84%CE%B9%CE%BD%CE%AC%CE%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Pashupatinath_ritesh.JPG","page_title":"Ναός Πασουπατινάθ","context_page_description":"Ο Ναός Πασουπατινάθ είναι ο ιερότερος Ινδουιστικός ναός αφιερωμένος στον Σίβα στις όχθες του ποταμού Βαγμάτι 5 χιλιόμετρα νοτιοανατολικά της Κοιλάδας του Κατμαντού στο Νεπάλ. Ο ναός συγκαταλέγεται στην λίστα Παγκόσμιας Κληρονομιάς της ΟΥΝΕΣΚΟ. Βρίσκεται χτισμένος στις όχθες του ποταμού Μπαγμάτι ο οποίος θεωρείται ιερός κατά την θρησκευτική παράδοση του Ινδουισμού. Είναι παραπόταμος του ποταμού Γάγγη. Η περιοχή χρησιμοποιόταν ως χώρος ανιμιστικής λατρείας από το 500 π.Χ. Η σημερινή μορφή του ναού χρονολογείται από ανακαίνιση μου έγινε το 18ο αιώνα και έχει αρχιτεκτονική μορφή Νεβάρ-Νεπαλέζικη.\\nΟ Ναός είναι αφιερωμένος στον θεό Σίβα ο οποίος κατά την ινδουιστική παράδοση είναι ο θεός της δημιουργίας, της καταστροφής, του καλού, του κακού, της γονιμότητας και του ασκητισμού. Στο ναό υπάρχουν πολλά λινγκάμ τα οποία οι πιστοί δείχνουν την λατρεία τους βάζοντας πάνω σε αυτά βούτυρο, γιαούρτι, γάλα, μέλι και ζάχαρη. Ο θεός Σίβα αναπαριστάται με 1008 μορφές αλλά στο Ναό αυτό λατρεύεται με την μορφή \\"Πασουπατινάθ\\". Η αναπαράσταση του Σίβα ως \\"Πασουπατινάθ\\" θεωρείται αρχηγός όλως των θηρίων και προστάτης του Νεπάλ."},{"page_url":"https://ht.wikipedia.org/wiki/Cem_Adrian","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Cem_Adrian.jpg","page_title":"Cem Adrian","context_page_description":"Cem Adrian, ki fèt 30 novanm 1980 nan Edirne, se yon chantè, otè-konpozitè-entèprèt, pwodiktè ak reyalizatè tik."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%86%D8%AF%D8%B1%D9%8A%D9%87_%D8%A8%D8%A7%D9%88%D8%B1_(%D8%B3%D9%8A%D8%A7%D8%B3%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/AndreBauerProfile.jpg","page_title":"أندريه باور (سياسي)","context_page_description":"أندريه باور ‏ هو سياسي أمريكي، ولد في 20 مارس 1969 بتشارلستون في الولايات المتحدة. حزبياً، نشط في الحزب الجمهوري. وقد انتخب عضو مجلس نواب كارولاينا الجنوبية وانتخب عضو مجلس ولاية كارولاينا الجنوبية وانتخب list of lieutenant governors of South Carolina."},{"page_url":"https://de.wikipedia.org/wiki/Georg_Wilhelm_Wilhelmy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Mittelnkirchen_Orgel_%281%29.jpg","page_title":"Georg Wilhelm Wilhelmy","context_page_description":"Georg Wilhelm Wilhelmy war ein deutscher Orgelbauer, der anfangs in Nordhessen und dann von 1781 bis 1806 in Stade tätig war."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8F%AC%ED%86%A0%EB%9D%BC%EC%9D%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/PLIcon.png","page_title":"포토라인","context_page_description":"포토라인은 윈도우 및 macOS용 래스터 및 벡터 그래픽스 편집기이다. 기능으로는 16비트 색 깊이, 풀 컬러 관리, 또 RGB, CMYK, Lab 색 모델의 지원, 레이어 지원, 손상 없는 이미지 조작을 포함한다. 탁상출판을 위해 사용할 수도 있다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D0%B6%D0%BD%D1%8F%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Vyzhnyany-2.jpg","page_title":"Выжняны","context_page_description":"Выжняны — село в Золочевском районе Львовской области Украины.\\nНаселение по переписи 2001 года составляло 333 человека. Занимает площадь 1,66 км². Почтовый индекс — 80724. Телефонный код — 3265."},{"page_url":"https://hu.wikipedia.org/wiki/S%C3%A3o_Paulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Mapa_de_S%C3%A3o_Paulo_%282%29.png","page_title":"São Paulo","context_page_description":"São Paulo Brazília legnépesebb, közel 12 millió lakosú városa, São Paulo szövetségi állam székhelye. Brazília délkeleti részén, a Tiête-, a Pinheiros- és a Tamanduatei-folyó medencéjében, a tengerparttól 60 km-re, tengerszint fölött 800 m-en fekszik a Baktérítő szélességén. A januári középhőmérséklet 23,6 °C, a júliusi 16 °C, az évi átlagos csapadék 1740 mm.\\nSão Paulo a Déli félgömb legnépesebb városa, a világ legnagyobb olyan városa ahol a portugál a hivatalos nyelv. A város és az azt körbevevő Sao Paulo állam az ország legnépesebb és legtöbb jövedelemmel rendelkező szövetségi állama.\\nA város nagyvárosi övezete, a Nagy São Paulo Brazília legnagyobb ilyen övezete, 23.5 millió lakossal rendelkezik. A konurbációs folyamatoknak köszönhetően ma már egy másik övezetről, a São Paulo-i Makrómetropoliszról is szokás beszélni. Ez a városhalmaz a világ egyik legnépesebb nagyvárosi övezete.\\nA város olyan nemzetközi eseményeknek ad otthont mint a São Paulo Jazz Festival, São Paulo Biennial, Formula–1 brazil nagydíj, São Paulo Divathét. Ez utóbbi népszerűségét és fontosságát tekintve a világ ötödik legnagyobb divathete."},{"page_url":"https://en.wikipedia.org/wiki/Trubchevsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Trubc_Boyan.JPG","page_title":"Trubchevsk","context_page_description":"Trubchevsk is a town and the administrative center of Trubchevsky District in Bryansk Oblast, Russia, located about 95 kilometers south of the city of Bryansk, the administrative center of the oblast. Population: 15,014; 16,342; 16,301."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%97%E1%83%94%E1%83%A6%E1%83%94%E1%83%9C%E1%83%98%E1%83%A5%E1%83%98%E1%83%A1_%E1%83%AC%E1%83%9B%E1%83%98%E1%83%9C%E1%83%93%E1%83%90_%E1%83%9B%E1%83%9D%E1%83%AC%E1%83%90%E1%83%9B%E1%83%94%E1%83%97%E1%83%90_%E1%83%A1%E1%83%90%E1%83%99%E1%83%90%E1%83%97%E1%83%94%E1%83%93%E1%83%A0%E1%83%9D_%E1%83%A2%E1%83%90%E1%83%AB%E1%83%90%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Holy_Martyrs_Church%2C_Teghenik%2C_Armenia_%282013%29.jpg","page_title":"თეღენიქის წმინდა მოწამეთა საკათედრო ტაძარი","context_page_description":"თეღენიქის წმინდა მოწამეთა საკათედრო ტაძარი — სომხური ეკლესია, რომელიც მდებარეობს სომხეთის კოტაიქის პროვინციაში, სოფელ თეღენიქში.\\nაშენდა XXI საუკუნეში. ეკლესია გაიხსნა 2003 წელს. მშენებლობა დაიწყო 2000 წელს და დასრულდა 2003 წელს. ტაძარი სომხეთის მოქმედმა კათოლიკოსმა - გარეგინ II-მ აკურთხა."},{"page_url":"https://vec.wikipedia.org/wiki/Poisson","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/%C3%89glise_St_Jean_Baptiste_Poisson_Sa%C3%B4ne_Loire_24.jpg","page_title":"Poisson","context_page_description":"Poisson el xé on comun de 567 abitanti del departemento de Saône-et-Loire che el fa parte del rejon Bourgogne-Franche-Comté in Fransa."},{"page_url":"https://en.wikipedia.org/wiki/1953","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Sagarmatha_ck_Oct18_2002.jpg","page_title":"1953","context_page_description":"1953 was a common year starting on Thursday of the Gregorian calendar, the 1953rd year of the Common Era and Anno Domini designations, the 953rd year of the 2nd millennium, the 53rd year of the 20th century, and the 4th year of the 1950s decade."},{"page_url":"https://id.wikipedia.org/wiki/Stadion_San_Mam%C3%A9s_(2013)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/San_Mam%C3%A9s_en_construcci%C3%B3n.jpg","page_title":"Stadion San Mamés (2013)","context_page_description":"San Mamés adalah sebuah stadion sepak bola bertempat duduk di Bilbao, Negeri Basque, Spanyol. Diresmikan pada 16 September 2013, stadion ini menggantikan San Mamés \\"lama\\" sebagai markas Athletic Bilbao."},{"page_url":"https://ja.wikipedia.org/wiki/2020%E5%B9%B4%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E5%A4%A7%E7%B5%B1%E9%A0%98%E9%81%B8%E6%8C%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Hawkins_2010_%281%29.jpg","page_title":"2020年アメリカ合衆国大統領選挙","context_page_description":"2020年アメリカ合衆国大統領選挙は、2020年11月3日に実施予定のアメリカ合衆国大統領・副大統領を選出するための選挙である。"},{"page_url":"https://en.wikipedia.org/wiki/Heckler_%26_Koch_P9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/P9S_9mm_caliber.jpg","page_title":"Heckler & Koch P9","context_page_description":"The HK P9 is a semi-automatic pistol from Heckler & Koch in 9×19mm Parabellum and the first to use a variation of H&K's roller delayed blowback system in a pistol format and polygonal rifling now common in H&K designs. Design began around 1965 and production ran between 1969 and 1978. Only 485 single-action P9's were produced and were discontinued in 1970. A traditional double action version, the P9S was manufactured in greater numbers."},{"page_url":"https://it.wikipedia.org/wiki/Rappresentanti_della_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Richard_T_Hanna.png","page_title":"Rappresentanti della California","context_page_description":null},{"page_url":"https://nl.wikipedia.org/wiki/V%C3%AFktor_Ok%C3%AF%C5%9Fev","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Viktor_Okishev_-_stage_3_-_Tour_de_l%27Ain_2014.JPG","page_title":"Vïktor Okïşev","context_page_description":"Vïktor Okïşev is een Kazachs wielrenner die anno 2018 rijdt voorVino-Astana Motors."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Vriezenveen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Flag_of_Vriezenveen.png","page_title":"Vriezenveen","context_page_description":"Vriezenveen sī Hô-lân Overijssel séng Twenterand chū-tī-thé lāi-bīn ê chi̍t ê chng-thâu."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%B8%D6%80%D5%B8%D5%A4%D5%A5%D6%81%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Coat_of_Arms_of_Gorodets_%28Nizhny_Novgorod%29.png","page_title":"Գորոդեցկի շրջան","context_page_description":"Գորոդեցկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Նիժնի Նովգորոդի մարզում։\\nՍտեղծվել է 1929 թվականին։ Վարչական կենտրոնը՝ Գորոդեց։"},{"page_url":"https://en.wikipedia.org/wiki/Kars_Oblast","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Karsprorro.png","page_title":"Kars Oblast","context_page_description":"Kars Oblast was one of the oblasts of the Caucasus Viceroyalty of the Russian Empire between 1878 and 1917. Its capital was the city of Kars, presently in the Republic of Turkey. The governorate bordered with the Ottoman Empire, Batum Oblast, Tiflis Governorate, Erivan Governorate, and from 1883 to 1903 the Kutais Governorate. It covered all of Turkey's present provinces of Kars and Ardahan and the northeastern part of Erzurum Province as well as a small part of Armenia."},{"page_url":"https://ceb.wikipedia.org/wiki/Belfaux_(lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Belfaux.JPG","page_title":"Belfaux (lungsod)","context_page_description":"Lungsod ang Belfaux sa Nasod nga Swiss. Nahimutang ni sa distrito sa Sarine District ug kanton sa Canton de Fribourg, sa kasadpang bahin sa nasod, 29 km sa habagatan-kasadpan sa Bern ang ulohan sa nasod. 584 metros ibabaw sa dagat kahaboga ang nahimutangan sa Belfaux, ug adunay 2,286 ka molupyo.\\nAng yuta palibot sa Belfaux kay kabungtoran sa kasadpan, apan sa sidlakan nga kini mao ang patag. Kinahabogang dapit sa palibot ang Käsenberg, 1,633 ka metros ni kahaboga ibabaw sa dagat, 15.6 km sa habagatan sa Belfaux. Dunay mga 111 ka tawo kada kilometro kwadrado sa palibot sa Belfaux medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Fribourg, 4.0 km sa habagatan-sidlakan sa Belfaux. Hapit nalukop sa kaumahan ang palibot sa Belfaux. Sa rehiyon palibot sa Belfaux, mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 1,471 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 188 milimetro nga ulan, ug ang kinaugahan Marso, sa 45 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Toronto_and_York_Radial_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Toronto_and_York_Radial_Railway_vehicle%2C_circa_1921.jpg","page_title":"Toronto and York Radial Railway","context_page_description":"The Toronto and York Radial Railway was a transit operator providing services to the suburbs of Toronto, Ontario, Canada. It was a subsidiary of the Toronto Railway Company. The company was created by merging four Toronto-area railway operations. The company was part of the empire of railway entrepreneurs Sir William Mackenzie and Donald Mann which included the Canadian Northern Railway and the parent Toronto Railway Company."},{"page_url":"https://eo.wikipedia.org/wiki/Skur%C4%9Dado_de_Kristo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Jesus_in_Golgotha_by_Theophanes_the_Cretan.jpg","page_title":"Skurĝado de Kristo","context_page_description":"La skurĝado de Kristo estas epizodo de la vivo de Jesuo kiel raportata de la Evangelioj.\\nLa skurĝado estas batado aparte sanga, pere de bastonoj, vergoj aŭ kato je naŭ vostoj. Tiu lasta konsistis, laŭ la romia tipologio, el bastono al kiu estis ligitaj diversaj laĉoj finigantaj per metalaj krifoj, plombaĵoj kaj ostaj splitoj kiuj estigis doloregajn ŝiraĵojn kaj ostorompojn al la torturito."},{"page_url":"https://et.wikipedia.org/wiki/Mask","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Speedglas.jpg","page_title":"Mask","context_page_description":"Mask on ese, mida tavaliselt hoitakse näo ees kaitse-, varje-, moondamis-, rituaal-, esinemis- või meelelahutuseesmärgil.\\nMaskid on ajaloo vältel kogu maailmas olnud väga tähtsad rituaalide läbiviimisel. Koos näitekunsti arenemisega rituaalidest said maskid ka oluliseks teatri osaks. Naervast ja nutvast maskist on saanud teatri ja näitekunsti sümbol. Rituaalsed ja teatris kasutatavad maskid on näokatted, mille eesmärk on muuta kandja mittetuntavaks või teha ta teatud inimese või olendi näoliseks."},{"page_url":"https://en.wikipedia.org/wiki/Catholic_Church_in_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/CatholicDiocesesPoland2004Numbered.svg","page_title":"Catholic Church in Poland","context_page_description":"There are 41 Catholic dioceses of the Latin Church and two eparchies of the Eastern Churches in Poland. These comprise about 10,000 parishes and religious orders. There are 33 million Catholics. The primate of the Church is Wojciech Polak, Archbishop of Gniezno. According to 2015 demographics, 92.9% of Poland's population is Roman Catholic."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BC%9A%E6%B4%A5%E4%B8%AD%E5%A4%AE%E7%97%85%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Aidu_Chuo_Hospital.JPG","page_title":"会津中央病院","context_page_description":"会津中央病院は、福島県会津若松市にある医療機関。一般財団法人温知会が運営する病院である。救命救急センターを持ち、会津地方の三次救急医療を担うほか、会津医療圏の災害拠点病院、地域がん診療連携拠点病院、エイズ治療拠点病院などの指定を受ける。運営母体の一般財団法人温知会は、猪苗代町立猪苗代病院の指定管理者である。"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%96%E0%A4%BE%E0%A4%B0%E0%A5%8D%E0%A4%95%E0%A5%80%E0%A4%B5%E0%A5%8D%E0%A4%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Dinamovskaya_street.jpg","page_title":"खार्कीव्ह","context_page_description":"खार्कीव्ह हे युक्रेन देशामधील दुसर्‍या क्रमांकाचे मोठे शहर आहे. युक्रेनच्या ईशान्य भागात रशियाच्या सीमेजवळ वसलेले खार्कीव्ह शहर ह्याच नावाच्या ओब्लास्तचे मुख्यालय देखील आहे.\\nइ.स. १६५४ साली स्थापण्यात आलेले खार्कीव्ह शहर रशियन साम्राज्यामधील एक बलाढ्य स्थान होते. सोव्हियेत संघाच्या युक्रेनियन सोव्हियेत साम्यवादी गणराज्याची निर्मिती खार्कीव्ह येथेच झाली व १९३४ सालापर्यंत सोव्हियेत युक्रेनची राजधानी खार्कीव्हमध्ये होती. सध्या खार्कीव्ह हे युक्रेनमधील सांस्कृतिक, शैक्षणिक व संशोधन केंद्र आहे."},{"page_url":"https://it.wikipedia.org/wiki/Doksy_(Liberec)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Doksy.jpg","page_title":"Doksy (Liberec)","context_page_description":"Doksy è una città della Repubblica Ceca facente parte del distretto di Česká Lípa, nella regione di Liberec."},{"page_url":"https://ca.wikipedia.org/wiki/B%C3%BAnquer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/B%C3%BAnquerPirineu.JPG","page_title":"Búnquer","context_page_description":"Un búnquer és una obra d'enginyeria militar feta de formigó armat amb una funció defensiva. Abans de la utilització del formigó com a matèria principal, es parlava de casamates. N'hi ha de diverses tipus: construccions petites de les quals es podia protegir instal·lacions estratègiques com ports, cruïlles, estacions fins a llargues infraestructures quasi ciutats subterrànies que havien de protegir un estat major d'un país durant atacs de llarga durada. Un dels búnquers més famosos de la història de la segona Guerra Mundial va ser el d'Adolf Hitler sota la cancelleria a Berlín.\\nA Catalunya destaquen els centenars de búnquers repartits en 96 nuclis de resistència repartits pel Pirineu, del Cap de Creus a la Vall d'Aran, que entre 1944 i 1955 va construir l'exèrcit espanyol a fi de combatre una eventual invasió aliada o del maquis que pogués enderrocar la dictadura del General Franco. Recentments s'ha condicionat Parc dels Búnquers de Montellà i Martinet.\\nL'expressió búnquer Barraqueta s'utilitza al País Valencià per a designar \\"els sectors considerats més integristes i, àdhuc, involucionistes de la societat valenciana\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Cimeti%C3%A8re_d%27Alma%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D1%98%D0%B5%D0%B2%D0%B8%D1%9B_%D0%9C%D0%B8%D1%88%D0%B0.JPG","page_title":"Cimetière d'Almaš","context_page_description":"Le cimetière d'Almaš est un cimetière orthodoxe situé à Novi Sad, la capitale de la province autonome de Voïvodine, en Serbie. En raison de sa valeur patrimoniale, il est inscrit sur la liste des entités spatiales historico-culturelles de grande importance de la République de Serbie ; 30 tombes de personnalités historiques, culturelles et autres sont plus particulièrement inscrites sur la liste des monuments culturels protégés."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D1%81-%D0%90%D0%BD%D0%B4%D0%B6%D0%B5%D0%BB%D0%B5%D1%81_%D0%9B%D0%B5%D0%B9%D0%BA%D0%B5%D1%80%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Magic_Lipofsky.jpg","page_title":"Лос-Анджелес Лейкерс","context_page_description":"«Лос-Анджелес Лейкерс» — американский профессиональный баскетбольный клуб из Лос-Анджелеса, штата Калифорния, выступающий в Тихоокеанском дивизионе Западной конференции, в Национальной баскетбольной ассоциации. Домашние игры проводит в «Стэйплс Центр», где также играет ближайший соперник по лиге «Лос-Анджелес Клипперс» и команда НХЛ «Лос-Анджелес Кингз», также помимо них здесь играет женская команда WNBA «Лос-Анджелес Спаркс». «Лос-Анджелес Лейкерс» одна из самых титулованных команд НБА, у них 16 чемпионств, после 2010 года. По состоянию на 2012 год, Лейкерс являются наиболее дорогостоящей командой НБА по данным Forbes, с оценочной стоимостью $ 900 млн.\\nКлуб был основан в 1946 году, в Детройте под названием «Детройт Джемс» и выступал в НБЛ. Через год команда переехала в Миннеаполис, штат Миннесота. Сменив название на «Миннеаполис Лейкерс», в честь прозвища штата, где базировалась команда. В Миннеаполисе «Лейкерс» выиграли 5 чемпионских титулов. Центровой той команды Джордж Майкен, впоследствии был признан главной звездой за всю историю НБА, на официальном сайте лиги."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B7%BA%E9%96%93%E8%99%9F%E8%A3%9D%E7%94%B2%E5%B7%A1%E6%B4%8B%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Japanese_cruiser_Asama_in_1901.jpg","page_title":"淺間號裝甲巡洋艦","context_page_description":"浅间号装甲巡洋舰是旧日本海军的一等巡洋舰，为浅间级装甲巡洋舰的首舰。由于当时的日本尚缺乏建造装甲巡洋舰的工业能力，本舰为日本向英国订购、由英国阿姆斯特朗-惠特沃斯公司建造。浅间号是日本六六舰队计划中所要求的最早一批装甲巡洋舰，参加了日俄战争中的诸多海战。\\n本舰舰名来源于群马县与长野县之间的浅间山，是日本海军中第二艘使用“浅间”这个名字的军舰。初代浅间号为明治初期的一艘护卫舰。"},{"page_url":"https://fr.wikipedia.org/wiki/McDonnell_Douglas_CF-18_Hornet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Canadian_CF-18_Hornet_escorts_Soviet_Tupolev_Tu-95_in_1987.jpg","page_title":"McDonnell Douglas CF-18 Hornet","context_page_description":"Le McDonnell Douglas CF-18 Hornet, officiellement appelé CF-188, est un avion de combat multirôle dérivé du McDonnell Douglas F/A-18 Hornet et utilisé par l'Aviation royale canadienne.\\nIl comporte deux variantes :\\nLe CF-18A : monoplace, attaque air ou sol. Désignation canadienne : CF-188A.\\nLe CF-18B : biplace d'entraînement. Désignation canadienne : CF-188B."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Expression_of_the_Emotions_Figure_20.png","page_title":"பயம்","context_page_description":"பயம் என்பது அச்சத்தை வெளிப்படுத்தும் ஒரு உணர்ச்சிவயப்பட்ட வெளிப்பாடாகும். இதன் அடிப்படை வழிமுறையானது வலி அல்லது ஆபத்தின் அச்சுறுத்தல் போன்ற பிரத்யேகத் தூண்டலின் மூலமாக விளைகிறது. பயம் என்பது அடிப்படையான அல்லது உள்ளார்ந்த மன உணர்வுகளின் வெளிப்பாடுகளில் ஒன்றாக உள்ளது என ஜான் பீ. வாட்சன், பிரெட்டஸ்-மெஹல்ஹெஸ், ராபர்ட் ப்லட்சிக் மற்றும் பால் எக்மன் போன்ற சில உளவியலாளர்கள் கூறுகின்றனர். மகிழ்ச்சி, துக்கம் மற்றும் கோபம் போன்ற மன உணர்ச்சிகளும் இந்த வெளிப்பாடுகளில் அடங்கியுள்ளன. பயம் கண்டிப்பாக மனக்கலக்கம் தொடர்பான உணர்ச்சிவயப்பட்ட நிலையில் இருந்து தனிப்பட்டு இருக்க வேண்டும். குறிப்பாக மனக்கலக்கம் என்பது வெளிப்புற அச்சுறுத்தல் ஏதும் இல்லாமல் ஏற்படக்கூடியதாகும். மேலும் பயமானது தப்பித்துக்கொள்ளல் மற்றும் தவிர்த்தல் போன்ற பிரத்யேக நடத்தைகளை ஒத்துள்ளது. ஆதலால் மனக்கலக்கம் என்பது கட்டுப்படுத்த முடியாத அல்லது தவிர்க்க முடியாத ஒன்றாக உணரக்கூடிய அச்சுறுத்தல்களின் விளைவாக ஏற்படுகிறது. பயம் என்பது மோசமானச் சூழல் அல்லது தொடரும் ஏற்கமுடியாதச் சூழல் போன்ற பெரும்பாலும் வருங்கால நிகழ்வுகளை எண்ணியே ஏற்படுகிறது என்பது குறிப்பிடத்தக்கதாகும். பயமானது சிறிது நேரத்தில் நடக்கவிருக்கும் ஏதாவது ஒரு விசயத்திற்கான உடனடி சலனம் ஆகும்."},{"page_url":"https://de.wikipedia.org/wiki/Wandereisen-Holzschnitte_von_1523","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/1481_Kasimir.jpg","page_title":"Wandereisen-Holzschnitte von 1523","context_page_description":"Die Wandereisen-Holzschnitte von 1523 umfassen 23 Holzschnitte des Kriegsberichterstatters Hans Wandereisen. Im Jahr 1523 zerstörten in ihrer Stärke deutlich überlegene Truppen des Schwäbischen Bundes, der aus fränkischen und schwäbischen Reichsständen bestand, insgesamt 23 sogenannte Raubnester, deren Besitzer dem Hans Thomas von Absberg bei der Entführung und Lösegelderpressung von vorwiegend Nürnberger und Augsburger Kaufleuten bis hin zu kaiserlichen Diplomaten geholfen hatten.\\nGeorg Truchsess von Waldburg-Zeil war Oberbefehlshaber des Schwäbischen Bundes, Hauptmann der berittenen Truppen war Rudolf von Ehingen und Hauptmann des Fußvolkes Jakob von Wernau. Um den einfachen Leuten, die meistens nicht lesen konnten, von den Erfolgen zu berichten, reiste Hans Wandereisen mit und fertigte Holzschnitte von den brennenden Burgen an.\\nDiese sind für die Heimatforschung heute bedeutend, da sie den Zustand der Burgen darstellen bevor einige gesprengt wurden, um eine Rückkehr der Eigentümer zu verhindern. Die Ereignisse werden auch als Teil des Fränkischen Krieges bzw. der Absberger Fehde bezeichnet.\\nDie Holzschnitte sind in drei Fassungen bekannt."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%95%D7%9C%D7%9D_%D7%92%27%D7%90%D7%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Blues_scale_variation_of_major_scale.png","page_title":"סולם ג'אז","context_page_description":"סולם ג'אז הוא כל סולם מוזיקלי שנעשה בו שימוש במוזיקת ג'אז. הרבה \\"סולמות ג'אז\\" הם סולמות נפוצים שמקורם במוזיקה הקלאסית, כולל הדיאטוני, סולם הטונים השלמים, הסולם האוקטטוני והמינור המלודי. כל הסולמות האלה היו בשימוש נפוץ בסוף המאה ה-19 ובתחילת המאה ה-20 על ידי מלחינים כגון רימסקי-קורסקוב, דביסי, ראוול וסטרווינסקי, לעיתים קרובות באופנים דומים מאוד לאלה ששימשו מאוחר יותר במוזיקת הג'אז. סולמות ג'אז מסוימים, כגון סולם הביבופ, נוצרים על ידי הוספת צלילים עוברים כרומטיים לצלילי סולם דיאטוני מוכר.\\nאחת התכונות החשובות של הג'אז היא מה שתאורטיקנים מכנים \\"תאימות אקורד-סולם\\": הרעיון כי רצף אקורדים יוצר רצף תואם של סולמות. במוזיקה הקלאסית, האקורדים בדרך כלל שייכים לסולם בו כתובה היצירה. בג'אז, לעומת זאת, מהלך הרמוני המורכב מארבעה אקורדים עשוי לעשות שימוש בארבעה סולמות שונים, לעיתים קרובות כתוצאה של אלטרציות שונות. לדוגמה, בסולם דו מז'ור, מלחין ג'אז עשוי לשנות את האקורד V באמצעות הנמכת הדרגה החמישית ♭. המאלתר יכול לבחור סולם המכיל את ארבעת התווים הללו, כגון סולם הטונים השלמים, סולם אוקטטוני, רה מינור מלודי או לה♭ מינור מלודי. בכל אחד מהמקרים הללו, הסולם מכיל את צלילי האקורד סול-סי-רה♭-פה, ולכן הוא \\"מתאים\\" לאקורד."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%83%BC%E3%83%90%E3%83%BC%E3%83%88%E3%83%BB%E3%82%AA%E3%83%BC%E3%82%A8%E3%83%B3%E3%83%BB%E3%83%AA%E3%83%BC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/H._Owen_Reed.jpg","page_title":"ハーバート・オーエン・リード","context_page_description":"ハーバート・オーエン・リードは、アメリカ合衆国の作曲家、指揮者。"},{"page_url":"https://ast.wikipedia.org/wiki/Enfermed%C3%A1_pol_virus_del_%C3%89bola","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Ebola-sudan_chart.jpg","page_title":"Enfermedá pol virus del Ébola","context_page_description":"La enfermedá pol virus del Ébola o fiebre hemorráxico del Ébola, tamién conocida como enfermedá del Ébola o a cencielles como ébola, ye una enfermedá causada nel ser humanu pol virus del Ébola. De normal los síntomes empiecen ente los dos díes y los trés selmanes dempués de contraer el virus, con fiebre, dolor de gargüelu, dolores musculares, y dolor de cabeza. Polo xeneral, siguen estomagaes, vultures, y foria, xuntu con fallu hepáticu y renal. Nesi momentu, dellos pacientes empiecen a sufrir entueyos hemorráxiques.\\nEl virus puede contraer por contautu cola sangre o los fluyíos corporales d'animales infectaos. Nun s'hai documentáu la tresmisión aérea na redolada natural. Créese que los esperteyos de la fruta son portadores del virus y pueden arimalo ensin resultar afeutaos. Una vegada qu'un ser humanu resulta infectáu, la enfermedá tamién puede arimase ente persones. Los sobrevivientes de xéneru masculín pueden tresmitir la enfermedá al traviés del semen hasta per añu y mediu. Col fin d'establecer un diagnósticu, polo xeneral refúguense antes otres enfermedaes con síntomes asemeyaos, como la malaria, el roxura y otres fiebres hemorráxiques virales."},{"page_url":"https://it.wikipedia.org/wiki/Le_genovesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Maria_Pellegrina_Amoretti.jpg","page_title":"Le genovesi","context_page_description":"Le genovesi, con sottotitolo Streghe, sante, prostitute, schiave, muse ed eroine, è il titolo di un saggio scritto da Luca Ponte e pubblicato nel 2008 dalla Fratelli Frilli Editori di Genova. In prima edizione è stato pubblicato nel 2004 all'interno della collana Xenos.\\nIl libro consta di nove capitoli incluso quello finale dedicato a proverbi in lingua ligure sulle donne, ed è corredato da un'appendice con un repertorio di nomi di donne genovesi d'epoca contemporanea oltre che da un indice delle liguri citate nel testo.\\nLa navigazione attraverso il testo, ordinato tematicamente, consente una ricostruzione, sia pure parziale, della storia di Genova o, quantomeno, di alcuni suoi costumi, come ad esempio l'applicazione di una gabella sul meretricio istituita nella Repubblica all'inizio del XV secolo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82%D0%BE%D0%B2_%D1%80%D0%B0%D0%B1%D0%BE%D1%82%D1%8B_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B0_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87%D0%B0_%D0%A1%D0%B5%D1%80%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Portrait_of_Countess_Varvara_Musina-Pushkina.jpg","page_title":"Список портретов работы Валентина Александровича Серова","context_page_description":"Список портретов работы Валентина Александровича Серова включает перечисление живописных и графических работ в портретном жанре, созданных художником.\\nПортретный жанр являлся специализацией художника, и именно к нему принадлежит подавляющее большинство созданных мастером работ. Произведения эти, помимо техники, делятся по типу моделей. Наиболее роскошными, красочными и обычно крупноразмерными из них являются парадные «заказные портреты», которые Валентин Серов писал с представителей российской императорской фамилии, аристократии, купечества и интеллигенции — за гонорары. Другую группу портретов составляют изображения друзей и знакомых Серова, представителей круга интеллигенции, писатели, актёры, певцы — они отличаются более камерным характером. К этой же группе относятся портреты членов семьи Саввы Мамонтова — покровителя художника. Наконец, третьей, наиболее интимной группой изображений являются портреты членов семьи Серова, включая его кузенов Симоновичей-Львовых-Дервизов."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%8C%E5%A3%AB%E6%BB%A1%E5%85%AC%E5%9B%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Two_deer_at_Richmond_Park%2C_London.jpg","page_title":"里士满公园","context_page_description":"里奇蒙公園是英國倫敦的御苑之一，占地2360英畝。它是倫敦最大的皇家園林，英國第二大的有圍牆的城市公園，僅次於伯明罕的薩頓公園。里奇蒙公園內擁有超過六百隻馬鹿和黇鹿。\\n里奇蒙公園內有一些著名的建築，其中的10座建築，以及公園的全部圍牆，均為登錄建築。其中白屋為皇家芭蕾舞學校所在地，年輕的芭蕾舞學生在此進行培訓已經有多年。它最初是喬治一世的狩獵別墅。"},{"page_url":"https://ast.wikipedia.org/wiki/Nicol%C3%A1s_de_Bari","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ilja_Jefimowitsch_Repin_-_Saint_Nicholas_of_Myra_saves_three_innocents_from_death.jpg","page_title":"Nicolás de Bari","context_page_description":"San Nicolás, tamién conocíu como San Nicolás de Myra o San Nicolás de Bari foi un obispu que vivió nel sieglu IV. Más de dos mil templos tán dedicaos a él en tol mundu.\\nN'Oriente llamar Nicolás de Mira, pela ciudá onde tuvo d'obispu, pero n'Occidente llámase-y Nicolás de Bari, porque cuando'l musulmanes conquistaron Anatolia, un grupu de cristianos sacó d'ellí de callao les reliquies del santu y llevar a la ciudá de Bari, n'Italia. Nesa ciudá axudicáronse-y tan almirables milagros al reza-y a esti gran santu, qu'el so cultu aportó a por demás popular en toa Europa. Ye Patronu de Rusia, de Grecia y de Turquía. En Roma yá nel añu 550 construyéren-y un templu nel so honor.\\nEl so nome ye notable tamién fuera del mundu cristianu porque la so figura dio orixe al mitu de Santa Claus, conocíu tamién como Pá Noel."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%B6nigreich_Preu%C3%9Fen","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Prusse1740.gif","page_title":"Königreich Preußen","context_page_description":"Königreich Preußen bezeichnet den preußischen Staat zur Zeit der Herrschaft der preußischen Könige zwischen 1701 und 1918.\\nDas Königreich Preußen entstand aus den brandenburgisch-preußischen Gebieten, nachdem sich Kurfürst Friedrich III. von Brandenburg zum König in Preußen gekrönt hatte. Das Königreich bestand aus Brandenburg, das zum Heiligen Römischen Reich gehörte, und dem Herzogtum Preußen, das als polnisches Lehen aus dem Ordensstaat hervorgegangen war. Der ursprünglich preußische Teil erhielt den Namen Ostpreußen.\\nIm 18. Jahrhundert stieg Preußen zu einer der fünf europäischen Großmächte auf und wurde die zweite deutsche Großmacht nach Österreich. Seit der Mitte des 19. Jahrhunderts trieb es die Schaffung eines deutschen Nationalstaates entscheidend voran und war ab 1867 der dominierende Gliedstaat des Norddeutschen Bundes. 1871 wurde dieser Bund zum Deutschen Kaiserreich erweitert und der König von Preußen übernahm das Amt des Deutschen Kaisers. Mit der Abdankung des letzten Kaisers und Königs, Wilhelms II., infolge der Novemberrevolution 1918 wurde die Monarchie abgeschafft. Das Königreich ging im neu geschaffenen Freistaat Preußen auf."},{"page_url":"https://ceb.wikipedia.org/wiki/Calliostoma_benedicti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Calliostoma_benedicti_001.jpg","page_title":"Calliostoma benedicti","context_page_description":"Espesye sa hilahila ang Calliostoma benedicti. Una ning gihulagway ni Dall ni adtong 1889. Ang Calliostoma benedicti sakop sa kahenera nga Calliostoma sa kabanay nga Calliostomatidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A7%A8%E0%A7%A6%E0%A7%A7%E0%A7%AF%E2%80%93%E0%A7%A8%E0%A7%A6_%E0%A6%B0%E0%A7%81%E0%A6%B6_%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%AE%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%B0_%E0%A6%B2%E0%A7%80%E0%A6%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/MordoviaArenaStadium.jpg","page_title":"২০১৯–২০ রুশ প্রিমিয়ার লীগ","context_page_description":"২০১৯–২০ রুশ প্রিমিয়ার লীগ রাশিয়ার শীর্ষ স্তরের ফুটবলের ২৮তম মৌসুম এবং সোভিয়েত ইউনিয়নের পতনের পর বর্তমান রুশ প্রিমিয়ার লীগের নামের অধীনে ১৬তম মৌসুম। জিনিত সেন্ট পিটার্সবার্গ এই লীগের বর্তমান চ্যাম্পিয়ন। এই মৌসুমে তামবভ এবং সোচি ২০১৮–১৯ রুশ ফুটবল জাতীয় লীগ হতে যোগদান করেছিল এবং ইয়েনিসিয় ক্রাস্নোইয়ার্স্ক এবং আনঝি মাখাচকালা ২০১৯–২০ রুশ ফুটবল জাতীয় লীগ অবনমিত হয়েছিল।"},{"page_url":"https://es.wikipedia.org/wiki/Subregi%C3%B3n_de_R%C3%ADo_Mayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Colombia_-_Nari%C3%B1o_-_R%C3%ADo_Mayo.svg","page_title":"Subregión de Río Mayo","context_page_description":"La subregión de Río Mayo es una de las 13 subregiones del departamento colombiano de Nariño.​​\\nComprende los municipios de Belén, Colón, El Tablón de Gómez, La Cruz del Mayo, San Bernardo, San José de Albán y San Pablo, que abarcan un total de 864 kilómetros cuadrados.​"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%A5%D5%B6%D5%AB%D5%BD_%D5%8B%D5%B8%D5%BA%D5%AC%D5%AB%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Janis_Joplin%27s_Porsche_356_convertible.jpg","page_title":"Ջենիս Ջոպլին","context_page_description":"Ջենիս Լին Ջոպլին, ամերիկացի ռոք-երգչուհի, ով սկզբում ելույթ էր ունենում Big Brother and the Holding Company խմբի կազմում, իսկ հետո Kozmic Blues Band և Full Tilt Boogie Band խմբերում։ Ջոպլինը, ով հրապարակել է ընդամենը 4 ստուդիո ալբոմ, համարվում է լավագույն սպիտակամորթ բլյուզ կատարողը և ռոք երաժշտության պատմության լավագույն վոկալիստներից մեկը:\\n1995 թվականին Ջենիս Ջոպլինը հետմահու ներկայացվել է Ռոք'ն'ռոլլի փառքի սրահ, 2005-ին պարգևատրվել է Գրեմմիով՝ ակնառու հաջողություների համար, 2013 թվականին աստղ է ստացել Հոլիվուդյան «Փառքի ծառուղում»: Ջոպլինը 46-րդ հորիզոնականն է զբաղեցնում Rolling Stone ամսագրի «Բոլոր ժամանակների 50 լավագույն կատարողների» ցուցակում և 28-րդ տեղը նույն ամսագրի «Բոլոր ժամանակների 100 լավագույն երգիչներ և երգչուհիներ» ցուցակում:"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_premiers_van_Oekra%C3%AFne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Yanukovich.jpg","page_title":"Lijst van premiers van Oekraïne","context_page_description":"Dit is een lijst van premiers van Oekraïne:"},{"page_url":"https://pt.wikipedia.org/wiki/Dompnac","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/France_Ardeche_Dompnac_01.jpg","page_title":"Dompnac","context_page_description":"Dompnac é uma comuna francesa na região administrativa de Auvérnia-Ródano-Alpes, no departamento de Ardèche. Estende-se por uma área de 16,12 km². Em 2010 a comuna tinha 81 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Ickburgh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/St_Peter%27s_Church%2C_Ickburgh%2C_Norfolk_-_geograph.org.uk_-_822838.jpg","page_title":"Ickburgh","context_page_description":"Ickburgh is a village and civil parish in the English county of Norfolk. It is situated on the A1065 Mildenhall to Fakenham road, some 5.5 miles north of Brandon and 9 miles south of Swaffham. The village is 36 miles from the city of Norwich and 89 miles from London. The population and Didlington was 309 in 134 households at the 2011 Census. The parish has an area of 1,221 hectares and in the 2001 census had a population of 245 in 99 households. The parish shares boundaries with the adjacent parishes of Hilborough, Foulden, Didlington, Mundford, Lynford and Stanford. The parish falls within the district of Breckland. Local government responsibilities are shared between the parish, district and county councils."},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_park_Folgefonna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Buerbreen.JPG","page_title":"Nationaal park Folgefonna","context_page_description":"Het nationaal park Folgefonna is het vijfentwintigste Noorse nationale park dat de op twee na grootste en meest zuidelijke gletsjer van Noorwegen beschermt. Het is gelegen in de provincie Vestland.\\nDe status van nationaal park werd officieel verleend op 29 april 2005, na een proces dat in 1998 door de fylkesmann van Hordaland was gestart. Het nationaal park is echter groter dan de gletsjer alleen. Het is ongeveer 545 km² groot, inclusief een gebied met de status van beschermd landschap.\\nTot het park behoren onder meer vijf rivieren met omliggende gebieden: Æneselva, Furubergselva, Hattebergselva, Mosneselva en Opoelva."},{"page_url":"https://pl.wikipedia.org/wiki/NGC_7129","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/NGC7129.jpg","page_title":"NGC 7129","context_page_description":"NGC 7129 – gromada otwarta powiązana z mgławicą refleksyjną IC 5134, znajdująca się w gwiazdozbiorze Cefeusza w odległości około 3000 lat świetlnych od Ziemi. Została odkryta 18 października 1794 roku przez Williama Herschela. Gwiazdy należące do gromady NGC 7129 są w stosunkowo młodym wieku, mają po zaledwie kilka milionów lat."},{"page_url":"https://fr.wikipedia.org/wiki/Soci%C3%A9t%C3%A9_historique_et_arch%C3%A9ologique_de_Langres","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Langres_-_H%C3%B4tel_du_Breuil-de-Saint-Germain_-1.JPG","page_title":"Société historique et archéologique de Langres","context_page_description":"La Société historique et archéologique de Langres, anciennement Société archéologique de Langres, est une société savante fondée en 1835."},{"page_url":"https://en.wikipedia.org/wiki/September_2025_lunar_eclipse","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Metonic_lunar_eclipses_2006-2063A.png","page_title":"September 2025 lunar eclipse","context_page_description":"A total lunar eclipse will take place on September 7, 2025. The Moon will pass through the center of the Earth's shadow. This is the last central lunar eclipse of Lunar Saros 128."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%8A%97%E4%BD%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/AngeloftheWest.jpg","page_title":"抗体","context_page_description":"抗體，又稱免疫球蛋白，是一種主要由漿細胞分泌，被免疫系統用來鑑別與中和外來物質如細菌、病毒等病原體的大型Y形蛋白質，僅被發現存在於脊椎動物的血液等體液中，及其B細胞的細胞膜表面。抗體能通過其可變區唯一識別特定外來物的一個獨特特徵，該外來目標被稱為抗原。蛋白上Y形的其中兩個分叉頂端都有一被稱為互補位的鎖狀結構，該結構僅針對一種特定的抗原表位。這就像一把鑰匙只能開一把鎖一般，使得一種抗體僅能和其中一種抗原相結合。 抗體和抗原的結合完全依靠非共價鍵的相互作用，這些非共價鍵的相互作用包括氫鍵、范德華力、電荷作用和疏水作用。這些相互作用可以發生在側鏈或者多肽主幹之間。正因這種特異性的結合機制，抗體可以「標記」外來微生物以及受感染的細胞，以誘導其他免疫機制對其進行攻擊，又或直接中和其目標，例如通過與入侵和生存至關重要的部分相結合而阻斷微生物的感染能力等，就像通緝犯上了手銬和腳鐐一樣。針對不同的抗原，抗體的結合可能阻斷致病的生化過程，或者召喚巨噬細胞消滅外來物質。而抗體能夠與免疫系統的其它部分交互的能力，是通過其Fc區底部所保留的一個糖基化座實現的。體液免疫系統的主要功能便是製造抗體。抗體也可以與血清中的補體一起直接破壞外來目標。\\n抗體主要由一種B細胞所分化出來的叫做漿細胞的淋巴細胞所製造。抗體有兩種物理形態，一種是從細胞分泌到血漿中的可溶解物形態，另一種是依附於B細胞表面的膜結合形態。抗體與細胞膜結合後所形成的複合體又被稱為B細胞感受器，這種複合體只存在於B細胞的細胞膜表面，是激活B細胞以及後續分化的重要結構。B細胞分化後成為生產抗體的工廠的漿細胞，或者長期存活於體內以便未來能迅速抵抗相同入侵物的記憶B細胞。在大多數情況下，與B細胞進行互動的輔助型T細胞對於B細胞的完全活化是至關重要的，因為輔助型T細胞負責識別抗原，並促使B細胞能分化出能與該抗原相結合的抗體的漿細胞和記憶型B細胞。而可溶性抗體則被釋放到血液等體液當中，持續抵抗正在入侵的外來微生物。\\n抗體是免疫球蛋白超家族中的一種醣蛋白。它們是血漿中丙種球蛋白的主要構成成分。抗體通常由一些基礎單元組成，每一個抗體包括：兩個長的重鏈，以及兩個短的輕鏈。而輕鏈和重鏈之間以雙硫鍵連接。輕鏈和重鏈又分為可變區和恆定區，而不同類型的重鏈恆定區，將會導致抗體種型的不同。在哺乳類動物身上已知的不同種型的抗體有五種，它們分別扮演不同的角色，並引導免疫系統對所遇到的不同類型外來入侵物產生正確的免疫反應。\\n儘管所有的抗體大體上都很相似，然而在蛋白質Y形分叉的兩個頂端有一小部分可以發生非常豐富的變化。這一高變區上的細微變化可達百萬種以上，該位置就是抗原結合位。每一種特定的變化，可以使該抗體和某一個特定的抗原結合。這種極豐富的變化能力，使得免疫系統可以應對同樣非常多變的各種抗原。"},{"page_url":"https://fr.wikipedia.org/wiki/Westhouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Westhouse_115.JPG","page_title":"Westhouse","context_page_description":"Westhouse est une commune française située entre Strasbourg et Sélestat, dans le département du Bas-Rhin, en région Grand Est.\\nCette commune se trouve dans la région historique et culturelle d'Alsace."},{"page_url":"https://en.wikipedia.org/wiki/Joseph_Rotblat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Josef_Rotblat_ID_badge.png","page_title":"Joseph Rotblat","context_page_description":"Sir Joseph Rotblat KCMG CBE FRS was a Polish physicist, a self-described \\"Pole with a British passport\\". Rotblat worked on Tube Alloys and the Manhattan Project during World War II, but left the Los Alamos Laboratory after the war with Germany ended. His work on nuclear fallout was a major contribution toward the ratification of the 1963 Partial Nuclear Test Ban Treaty. A signatory of the 1955 Russell–Einstein Manifesto, he was secretary-general of the Pugwash Conferences on Science and World Affairs from their founding until 1973 and shared, with the Pugwash Conferences, the 1995 Nobel Peace Prize \\"for efforts to diminish the part played by nuclear arms in international affairs and, in the longer run, to eliminate such arms.\\""},{"page_url":"https://es.wikipedia.org/wiki/Visi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Dragonfly_eye_3811.jpg","page_title":"Visión","context_page_description":"Se llama visión a la capacidad de interpretar el entorno gracias a los rayos de luz que alcanzan el ojo. La visión o sentido de la vista es una de las principales capacidades sensoriales de los humanos y de muchos otros animales. El Día Mundial de la Visión se celebra el segundo jueves del mes de octubre."},{"page_url":"https://no.wikipedia.org/wiki/Stjerneeple","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Chrusophyllum_cainito.jpg","page_title":"Stjerneeple","context_page_description":"Stjerneeple er frukten fra treet Chrysophyllum cainito i sapodillefamilien.\\nTreet er eviggrønt og blir 15–20 m høyt. Frukten er kulerund, 5–10 cm i diameter og grønn til purpurfarget. Den inneholder 3–8 frø som ligger i hvitt, søtt fruktkjøtt. Frukten er delt inn i 8 segmenter som danner et stjerneformet mønster når den deles på tvers.\\nArten vokser naturlig i Karibia og Mellom-Amerika. Den er avhengig av et fuktig, tropisk klima og er vanlig dyrket i Sørøst-Asia."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E3%81%AE%E6%B8%A9%E6%B3%89%E7%94%BB%E5%83%8F%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Togo_Onsen06bs4592.jpg","page_title":"日本の温泉画像一覧","context_page_description":"日本の温泉画像一覧では、日本の温泉の画像で日本語ウィキペディアおよびコモンズにあるもののファイル名を挙げる。"},{"page_url":"https://es.wikipedia.org/wiki/Escalinata_de_Teruel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/1-Teruel-escalinataTor%C3%A1n_%282006%290258.jpg","page_title":"Escalinata de Teruel","context_page_description":"La escalinata de Teruel, es una construcción monumental de Teruel.\\nObra del ingeniero turolense José Torán de la Rad, la emblemática edificación se construyó a comienzo de los años veinte, para salvar el desnivel existente entre la «Estación del Ferrocarril Central de Aragón» y el casto antiguo de la ciudad.\\nPor Decreto 60/2008, de 1 de abril, del Gobierno de Aragón, la Escalinata de Teruel fue declarada Bien de Interés Cultural, en la categoría de Monumento: su declaración se publicó en el Boletín Oficial de Aragón el 16 de abril de 2008."},{"page_url":"https://no.wikipedia.org/wiki/Equinor","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Olav_Fjell%28Jarvin%29.jpg","page_title":"Equinor","context_page_description":"Equinor er et norsk børsnotert olje- og gasselskap. Den norske stat er hovedaksjonær med en eierandel på 67 prosent som forvaltes av Olje- og energidepartementet. I tillegg eier Folketrygdfondet 3,45 prosent av aksjene, noe som gjør at den norske stat sin samlede eierandel i Equinor er på 70,5 prosent. Selskapet har 29 500 ansatte, herav 16 300 i selve morselskapet. Equinor er representert i ca. 36 forskjellige land.\\nMed en markedsverdi omkring 400 milliarder kroner er selskapet Norges desidert mest verdifulle, og det er blant verdens 50 største selskaper uavhengig av bransje. Hovedkontoret ligger i Stavanger, mens Equinors internasjonale operasjoner styres fra Fornebu.\\nSelskapet er en videreføring av Statoil, og ble til ved at olje- og gassdivisjonen i Norsk Hydro ble slått sammen med Statoil med virkning fra 1. oktober 2007, hvorpå selskapet skiftet navn til StatoilHydro. Navnet ble endret tilbake til Statoil i 2009. I 2018 endret selskapet navn til Equinor."},{"page_url":"https://es.wikipedia.org/wiki/Sancedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Escudo_de_Sancedo.svg","page_title":"Sancedo","context_page_description":"Sancedo es un municipio y lugar español en la comarca del Bierzo, provincia de León, comunidad autónoma de Castilla y León. Tiene un área de 31 km² con una población de 563 habitantes en 2017. Sancedo es uno de los municipios leoneses que son bilingües, situándose su habla tradicional en el área del leonés.​"},{"page_url":"https://en.wikipedia.org/wiki/Multi-Marques","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/%2703-%2705_Ford_E-450_Pom_Cutaway_With_Two_Badges.JPG","page_title":"Multi-Marques","context_page_description":"Multi-Marques Inc. is Quebec's largest bakery and the second largest in Canada since its merger with Canada Bread. Multi-Marques Inc. employs more than 1 700 people throughout seven bakeries in Laval, Beauport, Lévis, Quebec, Montreal and St-Côme-de-Beauce.\\nMulti-Marques also makes private and national label bread and pastries for many food wholesalers in Quebec. With revenues of more than c$300 million and the growing demand for products in the North American market is a continuing source of motivation.\\nIn December 2001, the Laval bakery earned the prestigious HACCP Certification.\\nMulti-Marques Inc. is a division of Canada Bread Company, a Toronto Stock Exchange-listed company. The company and its first product line was originally created by Morton Satin, Research Director of Steinberg Foods in Montreal in 1975, as a marketing outlet for the unique line of Steinberg breads."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_de_Z%C3%A4hringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bern-BerchtoldVZahring.JPG","page_title":"Maison de Zähringen","context_page_description":"La famille des Zähringen est une dynastie de ducs dans le sud-ouest de l'Allemagne et l'ouest de la Suisse du XIᵉ au début du XIIIᵉ siècle, issue de la première branche de la maison d'Autriche. De nos jours ils sont notamment restés connus pour avoir fondé plusieurs villes modernes, telles que Rheinfelden, Fribourg et Berne. Le dernier descendant de la branche aînée, portant le nom des Zähringen, mourut en 1218. Une branche cadette régna jusqu'en 1918 sur le pays de Bade.\\nLa famille des Zähringen fait partie des grandes familles qui ont façonné le destin de la Suisse au Moyen Âge avec les Habsbourg et les Savoie notamment."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%95%E0%B2%82%E0%B2%AA%E0%B3%8D%E0%B2%AF%E0%B3%82%E0%B2%9F%E0%B2%B0%E0%B3%8D_%E0%B2%AF%E0%B2%82%E0%B2%A4%E0%B3%8D%E0%B2%B0%E0%B2%BE%E0%B2%82%E0%B2%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/3-Tasten-Maus_Microsoft.jpg","page_title":"ಕಂಪ್ಯೂಟರ್ ಯಂತ್ರಾಂಶ","context_page_description":"ಕಂಪ್ಯೂಟರ್ ಯಂತ್ರಾಂಶ ದ ಅನೇಕ ಬಿಡಿ ಭಾಗಗಳನ್ನು ಜೋಡಿಸಿ ಪರ್ಸನಲ್‌ ಕಂಪ್ಯೂಟರ್‌ ಅನ್ನು ರೂಪಿಸಲಾಗಿದೆ. ಈ ಯಂತ್ರಾಂಶಗಳನ್ನು ಆಧರಿಸಿ ಕಾರ್ಯಾಚರಣಾ ವ್ಯವಸ್ಥೆ ಹಾಗೂ, ಬಳಕೆದಾರನ ಅಪೇಕ್ಷಿತ ಕ್ರಿಯೆಗಳನ್ನು ನೆರವೇರಿಸಲು ಸಾಫ್ಟ್‌ವೇರ್‌ ಗಳನ್ನು ಬಹುಸಂಖ್ಯೆಯಲ್ಲಿ ಅಳವಡಿಸಲಾಗಿದೆ."},{"page_url":"https://hu.wikipedia.org/wiki/Verebes_Istv%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Verebes_Istv%C3%A1n.jpg","page_title":"Verebes István","context_page_description":"Verebes István Jászai Mari-díjas színész, rendező, dramaturg, író, színházigazgató, műsorvezető. 1973–74-ben a Magyar Televízió szerkesztője volt. Az 1980-as években vált ismertté, amikor a Magyar Rádiónál vezetett kabaréműsorokat, politikai témákat sem kerülve. A rendszerváltás után állandó műsorvezetője lett az MTV Nap-kelte című, szombat reggeli műsorának. Apja Verebes Károly, színész volt."},{"page_url":"https://en.wikipedia.org/wiki/Lac_de_Melu","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Lac_de_Melo.jpg","page_title":"Lac de Melu","context_page_description":"Lac de Melu is a lake in Corsica, France. At an elevation of 1,710 metres, its surface area is 0.065 square kilometres. The lake is the source of the Restonica River.\\nIt is close to Lac de Capitellu, in the commune of Corte.\\nA new bacterial species, Polynucleobacter meluiroseus, was discovered in the lake and also named after the lake."},{"page_url":"https://sh.wikipedia.org/wiki/Looney_Tunes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Looney_tunes_careta.png","page_title":"Looney Tunes","context_page_description":"Looney Tunes je serija kratkih animiranih filmskih komedija produciranih od američkog studija Warner Bros. od 1930. do 1969. godine, a koja se zajedno sa sestrinskom serijom Merrie Melodies smatra najpoznatijim ostvarenjem Zlatnog doba američke animacije. Poznata je po tome što su se u njoj prvi pojavili Bugs Bunny, Daffy Duck, Porky Pig, Elmer Fudd, Tweety, Sylvester, Granny, Yosemite Sam, Foghorn Leghorn, Marvin the Martian, Pepé Le Pew, Speedy Gonzales, Tasmanian Devil, Ptica Trkačica, Wile E. Coyote i drugi najpozantiji i najpopularniji likovi u historiji filmske animacije.\\nIme je dobila po ranoj Disneyevoj seriji kratkih muzičkih animiranih filmopva Silly Symphonies. Ispočetka je služila za promoviranje muzičkih kompozicija na koju je Warner imao prava, i to kroz pustolovine likova kao što su Bosko i Buddy. Warnerov animacijski studio je sa vremenom stekao izuzetan ugled, i to zahvaljujući režiserima kao što su Tex Avery u Chuck Jones i glasovnom glumcu Melu Blancu. Od 1942. do 1964. Looney Tunes i Merrie Melodies su se smatrali najpopularnijim kratkim animiranim kino-filmovima."},{"page_url":"https://pl.wikipedia.org/wiki/Stara_Bircza","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Stara_Bircza_1.jpg","page_title":"Stara Bircza","context_page_description":"Stara Bircza – wieś w Polsce położona w województwie podkarpackim, w powiecie przemyskim, w gminie Bircza}. Leży na terenie Pogórza Przemyskiego.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa przemyskiego.\\nPrzez miejscowość przepływa niewielka rzeka Stupnica, dopływ Sanu. Znajduje się tu siedziba Nadleśnictwa Bircza.\\nWe wsi, na wzgórzu graniczącym z Birczą, znajdował się cmentarz i drewniana cerkiew greckokatolicka pod wezwaniem św. Sawy, zbudowana w 1797 roku. Spłonęła w 1926 roku."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_des_ducs_de_Bar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Ernest_Bradfer_par_CL_Mar%C3%A9chal_0005.jpg","page_title":"Château des ducs de Bar","context_page_description":"Le château des ducs de Bar est un ancien château situé à Bar-le-Duc dans le département de la Meuse en région Grand Est. Perché sur un éperon rocheux au bout de la Ville Haute, il dominait la vallée de l'Ornain et la Ville Basse. Démantelé en 1670 par ordre du roi de France Louis XIV, il ne reste aujourd'hui plus que le Neuf-Castel du XVIᵉ siècle et quelques vestiges des fortifications.\\nIl servait de lieu d'habitation aux comtes et ducs de Bar, puis, plus rarement, de lieu de villégiature aux ducs de Lorraine. Depuis 1970, le Neuf-Castel abrite le Musée Barrois.\\nLe Neuf-Castel est en partie inscrit au titre des monuments historiques depuis le 23 avril 1981."},{"page_url":"https://en.wikipedia.org/wiki/Royal_Palace_of_%C3%89vora","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Pal%C3%A1cio_de_D._Manuel_em_%C3%89vora.jpg","page_title":"Royal Palace of Évora","context_page_description":"The Royal Palace of Évora, also known as the Royal Palace of São Francisco and the Palace of King Manuel I, is a former royal residence of the Kings of Portugal, in Évora, the capital of Alentejo.\\nThe palace has its origins in a convent built in the 13th century. During the 14th century, the convent came under royal use when the royal family was in the Alentejo, but only became a proper palace under the reign of King John I, who used it as a personal retreat from the court. It became a royal palace during King Afonso V's reign, though it was the successive reigns of King John II and Manuel I that turned the originally ordinary palace into a grandiose renaissance palace, truly fit for a king. Over the centuries, the palace fell prey to war, decay, and urban redevelopment, which destroyed nearly all of the palace, with only a few segments of the palace still existing.\\nThe Royal Palace of Évora was one of the centers of the Portuguese Renaissance, under King Manuel I, where playwrights, like Gil Vicente, and explorers, like Vasco da Gama, sought audiences with the king."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%91%D7%99_%D7%91%D7%9F-%D7%A9%D7%99%D7%9E%D7%95%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Avi_Ben_Chimol_2017_04_27.jpg","page_title":"אבי בן-שימול","context_page_description":"אָבִי בֶּן-שִׁימוֹל הוא כדורסלן ישראלי המשחק בעמדת הרכז בקבוצת מכבי חיפה מליגת העל הישראלית."},{"page_url":"https://es.wikipedia.org/wiki/Vickers_Wellesley","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Vickers_Wellesley.png","page_title":"Vickers Wellesley","context_page_description":"El Vickers Wellesley fue un bombardero medio biplaza construido por la firma Vickers-Armstrongs Ltd. en Brooklands, Surrey, para la\\nReal Fuerza Aérea británica. Si bien, resultaba obsoleto al comienzo de la Segunda Guerra Mundial y no era adecuado para la guerra aérea en el teatro de operaciones europeo, el Wellesley fue operado en los teatros del desierto de África Oriental, Egipto y Oriente Medio. Fue uno de los dos aviones en llevar el nombre de Arthur Wellesley primer Duque de Wellington, el otro fue el Vickers Wellington. Este aeroplano tiene en su haber la obtención en 1938 del récord mundial de distancia que no sería superado hasta 1945."},{"page_url":"https://en.wikipedia.org/wiki/Weather_Report","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bobby_Thomas_jr._and_Wayne_Shorter.jpg","page_title":"Weather Report","context_page_description":"Weather Report was an American jazz fusion band of the 1970s and early 1980s. The band was initially co-led by the Austrian-born keyboard player Joe Zawinul, the American saxophonist Wayne Shorter and Czech bassist Miroslav Vitouš. Other prominent members at various points in the band's lifespan included bassists Alphonso Johnson, Jaco Pastorius and Victor Bailey; and drummers/percussionists Airto Moreira, Chester Thompson, Alex Acuña and Peter Erskine. Throughout most of its existence, the band was a quintet of keyboards, saxophone, bass, drums and percussion.\\nThe band began as an avant-garde jazz group; when Vitouš left Weather Report after a few years, Zawinul increasingly took control and steered the band towards a more funk and R&B-oriented jazz sound incorporating elements of world music and the latest developments in synthesizer technology. During the mid-1970s Weather Report remained one of the defining acts within the jazz form, winning the DownBeat best album award five times in a row.\\nAlongside Miles Davis's electric bands, the Mahavishnu Orchestra, Return to Forever, and the Headhunters, Weather Report is considered to be one of the pre-eminent early jazz fusion bands."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A9nus_de_Laussel","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Venus-de-Laussel-detail-bras.jpg","page_title":"Vénus de Laussel","context_page_description":"La Vénus de Laussel ou Vénus à la corne est une Vénus paléolithique datant du Gravettien au Paléolithique supérieur. Elle a été sculptée en bas relief sur un bloc calcaire et peinte à l'ocre rouge. Elle correspond à un personnage féminin nu tenant dans sa main droite un objet interprété généralement comme une corne de bison. Elle est conservée au Musée d'Aquitaine, à Bordeaux."},{"page_url":"https://sk.wikipedia.org/wiki/Trump_Ocean_Club_International_Hotel_and_Tower","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Panama_08_2013_Trump_Ocean_Tower_7085.JPG","page_title":"Trump Ocean Club International Hotel and Tower","context_page_description":"Trump Ocean Club International Hotel and Tower je mrakodrap v panamskej metropole Panama. S výškou 284 m a 70 poschodiami je najvyššou budovou mesta. Mrakodrap bol postavený v rokoch 2007 – 2011 a jeho architektom bol Arias Serna Saravia. Po svojom dokončení sa stal najvyššou budovou Latinskej Ameriky a bol ňou do roku 2013, kedy bol dokončený čilský mrakodrap Gran Torre Santiago; dnes je druhou najvyššou. Celková podlahová plocha budovy je 252 000 m²."},{"page_url":"https://de.wikipedia.org/wiki/Castle_Pinckney","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Castle_Pickney1.JPG","page_title":"Castle Pinckney","context_page_description":"Castle Pinckney war eine Küstenbefestigung zum Schutz des Hafens von Charleston und liegt auf der Insel Shutes' Folly Island etwa 1,7 km östlich von Charleston."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%89%E0%A6%A4%E0%A7%8D%E0%A6%A4%E0%A7%81%E0%A6%B0%E0%A7%87_%E0%A6%B2%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%9E%E0%A7%8D%E0%A6%9C%E0%A6%BE%E0%A6%B9%E0%A6%BE%E0%A6%81%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Ljubljana_-_Anas_acuta_male.jpg","page_title":"উত্তুরে ল্যাঞ্জাহাঁস","context_page_description":"উত্তুরে ল্যাঞ্জাহাঁস, কালদিঘেড়ি বা লেঞ্জাহাঁস Anatidae গোত্র বা পরিবারের অন্তর্গত Anas গণের অন্তর্ভুক্ত এক প্রজাতির বড় হাঁস। পাখিটি একটি বিশ্বজনীন প্রজাতি; বাংলাদেশ, ভারত ছাড়াও পৃথিবীর বহু দেশে এদের দেখা যায়। ইউরোপ, এশিয়া ও উত্তর আমেরিকার উত্তরাঞ্চলে এরা প্রজনন করে। প্রজাতিটি স্বভাবে পরিযায়ী এবং শীতকালে এর প্রজননস্থলের দক্ষিণে বিষুবীয় অঞ্চলের দিকে চলে আসে। সারা পৃথিবীতে এক বিশাল এলাকা জুড়ে এরা বিস্তৃত; কেবল দুই আমেরিকাতেই এরা প্রায় ৬৫ লক্ষ ৮০ হাজার বর্গ কিলোমিটার এলাকা জুড়ে বসবাস করে। বিশাল এলাকা জুড়ে বিস্তৃত হওয়ায় স্বাভাবিকভাবেই এর একাধিক ভৌগোলিক উপপ্রজাতি থাকার কথা। কিন্তু বিস্ময়কর হলেও সত্য, উত্তুরে ল্যাঞ্জাহাঁসের কোন উপপ্রজাতি নেই। ইটনের ল্যাঞ্জাহাঁসকে একসময় এর সহপ্রজাতিক মনে করা হলেও এরা আসলে ভিন্ন একটি প্রজাতি।\\nউত্তুরে ল্যাঞ্জাহাঁস বড় আকারের হাঁস। স্ত্রী-পুরুষ দুই হাঁসেরই নীলচে-ধূসর ঠোঁট এবং ধূসর পা ও পায়ের পাতা থাকে। পুরুষ হাঁস দেখতে চমৎকার, চকলেট রঙা মাথার পেছন থেকে একটি সরু সাদা রেখা ঘাড় হয়ে সাদা দেহতল পর্যন্ত নেমে গিয়েছে। এছাড়া পিঠ দর্শনীয় ধূসর, বাদামি ও কালো রঙে চিত্রিত থাকে। স্ত্রী হাঁসের দেহে রঙের বৈচিত্র্য কম। দেহ আনুস গণের অন্যান্য স্ত্রী হাঁসের মত মেটে রঙের। স্ত্রী হাঁস প্যাঁক-প্যাঁক করে ডাকে; পুরুষ হাঁসের ডাক বাঁশির শিষের মত।"},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%AA%D9%88%D8%B1%DA%A9%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Mevlana_Konya.jpg","page_title":"تورکیا","context_page_description":"تورکیا، بە فەرمی ناسراوە بە کۆماری تورکیا، دەوڵەتێکە بەشە گەورەکەی دەکەوێتە باشوری ڕۆژاوای ئاسیا و بەشە بچوکەکەی تری ئەکەوێتە ڕۆژھەڵاتی ئەورووپا. خاکی تورکیا گەرووی بۆسفۆر و دەدردەنیل و دەریای مەڕمەڕە کە دەریای ڕەش بە دەریای ئێژەوە دەبەستێت، و ئاسیا بە ئەورووپا دەگەیەنێت، ئەمەش وایکردووە کە شوێنێکی ستراتیژی و کاریگەری ھەبێت لەسەر ئەو دەوڵەتانەی بەسەر دەریای ڕەشدا دەڕوانن. تورکیا لە ڕۆژھەڵاتەوە ھاوسنوورە لەگەڵ گورجستان، ئێران، ئەرمەنستان و ئازەربایجان، لە باشوورەوە ھاوسنوورە لەگەڵ عێراق، سووریا و دەریای ناوین، و سنووری دەریاییی ھەیە لەگەڵ قوبرس، دەریای ئێژە، یۆنان و بولگاریا لە ڕۆژاواوە، و دەریای ڕەش لە باکورەوە، و ئەندامی ڕێکخراوی ھاریکاریی ئابووریی دەریای ڕەشە.\\nتورکیا ناوەندی حوکمی عوسمانی بووە تا ساڵی ١٩٢٢ و دامەزراندنی کۆماری تورکیا لە ساڵی ١٩٢٣ز."},{"page_url":"https://en.wikipedia.org/wiki/Stod%C5%AFlky_(Prague_Metro)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Praha%2C_Jihoz%C3%A1padn%C3%AD_m%C4%9Bsto%2C_Metro_Stod%C5%AFlky%2C_v%C3%BDtah.jpg","page_title":"Stodůlky (Prague Metro)","context_page_description":"Stodůlky is a Prague Metro station on Line B. The station was open on 11 November 1994 as part of the extension of Line B from Nové Butovice to Zličín."},{"page_url":"https://es.wikipedia.org/wiki/Beatriz_Bonnet","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Beatriz_Bonnet.JPG","page_title":"Beatriz Bonnet","context_page_description":"Nelly Beatris Auchter Bonnet ​​ fue una actriz y comediante argentina de cine, teatro y televisión.​"},{"page_url":"https://fi.wikipedia.org/wiki/Haapsalun_kuursaal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Haapsalu_kuursaal_2012.jpg","page_title":"Haapsalun kuursaal","context_page_description":"Haapsalun kuursaal on kuursaal eli kasino Haapsalun kaupungissa Virossa. Rakennus valmistui 1800-luvun lopussa ja nykyisin sen tiloissa toimii kahvila."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9E%97%E6%96%87%E9%BE%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/%E6%9E%97%E6%96%87%E9%BE%8D.jpg","page_title":"林文龍","context_page_description":"林文龍，前香港男演員及商人，1987年參加超級新星選舉而加入了無綫電視，1990年無綫電視太陽之子之一，曾一度轉投亞洲電視，之後回到無綫電視。2004年與演員郭可盈結婚。2012年轉投香港電視網絡，但於2016年以自由身形式重返無綫電視拍攝該台首部4K電視劇《不懂撒嬌的女人》。2017年，他再拍攝無綫電視劇集《再創世紀》，2019年12月獲邀擔任亞洲電視副總裁，於2020年1月正式上任。"},{"page_url":"https://es.wikipedia.org/wiki/Masaji_Kiyokawa","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Masaji_Kiyokawa.jpg","page_title":"Masaji Kiyokawa","context_page_description":"Masaji Kiyokawa fue un nadador japonés especializado en pruebas de estilo espalda, donde consiguió ser campeón olímpico en 1932 en los 100 metros.​"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8D%87%E4%B8%BB%E5%8B%95%E8%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Slide7eeee.JPG","page_title":"升主動脈","context_page_description":"升主动脉为主动脉与左心室交接的部分，始于第三肋间软骨下缘，并沿胸骨左半边上行。升主动脉有左冠状动脉和右冠状动脉两分支，供应心脏养分，之后主干会接至主动脉弓。"},{"page_url":"https://sq.wikipedia.org/wiki/Hume,_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/HumeFrontStreetFromWFirst.jpg","page_title":"Hume, Illinois","context_page_description":"Hume, Illinois është një fshat në qarkun Edgar të shtetit federal Illinois, SHBA. Në Hume, Illinois jetojnë 380 banorë, dhe dendësia e popullisë është 287 banor/km². Fshati ka një sipërfaqe prej dhe lartësi mbidetare prej 202 m."},{"page_url":"https://ca.wikipedia.org/wiki/Azy-le-Vif","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Map_commune_FR_insee_code_58021.png","page_title":"Azy-le-Vif","context_page_description":"Azy-le-Vif és un municipi francès, situat al departament del Nièvre i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 226 habitants."},{"page_url":"https://de.wikipedia.org/wiki/Dorfkirche_Falkenhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Falkenhagener_Kirche_2011-11-23_AMA_fec_%2827%29.JPG","page_title":"Dorfkirche Falkenhagen","context_page_description":"Die Dorfkirche Falkenhagen ist ein evangelisches Gotteshaus im Ortsteil Falkenhagen der Stadt Falkensee. Das inzwischen mehrfach umgebaute Gebäude wurde 1680 eingeweiht und steht unter Denkmalschutz."},{"page_url":"https://es.wikipedia.org/wiki/Sainte-Marie-la-Mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sainte-Marie-la-Mer_-_Mairie.jpg","page_title":"Sainte-Marie-la-Mer","context_page_description":"Sainte-Marie-la-Mer, Santa Maria la Mar en catalán, es una localidad y comuna francesa, situada en el departamento de Pirineos Orientales, región de Languedoc-Rosellón y comarca histórica del Rosellón, en la Salanca.\\nSus habitantes reciben el gentilicio de Saint-Marinois en francés o santmariaire, santmariaira en catalán."},{"page_url":"https://es.wikipedia.org/wiki/Punta_Carnsore","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/CarneBeach.jpg","page_title":"Punta Carnsore","context_page_description":"La punta Carnsore es un cabo o promontorio del extremo suroeste de la isla de Irlanda, que administrativamente pertenece al condado de Wexford.\\nLa punta Carnsore es usada por la Organización Hidrográfica Internacional, para delimitar la línea de separación entre el mar de Irlanda y el mar Céltico.\\nEn el sur.\\nUna línea que une St. David Head con punta Carnsore.\\nLimits of oceans and seas, pág. 12 y 13. Corrección de errores en pág. 39.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%99%A3%E5%B9%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Hiketa_Hinamatsuri_12_cropped.jpg","page_title":"陣幕","context_page_description":"陣幕\\n一般名詞\\n陣幕 - 故実作法に基づいた戦場における陣地を作るための幕。露天に幕串を立てて飾り、陣地を構成する。江戸時代になると、軍学書などを通じて武家社会における神聖な意味合いをもつ用具として認識されるようになる。また庶民の間でも外界からの邪気を払う呪術的機能を持つものとして祭礼や芝居興行に盛んに用いられるようになった。\\n固有名詞\\n陣幕 - 大相撲の力士名、また年寄名跡。\\n陣幕長兵衛：大坂相撲の力士。年寄名跡「陣幕」の祖。\\n陣幕久五郎：第12代横綱。年寄名跡「北陣」の祖。"},{"page_url":"https://de.wikipedia.org/wiki/Stefan_Schael","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ams_experiment-de.jpg","page_title":"Stefan Schael","context_page_description":"Stefan Schael ist ein deutscher Physiker."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D8%AC%D9%8A%D9%84%D9%88%D9%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Verinag_Water_Spring.jpg","page_title":"نهر جيلوم","context_page_description":"نهر جيلوم نهر في شمال الهند وشرق باكستان. إنه أقصى غرب الأنهار الخمسة لمنطقة البنجاب، ويمر عبر وادي كشمير. وهو رافد لنهر السند ويبلغ طوله الإجمالي حوالي 725 كيلومتر."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D8%AC%D8%B1%D9%8A%D8%AA_%D9%8A%D9%88%D8%B1%D8%B3%D9%86%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Marguerite_Yourcenar-Bailleul-1982.10.04.Bernhard_De_Grendel_%2810%29.jpg","page_title":"مارجريت يورسنار","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمارجريت يورسنار كانت كاتبه من بلجيكا و فرنسا و امريكا."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Querrieu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Querrieu_parc_du_ch%C3%A2teau_1a.jpg","page_title":"Château de Querrieu","context_page_description":"Le château de Querrieu et son parc sont situés sur le territoire de la commune de Querrieu ainsi que sur celui de la commune de Pont-Noyelles dans le département de la Somme."},{"page_url":"https://vi.wikipedia.org/wiki/Spreewaldheide","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Spreewaldheide_in_LDS.png","page_title":"Spreewaldheide","context_page_description":"Spreewaldheide là một đô thị thuộc huyện Dahme-Spreewald, bang Brandenburg, Đức. Đô thị Spreewaldheide có diện tích 35,99 km², dân số thời điểm 31 tháng 12 năm 2006 là 568 người."},{"page_url":"https://es.wikipedia.org/wiki/Agarrate_Catalina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Tabar%C3%A9_Cardozo_y_Fabi%C3%A1n_Pintos._Foto_by_Gonzalo_Pacheco..jpg","page_title":"Agarrate Catalina","context_page_description":"Agarrate Catalina es una murga uruguaya fundada en el año 2001. En el año 2003 hacen su debut en el Carnaval mayor, y desde entonces obtienen el primer lugar del concurso oficial en los años 2005, 2006, 2008, 2011 y 2020\\nSu director responsable es Yamandú Cardozo, y los textos son realizados por el mismo junto a su hermano Tabaré Cardozo y a Carlos Tanco. Por varios años la dirección escénica y los arreglos corales estuvieron a cargo de Martin Duarte. Actualmente esa tarea la desempeña Tabaré Cardozo."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_Mars_Science_Laboratory","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/PIA18401-MarsCuriosityRover-NovaRock-LaserSpark-20140712.jpg","page_title":"Timeline of Mars Science Laboratory","context_page_description":"The Mars Science Laboratory and its rover, Curiosity, were launched from Earth on November 26, 2011. As of August 29, 2020, Curiosity has been on the planet Mars for 2867 sols since landing on August 5, 2012."},{"page_url":"https://pt.wikipedia.org/wiki/Auvers","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Auvers.jpg","page_title":"Auvers","context_page_description":"Auvers é uma comuna francesa na região administrativa de Auvérnia-Ródano-Alpes, no departamento de Alto Loire. Estende-se por uma área de 21,5 km². Em 2010 a comuna tinha 62 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Jonesboro,_Lake_City_%26_Eastern_Railroad_Depot","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Manila-Depot-Museum-ar.jpg","page_title":"Jonesboro, Lake City & Eastern Railroad Depot","context_page_description":"The Jonesboro, Lake City & Eastern Railroad Depot is a historic former railroad station in Manila, Arkansas. It is a modest single-story wood frame structure with a gable roof, standing at the northwest corner of South Dewey and Baltimore Streets. The station was built in 1910 by the Jonesboro, Lake City and Eastern Railroad, and is a well-preserved example of a wood-frame board-and-batten station of the period. It is now owned by the city.\\nThe depot was listed on the National Register of Historic Places in 1997."},{"page_url":"https://lv.wikipedia.org/wiki/Zieme%C4%BCkoreja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Sunan_International_Airport%2C_Pyongyang%2C_North_Korea-1.jpg","page_title":"Ziemeļkoreja","context_page_description":"Korejas Tautas Demokrātiskā Republika, neoficiāli bieži saukta par Ziemeļkoreju, ir valsts Korejas pussalas ziemeļdaļā uz ziemeļiem no 38. paralēles. Ziemeļaustrumos robežojas ar Krievijas Federāciju, ziemeļos pa Amnokganas upi — ar Ķīnas Tautas Republiku, bet dienvidos — ar Korejas Republiku. No Dienvidkorejas Ziemeļkoreju atdala aptuveni 4 km plata Korejas Demilitarizētā zona. Lielākā daļa no iedzīvotājiem ir korejieši, kā arī ķīnieši un japāņi.\\nKorejas pussalu kontrolēja Korejas impērija, līdz to iekaroja un pēc Krievijas—Japānas kara 1905. gadā kolonizēja Japāna. 1945. gadā pēc Otrā pasaules kara pussala tika sadalīta divās zonās starp ASV un Padomju Savienību. 1948. gadā Ziemeļkoreja atteicās piedalīties Apvienoto Nāciju Organizācijas rīkotajās vēlēšanās. Tika izveidotas neatkarīgas valdības katrā no okupētajām teritorijām. Abas valstis pretendēja uz visu pussalu kā savu teritoriju, kas noveda pie Korejas kara 1950. gadā. Karš beidzās 1953. gadā, kad tika noslēgts pamiers. Oficiāli abas valstis joprojām karo viena ar otru, jo miera līgums netika parakstīts."},{"page_url":"https://en.wikipedia.org/wiki/Silvestre_Varela","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Silvestre_Varela.jpg","page_title":"Silvestre Varela","context_page_description":"Silvestre Manuel Gonçalves Varela is a Portuguese professional footballer who plays for Belenenses SAD as a winger.\\nHe represented mainly Porto during his career, amassing Primeira Liga totals of 237 matches and 47 goals over 11 seasons and winning 11 major titles, including three national championships and the 2011 Europa League. He also competed professionally in Spain, England, Italy and Turkey.\\nVarela appeared for Portugal at Euro 2012 and the 2014 World Cup, scoring in both tournaments."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Villamassargia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Bivio_ferroviario_Villamassargia-Domusnovas.jpg","page_title":"Villamassargia","context_page_description":"Villamassargia sī Italia Sardinia Tōa-khu Carbonia-Iglesias Séng ê chi̍t-ê comune."},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Brzeska_w_Siedlcach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/C.H.Arche.JPG","page_title":"Ulica Brzeska w Siedlcach","context_page_description":"Ulica Brzeska – ulica w Siedlcach, w Południowej Dzielnicy Przemysłowej. Nazwa ulicy pochodzi od miasta Brześć."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Geneva_(Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Downtown_Geneva%2C_Indiana.jpg","page_title":"Geneva (Indiana)","context_page_description":"Geneva sī Bí-kok Indiana chiu Adams kūn ê chi̍t ê chng-thâu.\\nChe sī chi̍t phiⁿ koan-î Bí-kok Indiana Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://en.wikipedia.org/wiki/Sher_Shah_Suri","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Sher_shah%27s_rupee.jpg","page_title":"Sher Shah Suri","context_page_description":"Sher Shah Suri, born Farīd Khān, was the founder of the Suri Empire in India, with its capital in Sasaram in modern-day Bihar. He introduced the currency of rupee. An ethnic Afghan, Sher Shah took control of the Mughal Empire in 1538. After his accidental death in 1545, his son Islam Shah became his successor. He first served as a private before rising to become a commander in the Mughal army under Babur and then the governor of Bihar. In 1537, when Babur's son Humayun was elsewhere on an expedition, Sher Shah overran the state of Bengal and established the Suri dynasty. A brilliant strategist, Sher Shah proved himself as a gifted administrator as well as a capable general. His reorganization of the empire laid the foundations for the later Mughal emperors, notably Akbar, son of Humayun.\\nDuring his seven-year rule from 1538 to 1545, he set up a new economic and military administration, issued the first Rupiya from \\"Taka\\" and organized the postal system of the Indian Subcontinent. Some of his strategies and contributions were later idolized by the Mughal emperors, most notably Akbar."},{"page_url":"https://de.wikipedia.org/wiki/Gutshaus_M%C3%B6thlitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Gutshaus_M%C3%B6thlitz_2.jpg","page_title":"Gutshaus Möthlitz","context_page_description":"Das Gutshaus Möthlitz befindet sich im Zentrum des Ortes Möthlitz im Westen des Landkreises Havelland. Das Gutshaus gehörte zum ehemaligen Rittergut Möthlitz."},{"page_url":"https://es.wikipedia.org/wiki/Cortes_de_Palencia_(1313)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Iglesia_de_San_Francisco.JPG","page_title":"Cortes de Palencia (1313)","context_page_description":"Cortes de Palencia de 1313. Cortes del reino de Castilla celebradas en la ciudad de Palencia en el año 1313, durante la minoría de edad de Alfonso XI de Castilla.\\nFueron las primeras Cortes del reinado de Alfonso XI, y en ellas se intentó poner orden en los asuntos del reino y designar al tutor o tutores de dicho monarca durante su minoría de edad, aunque al final no se consiguió alcanzar ningún acuerdo y, a pesar de los deseos del infante Pedro y de su madre, la reina María de Molina, los partidarios del infante Juan le nombraron a él único tutor del rey y encomendaron la custodia y la crianza de Alfonso XI a su madre, la reina Constanza de Portugal, aunque el otro bando nombró a su vez únicos tutores del rey a la reina María de Molina y al infante Pedro.​"},{"page_url":"https://es.wikipedia.org/wiki/Bancos_Externos","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Jockeys_ridge_state_park.jpg","page_title":"Bancos Externos","context_page_description":"Bancos Externos es una cadena de islas que cubre la mitad de la costa de Carolina del Norte. Las islas separan el Currituck Sound, el Albemarle Sound, y el Pamlico Sound del océano Atlántico.\\nEl primer vuelo de los hermanos Wright en un vehículo más pesado del aire ocurrió en los Bancos Externos el 17 de diciembre de 1903 en Kill Devil Hills, cerca del municipio de Kitty Hawk.​ El Monumento Nacional de los Hermanos Wright conmemora los vuelos históricos.\\nLa Colonia de Roanoke fue la primera colonia inglesa en América. La colonia fue fundada en 1587 por Walter Raleigh pero se convirtió en una leyenda cuando los 117 colonos desaparecieron misteriosamente. La obra de teatro La Colonia Perdida fue escrita para conmemorar la historia de los colonos y sigue siendo una parte muy importante de la cultura de los Bancos Externos.\\nA causa de las corrientes muy peligrosas y la alta cantidad de naufragios que han ocurrido allí, los Outer Banks son conocidos también como el Cementerio del Atlántico. El Museo del Cementerio del Atlántico está ubicado en Hatteras Village."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89conomie_de_la_Charente-Maritime","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Cognac_pot_still_DSC04032.JPG","page_title":"Économie de la Charente-Maritime","context_page_description":"Longtemps dominée par l'agriculture et des activités traditionnelles et profondément marquée par une très forte ruralité, la Charente-Maritime s'affranchit peu à peu de l'image d'un département rural et pauvre. Elle est devenue avant le début du XXIᵉ siècle un territoire attractif, grâce à son littoral, atout majeur qui a largement contribué à moderniser son économie où le tourisme y joue un rôle déterminant.\\nAujourd'hui, l'économie de la Charente-Maritime se caractérise par une agriculture en profonde mutation et par des activités maritimes encore importantes où le département est le leader national dans la production des huîtres et des moules. Cette économie départementale se distingue par la faiblesse de son industrialisation qui n'y occupe plus qu'une personne sur cinq mais celle-ci est largement compensée par la prédominance du secteur tertiaire.\\nLa tertiairisation de l'économie de ce département, stimulée en grande partie par le tourisme où la Charente-Maritime est la deuxième destination touristique de la France métropolitaine, profite davantage aux villes principales et au littoral qui y concentrent l'essentiel des activités économiques de la Charente-Maritime."},{"page_url":"https://de.wikipedia.org/wiki/Colin_Greenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Colin_Greenland.jpg","page_title":"Colin Greenland","context_page_description":"Colin Greenland ist ein britischer Science-Fiction-Schriftsteller. Bereits mit seiner ersten Erzählung gewann er den zweiten Preis des Faber & Faber-Wettbewerbs. Sein Roman Take back Plenty wurde schließlich mit den wichtigsten britischen Science-Fiction-Preisen ausgezeichnet: British Science Fiction Association Award und Arthur C. Clarke Award.\\nGreenlands erstes veröffentlichtes Buch, The Entropy Exhibition: Michael Moorcock and the UK New Wave war eine kritische Betrachtung der sogenannten New Wave in der britischen Science Fiction, basierend auf seiner Doktorarbeit. Danach veröffentlichte er einige Fantasy-Romane wie Daybreak on a Different Mountain, ehe er zur SF wechselte. Die erfolgreichsten Werke veröffentlichte er mit der Plenty-Reihe, die er 1990 mit Take Back Plenty begann und mit Seasons of Plenty, The Plenty Principle und Mother of Plenty fortsetzte.\\nGreenland schrieb auch Bücher, die nicht der SF zurechnen sind, wie den Mainstream-Roman Finding Helen über die Arbeit an der Erinnerung."},{"page_url":"https://la.wikipedia.org/wiki/Boinville-le-Gaillard","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Map_commune_FR_insee_code_78071.png","page_title":"Boinville-le-Gaillard","context_page_description":"Boinville-le-Gaillard est commune Francicum 614 incolarum praefecturae Evelinarum in regione Insula Franciae."},{"page_url":"https://vi.wikipedia.org/wiki/Rhyothemis_graphiptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Rhyothemis_graphiptera_-_Graphic_Flutterer_%281%29.jpg","page_title":"Rhyothemis graphiptera","context_page_description":"Rhyothemis graphiptera là loài chuồn chuồn trong họ Libellulidae. Loài này được Rambur mô tả khoa học đầu tiên năm 1842."},{"page_url":"https://it.wikipedia.org/wiki/Brian_Henton","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Internationale_Formule_Vee_autoraces%2C_Zandvoort%2C_Bestanddeelnr_924-7995.jpg","page_title":"Brian Henton","context_page_description":"Brian Henton è un pilota automobilistico britannico che ha partecipato anche alle competizioni di Formula 1.\\nDopo una breve ma fortunata carriera nelle formule minori britanniche ottiene un volante di Formula 1 nella stagione 1975. Con la Lotus partecipa a tre Gran Premi, senza ottenere risultati di rilievo.\\nNel 1976, non potendo avere una vettura competitiva per la Formula 2 decide di non correre. L'anno successivo viene ingaggiato dal team British American Racing che gestisce una March. In quattro Gran Premi ottiene solo un decimo posto nel gran premio di Long Beach e tre non qualificazioni. Termina la stagione con la Boro. Nel 1978 proverà la Surtees di Keegan durante le prove del gran premio d'Austria, ma senza risultare come ufficialmente iscritto.\\nTra il 1978 e il 1980 corre in Formula 2, chiudendo questa stagione presso l'autodromo di Pergusa, con il 2º posto al Gran Premio di Enna. Diventò vicecampione europeo nel 1979 e campione nel 1980 con la Toleman, proprio ad Enna. Nel 1981 la Toleman decide di passare alla Formula 1 mantenendo Henton come pilota. L'annata sarà disastrosa. Su 12 tentativi Henton arriverà solo una volta decimo."},{"page_url":"https://fr.wikipedia.org/wiki/C%C3%A9ramique_Moorcroft","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/MoorcroftDish.jpg","page_title":"Céramique Moorcroft","context_page_description":"Moorcroft est une manufacture de céramique britannique basée à Burslem, Stoke-on-Trent, Staffordshire, qui a été fondée à la fin du XIXᵉ siècle par William Moorcroft."},{"page_url":"https://id.wikipedia.org/wiki/Gunung_Haruna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Mount_Haruna_Mountaintop_Relief_Map%2C_SRTM-1%2C_Unmarked.jpg","page_title":"Gunung Haruna","context_page_description":"Gunung Haruna adalah sebuah gunung stratovolcano aktif yang terletak di bagian timur pulau Honshu atau lebih tepatnya di kota Takasaki, Gunma, Jepang. Gunung ini memiliki ketinggian 1449 m, terbentuk sekitar 300.000 tahun yang lalu, dan letusan terakhir yang diketahui adalah sekitar tahun 550 masehi."},{"page_url":"https://en.wikipedia.org/wiki/The_Big_Buddha_(Hong_Kong)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Tian_Tan_Buddha_2013.JPG","page_title":"The Big Buddha (Hong Kong)","context_page_description":"Tian Tan Buddha is a large bronze statue of Buddha Shakyamuni, completed in 1993, and located at Ngong Ping, Lantau Island, in Hong Kong. The statue is sited near Po Lin Monastery and symbolises the harmonious relationship between man and nature, people and faith. It is a major centre of Buddhism in Hong Kong, and is also a tourist attraction."},{"page_url":"https://fr.wikipedia.org/wiki/Winden_am_See","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/S%C3%A1sony01.jpg","page_title":"Winden am See","context_page_description":"Winden am See est une commune autrichienne du district de Neusiedl am See dans le Burgenland."},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%A1nos_Kamm%C3%A9nos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Panos_Kammenos.jpg","page_title":"Pános Kamménos","context_page_description":"Panagiotis Kamménos, dit Pános Kamménos, en grec, est un homme politique grec. Il est le président et fondateur des Grecs indépendants. Il est ministre de la Défense nationale dans le gouvernement grec, dirigé par Aléxis Tsípras de janvier à août 2015 et de septembre 2015 à janvier 2019."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86%D1%86%D0%BE_%D0%A2%D1%8C%D0%B5%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Palazzo_Thiene_Quattro_Libri.jpg","page_title":"Палаццо Тьене","context_page_description":"Палаццо Тьене — дворец в городе Виченца, построенный в 1550—1551 годах великим итальянским архитектором позднего Возрождения Андреа Палладио.\\nБудущий основоположник палладианства и классицизма в этой своей ранней работе довольно сдержан. Внимательно изучая «Десять книг об архитектуре» Витрувия и развив его идею дома с атриумом и перистилем, зодчий создал новый тип городского дворца — палаццо. В ранних работах в Виченце - палаццо Тьене Изеппо да Порто Паладио ещё близок флорентийским палаццо XV века, однако уже в эти работы демонстрируют тонкое понимание архитектоники ордера. В 1994-м году дворец был внесен в список объектов Всемирного Культурного Наследия ЮНЕСКО. Сейчас в здание палаццо содержит картинную галерею, в которой представлены произведения с XV по XIX век, 300 гравюр XVIII века, первые печатные книги, имеется также раздел, посвященный керамике и скульптуре."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%B5%E5%BA%AB%E7%9C%8C%E7%AB%8B%E6%98%8E%E7%9F%B3%E5%85%AC%E5%9C%92%E7%AC%AC%E4%B8%80%E9%87%8E%E7%90%83%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Akashi_baseball_field02.JPG","page_title":"兵庫県立明石公園第一野球場","context_page_description":"兵庫県立明石公園第一野球場は、兵庫県明石市の兵庫県立明石公園内にある硬式野球が行える野球場。施設は兵庫県が所有し、公益財団法人兵庫県園芸・公園協会が指定管理者として運営管理を行っている。\\nなお、神戸市東灘区に本社を置くトーカロが命名権を取得しており、2011年7月から「明石トーカロ球場」の呼称を用いている。"},{"page_url":"https://en.wikipedia.org/wiki/Yali_(mythology)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Yali_pillars1_in_Aghoreshwara_Temple_in_Ikkeri.jpg","page_title":"Yali (mythology)","context_page_description":"Yali is a mysterious creature seen in many South Indian temples, often sculpted onto the pillars. It may be portrayed as part lion, part elephant and part horse, and in similar shapes. Also, it has been sometimes described as a leogryph, with some bird-like features.\\nDescriptions of and references to yalis are very old, but they became prominent in south Indian sculpture in the 16th century. Yalis were believed to be more powerful than the lion, the tiger or the elephant."},{"page_url":"https://cs.wikipedia.org/wiki/Polonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Polacy_w_Wilnie.jpg","page_title":"Polonia","context_page_description":"Polonia je latinské jméno Polska a označení polské diaspory ve světě. Velikost polské diaspory se odhaduje na 15 až 20 milionů lidí. Největší populace Poláků žijících mimo Polsko jsou v Německu, ve Francii, ve Spojených státech, v Kanadě a Brazílii.\\nV Česku žije podle sčítání lidu z roku 2001 celkem 51 968 Poláků, a to zejména ve východní části českého Těšínska. Největší procentuální poměr Poláků k ostatním obyvatelům ze všech obcí v Česku je v obci Hrádek, kde se v roce 2001 k polské národnosti hlásilo skoro 43% obyvatel obce.\\nDalší sčítání lidu proběhlo v roce 2011 a k polské národnosti se přihlásilo 39 269 obyvatel České republiky.\\nPod názvem Polonia jezdí i mezinárodní vlak EuroCity mezi Varšavou, Bohumínem, Břeclaví a Vídní."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B5%D0%BD%D0%B8_%D0%B5_%D0%9B%D0%BE%D0%B0%D0%B7%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Besny_et_Loizy_%28Aisne%29_mairie.JPG","page_title":"Бени е Лоази","context_page_description":"Бени е Лоази насеље је и општина у североисточној Француској у региону Пикардија, у департману Ен која припада префектури Лаон.\\nПо подацима из 2011. године у општини је живело 370 становника, а густина насељености је износила 37,91 становника/km². Општина се простире на површини од 9,76 km². Налази се на средњој надморској висини од 80 метара."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A7%90%E7%BE%8E%E5%9C%8B%E8%87%BA%E5%8C%97%E7%B6%93%E6%BF%9F%E6%96%87%E5%8C%96%E4%BB%A3%E8%A1%A8%E8%99%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/%E5%8F%B0%E7%81%A3%E9%A7%90%E7%BE%8E%E5%9C%98%E9%AB%94%E8%88%89%E8%A1%8C%E5%85%83%E6%97%A6%E5%8D%87%E6%97%97%E5%84%80%E5%BC%8F_%2801%29.jpg","page_title":"駐美國臺北經濟文化代表處","context_page_description":"駐美國臺北經濟文化代表處，亦稱中華民國駐美國代表處，是中華民國在美國設置的駐外代表處，為中華民國駐美國的實質大使館。館長為中華民國駐美國代表。現任代表為蕭美琴，另有兩位副代表薛美瑜、黃敏境。代表處總處位於華盛頓特區，總管所有涉及台灣與美國雙邊關係的第一線工作事宜，同時管理中華民國在美國各地設置的駐外辦事處。駐美代表處除了專責與美國聯邦政府的聯繫交涉外，其領事服務轄區為華盛頓哥倫比亞特區、德拉瓦州、馬里蘭州、維吉尼亞州以及西維吉尼亞州。"},{"page_url":"https://no.wikipedia.org/wiki/Jekaterina_Skudina","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/SkudinaEkaterina8.jpg","page_title":"Jekaterina Skudina","context_page_description":"Jekaterina Jurjevna Skudina, russisk Екатерина Юрьевна Скудина er en russisk seiler som spesialiserer seg i matchracing. Under Sommer-OL 2012 i London representerte hun landet sitt, der hun ble nummer 4."},{"page_url":"https://no.wikipedia.org/wiki/Fylkesvei_776","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Torfjellet.jpg","page_title":"Fylkesvei 776","context_page_description":"Fylkesvei 776 går mellom Hofles i Nærøysund og Romstad i Høylandet. Veiens lengde er 57,9 km.\\nDen tar av fra fylkesvei 17 ved Okstad og går i retning nordvest til Salsbruket, deretter langs Oppløyfjorden til Geisnes, og med ferge til Hofles."},{"page_url":"https://it.wikipedia.org/wiki/Democrazia_ateniese","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/AncientAgoraofAthensColour.jpg","page_title":"Democrazia ateniese","context_page_description":"La democrazia ateniese è la prima forma di governo democratico attestata nella storia. Imitato da altre città, il sistema ateniese prevedeva che un limitato numero di cittadini, adulti e di sesso maschile, dai 30.000 ai 50.000 su una popolazione di 250/300.000, potesse proporre disegni di legge e votare quelle di iniziativa di un organo esecutivo, anch'esso selezionato tra la popolazione. Non è da sottovalutare, inoltre, il ruolo del teatro e della satira politica come strumento di propaganda di influenza della pubblica opinione.\\nTra i principali esponenti che contribuirono allo sviluppo della democrazia ateniese si annoverano: Solone, Clìstene ed Efialte.\\nIl politico democratico più influente fu, tuttavia, Pericle, con cui la democrazia raggiunse la sua forma più compiuta. Dopo la sua morte, la democrazia ateniese fu interrotta due volte da brevi parentesi oligarchiche, verso la fine della guerra del Peloponneso. Nel corso del IV secolo, pur con alcune riforme, il sistema fu sostanzialmente mantenuto fino alla sua soppressione, nel 322 a.C., ad opera dei Macedoni."},{"page_url":"https://pl.wikipedia.org/wiki/Infiniti_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/2nd-Infiniti-I30.jpg","page_title":"Infiniti I","context_page_description":"Infiniti I − samochód osobowy klasy średniej-wyższej produkowanych przez japońską firmę Infiniti w latach 1996–2004. Następca modelu J30. Dostępny jako 4-drzwiowy sedan. Do napędu używano silników V6 o pojemności 3,0 i 3,5 litra. Moc przenoszona była na oś przednią poprzez 4-biegową automatyczną bądź 5-biegową manualną skrzynię biegów. Powstały dwie generacje modelu."},{"page_url":"https://id.wikipedia.org/wiki/Kepulauan_Hawaii_Barat_Laut","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Hawaiianislandchain_USGS.png","page_title":"Kepulauan Hawaii Barat Laut","context_page_description":"Kepulauan Hawaii Barat Laut, atau disebut juga Kepulauan Leeward, adalah kepulauan dan atoll di bagian barat laut Kepulauan Hawaii. Kepulauan ini merupakan bagian dari negara bagian Hawaii, Amerika Serikat, kecuali Atoll Midway. Kepualaun Hawaii Barat Laut memiliki luas sebesar 8.0485 km².\\nBagian-bagian dari Kepulauan Hawaii Barat Laut adalah:\\nNihoa\\nNecker\\nFrench Frigate Shoals\\nGardner Pinnacles\\nKarang Maro\\nLaysan\\nLisianski\\nAtol Pearl dan Hermes\\nMidway\\nKure"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%BC_%D0%B2_%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%D0%9F%D0%B0%D0%BC%D0%B5%D1%82%D0%BD%D0%B8%D0%BA_%D0%9D%D0%B5%D0%B3%D1%83%D1%88%D0%B5%D0%B2%D0%BE1.jpg","page_title":"Список памятников русским в Болгарии","context_page_description":"В Болгарии установлено свыше 400 памятников русским. Многие улицы, города и сёла названы в честь русских общественных деятелей и полководцев, погибших или прославившихся в Русско-турецкую войну 1877—1878, когда Болгария снова приобрела свою свободу после пятивекового османского владычества."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Banstead","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Banstead_Church_-_geograph.org.uk_-_1159947.jpg","page_title":"Banstead","context_page_description":"Banstead sī Liân-ha̍p Ông-kok Eng-lân Tang-lâm Eng-lân Tōa-khu Surrey Kūn ê chi̍t ê bîn-chèng kàu-khu.\\nPang-bô͘:Surrey ê bîn-chèng kàu-khu"},{"page_url":"https://en.wikipedia.org/wiki/Pet%C5%91fi_Csarnok","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/PetofiCsarnok-Entrance.JPG","page_title":"Petőfi Csarnok","context_page_description":"Petőfi Csarnok, often called PeCsa, was a leisure center and concert hall in Budapest, Hungary. Placed in the Városliget, it is a famous concert spot for pop/rock music, serving as home for cultural programs, exhibitions and fan clubs. The building consisted of a 1020 square metre hall, and an open stage with a guest capacity of 4500 people. After a number of delays the building was finally demolished in early 2017 as part of the reconstruction of the surrounding park."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D0%BD%D1%8B%D1%85_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_WWE_Raw","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/WWE_Tag_team_champs_Primo_and_Epico.jpg","page_title":"Список командных чемпионов WWE Raw","context_page_description":"Командное чемпионство WWE Raw — командный чемпионат в профессиональном реслинге, который оспаривается в WWE, на бренде Raw. Чемпионат был представлен как Командное чемпионство WWE в 2002 году, первоначально защищался на бренде SmackDown!. Это один из четырёх мужских командных титулов в федерации и двух главных командных титулов основного ростера на ряду с командными титулами SmackDown, а также двух титулов подготовительный брендов командными титулами NXT и командными титулами NXT UK\\nКомандное чемпионство в WWE включает в себя огромную историю многих титулов, существовавших в WWE/WWF, а также титулы командных чемпионов WCW и ECW. Первоначально в WWE существовал лишь один титул — «Командные Чемпионы мира». В 2002 году, после того, как WWE купило WCW и ECW был создан титул «Командных чемпионов WWE». Титул Командных чемпионов WWE был эксклюзивным для шоу SmackDown!, а титул Командных чемпионов мира для Raw. В 2007 году, когда ECW был возрожден как бренд, титул Командных Чемпионов WWE перешёл туда вместе с чемпионами Мизом и Джоном Морриссоном и стал доступен для всех трёх брендов. В 2009 году Карлито и Примо со SmackDown!"},{"page_url":"https://en.wikipedia.org/wiki/Meeme_(community),_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Meeme_Poll_House_Meeme_Wisconsin.jpg","page_title":"Meeme (community), Wisconsin","context_page_description":"Meeme is an unincorporated community located in the town of Meeme, Manitowoc County, Wisconsin, United States. It is located at both the intersections of WIS-42 and CTH-XX"},{"page_url":"https://vi.wikipedia.org/wiki/Igor_Mitoraj","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Centurione_I_by_Igor_Mitoraj_with_Michaelsberg_Abbey%2C_Bamberg.jpg","page_title":"Igor Mitoraj","context_page_description":"Igor Mitoraj là một họa sĩ và nhà điêu khắc người Ba Lan. Nổi tiếng với các tác phẩm điêu khắc bộ phận về cơ thể người, thường được tạo ra cho các công trình sắp đặt công cộng quy mô lớn, ông được xem là một trong những nhà điêu khắc Ba Lan được quốc tế công nhận."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B8%D0%BD%D1%86%D0%B8_(%D0%92%D0%B0%D1%99%D0%B5%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Selo_Klinci_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_Panorama_3_-_Pogled_prema_jugozapadu.jpg","page_title":"Клинци (Ваљево)","context_page_description":"Клинци су насељено место града Ваљева у Колубарском округу са атаром површином од 470 ha. Према попису из 2002. било је 269 становника, док према резултатима пописа из 2011. у Клинцима има 233 становника.\\nНалазе се на петом километру пута Ваљево - Сувобор - Чачак, између села Белошевац, Петница, Жабари и Пауне, заузимајући скоро читаву косу брда која почиње над Петничком пећином и пружа се према северу. Старо село било је Паланка, и да је ту било село пре и за време косовске битке доказује и то што су се до скора изоравали крхотине судова, остаци грађе, разног алата и старог новца из турског доба.\\nОвде се налази Кућа породице Дудић, као споменик културе."},{"page_url":"https://es.wikipedia.org/wiki/Notre-Dame-du-Mont-Carmel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Notre-Dame-du-Mont-Carmel_Quebec_location_diagram.png","page_title":"Notre-Dame-du-Mont-Carmel","context_page_description":"Notre-Dame-du-Mont-Carmel, también conocido antes como La Montagne, Mont-Carmel y Valmont, ​ es un municipio perteneciente a la provincia de Quebec en Canadá. Es uno de los municipios pertenecientes al municipio regional de condado de Les Chenaux en la región administrativa de Mauricie.​"},{"page_url":"https://nl.wikipedia.org/wiki/Jules-Victor_Daem","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Jules_Victor_Daem_bischop_Sint_Baafskathedral_IMG_4929_ghent.JPG","page_title":"Jules-Victor Daem","context_page_description":"Jules-Victor Daem was een Belgisch rooms-katholiek geestelijke. Hij was van 1962 tot 1977 de 19de bisschop van Antwerpen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D8%B9%D8%A8_%D8%A7%D9%84%D8%A3%D9%83%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Maejantai_Chiang_Rai_province_08.JPG","page_title":"شعب الأكها","context_page_description":"شعب الأكها هم شعب ينتمي لقبائل التلال الأصلية التي تسكن قرى صغيرة في أعالي جبال تايلاند وبورما ولاوس ومقاطعة يونان الصينية. قدم شعب الأكها من الصين إلى جنوب شرقي آسيا في مطلع القرن العشرين الميلادي. فلقد سببت الحروب الأهلية في بروما ولاوس ارتفاعًا في تدفق أعداد المهاجرين من شعب الأكها، فيعيش الآن قرابة 80,000 منهم في كلًا من تشاينغ راي وتشاينغ ماي المقاطعات الشمالية لتايلاند. وتعد قبيلة الأكها واحدة من أكبر قبائل التلال الأصلية. ويمكن للسياح زيارة العديد من قراهم خلال الرحلات السياحية التي تنظم في هذه المدن.\\nيتحدث شعب الأكها لغة الأكها وهي لغة تنحدر من فروع لغة \\"اللولويش\\" وهي لغة من عائلة اللغات التبيتية البورمية. تنتمي لغة الأكها عن قرب للغة \\"ليسو\\" ويعتقد أن الأكها كانت تنتمي في السابق إلى قبائل \\"اليي\\" التي تعيش على الصيد وهم الشعب الذي حكم سهول \\"باوشان\\" و\\"تينج تشونج\\" في يونان الصينية قبل غزو أسرة مينغ لها عام 1644م."},{"page_url":"https://es.wikipedia.org/wiki/A_Rocket_to_the_Moon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/A_Rocket_to_the_Moon_2011.jpg","page_title":"A Rocket to the Moon","context_page_description":"A Rocket to the Moon es una banda de Braintree, Massachusetts, Estados Unidos. Su género musical se identifica con el powerpop e indie. Su principal integrante es Nick Santino. Nick Santino empezó la banda en el verano del 2006 como un experimento y decidió seguir con la idea porque tuvo una buena respuesta del público. El 14 de mayo de 2008 lanzaron su primer video y sencillo If Only They Knew del EP Greetings From... de 2008. A Rocket to the Moon lanzó su primer disco de estudio, llamado On Your Side, el 13 de octubre de 2009."},{"page_url":"https://it.wikipedia.org/wiki/Ardea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/ItaliaLazioArdea_ChiesaPortaleFregi.jpg","page_title":"Ardea","context_page_description":"Ardea è un comune italiano di 49 705 abitanti della città metropolitana di Roma Capitale nel Lazio."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%87%E0%B4%A8%E0%B5%8D%E0%B4%A4%E0%B5%8D%E0%B4%AF%E0%B4%AF%E0%B4%BF%E0%B4%B2%E0%B5%86_%E0%B4%AA%E0%B4%95%E0%B5%8D%E0%B4%B7%E0%B4%BF%E0%B4%95%E0%B4%B3%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%AA%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Orthotomus_sutorius.jpg","page_title":"ഇന്ത്യയിലെ പക്ഷികളുടെ പട്ടിക","context_page_description":"ഇന്ത്യയിൽ കണ്ടെത്തിയിട്ടുള്ള പക്ഷികളുടെ പട്ടികയാണിത്. ഇന്ത്യയിൽ ആകമാനം 1301 സ്പീഷീസ് പക്ഷികൾ ഉണ്ടെന്നാണ് കണക്ക്. ഇതിൽ 42 എണ്ണം തദ്ദേശ ഇനങ്ങളാണ്. ആകെ പക്ഷികളിൽ 26 ഇനങ്ങളെ ആപൂർവ്വമായോ, അസ്വാഭാവികമായോ കണ്ടുവരുന്നു. ഇന്ത്യയിലെ 82 ഇനം പക്ഷികൾ വംശനാശഭീഷണി നേരിടുന്നു. മയിലിനെയാണ് ഭാരതസർക്കാർ ദേശീയപക്ഷിയായി അംഗീകരിച്ചിരിക്കുന്നത്.\\n2006-ൽ അരുണാചൽ പ്രദേശിൽ വെച്ച് കണ്ടെത്തിയ Bugun Liocichla പക്ഷിയാണ് ഇന്ത്യയിലെ ഒരു പുതിയ സ്പീഷീസ്. വംശനാശം സംഭവിച്ചു എന്ന് വിശ്വസിക്കപെടുകയും പിൽകാലത്ത് കണ്ടെത്തപ്പെടുകയും ചെയ്ത ഒരു പക്ഷിയാണ് Jerdon's Courser.\\nവർഗ്ഗവിഭജനവിജ്ഞാനീയം അനുസരിച്ചാണ് ഈ പട്ടികയിൽ പക്ഷികളെ ഉൾപ്പെടുത്തിയിരിക്കുന്നത്. കൂടാതെ പക്ഷികളുടെ സാധാരണ നാമവും, ശാസ്ത്രീയനാമവും രേഖപ്പെടുത്തിയിരിക്കുന്നു.\\nതാഴെനൽകിയിരിക്കുന്ന സൂചകങ്ങളും പക്ഷിവിഭാഗങ്ങളെ കുറിച്ചറിയുന്നതിന് സഹായിക്കുന്നു.\\n/ യാദൃച്ഛികം ഇന്ത്യയിൽ അപൂർവമായി കണ്ടുവരുന്ന പക്ഷിവർഗ്ഗങ്ങൾ.\\n/ സ്വദേശീയം ഇന്ത്യയിലെ സ്വദേശി പക്ഷിവർഗ്ഗങ്ങൾ.\\n/(I) അവതരിപ്പിക്കപ്പെട്ടത് പുറം രാജ്യങ്ങളിൽ നിന്ന് ഇന്ത്യയിൽ അവതരിപ്പിക്കപെട്ട പക്ഷിയിനങ്ങൾ\\n/ വംശനാശം സംഭവിക്കപ്പെട്ടത് ഇന്ത്യയിൽ ഇനികാണാൻ സാധ്യതയില്ലാത്ത് പക്ഷികൾ; ഒരു പക്ഷേ ലോകത്തിന്റെ മറ്റുഭാഗങ്ങളിൽ കണ്ടെന്നുവരാം"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Hudson_River_School_artists","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Winter-Landscape-Valley-of-the-Catskills-%281866%29-Moore.jpg","page_title":"List of Hudson River School artists","context_page_description":"The following is a list of painters in the Hudson River School, a mid-19th-century American art movement. The movement was led by a group of landscape painters whose aesthetic vision was influenced by romanticism. Some of these artists are also considered luminists, a related movement in mid-19th-century American painting that was characterized in the twentieth century. Their paintings depict the Hudson River Valley and the surrounding area, as well as the Catskill Mountains, Adirondack Mountains, and White Mountains of New Hampshire. Note that \\"school\\" in this sense refers to a group of people whose outlook, inspiration, output, or style demonstrates a common thread, rather than a learning institution."},{"page_url":"https://pl.wikipedia.org/wiki/Julia_Rayska","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Julia_Rayska%2C_Bukiet_kwiat%C3%B3w%2C_1859.jpg","page_title":"Julia Rayska","context_page_description":"Julia Rayska, z domu Waniczek – polska malarka, przedstawicielka sztuki XIX wieku. Tworzyła przede wszystkim w duchu sztuki biedermeieru."},{"page_url":"https://nl.wikipedia.org/wiki/Rupsband","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Caterpillar_60_%286602619601%29.jpg","page_title":"Rupsband","context_page_description":"Rupsbanden zijn grote modulaire banden die onder andere op graafmachines, tanks, bulldozers, bouwvoertuigen en andere rupsvoertuigen voor onverhard terrein worden gebruikt."},{"page_url":"https://sv.wikipedia.org/wiki/Nolltaxa_i_kollektivtrafik","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Luxtram_2018_06.jpg","page_title":"Nolltaxa i kollektivtrafik","context_page_description":"Nolltaxa i kollektivtrafik innebär att det är gratis för huvuddelen, eller alla, av resenärerna att resa i kollektivtrafik."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Regensburg-Zentrum","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/D.-Martin-Luther-Str._10_Regensburg-1.jpg","page_title":"Liste der Baudenkmäler in Regensburg-Zentrum","context_page_description":"Auf dieser Seite sind die Baudenkmäler der Oberpfälzer Stadt Regensburg-Zentrum zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D1%81%D0%BB%D0%B8,_%D0%9F%D1%80%D0%B8%D1%81%D1%86%D0%B8%D0%BB%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Elvis_and_priscilla.jpg","page_title":"Пресли, Присцилла","context_page_description":"Присци́лла Энн Болье Пре́сли, урождённая Ва́гнер — американская актриса и предприниматель, единственная жена певца Элвиса Пресли. Как актриса она наиболее известна по роли Дженны Уэйд в телесериале «Даллас», а также по серии фильмов «Голый пистолет»."},{"page_url":"https://es.wikipedia.org/wiki/Agathosma_serpyllacea","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Agathosma_serpyllacea.jpg","page_title":"Agathosma serpyllacea","context_page_description":"Agathosma serpyllacea, es una especie de arbusto perteneciente a la familia de las rutáceas. Se encuentra en Sudáfrica.​"},{"page_url":"https://fr.wikipedia.org/wiki/Fuji_Television","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Fuji.TV.1.JPG","page_title":"Fuji Television","context_page_description":"Fuji Television Network, Incorporated, également connue sous le nom de Fuji TV, est une chaîne de télévision privée japonaise. Il s'agit de la chaîne centrale du réseau Fuji News Network et de Fuji Network System.\\nLes locaux de Fuji Television se situent à Odaiba, Minato-ku, à Tōkyō, dans un bâtiment dessiné par Kenzō Tange."},{"page_url":"https://gl.wikipedia.org/wiki/Galer%C3%ADa_de_imaxes_de_Estevesi%C3%B1os,_Estevesi%C3%B1os,_Monterrei","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Estevesinhos_%2879%29.jpg","page_title":"Galería de imaxes de Estevesiños, Estevesiños, Monterrei","context_page_description":"Estevesiños é un lugar da parroquia homónima do concello de Monterrei."},{"page_url":"https://cs.wikipedia.org/wiki/Ostrov_(okres_Chrudim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Ostrov_%28okres_Chrudim%29_znak.jpg","page_title":"Ostrov (okres Chrudim)","context_page_description":"Obec Ostrov se nachází v okrese Chrudim, kraj Pardubický, necelých 11 km severovýchodně od Chrasti. Žije zde 205 obyvatel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%96%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%85%D1%80%D0%B5%D0%B1%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/South_America_satellite_orthographic.jpg","page_title":"Гірський хребет","context_page_description":"Гірськи́й хребе́т, заст. ґрунь — велика лінійно витягнута позитивна форма рельєфу з чітко відбитими схилами, що перетинаються у верхній частині, гірська споруда, що має чітко виражені вісь, вервечку гірських вершин та схили. Одна з форм рельєфу."},{"page_url":"https://sl.wikipedia.org/wiki/Avrelijev_steber","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Inscription_Column_Marcus_Aurelius.jpg","page_title":"Avrelijev steber","context_page_description":"Avrelijev steber, rimski steber zmage na Piazza Colonna v Rimu, Italija. Dorski steber s spiralnim reliefom je bil po zgledu na Trajanov steber zgrajen v čast zmagam cesarja Marka Avrelija v markomanskih vojnah."},{"page_url":"https://es.wikipedia.org/wiki/Isla_Ngor","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/NgorIsland.JPG","page_title":"Isla Ngor","context_page_description":"La Isla Ngor​ es una pequeña isla en el país africano de Senegal, ​ que se encuentra fuera de la península de Cabo Verde, a 400 m de distancia del pueblo de Ngor en la punta de Almadies, cerca de Dakar.\\nLa población étnicamente es Lebou. Al igual que el pueblo, la isla es parte del distrito de Almadies en el departamento de Dakar."},{"page_url":"https://pl.wikipedia.org/wiki/Dekanat_kolski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Ko%C5%82o_-_ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw.Bogumi%C5%82a.jpg","page_title":"Dekanat kolski","context_page_description":"Dekanat kolski – jeden z 33 dekanatów rzymskokatolickiej diecezji włocławskiej. Przywrócony do istnienia 2 lutego 2015 r."},{"page_url":"https://sv.wikipedia.org/wiki/Asarums_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Asarums_kyrka_Exteri%C3%B6r_02.JPG","page_title":"Asarums kyrka","context_page_description":"Asarums kyrka är en kyrkobyggnad i Asarum i Karlshamns kommun i Lunds stift. Den är församlingskyrka i Asarums församling."},{"page_url":"https://uk.wikipedia.org/wiki/Confessions_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Madonna-jump-confessions2.jpg","page_title":"Confessions Tour","context_page_description":"Confessions Tour — сьомий світовий концертний тур американської співачки Мадонни, який проходив у 2006 році на підтримку її десятого студійного альбому Confessions on a Dance Floor. По завершенні Confessions Tour був визнаний найкасовішим турне сольної співачки в історії музики. Це досягнення занесено до Книги рекордів Гіннеса. 60 концертів туру відвідали понад 1 мільйон 200 тисяч глядачів."},{"page_url":"https://it.wikipedia.org/wiki/Musica_per_videogiochi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Mother_2_CD.jpg","page_title":"Musica per videogiochi","context_page_description":"Nata dalle prime melodie dei sintetizzatori, la musica per videogiochi è divenuta con il passare del tempo sempre più complessa soprattutto grazie all'evoluzione tecnologica dei mezzi adoperati per comporla.\\nA partire dal XXI secolo, sono aumentate le vendite delle colonne sonore di videogiochi nonché i concerti dedicati ad esse.\\nAlcuni autori recenti di musica per videogiochi includono Trent Reznor, Hans Zimmer e Michael Giacchino conosciuti anche in ambito cinematografico."},{"page_url":"https://de.wikipedia.org/wiki/Julien_Berthier","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Rue_Chapon%2C_Paris_-_View_from.JPG","page_title":"Julien Berthier","context_page_description":"Julien Berthier ist ein französischer Zeichner, Bildhauer und Installationskünstler."},{"page_url":"https://fr.wikipedia.org/wiki/Roger_Fry","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Roger_Fry_with_his_wife_Helen.jpg","page_title":"Roger Fry","context_page_description":"Roger Eliot Fry est un critique et théoricien de l'art britannique, particulièrement actif dans les premières décennies du XXᵉ siècle. Également peintre, il appartenait au Bloomsbury Group.\\nL'historien de l'art Kenneth Clark voyait en lui le successeur de John Ruskin ; Virginia Woolf publia sa biographie en 1940."},{"page_url":"https://fr.wikipedia.org/wiki/CAMI_Automotive","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/2010_Chevrolet_Equinox_LS_--_07-01-2009.jpg","page_title":"CAMI Automotive","context_page_description":"CAMI Automotive est un constructeur automobile de la société mère General Motors produit en 1986."},{"page_url":"https://vi.wikipedia.org/wiki/Hemiphractus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Hemiphractus_fasciatus_panamajuly2011.jpg","page_title":"Hemiphractus","context_page_description":"Hemiphractus là một chi động vật lưỡng cư trong họ Hemiphractidae, thuộc bộ Anura. Chi này có 6 loài và 17% bị đe dọa hoặc tuyệt chủng."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%95%9D%E5%82%8D%E8%99%9F%E9%98%B2%E8%AD%B7%E5%B7%A1%E6%B4%8B%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Japanese_cruiser_Unebi_1886.jpg","page_title":"畝傍號防護巡洋艦","context_page_description":"畝傍號防護巡洋艦是舊日本海軍的外購防護巡洋艦，為日本向法國羅亞爾阿特利耶和尚提耶公司所訂購，這也是日本第一艘購自法國的軍艦。本艦級只有單艘，因此本艦級也稱為畝傍級防護巡洋艦。\\n本艦作為對清朝的戰爭準備之一，完工後即起錨返回日本，然而卻在返航途中，從新加坡出港後即告失蹤。事後日本方面多方搜尋無果，只能將本艦除籍。\\n本艦艦名來源於奈良縣的畝傍山。在日本海軍的正式名稱為「畝傍艦」。除了「畝傍」一名外，候補名字還有「蜻蛉」、「磐余」"},{"page_url":"https://tr.wikipedia.org/wiki/AEK_(basketbol_tak%C4%B1m%C4%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Copa_Saporta.png","page_title":"AEK (basketbol takımı)","context_page_description":"AEK Basketbol Kulübü, kısaca AEK BK ya da AEK, AEK spor kulübünün bir parçası olan basketbol takımı. Kulüp Yunanistan'ın başkenti Atina'da yer almaktadır. 1924 yılında Yunan-Türk Savaşı'ndan kaçan Yunan sığınmacılar tarafından kurulmuştur."},{"page_url":"https://sk.wikipedia.org/wiki/Uri_(kant%C3%B3n)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Karte_Gemeinden_des_Kantons_Uri_farbig_2011.png","page_title":"Uri (kantón)","context_page_description":"Uri je nemeckojazyčný kantón. Hlavným mestom kantónu je Altdorf. Nachádza sa v strednom Švajčiarsku. Je rozdelený na 20 obcí a má druhú najnižšiu hustotu obyvateľstva. S 35-tisícmi obyvateľov sa zaraďuje medzi najmenej ľudnaté kantóny vo Švajčiarsku.\\nKantón Uri patrí k trom pôvodným kantónom, ktoré sa v roku 1291 po smrti nemeckého kráľa Rudolfa I. spojili na ochranu svojich «starých práv»."},{"page_url":"https://tr.wikipedia.org/wiki/SS_Lazio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Supercoppaitaliana.png","page_title":"SS Lazio","context_page_description":"Società Sportiva Lazio, 9 Ocak 1900'de İtalyan Ordusu mensupları tarafından kurulmuş bir Roma kulübüdür. Mavi-beyaz renklere sahip kulübün simgesi kartal, takma isimleri ise \\"Biancocelesti\\"dir. Ezeli rakibi AS Roma olup bütün derbilerden farklı olarak bu iki kulüp arasındaki siyasi görüş ayrılığı rekabeti kine dönüştürmektedir. Maçlarını 82,000 kişilik Olimpiyat Stadyumu'nda oynarlar.\\n\\"Lazio\\" kelimesinin kökeni Latince geniş anlamında olan \\"latiumdur\\" fakat bu ismi almalarının nedeni, Roma şehrinin İtalya'nın 1948 Anayasası'na göre 20 özerk bölgeden biri olan Lazio bölgesi içerisinde olmasıdır.Kulubün renkleri mavi-beyazdır. 1902 yılına kadar çeşitli sportif aktivitelerde bulunmuş, 1902 yılında ise futbol şubesi kurulmuştur.\\nII. Dünya Savaşı'ndan sonra S.S. takısı Waffen-SS'i anımsattığı için birçok takım değiştirmişken, İtalya'nın zamane diktatörü Benito Mussolini'nin de desteklediği Lazio, kulüp politikasını açığa vurmuş ve kararlı bir tutumla ismini değiştirmemiştir."},{"page_url":"https://de.wikipedia.org/wiki/Portlahorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Dam%C3%BCls-Gipfelkreuz-Portlahorn-01.jpg","page_title":"Portlahorn","context_page_description":"Das Portlahorn ist ein Berg des Bregenzerwaldgebirges, der auf dem Gemeindegebiet von Damüls gelegen ist. Der Blaue See ist etwa 280 m entfernt, die Portlaalpe etwa 1400 m und das Furkajoch etwa 3 km."},{"page_url":"https://fi.wikipedia.org/wiki/Blue_Flame","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Goodwood2007-121_The_Blue_Flame.jpg","page_title":"Blue Flame","context_page_description":"Blue Flame on Yhdysvalloissa suunniteltu rakettimoottoriauto, joka piti maanpinnan nopeusennätystä hallussaan vuodesta 1970 vuoteen 1983."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Indian_IT_companies","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Tidel_Park_gate_panorama.jpg","page_title":"List of Indian IT companies","context_page_description":"This is a list of notable companies in the information technology sector based in India. Top 10 companies are listed in descending order of their market capitalization, and other companies are listed alphabetically, grouped by the cities in which they are headquartered. Certain companies have main offices in more than one city, in which case they are listed under each, but minor offices and resources are not listed. Foreign companies are only listed if they have one of their main offices in India."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Psittaciformes_by_population","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Ara_ambigua.JPG","page_title":"List of Psittaciformes by population","context_page_description":"This is a list of Psittaciformes species by global population. While numbers are estimates, they have been made by the experts in their fields.\\nThis list is not comprehensive, as not all Psittaciformes have had their numbers quantified. All numbers, unless explicitly stated otherwise in the notes, regard individuals in the wild only."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%85%D1%82%D0%B5%D1%88_%D0%A0%D0%B0%D0%BC%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Dry_Drimia_maritima_%28Urginea_maritima%29%2C_at_the_north_edge_of_Ramon_crater_%28Makhtesh_Ramon%29%2C_Negev%2C_Israel.jpg","page_title":"Махтеш Рамон","context_page_description":"Махтеш Рамон є геологічною особливістю Ізраїльської пустелі Негев. Розташований на піку гори Негев, близько 85 км на південь від міста Беер-Шева. Махтеш Рамон не є кратером від метеорита або кратером вулканічного походження та є найбільшим в світі. Кратер має форму подовженого серця, довжина кратера — 40 км, 2-10 км в ширину та 500 метрів в глибину. Єдиним поселенням в цьому районі є невелике місто Міцпе-Рамон, розташоване на північному краю кратера. Сьогодні кратер і навколишній район є найбільшим національним парком Ізраїлю, заповідником Рамоном."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Declaration_of_Independence","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Jefferson%27s%2Bdeskdetail.jpg","page_title":"United States Declaration of Independence","context_page_description":"The United States Declaration of Independence is the pronouncement adopted by the Second Continental Congress meeting in Philadelphia, Pennsylvania, on July 4, 1776. The Declaration explained why the Thirteen Colonies at war with the Kingdom of Great Britain regarded themselves as thirteen independent sovereign states, no longer under British rule. With the Declaration, these new states took a collective first step toward forming the United States of America. The declaration was signed by representatives from New Hampshire, Massachusetts Bay, Rhode Island, Connecticut, New York, New Jersey, Pennsylvania, Maryland, Delaware, Virginia, North Carolina, South Carolina, and Georgia.\\nThe Lee Resolution for independence was passed by the Second Continental Congress on July 2 with no opposing votes. The Committee of Five had drafted the Declaration to be ready when Congress voted on independence. John Adams, a leader in pushing for independence, had persuaded the committee to select Thomas Jefferson to compose the original draft of the document, which Congress edited to produce the final version."},{"page_url":"https://ru.wikipedia.org/wiki/SIS755","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Elitegroup_755-A2_-_SiS_755-6676.jpg","page_title":"SIS755","context_page_description":"SIS755 — чипсет для материнской платы, выпущенный фирмой SIS в 2003 году. Предназначен на Socket 754. Поддерживал процессоры серии Athlon 64 и Sempron, ОЗУ DDR PC-3200, с порогом в 2 Гб. Использовал одноканальный контроллер памяти, встроенный в процессор.\\nЧипсет SIS755 был двухчиповым. Северным мостом являлся SIS755, а южным мостом — SIS964. Для соединения северного и южного моста в SiS755 используется фирменная 16-битная двунаправленная шина MuTIOL 1G, уже достаточно давно и успешно применяемая в продуктах SiS. Особенностью этой шины является её многопоточность. Пиковая пропускная способность MuTIOL 1G является 1.07 Гб в секунду."},{"page_url":"https://en.wikipedia.org/wiki/Citadel_of_Besan%C3%A7on","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Citadelle_de_Besan%C3%A7on_22.jpg","page_title":"Citadel of Besançon","context_page_description":"The Citadel of Besançon is a 17th-century fortress in Franche-Comté, France. It is one of the finest masterpieces of military architecture designed by Sébastien Le Prestre de Vauban. The Citadel occupies 11 hectares on Mount Saint-Etienne, one of the seven hills that protect Besançon, the capital of Franche-Comté. Mount Saint-Etienne occupies the neck of an oxbow formed by the river Doubs, giving the site a strategic importance that Julius Caesar recognised as early as 58 BC. The Citadel overlooks the old quarter of the city, which is located within the oxbow, and has views of the city and its surroundings.\\nThe fortification is well preserved. Today it is an important tourist site due both to its own characteristics and because it is the site of several museums. These museums include a museum of the Resistance and deportation, a museum focusing on traditional life in Franche-Comté and the region's archeological history, and a museum of natural history that includes a zoo, an insectarium, an aquarium, vivariums, a noctarium, a climatorium, a pedagogical exhibit on evolution, botanical gardens, and a children's farm. There is also a restaurant and shops."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Bonner_Ortsteil_Buschdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Bursche_Kreuz.jpg","page_title":"Liste der Baudenkmäler im Bonner Ortsteil Buschdorf","context_page_description":"Die folgende Liste enthält in der Denkmalliste ausgewiesene Baudenkmäler auf dem Gebiet des Bonner Ortsteils Buschdorf im Stadtbezirk Bonn.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Denkmalliste der Stadt Bonn, die von der Unteren Denkmalbehörde geführt wird. Grundlage für die Aufnahme in die Denkmalliste ist das Denkmalschutzgesetz Nordrhein Westfalens.\\nKarte mit allen Koordinaten des Ortsteils Buschdorf: OSM, Google"},{"page_url":"https://en.wikipedia.org/wiki/Kanagawa_Station_(Kanagawa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/KK-36_station_number.png","page_title":"Kanagawa Station (Kanagawa)","context_page_description":"Kanagawa Station is a railway station on the Keikyu Main Line in Kanagawa-ku, Yokohama, Kanagawa Prefecture, Japan, operated by the private railway operator Keikyu."},{"page_url":"https://pt.wikipedia.org/wiki/%C3%8Dndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Ramoji_Film_City%2C_Hyderabad_-_views_from_Ramoji_Film_City_%2835%29.JPG","page_title":"Índia","context_page_description":"Índia, oficialmente denominada República da Índia, é um país da Ásia Meridional. É o segundo país mais populoso, o sétimo maior em área geográfica e a democracia mais populosa do mundo. Delimitada ao sul pelo Oceano Índico, pelo mar da Arábia a oeste e pelo golfo de Bengala a leste, a Índia tem uma costa com 7 517 km de extensão. O país faz fronteira com Paquistão a oeste; China, Nepal e Butão ao norte e Bangladesh e Mianmar a leste. Os países insulares do Oceano Índico — Sri Lanka e Maldivas — estão localizados bem próximo da Índia.\\nLar da Civilização do Vale do Indo, de rotas comerciais históricas e de vastos impérios, o subcontinente indiano é identificado por sua riqueza comercial e cultural de grande parte da sua longa história. Quatro grandes religiões — hinduísmo, budismo, jainismo e siquismo — originaram-se no país, enquanto o zoroastrismo, o judaísmo, o cristianismo e o islamismo chegaram no primeiro milênio d.C. e moldaram a diversidade cultural da região."},{"page_url":"https://it.wikipedia.org/wiki/Gaeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Gaeta%2C_porta_Domnica_-_Lato_interno.jpg","page_title":"Gaeta","context_page_description":"Gaeta è un comune italiano di 20 260 abitanti della provincia di Latina nel Lazio meridionale."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%86%D0%B5%D0%BB%D1%83%D0%B9_(%D0%A0%D0%BE%D0%B4%D0%B5%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Tuileries_Rodin_Le_Baiser_120409_4.jpg","page_title":"Поцелуй (Роден)","context_page_description":"«Поцелуй» — мраморная скульптура, созданная Огюстом Роденом и представленная в 1889 году на Всемирной выставке в Париже.\\nИзначально изображённая обнимающаяся пара являлась частью рельефной группы, украшающей большие бронзовые скульптурные ворота «Врата ада», заказанные Родену для будущего музея искусств в Париже. Позднее была оттуда удалена и заменена скульптурой другой пары любовников, расположенной на малой правой колонне.\\nНе было и не будет мастера, способного вложить в глину, бронзу и мрамор порыв плоти более проникновенно и напряженно, чем это сделал Роден."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BD%D0%BE_%D0%9A%D0%BE%D0%BB%D0%B8%D1%87%D0%B0%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Gorno-Kolichani-MK.JPG","page_title":"Горно Количани","context_page_description":"Горно Количани — село во Општина Студеничани, во околината на град Скопје. Според пописот од 2002 година, селото имало население од 309 жители."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A4%E1%83%9D%E1%83%9A%E1%83%90%E1%83%93%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%A2%E1%83%90%E1%83%93%E1%83%98%E1%83%9D%E1%83%9C%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Poladi_Stadium.jpg","page_title":"ფოლადის სტადიონი","context_page_description":"ფოლადი — სპორტული კომპლექსი და ხელოვნურსაფარიანი სპორტული სტადიონი საქართველოში, ქალაქ რუსთავში. ძირითადად გამოიყენება საფეხბურთო მატჩებისათვის. ფოლადის სტადიონი 1948 წელს აშენდა. არის საფეხბურთო კლუბ მეტალურგის საშინაო მოედანი. იტევს 10,720 მაყურებელს. საფეხბურთო მოედნის ზომაა 105X68 მეტრი. მოედანი შემოზღუდულია ოთხი რეზინისსაფარიანი სარბენი ბილიკით, რომლის სიგრძეც 400 მეტრია. სტადიონის კომპლექსში შედის ასევე სპორტული დარბაზი 500-ადგილიანი ტრიბუნით, ათლეტიზმის დარბაზი და სათადარიგო მოედანი ზომებით 100X60 მეტრი. 1985 წელს ფოლადის სტადიონს რეკონსტრუქცია ჩაუტარდა, რის შედეგადაც მას დაემატა ორი ელექტროტაბლო, დასავლეთი ტრიბუნა, ორსართულიანი საცხოვრებელი კომპლექსი და ჩოგბურთის კორტი. გარდა ამისა, სტადიონზე მოწყობილია აუცილებელი სათავსოები, საპრესკონფერენციო დარბაზი და პრესბარი.\\n2009 წელს ფოლადის სტადიონს კიდევ ერთხელ ჩაუტარდა რეკონსტრუქცია. აღდგა სტადიონის ტერიტორიაზე არსებული მოძველებული ინფრასტრუქტურა, გაკეთდა ახალი საშხაპეები და ტრიბუნები, მთლიანად გამოიცვალა სადრენაჟო სისტემა და მოედანზე დაიგო ხელოვნური საფარი. განახლებული სტადიონი 2009 წლის 17 დეკემბერს დინამო თბილისისა და ვიტ ჯორჯიას დაპირისპირებით გაიხსნა."},{"page_url":"https://en.wikipedia.org/wiki/Military_ranks_of_Azerbaijan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/16.AzAF-MG.png","page_title":"Military ranks of Azerbaijan","context_page_description":"The Military ranks of Azerbaijan are the military insignia used by the Azerbaijani Armed Forces. Being a former member of Soviet Union, Azerbaijan shares a rank structure similar to that of Russia; however, the insignia used for its ranks had been increasingly being influenced by Turkey."},{"page_url":"https://vi.wikipedia.org/wiki/Tu_vi%E1%BB%87n_Geghard","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Monasterio_de_Geghard%2C_Armenia%2C_2016-10-02%2C_DD_64.jpg","page_title":"Tu viện Geghard","context_page_description":"Tu viện Geghard là một tu viện thời trung cổ ở tỉnh Kotayk của Armenia, có một phần được trạm khắc trên vách đá với ngọn núi liền kề. Nó được công nhận là di sản thế giới của UNESCO trong trạng thái bảo vệ nâng cao.\\nTrong khi nhà nguyện chính được xây dựng vào năm 1215, khu phức hợp tu viện được thành lập vào thế kỷ thứ 4 bởi Gregory the Illuminator tại địa điểm của một con suối linh thiêng bên trong một hang động. Do đó, tu viện ban đầu được đặt tên là Ayrivank, có nghĩa là \\"Tu viện của hang động\\". Tên thường được sử dụng cho tu viện ngày nay, Geghard, hay đầy đủ hơn là Geghardavank, có nghĩa là \\"Tu viện ngọn giáo\\", bắt nguồn từ ngọn giáo đã làm Jesus bị thương khi đang đóng đinh trên thập giá, được cho là do Giuđa Tađêô mang đến Armenia, và được lưu trữ giữa nhiều di tích khác. Bây giờ nó được trưng bày trong kho bạc Echmiadzin.\\nCác vách đá cao chót vót bao quanh tu viện là một phần của hẻm núi sông Azat, và được đưa vào cùng với tu viện trong danh sách Di sản Thế giới."},{"page_url":"https://de.wikipedia.org/wiki/Hogeschool_van_Amsterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Hvalogo.jpg","page_title":"Hogeschool van Amsterdam","context_page_description":"Die Hogeschool van Amsterdam ist eine Hochschule in Amsterdam. Das Studium verläuft ähnlich wie an den deutschen Fachhochschulen. Da die Hogeschool van Amsterdam eng mit der Universität von Amsterdam zusammenarbeitet, besteht die Möglichkeit, von dieser im Niederländischen als HBO bezeichneten Ausbildung in das wissenschaftliche Studium WO zu wechseln."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B0%D0%BD%D1%8C_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/%D0%A3%D0%BC%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BB%D1%96%D0%B7%D0%BD%D0%B8%D1%87%D0%BD%D0%B8%D0%B9_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB.jpg","page_title":"Умань (станція)","context_page_description":"Умань — тупикова залізнична станція 4-го класу Шевченківської дирекції Одеської залізниці на малозавантаженій лінії Христинівка — Умань. Розташована в однойменному місті на майдані Гагаріна."},{"page_url":"https://fi.wikipedia.org/wiki/Hilda_Heine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Hilda_Heine_20171030.jpg","page_title":"Hilda Heine","context_page_description":"Hilda Heine on marshallinsaarelainen poliitikko ja pedagogi. Hänet valittiin vuonna 2016 Marshallinsaarten ensimmäiseksi naispresidentiksi. Heine oli sitä ennen toiminut muun muassa monissa saarten koulutusta kehittävissä tehtävissä ja maan opetusministerinä. Heine oli myös ensimmäinen marshallinsaarelainen, joka suoritti tohtorin tutkinnon."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AD%D8%B3%D9%8A%D9%85%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Alhoceimas.jpg","page_title":"الحسيمة","context_page_description":"الحسيمة مدينة مغربية ساحلية، تحيط بها تضاريس جبلية، وتقع في منتصف الشريط الساحلي المتوسطي المغربي. هي من أهم حواضر منطقة الريف الكبرى وهي العاصمة الإدارية لإقليم الحسيمة. بلغ عدد سكان الجماعة الحضرية للحسيمة 56,716 نسمة في إحصاء 2004، و399،654 نسمة باحتساب المراكز الحضرية الناشئة المحيطة بها. عرفت المدينة نموا وتوسعا حضريين سريعين، منذ بداية القرن الواحد والعشرين، وهي تتحول تدريجيا إلى حاضرة كبرى تمتد ترابيا إلى نقط حضرية أخرى كبني بوعياش وإمزورن.\\nرغم كونها من الحواضر التي أسست في القرن العشرين، للحسيمة رمزية تاريخية كبيرة في التاريخين الريفي والمغربي، حيث كانت إحدى أهم المراكز العسكرية الحاسمة في تطورات حرب الريف، وكانت إحدى حواضرها أجدير، عاصمة لجمهورية الريف التي تلت انتصار المقاومة الريفية، بقيادة محمد بن عبد الكريم الخطابي على المستعمر الإسباني. عانت المدينة، خلال تاريخها المعاصر، وعلى غرار باقي مناطق الشمال المغربي، من تهميش اقتصادي واجتماعي إرادي من طرف الدولة المغربية، مما جعلها بؤرة احتجاج سياسي دائمة. عرفت المدينة، منذ بداية الألفية الثالثة، وخصوصا بعد زلزال 2004، مسلسل جبر ضرر اقتصادي واجتماعي عبر مجموعة من المشاريع الاقتصادية وتنمية البنيات التحتية.\\nالمدينة معروفة محليا بتسمية بيا، نسبة إلى اسم المدينة أيام الاستعمار الإسباني بيا سان خورخو."},{"page_url":"https://sr.wikipedia.org/wiki/Emocija","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Plutchik-wheel.svg","page_title":"Emocija","context_page_description":"Emocija je uzbuđenost izazvana situacijom ili stresorom koji je osobi važan. Sastoji se iz tri komponente: fiziološke, izražajne i subjektivne. Fiziološka komponenta priprema organizam za adekvatno reagovanje, izražavanjem se obavlja neverbalna komunikacija, a preko doživljaja spoznajemo u kakvom smo stanju. Emocije imaju adaptivnu i komunikativnu funkciju. Dele se na osnovne, složene, prijatne, neprijatne. Osnovne emocije su urođene reakcije na draži, i izražavaju se kod svih ljudi na sličan način. To su sreća, tuga, ljutnja, strah, gađenje i iznenađenje. Afekt, raspoloženje i sentiment su emocionalna stanja različitog intenziteta i trajanja, a afektivni ton je doživljaj prijatnosti i neprijatnosti i sastavni je deo svakog osećanja. Postoji više teorija o tome kako nastaju emocije: Džejms-Langeova, Kenon-Bardova i Teorija kognitivne procene. Prema Džejms-Langeovoj teoriji, emocija je doživljaj fizioloških promena u organizmu koje se refleksno dešavaju u određenoj situaciji i pokreću određeno ponašanje. Prema kognitivnim teorijama, emocija je rezultat procene smisla i značaja situacije. Nijedna dosadašnja teorija emocija nije primenljiva na sve ljude i sve situacije."},{"page_url":"https://cs.wikipedia.org/wiki/Pochod_nad%C4%9Bje","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Refugee_march_Hungary_2015-09-04_02.jpg","page_title":"Pochod naděje","context_page_description":"Tzv. pochody naděje byly pochody uprchlíků z Maďarska do Rakouska na začátku září 2015."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D0%B3%D0%B5%D0%BC%D0%BE%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Hippopotamus_amphibius.JPG","page_title":"Бегемот","context_page_description":"Бегемо́т, гіпопотам — рід наземноводяних ссавців з родини бегемотових ряду оленеподібних.\\nБегемотів відносять до групи «нежуйних» «парнокопитних» ссавців. Разом з низкою інших унгулят їх відносять до групи «товстошкірих».\\nУ гіпопотамів — короткі 4-палі кінцівки, при цьому на кінцях пальців є специфічні зроговіння, які називають копитцями. Самі пальці з'єднані невеликими шкірястими перепонками.\\nБегемоти — величезні ссавці — проводять більшість часу в воді, де вони ховаються від сонця вдень. Після сходу вони виходять за їжею, але відчувають себе неспокійно.\\nНа сьогодні бегемот — найнебезпечніша тварина для людини в Африці. Хоча бегемоти й не хижі тварини, вони можуть вбити або важко покалічити будь-кого своїми зубами, й роблять це частіше за левів чи інших хижаків."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_localit%C4%83%C8%9Bi_din_jude%C8%9Bul_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/FrataCJ_%2816%29.JPG","page_title":"Listă de localități din județul Cluj","context_page_description":"Lista de mai jos cuprinde toate localitățile din județ în ordine alfabetică.\\nAceastă listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://sh.wikipedia.org/wiki/Milan_%C5%A0koda","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Milan_Skoda.jpg","page_title":"Milan Škoda","context_page_description":"Milan Škoda je češki nogometaš i reprezentativac koji trenutno igra za Slaviju Prag. Za reprezentaciju je debitirao 12. lipnja 2015. godine u porazu 2:1 od reprezentacije Islanda, ušavši kao zamjena za Lukáša Váchu u 79. minuti."},{"page_url":"https://fi.wikipedia.org/wiki/Kirsi_Ylijoki","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Kirsi_Ylijoki_2011_-_O392.jpg","page_title":"Kirsi Ylijoki","context_page_description":"Kirsi Ylijoki on suomalainen näyttelijä. Hän valmistui Teatterikorkeakoulusta teatteritaiteen maisteriksi vuonna 1995. Hän toimii freelance-näyttelijänä ja on esiintynyt teatteriurallaan muun muassa Suomen Kansallisteatterissa, Lahden kaupunginteatterissa, Espoon teatterissa ja Komediateatteri Arenassa."},{"page_url":"https://de.wikipedia.org/wiki/Differenzdrucksensor","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Digital_Differential_Pressure_Sensor.jpg","page_title":"Differenzdrucksensor","context_page_description":"Der Differenzdrucksensor ist ein Drucksensor, der die Differenz zweier Absolutdrücke, den Differenzdruck, misst. Der Differenzdrucksensor kann aus zwei Messkammern bestehen, die durch eine Membran hermetisch voneinander getrennt sind. Die Auslenkung der Membran ist dann ein Maß für die Größe des Differenzdruckes."},{"page_url":"https://en.wikipedia.org/wiki/Stefan_Baka%C5%82owicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Stefan_Bakalowicz.jpg","page_title":"Stefan Bakałowicz","context_page_description":"Stefan Bakałowicz was a Polish painter from Warsaw, famous in the Russian Empire. He was noted for his paintings on the subjects of Ancient Rome. From 1936 he was a member of authorities of Polish Association of Artists - \\"The Capitol\\".\\nHis father was the painter Władysław Bakałowicz."},{"page_url":"https://sv.wikipedia.org/wiki/Vienne,_Is%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Roman_excavations_in_Vienne_%28Is%C3%A8re%29.JPG","page_title":"Vienne, Isère","context_page_description":"Vienne är en stad och kommun i departementet Isère i regionen Auvergne-Rhône-Alpes i sydöstra Frankrike. Kommunen är chef-lieu över två kantoner som tillhör arrondissementet Vienne. År 2009 hade Vienne 29 619 invånare.\\nI Vienne finns det många romerska lämningar. Den årliga jazzfestivalen Jazz à Vienne har hållits i Vienne sedan 1981."},{"page_url":"https://eu.wikipedia.org/wiki/Zink","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Skorpion_Zink_Mine.jpg","page_title":"Zink","context_page_description":"Zinka elementu kimiko bat da, Zn ikurra eta 30 zenbaki atomikoa dituena. Zinka, nahiz eta zenbaitetan trantsizio-metal gisa sailkatu den, metala da. Bere taldeko beste elementuekin dituen antzekotasunez gain, magnesioaren eta berilioaren zenbait ezaugarri dauzka. Elementu hau urria da Lurrean, baina erraz erauzten da.\\nLetoia, kobre eta zink proportzio ezberdinez osaturiko aleazio bat, K.a. hirugarren milurtekoan erabiltzen zen Egeon, Iraken, Arabiar Emirerri Batuetan, Kalmukian, Turkmenistanen eta Georgian eta K.a. bigarren milurtekoan Mendebaldeko Indian, Uzbekistanen, Iranen, Sirian eta Israelen. Zink metala Indian XII. mendean hasi zen eskala handian produzitzen, nahiz eta antzinako erromatarrek eta greziarrek ezagutzen zuten. Rajastaneko meatzeek zinkaren ekoizpena K.a. VI. mendean ematen zela frogatu dute. Gaur egun, zinka puruaren frogarik zaharrena Zawarren aurkitutakoa da, K.a. IX. mendekoa. Zink purua erauzteko destilazio prozesu bat erabiltzen zen. Alkimistek zinka erretzen zuten airean \\"filosofoen artilea\\" edo \\"elur zuria\\" deitzen zutena sortzeko.\\nElementu hau ziurrenik Parazeltso alkimistak izendatu zuen alemanezko zinke hitzean oinarritua."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%BB%D0%B5%D0%B0%D0%BD%D0%B0_%D0%94%D0%B5_%D0%9A%D1%80%D1%83%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/IleanaDCruz03.jpg","page_title":"Илеана Де Круз","context_page_description":"Илеана Де Круз, Панаџи, 1. новембар 1987 индијска је филмска глумица и модел."},{"page_url":"https://en.wikipedia.org/wiki/.410_bore","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Thompson_Center_Contender.jpg","page_title":".410 bore","context_page_description":"The .410 bore, is the smallest caliber of shotgun shell commonly available. A .410 bore shotgun loaded with shot shells is well suited for small game hunting and pest control. The .410 started off in the UK as a garden gun along with the .360 and the No.3, No.2 and No.1 bore rimfires. 410 shells have similar base dimensions to the .45 Colt cartridge, allowing many single-shot firearms, as well as some derringers chambered in that caliber, to fire .410 shot shells without any modifications."},{"page_url":"https://zh.wikipedia.org/wiki/BiblioTech","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/BiblioTech_Bexar_County_Digital_Library_-_Exterior.jpg","page_title":"BiblioTech","context_page_description":"BiblioTech是一间位于美国德克萨斯州比尔县的图书馆，是全球首家推行无纸化的图书馆。"},{"page_url":"https://da.wikipedia.org/wiki/Ber%C3%B8ringsf%C3%B8lsom_sk%C3%A6rm","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Platovterm1981.jpg","page_title":"Berøringsfølsom skærm","context_page_description":"En berøringsfølsom skærm, er en skærm, hvor man ved hjælp af en finger eller et pegeredskab kan navigere på enheden.\\nBerøringsfølsomme skærme er efterhånden meget udbredt og benyttes på f.eks. smartphones, tablet-computere, kasseapparater og elektroniske informationstavler."},{"page_url":"https://hu.wikipedia.org/wiki/Dance_in_the_Dark","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Lady_Gaga_Dance_in_the_Dark.jpg","page_title":"Dance in the Dark","context_page_description":"A Dance in the Dark egy dal Lady Gaga amerikai énekesnő The Fame Monster című harmadik középlemezéről. A dal inspirációja abból az intim és bensőséges élményből származik, mely két ember között jöhet létre egy hálószobában. Az énekesnő elmondása szerint „a dal egy olyan lányról szól, aki a sötétben szeret szexelni, mert szégyelli a testét”. Azt mondta, a MAC kozmetikai cég AIDS-alapítványával való munkája során ismert meg ilyen nőket, és a dallal fejezi ki, megérti hogy éreznek. Az eredeti tervek szerint ez a szám lett volna a Telephone-t követő kislemez, azonban Gaga a kiadó döntésével szemben az Alejandrót választotta a The Fame Monster harmadik kislemezének. Ugyanakkor Ausztráliában és néhány európai országban rádiós formában megjelent kislemezként.\\nA Dance in the Dark zenei stílusa a retróból és az új hullám rockzenei műfajból is merít. Egyfajta dadogós bevezetővel kezdődik, egy Madonna Vogue című dalát idéző részben pedig Gaga olyan híres embereknek a nevét említi, akik tragikus körülmények között veszítették életüket. A kritikusok nagyrészt pozitív értékelést adtak a dalnak."},{"page_url":"https://de.wikipedia.org/wiki/Puyricard","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Puyricard_20130912_06.jpg","page_title":"Puyricard","context_page_description":"Puyricard ist ein Ort in der Gemeinde Aix-en-Provence im Département Bouches-du-Rhône in der französischen Region Provence-Alpes-Côte d’Azur. Er liegt etwa 10 Kilometer nördlich des Gemeindehauptortes, der Stadt Aix-en-Provence."},{"page_url":"https://es.wikipedia.org/wiki/Bloomeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Bloomeria_crocea.jpg","page_title":"Bloomeria","context_page_description":"Bloomeria es un género de plantas monocotiledóneas perteneciente a la familia Asparagaceae. Incluye tres especies nativas de California y México."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Windelsbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Preuntsfelden_St._Nikolaus_002.jpg","page_title":"Liste der Baudenkmäler in Windelsbach","context_page_description":"Auf dieser Seite sind die Baudenkmäler der mittelfränkischen Gemeinde Windelsbach zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 28. November 2014 wieder und enthält 37 Baudenkmäler."},{"page_url":"https://vi.wikipedia.org/wiki/Budapest","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/AquincM4.jpg","page_title":"Budapest","context_page_description":"Budapest là thủ đô và thành phố đông dân nhất của Hungary, và một trong những thành phố lớn nhất trong Liên minh Châu Âu. Với dân số ước tính năm 2016 là 1.752.704 phân bố trên một diện tích khoảng 525 kilômét vuông, Budapest cũng là một trong những thành phố lớn có mật độ dân số cao nhất tại EU. Budapest vừa là một thành phố và vừa là một hạt, và tạo thành trung tâm của vùng đô thị Budapest, nó có diện tích 7.626 kilômét vuông và dân số 3.303.786, chiếm 33 phần trăm dân số Hungary. Vùng đô thị Budapest có GDP 141,0 tỷ đô la Mỹ năm 2016, chiếm 49,6 phần trăm GDP của Hungary. GDP trên đầu người của thành phố là 64.283 đô la Mỹ, bằng 148% trung bình của EU tính theo sức mua tương đương. Do đó thành phố này năm trong danh sách 100 thành phố theo GDP trên thế giới\\nvà khiến nó trở thành một trong những nền kinh tế khu vực lớn nhất Liên minh Châu Âu.\\nBudapest là một thành phố toàn cầu dẫn đầu với thế mạnh về thương mại, tài chính, truyền thông, nghệ thuật, thời trang, nghiên cứu, công nghệ, giáo dục và giải trí."},{"page_url":"https://en.wikipedia.org/wiki/Alberto_Palmetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Alberto_Palmetta_at_the_2018_YOG_07.jpg","page_title":"Alberto Palmetta","context_page_description":"Alberto Palmetta is an Argentine boxer. He competed in the men's welterweight event at the 2016 Summer Olympics."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BF%D0%B5%D1%80%D0%B5%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B7%D0%B0%D0%B6%D0%B8%D0%B3%D0%B0%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%D0%9B%D0%BE%D0%B4%D0%BE%D1%87%D0%BD%D1%8B%D0%B9_%D0%BC%D0%BE%D1%82%D0%BE%D1%80_%D0%B7%D0%B0%D0%B6%D0%B8%D0%B3%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B8_%D0%BA%D0%B0%D1%80%D0%B1%D1%8E%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%BF%D0%BE%D0%BB%D0%BD%D1%8B%D0%B5_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D1%82%D1%8B.JPG","page_title":"Опережение зажигания","context_page_description":"Опереже́ние зажига́ния — воспламенение рабочей смеси в цилиндре двигателя до достижения поршнем верхней мёртвой точки.\\nМомент зажигания оказывает большое влияние на работу двигателя. При работе четырёхтактного ДВС во время такта сжатия перед достижением поршнем ВМТ происходит воспламенение рабочей смеси в камере сгорания с помощью свечи зажигания. Происходит возгорание рабочей смеси, расширение рабочих газов и выполняется следующий такт — рабочий ход. В действительности сгорание рабочей смеси происходит не мгновенно. От момента появления искры до момента, когда вся смесь загорится, и давление газов достигнет максимальной величины, проходит несколько миллисекунд времени. Этот отрезок времени очень мал, но так как скорость вращения коленчатого вала весьма велика, то даже за это время поршень успевает пройти некоторый путь от того положения, при котором началось воспламенение смеси. Поэтому, если воспламенить смесь в ВМТ, то горение происходит при увеличивающемся объёме и закончится, когда поршень пройдёт некоторый путь и максимальная величина давления газов будет меньше, чем в том случае, если бы сгорание всей смеси произошло до достижения ВМТ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D1%87%D0%B8%D1%81%D0%BB%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BC%D0%B0%D1%82%D0%B5%D0%BC%D0%B0%D1%82%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Integral_as_region_under_curve.svg","page_title":"Вычислительная математика","context_page_description":"Вычислительная математика — раздел математики, включающий круг вопросов, связанных с производством разнообразных вычислений. В более узком понимании вычислительная математика — теория численных методов решения типовых математических задач. Современная вычислительная математика включает в круг своих проблем изучение особенностей вычисления с применением компьютеров.\\nВычислительная математика обладает широким кругом прикладных применений для проведения научных и инженерных расчётов. На её основе в последнее десятилетие образовались такие новые области естественных наук, как вычислительная физика, вычислительная химия, вычислительная биология и так далее."},{"page_url":"https://en.wikipedia.org/wiki/Arthur_Coke_Burnell","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/South_Indian_script_Burnell.png","page_title":"Arthur Coke Burnell","context_page_description":"Arthur Coke Burnell was an English civil servant who served in the Madras Presidency who was also a scholar in Sanskrit and Dravidian languages. He catalogued the Sanskrit manuscripts in southern India, particularly those in the collections of the Tanjore court collections. He was, with Henry Yule, a co-compiler of Hobson-Jobson, a compendium of Anglo-Indian terms."},{"page_url":"https://sh.wikipedia.org/wiki/Kapolei,_Hawaii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Kapolei_Oahu_Aerial.jpg","page_title":"Kapolei, Hawaii","context_page_description":"Kapolej je naseljeno mesto za statističke potrebe u američkoj saveznoj državi Havaji. Po popisu stanovništva iz 2010. u njemu je živelo 15.186 stanovnika."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_la_Charente","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Ligni%C3%A8reS3.16.JPG","page_title":"Liste des monuments historiques de la Charente","context_page_description":"Cet article recense les monuments historiques de la Charente, en France.\\nPour les monuments historiques de la commune d'Angoulême, voir la liste des monuments historiques d'Angoulême\\nPour les monuments historiques de la commune de Cognac, voir la liste des monuments historiques de Cognac\\nPour les monuments historiques de la commune de Confolens, voir la liste des monuments historiques de Confolens"},{"page_url":"https://it.wikipedia.org/wiki/Bruno_Mealli","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bruno_Mealli_1966.jpg","page_title":"Bruno Mealli","context_page_description":"Bruno Mealli è un ex ciclista su strada italiano.\\nProfessionista dal 1961 al 1969, conta la vittoria di tre tappe al Giro d'Italia."},{"page_url":"https://vi.wikipedia.org/wiki/Tetragonula_clypearis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Tetragonula_clypearis_f.jpg","page_title":"Tetragonula clypearis","context_page_description":"Tetragonula clypearis là một loài Hymenoptera trong họ Apidae. Loài này được Friese mô tả khoa học năm 1908."},{"page_url":"https://en.wikipedia.org/wiki/Milecastle_56","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Centurion_Inn%2C_Walton_-_geograph.org.uk_-_983227.jpg","page_title":"Milecastle 56","context_page_description":"Milecastle 56 was a milecastle on Hadrian's Wall."},{"page_url":"https://es.wikipedia.org/wiki/Sorghum_bicolor","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Sudangras%2CSudan_grass%2C-Sorghum_bicolor_%28L.%29_Moench_nothosubsp._drummondii_%28Steud.%29_de_Wet_ex_Davidse-.jpg","page_title":"Sorghum bicolor","context_page_description":"El sorgo o zahína es una hierba perteneciente a la familia de las gramíneas, cuyos frutos se utilizan para hacer harina y como forraje. Es un cultivo alimenticio importante en África, América Central, y Asia Meridional y es la quinta cosecha de cereal en el mundo, en cuanto a su producción. El productor más grande es Estados Unidos.\\nEl sorgo se conoce con varios nombres: mijo grande y maíz de Guinea en África occidental, kafir en África austral, duro en el Sudán, mtama en África oriental, iowar en la India y kaoliang en China.\\nEl género Sorghum se caracteriza por presentar espiguillas que nacen de a pares. El sorgo se trata como planta anual, aunque es hierba perenne y en los trópicos puede cosecharse varias veces al año.\\nTiene su origen en África del este y primero divergió de las variedades salvajes en Etiopía hace 5000 años. Se adapta bien al crecimiento en áreas áridas o semiáridas cálidas. Las muchas subespecies se dividen en cuatro grupos - sorgos del grano, sorgos forrajeros, sorgos dulces, y sorgo de escobas."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%D8%B8%D8%B1%DB%8C%D9%87_%D9%86%D8%A7%D8%B8%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Nazriya_Nazim.jpg","page_title":"نظریه ناظم","context_page_description":"نظریه ناظم هیندوستانلی موغنی، مانکن و اوْیونچو"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Stra%C3%9F_in_Steiermark","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Spielfeld_pfk_19.12.07_002.jpg","page_title":"Liste der denkmalgeschützten Objekte in Straß in Steiermark","context_page_description":"Die Liste der denkmalgeschützten Objekte in Straß in Steiermark enthält die 32 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Straß in Steiermark im steirischen Bezirk Leibnitz."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D0%BC%D0%B8%D1%80%D1%81%D0%BA%D0%B8_%D0%BD%D1%83%D0%B6%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Waste_and_hygiene_compartment_in_the_Destiny_laboratory_of_the_International_Space_Station_-_20090412.jpg","page_title":"Свемирски нужник","context_page_description":"Свемирски нужник је специјално опремљен простор у свемирском броду који се користити у условима микрогравитације за обављање физиолошких потреба космонаута. Опремљен је шкољком, прилагођеном за мушкарце и за жене, која се по свом изгледу не разликује значајно од обичне нужничке шкољке на Земљи. У почетку су свемирска одела космонаута имала пелене и отпадне вреће у које су космонаути обављали нужду, а данас ту исту нужду обављају у свемирским нужницима скоро на истоветан начин као при одласку у нужник на Земљи."},{"page_url":"https://lt.wikipedia.org/wiki/Topilas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Topilo-2.JPG","page_title":"Topilas","context_page_description":"Topilas – kaimas Lenkijos šiaurės rytuose, Hainuvkos valsčiuje, Hainuvkos apskrityje, Palenkės vaivadijoje. Kaimas yra apie 12 km į pietus nuo Hainuvkos ir apie 62 km į pietryčius nuo vaivadijos centro Balstogės. Kaimas yra Belovežo girioje. Nuo XIII-XIV a. iki 1795 m. kaimas priklausė Lietuvos Didžiajai Kunigaikštystei. Per kaimą eina Hainuvkos-Beleovežo girios siaurasis geležinkelis. 1945 m. gegužės 27 d. šalia kaimo įvyko mūšis tarp Armijos Krajovos ir NKVD. Šalia kaimo teka Lešna Pravos upė."},{"page_url":"https://cs.wikipedia.org/wiki/Lockheed_P-38_Lightning","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Lockheed_F-5_Lightning.jpg","page_title":"Lockheed P-38 Lightning","context_page_description":"Lockheed P-38 Lightning byl jednomístný dvoumotorový stíhací a stíhací-bombardovací letoun, který byl považován za jeden z nejlepších spojeneckých bojových strojů během 2. světové války. Byl nasazován v bojích v Evropě i Tichém oceánu. Němčtí piloti tento stroj hodnotili rozpačitě, jedni ho přezdívali dvouocasý ďábel, na druhou stranu ale taky měl přezdívku sedící kachna."},{"page_url":"https://tr.wikipedia.org/wiki/Norwalk,_Kaliforniya","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/City_of_norwalk_logo.png","page_title":"Norwalk, Kaliforniya","context_page_description":"Norwalk, Amerika Birleşik Devletleri'nin Kaliforniya eyaletinde yer alan ve Los Angeles ilçesinde yer alan bir şehirdir. Şehrin nüfusu 26 Kasım 2009 tarihinde 105,549'dur."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%B2%E0%AE%BE%E0%AE%95%E0%AF%82%E0%AE%B0%E0%AF%8D_%E0%AE%85%E0%AE%B0%E0%AF%81%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%9F%E0%AF%8D%E0%AE%9A%E0%AE%BF%E0%AE%AF%E0%AE%95%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Tollington_market%2C_Mall_Road%2C_Lahore%2C_Pakistan.jpg","page_title":"இலாகூர் அருங்காட்சியகம்","context_page_description":"இலாகூர் அருங்காட்சியகம் என்பது பாக்கித்தானின் இலாகூரில் அமைந்துள்ள ஒரு அருங்காட்சியகமாகும். இது 1865 ஆம் ஆண்டில் ஒரு சிறிய இடத்தில் நிறுவப்பட்டது. 1894 ஆம் ஆண்டில் பிரிட்டிசு காலனித்துவ காலத்தில் இலாகூரில் உள்ள 'தி மால்' என்ற இடத்தில் அதன் தற்போதைய இடத்தில் திறக்கப்பட்டது. இலாகூர் அருங்காட்சியகம் பாக்கித்தானின் அதிகம் பார்வையிடப்பட்ட மற்றும் புகழ்பெற்ற அருங்காட்சியகமாகும். இது தெற்காசியாவின் முக்கிய அருங்காட்சியகங்களில் ஒன்றாகும்.\\nஇந்த அருங்காட்சியகம், கட்டிடத்தின் முன் நேரடியாக அமைந்துள்ள ஜம்ஸாமா துப்பாக்கியுடன் அமைந்துள்ளது. இரட்யார்ட் கிப்ளிங் எழுதிய புகழ்பெற்ற கிம் என்ற பிரிட்டிசு புதினத்தில் பிரபலமானது - அவரின் தந்தை அருங்காட்சியகத்தின் ஆரம்பகால கண்காணிப்பாளர்களில் ஒருவராக இருந்தார். பண்டைய இந்தோ-கிரேக்க மற்றும் காந்தார இராச்சியங்களிலிருந்து பௌத்தக் கலைகளின் விரிவான சேகரிப்புக்காக இந்த அருங்காட்சியகம் இப்போது புகழ்பெற்றது. இது முகலாயப் பேரரசு, சீக்கியப் பேரரசு மற்றும் இந்தியாவில் உள்ள பிரித்தானியப் பேரரசு ஆகியவற்றின் சேகரிப்பையும் கொண்டுள்ளது."},{"page_url":"https://ca.wikipedia.org/wiki/Rumex_palustris","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Rumex_palustris_kz1.jpg","page_title":"Rumex palustris","context_page_description":"Rumex palustris és una espècie de la família de les Polygonaceae. Aquesta planta és un teròfit i un hemicriptòfit. Se la coneix comunament com a paradella palustre."},{"page_url":"https://fr.wikipedia.org/wiki/Tortue","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Turtle_entangled_in_marine_debris_%28ghost_net%29.jpg","page_title":"Tortue","context_page_description":"Les Tortues, ou Chéloniens, forment un ordre de reptiles dont la caractéristique est d'avoir une carapace. Il existe actuellement 343 espèces recensées possédant des caractéristiques diverses, mais toutes se distinguent des autres reptiles par une carapace qui est constituée d'un plastron au niveau du ventre et d'une dossière sur le dessus, reliés par deux ponts sur les côtés du corps. On les sépare traditionnellement en trois groupes : les tortues terrestres, les tortues aquatiques, ou tortues dulçaquicoles, et les tortues marines.\\nLes tortues sont ovipares et les pontes ont lieu entre 10 et 12 mois.Les jeunes grandissent vite, puis leur développement se ralentit. L'alimentation des tortues peut se composer de viande ou de végétaux selon les espèces.\\nLes 86 genres de tortues sont divisées en 14 familles. Elles se répartissent sur une bonne partie du globe et peuvent vivre dans des habitats très divers. Quarante-deux pour cent de ces espèces sont menacées de disparition, que ce soit en raison de la destruction de leurs habitats ou d'une prédation trop importante. Dans les deux cas, l'influence de l'homme est très importante, malgré les actions de protection mises en œuvre."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%A5%E9%A2%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/50Hz60Hz.svg","page_title":"工频","context_page_description":"工頻是電網工作頻率的簡稱，指電網中交流電的頻率，同一電網中的所有發電機、輸配電設備和用戶均使用這一頻率的交流電。目前世界上大多數國家使用50Hz作為電網工作頻率，但也有美國、部分亞洲國家和地區使用60Hz工頻。\\n在第二次工業革命過程中，許多不同的頻率和電壓曾被使用過。由於建設電網的設備投資巨大，電網規格的標準化進展緩慢。儘管如此，21世紀以來，使用50 Hz工頻的電網趨向於使用220–240伏電壓；使用60 Hz工頻的電網趨向於100–127 V供電。 兩種頻率目前在世界上同時使用，而且在技術上、兩種頻率沒有優劣之分。目前，沒有在全世界範圍內對電網頻率進行標準化的動力。\\n除非特別註明可以同時在50 Hz和60 Hz工頻上運行，電器不在設計的工頻的電網上工作可能導致效率降低甚至安全隱患。在日本出售的電器能夠同時在50Hz和60Hz。內置馬達的電器在60Hz運作時，由於馬達轉速提高，電器的功率也隨之增大。"},{"page_url":"https://hu.wikipedia.org/wiki/Pr%C3%ADm%C3%A1si_palota_(Budapest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Sarokh%C3%A1z_%28213._sz%C3%A1m%C3%BA_m%C5%B1eml%C3%A9k%29.jpg","page_title":"Prímási palota (Budapest)","context_page_description":"A budapesti Prímási palota épület a Budai Várnegyedben, az esztergom-budapesti érsek lakhelye és az Esztergom-Budapesti főegyházmegye hivatalának központja.\\nAz Úri utca 62. szám alatt álló épület a 18. század végén épült copf stílusban. Zártudvaros beépítésű, egyemeletes; a középtengelyben nyíló kapu felett kőkonzolok hordta díszes vasrácsos erkély látható.\\n1874-ben Scitovszky János hercegprímás, esztergomi érsek vásárolta meg az épületet. Tóth Árpád sétányra néző szárnya Budapest ostromában elpusztult, helyére modern, üvegfalú épület épült."},{"page_url":"https://ms.wikipedia.org/wiki/Shinjir%C5%8D_Koizumi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Shinjiro.jpg","page_title":"Shinjirō Koizumi","context_page_description":"Shinjirō Koizumi ialah ahli politik Jepun yang merupakan ahli Dewan Perwakilan Rakyat dari Parti Demokratik Liberal. Beliau merupakan anak kedua kepada mantan Perdana Menteri Jepun, Junichiro Koizumi dan beliau kini merupakan Menteri Alam Sekitar Jepun sejak 11 September 2019, menjadikan beliau sebagai menteri ketiga termuda yang dilantik di Jepun sejak Perang Dunia Kedua."},{"page_url":"https://es.wikipedia.org/wiki/La_Neuville-Roy","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Map_commune_FR_insee_code_60456.png","page_title":"La Neuville-Roy","context_page_description":"La Neuville-Roy es una población y comuna francesa, en la región de Picardía, departamento de Oise, en el distrito de Clermont y cantón de Saint-Just-en-Chaussée."},{"page_url":"https://it.wikipedia.org/wiki/Leonard_Piontek","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/600px_Nero_Bianco_e_Rosso_%28Diagonale%29.png","page_title":"Leonard Piontek","context_page_description":"Leonard Franz Piontek, in polacco Leonard Franciszek Piątek, è stato un calciatore polacco con cittadinanza tedesca, di ruolo attaccante."},{"page_url":"https://fi.wikipedia.org/wiki/Mahajanapada","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Ancient_india.png","page_title":"Mahajanapada","context_page_description":"Mahajanapadat olivat Intiassa 700-luvulta eaa. lähtien kehittyneitä valtioita. Mahajanapadeja oli yhteensä 16, joista merkittävimpiä olivat Magadha ja Kosala. Varmaa tietoa Intian historiasta on yleisesti vasta 500-luvulta eaa. eteenpäin, jolloin mahajanapadat olivat vakiinnuttaneet asemansa.\\nMahajanapadit saivat alkunsa, kun Intiaan 1800-luvulta eaa. alkaen saapuneet arjalaiset alkoivat noin 1000-luvulla eaa. asettua aloilleen ja perustaa kyliä. He muodostivat ensin janapadeiksi kutsuttuja valtioita, joita hallitsivat kyläneuvostot. Näitä on joskus erheellisesti kutsuttu demokratioiksi, vaikka oligarkia kuvaa hallintomallia paremmin. Neuvostojen jäsenet valittiin lähinnä pappissäädystä. 700-luvulta eaa. alkaen osa janapadeista alkoi muuttua kuningaskunniksi. Maanviljelyn ja kaupankäynnin kasvu järjestyneessä yhteiskunnassa johti rahan käyttöönottoon ja tiettyjen janapadien voimistumiseen naapuriensa kustannuksella. Näitä alettiin buddhalaisissa teksteissä kutsua mahajanapadeiksi erotuksena pienemmistä Intian valtioista.\\nBuddhalaisen tekstin Anguttara Nikayan mukaan 16 mahajanapadaa olivat seuraavat:\\nKashi\\nKosala\\nAnga\\nMagadha\\nVrijji\\nMalla\\nChetiya\\nVatsa\\nKuru\\nPanchala\\nMatsya"},{"page_url":"https://hr.wikipedia.org/wiki/Dromaeosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Dromaeosaurus_BW.jpg","page_title":"Dromaeosaurus","context_page_description":"Dromaeosaurus je bio rod teropodnih dinosaura koji su živjeli u razdoblju kasne krede, između 76,5 i 74,8 milijuna godina pr. Kr. na zapadu SAD-a i u Alberti. Njegov znanstveni naziv znači \\"gušter koji trči\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Scarborough","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Scarborough_North_Bay.jpg","page_title":"Scarborough","context_page_description":"Scarborough är en stad i Scarborough i North Yorkshire i England. Staden har 39 700 invånare, distriktet Scarborough 108 793 invånare. Staden blev grundad av vikingarna och är mest känd för sin 45 dagar långa marknad Scarborough Fair, som även är titeln på en välkänd traditionell folkvisa om marknaden.\\nStaden har varit en kurort sedan 1600-talet. University of Hull har ett campus i staden."},{"page_url":"https://en.wikipedia.org/wiki/Port_of_Belgrade","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Sava_River_with_Kalemegdan_Fortress.jpg","page_title":"Port of Belgrade","context_page_description":"The Port of Belgrade is a cargo and passenger port on the Danube river in Belgrade, Serbia.\\nThe port is located in the center of Belgrade, near Pančevo Bridge. It also manages the passenger terminal on the nearby Sava river. The port transfer capacity is three million tons per year and 10,000 TEUs. It also has 300,000 square meters of warehouses and 650,000 square meters of open-air storage areas."},{"page_url":"https://ca.wikipedia.org/wiki/Nepenthes_villosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Nepenthes_villosa_distribution.png","page_title":"Nepenthes villosa","context_page_description":"Nepenthes villosa és una espècie tropical de planta insectívora pertanyent al gènere Nepenthes."},{"page_url":"https://no.wikipedia.org/wiki/You_Want_It_Darker","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Synagogue_Shaar_Hashomayim.jpg","page_title":"You Want It Darker","context_page_description":"You Want It Darker er Leonard Cohens fjortende studioalbum. Det ble utgitt av Columbia Records 21. oktober 2016, to uker før Cohen døde, og er det siste albumet som ble utgitt mens han fortsatt var i live.\\nPå grunn av Cohens helsetilstand ble albumet spilt inn i et enkelt lydstudio rigget opp i stuen i Cohens leilighet i Los Angeles. De øvrige musikerne leverte sine bidrag i ett fullverdig studio dit Cohen ikke var i stand til å reise. Innspillingen begynte i 2015 og Patrick Leonard ble også syk under innspillingen.\\nKoret og kantoren fra Shaar Hashomayim, Cohens synagoge i Montreal, medvirket på innspillingen. Tittelsporet inkluderer det hebraiske «hineni», «her er jeg» eller «jeg er klar», med henvisning til Abraham som var klar til å ofre sin sønn. Disse ordene blir i jødisk tradisjon lest fra toraen på rosj hasjaná. Cohen ville gjenskape den lyden av sangen som han hadde hørt i synagogen som barn. Cohen visste hvordan han skulle skrive innenfor jødisk tradisjon uten å være hemmet av tradisjonen, ifølge Michael P. Kramer.\\nAdam Cohen medvirket på gitar og som produsent. Dana Glover medvirket som vokalist i koret. Alison Krauss koret på «Steer Your Way»."},{"page_url":"https://pt.wikipedia.org/wiki/Transporte_em_Nova_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Manhattan_Island_Ferry_Terminals_photo_D_Ramey_Logan.jpg","page_title":"Transporte em Nova York","context_page_description":"O sistema de transporte da cidade de Nova York é uma rede de sistemas infra-estruturais complexos. A cidade de Nova York, sendo a cidade mais populosa dos Estados Unidos, possui um sistema de transporte que inclui um dos maiores sistemas de metrô do mundo; o primeiro túnel veicular mecanicamente ventilado do mundo; e um teleférico. O sistema de aeroportos de Nova York, que inclui o Aeroporto Internacional John F. Kennedy, o Aeroporto LaGuardia, o Aeroporto Internacional de Newark, o Aeroporto Stewart e algumas pequenas instalações, é um dos maiores do mundo. A cidade de Nova York também abriga um extenso sistema de ônibus em cada um dos cinco distritos e inúmeros táxis por toda a cidade."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AE%D1%81%D0%BD%D0%B0%D1%80%D1%81%D0%B1%D0%B5%D1%80%D0%B3_(%D0%BA%D0%BE%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Tingshus_Kopparberg.JPG","page_title":"Юснарсберг (комуна)","context_page_description":"Комуна Юснарсберг — адміністративно-територіальна одиниця місцевого самоврядування, що розташована в лені Еребру у центральній Швеції.\\nЮснарсберг 163-я за величиною території комуна Швеції. Адміністративний центр комуни — місто Коппарберг."},{"page_url":"https://de.wikipedia.org/wiki/Milankovi%C4%87-Zyklen","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Eccentricity_zero.png","page_title":"Milanković-Zyklen","context_page_description":"Bei den Milanković-Zyklen handelt es sich um langperiodische Veränderungen der auf der Erde eintreffenden Sonnenstrahlung über die jährliche Schwankungsbreite hinaus. Die Erdbahn um die Sonne, die Präzession der Erdrotationsachse sowie die Neigung der Erdachse und damit die wechselnden Einfallswinkel der Sonneneinstrahlung auf der Nord- und Südhemisphäre unterliegen verschiedenen Zyklen mit einer Dauer von 25.800 bis etwa 100.000 beziehungsweise 405.000 Jahren. Sie erklären teilweise die natürlichen Klimaveränderungen vor allem während des Quartärs und sind daher im Kontext der Klimatologie und der Paläoklimatologie von großer Bedeutung. Die Grundidee von Milanković bestand darin, dass die astronomisch bedingte Variabilität der nordhemisphärischen Sonneneinstrahlung das Wachstum und Abschmelzen großer Eisschilde in hohem Maße mitbestimmte und damit – unter Mitwirkung der Eis-Albedo-Rückkopplung – eine Steuerfunktion für den Beginn und das Ende der verschiedenen Kaltzeitphasen ausübte. Somit entstand mit der Milanković-Theorie erstmals ein allgemein akzeptiertes Erklärungsmodell für die Ursache der pleistozänen Vereisungsprozesse."},{"page_url":"https://de.wikipedia.org/wiki/St-Pierre_(Montfort-l%E2%80%99Amaury)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Montfort-l%27Amaury_%C3%89glise_Saint-Pierre_Vitrail_024_826.jpg","page_title":"St-Pierre (Montfort-l’Amaury)","context_page_description":"Die katholische Pfarrkirche Saint-Pierre in Montfort-l’Amaury, einer Gemeinde im Département Yvelines in der französischen Region Île-de-France, geht auf eine romanische Kirche aus dem 11. Jahrhundert zurück. Die heutige Kirche wurde im Wesentlichen im 16. Jahrhundert errichtet. Im Jahr 1840 wurde die dem Apostel Petrus geweihte Kirche aufgrund ihrer zahlreichen Bleiglasfenster aus dem 16. Jahrhundert als eines der ersten Gebäude als Monument historique in die Liste der Baudenkmäler in Frankreich aufgenommen."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Sioux_City,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/SiouxCityIowa1900s.jpg","page_title":"History of Sioux City, Iowa","context_page_description":"Iowa is in the tallgrass prairie of the North American Great Plains, historically inhabited by speakers of Siouan languages.\\nThe area of Sioux City, Iowa was inhabited by Yankton Sioux when it was first reached by Spanish and French furtrappers in the 18th century.\\nIn 1803, during the presidency of Thomas Jefferson, France sold a vast portion of central North America to the United States of America. This \\"Louisiana Purchase\\" was largely unexplored. Jefferson sent out the Corps of Discovery, under Lewis and Clark, to scientifically document the territory. In 1804 the Lewis and Clark expedition traveled up the Missouri and set-up camp near what would become Sioux City, Iowa. On August 20, a member of the expedition, Sgt. Charles Floyd died of \\"bilous colic\\" and was buried on a bluff overlooking the river. At the time of Lewis and Clark, the Omaha tribe of Native Americans were present just downstream from this region, and the Yankton Sioux were upstream. William Thompson established a trading post near Floyd's Bluff in 1848, and had early ambitions for founding a city."},{"page_url":"https://sv.wikipedia.org/wiki/Cross_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Cross_City_Fire_Department.JPG","page_title":"Cross City","context_page_description":"Cross City är administrativ huvudort i Dixie County i den amerikanska delstaten Florida. Ortnamnet har med det att göra att orten grundades på en plats där två vägar korsades. Området hörde tidigare till Lafayette County. Dixie County grundades 1921 och Cross City utsågs till huvudort i det nya countyt. Countyt har haft ett flygfält, Cross City Airport, sedan 1940."},{"page_url":"https://nl.wikipedia.org/wiki/Janus_Kiepoog","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Oeteldonk_%28carnaval%29%2C_Bestanddeelnr_913-6064.jpg","page_title":"Janus Kiepoog","context_page_description":"Janus Borghs was als Janus Kiepoog, of Janus Kiep, een bekende Bosschenaar. Over hem deden en doen nog steeds vele verhalen de ronde."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B0%E0%A6%B8%E0%A6%BE%E0%A6%AF%E0%A6%BC%E0%A6%A8%E0%A7%87_%E0%A6%A8%E0%A7%8B%E0%A6%AC%E0%A7%87%E0%A6%B2_%E0%A6%AC%E0%A6%BF%E0%A6%9C%E0%A6%AF%E0%A6%BC%E0%A7%80%E0%A6%A6%E0%A7%87%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Christian_B._Anfinsen%2C_NIH_portrait%2C_1969.jpg","page_title":"রসায়নে নোবেল বিজয়ীদের তালিকা","context_page_description":"রসায়নশাস্ত্রের বিভিন্ন শাখায় গুরুত্বপূর্ণ অবদান রাখার জন্য রাজকীয় সুয়েডীয় বিজ্ঞান অ্যাকাডেমি বিজ্ঞানীদেরকে প্রতিবছর রসায়নে নোবেল পুরস্কার প্রদান করে। ১৮৯৫ সালে আলফ্রেড নোবেলের উইল অনুসারে যে পাঁচ শাখায় নোবেল পুরস্কার দেয়ার কথা তার মধ্যে রসায়ন অন্যতম। বাকি বিষয়গুলো হচ্ছে পদার্থবিজ্ঞান, সাহিত্য, শান্তি এবং চিকিৎসাবিজ্ঞান। পরবর্তীতে অর্থশাস্ত্রকেও এই তালিকায় সংযুক্ত করা হয়। এই পুরস্কারের ব্যাপারটি দেখাশোনা করে নোবেল ফাউন্ডেশন । রসায়ন নোবেল কমিটির পরামর্শে রাজকীয় সুয়েডীয় বিজ্ঞান অ্যাকাডেমি এই পুরস্কারটি প্রদান করে। প্রতিবছর নোবেলের মৃত্যু তারিখ ১০ ডিসেম্বর সুইডেনের রাজধানী স্টকহোম থেকে রসায়নে নোবেল পুরস্কার প্রদান করা হয়। ১৯০১ সালে নেদারল্যান্ডসের জ্যাকবস হেনরিকাস ভ্যান্ট হফকে প্রদান করা।\\n২৫ জনের মত বিজ্ঞানী জৈব রসায়নে অবদান রাখার জন্য নোবেল পুরস্কার অর্জন করেছেন।\\nরাষ্ট্রীয় নিষেধাজ্ঞার কারণে জার্মানীর রিচার্ড কুন এবং এডলফ বুটেনান্ড নোবেল পুরস্কার গ্রহণ করতে পারেন নাই। পরবর্তীতে তারা পদক এবং সনদ পান কিন্তু কোন টাকা পান নাই। ফ্রেডরিক স্যাঙ্গার ১৯৫৮ ও ১৯৮০ সালে রসায়নে এবং জন বার্ডেন ১৯৫৬ ও ১৯৮০ সালে পদার্থে নোবেল পুরস্কার অর্জন করেন। এই দুই বিজ্ঞানীই একই বিষয়ে দুইবার করে নোবেল পান। অন্যদিকে মেরি ক্যুরি এবং লিনাস পাউলিং দুইবার করে নোবেল পুরস্কার পান।"},{"page_url":"https://cs.wikipedia.org/wiki/N%C4%9Bmecko","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Germany_champions_2014_FIFA_World_Cup.jpg","page_title":"Německo","context_page_description":"Německo je středoevropský stát, rozdělený na 16 spolkových zemí. Na západě sousedí Německo s Francií, Lucemburskem, Belgií a Nizozemskem. Na severu je jeho sousedem Dánsko a jeho břehy jsou omývány Severním a Baltským mořem. Na východě sousedí s Polskem, na jihu se Švýcarskem a na jihovýchodě s Českem a Rakouskem. Česko je sousedem dvou spolkových zemí v Německu, a to Bavorska a Saska.\\nRozloha Německa je 357 023 km², přičemž území státu se nachází v mírném podnebním pásmu. Podle úředních údajů mělo Německo k 31. prosinci 2015 82,2 milionu obyvatel, což z něj činí nejlidnatější stát Evropské unie. Jeho populace ale již v letech 2003 až 2010 klesla kvůli dlouhodobě velmi nízké porodnosti, a to o skoro 800 000 obyvatel, takže až do roku 2012 bylo Německo jednou z mála západoevropských zemí s úbytkem obyvatelstva. Tento vývoj probíhá navzdory tomu, že Německo je zároveň domovem třetí největší populace imigrantů na světě. Výsledek sčítání lidu 2011 znamenal snížení dosavadního úředního odhadu stavu obyvatelstva o zhruba 1,1 miliónu lidí. Německo je co do absolutního počtu imigrantů zemí, která je nejvíce postižena současnou evropskou migrační krizí, zvláště v roce 2015."},{"page_url":"https://eu.wikipedia.org/wiki/Trichoglossus_capistratus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Trichoglossus_haematodus_capistratus_-Lion_Country_Safari-8-3c.jpg","page_title":"Trichoglossus capistratus","context_page_description":"Trichoglossus capistratus Trichoglossus generoko animalia da. Hegaztien barruko Psittacidae familian sailkatua dago."},{"page_url":"https://en.wikipedia.org/wiki/Mam_Tor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Mam_Tor%2C_overlooking_the_Hope_Valley_and_Castleton.jpg","page_title":"Mam Tor","context_page_description":"Mam Tor is a 517 m hill near Castleton in the High Peak of Derbyshire, England. Its name means \\"mother hill\\", so called because frequent landslips on its eastern face have resulted in a multitude of \\"mini-hills\\" beneath it. These landslips, which are caused by unstable lower layers of shale, also give the hill its alternative name of Shivering Mountain. In 1979, the continual battle to maintain the A625 road on the crumbling eastern side of the hill was lost when the road officially closed as a through-route, with the Fox House to Castleton section of the road being re-designated as the A6187.\\nThe hill is crowned by a late Bronze Age and early Iron Age univallate hill fort, and two Bronze Age bowl barrows. At the base of the Tor and nearby are four show caves: Blue John Cavern, Speedwell Cavern, Peak Cavern and Treak Cliff Cavern where lead, Blue John, fluorspar and other minerals were once mined. Mam Tor as declared to be one of the Seven Wonders of the Peak by Thomas Hobbes in his 1636 book De Mirabilibus Pecci.\\nSimon Jenkins rates the panorama from Kinder Scout to Stanage Edge as one of the top ten in England."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%AA%D7%99%D7%90%D7%A1_%D7%99%D7%95%D7%A8%D7%92%D7%A0%D7%A1%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Chelsea_1_Huddersfield_1_%28Mathias_J%C3%B8rgensen%29_%28cropped%29.jpg","page_title":"מתיאס יורגנסן","context_page_description":"מתיאס ג'טה-נג'י יורגנסן הידוע גם בכינויו \\"זנקה\\", הוא כדורגלן דני המשחק בפנרבחצ'ה ובנבחרת דנמרק בעמדת הבלם."},{"page_url":"https://en.wikipedia.org/wiki/Zubovo-Polyansky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Mordovia-field-near-zarubkino-11-september-2015.jpg","page_title":"Zubovo-Polyansky District","context_page_description":"Zubovo-Polyansky District is an administrative and municipal district, one of the twenty-two in the Republic of Mordovia, Russia. It is located in the west of the republic. The area of the district is 2,710 square kilometers. Its administrative center is the urban locality of Zubova Polyana. As of the 2010 Census, the total population of the district was 59,256, with the population of Zubova Polyana accounting for 17.5% of that number."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbahn_Timi%C8%99oara","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Podul_Decebal_in_renovare.jpg","page_title":"Straßenbahn Timișoara","context_page_description":"Die Straßenbahn Timișoara ist nach der Straßenbahn Bukarest der zweitgrößte Straßenbahnbetrieb in Rumänien. Die gesamte Netzlänge beträgt 33,1 Kilometer, es werden insgesamt 69 Haltestellen bedient. Aktuell verkehren in Timișoara die sieben Linien 1, 2, 4, 6, 7, 8 und 9, die zusammen sieben der insgesamt zehn Stadtbezirke abdecken. Lediglich Freidorf, Ghiroda Nouă und Plopi haben keinen Straßenbahnanschluss. Allerdings besaß zumindest Freidorf bis 2009 eine Schienenverbindung, wird aber seither durch die Autobuslinie 3 im dauerhaften Schienenersatzverkehr bedient. Ebenfalls durch Autobusse ersetzt wird seit dem 2. September 2017 die Linie 5.\\nDas Netz ist normalspurig und geht auf die 1869 eröffnete Pferdebahn zurück, die 1899 elektrifiziert und erweitert wurde. Ferner war die Straßenbahn Timișoara der erste Straßenbahnbetrieb auf dem Gebiet des heutigen Rumänien, später die zweite elektrisch betriebene Straßenbahn in Rumänien.\\nBetreiberin der Straßenbahn ist die Aktiengesellschaft Societatea de Transport Public Timișoara, kurz S.T.P.T."},{"page_url":"https://sv.wikipedia.org/wiki/Hakon_Ahlberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Stockholms_sjukhem_kyrkan.jpg","page_title":"Hakon Ahlberg","context_page_description":"Hakon Claes Axel Ahlberg, född 10 juni 1891 i Laholm, död 12 mars 1984 i Stockholm, var en svensk arkitekt och grundare av Svenska Arkitekters Riksförbund och dess förste ordförande. Han var en flitig debattör och som arkitekt ritade han allt från kyrkor och museer till bostäder och sjukhus. Bror till Alf Ahlberg."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%84%A1%E6%87%BC%E5%8B%87%E5%A3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bravest_Warriors_Promo_Poster.png","page_title":"無懼勇士","context_page_description":"《無懼勇士/探險勇士》是一部美國線上系列動畫，原創為《探險活寶》的作者潘得頓·沃德，由Breehn Burns指導。此系列由Frederator Studios在所屬的卡通宿醉YouTube頻道上出品。\\n設定在3085年，劇情循著四個受僱英雄穿梭宇宙，運用情緒的力量拯救可愛的外星人和他們的世界。2012年11月8日開始在Frederator的卡通宿醉YouTube頻道發行，該系列基於一個為Frederator的Nicktoons Network的動畫培育系列Random! Cartoons而創，於2009年1月10發表的短篇作品。漫畫改編本於2012年12月24日由Boom! Studios發行。\\n其在2013贏得了肖蒂獎的最佳網路系列，並等候提名安錫國際動畫影展。\\n其中一二季可藉由youtube觀看，而第三第四季只能透過VRV觀看"},{"page_url":"https://ro.wikipedia.org/wiki/Gaz_CS","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/CS-Gas-Synthese.svg","page_title":"Gaz CS","context_page_description":"Compusul 2-clorobenzalmalononitril, un cianocarbon, este componentul principal al unui gaz lacrimogen cunoscut sub acronimul CS care este folosit ca mijloc de neutralizare a manifestanților violenți în misiunile de menținere sau restaurare a ordinii publice. Expunerea provoacă senzația de arsură și lăcrimarea incontrolabilă a ochilor, în măsura în care subiectul nu poate să-și țină ochii deschiși, și iritația și senzația de arsură ale mucoaselor nasului, gurii și gâtului, ceea ce duce la tuse abundentă, descărcări puternice ale mucoaselor nazale, dezorientare și dificultăți de respirație. Gazul CS este un aerosol al unui solvent volatil și 2-clorobenzalmalononitril, care este un compus solid la temperatura camerei. Gazul CS este în general acceptat ca fiind neletal.\\nCS a fost sintetizat prima dată în 1928 de către doi americani, Ben Corson și Roger Stoughton, la Middlebury College. Numele substanței provine de la inițialele numelor de familie ale acestora,\\nGazul CS a fost dezvoltat și testat în secret în laboratoarele militare din Porton Down, în Wiltshire, Anglia, în anii 1950 și 1960. Gazul CS a fost folosit mai întâi pe animale, apoi pe militari voluntari ai Armatei Britanice."},{"page_url":"https://de.wikipedia.org/wiki/Max_Meid","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Frankfurt-Kulturdenkmal_Direktorenvilla-Bank-deutscher-Laender_Gartenseite_LWS1728.jpg","page_title":"Max Meid","context_page_description":"Max Meid war ein deutscher Architekt. Meid und sein Partner Helmut Romeick gehörten zu den führenden Vertretern der Nachkriegsmoderne in Frankfurt am Main und auch bundesweit."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B6%D0%B8%D0%BC%D0%B0,_%D0%AE%D0%BB%D0%B8%D1%8F_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Biathlon_European_Championships_2017_Sprint_Women_1910.JPG","page_title":"Джима, Юлия Валентиновна","context_page_description":"Ю́лия Валенти́новна Джи́ма — украинская биатлонистка. Олимпийская чемпионка 2014 года в эстафете, трёхкратный призёр чемпионатов мира, победительница этапов Кубка мира, пятикратная чемпионка Европы."},{"page_url":"https://sv.wikipedia.org/wiki/Genill%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Map_commune_FR_insee_code_37111.png","page_title":"Genillé","context_page_description":"Genillé är en kommun i departementet Indre-et-Loire i regionen Centre-Val de Loire i de centrala delarna av Frankrike. Kommunen ligger i kantonen Montrésor som tillhör arrondissementet Loches. År 2009 hade Genillé 1 554 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen,_Pl%C3%A4tze_und_Br%C3%BCcken_in_Hamburg-Hamm","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Erste_Grevenbr%C3%BCcke.jpg","page_title":"Liste der Straßen, Plätze und Brücken in Hamburg-Hamm","context_page_description":"Die Liste der Straßen, Plätze und Brücken in Hamburg-Hamm ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Hamm vorhandenen Straßen, Plätze und Brücken. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://no.wikipedia.org/wiki/Slaget_ved_Sel%C3%A5nger","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Suecia_2-063_%3B_Sundsvall.jpg","page_title":"Slaget ved Selånger","context_page_description":"Slaget ved Selånger var det siste slaget under den store nordiske krig. Slaget utspilte seg den 25. mai/ 5. juni 1721 i og omkring Sundsvall og Selånger. Jämtlands kavalerikompani spilte hovedrollen på den svenske siden, og mot seg hadde de en ti ganger så stor styrke kosakker og over 6 000 mann russisk infanteri. Resultatet ble en russisk seier, og byen Sundsvall med omkringliggende byer ble plyndret og brent ned.\\nEn russisk flåte av galeier hadde på denne tiden blitt sett langsmed Norrlandskysten på sin vei nordover. Länsstyrelsen, som på denne tiden lå i Gävle, bestemte seg for å sende major Johan Henrik Fieandt til Sundsvall for å organisere forsvaret av byen. Vel framme satte Fieandt opp en forsvarstyrke som bestod av 80 menn fra Norrlands første marinekompani under kommando av kommandør Wibbling, som på denne tid befant seg i byen med to store galeier og fire mindre. Dessuten var det en avdeling på ca. 80 ryttere fra Jämtlands kavalerikompani og cirka 150 mobiliserte bønder. Men Fieandt hadde håpet på at 700-800 mann kunne mobiliseres av bønder og bybeboere og skrev i bitre ordelag etter striden om medelpadingenes manglende evne og vilje."},{"page_url":"https://br.wikipedia.org/wiki/Savelleg-karreg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Monsax.jpg","page_title":"Savelleg-karreg","context_page_description":"Ar savelleg-karreg a zo ur spesad golvaneged, Monticola saxatilis an anv skiantel anezhañ.\\nAnvet e voe Turdus saxatilis da gentañ-penn gant an naturour svedat Carl von Linné."},{"page_url":"https://it.wikipedia.org/wiki/Gam-COVID-Vac","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/SputnikV.png","page_title":"Gam-COVID-Vac","context_page_description":"Il Gam-COVID-Vac è un candidato vaccino contro COVID-19, sviluppato dal Centro nazionale di ricerca epidemiologica e microbiologica N. F. Gamaleja in Russia e in fase di sperimentazione clinica."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%82%B9iD","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Shinjuku-i-Land-Tower-04.jpg","page_title":"ミスiD","context_page_description":"ミスiDは、講談社が主催する女性アイドルオーディション。"},{"page_url":"https://ca.wikipedia.org/wiki/Annals_d%27Ulster","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Bodleian_Library_MS._Rawl._B._489_-_folio_2v.jpg","page_title":"Annals d'Ulster","context_page_description":"Els Annals d'Ulster són uns annals medievals d'Irlanda, en dos manuscrits, que es troben l'un al Trinity College de Dublin i l'altre a la Bodleian library a Oxford.\\nLes entrades abasten els anys entre el 431 al 1540 dC. Les entrades fins a l'any 1489 van ser compilades al segle XV per l'escriba Ruaidhrí Ó Luinín, per al seu patró Cathal Óg Mac Maghnusa a l'illa de Belle Isle, al Lough Erne, en la província d'Ulster, i les entrades fins al 1507 per Ruaidhrí Ó Luinín, a partir de la qual s'alternen dos escribes desconeguts, i les darreres entrades ho són per diverses mans.\\nAnnals anteriors que daten des del segle sisè es van utilitzar com a font per a les entrades més anteriors, i les entrades posteriors es basen en el record i la història oral. T. M. Charles-Edwards ha afirmat que la principal font dels seus registres del primer mil·lenni és l'ara perduda continuació Armagh de la Crònica d'Irlanda.\\nEls annals empren la llengua irlandesa, amb algunes entrades en llatí. Ja que els Annals van copiar les seves fonts de manera textual, els annals no són només útils per als historiadors, sinó també per als lingüistes que estudien l'evolució de la llengua irlandesa."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9C%D1%83%D1%81%D0%BA%D0%B0%D1%82_%D0%B6%D0%B0%D2%A3%D2%93%D0%B0%D2%93%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Nutmeg_on_Tree.jpg","page_title":"Мускат жаңғағы","context_page_description":"Мускат жаңғағы — тропикалық мускат ағашының дәндерінен дайындалған татымды зат, дәмдеуіш.\\nОтаны - Индонезиядағы Молукк аралдары. Күшті хош иісі бар, аспазханада, сондай-ақ сашеде және рақым ету ретінде қолданылады.\\nАғаш көктегеннен кейін сегіз жыл өткен соң ғана жеміс береді, 25 жылдан кейін гүлденеді, 60 және одан да көп уақыттан астам жеміс береді. Әртүрлі мемлекеттерде кейде мускат криптокариін, хош иісті лаурелиді және калифорниялық торреиді «Мускат жаңғағы» деп атайды."},{"page_url":"https://sv.wikipedia.org/wiki/Olle_G%C3%A4llmo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Ollegallmo.jpg","page_title":"Olle Gällmo","context_page_description":"Olle Gällmo, född 26 juni 1966 i Sollentuna, är en svensk lärare och riksspelman på svensk säckpipa."},{"page_url":"https://sv.wikipedia.org/wiki/Offerdals_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Offerdals_kyrka.3.JPG","page_title":"Offerdals kyrka","context_page_description":"Offerdals kyrka är en kyrkobyggnad i byn Ede vid Hällsjöns östra ände. Den är församlingskyrka i Offerdals församling i Härnösands stift."},{"page_url":"https://ceb.wikipedia.org/wiki/Tegostoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Anthophilopsis_baphialis.JPG","page_title":"Tegostoma","context_page_description":"Henero sa mga alibangbang ang Tegostoma. Ang Tegostoma sakop sa kabanay nga Crambidae."},{"page_url":"https://es.wikipedia.org/wiki/Misionero","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Saint_Laurent-Marie-Joseph_Imbert%2C_M.E.P._%282%29.jpg","page_title":"Misionero","context_page_description":"Se llama misionero a aquella persona cuyo objetivo principal es el anuncio del evangelio mediante obras y palabras entre aquellos que no creen. Esa forma de misión propiamente tal es conocida como ad gentes, es decir, hacia las gentes, gentiles o no cristianos, y se desarrolla en lugares donde el evangelio no ha sido suficientemente anunciado o acogido, o en ambientes refractarios ubicados más allá de las propias fronteras donde se dificulta la prédica y aceptación del mensaje.\\nEn la Historia del cristianismo, la idea de misión se aplica tanto a colectividades como a individuos e implica una forma de vocación, que se interpreta como un llamamiento positivo de Dios que «envia», ​ para llevar un encargo o realizar un trabajo apostólico: la tarea de anunciar el evangelio, conforme al mandato final puesto en boca de Jesús de Nazaret en los Evangelios de Mateo y de Marcos:\\n«Id, pues, y haced discípulos a todas las gentes, bautizándolas en el nombre del Padre y del Hijo y del Espíritu Santo, y enseñándoles a guardar todo lo que yo os he mandado.»\\nEvangelio de Mateo 28:19-20a\\nY les dijo: «Id por todo el mundo y predicad el evangelio a toda criatura».\\nEvangelio de Marcos 16:15"},{"page_url":"https://no.wikipedia.org/wiki/Nordahl_Grieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Denkmal_Nordahl_Grieg_Bergen.jpg","page_title":"Nordahl Grieg","context_page_description":"Johan Nordahl Brun Grieg var en norsk lyriker, forfatter, dramatiker, journalist og politisk aktivist. Han var en av Norges mest markante diktere i sin levetid, og rakk å være produktiv i 21 år, før han selv ble en av «de unge døde», 41 år gammel. Samtidig ble Grieg på 1930-tallet politisk kontroversiell på grunn av sitt stalinistiske ståsted og sitt mangeårige engasjement for Sovjetunionens regime, formidlet gjennom en rekke polemiske artikler og en roman. Hans politiske engasjement fant særlig uttrykk i organisasjonen Sovjetunionens venner, som han ledet. Han var bror av forleggeren Harald Grieg og forfatterne Ingeborg Rolfsen Grieg og Johanne Grieg Cederblad, samt grandnevø av skolemannen Nordahl Rolfsen. Han var gift med skuespilleren Gerd Egede-Nissen fra 1940 til sin død."},{"page_url":"https://en.wikipedia.org/wiki/9th_term_Sejm_and_10th_term_Senate_of_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Paulina_Matysiak_Sejm_2019.jpg","page_title":"9th term Sejm and 10th term Senate of Poland","context_page_description":"The 9th term Sejm and the 10th term Senate is the legislature of the Republic of Poland following the 2019 Polish parliamentary election held on 13 October 2019 which returned 460 deputies to the Sejm and 100 senators to the Senate.\\nThe Parliament of Poland held its inaugural meeting on 12 November 2019."},{"page_url":"https://de.wikipedia.org/wiki/G%C3%B6ttinger_Wingolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/WingolfG%C3%B6ttingenPlakette.png","page_title":"Göttinger Wingolf","context_page_description":"Der Göttinger Wingolf ist eine christliche, überkonfessionelle, farbentragende und nichtschlagende Studentenverbindung in Göttingen und gehört dem ältesten studentischen Dachverband an."},{"page_url":"https://es.wikipedia.org/wiki/Pseudanthias_pleurotaenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/PinkStripeReefFish1.JPG","page_title":"Pseudanthias pleurotaenia","context_page_description":"Pseudanthias pleurotaenia es una especie marina de peces con aletas radiadas perteneciente a la familia Serranidae. Esta especie de Pseudanthias es un pez de arrecife del Océano Pacífico. También es conocido en español como pez marrano."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D1%84%D0%BE%D0%BD%D1%81%D0%BE_XIII_%D0%BE%D0%B4_%D0%A8%D0%BF%D0%B0%D0%BD%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Roi_Alfonso_XIII.jpg","page_title":"Алфонсо XIII од Шпаније","context_page_description":"Алфонсо XIII је био краљ Шпаније, постхумно је дете Алфонса XII. Проглашен је за краља одмах по рођењу 17. маја 1886. године. Владао је од 1886. до 1931. године. Његова мајка, краљица Марија Кристина од Аустрије из куће Хабзбург, именована је регенткињом за време његове малолетности. Када је навршио 16 година, 17. маја 1902, преузео је краљевске дужности.\\nШпанија је, међутим, у то време патила од три тешка проблема која ће на крају и довести до пропасти либералне монархије: недостатак реалних политичких представника ширих друштвених слојева; веома лоша ситуација народних маса, а нарочито сељака; проблеми настали као последица рата са мароканским Берберима из Рифа; и каталонски национализам потпомогнут барселонском буржоазијом. Ови и други проблеми онемогућили су да се успостави права либерална демократија, што је довело до диктатуре Прима де Ривере, кога је Алфонсо XIII подржао. Након пропасти диктатуре, Алфонсо XIII је фаворизовао повратак ка демократији, међутим, целокупна политичка класа га је напустила зато што се осећала издатом због његове подршке коју је пружио диктатури Прима де Ривере."},{"page_url":"https://es.wikipedia.org/wiki/Gengis_Kan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Genghis_khan_empire_at_his_death.png","page_title":"Gengis Kan","context_page_description":"Gengis Kan fue un guerrero y conquistador mongol que unificó a las tribus nómadas de esta etnia del norte de Asia, fundando el primer Imperio mongol, considerado el segundo más grande de la historia en términos de expansión territorial. Bajo su liderazgo como Gran Kan, los mongoles comenzaron una oleada de conquistas que extendió su dominio a un vasto territorio, desde Europa Oriental hasta el océano Pacífico, y desde Siberia hasta Mesopotamia, la India e Indochina. En la primera fase de esta expansión, las hordas mongolas conquistaron importantes reinos de Asia, como el Imperio Jin del norte de China, el Imperio tanguta, el Kanato de Kara-Kitai, el Imperio corasmio o la dinastía Song en el sur de China."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A5%D6%80%D5%A4%D5%A1%D5%BF%D5%A5%D6%80_%D5%BA%D5%A1%D6%80%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Fortressarmenians5.jpg","page_title":"Բերդատեր պարոն","context_page_description":"Բերդատեր պարոն. Կիլիկիայի հայկական պետության խոշոր ֆեոդալ իշխան; Բերդատեր պարոնները կազմել են պետության իշխող դասակարգի՝ ազնվականության վերնախավը։ Մոտ 80 բերդատեր պարոններից յուրաքանչյուրն ունեցել է իր կալվածքը, բերդը և զորքը, հաճախ եղել նաև համապատասխան գավառի տերն ու կառավարիչը։ Կալվածքի և բերդի ժառանգական տերը կոչվել է հայրենատեր բերդատեր պարոն, իսկ դրանք թագավորից պայմանական տիրակալության կարգով ստացածը՝ ոչ հայրենատեր բերդատեր պարոն։ Նրանք պարտավոր էին թագավորի կանչով ներկայանալ իրենց զինվորական ջոկատներով, հավաքել հարկերը և մուծել գանձարան, մասնակցել արքունիքի դիվանի նիստերին։ Թագավորը կարող էր ոչ հայրենատեր բերդատեր պարոններից վերցնել կալվածքն ու բերդը, իսկ հայրենատեր բերդատեր պարոնների տիրույթն ենթակա էր բռնագրավման լոկ դիվանի համաձայնությամբ և վճռով։"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A3%AE%E6%9E%97%E5%AE%AE%E5%A4%A7%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/WSB_Vergleich.jpg","page_title":"森林宮大橋","context_page_description":"森林宫大桥是一座位于德国德累斯顿、穿越易北河的行车桥梁。大桥是为了纾缓德累斯顿内城的交通挤塞而兴建。由于当时德累斯顿易北河谷被联合国教科文组织定为世界遗产，而联合国教科文组织也对于大桥的建造工程表示强烈反对，并警告将会撤销德累斯顿易北河谷的世界遗产资格，大桥的建造工程变得极具争议性。德累斯顿易北河谷在2006年因大桥的建造工程而被列为“濒危世界遗产”，并在2009年正式成为第二个被除名的世界遗产。"},{"page_url":"https://id.wikipedia.org/wiki/Dendrit","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Neuron-no_labels.png","page_title":"Dendrit","context_page_description":"Dendrit adalah cabang dari Neuron. Sel-sel saraf di otak disebut Neuron. Setiap neuron terdiri dari satu badan sel yang di dalamnya terdapat sitoplasma dan inti sel. Dari badan sel keluar dua macam serabut saraf, yaitu dendrit dan akson.\\nDendrit berfungsi mengirimkan impuls ke badan sel saraf, sedangkan akson berfungsi mengirimkan impuls dari badan sel ke jaringan lain. Akson biasanya sangat panjang. Sebaliknya, dendrit pendek.\\nSetiap neuron hanya mempunyai satu akson dan minimal satu dendrit. Kedua serabut saraf ini berisi plasma sel. Pada bagian luar akson terdapat lapisan lemak disebut mielin yang merupakan kumpulan sel Schwann yang menempel pada akson. Sel Schwann adalah sel glia yang membentuk selubung lemak di seluruh serabut saraf mielin. Membran plasma sel Schwann disebut neurilema. Fungsi mielin adalah melindungi akson dan memberi nutrisi. Bagian dari akson yang tidak terbungkus mielin disebut nodus Ranvier, yang berfungsi mempercepat penghantaran impuls."},{"page_url":"https://de.wikipedia.org/wiki/Zofingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Heiternplatz_180%C2%B0_panorama.jpg","page_title":"Zofingen","context_page_description":"Zofingen ist eine Kleinstadt, Einwohnergemeinde und Hauptort des gleichnamigen Bezirks im Kanton Aargau in der Schweiz. Sie liegt im äussersten Südwesten des Kantons im Wiggertal, an der Grenze zum Kanton Luzern, und bildet den südlichen Schwerpunkt eines Ballungsgebietes, das sich über Oftringen und Aarburg und bis nach Olten und Trimbach im Kanton Solothurn erstreckt. Die Stadt liegt nahe dem Kreuzungspunkt der wichtigsten Nord-Süd- und West-Ost-Verkehrswege der Schweiz. Mit fast 12'000 Einwohnern ist Zofingen die siebtgrösste Gemeinde des Kantons.\\nIn der Antike war Zofingen eine Siedlung der keltischen Helvetier, später errichteten die Römer einen Gutshof. Die Alemannen siedelten im 6. Jahrhundert und bildeten eine der ältesten Pfarreien im Aargau. Im 11. Jahrhundert gründeten die Frohburger ein Chorherrenstift und 1231 erfolgte die erste urkundliche Erwähnung Zofingens, das 1299 in den Besitz der Habsburger gelangte. 1415 eroberten die Berner die Stadt, 1528 führten sie die Reformation ein. Mit der Ausrufung der Helvetik endete 1798 der Untertanenstatus. Seit 1803 gehört Zofingen zum Kanton Aargau und entwickelte sich zu einem Regionalzentrum."},{"page_url":"https://en.wikipedia.org/wiki/.38_Special","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/38_Special_-_FMJ_-_SB_-_2.jpg","page_title":".38 Special","context_page_description":"The .38 Smith & Wesson Special is a rimmed, centerfire cartridge designed by Smith & Wesson. It is most commonly used in revolvers, although some semi-automatic pistols and carbines also use this round. The .38 Special was the standard service cartridge of most police departments in the United States from the 1920s to 1990s, and was also a common sidearm cartridge used by military personnel in World War II. In other parts of the world, it is known by its metric designation of 9×29.5mmR or 9.1×29mmR.\\nKnown for its accuracy and manageable recoil, the .38 Special remains one of the most popular revolver cartridges in the world more than a century after its introduction. It is used for target shooting, formal target competition, personal defense, and for hunting small game."},{"page_url":"https://fr.wikipedia.org/wiki/Oplurus_saxicola","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Oplurus.JPG","page_title":"Oplurus saxicola","context_page_description":"Oplurus saxicola est une espèce de sauriens de la famille des Opluridae."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E5%8C%97%E6%8D%B7%E9%81%8B341%E5%9E%8B%E9%9B%BB%E8%81%AF%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Siemens_C651.jpg","page_title":"臺北捷運341型電聯車","context_page_description":"台北捷運341型電聯車，簡稱C341型電聯車，是台北捷運營運的通勤型電聯車，屬於高運量類型車種，目前服務於台北捷運板南線。"},{"page_url":"https://simple.wikipedia.org/wiki/University_of_Magallanes","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Escudo_UMAG.jpeg","page_title":"University of Magallanes","context_page_description":"The University of Magallanes is a university in Punta Arenas, Chile."},{"page_url":"https://cs.wikipedia.org/wiki/Saint_John_(p%C5%99%C3%ADtok_z%C3%A1livu_Fundy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/St_John_River_Map.png","page_title":"Saint John (přítok zálivu Fundy)","context_page_description":"Saint John River je řeka na východě Severní Ameriky. Částečně tvoří hranici mezi Kanadou a USA. Je 673 km dlouhá. Povodí má rozlohu 55 400 km²."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E7%8F%AD%E7%89%99%E4%B8%96%E7%95%8C%E9%81%97%E4%BA%A7%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Vista_aerea_del_Monasterio_de_El_Escorial.jpg","page_title":"西班牙世界遗产列表","context_page_description":"本列表羅列了經聯合國教科文組織審核通過的西班牙世界遺產。1972年，聯合國教科文組織決定將價值較高的文化遺產和自然遺產選為世界遺產並寫入《世界遺產名錄》。1982年5月4日，西班牙表示願意接受《保護世界文化和自然遺產公約》，其歷史遺蹟獲得了列入《世界遺產名錄》、成為世界遺產的資格。隨著時間的推移，越來越多的西班牙歷史遺蹟成為世界遺產。這些世界遺產可分為自然遺產、文化遺產和複合遺產。\\n1984年，西班牙的首批世界遺產在阿根廷布宜諾斯艾利斯主辦的第8屆世界遺產委員會會議上誕生，西班牙的哥多華主教座堂、阿爾罕布拉宮、赫內拉利費宮、布哥斯大教堂、埃斯科里亞爾修道院、桂爾公園、桂爾宮和米拉公寓8個建築被選為世界遺產。1985年，5個西班牙歷史遺蹟被選為世界遺產。次年又有4個西班牙歷史遺蹟入選。截至2019年7月，西班牙共有42個文化遺產、4個自然遺產和2個複合遺產，合計48個，僅次於義大利和中國，位居世界第三。其中庇里牛斯山脈-佩爾迪多山是西班牙和法國的共有遺產，科阿谷和謝加貝爾德的史前岩石藝術地點群是西班牙與葡萄牙的共有遺產，阿爾馬登和伊德里亞的汞礦遺產是西班牙與斯洛維尼亞的共有遺產，古山毛櫸森林是西班牙與德國、斯洛伐克、烏克蘭、阿爾巴尼亞、奧地利、比利時、保加利亞、克羅埃西亞、義大利、羅馬尼亞和斯洛維尼亞的共有遺產。在西班牙的17個自治區中，卡斯提亞-雷昂自治區共有9個世界遺產，位居全國第一。\\n2002年4月18日，西班牙同聯合國教科文組織組建了一個名為西班牙信託基金的基金會，西班牙大使兼聯合國教科文組織常駐代表弗朗西斯科·比利亞爾和聯合國教科文組織總幹事松浦晃一郎簽署協定成立西班牙信託基金。西班牙信託基金每年將會提供600000歐元幫助其他會員國進行如遺產提名、評估暫定遺產一類的工作，尤其是拉丁美洲的會員國。2008年，西班牙擔任世界遺產委員會主席。2009年6月22日，西班牙在安達魯西亞的塞維亞主辦了第33次世界遺產委員會會議，會議於6月30日結束，為期共9天。西班牙的在任時間為2年。"},{"page_url":"https://en.wikipedia.org/wiki/Nussdorf,_Vienna","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Karte_Wien-Nussdorf.png","page_title":"Nussdorf, Vienna","context_page_description":"Nussdorf was a separate municipality until 1892 and is today a suburb of Vienna in the 19th district of Döbling."},{"page_url":"https://en.wikipedia.org/wiki/HMHS_Lanfranc","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Booth_Line_logo.png","page_title":"HMHS Lanfranc","context_page_description":"HMHS Lanfranc was an ocean liner requisitioned as a hospital ship in the First World War. On 17 April 1917 she was torpedoed by the German U-boat SM UB-40."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E6%96%87%E5%8C%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Mahuri.svg","page_title":"日本文化","context_page_description":"日本文化，是指在日本列島上形成的在關於思想、行為、生活、教育、信仰及價值觀等等的一系列實體或非實體的事物或象徵。\\n公元四世紀至九世紀，日本的遣隋使和遣唐使為日本帶來了漢傳佛教文化，如花道、茶道和香道都是伴隨著漢傳佛教傳到日本的，是日本傳統藝術的重要一環。十世紀左右，日本與東亞大陸的交流變少，開始孕育出日本的所謂國風文化。十六世紀中葉，歐陸文化傳到日本，後來因貿易保護政策和基督教禁令，使歐陸文化在日本的傳播停滯。直至十九世紀，日本在美國的外交壓力下簽署日美神奈川條約，開放了下田及箱館兩港口通商，歐陸文化在日本才得以重新復興，後來更成為日本文化的重要一員。\\n由於日本之於東亞大陸的地理位置，日本文化常常被劃入東亞或儒家文化圈文化之中，但始終存在爭議。美國保守派政治學家塞繆爾·P·亨廷頓在1993年發表的文明衝突論中，認為日本文化獨立於東亞自成一體，應並列為世界九大文明之一。而日本歷史學家與那霸潤則認為日本文化是東亞大陸文化的延伸，並著重於唐朝文化的色彩，只在些許方面有差異。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-l%E2%80%99Assomption_d%27Avenas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/OV-Avenas2.jpg","page_title":"Église Notre-Dame-de-l’Assomption d'Avenas","context_page_description":"L'église Notre-Dame-de-l'Assomption d'Avenas est située dans la nouvelle commune de Deux-Grosnes au centre de l'ancienne commune d'Avenas dans le département du Rhône. C'était à l'origine l'église du monastère d'Avenas qui appartenait au chapitre de Mâcon. L'autel du XIIᵉ siècle est classé au titre d'objet depuis 1901 dans la base Palissy du patrimoine mobilier français du Ministère de la Culture."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%B4%E7%BA%BF%E8%A3%85%E7%94%B2%E5%B8%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/WWI_style_ship_armor.svg","page_title":"水线装甲带","context_page_description":"水线装甲是装在军舰的两侧的一种厚金属装甲，它可以装在船壳之外或是之内，一般常见于主力军舰如战列舰、战列巡洋舰、航空母舰和巡洋舰上。\\n一般来说战列舰上的主装甲带是从主甲板的高度起安装，一直到略低于水线为止。如果是安在船壳内侧的话还要有一定的倾角以提高防护效能。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Lorch_(Rheingau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Lorch_Rhg_-_Rheinstra%C3%9Fe_Strunk_%28KD.HE_2_09.2015%29.jpg","page_title":"Liste der Kulturdenkmäler in Lorch (Rheingau)","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Lorch, Rheingau-Taunus-Kreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde.\\nDas Vorhandensein oder Fehlen eines Objekts in dieser Liste ist keine rechtsverbindliche Auskunft darüber, ob es Kulturdenkmal ist oder nicht: Diese Liste entspricht möglicherweise nicht dem aktuellen Stand der offiziellen Denkmaltopographie. Diese ist für Hessen in den entsprechenden Bänden der Denkmaltopographie Bundesrepublik Deutschland und im Internet unter DenkXweb – Kulturdenkmäler in Hessen einsehbar. Auch diese Quellen sind, obwohl sie durch das Landesamt für Denkmalpflege Hessen aktualisiert werden, nicht immer aktuell, da es im Denkmalbestand immer wieder Änderungen gibt."},{"page_url":"https://de.wikipedia.org/wiki/Straas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/M%C3%BCnchberg_Stadtgebiet.png","page_title":"Straas","context_page_description":"Straas ist ein Ortsteil der Stadt Münchberg im oberfränkischen Landkreis Hof.\\nDas Dorf befindet sich an der Staatsstraße 2194 zwischen Münchberg und der Auffahrt zur Autobahn 9. Verbindungsstraßen führen über die Hintere Höhe nach Münchberg und in die Nachbarorte Mussen, Biengarten, Plösen und in Verlängerung der Staatsstraße als Kreisstraße HO 21 nach Stammbach.\\nStraas war bis 1972 eine eigene Gemeinde im Landkreis Münchberg zusammen mit den Orten Biengarten, Plösen, Solg, Schödlas, Querenbach und Oelschnitz. Das Gemeindewappen war geteilt von Silber und Schwarz; oben ein roter Sparren, unten drei goldene Hämmer, deren Stiele unten zusammenstießen.\\nZu den Baudenkmälern zählen zwei Wohnstallhäuser und ein Wohnhaus mit Satteldach und Fachwerkgiebeln."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_vo_Vranove_nad_Top%C4%BEou","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Vranov_17_Slovakia3.jpg","page_title":"Zoznam kultúrnych pamiatok vo Vranove nad Topľou","context_page_description":"Toto je zoznam kultúrnych pamiatok v meste Vranov nad Topľou v okrese Vranov nad Topľou.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BD%D0%BA%D0%B8_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Panzertuerm_N874.jpg","page_title":"Танки США","context_page_description":"Ця стаття розглядає історію та розвиток американських танків: їх виникнення під час Першої світової війни, міжвоєнний період, Другої світової війни, холодної війни і епохи сучасності."},{"page_url":"https://it.wikipedia.org/wiki/Atacama_Large_Millimeter_Array","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/ALMA_first_fringes_at_Chajnantor.jpg","page_title":"Atacama Large Millimeter Array","context_page_description":"L'Atacama Large Millimeter/submillimeter Array è un radiointerferometro situato a 5000 metri d'altitudine nel deserto di Atacama in Cile. È un progetto sviluppato in collaborazione tra Europa, Nord America, Asia orientale e Repubblica del Cile.\\nL'inaugurazione ufficiale è avvenuta il 13 marzo 2013, mentre l'ultima antenna è stata consegnata il 1º ottobre 2013, con la piena operatività, alla fine dell'anno, di tutte le 66 antenne. Il costo del progetto è stato di circa un miliardo di dollari."},{"page_url":"https://id.wikipedia.org/wiki/Albania_dalam_Kontes_Lagu_Eurovision","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Juliana_Pasha%2C_Albania.jpg","page_title":"Albania dalam Kontes Lagu Eurovision","context_page_description":"Albania telah mengikuti Kontes Lagu Eurovision sebanyak tujuh kali. Penyiar negara ini, Radio Televizioni Shqiptar merupakan panitia untuk perwakilan Albania sejak partisipasi pertamanya pada tahun 2004, dan menggunakan kontes lama yang terkenal di sana, yaitu Festivali i Këngës në RTSH yang katanya sering disebut hanya sebagai Festivali i Këngës, untuk menentukan siapa wakil Albania di Kontes Lagu Eurovision nantinya."},{"page_url":"https://fr.wikipedia.org/wiki/Argonne_(r%C3%A9gion)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bundesarchiv_Bild_104-0176%2C_Argonnen%2C_Transporte_mit_Feldbahn.jpg","page_title":"Argonne (région)","context_page_description":"L'Argonne est une région naturelle de la France, qui chevauche les départements de la Marne, les Ardennes et la Meuse, à l'est du bassin parisien. L'Argonne est une région de forêt et d'étangs. La principale localité de l'Argonne est Sainte-Menehould.\\nDans l'Antiquité, la région de l'Argonne s'est forgée une grande réputation pour ses ateliers céramiques. Plus tard, dans l'histoire de France, elle est renommée grâce surtout à trois événements :\\nl'arrestation à Varennes de Louis XVI en 1791 ;\\nla bataille de Valmy en 1792 ;\\nla Grande Guerre de 1914-1918, notamment lors des batailles de Revigny en 1914, de Champagne en 1914-1915, de Vauquois de 1914 à 1918, de Verdun en 1916-1917 et lors de l'offensive Meuse-Argonne en 1918."},{"page_url":"https://pl.wikipedia.org/wiki/Biblioteka_Krak%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Krak%C3%B3w%2C_ul._Powro%C5%BAnicza_2%2C_willa%2C_A-884.jpg","page_title":"Biblioteka Kraków","context_page_description":"Biblioteka Kraków – gminna instytucja kultury powstała w 2017 roku w wyniku połączenia czterech samodzielnych dzielnicowych sieci bibliotek: Krowoderskiej Biblioteki Publicznej, Nowohuckiej Biblioteki Publicznej, Podgórskiej Biblioteki Publicznej, Śródmiejskiej Biblioteki Publicznej. Biblioteki decyzją Rady Miasta Krakowa od 1 stycznia 2017 roku stanowią jedną samorządową jednostkę organizacyjną Gminy Miejskiej Kraków."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%96%D1%83%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/ZhukovskyVASignature.png","page_title":"Василий Жуковски","context_page_description":"Василий Андреевич Жуковски е руски поет и прозаик, сред пионерите на романтизма. Той е също преводач, литературен критик, академик.\\nВ периода 1817 – 1841 г. е учител по руски език на великата княгиня, а след това и императрица Александра Фьодоровна и наставник на престолонаследника Александър Николаевич. Таен съветник.\\nВ чисто литературен план смята себе си за ученик на Николай Карамзин. Участва в литературния кръг Арзамас, чиито членове отричат традициите на класицизма. Автор е на елегии и на патриотични творби. Превежда английска и немска поезия и внася в руската лирика интимни и метафизични мотиви: приятелство, любов, вяра и задгробен живот. В неговите творби присъстват меланхолия, сантименталност и идилия. Развива руската поема и нейната мелодичност, особено изразяването на емоции. Усъвършенства руския хекзаметър, автор е на класическия превод на Одисея на руски.\\nАвтор е на текста на химна на Руската империя „Боже, Царя храни!“.\\nПогребан е в Тихвинското гробище, Санкт-Петербург."},{"page_url":"https://en.wikipedia.org/wiki/List_of_chairpersons_of_the_Austrian_People%27s_Party","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Volkspartei_Logo_2018.svg","page_title":"List of chairpersons of the Austrian People's Party","context_page_description":"This is a list of chairpersons of the Austrian People's Party."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_b%C5%82._Radzyma_Gaudentego_w_Gnie%C5%BAnie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Church_Radzym.JPG","page_title":"Parafia bł. Radzyma Gaudentego w Gnieźnie","context_page_description":"Parafia bł. Radzyma Gaudentego w Gnieźnie – rzymskokatolicka parafia w gnieźnieńskiej dzielnicy Winiary w dekanacie Gniezno II w archidiecezji gnieźnieńskiej. Największa parafia w dekanacie. Od 1998 do 2009 roku siedziba dekanatu, a od 2009 roku siedziba wicedziekanatu. Swoim zasięgiem obejmuje dzielnicę Winiary oraz pięć wiosek. Proboszczem jest ks. dr Andrzej Szczęsny."},{"page_url":"https://et.wikipedia.org/wiki/Hac%C4%B1_Bayrami_mo%C5%A1ee","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Hac%C4%B1_Bayram_Veli_T%C3%BCrbesi_2.jpg","page_title":"Hacı Bayrami mošee","context_page_description":"Hacı Bayrami mošee on mošee Türgi pealinna Ankara Ulusi linnaosas.\\nMošee asub kõrvuti hellenismiaegse Monumentum Ancyranumi ehk Augustuse templi varemetega.\\nSelle geograafilised koordinaadid on 39° 56′ 40″ N, 32° 51′ 29″ E."},{"page_url":"https://pt.wikipedia.org/wiki/Le_Petit_Journal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Liceubomb.jpg","page_title":"Le Petit Journal","context_page_description":"Le Petit Journal foi um jornal parisiense diário publicado de 1863 a 1944. Foi fundado por Moïse Polydore Millaud. Em suas colunas eram publicadas curiosidades, grandes acontecimentos políticos, fatos históricos retrospectivos e textos ficcionais de Émile Gaboriau e de Ponson du Terrail. Em diversos números é evidente o tom de sensacionalismo dado as suas coberturas.\\nNa década de 1890, devido a sua grande popularidade, chegou a ter uma tiragem de um milhão de cópias, e em 1884 foi incluída na publicação um suplemento semanal ilustrado."},{"page_url":"https://lt.wikipedia.org/wiki/Alfa_Romeo_156","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Alfa_Romeo_156_rear_20080331.jpg","page_title":"Alfa Romeo 156","context_page_description":"Alfa Romeo 156 – vidutinės klasės automobilis, kuris buvo gaminamas Italijos automobilių gamintojo „Alfa Romeo“. Pirmasis automobilis buvo pristatytas 1997 m. Frankfurto automobilių parodoje kaip sekantis modelis, einantis po Alfa Romeo 155. Alfa Romeo 156 buvo puikiai vertinama nuo pat pirmųjų dienų ir 1998 m. laimėjo Europos metų automobilio apdovanojimą 156 sedano versijos gamyba buvo nutraukta Europoje 2005 m. pabaigoje, o Q4 Crosswagon universalas buvo gaminamas iki 2007 m. pabaigos.\\nAutomobiliai buvo surenkami „Fiat“ grupės gamykloje Pomigliano d’Arco, Italijoje bei „General Motors“ gamykloje Rayong mieste, Tailande.\\nGamyba Tailande prasidėjo 2002 m. kovą ir tęsėsi apie porą metų. Čia pagaminti automobiliai buvo skirti Azijos Ramiojo vandenyno regiono rinkai. Tarp 1997 m. ir 2005 m. buvo pagaminta apie 680 000 vnt. automobilių.\\nAlfa Romeo 156 galimi kėbulo tipai buvo sedanas, bei dviejų skirtingų tipų universalai: Sportwagon ir Crosswagon. Galimos septynios variklių konfigūracijos, kėbulas turėjo dvi atnaujinimų versijas: vieną 2002 m., kitą 2003 m. Sportwagon automobilio reklaminė kampanija buvo daroma pasitelkiant aktorės Catherine Zeta-Jones pagalbą.\\n2007 m."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%B7%D8%A7%D8%B1_%D9%84%D9%88%D8%B3_%D8%A7%D9%86%D8%AC%D9%84%D9%88%D8%B3_%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/LAX_LA.jpg","page_title":"مطار لوس انجلوس الدولى","context_page_description":"مطار لوس انجلوس الدولى هوا مطار فى امريكا."},{"page_url":"https://vi.wikipedia.org/wiki/Eirenis_lineomaculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Eirenis_lineomaculatus.jpg","page_title":"Eirenis lineomaculatus","context_page_description":"Eirenis lineomaculatus là một loài rắn trong họ Rắn nước. Loài này được Schmidt mô tả khoa học đầu tiên năm 1939."},{"page_url":"https://it.wikipedia.org/wiki/Bojagi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Korea-Joseon-Bojagi-01.jpg","page_title":"Bojagi","context_page_description":"Un bojagi è un tradizionale tessuto da imballaggio coreano. I bojagi sono tipicamente quadrati e possono essere fatti con una varietà di materiali, sebbene la seta o la ramia siano comuni. I bojagi ricamati sono conosciuti come subo, mentre i bojagi patchwork fatti con tessuti diversi sono conosciuti come jogakbo.\\nI bojagi hanno molti usi, compresi quelli di confezioni regalo, nei matrimoni e nei riti buddisti. Più recentemente, sono stati riconosciuti come una forma d'arte tradizionale, e sono spesso presenti nei musei, ispirando anche reinterpretazioni moderne."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B4%D9%88%D8%B1%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Schwerin_Stadtmauer.jpg","page_title":"شورین","context_page_description":"شورین آلمانین مکلنبورق-فورپومرن ایالتینده یئر آلان بیر شهردیر و ۳۸ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۹۵۸۵۵ نفر دیر. بۇ شهرین ۱۳۰٫۴۶ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://de.wikipedia.org/wiki/Ehrenwache","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Turkey-1658_%282215850337%29.jpg","page_title":"Ehrenwache","context_page_description":"Ehrenwache bezeichnet eine im Protokolldienst stehende Gruppe von Soldaten, die zu Traditions- oder Repräsentationszwecken ein Gebäude, Denkmal o. Ä. unter militärische Bewachung stellt."},{"page_url":"https://da.wikipedia.org/wiki/William_Holman_Hunt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/William_Holman_Hunt_-_Rienzi_vowing_to_obtain_justice.jpg","page_title":"William Holman Hunt","context_page_description":"William Holman Hunt var en engelsk maler.\\nHan gik på akademiet og fik i den jævnaldrende John Everett Millais en varig ven, der blev ham en støtte i hans ungdoms svære kunstnerkamp. Han blev så betaget af John Ruskins Modern painters, at hans kunstnerbane var givet. Han var med til at grunde det prærafaelitiske broderskab og forfægtede det i The Times og The Contemporary Review, men frem for alt gennem sin kunst broderskabets uforfalskede lære.\\nHan hader det konventionelle i kunsten og dyrkede med næsten religiøs optagethed virkeligheden ved en enestående minutiøs gengivelse af alle billedets enkeltheder og lagde derved også skolens svagheder med hensyn til helhedsindtryk med videre blot.\\nMed den uendelige omhu, der kunne virke trættende, forbandt Hunt prærafaelitternes religiøse ånd, en mystik og tankedybde, der ofte talte i gåder til beskueren. Efter at have malet The Eve of St Agnes og Rienzi samlede han 1850 et kritikkens uvejr om sig med Kristus forfølges af Druiderne."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_seigneurs_puis_ducs_de_Bourbon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Prince_Cond%C3%A9_1814_Deseine_Chantilly.jpg","page_title":"Liste des seigneurs puis ducs de Bourbon","context_page_description":"Ceci est une liste des seigneurs ou sires de Bourbon, puis ducs de Bourbon à partir de 1327. Le titre régulier de duc de Bourbon est éteint depuis 1830."},{"page_url":"https://id.wikipedia.org/wiki/Ix_Chel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ixchel_Dresden.jpg","page_title":"Ix Chel","context_page_description":"Ix Chel atau Ixchel adalah nama pada abad ke-16 untuk dewi jaguar tua dalam hal kebidanan dan obat dalam budaya Maya kuno. Dia dihubungkan dengan Toci Yoalticitl yang dijuluki \\"Nenek Kami Tabib Nokturnal\\", seorang dewi bumi Aztek yang menghuni tempat pemandian dan berhubungan juga dengan dewi Aztek lainnya yaitu Cihuacoatl, yang biasa dipanggil saat ada kelahiran. Pada klasifikasi para dewa dalam Kodeks Dresden karya Schellhas-Zimmermann yang kemudian direvisi oleh Taube, Ixchel sesuai dengan Dewi O."},{"page_url":"https://de.wikipedia.org/wiki/Shire_of_Atherton","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Atherton_LGA_Qld.png","page_title":"Shire of Atherton","context_page_description":"Der Shire of Atherton war ein Verwaltungsbezirk in Queensland, Australien. Am 17. März 2008 ging er zusammen mit den Shires of Eacham, Herberton und Mareeba im Tablelands Regional Council auf."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E8%88%AA%E7%A9%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Narita_Airpoert_Terminal_2_Check-in_Area.JPG","page_title":"日本航空","context_page_description":"日本航空株式会社は、東京都品川区に本社を置く日本の航空会社。日本で最も長い国内線と国際線の歴史を持つ。イギリスのスカイトラックスによる航空会社の格付けで、実質最高評価の「ザ・ワールド・ファイブ・スター・エアラインズ」の認定を得ている。コーポレートスローガンは「明日の空へ、日本の翼」。なお、名前は似ているが、新日本航空とは資本上の関係はない。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%81%94%E7%9B%9FTMA-5","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Chiao%2C_Shargin%2C_Sharipov.jpg","page_title":"联盟TMA-5","context_page_description":"联盟TMA-5 是俄罗斯发射联盟号宇宙飞船，于2004年10月14日3:06点火升空，前往国际太空站。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Eutritzsch_(A%E2%80%93J)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Gebr._Frank.jpg","page_title":"Liste der Kulturdenkmale in Eutritzsch (A–J)","context_page_description":"Die Liste der Kulturdenkmale in Eutritzsch enthält die Kulturdenkmale des Leipziger Stadtteils Eutritzsch, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand 2017 erfasst wurden.\\nAus Platzgründen ist diese Liste geteilt. In dieser Liste sind die Kulturdenkmale in den Straßen mit den Anfangsbuchstaben A–J erfasst. Die Kulturdenkmale in den Straßen K–Z sind in der Liste der Kulturdenkmale in Eutritzsch aufgeführt."},{"page_url":"https://sh.wikipedia.org/wiki/Strabon","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Strabon.jpg","page_title":"Strabon","context_page_description":"\\"Strabo\\" je naziv kojim su Rimljani označavali osobu čije su oči bile iskrivljene ili izobličene. Pompejev otac se zvao \\"Pompeius Strabo.\\" Osoba rodom sa Sicilije koja je imala jasan vid kojim je mogla vidjeti stvari na velikoj daljini kao da su blizu također je nazivana \\"Strabo.\\"\\nNajznačajnija ličnost po tom imenu bio je Strabon, grčki povjesničar, geograf i filozof. U današnje vrijeme Strabon je uglavnom slavan po svojoj Geografiji, djelu u 17 knjiga koje sadrže povijest i opise ljudi i mjesta diljem njemu poznatog svijeta.\\nStrabon je rođen u imućnoj obitelji iz Amaseje na Pontu, koji je postao dijelom Rimskog Carstva upravo u vrijeme oko njegova rođenja. Učio je pod vodstvom mnogih geografa i filozofa, prvo u vlastitom kraju, a kasnije i u Rimu. U filozofiji je bio stoik, a u politici zagovornik rimskog imperijalizma. Kasnije je poduzeo znatna putovanja, među ostalim u Egipat i Etiopiju. Nije poznato kada je napisao Geografiju iako naznake u njoj smještaju završnu verziju u vrijeme vladavine cara Tiberija. Neki smještaju njegove prve skice oko 7. po. Kr., drugi pak oko 18. po. Kr. Spominje se smrt mauretanijskoga kralja Jube koja se dogodila 23. po. Kr."},{"page_url":"https://it.wikipedia.org/wiki/Dan_Burn","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Dan_Burn_BCFC_2013.jpg","page_title":"Dan Burn","context_page_description":"Dan Burn è un calciatore inglese, difensore del Brighton."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2%D0%BE_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8_(2012)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Jean-Luc_M%C3%A9lenchon_%28Place_au_Peuple%29_001_%28red%C3%A9coup%C3%A9%29.jpg","page_title":"Президентские выборы во Франции (2012)","context_page_description":"Президентские выборы во Франции 2012 года были проведены 22 апреля и 6 мая. Они стали десятыми выборами президента Пятой республики. На выборах был избран на пятилетний срок следующий президент Пятой республики. Первичные партийные выборы по выдвижению кандидатов состоялись во Франции с января по октябрь 2011 года.\\nПо результатам первого тура выборов лидировал Франсуа Олланд, набравший 28,63 % голосов и действующий президент Николя Саркози набравший 27,18 %, они и вышли во второй тур. Третье место заняла лидер «Национального фронта» Марин Ле Пен с 17,90 % голосов, за ней следовал лидер «Левого фронта» Жан-Люк Меланшон, набравший 11,10 % голосов.\\nПрезидентом страны был избран Франсуа Олланд. Эти выборы стали вторыми в истории Франции, которые привели социалиста на высший государственный пост и вторыми, которые проиграл действующий президент."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D1%80%D0%BE%D0%B3%D0%BE%D0%BC%D0%B8%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%BC%D0%BE%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Moscow%2C_MKZD_railway_line_%2815192830861%29.jpg","page_title":"Дорогомиловский железнодорожный мост","context_page_description":"Дорогоми́ловский железнодорожный мост в Москве — стальной трёхпролётный балочный мост через Москву-реку на 41-м километре Малого кольца МЖД в южной части станции Пресня. Построен в 1905—1907.\\nНа мосту расположены два главных железнодорожных пути станции Пресня, между её парками Пресня и Кутузово. Ранее это место было перегоном между станциями Пресня — Кутузово."},{"page_url":"https://en.wikipedia.org/wiki/Kotmale_Dam","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/UG-LK_Photowalk_-_2018-03-24_-_Kotmale_Dam_%281%29.jpg","page_title":"Kotmale Dam","context_page_description":"The Kotmale Dam is a large hydroelectric and irrigation dam in Kotmale, Sri Lanka. The dam generates power from three 67 MW turbines, totalling the installed capacity to 201 MW, making it the second largest hydroelectric power station in Sri Lanka. Construction on the dam began in August 1979 and was ceremonially completed in February 1985. The dam forms the Kotmale Reservoir, which was renamed to Gamini Dissanayake Reservoir on 11 April 2003 following a request by Prime Minister Ranil Wickramasinghe."},{"page_url":"https://ga.wikipedia.org/wiki/T%C3%BAr_Eiffel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Tour_Eiffel_-_20150801_15h30_%2810621%29.jpg","page_title":"Túr Eiffel","context_page_description":"Tá Túr Eiffel ar an túr is cáiliúla agus is spéisiúla ar domhan. Tá an túr suite ar an Champ de Mars, ar bhruach na Séine, i lár chathair Pháras, príomhchathair na Fraince.\\nInniu is mó an aithne ar an túr ar fud na cruinne. Is é an struchtúr is airde i. bPáras é agus an séadchomhartha is mó cuairteanna íoctha ar domhan. Tagann timpeall 7 milliún duine ar cuairt chuig an túr gach bliain. As a ailtire Gustave Eiffel a baisteadh é,\\nIs féidir an túr a fheiceáil ó bheagnach gach áit i bPáras. Bíonn cuma dhraíochtach ar an túr cáiliúil nuair a théann an ghrian faoi agus nuair a chuirtear na soilse geala air. Tá 20,000 bolgán ar fad ann."},{"page_url":"https://en.wikipedia.org/wiki/Dempster_Highway","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Permafrost_bush_very_green.jpg","page_title":"Dempster Highway","context_page_description":"The Dempster Highway, also referred to as Yukon Highway 5 and Northwest Territories Highway 8, is a highway in Canada that connects the Klondike Highway in Yukon to Inuvik, Northwest Territories on the Mackenzie River delta. The highway crosses the Peel River and the Mackenzie Rivers using a combination of seasonal ferry service and ice bridges. Year-round road access from Inuvik to Tuktoyaktuk opened in November 2017 with the completion of the Inuvik-Tuktoyaktuk Highway, creating the first all-weather road route, connecting to the Canadian road network with the Arctic Ocean, in Canada.\\nThe highway is named for the famous Yukon Mountie William Dempster, who earned renown for discovering the fate of The Lost Patrol."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Minister_for_Finance_(Denmark)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Wilhelm_Carl_Eppingen_Sponneck_by_Georg_Emil_Hansen.jpg","page_title":"List of Minister for Finance (Denmark)","context_page_description":"This is a list of Finance Ministers of Denmark since 1848. Denmark's first unified Finance Ministry was established in that year."},{"page_url":"https://bs.wikipedia.org/wiki/Begunje_na_Gorenjskem","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Begunje_village_just_before_the_sunset.jpg","page_title":"Begunje na Gorenjskem","context_page_description":"Begunje na Gorenjskem su naseljeno mjesto u sastavu općine Radovljica, regija Gorenjska, Slovenija."},{"page_url":"https://sv.wikipedia.org/wiki/Saxifraga_decipiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Saxifraga_decipiens_White_V08_H3990.jpg","page_title":"Saxifraga decipiens","context_page_description":"Saxifraga decipiens är en stenbräckeväxtart som beskrevs av Jakob Friedrich Ehrhart. Saxifraga decipiens ingår i Bräckesläktet som ingår i familjen stenbräckeväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Museum_DKM","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Bundeskunsthalle_-_OuterSpace_-_James_Nasmyth_-_The_moon_considered_as_a_planet%2C_a_world_and_a_satelite-4574.jpg","page_title":"Museum DKM","context_page_description":"Das Museum DKM ist ein Kunstmuseum in Duisburg in der Nähe des Hauptbahnhofs. Die Eröffnung des Privatmuseums nach dem Umbau der Schweizer Architekten Rohr, Egli und Partner erfolgte am 22. Januar 2009 durch den Schirmherr Jürgen Rüttgers. Der Titel der Eröffnungspräsentation, in der zum ersten Mal Teile der privaten Sammlung DKM öffentlich gezeigt werden, lautet „Linien stiller Schönheit“, dazu ist ein 300seitiger Katalog erschienen.\\nIm Rahmen der Kulturhauptstadt RUHR.2010 ist das Museum das jüngste teilnehmende RuhrKunstMuseen.\\nAuf 2.700 m² befinden sich 51 Räume für Künstler bzw. Themen mit über 1000 Ausstellungsstücken, darunter das grafische Werk von Blinky Palermo und Objekte von Ai Weiwei. Die Künstler werden mit ihrem Lebenswerk oder einem Überblick gezeigt. Daneben gibt es noch großflächige Bereiche mit Themenensembles, Dialogsituationen und Skulpturenhöfen. Neben der ständigen Sammlungsschau soll es in Zukunft auch Wechselausstellungen geben.\\nInitiator des Museums ist die Stiftung DKM, deren Gründung auf das Jahr 1999 zurückgeht. Stiftungsgründer sind die beiden Kunstsammler Dirk Krämer und Klaus Maas, aus deren Initialen die Abkürzung DKM gebildet ist."},{"page_url":"https://en.wikipedia.org/wiki/Wings_over_Pittsburgh","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Wingsoverpgh_IMG_8428_%2834603062221%29.jpg","page_title":"Wings over Pittsburgh","context_page_description":"Wings over Pittsburgh is an American Air show which takes place at Pittsburgh International Airport in Pittsburgh, Pennsylvania.\\nInaugurated in June 2000 the air show is one of the largest on the East Coast. Over the years the show has seen many unique displays from aircraft from all over the world. Some notable static displays include: Boeing P-8 Poseidon, Boeing C-17, Boeing KC-46 Pegasus, Boeing MV-22B Osprey, Boeing C-40 Clipper, Gulfstream C-37, Gulfstream C-20, Lockheed C-130T, Lockheed Martin KC-130, Beechcraft T-6 Texan and Beechcraft T-44A. Also, the 60th College Training Detachment provided military training at the airfield.\\nIn recent years the air show has featured displays by the Blue Angels and the USAF Thunderbirds. In 2016 and 2017 the United States Air Force, Navy and Army were joined by aircraft and aviators from the Royal Air Force, Canadian and French Air Forces. In upcoming years it was announced of the possibility of commercial airliners being on display. The types of aircraft or possible airlines featured have not been released and the organizers will not say more on the subject."},{"page_url":"https://fr.wikipedia.org/wiki/John_Gilbert_Talbot","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/John_Gilbert_Talbot_Vanity_Fair_8_July_1897.jpg","page_title":"John Gilbert Talbot","context_page_description":"John Gilbert Talbot PC, est un politicien du Parti conservateur britannique."},{"page_url":"https://de.wikipedia.org/wiki/Opel_Ampera","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Opel_Ampera-e_IMG_2921.jpg","page_title":"Opel Ampera","context_page_description":"Der Opel Ampera war ein viersitziges Plug-in-Hybrid-Pkw-Modell von General Motors auf Grundlage der ersten Generation des Chevrolet Volt mit Voltec-Antrieb. Die Schwestermodelle, zu denen auch die Rechtslenker Holden Volt in Australien und Vauxhall Ampera auf den britischen Inseln gehörten, wurden von Juli 2011 bis 2014 im Hamtramck-Werk von Chevrolet in Detroit hergestellt. Der rein Akku-elektrisch angetriebene Nachfolger war in Europa ab 2017 der Opel Ampera-e auf Basis des Chevrolet Bolt.\\nAls „Opel Ampera“ wurde der Wagen im März 2009 auf dem Genfer Auto-Salon vorgestellt. Opel nannte es ein „Elektrofahrzeug mit Reichweitenverlängerer“, engl. abgekürzt „EREV“, warb jedoch auch mit: „Fahren Sie mit unserem Elektrofahrzeug in die Zukunft“."},{"page_url":"https://pl.wikipedia.org/wiki/Most_im._Jules%E2%80%99a_Wijdenboscha","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Jules_Wijdenbosch_Bridge.jpg","page_title":"Most im. Jules’a Wijdenboscha","context_page_description":"Most im. Jules’a Wijdenboscha – most dźwigarowy łączący brzegi rzeki Surinam w Paramaribo."},{"page_url":"https://ceb.wikipedia.org/wiki/Sepiola_birostrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Sepiola_birostrata.JPG","page_title":"Sepiola birostrata","context_page_description":"Espesye sa nukos ang Sepiola birostrata. Una ning gihulagway ni Shun-ichi Syun'iti Sasaki ni adtong 1918. Ang Sepiola birostrata sakop sa kahenera nga Sepiola sa kabanay nga Sepiolidae. Giklaseklase sa IUCN ang espesye sa kapos sa datos. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Slave_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Slave_River_Watershed.png","page_title":"Slave River","context_page_description":"Der Fluss Slave ist ein 434 km langer Fluss entlang der östlichen Grenze des Wood-Buffalo-Nationalparks im zentralen bis nordwestlichen Teil Kanadas.\\nEr bildet den Abfluss des Athabascasees in Alberta, nimmt anschließend das Wasser des Peace River auf, und fließt weitere 415 km in nördlicher Richtung durch die Nordwest-Territorien, bis er schließlich in den Großen Sklavensee mündet. Der Fluss gehört zum Flusssystem des Mackenzie River.\\nDer Name des Flusses hat nichts mit dem Begriff „Sklaverei“ zu tun. Details zur Herkunft des Namens sind im Artikel zum Großen Sklavensee zu finden."},{"page_url":"https://vi.wikipedia.org/wiki/Baixo_Guandu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Brasaobaixoguandu.png","page_title":"Baixo Guandu","context_page_description":"Baixo Guandu là một đô thị thuộc bang Espírito Santo, Brasil. Đô thị này có diện tích 917,888 km², dân số năm 2007 là 28544 người, mật độ 31,11 người/km²."},{"page_url":"https://eo.wikipedia.org/wiki/Dick_Parry","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/DarkSideOfTheMoon1973.jpg","page_title":"Dick Parry","context_page_description":"Dick Parry, nasknome Richard Parry [Rikardo Pari], naskiĝinta la 22-an de decembro 1942 en Kentford, estas angla saksofonisto ĉefe konata pro sia kunlaboro kun la grupo Pink Floyd. Li faris solojn en la kantoj \\"Money\\", \\"Us and Them\\", \\"Shine On You Crazy Diamond\\" kaj \\"Wearing the Inside Out\\". Li ludis ankaŭ en la albumo de la bando Bloodstone nome Riddle of the Sphinx."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B9_%D0%B7%D1%83%D0%BB%D1%83%D1%81%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Dingane_-_%27Bulalani_abathakathi%27_-_1897.jpg","page_title":"Список королей зулусов","context_page_description":"Инкоси — титул вождя, также верховного правителя зулусов. На сегодняшний день инкоси зулусов является Гудвилл Звелитини каБекузулу.\\nЗулусских инкоси можно хронологически поделить на четыре категории:\\nЛегендарные инкоси рода зулусов до 1727 года.\\nИнкоси зулусов с 1727 по 1816 год — инкоси, сведения о которых сохранились в устной традиции.\\nИнкоси независимой державы зулусов — от создания зулусской державы Чакой до Англо-зулусской войны 1879 года.\\nИнкоси как духовные лидеры своего народа — с 1879 года по настоящее время.\\nВ полных именах инкоси за именем вождя следует отчество с префиксом «ка-». Например: Кечвайо каМпанде — Кечвайо, сын Мпанде."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbahnmuseum_Halle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Tatra-halle.jpg","page_title":"Straßenbahnmuseum Halle","context_page_description":"Das Straßenbahnmuseum Halle befindet sich in dem ehemaligen Depot der heutigen Halleschen Verkehrs-AG in der Seebener Straße 191 in Halle. Es beherbergt derzeit ca. 40 historische Straßenbahnfahrzeuge und Kraftfahrzeuge. Das Museum ist in der Regel jeden 1. und 3. Samstag in den Monaten Mai bis Oktober geöffnet. An den Öffnungstagen verkehrt die Stadtrundfahrt mit historischen Triebwagen. Der Verein Hallesche Straßenbahnfreunde e. V. betreibt das Museum und führt auch die Wartungs- und Instandsetzungsarbeiten an den Bahnen durch."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B1%D8%B3%D8%AF%D8%B3-%D8%A8%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Mercedes_benz_logo_1926.png","page_title":"مرسدس-بنز","context_page_description":"مرسدس-بنز، شرکت خودروسازی آلمانی و از زیرمجموعه‌های شرکت دایملر آ. گ است، که در زمینه طراحی و ساخت انواع خودرو، کامیون، اتوبوس و موتورهای درون‌سوز، همچنین ارائه خدمات مالی و نیز تعمیر خودرو فعالیت می‌نماید. کارخانه اصلی و دفتر مرکزی شرکت مرسدس بنز در شهر اشتوتگارت قرار دارد.\\nشرکت دایملر-موتورن-گیزلشافت در سال ۱۸۹۰ توسط گوتلیب دایملر و ویلهلم مایباخ تأسیس شد. در آوریل ۱۹۰۰ امیل یِلینِک، تاجر و سرمایه‌گذار دنیای نوپای خودروها، طی یک قرارداد پیشنهادی معادل ۵۵۰ هزار مارک آلمان را به دِ. اِم. گِ داد در صورتی که مایباخ می‌توانست خودرویی اسپرت و انقلابی برای او طراحی کند. خودرو درخواستی یلینک مشخصاتی بسیار پیشرفته‌تر از خودروهای زمان خود داشت. به دلیل علاقه زیاد یلینک به دخترش مرسدس، که تولد او را برای زندگی خود خوش‌یمن می‌دانست، نام او را برای خودرو خود انتخاب کرد و اولین خودرو با برند دایملر-مرسدس پس موفقیت مایباخ در طراحی خودروی موردنظر یلینک تولید شد. شرکت دِ. اِم. گِ به دلیل موفقیت چشمگیر سری خودروهای مرسدس، این نام را برای همیشه برای خودروهای تولیدی خود حفظ کرد.\\nدر سال ۱۹۲۶ شرکت دایملر-بنز از ادغام دو شرکت دایملر-موتورن-گیزلشافت و بنز اند سی تأسیس شد و از تاریخ ۲۸ ژوئن ۱۹۲۶ کارخانجات دو شرکت، تولیدات خود را، با برند مرسدس-بنز، به بازار عرضه کردند."},{"page_url":"https://es.wikipedia.org/wiki/Cornelis_Kruseman","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Cornelis_Kruseman%2C_Self-portrait.jpg","page_title":"Cornelis Kruseman","context_page_description":"Cornelis Kruseman fue un pintor neerlandés.\\nHijo de Alexander Hendrik Kruseman y Cornelia Bötger, nació en Ámsterdam, el 25 de septiembre de 1797. Siguió viviendo en esa ciudad hasta que viajó a Suiza e Italia en 1821. Con el tiempo acabó en París. En 1825, después de su regreso a los Países Bajos, se estableció en 's-Gravenhage. El 3 de octubre de 1832 se casó con Henriette Angelique Meijer. En 1841 partió de nuevo a Italia; donde se quedaría durante seis años. Fue allí donde recibió el apodo de «Kruseman italiano». De 1847 a 1854 vivió en La Haya, y después en la ciudad de Lisse hasta su muerte a los 60 años.\\nDesde la edad de catorce años, asistió al Amsterdamse Tekenacademie y recibió clases de Charles Howard Hodges, Petrus Antonius Ravelli y Jean Augustin Daiwaille. Su obra consiste en retratos, temas bíblicos y escenas italianas. En 1826 publicó un libro de sus viajes por Italia y titulado Aanteekingen van C. Kruseman, betrekkelijk deszelfs kunstreis en verblijf in Italië.\\nHa sido honrado por su trabajo en varias maneras."},{"page_url":"https://es.wikipedia.org/wiki/Suzuki_Boulevard_S40","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/BOBBER_sur_une_base_d%27un_650_savage.jpg","page_title":"Suzuki Boulevard S40","context_page_description":"La Suzuki Boulevard S40 es una motocicleta crucero fabricada por Suzuki Motor Corporation​​​ para el mercado japonés y exportada a Nueva Zelanda, ​​ Norte América, ​​​​ así como a Chile​ y otros países. Desde enero de 2015 la S40 se vende en Australia por primera vez desde que la motocicleta de 4 velocidades LS650 estuvo disponible en los 1980s.​​"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D1%8A%D0%BB%D0%BD%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B2_%D0%9D%D0%BE%D0%B2%D0%BE%D1%87%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Vladimir_Putin_1_February_2008-7.jpg","page_title":"Вълнения в Новочеркаск","context_page_description":"Работническите вълнения в град Новочеркаск, Ростовска област, РСФСР, СССР са най-острите прояви на работническо недоволство сред съветските работници след края на Втората световна война.\\nЦентър на недоволството става заводът за електровози в града, където в началото на юни 1962 г. работниците спират работа и издигат лозунга: „Месо, мляко, повишаване на заплатите“. Липсват политически лозунги.\\nЗапочва стачка с искане за повишаване на заплащането и подобряване на битовите условия. Стачниците успяват да организират митинг край градския комитет на партията, където се стига до стълкновения с милицията и армията.\\nИнтересно в случая е, че митингът се провежда под червено знаме и портрет на Ленин. Последното е изтълкувано от службите за сигурност като провокация. Към мястото на митинга се отправят войски, които стрелят по митингуващите. Убити са 26 души, а 87 са ранени. На следващата сутрин на площада се събира група от няколкостотин демонстранти. 116 са арестувани, от които 7 получават смъртна присъда и са екзекутирани. Останалите са осъдени на по 10 – 15 години затвор.\\nСлед инцидента съветското правителство насочва допълнителни хранителни стоки към региона и започва разследване."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8E%9F%E5%A7%8B%E5%8F%8D%E5%B0%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Tonic.jpg","page_title":"原始反射","context_page_description":"原始反射とは、幼児が特有の刺激に対して示す、中枢神経系によって引き起こされる反射行動のことである。この反射は、子供が成長して大人になり、前頭葉が発達する過程で失われていくものである。脳性麻痺者や健常者は反射を抑えることができるが、特定の条件下では反射が再び現れることがある。\\n脳性麻痺の場合にはこれらの反射を保持していることがあり、大人であっても再び現われることがある。原始反射の再出現は、認知症や外傷性損傷、脳卒中を含む特定の神経学的症状に帰せられる。その際の反射は、影響を受けた領域に限定される。片まひの人は、影響のある側の脚にのみ反射が見られる。\\n原始反射は脳が損傷している疑いがある時に、前頭葉の機能を検証する目的で使用される。もし原始反射が適切に抑制されていなければ、これらは前頭葉徴候と呼ばれる。非定型原始反射は、自閉症スペクトラムの初期の徴候の可能性としても研究されている。\\n原始反射は錐体外路機能によって伝えられる。これらはミエリン化の進行と共に皮質脊髄路が機能を獲得していくにつれて失われるが、様々な理由によって錐体路の機能が失われた大人や子供で再び現われることがある。しかしながら、「Amiel-Tisonの神経学的評価法」の出現により、小児集団におけるこういった反射の評価の重要性が低下している。"},{"page_url":"https://pl.wikipedia.org/wiki/Medal_Srebrnego_Jubileuszu_Kr%C3%B3la_Jerzego_V","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Medal%2C_award_%28AM_809189-1%29.jpg","page_title":"Medal Srebrnego Jubileuszu Króla Jerzego V","context_page_description":"Medal Srebrnego Jubileuszu Króla Jerzego V – brytyjski medal pamiątkowy ustanowiony 6 maja 1935 w celu upamiętnienia 25-lecia panowania króla Jerzego V.\\nWykonany był ze srebra i wieszany na czerwonej wstążce z niebiesko-biało-niebieskimi wąskimi paskami wzdłuż brzegów. Łącznie nadano 85 235 medali."},{"page_url":"https://en.wikipedia.org/wiki/Christmas_frigatebird","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Christmas_Island_Frigatebird_from_Indonesia.jpg","page_title":"Christmas frigatebird","context_page_description":"The Christmas frigatebird, or Christmas Island frigatebird, is a seabird of the frigatebird family Fregatidae which is an endemic breeder to Christmas Island in the Indian Ocean.\\nThe Christmas frigatebird is a large lightly built seabird with brownish-black plumage, long narrow wings and a deeply forked tail. It has a wingspan of around 2.15 m. The male has an egg shaped white patch on its belly and a striking red gular sac which it inflates to attract a mate. The female is slightly larger than the male and has a white breast and belly. They feed on fish taken in flight from the ocean's surface, and sometimes indulge in kleptoparasitism, harassing other birds to force them to regurgitate their food. The species is listed as critically endangered by the International Union for Conservation of Nature."},{"page_url":"https://pl.wikipedia.org/wiki/Aizkraukle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Aizkraukle_gerb.png","page_title":"Aizkraukle","context_page_description":"Aizkraukle – miasto na Łotwie, leżące nad rzeką Dźwiną w historycznej krainie Liwonia, centrum administracyjne okręgu Aizkraukle. Około 8962 mieszkańców.\\nPierwsze wzmianki o Aizkraukle pochodzą z Kroniki Henryka Łotysza. Prawa miejskie Aizkraukle otrzymało w 1967 roku, tuż po wybudowaniu elektrowni wodnej."},{"page_url":"https://tr.wikipedia.org/wiki/Kubbeli_Camii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Old_Bazaar_and_Clock_Tower.jpg","page_title":"Kubbeli Camii","context_page_description":"Kubbeli Camii, Kaplan Paşa Camii veya Bekarlar Camii, Arnavutluk Cumhuriyeti'nin Kavalye kentinde bulunmakta olan tarihi bir Osmanlı camii. Arnavutluğun millî kültür simge olarak ilan edildi.\\nKavalye Kubbeli Camii 1735 ve 1736 yılların arasında Ali Haydar Bey tarafından inşa edilmiştir. 1967 yılında, Arnavutluk Enver Hoca'nın komünist hükûmeti tarafından dünyanın ilk ateist devlet olarak ilan edildikten sonra, Kubbeli Camii kapatılmıştı ve çok zarak görmüştü. 70 metre uzakta bulunan daha eski ve tarihi olan camii zaten yıkıldı.\\nYerine inşa edilen 2008 senesi modern camii, tarihe uygun olmayan bir şekilde inşa edildi. Arnavutluk mimarisi için önemli olan tarihi Kubbeli camii, bugüne kadar yeniden inşa edilmedi."},{"page_url":"https://fi.wikipedia.org/wiki/Charleville-M%C3%A9zi%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Charleville_place_ducale.jpg","page_title":"Charleville-Mézières","context_page_description":"Charleville-Mézières on kunta Ardennesin departementissa Champagne-Ardennen hallintoalueella Ranskassa. Kunnassa oli 49 975 asukasta vuoden 2009 väestönlaskennassa. Charleville-Mézièresin pinta-ala on 31 neliökilometriä."},{"page_url":"https://en.wikipedia.org/wiki/Great_Mosque_of_Djenn%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Great_Mosque_of_Djenn%C3%A9_2.jpg","page_title":"Great Mosque of Djenné","context_page_description":"The Great Mosque of Djenné is a large banco or adobe building that is considered by many architects to be one of the greatest achievements of the Sudano-Sahelian architectural style. The mosque is located in the city of Djenné, Mali, on the flood plain of the Bani River. The first mosque on the site was built around the 13th century, but the current structure dates from 1907. As well as being the centre of the community of Djenné, it is one of the most famous landmarks in Africa. Along with the \\"Old Towns of Djenné\\" it was designated a World Heritage Site by UNESCO in 1988."},{"page_url":"https://en.wikipedia.org/wiki/Miami_City_Cemetery","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Hurricane_Irma_-_Miami_-_Miami_City_Cemetery_03.jpg","page_title":"Miami City Cemetery","context_page_description":"The Miami City Cemetery is a historic cemetery in Miami, Florida, United States. It is located at 1800 Northeast 2nd Avenue. On January 4, 1989, it was added to the U.S. National Register of Historic Places."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%8B%D1%8F%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B1%D1%96%D0%B1%D0%BB%D1%96%D1%8F%D1%82%D1%8D%D0%BA%D0%B0_%D0%91%D1%83%D1%82%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/National_Library-Thimphu-Bhutan-2008_01_23.jpg","page_title":"Нацыянальная бібліятэка Бутана","context_page_description":"Бутанская нацыянальная бібліятэка — бібліятэка, знаходзіцца ў Тхімпху, сталіцы Бутана. Бібліятэка была заснавана ў 1967 годзе з мэтай захаваньня і распаўсюджвання багатай культурнай спадчыны Бутана. Бібліятэка знаходзіцца на ўсходнім баку ракі каля Бутанскага музэю тэкстылю."},{"page_url":"https://it.wikipedia.org/wiki/Aarne_Salovaara","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Aarne_Salovaara.png","page_title":"Aarne Salovaara","context_page_description":"Aarne Ihamo Salovaara, nato Arne Ihamo Nylenius, è stato un ginnasta e giavellottista finlandese."},{"page_url":"https://pt.wikipedia.org/wiki/Boqueir%C3%A3o_(Curitiba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Rua_Waldemar_Loureiro_Campos.JPG","page_title":"Boqueirão (Curitiba)","context_page_description":"Boqueirão é um bairro da cidade brasileira de Curitiba, Paraná. Está situado na região sudoeste do município.\\nA economia da região é variada, porém, com uma concentração de industrias metalúrgicas e comércio de tecidos fixado principalmente na Rua Bley Zorning.\\nO Boqueirão é um dos maiores bairros da capital paranaense e entre as inúmeras instituições existentes, encontramos a escola de samba Jesus Bom à Beça"},{"page_url":"https://de.wikipedia.org/wiki/Wolfenb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Wolfenbuettel-Bahnhof-Maerz-2008.jpg","page_title":"Wolfenbüttel","context_page_description":"Wolfenbüttel ist eine an der Oker gelegene Kreisstadt und größte Stadt des Landkreises Wolfenbüttel in Niedersachsen. Mit 52.165 Einwohnern ist Wolfenbüttel eine selbständige Gemeinde und Mittelstadt. Die Stadt ist als Bischofsstadt Sitz der Kirchenregierung für die Evangelisch-Lutherische Landeskirche in Braunschweig. Außerdem ist sie Fachhochschulstandort und beheimatet einige mittelständische Unternehmen. Das Stadtgebiet umfasst eine Fläche von über 78,60 km²."},{"page_url":"https://pl.wikipedia.org/wiki/Polacy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Bronislawmalinowski.jpg","page_title":"Polacy","context_page_description":"Polacy – naród zachodniosłowiański zamieszkujący głównie obszar Rzeczypospolitej Polskiej i będący jej głównym składnikiem ludnościowym, a poza granicami Polski tworzący Polonię.\\nPolacy posługują się w większości językiem polskim oraz alfabetem łacińskim, który został wprowadzony w X wieku z chwilą, od której na ziemiach polskich zaczęto wprowadzać chrześcijaństwo obrządku zachodniego. W ukształtowaniu wyznaniowym Polaków wyraźną większość stanowią katolicy obrządku łacińskiego, obecne są także inne obrządki i wyznania.\\nWedług Narodowego Spisu Powszechnego z 2011 roku liczba osób deklarujących narodowość polską zamieszkałych na terenie Polski wynosi 36,5 mln przy populacji 38,5 mln. Liczebność diaspory polskiej według różnych źródeł to 13–16 mln. Stowarzyszenie „Wspólnota Polska” szacuje liczebność Polonii na 20 mln."},{"page_url":"https://en.wikipedia.org/wiki/One_Hundred_Famous_Views_of_Edo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/100_views_edo_018.jpg","page_title":"One Hundred Famous Views of Edo","context_page_description":"One Hundred Famous Views of Edo is a series of 119 ukiyo-e prints begun and largely completed by the Japanese artist Hiroshige. The prints were first published in serialized form in 1856–59, with Hiroshige II completing the series after Hiroshige's death. It was tremendously popular and much reprinted."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D0%BD%D0%B0%D0%B1%D0%BB%D1%8E%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B7%D0%B0_%D1%83%D1%80%D0%BE%D0%B2%D0%BD%D0%B5%D0%BC_%D0%B2%D0%BE%D0%B4%D1%8B_%D0%B2_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Levels_of_flooding_01.JPG","page_title":"Система наблюдения за уровнем воды в Санкт-Петербурге","context_page_description":"Система наблюдения за уровнем воды в Санкт-Петербурге — система сооружений.\\nВ Санкт-Петербурге с момента основания существует высокий риск наводнений.\\nС 1707 года в Кронштадте действует футшточная служба.\\nЭти сооружения стали основной частью системы оповещения о чрезвычайных ситуациях, действовавшей с первых лет существования города."},{"page_url":"https://it.wikipedia.org/wiki/Costanza_d%27Aragona_(1343-1363)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Spain_PobletMonastry_FrontView.jpg","page_title":"Costanza d'Aragona (1343-1363)","context_page_description":"Costanza Perez, o Costanza d'Aragona e di Navarra, fu principessa d'Aragona e regina consorte del Regno di Trinacria dal 1361 al 1363."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D1%80%D1%8B%D0%BA_%D0%93%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/KIev-KhreshchatykStr-BessarabskyiMarket.jpg","page_title":"Генрык Гай","context_page_description":"Генрык Юліян Гай — архітэктар і інжынэр польскага паходжаньня, які ў пачатку XX ст. працаваў у Расейскай імпэрыі, а потым у Польшчы.\\nПрацаваў у стылі нэаклясыцызму. Аўтар праектаў многіх будынкаў у Варшаве, Менску, Кіеве і ў іншых месцах Расейскай імпэрыі. У міжваенны пэрыяд — ваяводзкі архітэктар у Пінску."},{"page_url":"https://ca.wikipedia.org/wiki/Guerra_veneciano-genovesa","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Espansione_della_Repubblica_di_Venezia_Legenda.jpg","page_title":"Guerra veneciano-genovesa","context_page_description":"La guerra veneciano-genovesa fou un conflicte entre la República de Gènova i la República de Venècia lluitat al mar Egeu pel control del mediterrani oriental entre 1350 i 1355, fou guanyat per Gènova."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_F%C3%BCrth/M","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/F%C3%BCrth_Marienstra%C3%9Fe_29_002.JPG","page_title":"Liste der Baudenkmäler in Fürth/M","context_page_description":"Diese Liste ist eine Teilliste der Liste der Baudenkmäler in Fürth. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDieser Teil der Liste beschreibt die denkmalgeschützten Objekte an folgenden Fürther Straßen und Plätzen:\\nMaistraße\\nMarienstraße\\nMarktplatz\\nMathildenstraße\\nMauerstraße\\nMaxbrücke\\nMax-Planck-Straße\\nMaxstraße\\nMeckstraße\\nMerkurstraße\\nMohrenstraße\\nMondstraße\\nMoststraße\\nMühlstraße"},{"page_url":"https://pt.wikipedia.org/wiki/Haroun_Tazieff","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/D%C3%A9dicace_de_Haroun_Tazieff_%C3%A0_l%27auteur.jpg","page_title":"Haroun Tazieff","context_page_description":"Haroun Tazieff foi um geólogo polonês naturalizado belga e francês. Relizou diversas pesquisas na área de vulcanologia."},{"page_url":"https://fr.wikipedia.org/wiki/Francesco_Patrizi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Cherso_Petrisevic.jpg","page_title":"Francesco Patrizi","context_page_description":"Francesco Patrizi est un philosophe et savant vénitien, et un des principaux défenseurs du platonisme contre l'aristotélisme dominant de l'époque."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Drancy","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Gare_de_Drancy_05.jpg","page_title":"Gare de Drancy","context_page_description":"La gare de Drancy est une gare ferroviaire française de la ligne de La Plaine à Hirson et Anor, située dans la commune de Drancy.\\nC'est une gare de la Société nationale des chemins de fer français desservie par les trains de la ligne B du RER. Elle est située à 11,5 kilomètres de la gare de Paris-Nord."},{"page_url":"https://de.wikipedia.org/wiki/St._Nikolai_(Hamburg-Moorfleet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Snmf_innen_orgelempore_02.jpg","page_title":"St. Nikolai (Hamburg-Moorfleet)","context_page_description":"Die evangelisch-lutherische Kirche St. Nikolai in Hamburg-Moorfleet am südlichen Rand des Stadtteils an der Straße Moorfleeter Kirchenweg, die westlichste Kirche der Marschlande, ist einerseits eine typische Saalkirche der Vier- und Marschlande in Fachwerksbausweise, zeigt aber andererseits mit ihrem charakteristischen neugotischen Turm starke Einflüsse des nahen Hamburger Zentrums."},{"page_url":"https://af.wikipedia.org/wiki/Lys_van_afhanklike_gebiede","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Overseas_territories_and_colonies_labelled.png","page_title":"Lys van afhanklike gebiede","context_page_description":"Hierdie is 'n lys van afhanklike gebiede."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D9%8A%D9%81_%D9%84%D9%8A_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D8%A9_%D9%82%D8%A7%D8%B9%D8%AF%D8%A9_%D8%A3%D9%85%D8%B1%D9%8A%D9%83%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Cliff_Lee%2C_philly_crop.jpg","page_title":"كليف لي (لاعب كرة قاعدة أمريكي)","context_page_description":"كليف لي ‏ هو لاعب كرة قاعدة أمريكي، ولد في 30 أغسطس 1978 في بنتون في الولايات المتحدة."},{"page_url":"https://fr.wikipedia.org/wiki/Voye","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Drosselrohrs%C3%A4nger_Great_reed_warbler.jpg","page_title":"Voye","context_page_description":"La Voye est un ruisseau de l'est de la France, dans les deux départements de l'Ain et de Saône-et-Loire, en région Auvergne-Rhône-Alpes et Bourgogne-Franche-Comté. C'est un affluent droit de la Sâne Vive, donc un sous-affluent du Rhône par la Seille et la Saône."},{"page_url":"https://oc.wikipedia.org/wiki/Rugbi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/M%C3%AAl%C3%A9erugbyXIII.jpg","page_title":"Rugbi","context_page_description":"Lo rugbi es un ensemble d'espòrts collectius de balon eissits dau fotbòl practicat durant la premiera mitat dau sègle XIX en Anglatèrra. Demandan de portar un balon dins una zòna determinada dau camp advèrs ò de marcar de buts en passant lo balon entre dos potèus defenduts per l'equipa advèrsa. La premiera codificacion dei règlas data de 1846 e aguèt luòc dins l'escòla de Rugby. Uei, es un espòrt popular dins leis Illas Britanicas, en França, en Occitània, en Sud-Africa e en Oceania. Lo rugbi de XV es la varianta pus jogada mai lo rugbi de XIII es ben implantat dins certanei regions. Leis autrei variantas son pus raras maugrat l'inscripcion dau rugbi de 7, un derivat dau XV, au programa dei Jòcs Olimpics d'Estiu."},{"page_url":"https://sv.wikipedia.org/wiki/Bellerophon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Bellerophon_Museum_Gr%C3%B6den.jpg","page_title":"Bellerophon","context_page_description":"Bellerophon är ett släkte av paleozoiska snäckor med symmetriskt skal, hoprullat i en plan, sluten spiral.\\nDen yttre vindlingen omfattar ofta hela skalet. Mynningen är olika formad, ofta med en bred inskärning i ytterläppen, som fortsätter i en upphöjd list. Bellerophon levde från kambrium till perm. Flera arter förekommer i svenska avlagringar från yngre silur."},{"page_url":"https://en.wikipedia.org/wiki/Presidency_of_Franklin_D._Roosevelt,_first_and_second_terms","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/TVA_water_supply_Wilder.gif","page_title":"Presidency of Franklin D. Roosevelt, first and second terms","context_page_description":"The first and second terms of the presidency of Franklin D. Roosevelt began on March 4, 1933, when he was inaugurated as the 32nd President of the United States, and ended with Roosevelt's third inauguration on January 20, 1941. Roosevelt, a Democrat from New York, took office after defeating Republican President Herbert Hoover, who had presided over the start of the Great Depression. Roosevelt led the implementation of the New Deal, a series of programs designed to provide relief, recovery, and reform to Americans and the American economy. He also presided over a realignment that made his New Deal Coalition dominant in the Fifth Party System.\\nDuring his first hundred days in office, Roosevelt spearheaded unprecedented major legislation and issued a profusion of executive orders. The Emergency Banking Act helped put an end to a run on banks, while the 1933 Banking Act and the Securities Exchange Act of 1934 provided major reforms in the financial sector. To provide relief to unemployed workers, Roosevelt presided over the establishment of several agencies, including the Civilian Conservation Corps, the Public Works Administration, and the Federal Emergency Relief Administration."},{"page_url":"https://de.wikipedia.org/wiki/Lo%C3%AFk_Le_Floch-Prigent","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Loik_Le_Floch-Prigent_en_1999.jpg","page_title":"Loïk Le Floch-Prigent","context_page_description":"Loïk Le Floch-Prigent ist ein ehemals hochrangiger französischer Manager. Er wurde insbesondere bekannt als Vorstandsvorsitzender von Elf Aquitaine zwischen 1989 und 1993, danach als Präsident der französischen Eisenbahngesellschaft SNCF vom Dezember 1995 bis Juli 1996, als die Untersuchungen der Elf-Affäre begann. Er ist Neffe des bretonischen Poeten Maodez Glanndour."},{"page_url":"https://it.wikipedia.org/wiki/Carl_Bildt_(1850-1931)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Carl_Nils_Daniel_Bildt.jpg","page_title":"Carl Bildt (1850-1931)","context_page_description":"Carl Bildt è stato un diplomatico e storico svedese.\\nFiglio del primo ministro Gillis Bildt, fu ambasciatore a Roma dal 1889 al 1902 e dal 1905 al 1920. Lo ricordiamo soprattutto per il volume Christine de Suède et le Cardinal Azzolino, biografia di Cristina di Svezia.\\nNel 1901 fu eletto membro dell'Accademia svedese."},{"page_url":"https://hu.wikipedia.org/wiki/Honda_RA302","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Honda_RA302_front-left_Honda_Collection_Hall.jpg","page_title":"Honda RA302","context_page_description":"A Honda RA302 egy korábbi Formula–1-es autó, melyet a Honda épített az 1968-as szezonra a Lola Cars segítségével. Versenyzője a csapatnak Jo Schlesser volt, aki egyetlen egy futamon ült az autóba, miután életét vesztette."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A2%E0%B8%AD%E0%B8%94%E0%B9%80%E0%B8%82%E0%B8%B2%E0%B9%80%E0%B8%94%E0%B8%99%E0%B8%B2%E0%B8%A5%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Wonder_Lake_and_Denali.jpg","page_title":"ยอดเขาเดนาลี","context_page_description":"ยอดเขาเดนาลี หรือ ยอดเขาแมกคินลีย์ ตั้งอยู่ในรัฐอะแลสกา สหรัฐอเมริกา อยู่ในแนวเทือกเขาอะแลสกา ซึ่งเป็นแนวต่อเนื่องมาจากแนวเทือกเขาร็อกกี เป็นยอดเขาที่สูงที่สุดในทวีปอเมริกาเหนือ สูงถึง 6,194 เมตร จากระดับน้ำทะเล ยอดเขาแห่งนี้เป็นจุดเด่นกลางอุทยานแห่งชาติเดนาลีด้วย\\nคนไทยที่สามารถพิชิตยอดเขาเดนาลีสำเร็จเป็นคนแรกคือ วิทิตนันท์ โรจนพานิช ส่วนหญิงไทยที่สามารถพิชิตยอดเขาเดนาลีสำเร็จเป็นคนแรกคือ นภัสพร ชำนาญสิทธิ์ ซึ่งสามารถพิชิตยอดเขาได้เมื่อปี พ.ศ. 2561"},{"page_url":"https://en.wikipedia.org/wiki/1694_in_Ireland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/1662_Mary_II.jpg","page_title":"1694 in Ireland","context_page_description":"Events from the year 1694 in Ireland."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%8F%D0%B5%D1%98%D0%BD_%D0%95%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Jane_Eyre_title_page.jpg","page_title":"Џејн Ер","context_page_description":"Џејн Ер е познат и влијателен роман од англиската авторка Шарлот Бронте. Првпат бил објавен во Лондон, Англија во 1847 од страна на Смит, Елдер & Ко, со наслов Џејн Ер. Автобиографија под псевдонимот “Курер Бел”. Американското издание излегло наредната година, издадено од страна на Харпер & Брадерс во Њуjорк."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%BB%D0%B0%D1%80%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Picswiss_GL-13-02.jpg","page_title":"Гларус","context_page_description":"Гларус је град у источној Швајцарској. Гларус је главни град истоименог кантона Гларус, као и његово највеће насеље."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8A%E6%B5%B7%E8%88%9E%E6%BD%AE%E6%A1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Shanghai_Taxi_Dancers_Riots_1.jpeg","page_title":"上海舞潮案","context_page_description":"上海舞潮案是1948年發生於上海的一起舞女集體反對政府禁舞的風潮。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Bad_Liebenwerda","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Langenrieth_SJ_Eda_IMG_6717_bb.jpg","page_title":"Liste der Baudenkmale in Bad Liebenwerda","context_page_description":"In der Liste der Baudenkmale in Bad Liebenwerda sind alle denkmalgeschützten Gebäude der brandenburgischen Kurstadt Bad Liebenwerda und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Bad Liebenwerda aufgeführt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Denkmalen_und_Kunstwerken_in_Wei%C3%9Fwasser","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Holzskulptur_M%C3%A4nnlicher_Torso_von_Frank_Germann_Beeskow_2.JPG","page_title":"Liste von Denkmalen und Kunstwerken in Weißwasser","context_page_description":"Die Liste der Denkmale und Kunstwerke in Weißwasser gibt eine Übersicht über die Denkmale und Kunstwerke im öffentlichen Raum der Stadt Weißwasser. Die Objekte der Punkte 1 bis 9 stehen sämtlich unter Denkmalschutz.\\nZum Verzeichnis der Kulturdenkmale in der Stadt siehe Liste der Kulturdenkmale in Weißwasser/Oberlausitz"},{"page_url":"https://en.wikipedia.org/wiki/Second_inauguration_of_Dwight_D._Eisenhower","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/1957_Inauguration_of_President_Eisenhower.jpg","page_title":"Second inauguration of Dwight D. Eisenhower","context_page_description":"The second inauguration of Dwight D. Eisenhower as President of the United States was held privately on Sunday, January 20, 1957, at the White House and publicly on the following day, Monday, January 21, 1957, at the East Portico of the United States Capitol; both located in Washington, D.C. This was the 43rd inauguration and marked the commencement of the second and final four-year term of both Dwight D. Eisenhower as President and Richard Nixon as Vice President. Chief Justice Earl Warren administered the presidential oath of office after the Senate Minority Leader William Knowland sworn the Vice President in."},{"page_url":"https://cs.wikipedia.org/wiki/Jung-le","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Yangzhou-Old-Grand-Canal-3301.JPG","page_title":"Jung-le","context_page_description":"Císař Jung-le vlastním jménem Ču Ti vládl v letech 1402–1424 Číně jako třetí císař říše Ming. Byl čtvrtý syn Chung-wua, zakladatele a prvního císaře dynastie Ming.\\nOd roku 1370 nosil titul kníže z Jen, od roku 1380 sídlil v Pekingu a strážil severovýchodní pohraničí. V 80. a 90. letech 14. století vynikl v bojích s Mongoly a projevil se jako talentovaný vojevůdce, populární mezi vojáky, a úspěšný státník.\\nRoku 1399 se vzbouřil proti svému synovci, novému císaři Ťien-wenovi. V občanské válce, kterou nazval kampaň ťing-nan, kampaň za uklidnění nepořádků, po třech letech urputných bojů zvítězil a roku 1402 se prohlásil za císaře. Po převzetí vlády s novým rokem vyhlásil éru „Věčného štěstí“, Jung-le. Název éry je používán i jako jméno císaře.\\nJeho vláda je občas vnímána jako „druhé založení“ mingské dynastie, jelikož ostře změnil politický kurs svého otce. Po nástupu na trůn se musel vypořádat s následky občanské války. Severočínský venkov byl boji poničen, hospodářství zde trpělo nedostatkem pracovních sil. Císař se rozhodl posílit a stabilizovat ekonomiku, ale nejdříve umlčet jakýkoli odpor."},{"page_url":"https://sv.wikipedia.org/wiki/Lycenchelys_camchatica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Lycenchelys_camchatica.jpg","page_title":"Lycenchelys camchatica","context_page_description":"Lycenchelys camchatica är en fiskart som först beskrevs av Gilbert och Burke 1912. Lycenchelys camchatica ingår i släktet Lycenchelys och familjen tånglakefiskar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Ruggero_Ferrario","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Cycling_at_the_1920_Summer_Olympics%2C_Italian_team%2C_team_pursuit.jpg","page_title":"Ruggero Ferrario","context_page_description":"Ruggero Ferrario – włoski kolarz torowy i szosowy, złoty medalista olimpijski."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_de_la_Antigua_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Forum_of_Augustus_mdoel.jpg","page_title":"Arquitectura de la Antigua Roma","context_page_description":"La arquitectura de la Antigua Roma es probablemente uno de los testimonios más significativos de la cultura romana. Se caracteriza por haber adoptado el lenguaje externo de la arquitectura griega clásica, a la que le agregó varias innovaciones originales. Los dos estilos a menudo se consideran un cuerpo, lo que se conoce como arquitectura clásica. La arquitectura romana floreció en la República romana y más aún bajo el Imperio, cuando se construyó la gran mayoría de los edificios supervivientes. Usó nuevos materiales, particularmente el hormigón romano, y tecnologías como el arco de medio punto, la arcada, la bóveda y la cúpula para hacer edificios que normalmente eran fuertes y bien diseñados.\\nLa arquitectura romana abarca el período comprendido entre el establecimiento de la República romana en el año 509 a. C. hasta aproximadamente el siglo IV d. C., después de lo cual hace presencia la arquitectura tardía antigua o bizantina. Casi ningún ejemplo sustancial sobrevive desde antes del año 100 a. C., y la mayoría de las supervivencias más importantes provienen del Imperio posterior, después de aproximadamente el año 100 d. C."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9B%D7%9E%D7%99%D7%9C%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Water_in_cave.JPG","page_title":"כמילי","context_page_description":"כמילי, הידוע גם כ\\"כמילוניסי\\" הוא אי יווני זעיר, טרשי ושומם בדרום הים האגאי. מיקומו בקבוצת האיים הדודקאנסיים. האי, ככל הנראה שריד של פעילות געשית, הוא סלעי ובעל צמחייה עשבית דלה. אורכו כשני קילומטרים ורוחבו, במקומות הרחבים, עד כמה עשרות מטרים."},{"page_url":"https://cs.wikipedia.org/wiki/K%C5%99%C3%ADdlovka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Flugelhorn.jpg","page_title":"Křídlovka","context_page_description":"Křídlovka je žesťový nástroj příbuzný trubce, na rozdíl od ní však má širší a kóničtější trubici. Existuje také o oktávu níže znějící nástroj zvaný baskřídlovka. Ke známým hráčům na křídlovku patří např. Miles Davis nebo Chet Baker."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_obc%C3%AD_v_departementu_Calvados","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Calvados-Position.png","page_title":"Seznam obcí v departementu Calvados","context_page_description":"Toto je seznam obcí v departementu Calvados ve Francii, jichž je celkem 706:"},{"page_url":"https://en.wikipedia.org/wiki/Territorial_evolution_of_Colorado","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/United_States_1861-02-28-1861-03.png","page_title":"Territorial evolution of Colorado","context_page_description":"The following chronology traces the territorial evolution of the U.S. State of Colorado."},{"page_url":"https://lt.wikipedia.org/wiki/Osteodermas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Gila_fg01.jpg","page_title":"Osteodermas","context_page_description":"Osteodermas, antriniai odos sukaulėjimai – kai kurių stuburinių gyvūnų odos mezoderminiame sluoksnyje susidarę kauliniai dariniai, paprastai nedidelių plokštelių pavidalo.\\nOdos kauliniai dariniai stuburinių evoliucijoje susidarė ne vieną kartą ir nepriklausomai skirtingose tetrapodų grupėse, jie nėra žuvų kaulinių žvynų homologai.\\nOsteodermai būdingi daugeliui šiuolaikinių ir išmirusių roplių grupių. Juos turėjo arba dabar turi daugelis dinozaurų, primityvių archozaurų, plakodontų, parejazaurų, krokodilų, kai kurie driežai. Iš šiuolaikinių roplių labai gerai išvystytus osteodermus turi krokodilai. Jų osteodermai būna po raginiais skydeliais. Galvos osteodermai gali suaugti su kaukolės kaulais. Vėžlių šarvuose osteodermai sudaro periferines, nuchalines ir pigalines karapakso kaulines plokšteles.\\nŽinduoliams osteodermai nebūdingi, bet kai kurie jų turi, pvz., šiuolaikiniai ir išmirę nepilnadančiai. Koriumo suragėjusiems dariniams priskiriami ir prie kaukolės kaulų priaugantys ossa cornua, kurie sudaro porakanopių ragų kaulinius pamatus. Dykaragiuose ir žirafiniuose šie kaulai nuolatiniai. Elninių ossa cornua keičiami, jie kasmet nukrenta, nes osteoklastai suardo jų pamatus."},{"page_url":"https://es.wikipedia.org/wiki/Paysandisia_archon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Cocon_de_P._archon.JPG","page_title":"Paysandisia archon","context_page_description":"Paysandisia archon es una especie de lepidóptero de la familia Castniidae originaria de Uruguay, Argentina, Brasil y Paraguay. Fue descrita en 1879 por el alemán Hermann Burmeister, quien la denominó en un principio Castnia archon, y actualmente es considerada la única especie del género Paysandisia. A pesar de su procedencia sudamericana, esta especie se encuentra también en Europa, donde ha sido introducida accidentalmente y se ha convertido en plaga de palmeras debido a sus hábitos perforadores en su etapa de oruga.​​"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%9B%E9%98%BF%E5%B1%8B%E5%B1%B1_(%E5%9F%BC%E7%8E%89%E7%9C%8C%E7%A7%A9%E7%88%B6%E9%83%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%E3%83%AD%E3%82%A6%E3%83%90%E3%82%A4%E8%B6%8A%E3%81%97%E3%81%AB%E6%AD%A6%E7%94%B2%E5%B1%B1%E3%82%92%E7%9C%BA%E3%82%81%E3%82%8B.jpg","page_title":"四阿屋山 (埼玉県秩父郡)","context_page_description":"四阿屋山は、埼玉県秩父郡小鹿野町にある標高771.4mの山である。奥秩父山域の北東部に位置する。"},{"page_url":"https://cs.wikipedia.org/wiki/Otto_Herbert_Hajek","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Otto_Herbert_Hajek_Reliefplastik.jpg","page_title":"Otto Herbert Hajek","context_page_description":"Otto Herbert Hajek byl německý abstraktní malíř, grafik a sochař."},{"page_url":"https://es.wikipedia.org/wiki/Raza_(caballo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Meyers_b12_s0947b.jpg","page_title":"Raza (caballo)","context_page_description":"Las razas de caballo son las razas surgidas de la especie Equus caballus, y comprenden tanto las generadas en forma natural como las obtenidas a través de las intervenciones humanas. Sean ellas naturales o artificiales, están repartidas en casi todos los continentes, y ha sido el humano que las ha elegido según los usos y las necesidades.\\nA partir del siglo XXI, las nociones de marca y de « stud-book » tienden a sustituir a la noción de raza en el caso de los caballos de deporte ecuestre, ya que así se pone en valor la selección inducida por el hombre en cuanto a características y habilidades de los animales resultantes y de sus descendencias."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%82%D0%B5%D1%80,_%D0%90%D0%BB%D0%BB%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Allen_Coulter.jpg","page_title":"Култер, Аллен","context_page_description":"Аллен Култер — американский режиссёр кино и телевидения, участвующий в большинстве успешных телевизионных передачах. Он снял два полнометражных фильма, «Смерть Супермена», касающийся сомнительной смерти Джорджа Ривза с Эдриеном Броуди, Дайан Лейн и Беном Аффлеком в главных ролях, и фильм 2010 года «Помни меня»."},{"page_url":"https://en.wikipedia.org/wiki/WeTab","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/WeTab.png","page_title":"WeTab","context_page_description":"WeTab is a MeeGo-based tablet computer announced by German producer Neofonie in April 2010.\\nThe specifics include an 11.6\\" TN-panel touch screen, a 1.66 GHz Intel Atom N450 processor with fan, 16 GB NAND memory and a total weight of the device of an announced 800 g, but actually 1.002 kg.\\nMost media coverage in relation to the WeTab took place in German. WeTab GmbH began mass marketing in September 2010.\\nRetailers of the device are Amazon.de and German electronics retail giant Media Markt.\\nThe WeTab runs the Linux-based MeeGo operating system and thus can execute native Linux programs, additionally Adobe AIR applications work. Android apps are supported via Virtual Machine."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Oostende/deel_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Torhoutsestnwg_116.jpg","page_title":"Lijst van onroerend erfgoed in Oostende/deel 2","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Oostende. Het onroerend erfgoed maakt onderdeel uit van het cultureel erfgoed in België."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D1%83%D0%B4%D0%B3%D0%BE%D2%B3%D0%B8_%D0%B1%D0%B8%D0%BD%E2%80%8C%D0%B0%D0%BB%D0%BC%D0%B8%D0%BB%D0%B0%D0%BB%D3%A3_%D0%BA%D1%83%D0%B8%D1%82%D2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Queeta-Airport-40227.JPG","page_title":"Фурудгоҳи бин‌алмилалӣ куитҳ","context_page_description":"Фурудгоҳи байналмилалии куитҳ — фурудгоҳи ҳамагона бо Коди ИОТОи UET аст, ки як бонди фуруди асфалт дорад, ва тӯли бонди он 3658 метр аст. Ин фурудгоҳ дар шаҳри куитҳ кишвари Покистон қарор дорад, ва дар баландии 1605 метр аз сатҳи баҳр воқеъ шудааст."},{"page_url":"https://en.wikipedia.org/wiki/The_Engine_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/47383_at_Highley.jpg","page_title":"The Engine House","context_page_description":"The Engine House is an education centre at Highley station on the Severn Valley Railway, in Shropshire, England. Opened in March 2008, it houses some of the railway's out of service locomotives, wagons and coaches. In addition to the equipment listed below, exhibits include railway artifacts and a film about the Severn Valley Railway. Amenities include a restaurant, gift shop and picnic area."},{"page_url":"https://ru.wikipedia.org/wiki/Wizzard","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Wizzard_-_TopPop_1974_4.png","page_title":"Wizzard","context_page_description":"Wizzard — британская рок-группа, образоваванная в 1972 году в Бирмингеме, Англия, Роем Вудом, незадолго до этого покинувшим ELO. Октет, в котором «Вуд играл ту же роль, что Пол Маккартни — в Wings», культивировал красочный, эксцентричный имидж и исполнял «хаотичный, но неизменно мелодичный» поп-рок с элементами арт- и глэм-рока. Девять синглов Wizzard входили в UK Singles Chart; два из них — «See My Baby Jive» и «Angel Fingers» в 1973 году возглавляли британские списки."},{"page_url":"https://fi.wikipedia.org/wiki/Martin_H%C3%B6llwarth","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Martin_H%C3%B6llwarth_2005.jpg","page_title":"Martin Höllwarth","context_page_description":"Martin Höllwarth on itävaltalainen mäkihyppääjä, joka voitti kolme maailmanmestaruutta ja saavutti neljä olympiamitalia.\\nHöllwarth nousi mäkihyppääjänä maailman huipulle talvella 1991–1992, jolloin hän sijoittui Keski-Euroopan mäkiviikon kokonaiskilpailussa toiseksi ja saavutti Albertvillen olympialaisissa hopeaa niin normaali-, suur- kuin joukkuemäessäkin. Seuraavina vuosina hän ei menestynyt, vaan vasta Naganon olympialaisissa 1998 hän ylsi seuraavan kerran arvokisamitaleille saavuttaessaan pronssia joukkuemäessä.\\nHiihdon maailmanmestaruuskilpailuissa menestystä on tullut joukkuemäessä kolmen kultamitalin ja kahden pronssimitalin verran. Lisäksi hänellä on MM-tasolta henkilökohtainen pronssi Lahden kisojen normaalimäestä vuodelta 2001. Keski-Euroopan mäkiviikolla hän sijoittui kolmanneksi kaudella 2001–2002 sekä toiseksi kausilla 2003–2004 ja 2004–2005. Maailmancupissa hän voitti kahdeksan osakilpailua ja sijoittui 29 kertaa palkintokorokkeelle. Keski-Euroopan mäkiviikolla hän saavutti voiton Bischofshofenissa tammikuussa 2005.\\nHöllwarth lopetti uransa kauden 2007–2008 jälkeen ja huhtikuussa 2008 hänen ilmoitettiin siirtyvän Viron mäkihyppymaajoukkueen päävalmentajaksi."},{"page_url":"https://fr.wikipedia.org/wiki/La_Parfaite_Union_(Namur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Parfaite-Union-Tableau-1776.jpg","page_title":"La Parfaite Union (Namur)","context_page_description":"La Parfaite Union est le premier titre distinctif de « La Bonne Amitié – François Bovesse », loge maçonnique namuroise affiliée au Grand Orient de Belgique. Il n'y a donc pas lieu de la confondre avec La Parfaite Union, un atelier travaillant actuellement dans la capitale de la Wallonie sous les auspices de la Grande Loge de Belgique."},{"page_url":"https://et.wikipedia.org/wiki/T%C3%BCmoolsinine","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Color_change_of_thymol_blue_at_different_pH.jpg","page_title":"Tümoolsinine","context_page_description":"Tümoolsinine on happesusindikaator, mis ei lahustu vees, kuid lahustub alkoholides ja lahjendatud leeliselistes lahustes. See värvub punasest kollaseks pH 1,2–2,8 juures ning kollasest siniseks pH 8,0–9,6 juures."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1922_der_Deutschen_Reichspost","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/DR_1922_227_Posthorn.jpg","page_title":"Briefmarken-Jahrgang 1922 der Deutschen Reichspost","context_page_description":"Im Briefmarken-Jahrgang 1922 der Deutschen Reichspost wurden 17 Sondermarken und 30 Dauermarken sowie vier Dienstmarken herausgegeben. Zu den meisten Briefmarken liegen keine Angaben über die Auflagenhöhe vor.\\nMit der immer schneller werdenden Inflation wurden auch die Postgebühren immer schneller erhöht, so dass auch häufiger neue Wertstufen zur Verfügung gestellt werden mussten. Einige Marken mit höheren Werten sind bisher noch nicht im Jahr 1922 nachgewiesen, könnten also erst 1923 herausgegeben worden sein."},{"page_url":"https://el.wikipedia.org/wiki/Fiume_(%CE%BA%CE%B1%CF%84%CE%B1%CE%B4%CF%81%CE%BF%CE%BC%CE%B9%CE%BA%CF%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Regia_Nave_Fiume1.JPG","page_title":"Fiume (καταδρομικό)","context_page_description":"Το Fiume ήταν ιταλικό βαρύ καταδρομικό, το δεύτερο της κλάσης Zara. Η ναυπήγησή του ξεκίνησε τον Απρίλιο του 1929 και ολοκληρώθηκε τον Νοέμβριο του 1931. Είχε σημαντική πολεμική δράση στις αρχές του Δευτέρου Παγκοσμίου Πολέμου, συμμετέχοντας σε πολλές αποστολές αναχαίτισης βρετανικών νηοπομπών.\\nΕπίσης, ήταν μέλος των ιταλικών ναυτικών δυνάμεων που έλαβαν μέρος στη ναυμαχία της Καλαβρίας, καθώς και στη ναυμαχία του Ταινάρου, στην οποία ο ιταλικός στόλος υπέστη πανωλεθρία. Στη ναυμαχία αυτή βυθίστηκαν το Fiume καθώς και τα αδελφά πλοία Zara και Pola."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CE%BB%CE%BB%CE%B7%CE%BD%CE%B9%CE%BA%CE%AE_%CE%A6%CE%B9%CE%BB%CE%BF%CF%84%CE%B5%CE%BB%CE%B9%CE%BA%CE%AE_%CE%95%CF%84%CE%B1%CE%B9%CF%81%CE%B5%CE%AF%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Philotelia_002_cf-50.jpg","page_title":"Ελληνική Φιλοτελική Εταιρεία","context_page_description":"Η Ελληνική Φιλοτελική Εταιρεία ιδρύθηκε το 1925 στην Αθήνα με σκοπό την ανάπτυξη και διάδοση του φιλοτελισμού στην Ελλάδα, αλλά και την εκπροσώπησή του στο εξωτερικό. Μια εκατονταετία σχεδόν μετά, η ΕΦΕ επιμένει στη μελέτη, έρευνα, διάσωση και ανάδειξη του ελληνικού γραμματοσήμου και της ταχυδρομικής ιστορίας στον ελλαδικό και ευρύτερο γεωγραφικό χώρο, ως στοιχείων της ελληνικής πολιτιστικής κληρονομιάς. Η ΕΦΕ εκδίδει το διμηνιαίο περιοδικό Φιλοτέλεια, το μακροβιότερο ελληνικό φιλοτελικό περιοδικό και ένα από τα πλέον καταξιωμένα φιλοτελικά περιοδικά διεθνώς.\\nΗ ΕΦΕ στεγάζεται σε ιδιόκτητα γραφεία στο κέντρο της Αθήνας, όπου, εκτός από το εντευκτήριό της, διατηρεί τη μεγαλύτερη φιλοτελική βιβλιοθήκη στη χώρα. Η Εταιρεία υπήρξε πρωτοπόρος στην καθιέρωση ενός φιλοτελικού πλαισίου κανόνων, συμμετέχοντας με κρατικούς φορείς σε διαδικασίες σχετικές με την πολιτική των εκδόσεων των ελληνικών γραμματοσήμων, την καταστροφή των αποθέτων και την πάταξη της πλαστογραφίας. Το 1947, η ΕΦΕ αποτέλεσε ιδρυτικό μέλος της Ελληνικής Φιλοτελικής Ομοσπονδίας. Το 1975, με τη συμπλήρωση πενήντα ετών ζωής, η ΕΦΕ τιμήθηκε με τον Έπαινο της Ακαδημίας Αθηνών."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D9%84%D9%85%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Fregatte_Mecklenburg-Vorpommern_F218.jpg","page_title":"آلمان","context_page_description":"آلمان، رسمی آدی: آلمان فدراتیو جومهوریتی باتی آوروپادا یئرلشن دؤولت‌دیر. قوزئی ده قوزئی دنیزی، دانمارک و بالتیک دنیزی، دۇغودا لهیستان و چک جومهوریتی، گونئی‌ده اوتریش و سویس، باتی ده ایسه فرانسه، لوکزامبورق، بلژیک و هولند ایله همسرحددیر.\\nآلمان ۱۶ فدرال ایالت‌دن عبارت مجلیس‌لی فدرال جومهوریتیدیر. باشکند شهر و اینضیباطی مرکز برلین شهری‌دیر. دؤولت کیمی آلمان ۱۸۷۱-جی ایلده فرانسه -پروس ساواشیندن سوْنرا بیرلشدیریلمیش‌دیر. ایکینجی دونیا ساواشیندن سوْنرا ایکی حیصّه یه بؤلونن اؤلکه، ۱۹۹۰-جو ایلده یئنی‌دن بیرلش‌دی. اوروپا بیرلیگینین یارادیجیلاریندان بیری اوْلان آلمان ۸۱٫۸ میلیون اهالی‌سی ایله آب-ده سای اعتباری‌له بیرینجی یئری تۇتور.\\nبیرلشمیش میلتلر قورومو، ناتو، جی ۸ و جی۴ تشکیلاتلارینین عضوو اوْلان آلمان دۆنیانین اؤنجول دؤولتلریندن بیریدیر. اؤلکه اۆدم حجمینه گؤره دۆنیانین اۆچونجو بؤیوک ایقتصادیاتینا مالیک اوْلماقلا یاناشی امتهه ایخراجاتینا گؤره بیرینجی، ایدخالاتینا گؤره ایسه ایکینجی یئری تۇتور. ۲۰۰۷-جی ایلده هم اوروپا بیرلیگی، هم ده گ۸-ین نؤوبه‌لی رهبرلییی خۆصوصیت لرینی حیاتا کئچیریب.\\n۱۰۰-جی ایلدن اول جرمن خالق‌لاری جرمانیا اولاراق آدلاندیریلان بؤلگه‌ده یاشامیش‌لار. ۱۰. عصردن ۱۸۰۶-جی ایله قدر جرمن بؤلگه‌لری موقددس روما ژرمن ایمپراتورلوغونون بیر پارچاسی اوْلدو. ۱۶."},{"page_url":"https://de.wikipedia.org/wiki/Wei%C3%9Fhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Wei%C3%9Fhaus-Detail-Schweidkarte-17-Jh.JPG","page_title":"Weißhaus","context_page_description":"Das Weißhaus ist ein mittelalterliches Wasserschloss im Kölner Stadtteil Sülz."},{"page_url":"https://la.wikipedia.org/wiki/Rousset_(Alpes_Superiores)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Rousset05-ch%C3%A2teau-36.jpg","page_title":"Rousset (Alpes Superiores)","context_page_description":"Rousset est commune Francicum 163 incolarum praefecturae Alpium Superiorum in regione Provincia et Alpis."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D1%81%D1%82%D0%B1%D0%B0%D1%83%D0%B5%D1%80-%D0%93%D0%B5%D0%BD%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Goldkegelplatz_03.jpg","page_title":"Постбауер-Генг","context_page_description":"Постбауер-Генг — громада в Німеччині, розташована в землі Баварія. Підпорядковується адміністративному округу Верхній Пфальц. Входить до складу району Ноймаркт.\\nПлоща — 24,65 км². Населення становить 7479 ос."},{"page_url":"https://de.wikipedia.org/wiki/Techniker_Krankenkasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Eingangsbauwerk_der_ehemaligen_Margarinefabrik_Voss%2C_Hamburg-Barmbek.jpg","page_title":"Techniker Krankenkasse","context_page_description":"Die Techniker Krankenkasse ist eine Ersatzkasse und damit Träger der gesetzlichen Krankenversicherung. Sie ist bundesweit geöffnet und mit 10,7 Mio. Versicherten die größte deutsche Krankenkasse. Die TK ist eine Körperschaft des öffentlichen Rechts mit Selbstverwaltung. Sie ist Mitglied im Verband der Ersatzkassen. Seit September 2016 tritt die Krankenkasse unter der Marke Die Techniker auf."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tel_des_archev%C3%AAques_de_Sens","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/P1260001_Paris_IV_hotel_de_Sens_cour_rwk.jpg","page_title":"Hôtel des archevêques de Sens","context_page_description":"L’hôtel des archevêques de Sens est un hôtel particulier du XVᵉ siècle situé dans le 4ᵉ arrondissement de Paris. Classé aux monuments historiques, il abrite aujourd'hui la bibliothèque Forney, consacrée principalement à l'affiche et à la publicité."},{"page_url":"https://nl.wikipedia.org/wiki/Jingellic","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/JingellicBridgeHotel_December2005.jpg","page_title":"Jingellic","context_page_description":"Jingellic is een plaats in de Australische deelstaat Nieuw-Zuid-Wales."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Landschaftsschutzgebiete_im_Kreis_H%C3%B6xter","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Beverungen_-_2017-04-27_-_Weser-Skywalk_%2823%29.jpg","page_title":"Liste der Landschaftsschutzgebiete im Kreis Höxter","context_page_description":"Die Liste der Landschaftsschutzgebiete im Kreis Höxter enthält die Landschaftsschutzgebiete des Kreises Höxter in Nordrhein-Westfalen."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%B3%D8%A7%D8%A8%DB%8C%D8%AA%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Wappen_Zabitz.png","page_title":"تسابیتس","context_page_description":"تسابیتس یک منطقهٔ مسکونی در آلمان است که در اوشترنینبورگر لاند واقع شده‌است. تسابیتس ۵۱۸ نفر جمعیت دارد."},{"page_url":"https://eo.wikipedia.org/wiki/Hans_Pfitzner","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Hans_Pfitzner_Briefmarke.jpg","page_title":"Hans Pfitzner","context_page_description":"Hans Erich PFITZNER estis germana komponisto kaj dirigento."},{"page_url":"https://es.wikipedia.org/wiki/Avenida_General_Sarmiento","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Avenida_Sarmiento_Mapa.jpg","page_title":"Avenida General Sarmiento","context_page_description":"La Avenida General Sarmiento, más conocida como Avenida Sarmiento, es una importante arteria vial que atraviesa el Parque Tres de Febrero en la Ciudad de Buenos Aires, Argentina."},{"page_url":"https://hu.wikipedia.org/wiki/Nagyvir%C3%A1g%C3%BA_kenderkef%C5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Galeopsis_speciosa_-_blossom_%28aka%29.jpg","page_title":"Nagyvirágú kenderkefű","context_page_description":"A nagyvirágú kenderkefű az ajakosvirágúak rendjébe, ezen belül árvacsalánfélék családjába tartozó növényfaj."},{"page_url":"https://no.wikipedia.org/wiki/Henrik_Bech","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Henrik_Bech_Herkules_ved_et_brennende_alter_1769.jpg","page_title":"Henrik Bech","context_page_description":"Henrik Bech var en dansk treskjærer og kunstner, kom til Norge i 1750 etter invitasjon fra Moss Jernverk og arbeidet der med former til etasjeovner. Henrik Bech er ansett som en av de største kunstnere innen rokokko i Norge. Hans hovedverk er altertavlen, prekestolen og kongestolen i Kongsberg kirke fra 1762-1768. Han utførte også døpefont til Immanuels kirke i Halden i 1752."},{"page_url":"https://de.wikipedia.org/wiki/Auf_dem_Wege_zur_amerikanischen_Botschaft","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Sacvan.jpg","page_title":"Auf dem Wege zur amerikanischen Botschaft","context_page_description":"Auf dem Wege zur amerikanischen Botschaft ist eine Erzählung von Anna Seghers, die um 1929 entstand und 1930 in der gleichnamigen Sammlung in Berlin erschien. Die Autorin beschreibt eine Massendemonstration in einer großen Stadt gegen die umstrittene Verurteilung der beiden Anarchisten Sacco und Vanzetti wegen Raubmordes durch ein Gericht in Massachusetts"},{"page_url":"https://pl.wikipedia.org/wiki/Wyspa_%C5%9Awi%C4%99tej_Heleny,_Wyspa_Wniebowst%C4%85pienia_i_Tristan_da_Cunha","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/LocationStHelena.PNG","page_title":"Wyspa Świętej Heleny, Wyspa Wniebowstąpienia i Tristan da Cunha","context_page_description":"Wyspa Świętej Heleny, Wyspa Wniebowstąpienia i Tristan da Cunha – brytyjskie terytorium zamorskie, która składa się z trzech części położonych na południowym Oceanie Atlantyckim, odległych od siebie o kilka tysięcy kilometrów. W jej skład wchodzą: Wyspa Świętej Heleny, Wyspa Wniebowstąpienia oraz archipelag Tristan da Cunha, do którego administracyjnie zaliczana jest również wyspa Gough."},{"page_url":"https://cs.wikipedia.org/wiki/Lincoln_County_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Lincoln_County_Wisconsin_Courthouse.jpg","page_title":"Lincoln County (Wisconsin)","context_page_description":"Lincoln County je okres ve státě Wisconsin v USA. K roku 2010 zde žilo 28 743 obyvatel. Správním městem okresu je Merrill. Celková rozloha okresu činí 2 349 km²."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A7%8D%E0%A6%AF%E0%A6%B8%E0%A7%8D%E0%A6%A4%E0%A6%A4%E0%A6%AE_%E0%A6%95%E0%A6%A8%E0%A7%8D%E0%A6%9F%E0%A7%87%E0%A6%87%E0%A6%A8%E0%A6%BE%E0%A6%B0_%E0%A6%AC%E0%A6%A8%E0%A7%8D%E0%A6%A6%E0%A6%B0_%E0%A6%B8%E0%A6%AE%E0%A7%82%E0%A6%B9%E0%A7%87%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Liste_des_plus_grands_ports_%C3%A0_conteneurs.svg","page_title":"ব্যস্ততম কন্টেইনার বন্দর সমূহের তালিকা","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_im_Hamburger_Bezirk_Wandsbek","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/1186_grenzstein_rahlstedter_str.jpg","page_title":"Liste der Kulturdenkmäler im Hamburger Bezirk Wandsbek","context_page_description":"Dies ist eine veraltete Liste. Maßgeblich sind die Listen der Kulturdenkmäler in Hamburg nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013, die wegen ihrer Größe nach Stadtteilen aufgeteilt sind.\\nDie folgende Liste enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet der Freien und Hansestadt Hamburg, Bezirk Wandsbek.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Stadtteilen und ist alternativ nach Denkmallistennummer, Straße oder Beschreibung sortierbar.\\nBasis ist die Denkmalliste des Denkmalschutzamtes Hamburg. Diese enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz unter Denkmalschutz stehen oder zumindest zeitweise standen. Darüber hinaus führt das Denkmalschutzamt eine noch umfangreichere Liste der erkannten Denkmäler mit den als schutzwürdig erkannten Objekten, für die das Gesetz bereits Auflagen bei Veränderungen bis zu einer möglichen Unterschutzstellung vorsieht."},{"page_url":"https://es.wikipedia.org/wiki/John_James_Onslow","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Lapie1833-Malvinas.jpg","page_title":"John James Onslow","context_page_description":"John James Onslow fue un marino inglés de la primera mitad del siglo XIX que desempeñó la mayor parte de su carrera en aguas del Atlántico Sur. Fue el encargado de la ocupación británica a las islas Malvinas."},{"page_url":"https://de.wikipedia.org/wiki/Guillaume-Aff%C3%A4re","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Bundesarchiv_B_145_Bild-F042669-0054%2C_Bonn%2C_Tagung_SPD-Pr%C3%A4sidium%2C_Schmidt%2C_Wehner.jpg","page_title":"Guillaume-Affäre","context_page_description":"Die Guillaume-Affäre ist der politisch bedeutsamste Spionagefall der deutsch-deutschen Geschichte. Am 24. April 1974 wurde mit Günter Guillaume einer der engsten Mitarbeiter des Bundeskanzlers Willy Brandt als DDR-Agent des Ministeriums für Staatssicherheit enttarnt. Brandt übernahm die politische Verantwortung und trat am 7. Mai 1974 von seinem Amt als Bundeskanzler zurück. Es gilt als wahrscheinlich, dass die Guillaume-Affäre nicht der alleinige Grund für den Rücktritt war, zumal die von Guillaume in die DDR übermittelten Informationen offenbar nicht allzu sicherheitsrelevant waren. Mit Günter Guillaume wurde auch seine mit ihm nachrichtendienstlich zusammenarbeitende Ehefrau Christel Guillaume als Agentin enttarnt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Golzheim_(D%C3%BCsseldorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Haus_Luetzowstrasse_4_in_Duesseldorf-Golzheim%2C_von_Suedosten.jpg","page_title":"Liste der Baudenkmäler in Golzheim (Düsseldorf)","context_page_description":"Die Liste der Baudenkmäler in Golzheim (Düsseldorf) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Düsseldorf-Golzheim, Stadtbezirk 1, in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Düsseldorf eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%88%B4%E6%9C%A8Kei","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Suzuki_Kei_001.JPG","page_title":"鈴木Kei","context_page_description":"鈴木Kei是1998年至2009年間由日本鈴木公司開發製造的輕型運動型多用途車，除了在日本國內市場銷售外，亦曾引進香港。其雙生車款為馬自達Laputa，關於車名「Kei」在日語中音同「輕」，乃是原廠希望此車款能樹立輕型車的標準。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8B_%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B9_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Sir_Abe_Bailey%2C_1st_Bt.jpg","page_title":"Генералы Первой мировой войны","context_page_description":"«Генералы Первой мировой войны» — картина американского художника Джона Сингера Сарджента, написанная им в 1922 году.\\nВ 1918 году Сарджент получил заказ на создание картины от южноафриканского финансиста Абрахама Бейли, стремившегося сохранить память о британских полководцах времён Первой мировой войны. Ранее Бейли заказал ещё две картины на схожую тему, но с разными героями, которыми стали морские офицеры и государственные деятели. После долгих уговоров, в том числе при участии попечителей Национальной портретной галереи в Лондоне, куда Бейли заранее решил пожертвовать картины, Сарджент всё-таки решил взяться за огромных размеров полотно, на котором должны были быть изображены 22 генерала Британской империи. Сарджент писал картину долгих четыре года, работа над ней шла трудно, и, как признавался сам художник, «генералы маячат у меня перед глазами, как кошмар». Наконец, в 1922 году работа подошла к концу, и огромное полотно горизонтального формата было выставлено в Королевской академии. Картина была сдержанно оценена критиками, во многом из-за холодности персонажей и невыразительности композиции. В настоящее время картина находится в коллекции Национальной портретной галереи."},{"page_url":"https://en.wikipedia.org/wiki/Duivenvoorde_Castle","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Kasteel_Duivenvoorde_012.jpg","page_title":"Duivenvoorde Castle","context_page_description":"Duivenvoorde Castle is a castle in the town of Voorschoten, South Holland, in the Netherlands. It was first mentioned in 1226, making it one of the oldest castles in South Holland.\\nThe castle is remarkable in that it has never been sold, which can be said of very few Dutch castles. It has passed by inheritance through several noble houses, sometimes through the matrilineal line. For the first five centuries of its history, the castle was owned by one family, the van Duivenvoordes, who gave their name - at that time, van Duvenvoirde - to it. Although thus named, the van Duvenvoirdes properly formed part of the House of Wassenaer, an ancient noble family which has played an important role in Dutch history. Towards the end of the 17th century an owner of Duivenvoorde Castle, Johan van Duvenvoirde, readopted the name of van Wassenaer. Therefore, although the same family remained in the House, this was under a different name."},{"page_url":"https://vi.wikipedia.org/wiki/Stomatolina_rubra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Stomatolina_rubra_001.jpg","page_title":"Stomatolina rubra","context_page_description":"Stomatolina rubra là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển thuộc họ Trochidae, họ ốc đụn."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%A4%D0%B5%D0%BE%D0%B4%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%D0%A7%D0%9C%D0%A4_%D0%B2_%D0%A4%D0%B5%D0%BE%D0%B4%D0%BE%D1%81%D1%96%D1%97.jpg","page_title":"Історія Феодосії","context_page_description":"Історія Феодосії"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9D%D1%8B%D1%81%D0%B0%D0%BD%D0%B0_%D0%BA%D3%A9%D0%B7%D0%B4%D0%B5%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/KK-liegend.jpg","page_title":"Нысана көздеу","context_page_description":"Нысана көздеу – ежелгі спорт ойындарының бірі. Түркі халықтарында жамбы ату түрінде көрініс тапқан.\\nАрнайы спорт түрі ретінде Кеңес үкіметі тұсында дами бастады. Нысана көздеу спорты 1896 жылы өткен 1-Олимпия ойындары бағдарламасына енген. Қазақстанда нысана көздеушілер бәсекесі 1923 жылдан бері өтіп келеді. Нысана көздеуден қазақ қыздары арасынан шыққан тұңғыш спорт шебері – Г.Майлыбаева. Олимпия ойындарында қазақстандықтар В.Вохмянин 2 мәрте қола медаль алды, С.Беляев олимпия ойындарында 2 рет күміс жүлдені иемденді. Сонымен қатар О.Довгун, Г.Беляева, Ю.Бондарева, Б. Исаченко, Н.Коваленко, Г.Корчма, т.б. спортшылар әлем, Еуропа, Азия кубогы мен чемпионаттарында жеңімпаз, жүлдегер атанды.\\nҚазақстанның стенд атушылары да қомақты табыстарға қол жеткізді. А.Асанов екі дүркін әлем және бес дүркін Еуропа чемпионы, бес дүркін әлем кубогы иегері болды. В.Серов әлем чемпионы, В.Скоробагатов, В.Поляк, В.Гущалар Еуропа чемпионы атанды. И.Стручаев Азия ойындарының жеңімпазы болды. Еліміздегі нысана көздеу спортын дамытуға 1969 – 93 жылы аралығында өткен халықаралық “Алтын қырғауыл“ жарыстары үлкен септігін тигізді. Қазіргі таңда “Алтын мерген” халықаралық жарыстары өтіп келеді."},{"page_url":"https://pt.wikipedia.org/wiki/Rose_DeWitt_Bukater","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Titanic.jpg","page_title":"Rose DeWitt Bukater","context_page_description":"Rose DeWitt Bukater, posteriormente conhecida como Rose Dawson Calvert é uma personagem fictício e protagonista do filme Titanic de 1997. Rose foi criada por James Cameron, o roteirista, produtor e diretor do filme ganhador de 11 Oscars em 1998. Ela foi uma das passageiras sobreviventes do naufrágio do RMS Titanic em 15 de abril de 1912. Rose adotou o sobrenome Dawson após chegar em Nova Iorque em 18 de abril, no RMS Carpathia, três dias após o desastre, devido ao seu amante Jack Dawson, e numa maneira de esconder sua identidade."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1990","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Anna_Muzychuk_2011.jpg","page_title":"Lijst van personen geboren in 1990","context_page_description":"Dit is een lijst van personen die geboren zijn in 1990.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sv.wikipedia.org/wiki/Masdevallia_yungasensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Masdevallia_yungasensis_ssp._calocodon_Orchi_002.jpg","page_title":"Masdevallia yungasensis","context_page_description":"Masdevallia yungasensis är en orkidéart som beskrevs av Tamotsu Hashimoto. Masdevallia yungasensis ingår i släktet Masdevallia och familjen orkidéer.\\nArtens utbredningsområde är Bolivia."},{"page_url":"https://en.wikipedia.org/wiki/Old_Indian_Meeting_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Old_Indian_Meeting_House_Church_in_Mashpee_MA.jpg","page_title":"Old Indian Meeting House","context_page_description":"The Old Indian Meeting House is a historic meeting house at 410 Meetinghouse Road in Mashpee, Massachusetts. Built in 1684, the meetinghouse is the oldest Native American church in the eastern United States and the oldest church on Cape Cod. The building was listed on the National Register of Historic Places in 1998."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9B%D1%96%D0%BC%D0%BE%D0%BD%D1%8D-%D1%81%D1%83%D0%BB%D1%8C-%D0%93%D0%B0%D1%80%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Limone-sul-Garda01.jpg","page_title":"Лімонэ-суль-Гарда","context_page_description":"Лімонэ-суль-Гарда — камуна ў Італіі, размяшчаецца ў рэгіёне Ламбардыя, падпарадкоўваецца адміністрацыйнаму цэнтру Брэшыя.\\nНасельніцтва складае 1034 чалавек, шчыльнасць насельніцтва складае 40 чал./км². Займае плошчу 26 км². Паштовы індэкс — 25010. Тэлефонны код — 0365.\\nЗаступнікам населенага пункта лічыцца святы."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D0%BF%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F_%D1%84%D0%BE%D1%80%D0%BC_%D0%B4%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D0%B3%D1%80%D0%B5%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%81%D0%BE%D1%81%D1%83%D0%B4%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Dinos_du_Peintre_de_la_Gorgone.jpg","page_title":"Типология форм древнегреческих сосудов","context_page_description":"Типология форм древнегреческих сосудов представляет большое разнообразие. Форма древнегреческих сосудов соответствовала прикладному назначению и менялась почти до бесконечности, в зависимости от места и времени производства и личного вкуса производителя. Тем не менее некоторые формы были особенно распространёнными и любимыми и составляли особые разряды, имевшие каждый своё особое наименование. Античные писатели сохранили номенклатуру греческих сосудов, однако показания этих авторов столь неопределённые и путаные, что, основываясь на них и проверяя их по сохранившимся экземплярам, нельзя было прояснить многие детали. Несмотря на все это, благодаря трудам Панофки и работам других исследователей, названия большинства форм определены окончательно."},{"page_url":"https://simple.wikipedia.org/wiki/Jintara_Poonlarp","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Signature_Jintara_Poonlarp.png","page_title":"Jintara Poonlarp","context_page_description":"Jintara Poonlarp is a famous singer of Thailand. She is most populars for artist in genre Mor lam and Luk thung. She is have 40 original albums for relased, but two of her best-known songs are the string hits \\"Ma Tammai\\" and \\"Faen Ja,\\" recorded with Thongchai McIntyre. She is also sometimes known by her nickname Jin or the epithet sao siang pin."},{"page_url":"https://es.wikipedia.org/wiki/Eotitanops","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Eotitanops_borealis.jpg","page_title":"Eotitanops","context_page_description":"Eotitanops es un género extinto de mamíferos perisodáctilos de la familia Brontotheriidae que vivieron en el Eoceno de Norteamérica y Asia."},{"page_url":"https://en.wikipedia.org/wiki/Bolu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Bolu062007_7519.jpg","page_title":"Bolu","context_page_description":"Bolu is a city in Turkey, and administrative center of the Bolu Province. The population is 131,264.\\nThe city has been governed by mayor Alaaddin Yılmaz since local elections in 2004. It was the site of Ancient Claudiopolis and has also been called Eskihisar.\\nBolu is on the old highway from Istanbul to Ankara, which climbs over Mount Bolu, while the new motorway passes through Mount Bolu Tunnel below the town."},{"page_url":"https://en.wikipedia.org/wiki/Tom_Glynn-Carney","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Tom_Glynn-Carney_%C3%A0_Dunkerque.jpg","page_title":"Tom Glynn-Carney","context_page_description":"Tom Glynn-Carney is an English actor. He is best known for his supporting role in Christopher Nolan's war film Dunkirk."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D1%80%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Tov_Buren_sum_map.PNG","page_title":"Бурен","context_page_description":"Бурен — сомон аймаку Туве, Монголія. Територія 3,75 тис. км², населення 3,8 тис. Центр — селище Баянтохом розташоване на відстані 178 км від м. Зуунмод та 210 км від Улан-Батора."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1971/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Franz_Stangl_Treblinka.jpg","page_title":"Lijst van personen overleden in 1971/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1971.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sk.wikipedia.org/wiki/Mazda_RX-8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/2010_Mazda_RX-8_R3_--_09-03-2009.jpg","page_title":"Mazda RX-8","context_page_description":"Mazda RX-8 je športový automobil, ktorý v rokoch 2003 až 2011 vyrábala automobilka Mazda Motor Corporation. Prvýkrát sa objavila v roku 2001 na North American International Auto Show. Je nasledovníkom Mazdy RX-7, a ako jej predchodcovia v rade RX, je poháňaná Wankelovým motorom. RX-8 zahájila predaj v Severnej Amerike v modelovom roku 2004. Mazda 23. augusta 2011 oznámila, že výroba RX-8 bude ukončená, pričom modely roku 2011 budú poslednými."},{"page_url":"https://en.wikipedia.org/wiki/KTM","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Paris_-_Salon_de_la_moto_2011_-_KTM_-_350_SX-F_LTD_Edition_Tony_Cairoli_-_001.jpg","page_title":"KTM","context_page_description":"KTM AG is an Austrian motorcycle and sports car manufacturer owned by Pierer Mobility AG and Indian manufacturer Bajaj Auto. It was formed in 1992 but traces its foundation to as early as 1934. Today, KTM AG is the parent company of the KTM Group, consisting of a number of motorcycle brands.\\nKTM is known for its off-road motorcycles. Since the late 1990s, it has expanded into street motorcycle production and developing sports cars – namely the X-Bow. In 2015, KTM sold almost as many street as off-road bikes.\\nSince 2012, KTM has been the largest motorcycle manufacturer in Europe for four consecutive years. Globally, the company is among the leading off-road motorcycle manufacturers. In 2016, KTM sold 203,423 motor vehicles worldwide."},{"page_url":"https://es.wikipedia.org/wiki/Santa_Cruz_(Madeira)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Pt-scr1.png","page_title":"Santa Cruz (Madeira)","context_page_description":"Santa Cruz es una ciudad ubicada en el archipiélago de Madeira.\\nTambién se llama Ciudad Aeropuerto.\\nCiudad de pescadores, Santa Cruz conserva los Antiguos Tiempos de la Colonización y en varios monumentos notables. Está próxima a la ciudad de Machico.\\nLa población es de 12.000 hab. El mayor atractivo es el Solarium de Praia das Palmeiras."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%94%E1%83%A0%E1%83%94%E1%83%95%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%AC%E1%83%9B%E1%83%98%E1%83%9C%E1%83%93%E1%83%90_%E1%83%92%E1%83%A0%E1%83%98%E1%83%92%E1%83%9D%E1%83%9A_%E1%83%92%E1%83%90%E1%83%9C%E1%83%9B%E1%83%90%E1%83%9C%E1%83%90%E1%83%97%E1%83%9A%E1%83%94%E1%83%91%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%90%E1%83%99%E1%83%90%E1%83%97%E1%83%94%E1%83%93%E1%83%A0%E1%83%9D_%E1%83%A2%E1%83%90%E1%83%AB%E1%83%90%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Yerevan%2C_Surb_Grigor_Lusavorich_Church6.JPG","page_title":"ერევნის წმინდა გრიგოლ განმანათლებლის საკათედრო ტაძარი","context_page_description":"წმინდა გრიგოლ განმანათლებლის საკათედრო ტაძარი, ასევე, ცნობილი როგორც ერევნის კათედრალი — სომხეთის სამოციქულო ეკლესიის უდიდესი ტაძარი ამჟამად და სომხეთის უდიდესი კათედრალი. მდებარეობს სომხეთის დედაქალაქ ერევნის კენტრონის რაიონში და ითვლება სამხრეთი კავკასიის ერთ-ერთ უდიდეს რელიგიურ ნაგებობად წმინდა სამების საკათედრო ტაძართან ერთად. ტაძარი ანდრანიკ ზორავარის მეტროსადგურის მახლობლად დგას და ერევნის მრავალი წერტილიდან ჩანს."},{"page_url":"https://zh.wikipedia.org/zh-sg/M102","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ngc5866_hst_big.jpg","page_title":"M102","context_page_description":"梅西尔102是一个在梅西尔目录中未能明确被辨认出的，被梅西尔和皮埃尔·梅香声明重复的星系，目前有两个候选者：即重复的梅西尔101和NGC 5866。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Pyrbaum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/DEU_Pyrbaum_COA.svg","page_title":"Liste der Baudenkmäler in Pyrbaum","context_page_description":"Auf dieser Seite sind die Baudenkmäler des Oberpfälzer Marktes Pyrbaum zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://fr.wikipedia.org/wiki/Contis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Contis_fontaine_Ste_M_Mad.JPG","page_title":"Contis","context_page_description":"Contis est une station balnéaire située sur la commune de Saint-Julien-en-Born, dans le département francais des Landes."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_presidentene_for_Italias_senat","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Ivanoe_Bonomi_portrait.png","page_title":"Liste over presidentene for Italias senat","context_page_description":"Presidenten for Italias senat er leder for overhuset i parlamentet."},{"page_url":"https://en.wikipedia.org/wiki/Devon_heraldry","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Dillon_%28OfChymwell_BrattonFleming_Devon%29_Arms.png","page_title":"Devon heraldry","context_page_description":"The landed gentry and nobility of Devonshire, like the rest of the English and European gentry, bore heraldic arms from the start of the age of heraldry circa 1200-1215. The fashion for the display of heraldry ceased about the end of the Victorian era by which time most of the ancient armigerous families of Devonshire had died out, moved away or parted with their landed estates.\\nToday a very few ancient families remain in the county represented by direct male descendants, most notably Courtenay of Powderham, Fulford of Fulford, Kelly of Kelly, Cruwys of Cruwys Morchard, Clifford of Chudleigh, Acland of Killerton and Broadclyst, Wrey of Tawstock, etc. A few ancient Devon estates are still owned by descendants via female lines, for example Castle Hill, Filleigh, Molland, Incledon, Braunton, Hall, Bishop's Tawton, Newnham Park, etc. In most cases the laws of English heraldry preclude the transmission of paternal armorials via a female heiress, thus most of these inheritors via female lines, generally deriving from the same pool of high-status English armigerous families, bring their own paternal heraldry, possibly previously foreign to Devon, to the estates inherited."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BC%D0%B8%D1%88%D0%B2%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Temi%C5%A1var%2C_Rumunija_49.jpg","page_title":"Темишвар","context_page_description":"Темишвар град је у Румунији. Највећи је град Баната, лежи на реци Бегеј и седиште је округа Тамиш. Са 319.279 становника Темишвар је трећи град по величини у Румунији, а такође је познат као и културни, образовни и трговачки центар западне Румуније.\\nТемишвар је и највећи културно-историјски центар Срба у Румунији. Највише српског живља окупљено је управо у Темишвару, где иначе постоје многе културне установе које их зближавају. У Темишвару се налази седиште Епархије темишварске Српске православне цркве, као и Савеза Срба у Румунији, а такође се овде издаје и српски недељник „Наша реч“.\\nГрад се назива и „Малим Бечом“, јер је веома дуго био под Хабзбурговцима, и његово средиште својом архитектуром и амбијентима подсећа на стари део Беча."},{"page_url":"https://es.wikipedia.org/wiki/Arboreomorpha","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Charniodiscus_arboreus.jpg","page_title":"Arboreomorpha","context_page_description":"Los arboreomorfos son seres ediacáricos de tipo frondomorfo que poseían un anclaje con forma de disco o bulbo en el fondo del océano, un tallo central y ramificación. Las \\"ramas\\" eran estructuras lisas y tubulares, a menudo hinchadas con bifurcación y conectados entre sí para formar una estructura en forma de hoja.​\\nThaumaptilon es uno de los pocos casos que llegaron hasta el Cámbrico.​ Algunos autores clasifican este grupo dentro de Rangeomorpha y otros junto a Erniettamorpha en un grupo mayor llamado Frondomorpha."},{"page_url":"https://en.wikipedia.org/wiki/Paddington,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Rear_of_No.7_West_Street%2C_off_Oxford_Street%2C_Sydney_%28NSW%29_%287558810352%29.jpg","page_title":"Paddington, New South Wales","context_page_description":"Paddington is an inner-city area of Sydney, in the state of New South Wales, Australia. Located 3 kilometres east of the Sydney central business district, Paddington lies across two local government areas. The portion south of Oxford Street lies within the City of Sydney, while the portion north of Oxford Street lies within the Municipality of Woollahra. It is often colloquially referred to as \\"Paddo\\".\\nPaddington is bordered to the west by Darlinghurst, to the east by Centennial Park and Woollahra, to the north by Edgecliff and Rushcutters Bay and to the south by Moore Park."},{"page_url":"https://es.wikipedia.org/wiki/Vabres_(Cantal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/%C3%89glise_de_Vabres.jpg","page_title":"Vabres (Cantal)","context_page_description":"Vabres es una población y comuna francesa, situada en la región de Auvernia, departamento de Cantal, en el distrito de Saint-Flour y cantón de Saint-Flour-Nord."},{"page_url":"https://da.wikipedia.org/wiki/Helsing%C3%B8r_Kommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Kronborg_Helsing%C3%B6r.jpg","page_title":"Helsingør Kommune","context_page_description":"Helsingør Kommune er en nordsjællandsk kommune i Region Hovedstaden med 62.695 indbyggere, og omfatter ud over den største by Helsingør, byerne Espergærde, Hellebæk/Ålsgårde og Hornbæk. Kommunen har været uforandret siden kommunalreformen i 1970.\\nHistorisk set har det, der i dag er kommunen, været stærkt påvirket af den store skibstrafik, der går igennem Øresund. Byen Helsingør ved sundets smalleste sted. Byen nævnes første gang i 1231 som Flynderborg, en lille købstad, der ifbm. indførelsen af Øresundstolden får tildelt udvidede købstadsrettigheder af kong Erik af Pommern i 1426. Hertil opførte han et fæstningsværk, der senere skulle blive til Kronborg.\\nHelsingør Kommune dækker over den nordøstligste del af Nordsjælland, og har, udover en række kyst- og turistbyer langs Kattegat og Øresund, grænse til Esrum Sø mod sydvest samt flere statsejede skove, f.eks. Teglstrup Hegn og Horserød Hegn."},{"page_url":"https://sv.wikipedia.org/wiki/Phlebocarya_filifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Phlebocarya_filifolia_-_Flickr_-_Kevin_Thiele.jpg","page_title":"Phlebocarya filifolia","context_page_description":"Phlebocarya filifolia är en enhjärtbladig växtart som först beskrevs av Ferdinand von Mueller, och fick sitt nu gällande namn av George Bentham. Phlebocarya filifolia ingår i släktet Phlebocarya och familjen Haemodoraceae. Inga underarter finns listade."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E6%8B%89%E7%93%A6%E5%85%A7%C2%B7%E9%9B%B7%E6%89%8E%E4%BC%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Rezai_RG13_%289358905397%29.jpg","page_title":"阿拉瓦內·雷扎伊","context_page_description":"阿拉瓦內·雷扎伊，港譯莉莎爾或雷莎伊，伊朗裔法國網球選手。單打最高排名為第15。"},{"page_url":"https://fr.wikipedia.org/wiki/William_Guerin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Sergei_Samsonov.jpg","page_title":"William Guerin","context_page_description":"William Robert Guerin, dit Bill Guerin, est un joueur professionnel américain de hockey sur glace devenu entraîneur. Il est choisi en première ronde par les Devils du New Jersey dans la Ligue nationale de hockey en tant que cinquième joueur sélectionné au repêchage de 1989.\\nAu cours de sa carrière professionnelle, Guerin joue pour huit équipes en dix-huit saisons dans la LNH jusqu'à sa retraite à la fin de la saison 2009-2010. Il porte ainsi les couleurs des Devils, des Oilers d'Edmonton, des Bruins de Boston, des Stars de Dallas, des Blues de Saint-Louis, des Sharks de San José, des Islanders de New York et enfin des Penguins de Pittsburgh. Il remporte aussi la Coupe Stanley avec les Devils en 1995 et avec les Penguins en 2009.\\nIl représente également les États-Unis au niveau international. Il joue ainsi sept compétitions avec le maillot américain prenant part à deux reprises au championnat du monde junior en 1989 et 1990, et deux autres fois à la Coupe du monde en 1996 et 2004. Il participe également à trois Jeux olympiques en 1998, en 2002 au cours duquel il remporte la médaille d'argent et enfin en 2006."},{"page_url":"https://pt.wikipedia.org/wiki/Maur%C3%ADcio_Carrilho","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Mauricio_Carrilho.jpg","page_title":"Maurício Carrilho","context_page_description":"Maurício Carrilho é um arranjador, produtor musical, pesquisador de MPB e violonista brasileiro. É filho do músico e flautista Álvaro Carrilho e sobrinho do também flautista Altamiro Carrilho.\\nComo arranjador e violonista, trabalhou ao lado dos artistas de música popular brasileira como, Joyce, Elizeth Cardoso, Nara Leão, Chico Buarque, Miúcha, Francis Hime, Paulo Moura, Paulinho da Viola, entre outros."},{"page_url":"https://ast.wikipedia.org/wiki/Islla_de_Las_Palomas","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/IslaPalomasTarifa.JPG","page_title":"Islla de Las Palomas","context_page_description":"La Islla de los Palombos o Islla de Tarifa, anguaño xunida a tierra por aciu una carretera, ye la islla esistente frente a la ciudá de Tarifa y que'l so estremu sur, la Punta de Tarifa, representa'l puntu más meridional de la península ibérica y de la Europa continental.\\nNa zona nororiental de la islla son visibles los restos de, siquier, cinco hipogeos funerarios feniciu-púnicos fechaos ente los sieglos VI ya IV e.C. La práutica totalidá de la superficie de la islla viose, amás, bien alteriada pola construcción de canteres d'onde s'estrayxo sistemáticamente, dende dómina romana, roca caliar fosilífera pa la construcción. La fortificación de la islla llevar a cabu dende siquier el sieglu XVII col establecimientu d'una pequeña batería, en principiu con una dotación de cinco homes, pa construyise dende 1798 les primeres bateríes d'un fuerte proxectáu dos años antes.\\nHasta 1808 la islla tuvo dixebrada de Tarifa. Esi añu foi construyíu'l camín de la islla, obra d'Antonio González Salmón, quien tamién foi responsable del espigón que fai función de puertu de Tarifa."},{"page_url":"https://fr.wikipedia.org/wiki/La_Fabuloserie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/La_Fabuloserie_logo.jpg","page_title":"La Fabuloserie","context_page_description":"La Fabuloserie est un musée privé ouvert au public depuis 1983. Situé à Charny-Orée-de-Puisaye, dans l’Yonne, l’espace a été aménagé par Alain Bourbonnais pour accueillir sa collection d’art hors-les-normes.\\nLa collection réunit plus de mille créations réalisées par des artistes autodidactes apparentés à l’art brut. Conçue comme un véritable cabinet de curiosités, La Fabuloserie se compose de deux espaces : la « maison-musée » et le « jardin habité ». Le premier, la « maison-musée », expose notamment des peintures et dessins de Yanko Domsic, Philippe Dereux, Philippe Mahaut et Franz Ringel ; des sculptures et assemblages d’Émile Ratier, Simone Le Carré-Galimard et aussi la Tribu des Turbulents d’Alain Bourbonnais lui-même. Le second, le « jardin habité », musée de plein-air, présente les sculptures d’habitants-paysagistes comme Camille Vidal, Jules Damloup, mais aussi les girouettes de Jean Bertholle et l’étonnant Manège de Petit Pierre."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%82%A4%E3%83%A4%E3%83%AB%E3%83%BB%E3%83%95%E3%83%A5%E3%83%BC%E3%82%B8%E3%83%AA%E3%82%A2%E3%83%BC%E3%82%BA%E9%80%A3%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/James_II_%28headshot%29.jpg","page_title":"ロイヤル・フュージリアーズ連隊","context_page_description":"ロイヤル・フュージリアーズ連隊は1968年に編成されたイングランドの歩兵連隊であり、大型連隊と呼ばれるタイプの連隊である。大型連隊は複数の1～2個大隊編成の連隊を統合して複数大隊編成としたもので、イギリス陸軍に於いて20世紀後半から編成されるようになった新しいタイプの連隊である。ロイヤル・フュージリアーズ連隊は現存する歩兵の大型連隊の中ではロイヤル・アングリアン連隊に次いで古い。連隊番号は元の連隊の番号を繋げて、”第5, 6, 7, 20歩兵”とされる。"},{"page_url":"https://de.wikipedia.org/wiki/Marienviertel_(Berlin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Berlin_Mitte_St._Marienkirche_Lutherdenkmal_1906.jpg","page_title":"Marienviertel (Berlin)","context_page_description":"Das Marienviertel ist eins von ehemals vier Vierteln im historischen Stadtteil Alt-Berlin, der zum heutigen Ortsteil Mitte gehört. Der Name existiert mindestens seit 1727 und nimmt Bezug auf die St.-Marien-Kirche. Heute ist die Bezeichnung im Bereich der Stadtplanung wieder von Bedeutung."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Landshut-Nikola","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Nikolastr._31_Landshut-3.jpg","page_title":"Liste der Baudenkmäler in Landshut-Nikola","context_page_description":"In der Liste der Baudenkmäler in Landshut–Nikola sind die Baudenkmäler im Landshuter Stadtbezirk 01 Nikola aufgelistet.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Landshut. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://ru.wikipedia.org/wiki/Paralithodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Paralithodes_camtschaticus_Vladivostok.jpg","page_title":"Paralithodes","context_page_description":"Paralithodes — род неполнохвостых раков из семейства крабоиды."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%A9lix-Henri_Giacomotti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Reproduction%2Bphotographique%2Bde%2BF%C3%A9lix-Henri%2BGiacomotti%2B-%2BBesan%C3%A7on%2B-%2BMus%C3%A9e%2Bdes%2BBeaux-Arts%2Bet%2Bd%27Arch%C3%A9ologie.jpg","page_title":"Félix-Henri Giacomotti","context_page_description":"Félix-Henri Giacomotti, né le 19 novembre 1828 à Quingey et mort le 10 mai 1909 à Besançon, est un peintre et conservateur de musée français d'origine italienne."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Conrad_Rudolph_Wohlien","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Orgel_St._Marienkirche_Eddelak.jpg","page_title":"Johann Conrad Rudolph Wohlien","context_page_description":"Johann Conrad Rudolph Wohlien war ein Orgelbauer in Altona.\\nEr gehörte zur bekannten Altonaer Orgelbauerfamilie Wohlien und war „der dritte Orgelbauer seines Geschlechts“. Wohlien starb während der Renovierung der Orgel von St. Trinitatis in Hamburg-Altona. Mit seinem Sohn Johann Friedrich Eduard Wohlien erlosch die Firma, die vom Großvater Balthasar Wohlien begründet wurde."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D0%BE%D0%B0_%D0%92%D0%B0%D1%82%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Le_chateau_de_Vaux_le_Vicomte.jpg","page_title":"Франсоа Вател","context_page_description":"Франсоа Вател е френски готвач. Създател е на прочутия крем Шантийи – разбита със захар сметана с вкус на ванилия. Самоубива се, тъй като вследствие лошо време, доставчиците му не му донасят необходимата му риба и той не може да осигури храната за екстравагантния банкет в чест на френския крал Луи XIV даден от Луи II дьо Бурбон, принц дьо Конде през месец април 1671 г. в замъка Шантийи."},{"page_url":"https://ca.wikipedia.org/wiki/Miribilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Edificio_en_Avenida_Askatasuna.jpg","page_title":"Miribilla","context_page_description":"Miribilla és un barri del districte bilbaí d'Ibaiondo. Té una superfície de 0,82 kilòmetres quadrats i una població de 10.000 habitants. Limita al nord amb el barri de San Frantzisko, a l'oest amb Zabala, al sud amb San Adrian i a l'est amb Bilbo Zaharra."},{"page_url":"https://de.wikipedia.org/wiki/Visiline_Jepkesho","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Visiline_Jepkesho_Rio_2016.jpg","page_title":"Visiline Jepkesho","context_page_description":"Visiline Jepkesho ist eine kenianische Langstreckenläuferin."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B4%91%EB%B6%80%EB%93%A4%EC%9D%84_%EC%A7%80%EC%A7%80%ED%95%98%EB%8A%94_%EB%A0%88%EC%A6%88%EB%B9%84%EC%96%B8%EA%B3%BC_%EA%B2%8C%EC%9D%B4%EB%93%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/LGSM_at_the_BFI.JPG","page_title":"광부들을 지지하는 레즈비언과 게이들","context_page_description":"광부들을 지지하는 레즈비언과 게이들은 1984-1985년 영국 광부 파업을 지지하기 위해 결성된 단체이다. 파업이 종료되기까지 영국 전역에 11개의 단체가 존재했으며, 설립 지부인 런던 지부에서만 11,000파운드 이상을 모금했다."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BA%92%E9%BA%9F%E5%BA%A7V838","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/VanGogh-starry_night.jpg","page_title":"麒麟座V838","context_page_description":"麒麟座V838是位在麒麟座的一顆紅色變星，距離太陽約20,000光年；它可能是已知最大的恆星之一，該恆星在2002年經歷了一次爆發事件並被觀測到。一開始相信這是一次新星爆發，但在之後發現並非如此。爆發的原因至今不明，但有數個理論已經提出，其中包含恆星死亡的過程、聯星合併或吞噬行星。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%E2%80%99%D1%91%D1%80%D0%BD%D1%96%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Tj%C3%B6rnin_Panorama.jpg","page_title":"Т’ёрнін","context_page_description":"Т’ёрнін — возера ў Рэйк'явіку, адно з самых знакамітых азёр Ісландыі.\\nНа яго берагах знаходзіцца ратуша Рэйк’явіка, а таксама знакамітая школа, якую наведвалі першыя асобы Ісландыі"},{"page_url":"https://en.wikipedia.org/wiki/Dreher_High_School","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/SCETVDreherHighSchool.JPG","page_title":"Dreher High School","context_page_description":"Dreher High School is a co-educational four-year public high school in Richland County School District One located in Columbia, South Carolina, USA. Dreher, established in 1938, is one of the oldest public high schools in the state. In 2009, Dreher was listed as the 702nd best school in the country by Newsweek in their annual best-high school rankings. In 2015, Dreher was ranked the 7th best high school in South Carolina by US News and World Report."},{"page_url":"https://en.wikipedia.org/wiki/Evgenia_Medvedeva","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/2015_Grand_Prix_of_Figure_Skating_Final_Evgenia_Medvedeva_IMG_9505.JPG","page_title":"Evgenia Medvedeva","context_page_description":"Evgenia Armanovna Medvedeva, is a Russian figure skater. She is a two-time Olympic silver medalist, a two-time world champion, a two-time European champion, a two-time Grand Prix Final champion, a two-time Russian national champion, silver medalist at the 2018 European Figure Skating Championships and bronze medalist at the 2019 World Championships.\\nEarlier in her career, she won the 2015 World Junior Championships, the 2014 Junior Grand Prix Final, and the 2015 Russian Junior Championships.\\nMedvedeva is the first ladies' singles skater to win senior Worlds the year after winning Junior Worlds, and the first ladies' singles skater to win two consecutive senior Worlds the year after winning Junior Worlds. At the 2017 World Championships, she became the first female skater to win back-to-back world titles in 16 years since Michelle Kwan did so in 2000 and 2001, and the first Russian woman ever to successfully defend her world title. She became one of only four ladies to have achieve a Grand Slam, and the first skater to complete two Grand Slam in a row."},{"page_url":"https://es.wikipedia.org/wiki/15.%C2%AA_ceremonia_de_los_Premios_%C3%93scar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Teresa_Wright_1942.jpg","page_title":"15.ª ceremonia de los Premios Óscar","context_page_description":"La 15.ª ceremonia de entrega de los Premios Óscar se celebró el 4 de marzo de 1943 en el Cocoanut Grove del Ambassador Hotel de Los Ángeles, California, y fue conducida por Bob Hope.\\nLa mejor película fue La señora Miniver. La ceremonia es especialmente recordada por el discurso de aceptación del premio por parte de la actriz Greer Garson, que duró alrededor de 6 minutos, y que es generalmente considerado como el discurso más largo de la historia de los premios.\\nLa señora Miniver fue la segunda película en recibir nominaciones en las cuatro categorías interpretativas, así como la primera en conseguir cinco nominaciones interpretativas.\\nTambién destacar que Irving Berlin presentó el premio a la mejor canción, que al final acabó ganando él mismo por el tema «White Christmas».\\nLa categoría de mejor documental tuvo cuatro ganadores, algo que no había pasado nunca hasta ese momento.\\nParte de la ceremonia fue retransmitida por la cadena de radio CBS Radio.​"},{"page_url":"https://de.wikipedia.org/wiki/Fruchtblase","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Human_fetus_10_weeks_with_amniotic_sac_-_therapeutic_abortion.jpg","page_title":"Fruchtblase","context_page_description":"Die Fruchtblase, auch Fruchtwassersack oder Fruchtsack genannt, ist ein flüssigkeitgefüllter Membransack, in dem sich der Embryo bzw. Fötus amniotischer Landwirbeltiere entwickelt. Sie befindet sich entweder in einem mit einer relativ festen Schale umschlossenen Ei oder im Uterus des Muttertieres.\\nWas genau als „Fruchtblase“ bezeichnet wird, darauf legt sich die Literatur nicht einheitlich fest. Teils wird als Fruchtwassersack nur das mit Fruchtwasser gefüllte Amnion, die innere, den Embryo bzw. Fötus unmittelbar umgebende Eihaut, bezeichnet, teils ist die Fruchtblase aber auch definiert als die Gesamtheit der Eihäute, das heißt, sie schließt mindestens auch das Chorion, eine äußere Eihaut, mit ein.\\nDiese Unschärfe mag in der unterschiedlichen Entwicklung der Eihäute bei den oviparen und viviparen Amnioten begründet liegen."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%D8%A8%D8%A7%D9%86%E2%80%8C%D9%87%D8%A7%DB%8C_%DA%98%D8%A7%D9%BE%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Japanese_dialects-en.png","page_title":"زبان‌های ژاپنی","context_page_description":"زبان‌های ژاپنی خانواده زبان ژاپنی یا ژاپنی - ریوکیویی شامل زبان ژاپنی صحبت شده در جزایر اصلی ژاپن و همچنین زبان‌های ریوکیویی صحبت شده در جزایر ریوکیو هستند. اصطلاح «زبان ژاپنی» توسط لئون سارافیم تهیه شده و این خانواده زبانی به‌طور گسترده توسط زبان شناسان پذیرفته شده‌است."},{"page_url":"https://vi.wikipedia.org/wiki/Cosmopterix_inaugurata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Cosmopterix_inaugurata.jpg","page_title":"Cosmopterix inaugurata","context_page_description":"Cosmopterix inaugurata là một loài bướm đêm thuộc họ Cosmopterigidae. Nó được tìm thấy ở Brasil và Guyana.\\nCon trưởng thành được ghi nhận vào tháng 4 và tháng 11. Cánh trước dài 3,7-4,2 mm."},{"page_url":"https://en.wikipedia.org/wiki/2003_invasion_of_Iraq_order_of_battle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Marines_in_Saddams_palace_DM-SD-04-12222.jpg","page_title":"2003 invasion of Iraq order of battle","context_page_description":"This is the order of battle for invasion of Iraq during the Iraq War between coalition forces and Iraqi regular forces supported by Fedayeen Saddam irregulars and others between March 19 and May 1, 2003."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D0%B0_%D0%9A%D0%B0%D0%BF%D1%83%D0%B9%D1%81%D1%8C%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Venus_of_Capua_MAN_Napoli_Inv6017_n01.jpg","page_title":"Венера Капуйська","context_page_description":"Венера Капуйська, Афродіта Капуйська — давньоримська мармурова статуя II ст. н. е., що зберігається в Національному археологічному музею Неаполя. Зображує богиню Венеру, яка пише на щиті, і являє собою римську адаптацію класичного грецького типу Афродіти Коринфської."},{"page_url":"https://en.wikipedia.org/wiki/WLVW","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/WRQX_mix107.3_logo.png","page_title":"WLVW","context_page_description":"WLVW – branded as K-Love – is a non-commercial contemporary Christian radio station licensed to serve Washington, D.C. Owned and operated by the Educational Media Foundation, WLVW does not broadcast any local programming, functioning as the Washington metropolitan area network affiliate for K-Love. The station's transmitter resides in the district's northwest quadrant. In addition to a standard analog transmission, WLVW is available online; the station also formerly broadcast in the HD Radio format."},{"page_url":"https://cs.wikipedia.org/wiki/D%C5%AFm_Anny_Je%C5%BEkov%C3%A9_%C4%8Dp._250","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/S._K._Neumanna_%C4%8Dp._250.jpg","page_title":"Dům Anny Ježkové čp. 250","context_page_description":"Dům Anny Ježkové je dům na Pražském Předměstí v Hradci Králové, který vždy sloužil k bydlení a v přízemí se nacházely navíc obchodní místnosti."},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_Greece","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Naxos_Taverna.jpg","page_title":"Culture of Greece","context_page_description":"The culture of Greece has evolved over thousands of years, beginning in Minoan and later in Mycenaean Greece, continuing most notably into Classical Greece, through the influence of the Roman Empire and its successor the Byzantine Empire. Other cultures and states such as the Frankish states, the Ottoman Empire, the Venetian Republic and Bavarian and Danish monarchies have also left their influence on modern Greek culture, but historians credit the Greek War of Independence with revitalising Greece and giving birth to a single entity of its multi-faceted culture.\\nGreece is widely considered to be the cradle of Western culture and democracy. Modern democracies owe a debt to Greek beliefs in government by the people, trial by jury, and equality under the law. The ancient Greeks pioneered in many fields that rely on systematic thought, including biology, geometry, history, philosophy, and physics. They introduced such important literary forms as epic and lyric poetry, history, tragedy, and comedy. In their pursuit of order and proportion, the Greeks created an ideal of beauty that strongly influenced Western art."},{"page_url":"https://it.wikipedia.org/wiki/Architettura_liberty_in_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Casa_Rena.jpg","page_title":"Architettura liberty in Italia","context_page_description":"L'architettura Liberty in Italia si affermò inizialmente come «arte nuova» o, secondo il giornalista torinese Enrico Thovez, «arte floreale», questo nuovo stile stupì per essere così «fedelmente naturalistico e nella sostanza nettamente decorativo». A seguito delle edizioni dell'Esposizione internazionale d'arte decorativa moderna, Torino vide il crescente proliferare di questo nuovo stile in ambito prevalentemente architettonico, celebrando una sorta di «rinascimento delle arti decorative», avvalendosi di contributi dei maggiori autori dell'epoca come Raimondo D'Aronco e il torinese Pietro Fenoglio che si affermò per sua proficua attività di ingegnere e che fece del liberty torinese uno degli esempi più fulgidi e coerenti del variegato panorama architettonico italiano del tempo.\\nL'Art Nouveau in architettura e design degli interni superò lo storicismo eclettico che permeava l'età vittoriana. Gli artisti dell'Art Nouveau selezionarono e modernizzarono alcuni tra gli elementi del Rococò, come le decorazioni a fiamma e a conchiglia, al posto dei classici ornamenti naturalistici vittoriani."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%B3%E5%A3%A4%E5%9C%B0%E9%90%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Ex_pyongyang_metro.JPG","page_title":"平壤地鐵","context_page_description":"平壤地鐵是朝鮮首都平壤的城市軌道交通系統，始建於1960年代，1973年9月正式投入營運。地鐵隧道為韓戰時期已挖掘好的防空洞，深度普遍在22-100米之間，某些山區路段更深入150米。\\n平壤地鐵於1968年動工，1973年9月6日第一條地鐵線路千里馬線通車，第二條革新線在1975年朝鮮國慶節通車。現時系統約長24公里，分成千里馬及革新等兩條支線，合共17個車站，然而其中革新線上的光明站則在金日成去世後被關閉，不再使用。\\n平壤地鐵剛通車時採用了中國長春客車廠DK4型列車，目前使用的車廂都是從德國進口的車廂和朝鮮仿製德國的車廂。2016年1月1日，朝鮮自主研發生產的新型列車投入平壤地鐵營運。\\n除地下鐵路系統外，平壤亦有三條地面有軌電車鐵路，採用捷克、德國等國機車以及自行製造的列車。"},{"page_url":"https://pl.wikipedia.org/wiki/Rz%C4%85d_Zorana_Milanovicia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Arsen_Bauk.jpg","page_title":"Rząd Zorana Milanovicia","context_page_description":"Rząd Zorana Milanovicia – dwunasty rząd Republiki Chorwacji od rozpoczęcia w 1990 procesu demokratyzacji.\\nGabinet rozpoczął urzędowanie 23 grudnia 2011. Powstał po wyborach parlamentarnych z 4 grudnia 2011, w których bezwzględną większość głosów w Zgromadzeniu Chorwackim uzyskała Koalicja Kukuriku. W skład nowego gabinetu weszli przedstawiciele trzech partii politycznych z tego bloku: Socjaldemokratycznej Partii Chorwacji, Chorwackiej Partii Ludowej – Liberalnych Demokratów oraz Istryjskiego Zgromadzenia Demokratycznego. Gabinet zakończył urzędowanie 22 stycznia 2016 – dwa i pół miesiąca po kolejnych wyborach parlamentarnych."},{"page_url":"https://pt.wikipedia.org/wiki/Pal%C3%A1cio_dos_Papas_de_Avinh%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Alexander_VIII_1.jpg","page_title":"Palácio dos Papas de Avinhão","context_page_description":"O Palácio dos Papas em Avinhão, França, é uma das maiores e mais importantes construções góticas da Idade Média na Europa. Ao mesmo tempo fortaleza e palácio, a residência pontifícia foi, durante o século XIV, a sede da cristandade do Ocidente. Avinhão tornou-se na residência dos papas em 1309, quando o papa Clemente V, não querendo voltar a Roma depois do caos da sua eleição, mudou a corte papal para Avinhão. No palácio de Avinhão realizaram-se seis conclaves, dos quais resultaram as eleições dos papas Bento XII, em 1335; Clemente VI, em 1342; Inocêncio VI, em 1352; Urbano V, em 1362; Gregório XI, em 1370; e do Antipapa Bento XIII, em 1394.\\nO palácio, que resulta da fusão de dois edifícios - o palácio velho de Bento XII, verdadeira fortaleza assente sobre o inexpugnável rochedo dos Doms, e o palácio novo de Clemente VI, o mais faustoso dos pontífices de Avinhão - é, não somente, um dos maiores edifícios góticos, mas também aquele em que se exprimiu o estilo gótico internacional em toda a sua plenitude."},{"page_url":"https://sv.wikipedia.org/wiki/Doln%C3%AD_Bukovsko","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Dolni_Bukovsko_CZ_flag.png","page_title":"Dolní Bukovsko","context_page_description":"Dolní Bukovsko är en köping i Tjeckien. Den ligger i länet Södra Böhmen, i den centrala delen av landet, 100 km söder om huvudstaden Prag. Dolní Bukovsko ligger 445 meter över havet och antalet invånare är 1 473.\\nTerrängen runt Dolní Bukovsko är platt. Den högsta punkten i närheten är 502 meter över havet, 1,1 km norr om Dolní Bukovsko. Runt Dolní Bukovsko är det ganska tätbefolkat, med 58 invånare per kvadratkilometer. Närmaste större samhälle är Veselí nad Lužnicí, 8,6 km öster om Dolní Bukovsko. Trakten runt Dolní Bukovsko består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 7 °C. Den varmaste månaden är juli, då medeltemperaturen är 19 °C, och den kallaste är december, med -6 °C. Genomsnittlig årsnederbörd är 994 millimeter. Den regnigaste månaden är juni, med i genomsnitt 136 mm nederbörd, och den torraste är mars, med 39 mm nederbörd."},{"page_url":"https://fr.wikipedia.org/wiki/Magnolia_%C3%A9toil%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Magnolia_stellata_%28Jardin_des_plantes%29.jpg","page_title":"Magnolia étoilé","context_page_description":"Le Magnolia étoilé, Magnolia stellata, est un arbuste à floraison printanière originaire du Japon.\\nCette espèce est étroitement liée au Magnolia de Kobé, et est traitée par de nombreux botanistes comme une variété ou même un cultivar de celle-ci. Cependant, Magnolia stellata a été accepté comme une espèce distincte dans la monographie de Hunt en 1998."},{"page_url":"https://ms.wikipedia.org/wiki/Hannes_%C3%9E%C3%B3r_Halld%C3%B3rsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Hannes_%C3%9E%C3%B3r_Halld%C3%B3rsson_2018_%28cropped%29.jpg","page_title":"Hannes Þór Halldórsson","context_page_description":"Hannes Þór Halldórsson ialah seorang pembuat filem dan pemain bola sepak profesional Iceland yang bermain sebagai penjaga gol untuk kelab Azerbaijan, Qarabağ dan pasukan kebangsaan Iceland."},{"page_url":"https://en.wikipedia.org/wiki/8th_Armoured_Division_(South_Africa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/SADF_8_Division_26_Field_Artillery_Flash.jpg","page_title":"8th Armoured Division (South Africa)","context_page_description":"8 South African Armoured Division was a formation of the South African Army, active from the 1970s to 1999."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%AB%E5%90%89%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Sueyoshi_Park_Naha_Okinawa_Japan13s3.jpg","page_title":"末吉公園","context_page_description":"末吉公園は沖縄県那覇市にある都市公園である。国の史跡の末吉宮跡と日本一早咲きの桜の標本木のある公園として知られる。\\n公園内を流れる安謝川周辺および南側は人工的に整備された緑地公園であるのに対し、末吉宮跡のある北側の山地は多くの自然が残されている。心霊スポットとしても有名である。"},{"page_url":"https://cs.wikipedia.org/wiki/Eugenie_Bouchardov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Genie_Bouchard_Runner_up_Wimbledon_2014_.jpg","page_title":"Eugenie Bouchardová","context_page_description":"Eugenie „Genie“ Bouchardová, rodným jménem Eugenie Bouchard je kanadská tenistka, která na profesionální okruh vstoupila v roce 2009. Ve své dosavadní kariéře vyhrála na okruhu WTA Tour jeden singlový turnaj, když triumfovala na květnovém Nürnberger Versicherungscup 2014. K tomu přidala jednu deblovou trofej. Z dvouhry odešla třikrát, a ze čtyřhry jedenkrát, jako poražená finalistka. V rámci okruhu ITF získala šest titulů ve dvouhře a jeden ve čtyřhře.\\nNa žebříčku WTA byla ve dvouhře nejvýše klasifikována v říjnu 2014 na 5. místě a ve čtyřhře pak v srpnu 2013 na 103. místě. Hlavním tréninkovým centrem je floridská Tenisová akademie Nicka Savianiho. Trénuje ji Michael Joyce. V sezóně 2017 byl koučem bývalý americký tenista Harold Solomon. Od června 2011 se na její přípravě také podílela bývalá francouzská finalistka Wimbledonu Nathalie Tauziatová, která ukončila spolupráci v roce 2013. Stejný rok ji trénoval Portugalec António van Grichen. V sezóně 2014 se jejím koučem stal Nick Saviano a mezi únorem a srpnem 2015 ji vedl Francouz Sam Sumyk. V závěru sezóny 2016 se podruhé jejím koučem stal Thomas Högstedt."},{"page_url":"https://de.wikipedia.org/wiki/Ernst_Herzfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Kurangun_panels%2C_2009-05-08.jpg","page_title":"Ernst Herzfeld","context_page_description":"Ernst Emil Herzfeld war ein deutscher vorderasiatischer Archäologe, Altorientalist und Epigraphiker. Er war Mitbegründer der vorderasiatischen und islamischen Archäologie, Architektur- und Kunstgeschichte und Begründer der iranischen Archäologie."},{"page_url":"https://en.wikipedia.org/wiki/Bogert_House_(Bogota,_New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/BogertHouse.jpg","page_title":"Bogert House (Bogota, New Jersey)","context_page_description":"The Bogert House in Bogota, Bergen County, New Jersey, United States. The house was listed on the National Register of Historic Places in 1983."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9B%D0%BE%D0%BF%D1%83_%D0%A1%D1%83%D0%B0%D1%80%D1%8B%D1%88_%D0%B4%D1%8B_%D0%90%D0%BB%D0%B1%D0%B5%D1%80%D0%B3%D0%B0%D1%80%D1%8B%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%D0%9A%D0%B0%D1%80%D0%B0%D0%B2%D0%B5%D0%BB%D0%BB%D0%B0.jpg","page_title":"Лопу Суарыш ды Албергарыя","context_page_description":"Ло́пу Суа́рыш ды Алберга́рыя — партугальскі мараплавец, трэці губернатар Партугальскай Індыі, які змяніў у 1515 годзе папярэдняга губернатара Афонсу дэ Албукеркі.\\nЛопу Суарыш нарадзіўся ў Партугаліі ў знатнай сям'і, блізкай да магутнага роду Алмейда. Годам нараджэння звычайна лічыцца 1442, хоць часам згадваецца 1460 год. Наконт даты смерці таксама няма ўпэўненасці, але 1520 год падаецца найбольш верагодным. Выбраў кар'еру ваеннага, у 1495—1499 гадах служыў афіцэрам у крэпасці Эльміна, размешчанай у Гвінейскім заліве на ўзбярэжжы Заходняй Афрыкі.\\nУ 1504 годзе Лопу Суарыш узначаліў 6-ю Індыйскую армаду Партугаліі. Плаванне ў Індыю, якое доўжылася каля года, стала самым паспяховым за ўсю гісторыю партугальскіх марскіх экспедыцый — толькі адзін карабель быў страчаны, груз спецый у трумах прынёс небывалы прыбытак. Экспедыцыя нават знайшла тры караблі папярэдняй флатыліі 1503 года, адрамантавала іх і прывяла ў Партугалію, такім чынам Лопу Суарыш вярнуўся з большай колькасцю караблёў, чым меў пры адплыцці. Поспех экспедыцыі паставіў Лопу Суарыша ў шэраг выдатных мараходаў Партугаліі перад каралём Мануэлам I."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%82%B9%E3%83%95%E3%82%A1%E3%83%8F%E3%83%BC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Chehel_Sotoon.jpg","page_title":"エスファハーン","context_page_description":"エスファハーン は、イランの都市。エスファハーン州の州都。テヘランの南約340kmに位置する。日本語では、慣例的にイスファハン、イスファハーンとも表記される。\\n古くからの政治・文化・交通の拠点であり、16世紀末にサファヴィー朝の首都に定められ発展した。当時の繁栄は「エスファハーンは世界の半分」と賞賛され、この街を訪れたヨーロッパの商人も繁栄の記録を残している。イラン人にとってエスファハーンは歴史的・文化的に重要な町であり、町の美しさは「イランの真珠」と例えられる。\\n町は16世紀以前に建設された旧市街と、サファヴィー朝の王アッバース1世が建設した新市街で構成される。有名なイマーム・モスクなどがある新市街のイマーム広場は、ユネスコにより世界遺産に登録されている。\\n町の住人は出費に厳しい「倹約家」「吝嗇家」として良くも悪くも有名であり、他の地域の人間からは敬遠されることがある。イランでは「エスファハーンはいいところだ。エスファハーン人さえいなければ」という住民を揶揄する言葉も知られている。また、エスファハーンの人間は訛りが強いことでも知られ、言葉を聞いただけで容易に出身地が判別できるほどだと言われる。"},{"page_url":"https://sv.wikipedia.org/wiki/Surte","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Ale_Skaardal_IMG_0530_Akzo_Nobel_Pulp_and_Performance_Chemicals_AB.jpg","page_title":"Surte","context_page_description":"Surte är en tätort i Ale kommun som ligger vid E45 och Bergslagsbanan öster om Göta älv, omkring 1,5 mil norr om centrala Göteborg. I tätorten ingår även samhället Bohus som vuxit samman med Surte."},{"page_url":"https://ca.wikipedia.org/wiki/Arctornitinis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Arctornis_submarginata.jpg","page_title":"Arctornitinis","context_page_description":"Arctornithini és una tribu de papallones nocturnes de la subfamília Lymantriinae i la família Erebidae."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%AE%E1%83%95%E1%83%98%E1%83%97%E1%83%98_%E1%83%AE%E1%83%94%E1%83%9A%E1%83%9D%E1%83%95%E1%83%9C%E1%83%94%E1%83%91%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Raphael_Spasimo.jpg","page_title":"სახვითი ხელოვნება","context_page_description":"სახვითი ხელოვნება მოიცავს მხატვრობას, სკულპტურას, ფოტოგრაფიას და ხელოვნების სხვა ისეთ სახეებს, რომელთა პირველადი ბუნება ვიზუალური ხასიათის ნამუშევართა შექმნაა. სახვით ხელოვნებას განასხვავებენ საშემსრულებლო ხელოვნების, სიტყვის ხელოვნების, კულინარული ხელოვნებისა და სხვა მსგავსთაგან; თუმცა განსაზღვრება მკაცრი არ არის და მრავალი ხელოვნების შემსწავლელი დისციპლინა მოიცავს სახვით ხელოვნებას სხვა ტიპის ხელოვნებებთან მიმართებაში."},{"page_url":"https://eo.wikipedia.org/wiki/Vila_Vi%C3%A7osa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Palaca_%C4%9Dardeno.jpg","page_title":"Vila Viçosa","context_page_description":"Vila Viçosa estas portugala urbo en la Distrikto Évora, en la regiono Alentejo kaj en la sub-regiono Centra Alentejo, kun 5 023 loĝantoj.\\nĜi estas sidejo de municipio kun 194,86 km² de areo kaj 8 319 loĝantoj, subdividita en 4 freguesias. La municipo estas lima norde kaj oriente de la municipo de Elvas, sude de Alandroal, okcidente de Redondo kaj nordokcidente de Borba.\\nEn Vila Viçosa estis la sidejo de la dukoj de Bragança, el kiuj kelkaj reĝoj de Portugalio, dum kelkaj jarcentoj, ĝis la Proklamo de la Respubliko, nome en la tre vizitata Duka Palaco de Vila Viçosa."},{"page_url":"https://sv.wikipedia.org/wiki/Tjuvah%C3%A5lan","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Tjuvah%C3%A5lan5.JPG","page_title":"Tjuvahålan","context_page_description":"Tjuvahålan är en havsvik och en sandstrand i Halmstad kommun i Halland. Även området ovanför viken där Tyluddens fritidsby nu ligger brukar refereras ibland till som Tjuvahålan. Viken kallas Tjuvahålan för att den förr varit tillhåll för sjörövare och smugglare."},{"page_url":"https://la.wikipedia.org/wiki/Ch%C3%A2tel-Guyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Chatel_centre.JPG","page_title":"Châtel-Guyon","context_page_description":"Châtel-Guyon est commune 6225 incolarum Franciae praefecturae Podii Dumiatis in regione Arvernia."},{"page_url":"https://ceb.wikipedia.org/wiki/Tullytown","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/TullytownPA_WaltDisneyElementarySchool.jpg","page_title":"Tullytown","context_page_description":"Lungsod ang Tullytown sa Tinipong Bansa. Nahimutang ni sa kondado sa Bucks County ug estado sa Pennsylvania, sa sidlakang bahin sa nasod, 230 km sa amihanan-sidlakan sa Washington, D.C. 4 metros ibabaw sa dagat kahaboga ang nahimutangan sa Tullytown, ug adunay 1,872 ka molupyo. Tullytown nga nahimutang sa lanaw sa Van Sciver Lake ang ulohan sa nasod.\\nAng yuta palibot sa Tullytown kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 62 ka metro ug 7.0 km sa amihanan-kasadpan sa Tullytown. Dunay mga 78 ka tawo kada kilometro kwadrado sa palibot sa Tullytown medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Levittown, 2.1 km sa amihanan-kasadpan sa Tullytown. Hapit nalukop sa kaumahan ang palibot sa Tullytown. Sa rehiyon palibot sa Tullytown, mga estretso talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Enero, sa -1 °C. Ang kasarangang pag-ulan 1,427 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 169 milimetro nga ulan, ug ang kinaugahan Marso, sa 79 milimetro."},{"page_url":"https://no.wikipedia.org/wiki/Vannklosett","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/French_Squatter_Toilet.jpg","page_title":"Vannklosett","context_page_description":"Et vannklosett eller vassklosett, oftest forkortet WC eller wc etter engelsk water closet, er en innretning konstruert for å bli kvitt menneskers avføring, urin eller oppkast og ved hjelp av vann føre det via et avløpsrør til oppsamling i septiktank eller til offentlig kloakk og eventuell rensing. Vannklosetter kan vanligvis samtidig fjerne toalettpapir. Vannklosett kan betegne både selve innretningen og rommet. Alternativer til vannklosett er bl.a tørrklosett, privet eller utedo."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D9%8A%D9%84_%D8%A7%D8%AA%D9%8A%D9%86%D8%B2%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Daniel_atienza_moudon_2010.JPG","page_title":"دانيل اتينزا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nدانيل اتينزا لاعب سباق عجل من اسبانيا."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B4%D0%B0_%D0%90%D0%BD%D0%B5_%D0%91%D1%80%D0%BD%D0%B0%D0%B1%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Branko_Ruzic_-_WIKI_GAP_BELGRAD_018.jpg","page_title":"Влада Ане Брнабић","context_page_description":"Влада Ане Брнабић је актуелни сазив Владе Републике Србије изабране 29. јуна 2017.\\nДруга је влада коју је изабрао Једанаести сазив Народне скупштине Републике Србије. О кабинету Ане Брнабић изјаснило се укупно 212 посланика – \\"за\\" је гласало 157 посланика, а 55 је било \\"против\\".\\n15. је по реду Влада Србије од обнове вишепартијског система у Србији."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A6%8F%E5%B2%A1%E3%82%BF%E3%83%AF%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Fukuoka_Tower_Illumination_Christmas_tree.jpg","page_title":"福岡タワー","context_page_description":"福岡タワーは、福岡県福岡市早良区のシーサイドももち地区にあるランドマークタワーで、高さは234m。日本で1番高い海浜タワーでもある。1989年のアジア太平洋博覧会にあわせて建設された。福岡市と地元有力企業との共同出資による福岡タワー株式会社が運営している。"},{"page_url":"https://fr.wikipedia.org/wiki/Les_Plus_Beaux_Villages_de_Russie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Agvan_Dorzhiev_museum.JPG","page_title":"Les Plus Beaux Villages de Russie","context_page_description":"Les Plus Beaux Villages de Russie est une association privée, créée en août 2014 et qui s'inspire de l'association Les Plus Beaux Villages de France.\\nCette association est également associée à Les Plus Beaux Villages de la Terre."},{"page_url":"https://hr.wikipedia.org/wiki/Robert_Forster_(gitarist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Robert_Forster_at_ATP%2C_Mt_Buller%2C_Victoria%2C_Australia.jpg","page_title":"Robert Forster (gitarist)","context_page_description":"Robert Forster je australski gitarist, pjevač i kantautor. Poznat je postao kao član grupe Go-Betweens."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Uhy","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Uhy_KL_CZ.png","page_title":"Uhy","context_page_description":"Uhy sī Czech Tiong Bohemia chiu Kladno koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://en.wikipedia.org/wiki/Borassus_flabellifer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%E0%B4%A8%E0%B5%8A%E0%B4%99%E0%B5%8D%E0%B4%99%E0%B5%8D_%E0%B4%B8%E0%B5%BC%E0%B4%AC%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B5%8D%E0%B5%A8.jpg","page_title":"Borassus flabellifer","context_page_description":"Borassus flabellifer, commonly known as doub palm, palmyra palm, tala palm, toddy palm, wine palm, or ice apple is native to the Indian subcontinent and Southeast Asia. It is reportedly naturalized in Socotra and parts of China."},{"page_url":"https://fr.wikipedia.org/wiki/Astragalus_applegatei","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Astragalus_applegatei.jpg","page_title":"Astragalus applegatei","context_page_description":"Astragalus applegatei est une espèce végétale de la famille des Fabaceae."},{"page_url":"https://ca.wikipedia.org/wiki/Lincoln_(autom%C3%B2bil)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Lincoln_Model_L_Sport_Touring_1929.jpg","page_title":"Lincoln (automòbil)","context_page_description":"Lincoln és una marca d'automòbils de luxe construïts als Estats Units per Ford Motor Company. Fundada l'any 1917 per Henry M. Leland, va ser adquirida per Ford Motor Company l'any 1922. Lincoln va ser la marca de luxe més venuda als Estats Units, però el 1998 Lincoln perdé terreny vers els seus competidors; per combatre-ho, Lincoln ha presentat nous models com el MKZ, MKS i el MKX."},{"page_url":"https://it.wikipedia.org/wiki/Majet%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Majet%C3%ADn%2C_kostel_%282%29.jpg","page_title":"Majetín","context_page_description":"Majetín è un comune della Repubblica Ceca facente parte del distretto di Olomouc, nella regione di Olomouc."},{"page_url":"https://en.wikipedia.org/wiki/June_1993_lunar_eclipse","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Lunar_eclipse_chart_close-29jun26.png","page_title":"June 1993 lunar eclipse","context_page_description":"A total lunar eclipse took place on Friday, June 4, 1993, the first of two total lunar eclipses in 1993, the second being on Monday, November 29. The Moon was plunged into darkness for 1 hour and 36 minutes, in a deep total eclipse which saw the Moon 56% of its diameter inside the Earth's umbral shadow. The visual effect of this depends on the state of the Earth's atmosphere, but the Moon may have been stained a deep red colour. The partial eclipse lasted for 3 hours and 38 minutes in total. The moon passed through the center of the Earth's shadow."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%88%D0%BA%D0%B0%D1%80_(%D0%B3%D0%BE%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Goshqar_Mountain%2C_small_Caucasus%2C_Azerbaijan.jpg","page_title":"Кошкар (гора)","context_page_description":"Кошкар — безлесная скалистая гора в Азербайджане, на северо-восточной части Малого Кавказа."},{"page_url":"https://de.wikipedia.org/wiki/Karen_Kwiatkowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Karen_Kwiatkowski_on_the_farm.jpg","page_title":"Karen Kwiatkowski","context_page_description":"Karen U. Kwiatkowski ist eine US-amerikanische Autorin und ein ehemaliger weiblicher Berufsoffizier der U.S. Air Force. Mit ihrem Namen verbunden wird ihr Wirken im Jahr 2003 als Whistleblowerin, die einige Hintergründe zum Beginn des Irakkrieges in der Bush-Administration bekannt machte und Geheimdienstarbeit kritisierte.\\nIhre Enthüllungen wurden auch vom ehemaligen Chef der CIA-Antiterrorabteilung, Vincent Cannistraro, bestätigt."},{"page_url":"https://fr.wikipedia.org/wiki/Johann_Michael_Ackner","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Ackner_kabinett.jpg","page_title":"Johann Michael Ackner","context_page_description":"Johann Michael Ackner, né le 25 janvier 1782 et mort le 12 août 1862, est un archéologue et un naturaliste de Transylvanie, dans l'Empire d'Autriche."},{"page_url":"https://sh.wikipedia.org/wiki/Guttau/Hu%C4%87ina","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Guttau_in_BZ.svg","page_title":"Guttau/Hućina","context_page_description":"Gutau ili Hućina je opština u njemačkoj saveznoj državi Saksonija. Jedno je od 63 opštinska središta okruga Baucen. Prema procjeni iz 2010. u opštini je živjelo 1.649 stanovnika. Posjeduje regionalnu šifru 14625210."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/17th_Congress_AUCP-4.jpg","page_title":"Сталин, Иосиф Виссарионович","context_page_description":"Ио́сиф Виссарио́нович Ста́лин — российский революционер, советский политический, государственный, военный и партийный деятель. С 21 января 1924 по 5 марта 1953 — руководитель СССР. Маршал Советского Союза. Генералиссимус Советского Союза.\\nС 1895 года в возрасте 15 лет вступил в подпольное революционное движение. Вёл пропаганду марксизма среди семинаристов и рабочих. В 1900 году впервые участвовал в организации забастовок и протестов рабочих. В 1901 году вступил в РСДРП, после раскола присоединился к большевикам. В 1904 году стал одним из главных организаторов большой бакинской стачки, итогом которой стало заключение первого в Российской империи коллективного договора между бастующими и промышленниками. В 1909—1917 годах неоднократно арестовывался и отправлялся в ссылки, откуда также неоднократно совершал побег. В 1912 году по предложению В. И. Ленина включён в ЦК РСДРП. Тогда же Иосиф Джугашвили окончательно берёт себе псевдоним «Сталин».\\nПосле Февральской революции вернулся в Петроград. С возвращением Ленина в Россию Сталин поддержал его лозунг превращения «буржуазно-демократической» февральской революции в пролетарскую социалистическую революцию."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_San_Geremia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/San_Geremia_%28Venice%29_San_Pietro_da_Ferrari.jpg","page_title":"Église San Geremia","context_page_description":"L'église San Geremia est une église catholique de Venise, en Italie. L'édifice est connu comme le siège du culte de sainte Lucie de Syracuse car ses reliques y sont conservées et font l'objet d'un culte."},{"page_url":"https://pt.wikipedia.org/wiki/Juscelino_Kubitschek","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Juscelino_Kubitschek_em_1934.jpg","page_title":"Juscelino Kubitschek","context_page_description":"Juscelino Kubitschek de Oliveira, também conhecido pelas suas iniciais JK foi um médico, oficial da Polícia Militar mineira e político brasileiro que ocupou a Presidência da República entre 1956 e 1961. JK concluiu o curso de humanidades do Seminário de Diamantina e em 1920 mudou-se para Belo Horizonte. Em 1927, formou-se em medicina pela Universidade Federal de Minas Gerais, e em 1930 especializou-se em urologia em Paris. Em dezembro de 1931, casou-se com Sarah Lemos, com quem teve a filha Márcia, em 1943, e adotou Maria Estela, em 1947.\\nEm 1931, ingressou na Polícia Militar como médico. Neste período, trabalhou na Revolução Constitucionalista e tornou-se amigo do político Benedito Valadares que, ao ser nomeado interventor federal em 1933, nomeou Juscelino como seu chefe de gabinete. Em 1934, foi eleito deputado federal, mas o seu mandato foi cassado com o advento do golpe do Estado Novo. Com a perda do mandato, retornou à medicina. Em 1940, foi nomeado prefeito de Belo Horizonte por Valadares, permanecendo neste cargo até outubro de 1945. No final do mesmo ano foi eleito deputado constituinte pelo Partido Social Democrático."},{"page_url":"https://nl.wikipedia.org/wiki/Huygenshuis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Voorgevel%2C_voor_de_afbraak_in_18..%3F%2C_reproductie_van_oude_foto_-_%27s-Gravenhage_-_20089702_-_RCE.jpg","page_title":"Huygenshuis","context_page_description":"Het Huygenshuis was de woning van Constantijn Huygens aan het Plein in Den Haag. Het gebouw heeft bestaan van 1637 tot 1876 waarna het is vervangen voor het Departement van Justitie.\\nHet huis was in dezelfde tijd, stijl en in onderling overleg gebouwd als het destijds naastgelegen Mauritshuis. Het was een gebouw in Classicistische stijl, ontworpen door Huygens zelf, met hulp van Jacob van Campen en de hofarchitect Pieter Post. Huygens schreef er de verhandeling Domus over zodat het als voorbeeld kon dienen voor andere architecten. De beelden die oorspronkelijk boven de gevel stonden vertegenwoordigden Firmitas, Utilitas en Venustas, architectonische basiswaarden volgens de Romeinse architect Vitruvius. Ze werden vervaardigd door meesterbeeldhouwer Pieter Adriaensz. 't Hooft.\\nDe woning huisvestte vanaf 1829 het Ministerie van Koloniën. Na het gereedkomen van een nieuw gebouw voor dit ministerie op het terrein van het koetshuis en tuin in 1860, werd in 1866 het Huygenshuis afgebroken om plaats te maken voor het Departement van Justitie."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BD%8E%E5%9C%B0%E3%82%BD%E3%83%AB%E3%83%96%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Cottbus_zweisprachige_Strassenbezeichnung_zugeschnitten.jpg","page_title":"低地ソルブ語","context_page_description":"低地ソルブ語は、スラブ語派の言語である。下ソルブ語ともいう。話者がいる地域は、ドイツ東部の歴史的にはラウジッツと呼ばれる地域であり、現在のブランデンブルク州の一部である。ソルブ語の一つであり、他方は高地ソルブ語である。\\n低地ソルブ語の話者は、ブランデンブルク州の都市コトブスとその周辺にいる。この地域の特徴として、大抵バイリンガルである。コトブスには、教育する言語として低地ソルブ語を使用するギムナジウムが存在する。"},{"page_url":"https://pl.wikipedia.org/wiki/Torpeda_parogazowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Torpedo_cross_section.jpg","page_title":"Torpeda parogazowa","context_page_description":"Torpeda parogazowa - torpeda z napędem śrubowym, w którym śruba jest napędzana silnikiem tłokowym lub turbinowym zasilanym mieszaniną pary wodnej i gazów spalinowych powstałych w procesie spalania paliwa z równoczesnym wtryskiem wody do komory spalania.\\nWczesne torpedy miały silniki zasilane sprężonym powietrzem z butli, które ulegało bardzo gwałtownemu ochłodzeniu na skutek zmniejszenia ciśnienia między butlą a silnikiem. Zastosowane z początkiem XX w. podgrzanie powietrza z butli, przez użycie go jako utleniacza do spalania niewielkich ilości paliwa i napędzanie silnika powstałymi gazami spalinowymi pozwoliło na bardzo znaczącą poprawę osiągów. Kolejnym krokiem było opracowanie w 1912 właściwej torpedy parogazowej, w której powietrze, paliwo i woda są równocześnie wtryskiwane do komory spalania. Woda pod wpływem ciepła spalania odparowywała, równocześnie chłodząc komorę i zwiększając objętość mieszaniny gazów, która następnie kierowana była do silnika.\\nWydajny napęd parogazowy pozwalał przenosić duże i ciężkie głowice z dużymi prędkościami na znaczny dystans."},{"page_url":"https://es.wikipedia.org/wiki/Ouranosaurus_nigeriensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Ouranosaurus_teeth.JPG","page_title":"Ouranosaurus nigeriensis","context_page_description":"Ouranosaurus nigeriensis es la única especie conocida del género Ouranosaurus de dinosaurio iguanodontiano hadrosauroide, que vivió a mediados del período Cretácico, hace aproximadamente 110 millones de años durante el Aptiense, en lo que hoy es África. Encontrado en la Formación Echkar o El Rhaz, depósitos de Gadoufaouna, Agadez, Níger, en 1966 y fue nombrado en 1976 por el paleontólogo francés Philippe Taquet.​ El nombre es una combinación de la palabra en árabe para \\"coraje\\" y el país del descubrimiento, aunque ourane es también el nombre tuareg para el varano del desierto."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9F%E0%AF%86%E0%AE%9F%E0%AF%8D%E0%AE%B0%E0%AE%BE_%E0%AE%90%E0%AE%A4%E0%AE%B0%E0%AF%8B%E0%AE%AA%E0%AF%8D%E0%AE%A4%E0%AE%BE%E0%AE%B2%E0%AE%BF%E0%AE%95%E0%AF%8D_%E0%AE%A8%E0%AF%80%E0%AE%B0%E0%AE%BF%E0%AE%B2%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/TetrahydrophthalicAnhydride.png","page_title":"டெட்ரா ஐதரோப்தாலிக் நீரிலி","context_page_description":"டெட்ரா ஐதரோப்தாலிக் நீரிலி என்பது C₆H₈C₂O₃ என்ற மூலக்கூற்று வாய்ப்பாட்டால் விவரிக்கப்படும் ஒரு கரிம வேதியியல் சேர்மமாகும். இரண்டு விதமான மாற்றியங்களை இச்ச்சேர்மம் கொண்டுள்ளது. இக்கட்டுரை சிசு மாற்றியம் எனப்படும் ஒரு பக்க மாற்றியத்தை விவரிக்கிறது. டைகார்பாக்சிலிக் அமில டெட்ரா ஐதரோப்தாலிக் நீரிலி, டெட்ரா ஐதரோப்தாலிமைடு போன்ற பிற சேர்மங்களைத் தயாரிப்பதற்கான முன்னோடிச் சேர்மமாக இது பயன்படுகிறது. டெட்ரா ஐதரோப்தாலிமைடிலிருந்து பூஞ்சைக் கொல்லியான கேப்டான் சேர்மம் தயாரிக்கப்படுகிறது. வெண்மை நிறங்கொண்டதாக இருக்கும் டெட்ரா ஐதரோப்தாலிக் நீரிலி கரிமக் கரைப்பான்களில் கரைகிறது."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%BF%E0%A6%A8%E0%A7%8B%E0%A6%AC%E0%A6%BE_%E0%A6%AD%E0%A6%BE%E0%A6%AC%E0%A7%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Shree_%27Bharat_Ram%27_Mandir%2C_Paunar_Ashram_-_panoramio.jpg","page_title":"বিনোবা ভাবে","context_page_description":"বিনায়ক নরহরি \\"বিনোবা ভাবে\\" ভাবে ভারতে অহিংসা ও মানবাধিকারের প্রবক্তা ও সমর্থক। প্রায়শই তিনি আচার্য নামে পরিচিত হতেন, ও তিনি বিশেষভাবে ভূদান আন্দোলনের জন্য পরিচিত ছিলেন। তাঁকে ভারতের জাতীয় শিক্ষক বলে মানা হয় এবং তাঁকে গান্ধীজীর অধ্যাত্মিক উত্তরাধিকারীও বলা হয়। তিনি মারাঠী ভাষাতে শ্রীমদ ভগবদ্গীতা অনুবাদ করেছেন যার নাম \\"গীতাঈ\\" অর্থাৎ মা গীতা।"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80_(%D0%A1%D0%BF%D0%B0%D1%81_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Khans%27_mausoleum%2C_Bolgar.JPG","page_title":"Болгар (Спас районы)","context_page_description":"Болгар — Татарстанның көньяк-көнбатышында, Иделнең сул як ярында урнашкан, район буйсынуындагы шәһәр. Спас районы үзәге. 1991 елга чаклы Куйбышев. Беренче тапкыр Ибн Фадлан кулъязмасында 10 гасырда телгә алынган. X-XII гасырларда Идел Болгары дәүләтенең башкаласы, Идел-Урал буйларында Исламны кабул итү беренче урыны, XIII гасырда Алтын Урданың беренче башкаласы, Алтын Урданы нигез салу урыны.\\nБолгар шәһәрлеге читендә, борынгы һәйкәлләре янында \\"Болгар\\" аэродромы урнаша.\\nЧардаклы тимер юлы станциясеннән төньякка таба 71 км ераклыкта. Казанга кадәр — 140 км. Мәйдан — 8 км². Халык саны — 8,5 мең кеше. Урыслар — 83,4 %, татарлар — 12,9 %, чуашлар — 2,1 %. Азык-төлек ширкәтләре, тегү фабрикасы бар."},{"page_url":"https://sk.wikipedia.org/wiki/Al%C5%BEbeta_z_Yorku","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Signature_Elizabeth_of_York.jpg","page_title":"Alžbeta z Yorku","context_page_description":"Alžbeta z Yorku bola anglická kráľovná ako manželka Henricha VII., za ktorého sa vydala v roku 1486. Vo svojom období bola považovaná za jednu z najkrajších žien."},{"page_url":"https://bg.wikipedia.org/wiki/Conus_augur","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Conus_augur_001.jpg","page_title":"Conus augur","context_page_description":"Conus augur е вид охлюв от семейство Conidae. Видът не е застрашен от изчезване."},{"page_url":"https://nl.wikipedia.org/wiki/Gouvernementsgebouw_(Assen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Gouvernementsgebouw_Assen_-_entree.jpg","page_title":"Gouvernementsgebouw (Assen)","context_page_description":"Het Gouvernementsgebouw in de Nederlandse stad Assen is het voormalig provinciehuis van Drenthe. Het pand is sinds 1976 in gebruik bij het Drents Museum en sinds 1994 een rijksmonument."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A0%BC%E9%9B%B7%E7%BD%97%E5%86%85%E6%A0%BC%E7%BD%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Salt_production_in_Guerrero_Negro.jpg","page_title":"格雷罗内格罗","context_page_description":"格雷羅內格羅是墨西哥的一個城鎮，位於南下加利福尼亞州的穆萊赫自治區。"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%D9%88%D8%AF%D9%88%DB%8C%D9%82%D8%B2%D9%81%D9%84%D8%AF%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Ludwigslust_Postamt.jpg","page_title":"لودویقزفلده","context_page_description":"لودویقزلوست آلمانین مکلنبورق-فورپومرن ایالتینده یئر آلان بیر شهردیر و ۳۵ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۱۲۸۱۵ نفر دیر. بۇ شهرین ۷۸٫۳ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BB%D1%96%D0%BD%D1%83%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Sicily_Selinunte_Temple_E_%28Hera%29.JPG","page_title":"Селінунт","context_page_description":"Селінунт — стародавнє місто на південно-західному узбережжі Сицилії, у давнину — самостійне місто-держава.\\nЗаснований у 628 р. до н. е. колоністами з Мегар на території, раніше колонізованій фінікійцями. Назву міста вважають фінікійською за походженням, хоча місцеві мешканці пов'язували її з селерою, якою і справді славилася ця місцевість. Клімат в Селінунті був нездоровий, але стратегічне становище міста було дуже вигідним. Селінунт мав дві штучні гавані, головною з яких була Мазара.\\nВ VI ст. до н. е. в місті була встановлена тиранія. Відомі імена трьох селінунтських тиранів — Ферон, Піфагор і Еврілей.\\nРозташований на країній західній межі грецьких володінь у Сицилії, Селинунт змушений був вести постійну боротьбу з елімами і фінікійцями. У 408 р. до н. е. його захопили й зруйнували карфагеняни. У 305 р. до н. е. був приєднаний до своїх володінь Агафоклом. У 249 р. до н. е. місто знову зруйнували пунійці, які вцілілих міщан переселили до Лілібея.\\nОстаточно Селінунт був знищений арабами під час їхнього нападу на Сицилію у 827 р. Пізніше на місці зруйнованого міста виникло селище Марінелла."},{"page_url":"https://br.wikipedia.org/wiki/Trogon_sitro%C3%B1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Citreoline_Trogan.jpg","page_title":"Trogon sitroñs","context_page_description":"An trogon sitroñs a zo un evn hag a vev e Mec'hiko."},{"page_url":"https://sk.wikipedia.org/wiki/Moho_spevav%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kauaioo.jpg","page_title":"Moho spevavý","context_page_description":"Moho spevavý bol vták z vyhynutej čeľade mohovité. Obýval lesy na ostrove Kauai, bol to tunajší endemit. Meral 19 – 21,5 cm a bol na rozdiel od ostatných vtákov z rodu s čiastočne žltým perím iba tmavo sfarbený, len so žltými nohami. Živil sa nektárom či bezstavovcami.\\nMoho vyhynul následkom ničenia biotopu, introdukciou nových predátorov a komáre, ktorí sa usadili v nížinách a prenášali na vtáky choroby. Vo vyšších nadmorských výškach hrozilo nebezpečenstvo hurikánov. Posledné pozorovanie moha spevavého sa v literatúre uvádza na rok 1987 alebo 1985."},{"page_url":"https://es.wikipedia.org/wiki/San_Mart%C3%ADn_de_Bola%C3%B1os","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Dasypus_novemcinctus.jpg","page_title":"San Martín de Bolaños","context_page_description":"San Martín de Bolaños es un pueblo y municipio de la Región Norte del estado de Jalisco, México. Se encuentra aproximadamente a 122 km al norte de Guadalajara. Según el II Conteo de Población y Vivienda de 2005, el municipio tenía 3,205 habitantes.​ Anteriormente la región era conocida como Alcaldía Mayor del Real de Bolaños o como Mineral del Tepec. Su extensión territorial es de 991.99 km² y la población se dedica principalmente al sector primario.​"},{"page_url":"https://cs.wikipedia.org/wiki/Cvr%C4%8Dovice_(Zdounky)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Cvr%C4%8Dovsk%C3%BD_potok.jpg","page_title":"Cvrčovice (Zdounky)","context_page_description":"Cvrčovice jsou malá moravská vesnice v okrese Kroměříž, spadající pod obec Zdounky. Trvale zde žije asi 160 obyvatel a celkem je zde kolem 70 obydlí."},{"page_url":"https://de.wikipedia.org/wiki/Pappel-Becherrindenschwamm","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Pappelbecher1.jpg","page_title":"Pappel-Becherrindenschwamm","context_page_description":"Der Pappel-Becherrindenschwamm oder Judas-Öhrchen ist ein Pilz und eine von sechs Arten der Gattung Schizophyllum aus der Familie der Schizophyllaceae."},{"page_url":"https://fr.wikipedia.org/wiki/Une_journ%C3%A9e_au_zoo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/ADayAtTheZooTitle.png","page_title":"Une journée au zoo","context_page_description":"Une journée au zoo est un cartoon Merrie Melodies réalisé par Tex Avery en 1939.\\nAvailable on the DVD Cartoon Craze: Bugs Bunny Volume 2."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%82%AC%EC%9D%B4%EC%8A%88%EB%82%98%EA%B0%80_%EC%99%95%EC%A1%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Vijayanagara_flag.png","page_title":"사이슈나가 왕조","context_page_description":"사이슈나가 왕조는 마가다 왕국의 세 번째 왕조이다. 하리얀카 왕조가 무너진 기원전 413년부터 난다 왕조가 들어선 기원전 345년까지 존속하였다."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D8%B3%D9%88%D9%84_%D8%B5%D8%BA%D9%8A%D8%B1_%D8%A7%D9%84%D8%B1%D8%A3%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Crassula_capitella_2.jpg","page_title":"كرسول صغير الرأس","context_page_description":"كرسول صغير الرأس هو نوع من النباتات يتبع جنس الكرسول من الفصيلة الكرسولية."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%96%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Rotating_earth_%28large%29.gif","page_title":"Жер","context_page_description":"Жер — Күн жүйесіндегі Күннен әрі қарай санағанда үшінші ғаламшар адамзаттың тіршілік ететін бесігі. Жер эллипстік орбита бойымен 29,765 км/с жылдамдықпен 149,6 млн. км орташа қашықтықта 365,24 орташа күн тәулігі ішінде Күнді бір рет айналып шығады. Оның табиғи серігі – Ай. Ай Жерді 384000 км орташа қашықтықта айналады. Жер осінің эклиптика жазықтығына көлбеулігі 66°33´22˝, оның өз осінен айналу периоды 23 сағ 56 мин 4,1 с. Жердің өз осінен айналуы себебінен Жерде күн мен түн ауысса, ал оның осінің орбита жазықтығына көлбеулігі мен Күнді айналуы салдарынан Жерде жыл мезгілдері өзгеріп отырады. Жердің жасы шамамен 4,5 млрд. жыл деп есептеледі. Жер Күнді айналып жүрген 9 планетаның ішінде мөлшері мен массасы бойынша 5 орында. Жердің массасы 5,975•1021 т, орташа тығыздығы 5,517 г/см³, көлемі 1,083 млрд. км³, ауданы 510,2 млн. км², сыртқы пішіні 3 осьті эллипсоидқа жақын. Осы күнгі космогониялық түсінік бойынша Жер осыдан 4,5 млрд. жыл бұрын Күн айналасындағы кеңістікте шашыраған газ-тозаң заттан, планеталар тартылыс күшінің әсерінен пайда болған. Қатты материя кесектерінің соқтығысып, жабысуынан планеталар ұлғая берген."},{"page_url":"https://pl.wikipedia.org/wiki/Karol_Otto_Kniaziewicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Karol_Otto_Kniaziewicz_1.PNG","page_title":"Karol Otto Kniaziewicz","context_page_description":"Karol Otto Kniaziewicz herbu własnego – generał dywizji Wojsk Polskich, uczestnik insurekcji kościuszkowskiej, jeden z dowódców Legionów Polskich we Włoszech, twórca i dowódca Legii Naddunajskiej, uczestnik kampanii napoleońskiej, działacz emigracyjny."},{"page_url":"https://pl.wikipedia.org/wiki/Sprawiedliwo%C5%9B%C4%87_Trajana_i_Sprawiedliwo%C5%9B%C4%87_Herkinbalda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Tapestry_portrait_of_Rogier_vand_der_Weyden.jpg","page_title":"Sprawiedliwość Trajana i Sprawiedliwość Herkinbalda","context_page_description":"Sprawiedliwość Trajana i Sprawiedliwość Herkinbalda – zniszczone obrazy niderlandzkiego malarza Rogiera van der Weydena i jego warsztatu. Dzieło było datowane na pierwszej tablicy rokiem 1439 oraz sygnowane – na pierwszej i trzeciej tablicy."},{"page_url":"https://fr.wikipedia.org/wiki/Luzerne_lupuline","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Medicago_lupulina_08_ies.jpg","page_title":"Luzerne lupuline","context_page_description":"La Luzerne lupuline est une plante herbacée annuelle ou bisannuelle, de la famille des Fabacées, assez commune dans les régions tempérées, parfois cultivée comme fourrage ou comme engrais vert."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BB%D0%B8%D0%BA%D0%B0%D1%82%D0%BD%D0%B8_%D0%BC%D0%B8%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Quartz_oisan.jpg","page_title":"Силикатни минерали","context_page_description":"Силикатните минерали ја сочинуваат најголемата и најзначајната класа на карпотворни минерали и околу 90% од Земјината кора. Тие се хемиски соединенија на силициумот со кислород и со некои минерали и широко се широко застапени во облик на стакло, порцелан, керамика и др. Се класификуваат во зависност од составот и распореденоста на нивната силикатна група."},{"page_url":"https://pl.wikipedia.org/wiki/Denzel_Whitaker","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Denzel_Whitaker_by_Gage_Skidmore.jpg","page_title":"Denzel Whitaker","context_page_description":"Denzel Dominique Whitaker – amerykański aktor filmowy i telewizyjny, raper, kompozytor i przedsiębiorca."},{"page_url":"https://pt.wikipedia.org/wiki/Br%C3%BChl","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Bruehl_Feuriger_Elias.jpg","page_title":"Brühl","context_page_description":"Brühl é uma cidade da Alemanha, localizada no distrito de Rhein-Erft-Kreis, estado da Renânia do Norte-Vestfália. Fica 20 km a Sul de Colónia. Fica localizada na margem da reserva natural \\"Naturpark Kottenforst-Ville\\"."},{"page_url":"https://de.wikipedia.org/wiki/%C3%96sterreich-Ungarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Wilhelm_Gause_Ball_der_Stadt_Wien_1904.jpg","page_title":"Österreich-Ungarn","context_page_description":"Die Österreichisch-Ungarische Monarchie, ungarisch Osztrák-Magyar Monarchia, kurz Österreich-Ungarn, informell auch k. u. k. Doppelmonarchie genannt, war eine Realunion in der letzten Phase des Habsburgerreiches in Mittel- und Südosteuropa für den Zeitraum zwischen 1867 und 1918. Sie bestand nach dem Umbau des Kaisertums Österreich zu einem Staatenverband auf der Grundlage des österreichisch-ungarischen Ausgleiches vom 8. Juni 1867 bis zum 31. Oktober 1918.\\nDie Österreichisch-Ungarische Monarchie setzte sich aus zwei Staaten zusammen: aus den im Reichsrat vertretenen Königreichen und Ländern, inoffiziell Cisleithanien, und den Ländern der Heiligen Ungarischen Krone, inoffiziell Transleithanien. Hinzu kam das seit 1878 von Österreich besetzte Gebiet Bosnien und Herzegowina, das 1908 als Kondominium nach langen Verhandlungen der Monarchie einverleibt wurde. Die verfassungsrechtlichen Ausgleichsvereinbarungen sicherten im Sinne einer Realunion die Gleichberechtigung der beiden Staaten im Verhältnis zueinander. Gemeinsames Staatsoberhaupt war der Kaiser von Österreich und Apostolische König von Ungarn aus dem Haus Habsburg-Lothringen."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%BE%9D%E7%B4%8D%E7%88%B5%C2%B7%E7%BE%85%E8%80%80%E6%8B%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Estandarte_del_Reino_de_Castilla.png","page_title":"依納爵·羅耀拉","context_page_description":"圣依纳爵‧罗耀拉，西班牙人，耶稣会创始人，罗马公教圣人之一。他在罗马公教会内进行改革，以对抗由马丁·路德等人所领导的宗教改革。"},{"page_url":"https://es.wikipedia.org/wiki/Partido_Radical_de_Chile","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Alexis_Sep%C3%BAlveda_Soto.jpg","page_title":"Partido Radical de Chile","context_page_description":"El Partido Radical de Chile ​​​​ es un partido político chileno laicista, liberal igualitario y socialista democrático. Se originó a partir de la derrota del bando rebelde en la Revolución de 1859, muchos de los cuales pertenecían al ala más subversiva del Partido Liberal. El 27 de diciembre de 1863 se fundó la primera Asamblea en Copiapó, precediendo a la instalación de diversas asambleas autodenominadas como \\"radicales\\" y que funcionaron en el territorio chileno con plena independencia electoral hasta la Convención Radical de 1888, ocasión en que dichas asambleas se federaron y legalizaron como un partido político. ​\\nEl radicalismo chileno se caracteriza por la difusión de una doctrina racionalista, laica y democrática, motivada por los ideales de la libertad, igualdad y fraternidad.​​\\nLos radicales han participado en coaliciones políticas tanto con la izquierda democrática como con la derecha liberal. En 1994 se fusionó con el Partido Socialdemocracia Chilena, y dio origen al Partido Radical Socialdemócrata, el cual fue considerado heredero de la historia y la tradición del radicalismo chileno hasta 2016, cuando retomó el nombre histórico de Partido Radical de Chile."},{"page_url":"https://cy.wikipedia.org/wiki/The_Dead_Weather","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Dead_Weather.jpg","page_title":"The Dead Weather","context_page_description":"Grŵp roc amgen yw The Dead Weather. Sefydlwyd y band yn Nashville, Tennessee yn 2009. Mae The Dead Weather wedi cyhoeddi cerddoriaeth ar label recordio Third Man Records."},{"page_url":"https://es.wikipedia.org/wiki/The_Cure","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Robert_Smith_of_The_Cure_live_in_Singapore_1_August_2007.jpg","page_title":"The Cure","context_page_description":"The Cure es una banda británica de rock formada en 1976 en Crawley.​ En sus orígenes, se llamó Easy Cure por un breve período, y ya figuraba en sus filas uno de sus tres fundadores y futuro líder, Robert Smith, como guitarra solista.​ El grupo alcanzó la cota más alta de su éxito comercial entre finales de la década de los ochenta y la primera mitad de la década de los noventa, aunque desde las siguientes dos décadas su producción musical ha ido en descenso.\\nDurante su extensa carrera, The Cure ha tenido múltiples cambios en su formación, siendo su alineación más popular la integrada entre 1986 y 1989 por el vocalista Robert Smith, el bajista Simon Gallup, el guitarrista Porl Thompson, el baterista Boris Williams y los teclistas Roger O'Donnell y Laurence Tolhurst, de los cuáles actualmente permanecen Smith, Gallup y O'Donnell, junto a Jason Cooper en la batería y Reeves Gabrels como guitarra solista. La apariencia característica de Smith, frecuentemente vestido de negro y maquillado con un efecto borroneado de lápiz de labios, sumada a letras introspectivas y existenciales, ​ han hecho que la banda fuera asociada generalmente con el rock gótico."},{"page_url":"https://es.wikipedia.org/wiki/Apristurus_atlanticus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Apristurus_laurussoni_distmap.png","page_title":"Apristurus atlanticus","context_page_description":"Apristurus atlanticus es una especie de peces de la familia Scyliorhinidae en el orden de los Carcharhiniformes."},{"page_url":"https://pt.wikipedia.org/wiki/Butorfanol","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Butorphanol.png","page_title":"Butorfanol","context_page_description":"Butorfanol é um fármaco agonista parcial utilizado pela medicina humana e pela medicina veterinária como analgésico opioide, é utilizado também para promover a analgesia em gatos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%83%D1%8E_%D0%B4%D1%83%D0%BC%D1%83_(2011)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Sergey_Shpilkin%2C_January_2018-2.jpg","page_title":"Выборы в Государственную думу (2011)","context_page_description":"Вы́боры депута́тов Госуда́рственной ду́мы Федера́льного собра́ния Росси́йской Федера́ции VI созы́ва состоялись 4 декабря 2011 года. Впервые Государственная дума избиралась на пять лет.\\nВыборы проходили по пропорциональной избирательной системе — все 450 депутатов избирались по партийным спискам по единому федеральному округу, а затем депутатские мандаты распределялись пропорционально проценту набранных партиями голосов. В качестве участников выборов были зарегистрированы все официально зарегистрированные в РФ политические партии. Последние выборы, на которых для полноценного представительства в Государственной Думе партиям было необходимо преодолеть семипроцентный барьер. Первые и последние выборы, на которых партии, набравшие от 5 до 6 % голосов, получали по одному мандату в Госдуме, набравшие от 6 до 7 % — два мандата. Ни одна из партий не смогла показать подобный результат. По результатам голосования все четыре партии, которые были представлены в нижней палате Федерального собрания V созыва, сохранили своё представительство в Госдуме VI созыва. При этом ни одна другая партия не смогла туда попасть."},{"page_url":"https://it.wikipedia.org/wiki/Ritratto_di_Gertrude_Stein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Gertrude_Stein_statue_in_NYC_%28cropped%29.jpg","page_title":"Ritratto di Gertrude Stein","context_page_description":"Ritratto di Gertrude Stein è un dipinto a olio su tela realizzato nel 1905–1906 dal pittore spagnolo Pablo Picasso.\\nConservato nel Metropolitan Museum of Art di New York, il quadro è considerato dai critici come l'opera che precorse il Cubismo.\\nIl soggetto, la scrittrice statunitense Gertrude Stein, fu una cara amica di Picasso nonché collezionista di quadri cubisti e prima vera mecenate e sostenitrice delle opere del pittore spagnolo.\\nLa forte personalità della Stein, che rimase poi proprietaria della tela fino alla morte, fu rappresentata da Picasso grazie all'evidenziamento dei suoi profondi occhi neri.\\nPare che nel realizzare questo dipinto Picasso abbia esitato a lungo prima di realizzare il volto che come si può notare è molto diverso dal resto del dipinto, soprattutto dalle mani. Dall'analisi della pittura infatti- e alcune testimonianze dell'epoca lo confermerebbero- emerge che la testa sia addirittura stata cancellata e ridipinta.\\nIn effetti si ritrovano nei tratti duri e irrealisti le influenze dell'arte africana ed il germe del cubismo.\\nLo sviluppo di questa tendenza nell'arte di Picasso si avrà l'anno successivo con Les demoiselles d'Avignon."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AE%E0%B3%87%E0%B2%B2%E0%B3%8B%E0%B2%97%E0%B2%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Red_roast_duck_curry.jpg","page_title":"ಮೇಲೋಗರ","context_page_description":"ಮೇಲೋಗರ ಎಂಬುದು ವೈವಿಧ್ಯಮಯವಾದ ಮಸಾಲೆಯುಕ್ತ ಭಕ್ಷ್ಯಗಳನ್ನು ವಿವರಿಸಲು ಪಾಶ್ಚಾತ್ಯ ಸಂಸ್ಕೃತಿಯ ಉದ್ದಕ್ಕೂ ಬಳಸಲಾಗುವ ಒಂದು ಸಾರ್ವತ್ರಿಕ ವಿವರಣೆಯಾಗಿದ್ದು, ವಿಶೇಷವಾಗಿ ಭಾರತೀಯ, ಪಾಕಿಸ್ತಾನಿ ಅಥವಾ ಇತರ ದಕ್ಷಿಣ ಏಷ್ಯಾದ ಪಾಕಪದ್ಧತಿಗಳಿಗೆ ಸೇರಿದ ಮಸಾಲೆಯುಕ್ತ ಭಕ್ಷ್ಯಗಳನ್ನು ವಿವರಿಸಲು ಇದನ್ನು ಬಳಸಲಾಗುತ್ತದೆ. ಅರಿಶಿನ, ಧನಿಯಾ, ಮತ್ತು ಜೀರಿಗೆ ಇವು ಬಹುತೇಕ ಮಸಾಲೆ ಪುಡಿಗಳಲ್ಲಿ ಕಂಡುಬರುವ ಮೂರು ಮಸಾಲೆಗಳಾಗಿವೆ; ಭೌಗೋಳಿಕ ಪ್ರದೇಶ ಮತ್ತು ಸೇರ್ಪಡೆಗೊಳ್ಳುತ್ತಿರುವ ಆಹಾರಗಳನ್ನು ಅವಲಂಬಿಸಿ ಹೆಚ್ಚುವರಿ ಮಸಾಲೆಗಳ ಒಂದು ವ್ಯಾಪಕ ಶ್ರೇಣಿಯನ್ನು ಇದರಲ್ಲಿ ಸೇರಿಸಬಹುದು. \\"ಮೇಲೋಗರ\\" ಎಂಬ ಆಹಾರಶೈಲಿಯನ್ನು ರೂಪಿಸುವಂಥ ಯಾವುದೇ ನಿರ್ದಿಷ್ಟ ಘಟಕವಸ್ತುವಿನ ಅಸ್ತಿತ್ವವೂ ಇಲ್ಲಿ ಕಂಡುಬರುವುದಿಲ್ಲವಾದ್ದರಿಂದ, \\"ಮೇಲೋಗರ\\" ಎಂಬ ಪದವು \\"ಎಸರು\\" ಅಥವಾ \\"ಮಾಂಸಭಕ್ಷ್ಯ\\" ಎಂಬುದಕ್ಕೆ ಹೋಲುವಂತಿದೆ.\\nಅಂತರರಾಷ್ಟ್ರೀಯ ಪಾಕಪದ್ಧತಿಯಲ್ಲಿ ಎದ್ದುಕಾಣುವಂತೆ ಗುರುತಿಸಿಕೊಳ್ಳುವ ಸಲುವಾಗಿ, ಇತ್ತೀಚಿನ ದಶಕಗಳಲ್ಲಿ ಮೇಲೋಗರದ ಜನಪ್ರಿಯತೆಯು ಭಾರತೀಯ ಉಪಖಂಡದಿಂದ ಆಚೆಗೆ ಹರಡಿಕೊಂಡಿದೆ. ಇದರ ಪರಿಣಾಮವಾಗಿ, ಅದರದ್ದೇ ಆದ ಅನನ್ಯ ರುಚಿಗಳು ಮತ್ತು ಸಾಂಸ್ಕೃತಿಕ ಸಂವೇದನಾ ಶಕ್ತಿಗಳಿಗೆ ಹೊಂದಿಕೊಳ್ಳುವ ಸಲುವಾಗಿ ಪ್ರತಿಯೊಂದು ಸಂಸ್ಕೃತಿಯೂ ತನ್ನ ಸ್ಥಳೀಯ ಅಡುಗೆಯಲ್ಲಿ ಮಸಾಲೆಗಳನ್ನು ಅಳವಡಿಸಿಕೊಂಡಿದೆ. ಥಾಯ್‌ ಜನರ, ಬ್ರಿಟಿಷರ, ಜಪಾನಿಯರ ಮತ್ತು ಜಮೈಕನ್ನರ ಪಾಕಪದ್ಧತಿಗಳಲ್ಲಿ ಮೇಲೋಗರವು ಭರ್ಜರಿ ಜನಪ್ರಿಯತೆಯನ್ನು ಗಳಸಿಕೊಂಡಿರುವುದರಿಂದ, ಅದನ್ನು ಅಖಿಲ-ಏಷ್ಯಾದ ಅಥವಾ ಜಾಗತಿಕ ಮಟ್ಟದ ಒಂದು ವಿದ್ಯಮಾನ ಎಂದು ಕರೆಯಬಹುದು."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/KG_Ag_Evrazes_a.jpg","page_title":"Памятные монеты Киргизии","context_page_description":"Памятные и юбилейные монеты выпускаются Национальным банком Кыргызской Республики из драгоценных и недрагоценных металлов, начиная с 1995 года, когда были выпущены две монеты, посвящённые 1000-летию эпоса «Манас».\\nМонеты посвящены, в основном, различным достопримечательностям и символам Киргизии. НБКР также выпускал монеты в рамках международных монетных программ стран ЕврАзЭС. Инвестиционные монеты не выпускались.\\nВ связи с отсутствием в стране собственного монетного двора, все монеты чеканятся за рубежом, на монетных дворах Великобритании, Казахстана, Литвы, Польши, России и Словакии."},{"page_url":"https://br.wikipedia.org/wiki/Aerodramus_fuciphagus","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/SwiftletBirdNests.jpg","page_title":"Aerodramus fuciphagus","context_page_description":"Aerodramus fuciphagus a zo ur spesad evned bihan eus ar c'herentiad Apodidae."},{"page_url":"https://ast.wikipedia.org/wiki/Pulau_Pramuka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Dermaga_Pulau_Pramuka.jpg","page_title":"Pulau Pramuka","context_page_description":"Pulau Pramuka ye una islla que forma parte de la rexencia de Xakarta conocida como Islles Seribu nel mar de Java, Indonesia, cerca de les islles Pulau Sekati, Pulau Karya y Pulau Karangkeling."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%AA%D8%A7%D9%86%D9%83%D9%88%D8%B1%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/In_Betancuria.jpg","page_title":"بيتانكوريا","context_page_description":"بلدية بيتانكوريا هي بلدية تقع في مقاطعة لاس بالماس التابعة لمنطقة جزر الكناري جنوب غرب إسبانيا."},{"page_url":"https://it.wikipedia.org/wiki/Carabiniere_(F_593)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/F593_Nave_Carabiniere.jpg","page_title":"Carabiniere (F 593)","context_page_description":"Il Carabiniere è una fregata missilistica della Marina Militare specializzata nella lotta antisommergibile. L'unità è intitolata all'Arma dei carabinieri, quarta delle Forze armate italiane ed è stata varata il 29 marzo 2014 in virtù dell'approssimarsi del bicentenario di fondazione dell'Arma dei carabinieri, 1814-2014. La nave appartiene al gruppo ASW della classe Bergamini, insieme alle altre unità Virginio Fasan, Carlo Margottini e Alpino."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D9%81%D8%B1%D8%B3%D9%86%D9%88_(%D8%B3%DB%8C%E2%80%8C%D8%A7%D9%84-%DB%B1%DB%B2%DB%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/USS_Fresno_%28CL-121%29_at_Dublin%2C_Ireland%2C_in_May_1948_%2880-G-K-9384%29.jpg","page_title":"یواس‌اس فرسنو (سی‌ال-۱۲۱)","context_page_description":"یواس‌اس فرسنو (سی‌ال-۱۲۱) یک کشتی بود که طول آن ۵۴۱ فوت ۶ اینچ بود. این کشتی در سال ۱۹۴۶ ساخته شد."},{"page_url":"https://en.wikipedia.org/wiki/List_of_vacuum_cleaners","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Central_vacuum_system.jpg","page_title":"List of vacuum cleaners","context_page_description":"This is a list of vacuum cleaners and vacuum cleaner manufacturers. A vacuum cleaner is a device that uses an air pump to create a partial vacuum to suck up dust and dirt, usually from floors, and optionally from other surfaces as well. The dirt is collected by either a dustbag or a rigid cartridge, which may be emptied and reused. Vacuum cleaners are used in homes as well as in industry, and exist in a variety of sizes and models."},{"page_url":"https://ca.wikipedia.org/wiki/Sigmund_L%C3%B6w","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/De_schilder_Hendrik_Maarten_Krabb%C3%A9_in_zijn_atelier%2C_gefotografeerd_door_Sigmund_L%C3%B6w_in_1903.jpg","page_title":"Sigmund Löw","context_page_description":"Sigmund Löw, fou un fotògraf alemany.\\nLöw i la seva esposa Sofia Herz Herz va fundar el 1869 l'Estudi _Herz a Baden-Baden. Es van establir el 1879 amb el seu marxant d'art a Amsterdam. Des de 1892, Löw va treballar com a fotògraf, i es dedicà a les targetes de visita, les fotografies de gabinet i estereoscòpiques."},{"page_url":"https://en.wikipedia.org/wiki/Haute-Loire","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/F08.Brioude.0049.jpg","page_title":"Haute-Loire","context_page_description":"Haute-Loire is a department in the Auvergne-Rhône-Alpes region of south-central France. Named after the Loire River, it is surrounded by the departments of Loire, Ardèche, Lozère, Cantal and Puy-de-Dôme. In 2016, it had a population of 227,339; its inhabitants are called Altiligériens in French.\\nThe department, which has its prefecture in Le Puy-en-Velay, covers the upper reaches of the Loire and consists of the Loire Valley and the surrounding mountains in the Massif Central. It is one of the original 83 departments of France created in 1790 during the French Revolution. Parts of the department are included in the Livradois-Forez Regional Natural Park."},{"page_url":"https://it.wikipedia.org/wiki/La_guerra_%C3%A8_una_mafia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Laguerra%C3%A8unamafiaita_.jpg","page_title":"La guerra è una mafia","context_page_description":"La guerra è una mafia è un discorso e un libro del 1935, di Smedley D. Butler, un Maggiore Generale in pensione del Corpo dei Marines degli Stati Uniti e due volte vincitore della Medal of Honor. Sulla base della sua esperienza militare, Butler discute di come gli interessi commerciali traggano vantaggio dalla guerra, come nel caso della speculazione bellica.\\nDopo che Butler si ritirò dal Corpo dei Marines degli Stati Uniti nell'ottobre del 1931, iniziò un tour nazionale portando il suo discorso \\"War is a Racket\\". Il discorso ebbe così tanto successo che scrisse una versione più lunga, che fu poi pubblicata come libro nel 1935.\\nIl suo lavoro fu inserito in versione breve nel Reader's Digest come un supplemento di libro, che aiutò a rendere popolare il suo messaggio. In un'introduzione alla versione di Reader's Digest, Lowell Thomas, che ha scritto la sua autobiografia orale, ha elogiato il \\"coraggio morale e fisico\\" di Butler."},{"page_url":"https://fr.wikipedia.org/wiki/Grotte_des_Esp%C3%A9lugues","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Cheval_de_Lourdes.jpg","page_title":"Grotte des Espélugues","context_page_description":"La grotte des Espélugues est une grotte d'occupation préhistorique située sur la commune française de Lourdes, dans le département des Hautes-Pyrénées en région Occitanie. En 1793, les ossements extraits servent à la fabrication de poudre."},{"page_url":"https://nl.wikipedia.org/wiki/Koninklijke_Muziekmaatschappij_Sint-Cecilia_Koolskamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Harmonie_koolskamp_2011.jpg","page_title":"Koninklijke Muziekmaatschappij Sint-Cecilia Koolskamp","context_page_description":"De Koninklijke Muziekmaatschappij Sint-Cecilia Koolskamp is een Belgisch harmonie-orkest uit Koolskamp, een deelgemeente van Ardooie. Hierin spelen houtblazers, koperblazers en slagwerkers, sinds 2018 onder leiding van dirigent Nathan Feys.\\nDe harmonie omvat ook een drumband, sinds 2016 onder leiding van Matthias Grymonpon.\\nJaarlijks zijn er concerten met nieuwe concertstukken. Tussendoor worden ook heel wat evenementen muzikaal ingelijst door de harmonie.\\nDe harmonie bestaat anno 2019 uit een 65-tal amateurmuzikanten."},{"page_url":"https://hr.wikipedia.org/wiki/Novozelandska_subantarkti%C4%8Dka_oto%C4%8Dja","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Antipodes_Islands.jpg","page_title":"Novozelandska subantarktička otočja","context_page_description":"Novozelandska subantarktička otočja je zajednički naziv za pet otočja najjužnijih otoka Novog Zelanda koji su zajedno upisani na UNESCO-v popis mjesta svjetske baštine u Australiji i Oceaniji 1998. god. Većina njihovih otoka se nalazi na južnoj i istočnoj ivici podvodnog kontinenta koji okružuje Novi Zeland, Zelandije, koji se prije oko 130-85 milijuna godina, zajedno s Australijom, odvojio od Antarktike, a prije 60-85 milijuna godina odvojio i od Australijskog kontinenta. Kako su smješteni na mjestu sudara tektonskih ploča i miješanja antarktičke i suptropskih morskih struja, otoci imaju veliku razinu produltivnosti, bioraznolikosti, gustoće divljih životinja, te endemičnosti ptica, biljaka i beskralježnjaka. Kao kod njima sličnog i zemljopisno bliskog australskog otoka Macquarie. Najveća je raznolikost pelagijskih morskih ptica i pingvina, dok od 126 ukupnih vrsta ptica čak 40 vrsta se ne gnijezde nigdje drugdje u svijetu.\\nOva otočja su nenastanjena, a tek iznimno ih posjećuju turisti i istraživači:"},{"page_url":"https://da.wikipedia.org/wiki/Lignin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Arboform-2.jpg","page_title":"Lignin","context_page_description":"Lignin af latin lignum = \\"træstof\\", \\"ved\\". Lignin virker – populært sagt – som \\"betonen\\" i en cellevæg, hvor cellulose og hemicellulose svarer til \\"armeringsjern\\". Ligninerne danner en gruppe af fenoliske makromolekyler, der er sammensat af forskellige monomere byggestene. Det drejer sig om faste biopolymerer, som bliver indlejret i planternes cellevæg, hvor de fremkalder forvedningen af cellen. Ca. 20-30 % af tørstoffet i forveddede planter består af lignin, og dermed er stoffet ved siden af cellulose og kitin de mest almindeligt forekommende, organiske forbindelser på jorden. Den totale produktion af lignin antages at være på ca. 20 milliarder tons pr. år.\\nDa ligninerne er væsentlige for plantevævenes styrke, er udviklingen af de landlevende planter og især træerne meget nøje forbundet med dannelsen af lignin. Kun med lignin kan planterne danne styrkeelementer, som giver større plantedele stabilitet udenfor vandet – i vandet sørger opdriften for den nødvendige stabilitet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%8A%B1%E5%AD%90%E7%94%98%E8%97%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Spruitjes.jpg","page_title":"抱子甘藍","context_page_description":"抱子甘藍，又稱球芽甘藍，俗稱小洋白菜、小圓白菜、小捲心菜、小椰菜，是一種蔬菜，味道微苦。煮過的小洋白菜在西餐中常做配菜。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%80%D0%B8%D0%BD%D0%BA%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Syrinx.jpg","page_title":"Сиринкс","context_page_description":"Сиринкс — голосовой орган птиц. Расположен в основании трахеи. В отличие от млекопитающих, у птиц отсутствуют голосовые связки. Звук издаётся вследствие вибраций тимпанальных мембран и козелка, вызываемых продуванием воздуха через сиринкс. Специальные мышцы способны изменять натяжение мембран и диаметр просвета бронхов, что приводит к изменению издаваемого звука.\\nСиринкс получил название от Томаса Генри Гексли в середине XIX века.\\nСиринкс мог появиться у ранних птиц или ещё у их предков-динозавров. Он редко сохраняется в ископаемом состоянии, но иногда благодаря минерализации его колец это случается. По состоянию на 2016 год известны находки сиринкса позднемеловой птицы вегависа, эоценовой птицы пресбиорниса и ряд намного более молодых находок."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_%C3%BCber_die_Albula","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Via_Zinols_Br%C3%BCcke_%C3%BCber_die_Albula%2C_Filisur_GR_20190817-jag9889.jpg","page_title":"Liste der Brücken über die Albula","context_page_description":"Die Liste der Brücken über die Albula enthält die Brücken von der Quelle westlich des Albulapasses bis zur Mündung in den Hinterrhein bei Fürstenaubruck."},{"page_url":"https://sv.wikipedia.org/wiki/Bil","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Exhaust.jpg","page_title":"Bil","context_page_description":"Bil är ett motorfordon som är försett med åtminstone tre hjul, och som inte är en mopedbil, en jordbruksmaskin eller ett stridsfordon. Bilar delas in i personbilar, lastbilar och bussar. Från början användes benämningen automobil, från grekiskans αὐτός, autós, \\"själv\\" och latinets móbilis, \\"rörlig\\". Förkortningen \\"bil\\" skapades i den danska tidningen Politiken, 1902.\\n2010 uppskattades att antalet bilar hade ökat till över 1 miljard fordon, upp från 500 miljoner 1986. Siffrorna ökar snabbt, särskilt i Kina, Indien och andra nya industriländer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D1%8F_2010_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/M_6.6_-_Moro_Gulf%2C_Mindanao%2C_Philippines.jpg","page_title":"Землетрясения 2010 года","context_page_description":"В результате землетрясений в 2010 году погибли и пропали без вести по разным оценкам от 226 050 до 320 120 человек. Наибольшее количество жертв возникло в результате землетрясения на Гаити, которое по разным оценкам унесло жизни от 222 570 до 316 000 человек и стало крупнейшим по количеству жертв с 1900 года. Кроме того, одним из наиболее значительных землетрясений 2010 года считается землетрясение в Чили магнитудой 8,8, ставшее на тот момент седьмым сильнейшим землетрясением с 1900 года. Предупреждения о цунами, вызванном этим землетрясением, были опубликованы во всём тихоокеанском регионе, в том числе в странах, территориально расположенных в зоне тихоокеанского вулканического огненного кольца."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%B1%D1%83%D1%81%D1%82%D0%B0%D0%BD_(%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Gobustan_State_Historical-Artistic_Reserve.jpg","page_title":"Гобустан (заповедник)","context_page_description":"Гобустан, или Гобустанский государственный историко-художественный заповедник — археологический заповедник в Азербайджане, к югу от Баку, на территории Карадагского и Апшеронского районов, представляющий собой равнину, расположенную между юго-восточным склоном Большого Кавказского хребта и Каспийским морем, и частью которой является культурный пейзаж наскальных рисунков, расположенный на территории 537 гектаров.\\nПамятники Гобустана делятся на две группы: 1) наскальные изображения и 2) древние стоянки и другие объекты. В горах Гобустана под названиями Беюкдаш, Кичикдаш, Джингирдаг, Шонгардаг и Шихгая сосредоточены свидетельства о жителях региона эпохи каменного века и последующих периодов — наскальные изображения, стоянка человека, надгробные памятники и др. Здесь находятся также остатки большого доисторического кромлеха, которые отчётливо прослеживаются. Рисунки были найдены на трёх участках скалистого плато, а обнаруженные здесь же некогда обитаемые пещеры, следы поселений и усыпальницы указывают на густую заселённость этой территории в период между верхним палеолитом и средневековьем."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_bisericilor_fortificate","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Sankt_Ols_ydre5.jpg","page_title":"Lista bisericilor fortificate","context_page_description":"Aici găsiți o listă neexaustivă de Biserici fortificate europene și chiar extraeuropene."},{"page_url":"https://en.wikipedia.org/wiki/N_V_Sathyanarayana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/N_V_Sathyanaraya.jpg","page_title":"N V Sathyanarayana","context_page_description":"N V Sathyanarayana, popularly known as Sathya, is an information entrepreneur and the founder of Informatics Limited. He is currently the Chairman and Managing Director of Informatics, a company providing library services and research software."},{"page_url":"https://eo.wikipedia.org/wiki/Stabestro_de_la_Blanka_Domo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jacob_Lew.jpg","page_title":"Stabestro de la Blanka Domo","context_page_description":"La Stabestro de la Blanka Domo estas la plej altranga oficisto en la Blanka Domo; la Stabestro estas Asistanto al la Prezidento, kaj la posteno havas ministran rangon.\\nLa nuna Stabestro estas Jacob Lew, kiu enposteniĝis la 27-an de januaro, 2012, post la demisio de William M. Daley."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%83%A1%E5%AE%89%C2%B7%E9%A6%AC%E4%B8%81%C2%B7%E5%BE%B7%E7%88%BE%E6%B3%A2%E7%89%B9%E7%BE%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Juan_Del_Potro_2007_Australian_Open.jpg","page_title":"胡安·馬丁·德爾波特羅","context_page_description":"胡安·馬丁·德爾波特羅，阿根廷職業男子網球運動員，也是阿根廷國內排名最高的男子網球運動球員。於2009年美國網球公開賽決賽中擊敗賽會五屆冠軍費德勒奪得冠軍，是男子網壇第一位在男單比賽中連勝納達爾和費德勒奪得最後冠軍的球員，繼1977年維拉斯之後，第一位奪得大滿貫冠軍的阿根廷球員。\\n德爾波特羅常被媒體和評論家稱之為「德波」和「坦迪爾之塔」。在中國，由於名字諧音以及多體毛的特徵，媒體和粉絲們暱稱其為「大菠蘿」或「大師兄」。由於其發球威力大、技術全面，身材高大但移動靈活，心理素質穩定，2009年奪得美網冠軍之後，被媒體認為是費德勒之後下一代球王的熱門人選。但由於職業生涯飽受腕傷困擾，參賽計劃走走停停，最低排名曾跌至200名外，但他仍然是四巨頭最有力的挑戰者，曾多次打敗四巨頭成員，與四巨頭的對戰成績為20勝51負，對戰成績雖處下風但並不像其他球員那麼懸殊。\\n截止至2015年賽季，德爾波特羅獲得了包括大滿貫在內的18個巡迴賽單打冠軍，於2009年的年終總決賽中獲得了亞軍。另外，他還是2016年裡約奧運會網球項目單打銀牌得主、2012年倫敦奧運會網球項目單打銅牌得主。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D9%83_%DA%A4%D9%8A%D8%B1%DA%A4%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Marc_Vervenne_576.jpg","page_title":"مارك ڤيرڤين","context_page_description":"مارك ڤيرڤين عالم لاهوت و استاذ جامعى من بلجيكا."},{"page_url":"https://gl.wikipedia.org/wiki/Paradoxo_de_Hempel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Fuji_apple.jpg","page_title":"Paradoxo de Hempel","context_page_description":"O paradoxo do corvo é un paradoxo proposto polo filósofo Alemán Carl Hempel na década de 1940 para ilustrar un problema onde a lóxica indutiva desafía á intuición. Este paradoxo coñécese tamén como paradoxo da negación ou paradoxo de Hempel.\\nCando durante milleiros de anos a xente observou feitos que se acomodan ben no marco dunha teoría como a lei da gravidade, tendemos a crer que dita teoría ten unha alta probabilidade de ser certa e a nosa confianza nela aumenta con cada nova observación que se axusta a ela. Este tipo de razoamento pode sintetizarse no principio de indución:\\nSe se observa un caso particular X consistente coa teoría T, entón a probabilidade de que T sexa certa aumenta.\\nHempel dá un exemplo do principio de indución. Propón como teoría \\"Todos os corvos son negros\\". Se agora examinamos a un millón de corvos, e observamos que todos son negros, a nosa crenza na teoría \\"todos os corvos son negros\\" crecerá lixeiramente con cada observación. Neste caso, o principio de indución parece razoábel.\\nAgora ben, a afirmación \\"todos os corvos son negros\\" é equivalente en lóxica á afirmación \\"todas as cousas non negras non son corvos\\"."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D1%81%D1%82%D0%B0%D0%B2%D0%B0_M59/66","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Yugoslavian_SKS_M59_66.JPG","page_title":"Застава M59/66","context_page_description":"Застава M59/66 или популарно паповка, је југословенска верзија совјетске пушке СКС."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D9%83%D8%B2_%D8%B4%D9%86%D8%BA%D8%A7%D9%81%D9%8A%D8%AA_%D8%A7%D9%84%D8%B7%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Shengavit_Medical_Center_-_%D5%87%D5%A5%D5%B6%D5%A3%D5%A1%D5%BE%D5%AB%D5%A9_%D5%A2%D5%AA%D5%B7%D5%AF%D5%A1%D5%AF%D5%A1%D5%B6_%D5%AF%D5%A5%D5%B6%D5%BF%D6%80%D5%B8%D5%B6.jpg","page_title":"مركز شنغافيت الطبي","context_page_description":"مركز شنغافيت الطبي، هو واحد من المرافق العلاجية والتشخيصية الخاصة متعددة التخصصات في يريفان، قاعدة التدريب بعد التخرج السريري لجامعة يريفان الطبية الحكومية والمعهد الوطني للصحة. يدير المركز الخدمات التالية: التوليد، أمراض النساء التنظيرية، جراحة الأورام، جراحة الأعصاب، الجراحة العامة والجراحة بالمنظار، الجراحة الدقيقة والبلاستيكية، جراحة الأوعية الدموية، طب العيون، الأنف والأذن والحنجرة، التخدير وطب الرعاية الحرجة، طب الأسنان، مركز التشخيص، المختبرات الطبية. المتاحة هي 65 سريرا. في المتوسط يوجد 7000 مريض في السنة."},{"page_url":"https://en.wikipedia.org/wiki/Tutuban_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Historical_Marker_of_the_old_Tutuban_Railway_Station.JPG","page_title":"Tutuban station","context_page_description":"Tutuban station, also known as the Manila station or Divisoria station is the main train station of the Philippine National Railways located in the City of Manila, Philippines.\\nThe name refers to two stations: the original Tutuban station, which today forms part of Tutuban Center, and the PNR Executive Building, which houses PNR offices and serves as the current terminus of all PNR services."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre-Adolphe_Pinsonnault","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Msgn_Pinsonnault.jpg","page_title":"Pierre-Adolphe Pinsonnault","context_page_description":"Pierre-Adolphe Pinsonnault fut le premier évêque de London en Ontario."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_%C3%A9glises_de_la_Haute-Garonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Billi%C3%A8re_-_Eglise_Saint-Barth%C3%A9l%C3%A9my_-_01.jpg","page_title":"Liste des églises de la Haute-Garonne","context_page_description":"La liste des églises de la Haute-Garonne recense de manière exhaustive les églises situées dans le département français de la Haute-Garonne.\\nToutes sont situées dans le diocèse de Toulouse."},{"page_url":"https://ca.wikipedia.org/wiki/Kh%C3%A9misset","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Nature_kh%C3%A9misset.JPG","page_title":"Khémisset","context_page_description":"Khémisset és un municipi de la província de Khémisset, a la regió de Rabat-Salé-Kenitra, al Marroc. Segons el cens de 2014 tenia una població total de 131.542 persones. Es troba a 86 kilòmetres de Rabat, a 55 de Meknès i a 120 de Fes. La majoria de la població és amaziga i parla el tamazight del Marroc Central."},{"page_url":"https://es.wikipedia.org/wiki/Gallina_de_Mos","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Gali%C3%B1a_de_Mos.JPG","page_title":"Gallina de Mos","context_page_description":"La galiña de Mos es una raza de gallina española originaria de Galicia. Toma su nombre, de forma casual, de la parroquia de Mos, en el ayuntamiento lucense de Castro de Rey. Es un ave de formas redondeadas, pecho amplio y gran abundancia de masas musculares en todo el cuerpo, que soporta bien las duras condiciones del invierno. Se le observa una producción de huevos escasa, no obstante, aunque de crecimiento lento, es de excelente aptitud cárnica. Se encuentra en peligro de extinción, aunque el número de ejemplares ha aumentado considerablemente en 7 años.​"},{"page_url":"https://de.wikipedia.org/wiki/Couzinet_70","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Avion_Couzinet_70_a_l%27atterrissage.jpg","page_title":"Couzinet 70","context_page_description":"Die Couzinet 70 war ein französisches Postflugzeug, das 1932 seinen Erstflug absolvierte. Die dreimotorige Maschine war zum größten Teil aus Holz gefertigt und überquerte am 16. Januar 1933 unter Jean Mermoz den Südatlantik von Saint-Louis nach Natal. Der Konstrukteur der Maschine, René Couzinet, gehörte zu der vierköpfigen Besatzung auf dem Flug über 3180 km in 14:25 h.\\nDer Rückflug begann am 15. Mai. Am 21. Mai 1933 landete die Maschine in Le Bourget vor 15.000 Zuschauern. Das überholte und umgebaute Flugzeug führte 1934 als Couzinet 71 drei weitere Hin- und Rückflüge über den Südatlantik im Dienst der Air France durch."},{"page_url":"https://en.wikipedia.org/wiki/5.45%C3%9739mm","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/RussianWP.jpg","page_title":"5.45×39mm","context_page_description":"The 5.45×39mm cartridge is a rimless bottlenecked intermediate cartridge. It was introduced into service in 1974 by the Soviet Union for use with the new AK-74. The 5.45×39mm gradually supplemented, then largely replaced the 7.62×39mm cartridge in Soviet and Warsaw Pact service as the primary military service rifle cartridge."},{"page_url":"https://sv.wikipedia.org/wiki/Acacia_pulchella","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Acacia_pulchella_1.jpg","page_title":"Acacia pulchella","context_page_description":"Acacia pulchella är en ärtväxtart som beskrevs av Robert Brown. Acacia pulchella ingår i släktet akacior, och familjen ärtväxter."},{"page_url":"https://es.wikipedia.org/wiki/Jos%C3%A9_Alonso_y_Trelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Autocaricatura_de_Jos%C3%A9_Alonso_y_Trelles_%2809-12-1894%29.jpg","page_title":"José Alonso y Trelles","context_page_description":"José María Alonso y Trelles Jarén, conocido como «El Viejo Pancho», fue un escritor y poeta gauchesco uruguayo de origen español.\\nRadicado en su juventud en la localidad uruguaya de Tala, tuvo a su cargo las publicaciones satíricas El Tala Cómico y Momentáneas. Sus aportes literarios más importantes se dieron en el campo de la lírica, que cultivó en la forma de poesía gauchesca y a la que contribuyó ampliamente a través de los semanarios tradicionalistas El Terruño, El Fogón y El Ombú. En 1915 publicó su obra maestra, Paja brava, en la cual recopiló la mayoría de sus textos del mencionado género. Hacia el final de sus días ocupó una banca como diputado por el departamento de Canelones."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%80%D0%BA%D0%B5_(%D0%BB%D1%83%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Pirquet_LROC.jpg","page_title":"Пирке (лунный кратер)","context_page_description":"Кратер Пирке — крупный древний ударный кратер в южном полушарии обратной стороны Луны. Название присвоено в честь австрийского ученого в области космонавтики Гвидо фон Пирке и утверждено Международным астрономическим союзом в 1970 г. Образование кратера относится к нектарскому периоду."},{"page_url":"https://ca.wikipedia.org/wiki/Esparver_grec","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Accipiter_brevipes_1.jpg","page_title":"Esparver grec","context_page_description":"L'esparver grec és un ocell de la família dels accipítrids que habita boscos poc densos i terres de conreu d'Europa sud-oriental i Àsia Occidental, a la Península Balcànica incloent Grècia, oest de Turquia, i des del sud d'Ucraïna cap a l'est fins al Kazakhstan. Hiverna a l'Àfrica Oriental."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D1%81%D0%BA%D0%B8_%D0%BA%D1%80%D0%B0%D0%BB%D0%B5%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Portrait_Roy_de_france_Chilperic_II.jpg","page_title":"Список на француски кралеви","context_page_description":"Ова е список на кралеви на Франција, распоредени по хронолошки редослед, од соодветните династии.\\nФранцуските монарси владееле од воспоставувањето на Франкија во 486 па сè до 1870. Во текот на поголемиот дел од својата историја, Франција била под власт на кралевите. Сепак, четворица каролиншки монарси биле исто така и цареви на Светото римско царство а династијата Бонапарти биле цареви.\\nВо оваа статија се содржат сите владетели кои ја имале титулата „Крал на Франките“, „Крал на Франција“, „Крал на Французите“ или „Цар на Французите“. За другите франкиски монарси, види Список на франкиски кралеви.\\nКако дополнување на туканаведените монарси, Кралевите на Англија и Британија од 1340–1360 и 1369–1801 исто така ја барале титулата Крал на Франција. Кусо време, тоа барање имало основа in fact — под условите на Троанскиот договор од 1420, кога Шарл VI го признал својот зет Хенри V од Англија за регент и наследник. Хенри V починал пред Шарл VI па така синот на Хенри V, Хенри VI од Англија, го наследил својот дедо Шарл VI како Крал на Франција."},{"page_url":"https://en.wikipedia.org/wiki/Cab_Secure_Radio","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/CSR_01.jpg","page_title":"Cab Secure Radio","context_page_description":"Cab Secure Radio was an in-cab analogue radiotelephone system formerly used on parts of the British railway network. Its main function was to provide a secure speech link between the train driver and the signaller which could not be overheard by other train drivers. In areas where CSR was used it had to be the primary method of communication between driver and signaller, always being used in preference to the signal post telephone. CSR was replaced by the GSM-R digital system, forming the initial phase of rollout of ERTMS throughout the UK."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B7%CE%BB%CE%B9%CE%B4%CE%BF%CE%B2%CE%BF%CF%8D%CF%84%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Gavia_stellata_map.png","page_title":"Κηλιδοβούτι","context_page_description":"Το Kηλιδοβούτι είναι υδρόβιο πτηνό της οικογενείας των Κολυμβιδών, που απαντάται και στον ελλαδικό χώρο. Η επιστημονική ονομασία του είδους είναι Gavia stellata και δεν περιλαμβάνει υποείδη."},{"page_url":"https://en.wikipedia.org/wiki/Scott_Moir","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/2014_Winter_Olympics_-_Tessa_Virtue_and_Scott_Moir_-_05.jpg","page_title":"Scott Moir","context_page_description":"Scott Patrick Moir is a retired Canadian ice dancer. With ice dance partner Tessa Virtue, he is the 2010 and 2018 Olympic champion, the 2014 Olympic silver medalist, a three-time World champion, a three-time Four Continents champion, the 2016–17 Grand Prix Final champion, an eight-time Canadian national champion, and the 2006 World Junior champion. Moir and Virtue are also the 2018 Olympic gold medalists in the team event and the 2014 Olympic silver medalists in the team event. They are the most decorated Canadian ice dance team of all time and the most decorated Olympic figure skaters of all time.\\nVirtue and Moir were paired in 1997, at the ages of seven and nine. They are the 2004 Canadian junior champions and became Canada's top ice dance team in 2007. They are the 2008 World silver medalists and the 2009 World bronze medalists and became the first ice dance team to receive a 10.0 for a program component score under the new ISU Judging System. In 2010, they became the first ice dancers from North America to win an Olympic gold medal, ending the 34-year streak of the Europeans. They are the youngest ice dance team ever to win an Olympic title."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%8F%D0%B4%D0%B7%D0%B0%D0%BA%D1%96_%D0%A5%D0%B0%D1%8F%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Hayao_Miyazaki.jpg","page_title":"Міядзакі Хаяо","context_page_description":"Міядза́кі Ха́яо — японський режисер анімаційних фільмів, автор численної манґи. Випускник політико-економічного факультету університету Ґакусюін. Співзасновник анімаційної студії Ghibli, з квітня 2005 року по 2014 — її директор. Власник Музею студії Ghibli. Відомий також під псевдонімами Акіцу Сабуро і Терукі Цутому.\\nМіядзакі Хаяо — один з найвідоміших у світі японських мультиплікаторів і анімаційних режисерів. Його часто називають азійським Волтом Діснеєм, хоча сам аніматор не любить цього порівняння. В Японії Міядзакі прославився завдяки повнометражним анімаційним шедеврам «Навсікая з Долини Вітрів», «Небесний замок Лапута», «Мій сусід Тоторо». На Заході він став широко відомим після випуску у 1997 році його фільму «Принцеса Мононоке». У 2003 році твір Міядзакі «Віднесені привидами» отримав премію Оскар за найкращий анімаційний фільм року. Останньою на цей час повнометражною роботою режисера є фільм «Вітер дужчає»."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%90%D0%BD%D0%B3%D0%B5%D1%80%D1%81%D0%B4%D0%BE%D1%80%D1%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Wappen_Angersdorf.png","page_title":"Ангерсдорф","context_page_description":"Ангерсдорф — Германияла, Саксония-Анхальт ерендә урынлашҡан коммуна.\\n2006 йылғы халыҡ иҫәбен алыу буйынса коммунала 1195 кеше йәшәй. Майҙаны — 6,37 км². Диңгеҙ кимәленән 75 метр бейеклектә һәм UTC +1 ваҡыт бүлкәтендә урынлашҡан. Почта индексы — 6179 һәм автомобиль коды — SK."},{"page_url":"https://en.wikipedia.org/wiki/Tomato_seed_oil","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Tomato_01.jpg","page_title":"Tomato seed oil","context_page_description":"Tomato seed oil is a vegetable oil extracted from the seeds of tomatoes.\\nThe possibility of extracting oil from tomato seeds was studied in the USA in 1914. Seeds were obtained from a variety of locations and pressed to produce oil. This was refined using an alkali and then clarified with fuller's earth. The resulting oil was pale yellow and considered suitable for dressing salads.\\nThe seeds have been given renewed attention as there is pressure to utilise the waste products of tomato processing, in which seeds are the largest component. In Greece, over a million tons of tomatoes are processed each year and the resulting quantity of seeds might be used to produce up to 2000 tons of oil. The oil from Greek seeds has been extracted by using ether as a solvent. When analysed, it was found to contain a high proportion of unsaturated fatty acids, especially linoleic acid."},{"page_url":"https://hu.wikipedia.org/wiki/Beje","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Tornalja097.JPG","page_title":"Beje","context_page_description":"Beje 1971 óta Tornalja településrésze, korábban önálló község Szlovákiában, a Besztercebányai kerület Nagyrőcei járásában."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%84%E0%B8%AB%E0%B8%A5%E0%B9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Shoulder_joint_back-en.svg","page_title":"ไหล่","context_page_description":"ไหล่ หรือ บ่า เป็นส่วนประกอบของร่างกายมนุษย์ที่อยู่บริเวณข้อต่อไหล่ ซึ่งประกอบด้วยกระดูกต้นแขนประกอบกับกระดูกสะบัก\\nไหล่ประกอบด้วยกระดูก 3 ชิ้น ได้แก่ กระดูกไหปลาร้า, กระดูกสะบัก และกระดูกต้นแขน ร่วมกับกล้ามเนื้อ เอ็น และเอ็นกล้ามเนื้อที่เกี่ยวข้อง ข้อต่อระหว่างกระดูกต่างๆ เหล่านี้ประกอบกันเป็นข้อต่อไหล่ ไหล่เป็นโครงสร้างที่มีความยืดหยุ่นเพื่อให้แขนและมือสามารถการเคลื่อนที่ได้อย่างมาก และยังมีความแข็งแรงมากเพื่อใช้ในการออกแรงยกของ ดัน และดึง จากหน้าที่การทำงานของไหล่ดังกล่าวทำให้ไหล่เป็นบริเวณที่คนมักบาดเจ็บหรือปวดล้าอยู่สม่ำเสมอ"},{"page_url":"https://it.wikipedia.org/wiki/Fuerzas_Armadas_de_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/3in.png","page_title":"Fuerzas Armadas de España","context_page_description":"Le Fuerzas Armadas de España sono le forze armate delle Spagna e sono al comando del re, Filippo VI, nella qualità di capitano generale.\\nLe forze armate spagnole fanno parte della Forza operativa europea di reazione rapida e dell'Eurocorps. Allo stesso modo, le forze armate spagnole sono integrate nella struttura militare dell'Organizzazione del Trattato del Nord Atlantico, un'alleanza a cui la Spagna ha aderito nel 1982. Inoltre la Spagna ha il più antico corpo di fanteria di marina del mondo e le due unità militari permanenti più anticche del mondo: il reggimento di fanteria im memoria del re n° 1 e il reggimento di fanteria \\"Soria\\" n° 9.\\nNel 2017, le forze armate spagnole avevano circa 131.911 militari e 20.244 civili."},{"page_url":"https://en.wikipedia.org/wiki/Euphorbia_ambovombensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Euphorbia_ambovombensis1_ies.jpg","page_title":"Euphorbia ambovombensis","context_page_description":"Euphorbia ambovombensis is a species of plant in the family Euphorbiaceae. It is endemic to Madagascar. Its natural habitats are subtropical or tropical dry forests and subtropical or tropical dry shrubland. It is threatened by habitat loss."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%AD%E0%B8%B2%E0%B9%82%E0%B8%97%E0%B8%9A%E0%B8%B2%E0%B8%99%E0%B8%AB%E0%B8%A1%E0%B8%B2%E0%B8%A2%E0%B9%80%E0%B8%A5%E0%B8%82_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/A8_-_Drackensteiner_Hang_-_panoramio_%281%29.jpg","page_title":"เอาโทบานหมายเลข 8","context_page_description":"เอาโทบานหมายเลข 8 หรือย่อว่า A8 เป็นหนึ่งในทางหลวงเอาโทบานของประเทศเยอรมนี มีระยะทาง 497 กิโลเมตร เชื่อมประเทศลักเซมเบิร์กกับรัฐซาลซ์บูร์กของประเทศออสเตรีย ระหว่างเส้นทางพากผ่านเมืองสำคัญอย่างคาลส์รูเออ, ฟอทซ์ไฮม์, ตอนใต้ของชตุทท์การ์ท, เอาคส์บวร์ค, มิวนิก และซาลซ์บูร์ก ถือเป็นถนนสายสำคัญที่สุดที่เชื่อมฝั่งตะวันตก-ตะวันออกในภาคใต้ของเยอรมนี\\nเอาโทบานหมายเลข 8 เป็นเอาโทบานสายแรก ๆ ของประเทศเยอรมนี การก่อสร้างเริ่มขึ้นในเดือนมีนาคม ค.ศ. 1934 ในสมัยนาซีเยอรมนี โดยใช้ชื่อว่า ไรชส์เอาโทบาน ในช่วงแรกนี้ก่อสร้างเพียงช่วงเมืองคาลส์รูเออกับเมืองซาลซ์บูร์ก มีทางวิ่งขนาด 2+2 ช่องจราจรแบบไม่มีทางบริการฉุกเฉินและมีโค้งรัศมีแคบ ต่อมาหลังสงครามโลกครั้งที่สองจึงมีการก่อสร้างส่วนต่อขยายไปยังเมืองอื่น ๆ\\nในปัจจุบัน แม้ส่วนใหญ่ของเส้นทางถูกอัพเกรดเป็นมาตรฐานใหม่ 3+3 ช่องจราจรพร้อมระบบอำนวยความปลอดภัยครบครัน แต่บางช่วงยังคงเป็นทางวิ่ง 2+2 ช่องจราจรแบบไม่มีทางบริการฉุกเฉินเหมือนกับก่อนสมัยสงครามโลก ทำให้ A8 กลายเป็นหนึ่งในเอาโทบานที่หนาแน่นและอันตรายที่สุดในเยอรมนี โดยเฉพาะช่วงที่ผ่านป่าดำและทิวเขาแอลป์ชวาเบิน"},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D9%81%D8%B1%DB%8C%D9%82%DB%81_%DA%A9%DB%92_%D8%B9%D8%A7%D9%84%D9%85%DB%8C_%D8%AB%D9%82%D8%A7%D9%81%D8%AA%DB%8C_%D9%88%D8%B1%D8%AB%DB%81_%D9%85%D9%82%D8%A7%D9%85%D8%A7%D8%AA_%DA%A9%DB%8C_%D9%81%DB%81%D8%B1%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/MtKenyaMackinder.jpg","page_title":"افریقہ کے عالمی ثقافتی ورثہ مقامات کی فہرست","context_page_description":"یونیسکو نے افریقا میں 135 عالمی ثقافتی ورثہ مقامات کو نامزد کیا ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Bugatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Bugatti_Coach_Type_46_%281933%29_pic2.JPG","page_title":"Jean Bugatti","context_page_description":"Jean Bugatti est un ingénieur en mécanique, designer et industriel constructeur automobile, pilote d'essai d'usine français, héritier de Bugatti, fondé par son père Ettore Bugatti en 1909."},{"page_url":"https://en.wikipedia.org/wiki/Duchy_of_Courland_and_Semigallia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Biron_Rezidenz.jpg","page_title":"Duchy of Courland and Semigallia","context_page_description":"The Duchy of Courland and Semigallia was a duchy in the Baltic region, in what was then known as Livonia, that existed from 1561 to 1569 as a nominally vassal state of the Grand Duchy of Lithuania and subsequently made part of the Crown of the Polish Kingdom from 1569 to 1726 and incorporated into the Polish–Lithuanian Commonwealth in 1726. On 28 March 1795, it was annexed by the Russian Empire in the Third Partition of Poland.\\nThere was also a short-lived wartime state existing from 8 March to 22 September 1918 with the same name. Plans for it to become part of the United Baltic Duchy, subject to the German Empire, were thwarted by Germany's surrender of the Baltic region at the end of the First World War. The area became a part of Latvia at the end of World War I."},{"page_url":"https://de.wikipedia.org/wiki/Peccatel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Ivenack-kirche-wappen4.jpg","page_title":"Peccatel","context_page_description":"Peccatel, historisch auch Piccatel und Pykatel, zuletzt auch Peckatel, ist der Name eines 1773 erloschenen mecklenburgischen Adelsgeschlechts mit Stammhaus in Peckatel, einem Ortsteil der Gemeinde Plate."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D9%86%DA%AF%D9%87_%D8%AF%D8%A7%D9%86%D9%85%D8%A7%D8%B1%DA%A9_%D8%AF%D8%A4%DB%8C%D9%88%D8%B4%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/090102_PoW_gunnery_plot.png","page_title":"تنگه دانمارک دؤیوشو","context_page_description":"تنگه دانمارک دؤیوشو بریتانیا ایمپیراتورلوغو و آلمان قوشونو آراسیندا باش وئرن دؤیوش.ایکینجی دونیا ساواشینین بیر قیسمی‌دیر. بۇ وۇروشون سوْنو بریتانیا غلبه‌سیله بیتمیش‌دیر"},{"page_url":"https://it.wikipedia.org/wiki/Keisuke_Ushiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Keisuke_Ushiro_%28cropped%29.jpg","page_title":"Keisuke Ushiro","context_page_description":"Keisuke Ushiro è un multiplista giapponese.\\nVincitore di quattro titoli nazionali nel decathlon nel 2010, 2014, nel 2018 e nel 2019, ha rappresentato il Giappone in occasione di Londra 2012 e Rio de Janeiro 2016. Durante la cerimonia d'apertura della manifestazione in Brasile, Ushiro è stato portabandiera della delegazione nipponica."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA_III_(%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%91%D1%80%D0%B5%D1%82%D0%B0%D0%BD%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Fran%C3%A7ois_III%2C_Dauphin_de_France.jpg","page_title":"Франциск III (герцог Бретани)","context_page_description":"Франциск, дофин Франции, также Франциск III, герцог Бретонский — старший сын и наследный принц французского короля Франциска I и Клод Французской, дочери Людовика XII и Анны Бретонской."},{"page_url":"https://fr.wikipedia.org/wiki/Astrolabe_planisph%C3%A9rique","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/H_Arcturus.png","page_title":"Astrolabe planisphérique","context_page_description":"L'astrolabe planisphérique, communément appelé astrolabe, est un instrument astronomique d'observation et de calcul analogique. Instrument aux fonctions multiples, il permet notamment de mesurer la hauteur des étoiles, dont le Soleil, et ainsi de déterminer l'heure de l'observation et la direction de l'astre. Sa conception, dont les origines remontent à l'Antiquité, perfectionnée par les civilisations arabes, s'appuie sur une projection plane de la voûte céleste et de la sphère locale, dite projection stéréographique."},{"page_url":"https://bar.wikipedia.org/wiki/Langobardische_Sproch","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Runic_letter_isaz.png","page_title":"Langobardische Sproch","context_page_description":"Langobardisch is a ausgstorbane germanische Sproch, wo vo de Langobarden gred worn und bis spodastns im 10. Joarhundat ausgstorbm is.\\nGschichtli gseng is de Sproch vo de Langobarden eascht im 6. Joarhundat fossba, wias eanan Wohnsitz z Pannonien aufgebm hom und af Norditalien eingwandat san. Zua Schriftsproch hod se s Langobardische nia entwicklt, wei de Langobardn z Italien schnej de romanische Mundort vo de Einheimischn ognumma hom und ois Schriftsproch nacha s Lateinische gnutzt hom."},{"page_url":"https://it.wikipedia.org/wiki/Franck_Rib%C3%A9ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Franck_Ribery_Training_2016-11_FC_Bayern_Muenchen-10.jpg","page_title":"Franck Ribéry","context_page_description":"Franck Henry Pierre Ribéry è un calciatore francese, centrocampista o attaccante della Fiorentina.\\nConsiderato tra i più forti calciatori della sua generazione, ha legato la sua carriera principalmente al Bayern Monaco, dove ha giocato per dodici stagioni vincendo ben nove campionati tedeschi. Al termine della stagione 2012-2013, che lo ha visto conquistare da protagonista un prestigioso treble, è stato nominato UEFA Best Player in Europe, davanti a Lionel Messi e Cristiano Ronaldo, e miglior giocatore dell'anno ai Globe Soccer Awards.\\nConta 81 presenze e 16 gol con la nazionale francese, con cui si è laureato vice-campione del mondo al mondiale del 2006. Con i Bleus ha preso parte a due campionati del mondo e a due campionati d'Europa.\\nA livello individuale, tra gli altri riconoscimenti, è stato nominato tre volte calciatore francese dell'anno e una volta calciatore tedesco dell'anno."},{"page_url":"https://de.wikipedia.org/wiki/La_Vall_d%E2%80%99en_Bas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/WF_Sant_Privat_den_Bas_001.jpg","page_title":"La Vall d’en Bas","context_page_description":"La Vall d’en Bas ist eine landwirtschaftlich geprägte Gemeinde in der Garrotxa in der katalanischen Provinz Girona in Spanien. Der Ort ist 1968 durch die Vereinigung von mehreren kleinen Ortschaften und Weilern sowie Kirchengemeinden entstanden. Diese Gemeindeneubildung stellte die alte Struktur des „Vescomtat“ von Bas als geografisch-landschaftliche Einheit wieder her. Die mit dem Zusammenschluss einhergehende Flurbereinigung, der Ausbau des Wege- und Straßennetzes zwischen den Teilorten sowie die Gründung der landwirtschaftlichen Genossenschaft von La Vall d'en Bas zu Anfang der 1970er Jahre hat die Landwirtschaft und den Tourismus in der Region entscheidend gestärkt. Die Gemeinde gilt als eine der flächenmäßig größten Gemeinden in der Garrotxa und hatte im Jahr 2018 3029 Einwohner.\\nAn die zentrale Ebene von Bas schließt im Norden die Ebene von Olot an, im Westen begrenzen die Massive des Puigsacalm und des Santa Magdalena mit grandiosen Felswänden sowie die Gebirgskette von Llancers und der Sant Miquel das Tal. Der Sant Miquel schließt auch den südlichen Bereich der Ebene ab."},{"page_url":"https://pl.wikipedia.org/wiki/Mosty_w_Olsztynie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Olsztyn-most_wchodni_ul_Tuwima.jpg","page_title":"Mosty w Olsztynie","context_page_description":"Olsztyńskie mosty – mosty znajdujące się na terenie miasta Olsztyna wybudowane na rzekach: Łynie, Wadągu i Kortówce oraz na Jeziorze Długim."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%BD%A9%E4%BB%80%E7%A7%91%E6%AF%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Peshkopia1_beschnitten.jpg","page_title":"佩什科比","context_page_description":"佩什科比位于阿尔巴尼亚东北部，邻近科索沃和马其顿共和国边境，是迪勃拉州的首府，人口约13,251。\\n它距离阿尔巴尼亚首都地拉那187公里，距离马其顿边界20公里。它位于海拔651米处。它是迪勃拉州和地区的首府。这是阿尔巴尼亚唯一一个不与州名同名的首府。\\n佩什科比位于黑德林河以东。德林山谷是该地区的最低部分。在该地区发现了铬矿，硫矿和大理石矿等矿石。它也是阿尔巴尼亚重要的工业中心，特别是食品工业。\\n佩什科比拥有AleksandërMoisiu大学的一个分支机构，但目前因阿尔巴尼亚国家教育部作出有关成为大学资格的修订而未能达到标准大学资格水平。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D0%BB%D0%B8%D0%BF%D1%81%D0%BE%D0%B8%D0%B4_%D0%B2%D1%80%D0%B0%D1%89%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/OblateSpheroid.PNG","page_title":"Эллипсоид вращения","context_page_description":"Эллипсо́ид враще́ния — поверхность вращения в трёхмерном пространстве, образованная при вращении эллипса вокруг одной из его главных осей.\\nТермин «сфероид» для обозначения двух вариантов эллипсоида вращения ввёл Архимед:\\n«… мы полагаем следующее: если эллипс при сохранении неподвижной большей оси поворачивается, возвращаясь в исходное положение, то охватываемая им фигура будет называться вытянутым сфероидом. Если эллипс поворачивается при сохранении в неподвижности малой оси и возвращается назад, то охватываемая им фигура будет называться сплюснутым сфероидом.»\\nЭллипсоид вращения является частным случаем эллипсоида, две из трёх полуосей которого имеют одинаковую длину:\\nВ частном случае, когда все три полуоси равны, исходный эллипс представляет собой окружность, а эллипсоид вращения вырождается в сферу."},{"page_url":"https://nl.wikipedia.org/wiki/Kasteel_van_Clisson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/ChateaudeClisson.JPG","page_title":"Kasteel van Clisson","context_page_description":"Het Kasteel van Clisson is een kasteel in de Franse gemeente Clisson."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE_%D0%90%D1%80%D0%BD%D0%B0%D1%83%D0%B4%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Hristo_Arnaudov_IMARO_Odrinsko.jpg","page_title":"Христо Арнаудов","context_page_description":"Христо Арнаудов, известен като Афуза, Арнаутина, Попчето и Хафъза, е български революционер, гюмюрджински войвода на Вътрешната македоно-одринска революционна организация."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B0%D0%B1%D0%BE_%D0%9C%D0%B1%D0%B5%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/SthAfrica.ThaboMbeki.01.jpg","page_title":"Табо Мбеки","context_page_description":"Табо Мбеки је бивши председник Јужноафричке Републике, од 14. јуна 1999. до 22. септембра 2008. На том месту наследио је Нелсона Манделу, као и на месту председника Афричког националног конгреса.\\nМбеки је син Гована Мбекија, високог званичника Афричког националног конгреса и Јужноафричке комунистичке партије. Табо је са 14 година постао члан Афричког националног конгреса. Године 1959. је избачен из школе због студентског штрајка.\\nНакон доласка у Јоханезбург, сарађивао је са Волтером Сисулуом у борби против апартхејда. Након хапшења Сисулуа, Манделе и свог оца, Мбеки је напустио Јужноафричку Републику и провео у игзнанству 28 година. Добио је звање магистра економије на Универзитету Сасекс у Брајтону. Војну обуку је завршио у Совјетском Савезу, а касније је радио као функционер АНК у Замбији, Нигерији, Боцвани, Мозамбику и Свазиленду. У Јужноафричку Републику се вратио после ослобађања Нелсона Манделе.\\nУ мају 1994. је изабран за потпредседника Јужноафричке Републике. Наследио је Манделу на месту председника Афричког националног конгреса децембра 1997. и на месту председника Јужноафричке Републике 14. јуна 1999, а 2004. је поново изабран за председника."},{"page_url":"https://ro.wikipedia.org/wiki/Valeriu_Pantazi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Romeliu_Ieronim_Copila%C8%99.jpg","page_title":"Valeriu Pantazi","context_page_description":"Valeriu Pantazi, pe numele său real Valeriu Pantazie Constantinescu, a fost un poet, scriitor, topograf și pictor român, membru al Uniunii Artiștilor Plastici din București și al Uniunii Scriitorilor din România. Valeriu Pantazi a fost un apropiat al lui Nichita Stănescu, Sorin Dumitrescu, Ștefan Agopian, al graficianului Valentin Popa, al pictorului Radu Darânga și l-a avut ca profesor pe Octavian Angheluță. Cel mai bun prieten al său a fost pictorul piteștean Gheorghe Pantelie. Valeriu Pantazi a fost căsătorit cu arhitecta și autoarea de literatură pentru copii Francisca Stoenescu.\\nÎn pictura sa, printr-o tematică bogată ancorată în operele înaintașilor români și internaționali, Valeriu Pantazi a probat a fi un adept al picturii clasice. Asemenea înaintașilor săi Dărăscu, Petrașcu și Pallady, maeștri ai impresionismului și postimpresionismului, Valeriu Pantazi a reușit să integreze stiluri, tehnici și abordări din opere clasice, fără a le frauda.\\n„... Eu îmi permit doar să afirm că nu există nici un fel de „alchimie” între cuvânt și culoare în ceea ce mă privește."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC%D0%B5%D0%BD%D1%96%D0%BA%D0%BE_%D0%A4%D0%BE%D0%BD%D1%82%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Fontana-obelisk.jpg","page_title":"Доменіко Фонтана","context_page_description":"Доменіко Фонтана — відомий архітектор та інженер доби пізнього Відродження і Ранішнього бароко Риму. Один з перших, хто почав перебудову Риму на засадах регулярного містобудування, реалізував в місті трипроменеву схему головних вулиць, підхоплених пізніше різними будівничими різних країн у Франції, Росії тощо."},{"page_url":"https://de.wikipedia.org/wiki/Tadrart_Acacus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Libya_5101_Fozzigiaren_Arch_Tadrart_Acacus_Luca_Galuzzi_2007.jpg","page_title":"Tadrart Acacus","context_page_description":"Tadrart Acacus ist ein Gebirge im Südwesten Libyens. Es befindet sich unweit der libyschen Stadt Ghat und in der Nähe des Felsmassivs Idinen. Ein südlicher Ausläufer ist das Tassili Tadrart."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Ghighi%C8%99eni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/CucuceniBH_%2842%29.jpg","page_title":"Biserica de lemn din Ghighișeni","context_page_description":"Biserica de lemn din Ghighișeni se află în cătunul Cucuceni din marginea localității Ghighișeni, județul Bihor. Ea a fost ridicată în jurul anului 1743 în satul Ghighișeni și este semnată de meșterul Tulea Ilie, cel care a ridicat și biserica de lemn din Rieni câțiva ani mai târziu. Împreună cu cele din Rieni și Valea de Jos este în linii mari o replică a bisericii de lemn din Brădet, una dintre cele mai semnificative realizări din regiune și din întreaga Transilvanie. Biserica se află pe noua listă a monumentelor istorice sub codul LMI: BH-II-m-B-01228."},{"page_url":"https://fr.wikipedia.org/wiki/AIM-120_AMRAAM","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/RNoAF_F16A.jpg","page_title":"AIM-120 AMRAAM","context_page_description":"L'AIM-120 AMRAAM est un missile air-air de moyenne portée, muni d'un système de guidage à radar actif. Il est surnommé Slammer par les pilotes américains.\\nL'AMRAAM est le missile au-delà de la portée visuelle le plus populaire au monde, avec plus de 14 000 exemplaires produits pour la United States Air Force, la United States Navy et 33 clients internationaux. L'AMRAAM a été utilisé dans plusieurs engagements et est crédité de dix victoires aériennes. Maintenant âgé de plus de 30 ans dans sa conception, l'AMRAAM devrait être remplacé par le nouveau AIM-260 JATM, vers le milieu des années 2020 pour offrir de meilleures performances et de meilleurs capacités à vaincre le brouillage électronique."},{"page_url":"https://pl.wikipedia.org/wiki/Tata_Motors","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Tatapickup3117enimagesbwp4.jpg","page_title":"Tata Motors","context_page_description":"Tata Motors Limited – największy prywatny producent samochodów i autobusów, a także indyjski gigant przemysłowy. Tata Motors jest częścią spółki Tata Group, założonej przez Jamsetji Tatę. Samochody tej marki sprzedawane są głównie na kontynencie azjatyckim, choć od pewnego czasu firma oferuje je także na niektórych rynkach europejskich. Samochody Taty sprzedawane są we Włoszech, Hiszpanii, Turcji oraz od 1 września 2008 roku w Polsce.\\nO Tacie bardzo głośno zrobiło się w połowie 2008 roku, kiedy to firma ogłosiła chęć produkowania najtańszego auta na świecie, modelu Nano, oraz odkupiła za 2,3 mld dolarów od Ford Motor Company prawa do marek Land Rover, Jaguar, Daimler, Lanchester oraz Rover. Guenter Butschek jest prezesem TATA Motors."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Vincent_de_Mont-de-Gali%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/%C3%89glise_Saint-Vincent_de_Mont-de-Gali%C3%A9_27.jpg","page_title":"Église Saint-Vincent de Mont-de-Galié","context_page_description":"L'église Saint-Vincent de Mont-de-Galié est une église catholique située à Mont-de-Galié, dans le département français de la Haute-Garonne en France."},{"page_url":"https://af.wikipedia.org/wiki/Rusland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Moscow_Kremlin_%288707177088%29.jpg","page_title":"Rusland","context_page_description":"Rusland, amptelik die Russiese Federasie, is 'n land wat gedeeltelik in Europa en gedeeltelik in Asië lê. Die land lê egter vanuit 'n politieke oogpunt in Europa omdat die belangrikste deel, ook die hoofstad, Moskou, Europees is en sowat 70 persent van die bevolking daar woon.\\nMet sy oppervlak van 17 098 246 km² is Rusland by verre die grootste land ter wêreld, byna twee maal so groot soos die tweede grootste land, Kanada. Dit grens aan: Noorweë, Finland, Estland, Letland, Litaue, Pole, Wit-Rusland, Oekraïne, Georgië, Azerbeidjan, Kasakstan, die Volksrepubliek China, Mongolië en Noord-Korea. Verder is dit deur 'n see of smal seestraat geskei van die Verenigde State van Amerika, Kanada, Turkmenistan, Iran, Turkye, Swede en Japan.\\nDie moderne Russiese landsnaam Rossija vir Rusland het sy oorsprong in die Griekse weergawe Rossia van die historiese Oos-Slawiese benaming Roes vir gebiede in die huidige Europese state Rusland, Wit-Rusland en Oekraïne wat deur Slawiërs bewoon is. Die vroegste bewoners het hulle sowat 100 000 jaar gelede in die weste van moderne Rusland gevestig."},{"page_url":"https://fr.wikipedia.org/wiki/Carol_Channing","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Carol_Channing.jpg","page_title":"Carol Channing","context_page_description":"Carol Channing est une actrice et chanteuse américaine née le 31 janvier 1921 à Seattle, Washington et morte le 15 janvier 2019 à Rancho Mirage, Californie."},{"page_url":"https://ca.wikipedia.org/wiki/Fernando_Maria_Bonilla-Musoles","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Embryo_at_12_weeks.JPG","page_title":"Fernando Maria Bonilla-Musoles","context_page_description":"Fernando Maria Bonilla-Musoles és un obstetre i ginecòleg valencià. És una autoritat internacional en la seva disciplina, amb especial projecció als àmbits europeu i llatinoamericà."},{"page_url":"https://et.wikipedia.org/wiki/Juttselg-hiir","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Mysz_polna2.jpg","page_title":"Juttselg-hiir","context_page_description":"Juttselg-hiir on hiirlaste sugukonda kuuluv näriline.\\nTeda leidub ka Eestis. Juttselg-hiir sööb seemneid, kuid suurema osa tema toidulauast katavad putukad."},{"page_url":"https://fr.wikipedia.org/wiki/Vertebrata_(algue)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Ascophyllum_nodosum_with_Polysiphonia_lanosa.jpg","page_title":"Vertebrata (algue)","context_page_description":"Vertebrata est un genre d'algues rouges de la famille des Rhodomelaceae."},{"page_url":"https://la.wikipedia.org/wiki/Alpinia_oxyphylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Alpinia_oxyphylla01.JPG","page_title":"Alpinia oxyphylla","context_page_description":"Alpinia oxyphylla est planta hortensis et medicinalis generis Alpiniae et familiae Zingiberacearum."},{"page_url":"https://en.wikipedia.org/wiki/Piano_Concerto_No._1_(Chopin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/The_first_page_of_the_score_from_Fr%C3%A9d%C3%A9ric_Chopin%27s_Piano_Concerto_No._1_in_E_minor%2C_Op._11.png","page_title":"Piano Concerto No. 1 (Chopin)","context_page_description":"The Piano Concerto No. 1 in E minor, Op. 11, is a piano concerto written by Frédéric Chopin in 1830, when he was twenty years old. It was first performed on 11 October of that year, at the Teatr Narodowy in Warsaw, Poland, with the composer as soloist, during one of his “farewell” concerts before leaving Poland.\\nIt was the first of Chopin's two piano concertos to be published, and was therefore given the designation of Piano Concerto “No. 1” at the time of publication, even though it was actually written immediately after the premiere of what was later published as Piano Concerto No. 2.\\nThe concerto is scored for solo piano, pairs of flutes, oboes, clarinets, and bassoons, 4 horns, 2 trumpets, tenor trombone, timpani and strings. A typical performance lasts about 40 minutes."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%A4%D5%AF%D5%A1%D5%B6%D6%81_%D5%B4%D5%AB%D5%A3%D6%80%D5%A1%D6%81%D5%AB%D5%A1%D5%B5%D5%AB_%D5%BA%D5%A1%D5%BF%D5%B4%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Spreading_homo_sapiens_la.svg","page_title":"Մարդկանց միգրացիայի պատմություն","context_page_description":"Մարդու միգրացիա, մարդկանց տեղաշարժը մի տեղից մյուսը, մասնավորապես տարբեր երկրներ՝ նպատակ ունենալով ժամանակավորապես կամ մշտապես բնակություն հաստատել նոր վայրում: Այն սովորաբար ներառում է շարժումներ երկար հեռավորությունների վրա և մի երկրից կամ տարածաշրջանից մյուսը:\\nՊատմականորեն, մարդկային վաղ միգրացիան ներառում է աշխարհի բնակեցումը, այսինքն՝ միգրացիան աշխարհի դեպի այն շրջաններ, որտեղ նախկինում մարդկային բնակավայր գոյություն չի ունեցել վերին պալեոլիթի ժամանակ: Սկսած նեոլիթյան ժամանակներից միգրացիաների մեծ մասը, բացառությամբ հեռավոր շրջանների բնակաեցումը ինչպիսիք են Արկտիկան կամ Խաղաղ օվկիանոսը, պատերազմական բնույթ ունեին. տարածքների զավթում կամ բնակչության ընդլայնում:Գաղութացումը նպաստում է նստակյաց բնակչության ընդլայնմանը՝ նոսր բնակեցված տարածքներում կամ այն տարածքներում որոնք մշտական բնակաեցման համար նպատակահարմար չէին: Նորագույն ժամանակներում մարդկանց միգրացիան հիմնականում ստացել է ինքնիշխան պետությունների ներսում և միջև գործող ձև՝ կամ վերահսկվող, կամ անվերահսկելի:\\nՄիգրացիան կարող է լինել կամավոր և ոչ կամավոր: Ոչ կամավոր միգրացիան ներառում է՝ հարկադիր տեղափոխություն և պատերազմներ և երկուսն էլ նպաստում են սփյուռքի առաջացմանը:"},{"page_url":"https://en.wikipedia.org/wiki/Nothomyrmecia","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Nothomyrmecia_macrops_casent0172003_head_1.jpg","page_title":"Nothomyrmecia","context_page_description":"Nothomyrmecia, also known as the dinosaur ant or dawn ant, is a rare genus of ants consisting of a single species, Nothomyrmecia macrops. These ants live in South Australia, nesting in old-growth mallee woodland and Eucalyptus woodland. The full distribution of Nothomyrmecia has never been assessed, and it is unknown how widespread the species truly is; its potential range may be wider if it does favour old-growth mallee woodland. Possible threats to its survival include habitat destruction and climate change. Nothomyrmecia is most active when it is cold because workers encounter fewer competitors and predators such as Camponotus and Iridomyrmex, and it also increases hunting success. Thus, the increase of temperature may prevent them from foraging and very few areas would be suitable for the ant to live in. As a result, the IUCN lists the ant as Critically Endangered.\\nAs a medium-sized ant, Nothomyrmecia measures 9.7–11 mm. Workers are monomorphic, showing little morphological differentiation among one another. Mature colonies are very small, with only 50 to 100 individuals in each nest."},{"page_url":"https://fr.wikipedia.org/wiki/Pollachius","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Pollachius_virens.jpg","page_title":"Pollachius","context_page_description":"Le genre Pollachius concerne deux espèces de poissons marins de la famille des Gadidae. Ils peuvent être appelés Lieu ou Colin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D1%85%D1%82%D0%B5%D1%82%D0%B0%D0%BB%D1%8C-%D0%B0%D0%BC-%D0%A0%D0%B5%D0%BD%D0%BD%D1%88%D1%82%D0%B0%D0%B9%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Wappen_Reichmannsdorf.png","page_title":"Лихтеталь-ам-Реннштайг","context_page_description":"Лихтеталь-ам-Реннштейг — общинная ассоциация в районе Заальфельд-Рудольштадт, в земле Тюрингия в Германии.\\nАдминистрация общинной ассоциации находится в Лихте, нынешним её председателем является Кристоф Тэйс.\\nВ состав этой общинной ассоциации входят четыре общины."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_s%C3%A4chsischen_Ministerpr%C3%A4sidenten","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/A080128-181812_-_Portrait.jpg","page_title":"Liste der sächsischen Ministerpräsidenten","context_page_description":"Die Liste beinhaltet die Vorsitzenden des Gesamtministeriums des Königreichs Sachsen von 1831 bis 1918 und die Ministerpräsidenten des Freistaates Sachsen von 1918 bis heute.\\nVon 1831 bis 1918 hatte der sächsische König nach der Verfassung offiziell den Vorsitz im Gesamtministerium. Von Anfang an wurde jedoch auch ein Minister mit dem Vorsitz beauftragt. Nach 1873 nahmen die Könige kaum noch an den Sitzungen des Kabinetts teil. Der Titel eines Ministerpräsidenten wurde offiziell erst 1919 eingeführt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D1%83%D0%B1%D0%B5%D1%80,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B0%D1%81_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D0%B8%D1%81%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/AUT_U-21_vs._FIN_U-21_2015-11-13_%28023%29.jpg","page_title":"Грубер, Андреас (футболист)","context_page_description":"Андреас Грубер — австрийский футболист, вингер клуба «Маттерсбург»."},{"page_url":"https://en.wikipedia.org/wiki/Young_America_movement","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Young_America_1.jpg","page_title":"Young America movement","context_page_description":"The Young America Movement was an American political and cultural attitude in the mid-19th century. Inspired by European reform movements of the 1830s, the American group was formed as a political organization in 1845 by Edwin de Leon and George Henry Evans. It advocated free trade, social reform, expansion southward into the territories, and support for republican, anti-aristocratic movements abroad. It became a faction in the Democratic Party in the 1850s. Senator Stephen A. Douglas promoted its nationalistic program in an unsuccessful effort to compromise sectional differences.\\nJohn L. O'Sullivan described the general purpose of the Young America Movement in an 1837 editorial for the Democratic Review:\\nAll history is to be re-written; political science and the whole scope of all moral truth have to be considered and illustrated in the light of the democratic principle. All old subjects of thought and all new questions arising, connected more or less directly with human existence, have to be taken up again and re-examined.\\nHistorian Edward L. Widmer has largely placed O'Sullivan and the Democratic Review in New York City at the center of the Young America Movement."},{"page_url":"https://de.wikipedia.org/wiki/Kappelberg_(Fellbach)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Rotenberg_night.jpg","page_title":"Kappelberg (Fellbach)","context_page_description":"Der Kappelberg ist ein 469 m ü. NN hoher Bergausläufer des Schurwalds südlich von Fellbach."},{"page_url":"https://it.wikipedia.org/wiki/Linea_Circle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Blackfriars_tube_stn_and_Thameslink_northern_entrance_close_up_2012.JPG","page_title":"Linea Circle","context_page_description":"La linea Circle è una linea della metropolitana di Londra. Il suo percorso è a forma di spirale, che va da Hammersmith a Edgware Road e poi, completato il giro attorno al centro di Londra, torna ad Edgware Road, dove il treno termina la corsa per poi cambiare direzione e ripartire verso Hammersmith. La ferrovia è sotterranea nella parte centrale e, a differenza delle altre linee della metropolitana di Londra, i cui tunnel sono molto profondi, le gallerie ferroviarie della Circle Line sono appena sotto la superficie e di dimensioni simili a quelle delle linee principali britanniche.\\nLa linea, identificabile sulla mappa con il colore giallo, è lunga 17 miglia e fa servizio presso 36 stazioni, di cui la maggior parte offre interscambi con la linea ferroviaria principale. La maggior parte del percorso e tutte le stazioni sono condivise con le linee District, Hammersmith & City e Metropolitan. Combinando i viaggiatori della Circle Line con quelli della linea Hammersmith & City si contano più di 114 milioni di passeggeri all'anno.\\nA ovest, est e sud, la Circle line segue all'incirca i confini della zona tariffaria 1."},{"page_url":"https://sv.wikipedia.org/wiki/Sankt_Petersburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%92%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D0%B8%D1%8F_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D0%B2%D0%B0_1.jpg","page_title":"Sankt Petersburg","context_page_description":"Sankt Petersburg är en stad i västra Ryssland, belägen vid floden Nevas utlopp i Finska viken.\\nSankt Petersburg är Rysslands näst största stad med cirka 5,2 miljoner invånare inom gränsen för dess federala stadsområde, inklusive bland annat Kolpino, Kronstadt, Pusjkin och den tidigare finska staden Terijoki. Stadens guvernör är Georgij Poltavtjenko. Sankt Petersburg är ett populärt resmål i Ryssland."},{"page_url":"https://it.wikipedia.org/wiki/David_Weir","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/David_Weir_2014.jpg","page_title":"David Weir","context_page_description":"David Gillespie Weir è un allenatore di calcio ed ex calciatore scozzese, capo responsabile dello sviluppo dei calciatori in prestito per il Brighton & Hove Albion."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A8%E0%AF%86%E0%AE%B5%E0%AE%BF%E0%AE%B2%E0%AF%8D_%E0%AE%AE%E0%AE%9A%E0%AF%81%E0%AE%95%E0%AF%86%E0%AE%B2%E0%AE%BF%E0%AE%A9%E0%AF%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Maskelyne_Nevil.jpg","page_title":"நெவில் மசுகெலினே","context_page_description":"மாண்புறு முனைவர் நெவில் மசுகெலினே அ க உ ஐந்தாம் பிரித்தானிய அரசு வானியலாளர் ஆவார். இவர் அரசு வானியலளராக 1765 முதல் 1811 வரை இருந்தார்."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%95%B5%E6%84%8F%E5%BB%BA%E7%AF%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Too_short_adjacent_benches.jpg","page_title":"敵意建築","context_page_description":"敵意建築是在都市空間中故意使用一些要素來引導或限制某些行為，以此為預防犯罪或維持秩序的形式的一種設計手法。它針對的往往是更常用或依賴公共空間的人，例如露宿者和青年人，設計上更多地限制他們進行的行為。最典型的敵意建築即「防露宿者尖刺」——嵌在平坦表面上的螺柱等結構會使之變得粗糙，無法在上面睡覺。其他措施還包括傾斜的窗台，以阻止人們坐下；帶扶手的長椅，以阻止人們躺臥；以及用灑水器間歇性灑水，但實際上並沒有東西需要澆灌。敵意建築還用於阻止滑板活動、亂丟垃圾、遊蕩和隨地小便。批評者認為，該措施會加劇社會分裂，並給所有公眾，尤其是長者、殘疾人和兒童帶來麻煩。"},{"page_url":"https://fi.wikipedia.org/wiki/Yhdysvaltain_6._laivasto","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/US_Sixth_Fleet_Logo_high_resolution_version.jpg","page_title":"Yhdysvaltain 6. laivasto","context_page_description":"Yhdysvaltain 6. laivasto on merivoimien operatiivinen yhtymä ja Yhdysvaltain Eurooppaan sijoitettujen laivastovoimien esikunta. Laivaston esikunta on Napolissa Italiassa ja sen komentajana on vara-amiraali Lisa M. Franchetti.\\nLaivasto on perustettu helmikuussa 1950 nimeämällä uudestaan aiempi 6. laivasto, joka taas oli vuonna 1948 muodostettu Yhdysvaltain Välimeren laivastosta. Perustamisestaan lähtien laivasto on osallistunut toimiin kaikkialla Välimeren alueella ja toisinaan kauempanakin. Laivaston joukot ovat osallistuneet lukuisiin Naton harjoituksiin, Yhdysvaltain Libanonin maihinnousuun 1958, Jom Kippurin sotaan 1973, Suezin kanavan raivaukseen vuoden 1973 jälkeen, lukuisiin iskuihin Libyaan 1980-luvulla ja Adrianmerelle sijoitettujen joukkojen huolto-operaatioon Jugoslavian hajoamissotien aikana 1990-luvulla. Viimeisimpänä laivasto on osallistunut ilmaiskuihin Libyaan 2011. Laivastoon kuului 2013 operaatio Iraqi Freedomin aikana kaikkiaan 40 alusta, 175 lentokonetta ja 21 000 henkeä. Sukellusveneiden emälaivan USS Emory S. Landin palattua Yhdysvaltoihin jäi laivaston ainoaksi pysyvästi sijoitetuksi alukseksi USS Mount Whitney."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_na_prze%C5%82%C4%99czy_Kasserine","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Bundesarchiv_Bild_101I-557-1002-10%2C_Tunesien%2C_amerikanische_Kriegsgefangene.jpg","page_title":"Bitwa na przełęczy Kasserine","context_page_description":"Bitwa na przełęczy Kasserine – bitwa rozegrana podczas II wojny światowej, w dniach 19-25 lutego 1943 roku, na przełęczy Kasserine, w zachodniej Tunezji, będąca częścią kampanii tunezyjskiej. W bitwie brała udział Niemiecko-Włoska Armia Pancerna, dowodzona przez feldmarszałka Erwina Rommla, wsparta dwiema dywizjami niemieckiej 5 Armii Pancernej. Po stronie alianckiej trzon sił stanowił II Korpus amerykański pod dowództwem generała-majora Lloyda Fredendalla, wchodzący w skład brytyjskiej 1 Armii generała-porucznika Kennetha Andersona.\\nOd początku 1943 roku dochodziło w Tunezji do coraz częstszych ataków alianckich samolotów szturmowych na niemieckie lotniska i zgrupowania pancerne. Na przykład 18 stycznia – w czasie nalotu na lotnisko w Tunisie – zniszczono 23 samoloty Ju 52. Od tego czasu samoloty niemieckie mogły lądować tylko w nocy.\\nPod koniec stycznia armia pancerna Rommla przystąpiła do ofensywy na zachodzie. Zajęła miejscowości Sbeitla i Kafsa, po czym uderzyła na przełęcz."},{"page_url":"https://hu.wikipedia.org/wiki/Luvi_%C3%ADr%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Luvi_A452.jpg","page_title":"Luvi írás","context_page_description":"A luvi írás a luvi nyelv leírására szolgáló hieroglif típusú írásrendszer. Anatóliában alakult ki és a képjelek semmilyen kapcsolatot nem mutatnak más hieroglif írásokkal, sem az óegyiptomival, sem a képszerű ókánaánita ábécével, így endemikusnak tekinthető. Az íráskép felfedezését követően először hettita képírásnak gondolták, amelyet a hettiták a saját ékírásos rendszerük mellett az epigrafikus felirataikon alkalmaztak. Kiderült azonban, hogy a „hettita hieroglifákkal” írt feliratok nem hettita nyelvűek. A hettita íráshoz annyiban hasonlít, hogy szintén szótagírás, de a rendszere gyökeresen különbözik tőle."},{"page_url":"https://it.wikipedia.org/wiki/Doln%C3%AD_Hradi%C5%A1t%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Doln%C3%AD_Hradi%C5%A1t%C4%9B_2017-05-19_Kaple.jpg","page_title":"Dolní Hradiště","context_page_description":"Dolní Hradiště è un comune della Repubblica Ceca facente parte del distretto di Plzeň-sever, nella regione di Plzeň."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B4%D1%80%D0%B0%D0%B1%D0%B8%D0%BB%D0%BB%D0%B0_(%D0%BC%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Mundrabilla_meteorite_NMNH_slice.jpg","page_title":"Мандрабилла (метеорит)","context_page_description":"Мандрабилла — железный метеорит общим весом более 22 тонны из Австралии."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%82%A3%E3%83%BC%E3%83%84%E3%82%A7%E3%83%B3%E3%83%90%E3%83%83%E3%83%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Dietzenbach_Bahnhof_20070912-2.jpg","page_title":"ディーツェンバッハ","context_page_description":"ディーツェンバッハ は、ドイツ連邦共和国ヘッセン州オッフェンバッハ郡の市で、同郡の郡庁所在地である。"},{"page_url":"https://it.wikipedia.org/wiki/Young_Corbett_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Young_Corbett_III.jpg","page_title":"Young Corbett III","context_page_description":"Young Corbett III, pseudonimo di Raffaele Giordano, è stato un pugile statunitense di origine italiana.\\nFu campione del mondo dei pesi welter nel 1933 e dei pesi medi nel 1938. È riconosciuto fra i più grandi pugili di ogni tempo."},{"page_url":"https://it.wikipedia.org/wiki/Fernando_Troyansky","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Fernando_Troyansky_-_FK_Austria_Wien_%28quer%29.jpg","page_title":"Fernando Troyansky","context_page_description":"Fernando Ariel Troyansky è un calciatore argentino, difensore del Wiener Neustadt."},{"page_url":"https://id.wikipedia.org/wiki/Penghitungan_Omer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Baruch_Zvi_Ring_-_Memorial_Tablet_and_Omer_Calendar_-_Google_Art_Project.jpg","page_title":"Penghitungan Omer","context_page_description":"Penghitungan Omer adalah penghitungan verbal berpengaruh terhadap setiap empat puluh sembilan hari yang dimulai dengan Minggu persembahan unjukan dari seberkas gandum potong dengan pengurbanan tak lama setelah pemberian panen gandum dan perayaan buah sulung yang diadakan pada akhir Perayaan Pekan panen gandum /Shavuot/Pentakosta menurut Hukum Musa Alkitab Perjanjian Lama: Ulangan 16:9-12 Imamat 23:10-16; atau pada tradisi hari raya Yahudi tertentu pada saat ini periode antara Paskah Yahudi atau Perayaan Roti Tak Beragi dan Shavuot. Ini adalah periode kedua dari tiga periode perayaan Hukum Musa tahunan."},{"page_url":"https://fr.wikipedia.org/wiki/Neobisium_carcinoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Neobisium_carcinoides_%2826034729015%29.jpg","page_title":"Neobisium carcinoides","context_page_description":"Neobisium carcinoides est une espèce de pseudoscorpions de la famille des Neobisiidae."},{"page_url":"https://it.wikipedia.org/wiki/Monastero_del_Tango","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/TangoMonastery.jpg","page_title":"Monastero del Tango","context_page_description":"Il monastero del Tango è un monastero buddhista situato 14 km a nord della città di Thimphu, la capitale del Bhutan. Fu fondato da Phajo Drugom Zhigpo nel XIII secolo e costruito nella sua forma attuale nel 1688 da Tenzin Rabgye, quarto Druk Desi del paese. È ritenuto un luogo sacro dai monaci che vi vivono, poiché nel 1616 nelle grotte vicine all'attuale monastero meditò lo Shabdrung Ngawang Namgyal."},{"page_url":"https://en.wikipedia.org/wiki/Adana_Toros_BYZ","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Adana_Toros_BYZ_team_photo.jpg","page_title":"Adana Toros BYZ","context_page_description":"Adana Toros BYZ is a volleyball club based in Adana. Club's men's team promoted to the top flight of the Turkish Men's Volleyball League in 2016, in just 5 years after the foundation. The club play their home games at the Menderes Sports Hall and is sponsored by Tatlıcı Köse, Sera Fresh, Bodyline and Anadolu Bal. Jersey colours are blue and navy."},{"page_url":"https://es.wikipedia.org/wiki/Ruf_CTR3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/RUF_CTR_3.jpg","page_title":"Ruf CTR3","context_page_description":"El Ruf CTR3 es un automóvil superdeportivo producido desde 2007 por Ruf Automobile. Sucesor del apodado Yellow Bird, el CTR3 salió 20 años después del CTR1.\\nEl CTR3 es el modelo superior de Ruf Automobile, aunque más el CTR3 Clubsport.​"},{"page_url":"https://nl.wikipedia.org/wiki/Slagelse_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Slagelses_segl.jpg","page_title":"Slagelse (plaats)","context_page_description":"Slagelse is een stad in de Deense regio Seeland, in de gelijknamige gemeente Slagelse. De plaats telt 31.879 inwoners."},{"page_url":"https://ast.wikipedia.org/wiki/Rapazos_xugando_a_soldaos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Ni%C3%B1os_jugando_a_soldados_%28boceto%29.jpg","page_title":"Rapazos xugando a soldaos","context_page_description":"Rapazos xugando a soldaos ye un cartón pa tapiz de Francisco Goya, entamáu pal antedormitorio de los Príncipes d'Asturies nel Palaciu del Pardo.\\nEsíbese anguaño nel Muséu del Prado. Caltiense un bocetu preparatorio pa esti cartón, na Coleición Yanduri de Sevilla."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BB%D0%B5%D1%85%D0%BE%D0%B2%D0%B8%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%C4%8Celechovice%2C_n%C3%A1ves_%282%29.jpg","page_title":"Челеховице","context_page_description":"Челеховице је насељено мјесто са административним статусом сеоске општине у округу Преров, у Оломоуцком крају, Чешка Република."},{"page_url":"https://da.wikipedia.org/wiki/Hamstere","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Goldhamster.jpg","page_title":"Hamstere","context_page_description":"Hamstere er en underfamilie til studsmusfamilien.\\nHamstere er en gruppe af små til mellemstore gnavere. Som hos andre arter af gnavere vokser hamsternes fortænder hele livet, men som noget specielt blandt gnavere har hamstere kindposer, som de bruger til at samle føde i og bære det hjem til deres bo for at æde under rolige forhold. Ordet hamster er beslægtet med at hamstre, altså at samle forråd. Ordet hamster er fælleskøn, dvs. at det hedder en hamster."},{"page_url":"https://ro.wikipedia.org/wiki/Montlivault","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Eglise_de_montlivaut.jpg","page_title":"Montlivault","context_page_description":"Montlivault este o comună în departamentul Loir-et-Cher, Franța. În 2009 avea o populație de 1333 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Grisuten","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Bundesarchiv_Bild_183-L0902-114%2C_Leipzig%2C_Messe%2C_neue_Mode.jpg","page_title":"Grisuten","context_page_description":"Grisuten ist ein Handelsname für die Polyesterfaser PE. In der DDR war Grisuten ein viel verwendeter Grundstoff der Bekleidungsindustrie.\\nDie Chemiefaser PE wurde 1946 erstmals in England entwickelt und erhielt Ende der 1960er-Jahre in der DDR die Handelsbezeichnung Grisuten. Betriebe, die ihre Textilien mit Grisuten kennzeichneten, waren Mitglied im „Warenzeichenverband für Kunststofferzeugnisse der DDR e.V.“. Grisuten hatte ähnliche Gebrauchseigenschaften wie die Polyamidfaser Dederon. Im Konsumgüterbereich eignete sich Grisuten besonders zur Herstellung sogenannter pflegearmer Blusen, für Regenmäntel, Anzug-, Kostüm- und Rockstoffe, Gardinen und Badebekleidung. Weitere Enderzeugnisse waren Filter, Planen und künstliche Arterien.\\nIn der Werbung wurde das mühelose Reinigen hervorgehoben, bei dem kein Stärken und Bügeln mehr nötig war.\\nDas Ausgangsprodukt für die Grisuten-Oberbekleidung, die Terephthalsäure wurde in dem Erdölverarbeitungswerkes Schwedt produziert und in Premnitz weiterverarbeitet. An diesem Standort werden auch 2017 noch Grisutenfasern durch die Märkische Faser GmbH hergestellt."},{"page_url":"https://es.wikipedia.org/wiki/Tithonia_diversifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Tithonia_diversifolia%2C_a_Mexican_Sunflower_in_Africa._%289439108054%29.jpg","page_title":"Tithonia diversifolia","context_page_description":"Tithonia diversifolia es una especie de plantas con flores de la familia de Asteraceae que comúnmente es conocida como árbol maravilla, falso girasol, quil amargo, tornasol mexicano, girasol mexicano, margaritona, árnica de la tierra, girasol japonés o crisantemo de Nitobe o también llamado Botón de Oro."},{"page_url":"https://oc.wikipedia.org/wiki/Nogent-sur-Seine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Moulin_de_Nogent-sur-Seine.JPG","page_title":"Nogent-sur-Seine","context_page_description":"Nogent-sur-Seine es una comuna francesa, situada dins lo departament d'Auba e la region de Champanha-Ardena."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Nieuw-Amsterdam_(Drenthe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Locatie_Nieuw-Amsterdam_in_Drenthe.png","page_title":"Nieuw-Amsterdam (Drenthe)","context_page_description":"Nieuw-Amsterdam sī Hô-lân Drenthe séng Emmen chū-tī-thé lāi-bīn ê chi̍t ê chng-thâu."},{"page_url":"https://de.wikipedia.org/wiki/Lebensweltorientierung","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Teilhabe-dimensionen.jpg","page_title":"Lebensweltorientierung","context_page_description":"Lebensweltorientierung ist ein in der Sozialen Arbeit von Hans Thiersch geprägter Begriff. Er gehört heute zum festen Bestandteil der theoretischen sowie praktischen Diskurse der Sozialen Arbeit. Der Begriff ist abgeleitet vom Begriff der Lebenswelt der Philosophie und Soziologie.\\nIn die Kritik kam der zunehmend beliebige Gebrauch des Lebensweltbegriffs im Bereich der Sozialen Arbeit beispielsweise durch Peter Fuchs und Bernd Halfar. In Auseinandersetzung dieser Kritik entwickelt Björn Kraus eine systemisch-konstruktivistische Perspektive der Lebensweltorientierung.\\nNach der Analyse von Literaturverzeichnissen in sozialarbeitswissenschaftlichen Publikationen kommt Jochem Kotthaus zum Ergebnis: „Dort werden zum Thema »Lebenswelt« immer wieder Namen wie Alfred Schütz, Jürgen Habermas sowie Peter Berger und Thomas Luckmann und Hans Thiersch sowie Björn Kraus zu finden sein – aus gutem Grund. Diese sind absolut unverzichtbar, um Lebenswelt bearbeiten zu können.“"},{"page_url":"https://bs.wikipedia.org/wiki/Kampor","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Rab_SEufemia.jpg","page_title":"Kampor","context_page_description":"Kampor je naseljeno mjesto u sastavu grada Raba, na ostrvu Rabu, Primorsko-goranska županija, Republika Hrvatska."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%98%D0%BD%D1%82%D0%BE%D1%80%D1%81%D1%83%D1%80%D0%B0-%D0%91%D1%83%D0%B7%D0%B5%D1%83%D0%BB%D1%83%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/ROU_CV_Intorsura_Buzaului_CoA1.jpg","page_title":"Инторсура-Бузеулуй","context_page_description":"Инторсура-Бузеулуй — місто у повіті Ковасна в Румунії. Адміністративно місту підпорядковані такі села:\\nБредет\\nСкредоаса\\nФлороая\\nМісто розташоване на відстані 137 км на північ від Бухареста, 28 км на південний схід від Сфинту-Георге, 32 км на схід від Брашова."},{"page_url":"https://en.wikipedia.org/wiki/Klaudy%C3%A1n_map_of_Bohemia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/1518bohemiamap.jpg","page_title":"Klaudyán map of Bohemia","context_page_description":"Klaudyán map is the earliest map of Bohemia. It was printed by Mikuláš Klaudyán, a printer from Mladá Boleslav. The ratio scale is 1:685000."},{"page_url":"https://en.wikipedia.org/wiki/Galactica_(roller_coaster)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Air_06.jpg","page_title":"Galactica (roller coaster)","context_page_description":"Galactica is a flying roller coaster located in the Forbidden Valley area of Alton Towers amusement park in Staffordshire, England and is the first flying coaster manufactured by Bolliger & Mabillard. Guests ride in a prone position and experience the feeling of flight by \\"flying\\" close to the ground, under footpaths, and narrowly past trees and rocks.\\nThe roller coaster originally opened as Air on 16 March 2002. Following the close of the 2015 season, the ride underwent refurbishment and reopened as Galactica on 24 March 2016. It features an 840-metre-long track, reaches a top speed of 75 km/h, and debuted a dedicated virtual reality experience, although this has since been removed."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Coswig_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Spitzgrundm%C3%BChle_2015.jpg","page_title":"Liste der Kulturdenkmale in Coswig (Sachsen)","context_page_description":"In der Liste der Kulturdenkmale in Coswig (Sachsen) sind sämtliche Kulturdenkmale der Gemeinde Coswig und seiner Ortsteile im sächsischen Landkreis Meißen aufgelistet. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://cs.wikipedia.org/wiki/Klement_%C5%A0ilinger","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Anatomick%C3%BD_%C3%BAstav_Lek._fak._UK-1-1.jpg","page_title":"Klement Šilinger","context_page_description":"Klement Šilinger byl slovenský architekt."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D8%A8%D9%84_%D8%A2%D9%8A_%D8%A2%D9%8A_%D8%A5%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Apple_Platinum_IIe.jpg","page_title":"ابل آي آي إي","context_page_description":"ابل آي آي إي ‏، هي نظام التشغيل التابع لشركة آبل لأنظمة الكمبيوتر، أنتجها وطورها شركة آبل، ظهرت في السوق شهر يناير عام 1983م، وتوقف صدورها نهائياً في شهر نوفمبر عام 1993م، وتعمل بنظامي آبل دوس3.3 و برو دوس."},{"page_url":"https://es.wikipedia.org/wiki/San_Clemente_(RN)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/San_Clemente_panorama.jpg","page_title":"San Clemente (RN)","context_page_description":"San Clemente es un municipio situado en el territorio de la provincia de Rímini, en Emilia-Romaña."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%B0_%D0%A1%D0%B5%D0%BD%D1%82-%D0%92%D0%B8%D0%BA%D1%82%D1%83%D0%B0%D1%80_(%D1%81%D0%B5%D1%80%D0%B8%D1%8F_%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/1904%2C_C%C3%A9zanne%2C_Mont_Sainte-Victoire.jpg","page_title":"Гора Сент-Виктуар (серия картин)","context_page_description":"«Гора Сент-Виктуар» — серия картин французского художника-постимпрессиониста Поля Сезанна, посвящённая одноимённой горной гряде в окрестностях Экс-ан-Прованса. В общей сложности насчитывается 87 работ Сезанна на данный сюжет.\\nРодившись в Экс-ан-Провансе, Сезанн с юных лет знал и любил окрестные пейзажи. Будучи учеником коллежа, он частенько бродил по этим местам со школьными друзьями — Эмилем Золя и Батистеном Байлем. И, разумеется, его внимание привлекала неизменная доминанта пейзажа — гора Сент-Виктуар, просматривающаяся из любой точки города и его округи. Даже и в зрелые годы Сезанн совершал восхождение на тысячеметровую вершину горы и неизменно восхищался ей.\\nПервые зарисовки горы Сент-Виктуар относятся к 1870 году. Они выполнены в Жа де Буффане — загородном доме, который в 1859 году приобрёл отец Сезанна и где художник оборудовал себе мастерскую.\\n15 октября 1877 года была открыта железнодорожная линия Экс — Марсель. Уже спустя полгода, в письме Эмилю Золя, датированном 14 апреля 1878 года, Сезанн описывает своё восхищение горой Сент-Виктуар, которую он наблюдал из окна поезда на этой линии, проходящего по железнодорожному мосту в долине реки Арк."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B9%B3%E5%86%85%E6%94%BF%E4%BF%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Wakaura_Tenmangu_romon.jpg","page_title":"平内政信","context_page_description":"平内政信または正信は、江戸時代の大工棟梁。紀伊国那賀郡出身。"},{"page_url":"https://nl.wikipedia.org/wiki/Alexandrine_Tinne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Alexandrine_Tinne_in_de_Haagse_Kazerne_%28circa_1860%29.jpg","page_title":"Alexandrine Tinne","context_page_description":"Alexandrine \\"Alexine\\" Pieternella Françoise Tinne was een Nederlandse ontdekkingsreizigster die in 1862 en 1863 als eerste westerse vrouw in Centraal-Afrika doordrong en vervolgens in 1868/69 ook als de eerste westerse vrouw ver in de Sahara reisde. Ook was ze Nederlands eerste belangrijke fotografe. Van locaties in Den Haag en het interieur van haar huis aan het Lange Voorhout maakte ze in de zomer 1860 en winter 1860/61 een veertigtal foto's van groot formaat.\\nIn het World Museum te Liverpool wordt een belangrijke verzameling etnografische voorwerpen uit Centraal- en Noord-Afrika van haar bewaard."},{"page_url":"https://de.wikipedia.org/wiki/Norev","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Norev_collection.jpg","page_title":"Norev","context_page_description":"Norev ist ein französischer Markenname, unter dem seit 1954 Spielzeug- und Modellautos vertrieben werden. Mit Stand 2019 sind solche in den Maßstäben 1:12, 1:18, 1:43, 1:50, 1:64 und 1:87 am Markt erhältlich. Diese Modellautos werden auch heute noch von der gleichnamige Firma Norev mit Sitz in Vaulx-en-Velin im östlichen Ballungsgebiet von Lyon vertrieben. Mit Stand 2017 erwirtschaftet die Firma mit rund 300 Mitarbeiter einen Umsatz von rund 14 Millionen Euro und vertrieb etwa 1'800'000 Modellautos.\\nDer Marken- und Firmenname basiert auf der umgekehrten Schreibweise des Familiennamen Véron der drei Brüder mit dem Vornamen Paul, Joseph und Émile, die die Firma im September 1945 gegründet haben. Émile Véron gründete 1961 auch die Firma Majorette, deren Markenname aktuell der Simba-Dickie-Group gehört, zu der auch die Firma Märklin gehört."},{"page_url":"https://hr.wikipedia.org/wiki/Popis_autocesta_u_Njema%C4%8Dkoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Bundesautobahn_215_map.png","page_title":"Popis autocesta u Njemačkoj","context_page_description":"Njemačke autoceste su označene velikim slovom A i brojčanom oznakom na plavoj podlozi. Sljedeće tablice prikazuje sve izgrađene autoceste u Njemačkoj."},{"page_url":"https://fy.wikipedia.org/wiki/Joseph_Kotalla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/JosephKotalla.jpg","page_title":"Joseph Kotalla","context_page_description":"Joseph Johann Kotalla wie yn de Twadde Wrâldoarloch haad fan de administraasje yn Kamp Amersfoart. Kotalla wie fertsjintwurdiger fan syn berop en wie ferskate kearen opnaam west fanwege psychyske problemen. Septimber 1942 waard hy fan Schutzhaftlagerführer II Karl Peter Berg yn Amersfoart oansteld.\\nEk nei dy oanstelling stie Kotalla ûnder behanneling fan in psychiater. Fan desimber 1942 ôf oant april 1943, waard hy ferplege op de psychiatryske ôfdieling fan in Dútsk militêr sikehûs yn De Haach. Kotalla wie UnterSchutzhaftlagerführer en yn dy fuksje ferfong hy Berg as kommandant at dy dêr net wie.\\nKotälla waard kwalifisearre as ien fan de meast wreedferneande kampbeulen fan Amersfoart en krige de bynamme Beul fan Amersfoart. Hy hie it fral net stean op Joaden en prysters. Kotalla die ferskate kearen mei yn in fjoerpeloton.\\nYn 1949 waard Kotalla ta de dea feroardiele, in straf dy't 1951 feroare waard yn libbenslange finzenisstraf. Hy waard yn Breda fêstset, mei Willy Lages, Ferdinand aus der Fünten en Franz Fischer. Kotalla stoar 1979 yn de finzenis fan Breda."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E5%B3%B6%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/%E4%B8%89%E5%B3%B6%E6%9A%A6.jpg","page_title":"三島市","context_page_description":"三島市為日本靜岡縣東部伊豆半島北端的都市。市內有著名的三嶋大社。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BB%D0%B0%D1%82%D0%B5%D1%80%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Bellaterra_FGC.JPG","page_title":"Беллатерра","context_page_description":"Беллатерра — децентралізоване муніципальне утворення муніципалітету Сарданьола-дал-Бальєс, кумарки Бальєс-Уксідантал, провінції Барселона, Каталонія."},{"page_url":"https://sv.wikipedia.org/wiki/Les_Mariages_samnites","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Andr%C3%A9_Ernest_Modeste_Gr%C3%A9try.jpg","page_title":"Les Mariages samnites","context_page_description":"Les Mariages samnites är en opéra comique i tre akter med musik av André Grétry och libretto av Barnabé Farmian Durosoy efter ett verk av Jean François Marmontel."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A9%D7%99%D7%9D_%D7%91%D7%9E%D7%93%D7%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Tu_Youyou_5012-1-2015.jpg","page_title":"נשים במדע","context_page_description":"לאורך תקופות ארוכות בהיסטוריה אפליית נשים וקיפוח זכויותיהן הרחיקו נשים ממדע. נשים נאלצו להיאבק על זכותן להשכלה מדעית, ועל זכותן לעסוק במדע. במשך דורות הוטלו על נשים הגבלות שונות, מכיוון שנטען שהן חסרות כישורים קוגניטיביים ורגשיים, ושיש בכך איום על יציבות החברה. עם זאת, הצליחו נשים מעטות להשתתף החל מראשית ההיסטוריה של המדע בפעילות המדעית, ותרמו בפיתוח ענפי מדע חדשים, ניסויים ותצפיות פורצי דרך ובניסוח תאוריות חדשות. אולם פעמים רבות חלקן של הנשים בתגליות חשובות לא הוכר, ויוחס לאחרים.\\nעל אף שחל שיפור ניכר במעמד האישה בכלל ובמעמדן של נשים במדע בפרט, גם כיום טרם הושג שוויון מלא בהשתתפות נשים במדע. ניתן לראות זאת ביחס הכמותי בין חוקרים לחוקרות באקדמיה, במספר הנשים הפונות ללימודים בחלק מהתחומים המדעיים ובמספר זוכות פרס נובל. בכל אלה מקומן היחסי והכמותי של נשים הוא נמוך. מיעוט נשים במדע פוגע לא רק באותן נשים שהתקדמות הקריירה המדעית שלהן נעצרה, אלא במדע עצמו. אם בקרב 50% מהאוכלוסייה יש קושי גדול להביא לידי ביטוי את הכישורים והיכולות הקיימים בו בתחום המחקר המדעי, יוצא המדע נפסד. בנוסף, פעילות של נשים במדע יכולה להביא ערך מוסף, הסתכלות מזווית אחרת ודרכי פעולה שונות, כך שהתרומה של הצטרפות יותר נשים למדע יכולה להיות לא רק כמותית אלא איכותית."},{"page_url":"https://sv.wikipedia.org/wiki/Baris_(skalbaggar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Baris_strenua_larva.jpg","page_title":"Baris (skalbaggar)","context_page_description":"Baris är ett släkte av skalbaggar som beskrevs av Ernst Friedrich Germar 1817. Baris ingår i familjen vivlar."},{"page_url":"https://vec.wikipedia.org/wiki/Cornay","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Village_de_Cornay.JPG","page_title":"Cornay","context_page_description":"Cornay el xé on comun de 63 abitanti del departemento de Ardennes che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://hu.wikipedia.org/wiki/Bruno_Verner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Bruno_Verner_of_Tetine.jpg","page_title":"Bruno Verner","context_page_description":"Bruno Verner brazil zeneszerző, költő, elektronikus zenész és performanszművész."},{"page_url":"https://es.wikipedia.org/wiki/Lenguas_austroasi%C3%A1ticas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Lenguas_austro-asi%C3%A1ticas.png","page_title":"Lenguas austroasiáticas","context_page_description":"Las lenguas austroasiáticas son una amplia familia de lenguas del sudeste asiático y la India. El nombre proviene de la palabra griega que significa 'Sur de Asia'.\\nEstas lenguas están distribuidas por regiones donde además se hablan lenguas de otras familias. Está bastante extendida la creencia de que las lenguas austroasiáticas son las lenguas autóctonas del sudeste asiático así como del este de la India, y que las otras lenguas de la región, incluso las indoeuropeas, las tai-kadái, y las lenguas sino-tibetanas, han llegado allí como resultado de movimientos poblacionales posteriores. Algunos lingüistas, siguiendo los planteamientos de Schmidt, sugieren que las lenguas austroasiáticas pueden estar emparentadas con las austronesias, formando así la supuesta superfamilia áustrica, no obstante, este planteamiento no goza de consenso.\\nLos lingüistas distinguen entre dos grandes divisiones de lenguas austroasiáticas, las mon-jemer, también llamadas mon-camboyanas del sudeste asiático y las lenguas munda del centro y del este central de la India."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_(%D0%92%D1%8B%D1%80%D0%B8%D1%86%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C%2C_%D0%92%D1%8B%D1%80%D0%B8%D1%86%D0%B0_%282%29.jpg","page_title":"Казанская церковь (Вырица)","context_page_description":"Це́рковь Каза́нской иконы Бо́жией Ма́тери — православный храм в посёлке Вырица Ленинградской области.\\nПриход храма относится к Гатчинской епархии Русской православной церкви, входит в состав Гатчинского районного благочиннического округа. Настоятель — протоиерей Георгий Николаевич Преображенский."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_der_Stadt_Bayreuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Wilhelm-von-Diez-Stra%C3%9Fe_Bayreuth_DSCF7090.JPG","page_title":"Liste der Straßen und Plätze der Stadt Bayreuth","context_page_description":"Die Liste der Straßen und Plätze der Stadt Bayreuth beschreibt das Straßensystem mit den entsprechenden historischen Bezügen. Sie erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://eu.wikipedia.org/wiki/Maine_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/MaineWisconsinTownHallOutagamieCountyWIS187.jpg","page_title":"Maine (Wisconsin)","context_page_description":"Maine Ameriketako Estatu Batuetako inkorporatutako herri bat da. Marathon konderrian kokatuta dago, Wisconsin estatuan. 831 biztanle ditu, 37,4 kilometro koadroko azaleran banatuta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_(%D0%A1%D1%96%D1%80%D0%B0%D0%BA%D1%83%D0%B7%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Mulini_-_Teatro_Greco_-_Siracusa.jpg","page_title":"Грецький театр (Сіракузи)","context_page_description":"Грецький театр (Сіракузи) — давньогрецький театр в місті Сіракузи, що згодом перейшов до Римської імперії."},{"page_url":"https://de.wikipedia.org/wiki/Ernst_Kirchbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Kirchbach_Ernst_Escena_Dramatica.jpg","page_title":"Ernst Kirchbach","context_page_description":"Ernst Sigismund Kirchbach war ein Historien- und Porträtmaler sowie Direktor der Kunstakademie in Santiago de Chile."},{"page_url":"https://fr.wikipedia.org/wiki/Gideon_Ezra","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Gidez.jpg","page_title":"Gideon Ezra","context_page_description":"Gideon Ezra, né le 30 juin 1937 à Jérusalem et mort le 17 mai 2012, est un parlementaire à la Knesset israélienne. Ministre de l'environnement du 18 janvier 2006 au 31 mars 2009.\\nIl a étudié la géographie et les sciences politiques à l'université de Haïfa."},{"page_url":"https://pl.wikipedia.org/wiki/Galeria_Sztuki_%E2%80%9EDw%C3%B3r_Karwacjan%C3%B3w%E2%80%9D_w_Gorlicach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Dw%C3%B3r_Karwacjan%C3%B3w_w_Gorlicach.jpg","page_title":"Galeria Sztuki „Dwór Karwacjanów” w Gorlicach","context_page_description":"Galeria Sztuki „Dwór Karwacjanów” w Gorlicach – oddział Muzeum Dwory Karwacjanów i Gładyszów w Gorlicach, w latach 1983-1999 Galeria Sztuki w Gorlicach - oddział Nowosądeckiego Biura Wystaw Artystycznych."},{"page_url":"https://es.wikipedia.org/wiki/Pennatulacea","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Pennatula_rubra.jpg","page_title":"Pennatulacea","context_page_description":"Los pennatuláceos son un orden de cnidarios octocoralarios. Su nombre deriva de su aspecto similar a una pluma de escribir antigua.\\nEn realidad, cada pluma consta de numerosos animales interconectados, llamados pólipos, que se agrupan en colonias. Se forman a partir de un pólipo axial altamente modificado, que desarrolla un tallo, o raquis, que soporta los pólipos secundarios. En la base del pólipo axial tienen un bulbo o pedúnculo que está anclado en la arena o el barro, mientras que los pólipos situados en la parte superior se encargan de capturar alimentos en suspensión con sus tentáculos. Sus especies son los únicos octocorales adaptados para vivir en sedimentos limosos o arenosos.​\\nLa colonia está soportada normalmente por un eje interno, en forma de vara, compuesto de calcita pero sin escleritos, similar a la estructura de algunas gorgonias. Pueden alcanzar más de 1,5 m de altura, pero la mayoría es más pequeña.\\nLas 15 familias de Pennatulacea, actualmente consideradas válidas, están caracterizadas en gran medida por la disposición de los pólipos secundarios alrededor del raquis, con algunas familias que muestran una simetría bilateral en la colonia.​"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B1%82%E5%AD%90%E6%A8%A1%E5%9E%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/%E5%9F%BA%E6%9C%AC%E7%B2%92%E5%AD%90%E7%90%86%E8%AE%BA%E7%A0%94%E7%A9%B6%E5%BA%A7%E8%B0%88%E4%BC%9A.jpg","page_title":"层子模型","context_page_description":"層子模型是中國粒子物理理論工作者1966年提出的相對論性的強子結構模型。模型依據「無限可分」思想，認為強子內部由「層子」構成，使用強子內部結構波函數及其重疊積分來描述強子的結構和轉化過程。"},{"page_url":"https://it.wikipedia.org/wiki/Vittuone","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Vittuone_Chiesa_Annunciazione.jpg","page_title":"Vittuone","context_page_description":"Vittuone è un comune italiano di 9 276 abitanti della città metropolitana di Milano in Lombardia."},{"page_url":"https://de.wikipedia.org/wiki/Henning_Grunwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Portrait_Henning_Grunwald.jpg","page_title":"Henning Grunwald","context_page_description":"Henning Grunwald, eigentlich Hans-Henning Glade, war ein deutscher Schriftsteller und Verfasser von Romanen, Essays und Gedichten."},{"page_url":"https://sv.wikipedia.org/wiki/Bryce_Canyon_nationalpark","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Bryce_Canyon_visitors_center.jpg","page_title":"Bryce Canyon nationalpark","context_page_description":"Bryce Canyon nationalpark är en nationalpark belägen i Garfield County och Kane County i sydvästra Utah i USA. Inne i nationalparken ligger Bryce Canyon. Trots namnet är det egentligen ingen kanjon, utan mer en naturlig amfiteater skapad av erosion längs den östra sidan av Paunsaugunt Plateau. Bryce Canyon är utmärkande på grund av sina unika geologiska strukturer, kallade hoodoos, formade av vind, vatten och iserosioner av flod- och sjöbäddssedimentärstenar. De röda, oranga och vita färgerna av stenarna ger spektakulära vyer.\\nBryce Canyon ligger mycket högre än den närliggande Zion nationalpark och södra sidan av Grand Canyon. Höjden uppe på platån varierar mellan 2 400 och 2 700 meter över havsytan. Områdena har därför mycket olika ekologi och klimat, vilket ger den som besöker alla tre parkerna en väldigt kontrastrik upplevelse av regionen.\\nKanjonområdet bosattes av mormonpionjärer under 1850-talet och namngavs efter Ebenezer Bryce som bodde i området 1875. Området runt Bryce Canyon blev ett av USA:s nationalmonument 1924 och blev nationalpark 1928. Parken täcker ett område på 145 km²."},{"page_url":"https://en.wikipedia.org/wiki/Doolin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Doolin-Gus-OConnors-Pub-2012.JPG","page_title":"Doolin","context_page_description":"Doolin is a coastal village in County Clare, Ireland, on the Atlantic coast. It borders the spa town of Lisdoonvarna. It is a noted centre of traditional Irish music, which is played nightly in its pubs, making it a popular tourist destination. There are numerous nearby archaeological sites, many dating to the Iron Age and earlier. Doonagore Castle and Ballinalacken Castle are also in the area. The area was officially classified as part of the West Clare Gaeltacht prior to the 1950s, and maintains a connection with Irish-speaking areas - including via its maritime connection with the Aran Islands."},{"page_url":"https://lt.wikipedia.org/wiki/Slovakijos_v%C4%97liava","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Flag_of_Slovakia_vertical_%28gabbe%29.jpg","page_title":"Slovakijos vėliava","context_page_description":"Slovakijos vėliava – suskirstyta į tris vienodo aukščio horizontalias juostas: viršutinę baltą, vidurinę mėlyną, apatinę raudoną. Į kairę pusę nuo centro įkomponuotas Slovakijos herbas.\\nVėliava įteisinta 1992 m. rugsėjo 3 d."},{"page_url":"https://en.wikipedia.org/wiki/Jacquemart_de_Hesdin","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Jacquemart_de_Hesdin_002.jpg","page_title":"Jacquemart de Hesdin","context_page_description":"Jacquemart de Hesdin was a French miniature painter working in the International Gothic style. In English, he is also called Jacquemart of Hesdin. During his lifetime, his name was spelt in a number of ways, including as Jacquemart de Odin."},{"page_url":"https://it.wikipedia.org/wiki/V%C3%ADctor_Mario_P%C3%A9rez","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Basketball_Puerto_Rico.png","page_title":"Víctor Mario Pérez","context_page_description":"Víctor Mario Pérez López è stato un cestista e allenatore di pallacanestro portoricano."},{"page_url":"https://en.wikipedia.org/wiki/Wallersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Wallersdorf_in_DGF.png","page_title":"Wallersdorf","context_page_description":"Wallersdorf is a market town and municipality in the district of Dingolfing-Landau in Bavaria in Germany."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%96%84%E6%89%B6%E6%9E%97%E8%8A%B1%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/HK_%E8%8F%AF%E5%AF%8C%E9%82%A8_Wah_Fu_Estate_%E8%8A%B1%E5%9C%92%E5%B9%B3%E5%8F%B0_platform_view_North_Bus_Terminal_March-2012.jpg","page_title":"薄扶林花園","context_page_description":"薄扶林花園是香港南區的一個私人住宅屋苑，位於香港島薄扶林薄扶林道180號，由長江實業及新鴻基地產合作發展，於1979年12月入伙，由6幢住宅大樓組成，合共提供1,120個住宅單位。"},{"page_url":"https://es.wikipedia.org/wiki/Maguncia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mainzer_Fastnacht_Zug-Ente_2004.jpg","page_title":"Maguncia","context_page_description":"Maguncia​ es la capital del estado federado alemán de Renania-Palatinado. Es una ciudad situada en el suroeste de Alemania, a orillas del río Rin, en la margen opuesta a la desembocadura del Meno, por lo que es un importante puerto fluvial de Alemania. En la orilla contraria se encuentra la ciudad de Wiesbaden, en el estado de Hesse.\\nDestaca por ser el lugar donde Johannes Gutenberg inventó la imprenta de caracteres móviles. Actualmente Maguncia ha vuelto a ser centro de los medios de comunicación, ya que alberga la sede de la ZDF, el segundo canal más importante del medio televisivo alemán.\\nAunque fue gravemente dañada durante la Segunda Guerra Mundial, la ciudad conserva gran parte de su casco antiguo, en el que destacan las construcciones realizadas en piedra de color rojo.\\nMaguncia tiene universidad propia desde 1477, denominada actualmente Universidad Johannes Gutenberg, ubicada cerca del centro de la ciudad. Su antiguo campus no solo comprende aulas y salas de conferencia, sino también viviendas, bares y restaurantes que constituyen un barrio independiente.\\nCon 215.110 habitantes, es la tercera ciudad más grande de la región Rin-Meno."},{"page_url":"https://fr.wikipedia.org/wiki/Loznica_(Ma%C4%8Dva)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Vukov_Dom_Kulture.JPG","page_title":"Loznica (Mačva)","context_page_description":"Loznica prononcé en français : /lɔznitsa/ est une ville de Serbie située dans le district de Mačva. Au recensement de 2011, la ville intra muros comptait 18 714 habitants et le territoire dont elle est le centre, appelé Ville de Loznica, 78 788."},{"page_url":"https://gl.wikipedia.org/wiki/Arco_de_Constantino","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Arch.of.constantine.threequarter.view.arp.jpg","page_title":"Arco de Constantino","context_page_description":"O Arco de Constantino é un arco de triunfo que se atopa a entre o Coliseo e a cuíña do Palatino, en Roma. É un dos 3 arcos que permanece na Vía do Foro Imperial, xunto co Arco de Tito e o Arco de Septimio Severo.\\nO arco foi ergueito polo Senado para conmemorar a vitoria de Constantino I o Grande contra Maxencio na batalla de Ponte Milvio, o 28 de outubro de 312, e para conmemorar, tamén, a outros emperadores anteriores. Foi inaugurado o 25 xullo de 315 sendo, polo tanto, o máis moderno dos arcos triunfais alzados na Roma Antiga, diferenciándose tamén por estar construído a partir dos materiais de edificios anteriores."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%DB%8C%D8%AE_%DA%A9%D8%B1%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Welcome_Celebration_for_Red_Army_in_Pyongyang2.JPG","page_title":"تاریخ کره","context_page_description":"دوره پارینه‌سنگی زیرین در شبه‌جزیره کره و منچوری از حدود یک میلیون سال پیش آغاز شد. قدمت نخستین سفال‌های کره به حدود ۸ هزارسال پیش از میلاد بازمی‌گردد. دوران نوسنگی در حدود ۶ هزارسال پیش از میلاد در کره آغاز شد و کره در ۲ هزار سال پیش از میلاد وارد عصر برنز و در حدود ۷۰۰ پیش از میلاد وارد عصر آهن شد."},{"page_url":"https://de.wikipedia.org/wiki/Uetersen","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Uetersen_Marktplatz_02.JPG","page_title":"Uetersen","context_page_description":"Die Stadt Uetersen liegt im Kreis Pinneberg in Schleswig-Holstein. Sie ist als Chorstadt des Nordens und Rosen- und Hochzeitsstadt an der Pinnau bekannt. Uetersen gehört zur Metropolregion Hamburg, zur Maritimen Landschaft Unterelbe und zur AktivRegion Pinneberger Marsch & Geest. Die Kleinstadt mit etwa 18.000 Einwohnern ist eine der dichtbesiedelten Städte in Schleswig-Holstein. Die Stadt dient den ländlichen Kommunen im südwestlichen Kreis Pinneberg als Unterzentrum und Anlaufpunkt für die Versorgung des Bedarfs an Dienstleistungen, Gütern und Infrastruktureinrichtungen. Insgesamt versorgt die Stadt im Umland ein Einzugsgebiet mit rund 50.000 Menschen. Seit einigen Jahren strebt sie als größtes Unterzentrum in Schleswig-Holstein die Anerkennung als Unterzentrum mit Teilfunktionen eines Mittelzentrums an.\\nDie Stadt verfügt über keine Gründungsurkunde. Als Gründungsjahr wird 1234 angenommen, das Jahr, in dem die Stadt erstmals urkundlich erwähnt wurde. Seit 1933 wird dieses Datum offiziell landesgeschichtlich anerkannt.\\nDie Geschichte der Stadt wurde überwiegend durch Brände, Kriege, Katastrophen und Unglücke geprägt. So brannte der damalige Ort mehrmals fast vollständig ab."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%A2%D8%AB%D8%A7%D8%B1_%D8%B3%D9%87%D8%B1%D8%A7%D8%A8_%D8%B3%D9%BE%D9%87%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Untitled_by_Sohrab_Sepehri_%2841%29.jpg","page_title":"فهرست آثار سهراب سپهری","context_page_description":"فهرست آثار سهراب سپهری یک فهرست ناکامل از کارهای سهراب سپهری است."},{"page_url":"https://da.wikipedia.org/wiki/Fur_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Det_lille_Land_-_Fur_Fossiler.JPG","page_title":"Fur Museum","context_page_description":"Fur Museum er et naturhistorisk museum beliggende i Nederby på øen Fur i Limfjorden. Museet besidder og udstiller en omfattende samling af tidlig eocæne fossiler fra Fur Formationen, et jordlag der i daglig tale kaldes for moleret, og det underliggende Stolleklint Ler på Fur. Museet fortæller om egnens geologi og er samtidig er et lokalmuseum med kulturhistorisk, etnologisk og arkæologisk virke på Fur. Museet er en del af Museum Salling.\\nLivet på Fur gennem de sidste 200 år opleves på museumsgården eller i det gamle bundgarnshus ved Gammel Havn."},{"page_url":"https://ru.wikipedia.org/wiki/Canadian_National_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Canadian_National_System_Map.PNG","page_title":"Canadian National Railway","context_page_description":"Canadian National Railway Company — крупнейшая в Северной Америке железнодорожная сеть, расположенная на территории Канады и США с общей протяжённостью полотна свыше 30 000 км. Создана в 1919 году в результате амальгамации нескольких существующих железных дорог в единую национальную корпорацию, приватизирована в 1995 году и в дальнейшем расширена за счёт объединения с железнодорожными сетями на территории США."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%95%D7%96%D7%99%D7%90%D7%95%D7%9F_%D7%9C%D7%AA%D7%95%D7%9C%D7%93%D7%95%D7%AA_%D7%99%D7%94%D7%95%D7%93%D7%99_%D7%A4%D7%95%D7%9C%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Museum_of_the_History_of_Polish_Jews_inside_2013_02.JPG","page_title":"המוזיאון לתולדות יהודי פולין","context_page_description":"המוזיאון לתולדות יהודי פולין הוא מוזיאון השוכן בוורשה בירת פולין, המציג את ההיסטוריה של יהדות פולין.\\nהמוזיאון ממוקם בשטח שבו נמצא בעבר גטו ורשה, במקום שבו ניצב בניין מפקדת היודנראט, ליד רחוב אנילביץ' ומול האנדרטה לזכר גיבורי גטו ורשה של הפסל נתן רפופורט."},{"page_url":"https://en.wikipedia.org/wiki/Assassin%27s_Creed_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Pope_Alexander_Vi.jpg","page_title":"Assassin's Creed II","context_page_description":"Assassin's Creed II is a 2009 action-adventure video game developed by Ubisoft Montreal and published by Ubisoft. It is the second major installment in the Assassin's Creed series, a sequel to 2007's Assassin's Creed. The game was first released on the PlayStation 3 and Xbox 360 in November 2009, and was later made available on Microsoft Windows in March 2010 and OS X in October 2010. Several minor game related features could be redeemed on Uplay and three downloadable expansion packs were released on Xbox Live.\\nThe plot is set in a fictional history setting and follows the centuries-old struggle between the Assassins, who fight for peace with free will, and the Knights Templars, who desire peace through control. The framing story is set in the 21st century and follows Desmond Miles as he relives the genetic memories of his ancestor Ezio Auditore da Firenze. The main narrative takes place at the height of the Renaissance in Italy during the 15th and early 16th century. Players can explore Florence, Venice, Tuscany and Forlì as they guide Ezio on a quest for vengeance against those responsible for betraying his family."},{"page_url":"https://fr.wikipedia.org/wiki/Niewirk%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Niewirkow-Palac.jpg","page_title":"Niewirków","context_page_description":"Niewirków est un village de la gmina de Miączyn, du powiat de Zamość, dans la voïvodie de Lublin, situé dans l'est de la Pologne.\\nIl se situe à environ 5 kilomètres au sud de Miączyn, 19 kilomètres à l'est de Zamość et 90 kilomètres au sud-est de Lublin."},{"page_url":"https://nl.wikipedia.org/wiki/SVC_2000","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/LOGO_SVC2000.png","page_title":"SVC 2000","context_page_description":"SVC2000 is een amateurvoetbalvereniging uit Roermond in de gelijknamige gemeente, Limburg, Nederland."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%B9%B1%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Broad_billed_prion.jpg","page_title":"鹱科","context_page_description":"鹱科是鸟纲鹱形目的一科，是一类大型海鸟，广泛分布于世界各地海域。有12属72种。"},{"page_url":"https://en.wikipedia.org/wiki/Spanish_sparrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/SpanishSparrowMap.svg","page_title":"Spanish sparrow","context_page_description":"The Spanish sparrow or willow sparrow is a passerine bird of the sparrow family Passeridae. It is found in the Mediterranean region and south-west and central Asia. It is very similar to the closely related house sparrow, and the two species show their close relation in a \\"biological mix-up\\" of hybridisation in the Mediterranean region, which complicates the taxonomy of this species."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%B3%E3%82%AC%E3%83%9D%E3%83%BC%E3%83%AB%E3%82%B0%E3%83%A9%E3%83%B3%E3%83%97%E3%83%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/1_singapore_f1_night_race_2012_city_skyline.jpg","page_title":"シンガポールグランプリ","context_page_description":"シンガポールグランプリは、シンガポールで行われる自動車レース。2008年以降はF1世界選手権の1戦として、「マリーナベイ・ストリート・サーキット」で行われている。"},{"page_url":"https://da.wikipedia.org/wiki/Yasuyo_Yamasaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/YasuyoYamasaki.jpg","page_title":"Yasuyo Yamasaki","context_page_description":"Oberst Yasuyo Yamasaki ledede de japanske styrker på Attu under Slaget om Aleuterne.\\nYamasaki var en professionel hærofficer, og han blev forfremmet til oberst i marts 1940. Senere samme år, overtog han kommandoen over det 130. infanteriregiment.\\nI februar 1943, blev Yamasaki chef for den 2. distriktstyrke i Nordhavets forsvarsstyrke, i hvilken egenskab tog han til Aleuterne. Han ankom til Attu i april 1943 med ubåd. Hans opgave var at holde øen uden hjælp udefra.\\nDe 2.650 forsvarere under Yamasaki, ville ikke imødegå en landgang ved kysten, men foretrak at forskanse sig i de højtliggende områder langt væk fra kysten. Slaget gav nogle af de blodigste kampe i Stillehavskrigen, svarende til slagene om Iwo Jima og Okinawa.\\nDen 29. maj, angreb de sidste af de japanske styrker pludselig nær Massakre Bay i et af de største banzaiangreb i Stillehavskrigen. Angrebet blev ledet af Yamasaki selv, der blev dræbt senere på dagen, med sit sværd i hånden, mens han angreb Engineer Hill. Hans angreb trængte de amerikanske linjer langt nok tilbage til at japanerne kunne angribe chokerede amerikanske støtteenheder i bagområderne."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_sv%C4%9Btsk%C3%BDch_%C5%99%C3%AD%C5%A1sk%C3%BDch_kn%C3%AD%C5%BEat_a_kn%C3%AD%C5%BEectv%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Rieneck.PNG","page_title":"Seznam světských říšských knížat a knížectví","context_page_description":"Tento článek představuje seznam světských knížecích rodů a knížectví Svaté říše římské."},{"page_url":"https://en.wikipedia.org/wiki/List_of_shipwrecks_of_western_Lake_Superior","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Mentor_ship.png","page_title":"List of shipwrecks of western Lake Superior","context_page_description":"Since the 19th century, there have been several losses in both the Minnesota and the Wisconsin portion of western Lake Superior. Out of the known shipwrecks in the region, 25 of them are listed on the National Register of Historic Places. This list includes both shipwrecks in Lake Superior and the Saint Louis River."},{"page_url":"https://es.wikipedia.org/wiki/Galeana_(Nuevo_Le%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Morangos_hidroponicos.JPG","page_title":"Galeana (Nuevo León)","context_page_description":"Galeana es una población del estado de Nuevo León, localizada al sur del estado y cabecera del municipio del mismo nombre.\\nGaleana fue el lugar de nacimiento de Mariano Escobedo, general republicano, héroe de la Guerra de Reforma y de la Intervención Francesa. Nació el 16 de enero de 1826, ahí recibió la educación elemental y se dedicó a la agricultura.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%83%A9%E3%82%BD%E3%83%89%E3%83%AD%E3%83%A1%E3%82%A6%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Thalassodromeuswitton2.jpg","page_title":"タラソドロメウス","context_page_description":"タラソドロメウス は、白亜紀前期にブラジルに生息していた翼竜。ほぼ完全な頭骨と下顎は長さ1.5mに達し、サンタナ層の翼竜としては大きい方で翼開長は約4mである。\\n非常に大きなトサカと、先端が鋭く尖った嘴を持つ。その嘴の形状から、現存するハサミアジサシのように海面に嘴を差し入れ、飛びながら表層の魚類を捕食していたと推測され、学名はその推測に因んでつけられた。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%8A%D9%86%D8%A7%D8%AA%D9%88_%DA%86%D9%88%D8%A7%D9%88_%D8%A7%D9%8A%D9%86%D8%A7%D8%B3%D9%8A%D9%88_%D9%85%D8%A7%D8%B1%D8%AC%D8%A7%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Dinamo-Omonia_%2813%29.jpg","page_title":"ريناتو چواو ايناسيو مارجاكا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nريناتو چواو ايناسيو مارجاكا لاعب كورة قدم من البرتغال."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_1937_der_Deutschen_Reichspost","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/DR_1937_643_Luftschutz.jpg","page_title":"Briefmarken-Jahrgang 1937 der Deutschen Reichspost","context_page_description":"Der Briefmarken-Jahrgang 1937 der Deutschen Reichspost umfasste 17 Sondermarken, die meisten waren mit einem Zuschlag versehen. Dauermarken wurden in diesem Jahr keine herausgegeben. Dabei waren vier Briefmarkenblocks mit je vier gleichen Briefmarken, die sich von Block zu Block nur durch zusätzliche Aufdrucke zu den verschiedenen Anlässen unterschieden bzw. bei einem Block nicht gezähnt wurden. Es gibt keine verlässlichen Angaben zu der Auflagenhöhe der Briefmarken."},{"page_url":"https://en.wikipedia.org/wiki/Glenn_Spencer_(baseball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/GlennSpencerGoudeycard.jpg","page_title":"Glenn Spencer (baseball)","context_page_description":"Glenn Spencer was a Major League Baseball pitcher who played five seasons with the Pittsburgh Pirates and the New York Giants of the National League from 1928 to 1933. His best season came in 1931 when he went 11–12 with a 3.42 earned run average in 38 games."},{"page_url":"https://af.wikipedia.org/wiki/FC_Wageningen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Stadion_Wageningse_Berg.jpg","page_title":"FC Wageningen","context_page_description":"FC Wageningen is 'n voormalige Nederlandse sokkerklub uit Wageningen. Wageningen is op 27 Augustus 1911 gestig en in 1992 ontban, weens 'n skuldlas van 500 000 gulden. Die span se tuisveld was die Wageningse Berg. FC Wageningen het twee keer die KNVB-Beker gewen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%B1%D0%B5%D0%B6%D1%83%D0%B2_(%D0%B3%D0%BC%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Dolina_Kobyla%C5%84ska_a7.jpg","page_title":"Забежув (гмина)","context_page_description":"Забежув — сельская гмина в Польше, входит как административная единица в Краковский повят, Малопольское воеводство. Население — 22 257 человек."},{"page_url":"https://pt.wikipedia.org/wiki/Solanaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Solandra_maxima_1.jpg","page_title":"Solanaceae","context_page_description":"Solanaceae, é uma família de plantas com flor do grupo das dicotiledóneas, com espécies herbáceas e outras lenhosas, em geral com folhas alternas, simples e sem estípulas, pertencente à ordem Solanales. Na sua presente circunscrição taxonómica agrupa cerca de 98 géneros e mais de 2700 espécies, com grande diversidade de hábito, morfologia e ecologia. Apresenta distribuição natural do tipo cosmopolita, estando presente em todos os continentes com excepção da Antártida, mas com centro de diversidade na América do Sul e na América Central. Inclui espécies com grande valor económico, como a batata, o tomate, o tabaco, os pimentos e pimentões e ornamentais como Petunia, Schizanthus, Salpiglossis e Datura. Algumas espécies são conhecidas como plantas medicinais, pelos seus efeitos psicotrópicos ou por serem venenosas. A solanáceas incluem vários organismos modelo usados em biologia celular, molecular e genética, entre as quais o tabaco e a petúnia."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%A6%E0%B3%81%E0%B2%97%E0%B3%8D%E0%B2%A7%E0%B2%B0%E0%B2%B8_%E0%B2%97%E0%B3%8D%E0%B2%B0%E0%B2%82%E0%B2%A5%E0%B2%BF_(Lymph_Node)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Crc_met_to_node1.jpg","page_title":"ದುಗ್ಧರಸ ಗ್ರಂಥಿ (Lymph Node)","context_page_description":"ದುಗ್ಧರಸ ಗ್ರಂಥಿ ಯು ಪ್ರತಿರಕ್ಷಣಾ ವ್ಯವಸ್ಥೆಯ ಸಣ್ಣ, ಗೋಲಾಕಾರದ ಅಂಗವಾಗಿದೆ. ಇದು ಶರೀರದಾದ್ಯಂತ ವ್ಯಾಪಕವಾಗಿ ವಿತರಣೆಯಾಗಿದ್ದು, ದುಗ್ಧರಸ ನಾಳಗಳ ಮೂಲಕ ಒಂದಕ್ಕೊಂದು ಸಂಪರ್ಕದಲ್ಲಿದೆ. B, T ಮತ್ತು ಇತರೆ ಪ್ರತಿರಕ್ಷಣಾ ಜೀವಕೋಶಗಳಿಗೆ ದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳು ಕೋಟೆಯಂತೆ ರಕ್ಷಣೆ ನೀಡುತ್ತವೆ.\\nದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳು ಶರೀರದುದ್ದಕ್ಕೂ ಹರಡಿದ್ದು, ಯಾವುದೇ ಬಾಹ್ಯವಸ್ತು ಅಥವಾ ಕಣಗಳ ವಿರುದ್ಧ ಶೋಧಕ ಅಥವಾ ಬೋನುಗಳಂತೆ ವರ್ತಿಸುತ್ತವೆ. ಪ್ರತಿರಕ್ಷಣಾ ವ್ಯವಸ್ಥೆಯು ಸರಿಯಾದ ರೀತಿಯಲ್ಲಿ ಕಾರ್ಯನಿರ್ವಹಿಲು ಈ ದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳು ಬಹಳ ಮುಖ್ಯವಾಗಿವೆ.\\nದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳು ವೈದ್ಯಕೀಯವಾಗಿಯೂ ಪ್ರಾಮುಖ್ಯತೆ ಹೊಂದಿವೆ. ಗಂಟಲಿನ ಸೋಂಕಿನಂತಹ ಕ್ಷುಲ್ಲಕ ಸ್ಥಿತಿಗಳಿಂದ ಹಿಡಿದು, ಜೀವಕ್ಕೇ ಅಪಾಯವಾಗುವಂತಹ ಕ್ಯಾನ್ಸರ್‌ ರೋಗಗಳ ವರೆಗೆ ವಿವಿಧ ಸ್ಥಿತಿಗಳಲ್ಲಿ ಈ ಗ್ರಂಥಿಗಳ ಊತ ಅಥವಾ ಉಬ್ಬುವಿಕೆ ಸ್ಥಿತಿಯುಂಟಾಗುತ್ತದೆ. ಕ್ಯಾನ್ಸರ್‌ ವಿಚಾರದಲ್ಲಿ, ದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳ ಸ್ಥಿತಿ ಅದೆಷ್ಟು ಗಮನಾರ್ಹವಾಗಿ ಬದಲಾಗಿರುತ್ತದೆ ಎಂದರೆ, ಕ್ಯಾನ್ಸರ್‌ ಹಂತಗಳನ್ನು ಗುರುತಿಸಲು ಈ ದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳ ಸ್ಥಿತಿಯನ್ನು ಬಳಸಲಾಗುತ್ತದೆ. ಇದನ್ನು ಆಧರಿಸಿ, ನೀಡಬೇಕಾದ ಚಿಕಿತ್ಸಾ ಕ್ರಮ ಮತ್ತು ವ್ಯಾಧಿಯ ಗತಿಯ ಮುಂಗಾಣ್ಕೆಯನ್ನು ನಿರ್ಣಯಿಸಬಹುದಾಗಿದೆ.\\nದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳ ಊತ ಸಂಭವಿಸಿದಾಗೆಲ್ಲ, ಅಂಗಾಂಶ ಪರೀಕ್ಷೆಯ ಮೂಲಕವೂ ಸಹ ರೋಗನಿರ್ಣಯ ಮಾಡಬಹುದಾಗಿದೆ. ಕೆಲವು ರೋಗಗಳು ಆಗಾಗ್ಗೆ ದುಗ್ಧರಸ ಗ್ರಂಥಿಗಳ ಮೇಲೆ ದೃಢವಾಗಿ ಮತ್ತು ಗೊತ್ತಾದ ಸ್ಥಳದಲ್ಲಿ ಪರಿಣಾಮ ಉಂಟುಮಾಡುತ್ತವೆ."},{"page_url":"https://eo.wikipedia.org/wiki/NGC_2276","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/NGC2276-HST-R814GB555.jpg","page_title":"NGC 2276","context_page_description":"NGC 2276 estas galaksio en konstelacio Cefeo.\\nĈi tiu objekto estis jam en la originala versio de NGC-katalogo."},{"page_url":"https://fr.wikipedia.org/wiki/Sony_Mavica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Sony_Mavica_1981_prototype_CP%2B_2011.jpg","page_title":"Sony Mavica","context_page_description":"Mavica est une gamme d'appareils photographiques électroniques conçue et produite par Sony et qui utilisent des disques amovibles comme unités de stockage.\\nLes appareils photographiques originaux Mavica étaient basés sur la technologie vidéo analogique. Les modèles suivants, Digital Mavica, étaient des appareils photographiques numériques."},{"page_url":"https://pl.wikipedia.org/wiki/Cewk%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Cewk%C3%B3w%2C_cerkiew_%C5%9Bw._Dymitra_%28HB11%29.jpg","page_title":"Cewków","context_page_description":"Cewków – wieś w Polsce położona na Płaskowyżu Tarnogrodzkim, w województwie podkarpackim, w powiecie lubaczowskim, w gminie Stary Dzików."},{"page_url":"https://nl.wikipedia.org/wiki/Vexillum_leucodesma","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Vexillum_leucodesma_001.jpg","page_title":"Vexillum leucodesma","context_page_description":"Vexillum leucodesma is een slakkensoort uit de familie van de Costellariidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1845 door Reeve."},{"page_url":"https://fi.wikipedia.org/wiki/Elton_John","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Elton_john_cher_show_1975.JPG","page_title":"Elton John","context_page_description":"Sir Elton Hercules John, CBE on englantilainen poplaulaja, pianisti ja lauluntekijä. Hän on myynyt yli 450 miljoonaa levyä urallaan, joka kattaa viisi vuosikymmentä.\\nJohnin uran suurin kaupallinen menestys ajoittui 1970-luvulle, jolloin hän saavutti Yhdysvaltain albumilistan kärjen seitsemän kertaa peräkkäin. Kuusi kappaletta nousi ykköseksi, 16 pääsi Top 10:een ja 23 Top 40:een. Suurimman suosionsa aikaan hän teki albumejaan tiiviissä yhteistyössä sanoittaja Bernie Taupinin kanssa ja pukeutui huomiota herättävästi, mikä toi värikkyyttä hänen esiintymisiinsä.\\n1990-luvun alussa John myönsi kärsineensä uransa aikana huumeongelmista, alkoholismista ja bulimiasta. Hän on edelleen esillä julkisuudessa ja jatkaa AIDSin vastaista taistoa, jossa hän on ollut mukana 1980-luvun lopulta alkaen. Hän pääsi Rock and Roll Hall of Fameen vuonna 1994, ja hänet aateloitiin vuonna 1998."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%88%D0%BE%D0%B2%D0%B0_(%D1%80%D1%96%D1%87%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/uk/0/0c/Sylikatny_zavod_Koshova_Kherson.jpg","page_title":"Кошова (річка)","context_page_description":"Кошова́ — річка на півдні України, права притока Дніпра.\\nПочинається відразу ж біля Херсона, в районі річкового вокзалу. Місце відгалуження р. Кошової від Дніпра прийнято вважати вершиною дніпрової дельти. В районі селища Дніпровське річка розділяється на два рукави та утворює острів Рожок, близько кілометра завдовжки."},{"page_url":"https://cy.wikipedia.org/wiki/Team_Sky","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Sky_Tour_2010_stage_1_start.jpg","page_title":"Team Sky","context_page_description":"Tîm beicio proffesiynol Prydeinig yw Team Sky sy'n cystadlu ar Gylchdaith Proffesiynol yr UCI. Lleolir y tîm yng Nghanolfan Seiclo Cenedlaethol Prydain yn y Felodrom ym Manceinion, Lloegr, gyda chanolfan cynorthwyol yng Ngwlad Belg a chanolfan reoli yn Quarrata, Yr Eidal. Rheolir y tîm gan gyn-gyfarwyddwr perfformiad British Cycling, Dave Brailsford."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%80%D0%B5%D0%B2%D1%8F%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%B0_%D0%9D%D0%B8%D0%B6%D0%BD%D0%B5%D0%B3%D0%BE_%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F%2C_34_%D0%94%D0%BE%D0%BC_%D0%9A._%D0%9F%D0%BE%D0%BB%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D0%B0.JPG","page_title":"Деревянная архитектура Нижнего Новгорода","context_page_description":"Деревянная архитектура Нижнего Новгорода — совокупность стилей и направлений в деревянной архитектуре Нижнего Новгорода, комплекс культурного и исторического наследия деревянной и каменно-деревянной архитектуры города XIX — начала XX веков.\\nВ течение большей части истории Нижнего Новгорода, с XIII по 20-е годы XX века, его застройка была преимущественно деревянной. По мнению исследователей архитектуры, деревянная городская застройка XIX — начала XX веков — уникальный феномен, не имеющий аналогов в мировой культуре и самая яркая особенность русского исторического города. Многие исследователи указывают, что для Нижнего Новгорода она — важнейший элемент национального и местного колорита, отличающий Нижний Новгород от Москвы и Санкт-Петербурга, а также неотъемлемый элемент градостроительной ткани и городской культуры.\\nДеревянная архитектура города развивалась в общем русле русского зодчества, каждый этап был подвержен влиянию господствовавшего стиля: русского классицизма, эклектики, модерна и ретроспективизма. Значительное влияние на неё оказали местные традиции народного деревянного зодчества, в частности знаменитая Нижегородская глухая домовая резьба."},{"page_url":"https://pl.wikipedia.org/wiki/Brechin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Scotia_Depicta_-_Brechin_Castle_-Plate-.jpg","page_title":"Brechin","context_page_description":"Brechin – miasto w Szkocji, w Angus."},{"page_url":"https://lt.wikipedia.org/wiki/Brazilija","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Coat_of_Arms_of_Brazil.png","page_title":"Brazilija","context_page_description":"Brazilijos Federacinė Respublika – valstybė Pietų Amerikos žemyne, didžiausia ir daugiausiai gyventojų turinti šio žemyno valstybė. Brazilija yra didžiausia pagal plotą ir gyventojų skaičių portugališkai kalbanti valstybė pasaulyje. Šalis taip pat yra penkta pagal užimamą plotą ir gyventojų skaičių pasaulio valstybė.\\nŠalis užima didelę teritoriją tarp Andų kalnų ir Atlanto vandenyno, bei ribojasi su Urugvajumi, Argentina, Paragvajumi, Bolivija, Peru, Kolumbija, Venesuela, Gajana, Surinamu ir Prancūzijos Gviana.\\nBrazilija buvo Portugalijos kolonija nuo Pedro Kabralo išsilaipinimo 1500 m. iki nepriklausomybės paskelbimo 1822 m. Iš pradžių tapusi nepriklausoma kaip Brazilijos imperija, respublika su dvejų rūmų įstatymų leidžiamąja valdžia, įkurta 1824 m. ratifikavus pirmąją konstituciją, egzistavo iki 1889 m. Dabartinė Konstitucija Braziliją apibrėžia kaip federalinę respubliką. Federaciją sudaro federalinės teritorijos sąjunga, 26 valstijos bei 5564 savivaldybės.\\nBrazilijos ekonomika yra penkta pasaulyje pagal BVP ir aštunta pasaulyje pagal perkamosios galios paritetą. Šalis laikoma turinti vieną labiausiai augančių ekonomikų pasaulyje."},{"page_url":"https://fi.wikipedia.org/wiki/Ringstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bim_im_abendlichen_Wien.jpg","page_title":"Ringstraße","context_page_description":"Ringstraße on Itävallan Wienin vanhaa kaupunkia ympäröivä osittain yksisuuntainen kehäkatu. Sen eri osilla on nimet: Stubenring, Parkring, Schubert-Ring, Kärtner Ring, Opernring, Burgring, Dr.-Karl-Renner-Ring, Universitätsring ja Schottenring.\\nPormestari Karl Luegerin mukaan nimetty Dr.-Karl-Lueger-Ring herätti närää, ja Wienin kaupunki päätti vuonna 2012 muuttaa nimen Universitätsringiksi.\\nRingstraßen kohdalla sijaitsi aiemmin Wienin kaupunginmuuri, mutta se purettiin 1800-luvun lopulla keisarin käskystä, ja tilalle rakennettiin kehämäinen puistokatu."},{"page_url":"https://sv.wikipedia.org/wiki/Barkeria_lindleyana","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Barkeria_lindleyana_ssp._vanneriana_Orchi_2012-12-01_010.jpg","page_title":"Barkeria lindleyana","context_page_description":"Barkeria lindleyana är en orkidéart som beskrevs av James Bateman och John Lindley. Barkeria lindleyana ingår i släktet Barkeria och familjen orkidéer."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_prefeitos_de_S%C3%A3o_Bernardo_do_Campo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Italo-Stefanini.jpg","page_title":"Lista de prefeitos de São Bernardo do Campo","context_page_description":"Esta é a lista de prefeitos e vice-prefeitos de São Bernardo do Campo, município do estado brasileiro de São Paulo.\\nCriado em 12 de março de 1889 e com instalação efetiva do município em 02 de maio de 1890, o município de São Bernardo compreendia praticamente toda a área do atual Grande ABC. Sua sede era a Vila de São Bernardo, que corresponde ao atual centro da cidade de São Bernardo do Campo. Em 1938, a sede foi transferida para o distrito de Santo André, São Bernardo foi rebaixado à condição de distrito e a cidade foi renomeada para Santo André. Em 1 de janeiro de 1945, São Bernardo retoma sua autonomia, emancipando-se de Santo André.\\nEntre sua fundação e o dia 29 de setembro de 1892, o município foi governado pelo Conselho de Intendência, composto por três integrantes nomeados pelo governo estadual. Com a instalação da Câmara Municipal em 1892, os vereadores passam a escolher entre si um único intendente – denominação que seria alterada para prefeito. O sistema de eleição indireta pela Câmara vigorou até 1930, ano que marca o fim da República Velha. A partir daí, os prefeitos passaram a ser nomeados pelo governador do Estado de São Paulo."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E7%A9%BA%E8%BB%8D%E8%BB%8D%E5%82%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Curtiss_A-12_ROCAF.jpg","page_title":"中華民國空軍軍備","context_page_description":"中華民國空軍軍備羅列出中華民國空軍退役及現役的軍事裝備。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B3%D1%80%D0%B8%D1%86%D0%BA%D0%B8%D0%B9,_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D0%91%D0%B0%D0%B7%D0%B0%D1%80%D0%BD%D0%B0_%D0%B2%D1%83%D0%BB.%2C_40_%D0%A2%D0%B0%D0%B1%D0%BB%D0%B8%D1%87%D0%BA%D0%B0.jpg","page_title":"Багрицкий, Эдуард Георгиевич","context_page_description":"Эдуа́рд Гео́ргиевич Багри́цкий — русский поэт «Серебряного века», переводчик и драматург, художник-график."},{"page_url":"https://de.wikipedia.org/wiki/Luis_Vernet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Vernet_Luis_10_Pesos.png","page_title":"Luis Vernet","context_page_description":"Luis Elias Vernet war ein Kaufmann aus einer Hugenottenfamilie. Als erster argentinischer Inselkommandant auf den Falklandinseln gründete er dort 1829 mit einer Gruppe von Briten und Deutschen eine Kolonie. Seine Bemühungen, mit einer permanenten Siedlung die eigenen wirtschaftlichen Interessen und die argentinischen Hoheitsansprüche auf den Falklandinseln umzusetzen, fanden international keine Anerkennung und wurden 1831 durch eine militärische Intervention der USA zunichtegemacht."},{"page_url":"https://it.wikipedia.org/wiki/Crawfordsville_(Arkansas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Crawfordsville_AR_002.jpg","page_title":"Crawfordsville (Arkansas)","context_page_description":"Crawfordsville è un comune degli Stati Uniti d'America, situato in Arkansas, nella contea di Crittenden."},{"page_url":"https://de.wikipedia.org/wiki/University_Wits","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Rgreene.jpg","page_title":"University Wits","context_page_description":"University Wits ist ein Begriff, der für eine Gruppe von englischen Theaterautoren und Verfassern von Flugschriften des späten 16. Jahrhunderts steht, welche an den Universitäten Oxford oder Cambridge studierten und zu populären Autoren wurden. Prominente Mitglieder dieser Gruppe waren Christopher Marlowe, Robert Greene und Thomas Nashe von der Cambridge sowie John Lyly, Thomas Lodge und George Peele von der Oxford. Thomas Kyd wird auch dazu gezählt, hat aber vermutlich nie an einer Universität studiert.\\nVon Manfred Pfister werden sie als akademisch gebildete Söhne mittelloser oder wenig begüterter Familien beschrieben, welche keine gesicherte gesellschaftliche Stellung hatten. Aber hierzu auch literarisch begabte Angehörige der niederen Gentry.\\nDiese vielfältige und talentierte lockere Verbindung Londoner Schriftsteller und Dramatiker bereitete die Bühne für das Elisabethanische Theater. Sie gelten als die frühesten professionellen Schriftsteller in englischer Sprache und bereiteten den Weg für die Schriften von William Shakespeare, der nur zwei Monate nach Christopher Marlowe geboren wurde."},{"page_url":"https://vi.wikipedia.org/wiki/D%C6%A1i_qu%E1%BA%A1_%C4%91eo_k%C3%ADnh","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Spectacled_Flying-fox.png","page_title":"Dơi quạ đeo kính","context_page_description":"Dơi quạ đeo kính là một loài động vật có vú trong họ Dơi quạ, bộ Dơi. Loài này được Gould mô tả năm 1849. Loài dơi này sống ở khu vực phía đông bắc của Úc Queensland. Nó cũng được tìm thấy trong New Guinea và hải đảo bao gồm đảo Woodlark, đảo Alcester, Kiriwina, Halmahera. Dơi quạ đeo kính đã được liệt kê như là một loài bị đe dọa theo Đạo luật Bảo vệ Môi trường và Bảo tồn đa dạng sinh học năm 1999. Chúng được coi là dễ bị tổn thương do một sự suy giảm đáng kể về số lượng do kết quả của việc mất nơi sống và các điểm cắm trại tách biệt. Người ta cũng ghi nhận rằng loài dơi đeo kính bay lướt qua bề mặt nước để uống và bị cá sấu bắt Chiều dài đầu và thân 22–24 cm, tay trước dài 157–181 mm, trọng lượng 400–1000 g."},{"page_url":"https://en.wikipedia.org/wiki/Georges_Doussot","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Georges_Doussot_1924.jpg","page_title":"Georges Doussot","context_page_description":"Georges Doussot was a French boxer. He competed in the 1924 Summer Olympics.\\nIn 1924, Doussot was eliminated in the first round of the welterweight class after losing his fight to Al Mello."},{"page_url":"https://en.wikipedia.org/wiki/James_Thomas_Brown","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/James_Thomas_Brown.png","page_title":"James Thomas Brown","context_page_description":"James Thomas Brown was a lawyer, judge and political figure in Saskatchewan. He represented Souris in the Legislative Assembly of Saskatchewan from 1905 to 1908 as a Provincial Rights Party member.\\nHe was born in Huntingdon, Quebec, the son of Samuel Brown and Margaret White, and was educated there and at McGill University. Brown moved to Manitoba in 1833 and to Saskatchewan in 1896. He practised law in Moosomin, Saskatchewan and later served as Crown Prosecutor for Assiniboia district. In 1922, he married Alice M. Lewis. Brown was an unsuccessful candidate for a seat in the House of Commons in 1908. He later lived in Regina. Brown served as a puisne judge for the Supreme Court of Saskatchewan. He was named Chief Justice for the Saskatchewan Court of King's Bench in 1918. Brown died in Regina on April 28, 1957, at the age of 86."},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_Park_Taganaj","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D0%94%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%A2%D0%B0%D0%B3%D0%B0%D0%BD%D0%B0%D0%B9%2C_%D1%85%D1%80%D0%B5%D0%B1%D0%B5%D1%82_%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%A2%D0%B0%D0%B3%D0%B0%D0%BD%D0%B0%D0%B9%2C_%D0%B2%D0%B8%D0%B4_%D0%BD%D0%B0_%D0%B3._%D0%AE%D1%80%D0%BC%D0%B0.jpg","page_title":"Nationaal Park Taganaj","context_page_description":"Nationaal Park Taganaj is een nationaal park gelegen in de Oblast Tsjeljabinsk van Rusland en behoort geografisch gezien tot de Zuidelijke Oeral. De oprichting vond plaats op 5 maart 1991 per decreet van de Raad van Ministers van de Russische SFSR en heeft een oppervlakte van 568,43 km². Het doel van de oprichting was om een van de meest unieke delen van de Zuidelijke Oeral te beschermen, het gelijknamige bergmassief Taganaj."},{"page_url":"https://en.wikipedia.org/wiki/Guaman%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Guaman%C3%AD%2C_Guayama%2C_Puerto_Rico_locator_map.png","page_title":"Guamaní","context_page_description":"Guamaní is a barrio in the municipality of Guayama, Puerto Rico. Its population in 2010 was 1,455."},{"page_url":"https://vi.wikipedia.org/wiki/Deuterocohnia_haumanii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Deuterocohnia_haumanii_%28TS%29_2-00809.jpg","page_title":"Deuterocohnia haumanii","context_page_description":"Deuterocohnia haumanii là một loài thực vật có hoa trong họ Bromeliaceae. Loài này được A.Cast. mô tả khoa học đầu tiên năm 1929."},{"page_url":"https://es.wikipedia.org/wiki/Tom_Carruth","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Rosa-homerun.jpg","page_title":"Tom Carruth","context_page_description":"Tom Carruth es un horticultor rosalista estadounidense que ha estado creando nuevos obtentores de rosas nuevas desde la década de 1980 en que empezó a trabajar con Weeks Roses Inc., Ontario, California.​\\nTom Carruth es uno de los hibridadores de rosas más importantes de los Estados Unidos. Fue galardonado con el primer premio de All-America Rose Selections en 1997 con la floribunda a rayas llamada 'Scentimental' y desde entonces ha recibido otros por 8 nuevas rosas más, en tan solo un periodo de 11 años.\\nCarruth debe ser reconocido, junto con Jack E. Christensen, como creador de 'Crystalline' la rosa favorita de los rosalistas. Jugó un papel decisivo en la introducción en el mercado estadounidense de la rosa de Gareth Fryer 'Sunset Celebration' que fue premiada en AARS."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AA%E3%83%A5%E3%83%BC%E3%83%AB%E3%81%AE%E3%82%A2%E3%82%A6%E3%82%B0%E3%82%B9%E3%83%88%E3%82%A5%E3%82%B9%E3%83%96%E3%83%AB%E3%82%AF%E5%9F%8E%E3%81%A8%E5%88%A5%E9%82%B8%E3%83%95%E3%82%A1%E3%83%AB%E3%82%B1%E3%83%B3%E3%83%AB%E3%82%B9%E3%83%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/BR%C3%BCHLschloss5.jpg","page_title":"ブリュールのアウグストゥスブルク城と別邸ファルケンルスト","context_page_description":"ブリュールのアウグストゥスブルク城と別邸ファルケンルストは、ドイツの世界遺産の一つで、1984年に登録された。ブリュールにあるこれら二つの建物は、シュロス庭園で繋がっている。"},{"page_url":"https://sk.wikipedia.org/wiki/Doubravice_(okres_Strakonice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Flag_of_Doubravice_%28okres_Strakonice%29.jpg","page_title":"Doubravice (okres Strakonice)","context_page_description":"Doubravice je obec v Česku v okrese Strakonice v Juhočeskom kraji. 1. januára 2012 tu žilo 265 obyvateľov, z toho 144 mužov a 121 žien, pričom priemerný vek v obci bol 41,4 roka."},{"page_url":"https://en.wikipedia.org/wiki/The_Flower_of_No_Man%27s_Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/The_Flower_of_No_Man%27s_Land.jpg","page_title":"The Flower of No Man's Land","context_page_description":"The Flower of No Man's Land is a lost 1916 silent film drama directed by John H. Collins and starring Viola Dana. It was distributed by Metro Pictures."},{"page_url":"https://nl.wikipedia.org/wiki/Villettes","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Map_commune_FR_insee_code_27692.png","page_title":"Villettes","context_page_description":"Villettes is een gemeente in het Franse departement Eure en telt 125 inwoners. De plaats maakt deel uit van het arrondissement Évreux."},{"page_url":"https://en.wikipedia.org/wiki/Robert_Bosch_GmbH","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bosch_Abstatt_Luftbild.jpg","page_title":"Robert Bosch GmbH","context_page_description":"Robert Bosch GmbH, or Bosch, is a German multinational engineering and technology company headquartered in Gerlingen, near Stuttgart, Germany. The company was founded by Robert Bosch in Stuttgart in 1886. Bosch is 92% owned by Robert Bosch Stiftung, a charitable institution.\\nBosch's core operating areas are spread across four business sectors: mobility, consumer goods, industrial technology and energy and building technology."},{"page_url":"https://en.wikipedia.org/wiki/Threshing_machine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Agriculture_of_Bangladesh_10.jpg","page_title":"Threshing machine","context_page_description":"A threshing machine or a thresher is a piece of farm equipment that threshes grain, that is, it removes the seeds from the stalks and husks. It does so by beating the plant to make the seeds fall out.\\nBefore such machines were developed, threshing was done by hand with flails: such hand threshing was very laborious and time-consuming, taking about one-quarter of agricultural labour by the 18th century. Mechanization of this process removed a substantial amount of drudgery from farm labour. The first threshing machine was invented circa 1786 by the Scottish engineer Andrew Meikle, and the subsequent adoption of such machines was one of the earlier examples of the mechanization of agriculture. During the 19th century, threshers and mechanical reapers and reaper-binders gradually became widespread and made grain production much less laborious.\\nMichael Stirling is said to have invented a rotary threshing machine in 1758 which for forty years was used to process all the corn on his farm at Gateside. No published works have yet been found but his son William made a sworn statement to his minister to this fact. He also gave him the details of his father's death in 1796."},{"page_url":"https://de.wikipedia.org/wiki/St.-Georgs-Kirche_(Dinkelsb%C3%BChl)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Dinkelsb%C3%BChl_M%C3%BCnster_St._Georg_034.JPG","page_title":"St.-Georgs-Kirche (Dinkelsbühl)","context_page_description":"Die katholische Stadtpfarrkirche St. Georg in Dinkelsbühl, einer Stadt im mittelfränkischen Landkreis Ansbach, ist eine spätgotische Hallenkirche. Inmitten der Stadt gelegen, wurde das Münster in den Jahren 1448 bis 1499 nach Plänen von Niclaus Eseler erbaut."},{"page_url":"https://nl.wikipedia.org/wiki/Obrium","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Obrium.cantharinum.-.calwer.38.01.jpg","page_title":"Obrium","context_page_description":"Obrium is een kevergeslacht uit de familie van de boktorren. De wetenschappelijke naam van het geslacht werd voor het eerst geldig gepubliceerd in 1821 door Dejean."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%BF%CE%BB%CE%BF%CE%BA%CF%85%CE%BD%CE%B8%CE%BF%CF%8D_(%CE%91%CE%B8%CE%AE%CE%BD%CE%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Athens_center_map.PNG","page_title":"Κολοκυνθού (Αθήνα)","context_page_description":"Η Κολοκυνθού είναι δυτική συνοικία του Δήμου Αθηναίων. Συνορεύει με Κολωνό την Ακαδημία Πλάτωνα και τους Δήμους Αιγάλεω και Περιστερίου. Μέχρι πριν από τριάντα χρόνια η περιοχή είχε πολλά περιβόλια και χωράφια."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B8%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD_%D0%89%D1%83%D0%B1%D0%B8%D1%88%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Visarion_Ljubisa_1884_Vilimek.png","page_title":"Висарион Љубиша","context_page_description":"Висарион Љубиша је био митрополит црногорско-приморски од 1882. до 1884. године.\\nРођен је 1823. године у селу Свети Стефан у племену Паштровића. Изгубио оца, који је био морнар, као и многи од његових сународника, када је имао само три године. Када је достигао школски узраст, мајка га је послала код његовог деде, игумана Саве Љубише, у манастир Прасквицу. Завршио је основну школу у Рисну а затим православну свештеничку школу у Шибенику, која је у 1841. уздигнута на ранг богословије."},{"page_url":"https://hu.wikipedia.org/wiki/Peru_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Compa%C3%B1%C3%ADa_de_Jesus_D%C3%A9cembre_2007_-_Vue_de_C%C3%B4t%C3%A9.jpg","page_title":"Peru világörökségi helyszínei","context_page_description":"Peru területéről eddig tizenkét helyszín került fel a Világörökségi Listára, huszonnégy helyszín a javaslati listán várakozik a felvételre."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D9%88%D8%B3%D9%8A%D9%87_%D9%85%D8%A7%D8%B1%D9%8A%D8%A7_%D9%85%D8%A7%D9%86%D9%88%D9%8A%D9%84_%D9%83%D9%88%D8%B1%D8%AA%D9%8A%D9%86%D8%A7_%D8%A8%D9%8A%D8%B1%D9%8A%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Jos%C3%A9_Mar%C3%ADa_Manuel_Cortina_P%C3%A9rez.jpg","page_title":"خوسيه ماريا مانويل كورتينا بيريز","context_page_description":"خوسيه ماريا مانويل كورتينا بيريز ‏ هو مهندس معماري إسباني، ولد في 1868 في بلنسية في إسبانيا، وتوفي بنفس المكان في 1950."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Utrecht_(stad)/Voorstraat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Voorstraat37.JPG","page_title":"Lijst van rijksmonumenten in Utrecht (stad)/Voorstraat","context_page_description":"De stad Utrecht telt in totaal 1402 inschrijvingen in het rijksmonumentenregister. De Voorstraat in het centrum telt 17 rijksmonumenten. Hieronder een overzicht."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D9%88%D8%A7%D9%84%D8%AF%D9%88_%DA%A9%D8%A7%D8%AA%D8%A7%D9%86%D8%A6%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Tower_grutti_gualdo_cattaneo.JPG","page_title":"قوالدو کاتانئو","context_page_description":"قوالدو کاتانئو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۵۹۹۵ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۴۴۶ متر یۇکسک‏لیکده یئر آلیب. و اومبریا اوستانیندا یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Damer_(crater)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Damer_crater_MESSENGER_WAC_IGF_to_RGB.jpg","page_title":"Damer (crater)","context_page_description":"Damer is a crater on Mercury in the Shakespeare quadrangle. Its diameter is 60 km. It was named after the English sculptor Anne Seymour Damer in 2013."},{"page_url":"https://nn.wikipedia.org/wiki/Sandvika_stasjon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Sandvika_stasjon_-_2009-05-01_at_13-34-00.jpg","page_title":"Sandvika stasjon","context_page_description":"Sandvika stasjon er ein jarnbanestasjon i Sandvika i Bærum kommune for lokal persontrafikk, sams for Drammenbanen og Askerbanen. Stasjonen har inngang og venterom under spora, med oppgang til kvar av perrongane. Ein bussterminal og ein drosjehaldeplass er knytt beinveges til stasjonen.\\nStasjonen vart opna i 1872, men på det noverande stasjonsområdet er det ikkje noko att av det opphavlege. Eit særkjenne for Sandvika stasjon er eit eldre stillverkshus i mur over spora, det finst ikkje noko liknande her i landet. Stillverkshuset er ikkje i bruk."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D5%B6%D5%AB%D5%AF%D5%A1_%D4%BF%D5%B8%D6%82%D5%B7%D5%AB%D5%B6%D5%BD%D5%AF%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Monika_Kuszy%C5%84ska.jpg","page_title":"Մոնիկա Կուշինսկա","context_page_description":"Մոնիկա Կուշինսկա, լեհ երգչուհի, երգահան։ Նախկինում եղել է Varius Manx խմբի մենակատարը։ Ներկայացրել է Լեհաստանը Եվրատեսիլ 2015 երգի միջազգային մրցույթում:"},{"page_url":"https://de.wikipedia.org/wiki/Rouvres-sur-Aube","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Petrifying_waterfall_%282693916092%29.jpg","page_title":"Rouvres-sur-Aube","context_page_description":"Rouvres-sur-Aube ist eine französische Gemeinde mit 106 Einwohnern im Département Haute-Marne in der Region Grand Est. Sie gehört zum Arrondissement Langres und zum Kanton Villegusien-le-Lac. Die Einwohner werden Rouvrois genannt."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%8E%92%E4%B8%8B%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/201907_Concourse_of_Paixia_Station.jpg","page_title":"排下站","context_page_description":"排下站是福州地鐵1號線的一座中間站，位於福州市倉山區福峽路與南三環路交口的北側，2016年5月18日開通試營運。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%BA%A5%E8%A6%BA%E7%90%86%E5%A4%A7%E5%AD%B8%E5%9C%96%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Old_Library_Bookshelves%2C_Macquarie_University.JPG","page_title":"麥覺理大學圖書館","context_page_description":"麥覺理大學圖書館是麥覺理大學的主圖書館，藏書180萬冊。圖書採用美國國會圖書館圖書分類法進行分類。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C%D0%BD%D0%B0_%D0%BF%D1%80%D0%BE%D0%BC%D0%B8%D1%81%D0%BB%D0%BE%D0%B2%D1%96%D1%81%D1%82%D1%8C_%D0%B2_%D0%9D%D0%94%D0%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Trabant_nT_%28front_quarter%29.jpg","page_title":"Автомобільна промисловість в НДР","context_page_description":"Автомобільна промисловість НДР — галузь економіки НДР.\\nАвтомобільна промисловість НДР існувала в період з 1945 по 1990 роки. Вона була заснована практично відразу після закінчення Другої світової війни на території Радянської окупаційної зони Німеччини. До 1970-х років XX століття була однією з провідних галузей республіки, значна частина продукції відправлялася на експорт в країни Європи, Азії, Африки і на Кубу. За виробництвом автомобілів серед соціалістичних країн НДР разом з Чехословаччиною була на другому-третьому місці після СРСР до середини 1970-х рр, коли поступилася Польщі, а потім також Югославії в середині 1980-х років і Китаю в кінці 1980-х років. Щорічне виробництво поступово зростало весь час до досягнення максимуму у майже в 265 тис. одиниць в 1986 році, після чого дещо впало. Автомобільна промисловість НДР була фактично ліквідована на початку 1990-х в ході об'єднання НДР і ФРН, знову увійшовши в автопром єдиної Німеччини.\\nАвтомобілебудування НДР за роки свого існування зазнавало значні труднощі."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D1%81_%D0%BB%D0%B0%D1%9E%D1%80%D1%8D%D0%B0%D1%82%D0%B0%D1%9E_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%B5%D1%9E%D1%81%D0%BA%D0%B0%D0%B9_%D0%BF%D1%80%D1%8D%D0%BC%D1%96%D1%96_%D0%BF%D0%B0_%D1%85%D1%96%D0%BC%D1%96%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Nobel2004chemistrylaurets-Hershko.jpg","page_title":"Спіс лаўрэатаў Нобелеўскай прэміі па хіміі","context_page_description":"Но́белеўская прэ́мія па хі́міі — найвышэйшая ўзнагарода за навуковыя дасягненні ў галіне хіміі, якая штогод прысуджаецца Шведскай каралеўскай акадэміяй навук у Стакгольме. Адна з пяці Нобелеўскіх прэмій, заснаваных у 1895 годзе паводле запавету шведскага хіміка Альфрэда Нобеля, які памёр у 1896 годзе. Гэтыя прэміі прысуджаюцца за выдатныя заслугі ў галінах хіміі, фізікі, літаратуры, міру і фізіялогіі або медыцыны. У адпаведнасці з запаветам Нобеля прэмія знаходзіцца ў падпарадкаванні Фонду Нобеля і прысуджаецца камісіяй з пяці членаў, якія выбіраюцца Шведскай каралеўскай акадэміяй навук. Лаўрэатам першай Нобелеўскай прэміі па хіміі ў 1901 годзе стаў Якаб Хендрык вант Гоф з Нідэрландаў. Кожны лаўрэат атрымлівае медаль, дыплом і грашовы прыз, які змяняецца з цягам часу. У 1901 годзе вант Гоф атрымаў 150 782 шведскія кроны, што ў снежні 2008 года было эквівалентна 7 731 004 шведскім кронам. Пачынаючы з 2001 года кожная грашовая ўзнагарода складала 10 мільёнаў шведскіх крон. Прэмія ўручаецца на штогадовай цырымоніі 10 снежня, у гадавіну смерці Альфрэда Нобеля."},{"page_url":"https://de.wikipedia.org/wiki/Oberamt_R%C3%B6tteln","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Offenburg_Wappen_family_1.jpg","page_title":"Oberamt Rötteln","context_page_description":"Das Oberamt Rötteln war seit dem 16. Jahrhundert ein Verwaltungsbezirk der Markgrafschaft Baden-Durlach und von 1771 bis 1803 der Markgrafschaft Baden, 1803 bis 1806 des Kurfürstentums Baden und 1806 bis 1810 des Großherzogtums Baden. Der Sitz des Oberamts war zunächst auf der Burg Rötteln und nach deren Zerstörung in Lörrach."},{"page_url":"https://fr.wikipedia.org/wiki/Yves_Archambault","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Bernie_Parent.jpg","page_title":"Yves Archambault","context_page_description":"Yves Archambault est un joueur professionnel de hockey sur glace en Amérique du Nord."},{"page_url":"https://sv.wikipedia.org/wiki/Humiriaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Vantanea_guianensis.jpg","page_title":"Humiriaceae","context_page_description":"Humiriaceae är en familj av tvåhjärtbladiga växter. Humiriaceae ingår i ordningen malpigiaordningen, klassen tvåhjärtbladiga blomväxter, fylumet kärlväxter och riket växter. Enligt Catalogue of Life omfattar familjen Humiriaceae 62 arter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://eu.wikipedia.org/wiki/Iporanga","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bandeira_Iporanga.png","page_title":"Iporanga","context_page_description":"Iporanga Brasilgo udalerri bat da, São Pauloko estatuan kokatua. 4.333 biztanle ditu 1.152,059 km²ko eremuan."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tel_de_ville_de_Dunkerque","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Town_hall_of_Dunkerque_-_statue_of_Jean-Marie_Joseph_Emmery_-_detail-7579.jpg","page_title":"Hôtel de ville de Dunkerque","context_page_description":"L’hôtel de ville de Dunkerque est un bâtiment centenaire. Endommagé pendant les deux guerres mondiales, il fut à chaque fois restauré. En 2005, le beffroi de l'hôtel de ville est admis au patrimoine mondial de l'UNESCO parmi les beffrois de Belgique et de France. La ville de Dunkerque en compte deux, le second étant le beffroi de l'église Saint-Éloi à une centaine de mètres de la mairie.\\nL'hôtel de ville est le centre administratif de la ville, comme dans la plupart des villes, s'y déroulent conseil municipal, mariage, état civil, etc. mais c'est également un des endroits incontournables de la bande de Dunkerque lors du carnaval. La porte Jean-Bart, le beffroi de l'hôtel de ville ainsi que sa façade et les toitures sont inscrits au titre de monument historique."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D9%84%D8%A7%D8%AC%D9%88_%D8%AF%D9%89_%D9%BE%D9%8A%D8%A7%D9%86%D8%A7_%D8%AF%D9%8A%D8%AC%D9%84%D9%89_%D8%A7%D9%84%D8%A8%D8%A7%D9%86%D9%8A%D8%B3%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/LagoPianaDegliAlbanesi.JPG","page_title":"بحيره لاجو دى پيانا ديجلى البانيسى","context_page_description":"لاجو دى پيانا ديجلى البانيسى بحيره فى ايطاليا."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B1%9F%E6%B1%89%E8%B7%AF%E7%AB%99_(%E6%AD%A6%E6%B1%89%E5%9C%B0%E9%93%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Jianghan_Road_Station_13.jpg","page_title":"江汉路站 (武汉地铁)","context_page_description":"江汉路站是武汉地铁2号线与6号线的换乘车站，位于武汉市江汉区。"},{"page_url":"https://la.wikipedia.org/wiki/Colin_Maclaurin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Colin_Maclaurin_%28Buchan-Ferguson%29.jpg","page_title":"Colin Maclaurin","context_page_description":"Colin Maclaurin fuit mathematicus Scoticus. Cadogan fuit sodalis Regalis Societatis Londiniensis, cui anno 1719 cooptatus est, professorque apud Aberdonenses et Edinburgenses."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_stortingsrepresentanter_for_Kristiansund","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Mathias_Andreas_Boye%2C_ca_1870%2C_Hans_Maartmann%2C_Oslo_Museum%2C_OB.F18775c.jpg","page_title":"Liste over stortingsrepresentanter for Kristiansund","context_page_description":"Liste over stortingsrepresentanter for Kristiansund dekker alle som representerte Kristiansund kjøpstad på Stortinget fra 1851 til 1921. Listen omfatter alle faste representanter og alle som møtte fast som vara for regjeringsmedlemmer eller avdøde representanter.\\nKristiansund fikk kjøpstadsrettigheter i 1742. Fra det første Stortinget i 1814 utgjorde kjøpsteder egne bykretser, til forskjell fra landkretsene, ved stortingsvalg. Kjøpstedene Kristiansund og Molde utgjorde én valgkrets mellom 1814 og 1850. Ved stortingsvalget i 1850 ble valgkretsen delt. Kristiansund valgte én representant i hele sin tid som egen valgkrets. Ved stortingsvalget i 1921 ble kretsen slått sammen med Ålesund og Molde til en felles krets for kjøpstedene i Møre og Romsdal fylke. Ved stortingsvalget i 1953 ble ordningen med bykretser avskaffet, og Kristiansund gikk inn i Møre og Romsdal fylke."},{"page_url":"https://en.wikipedia.org/wiki/National_Historic_Fleet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Garlandstone%2C_Morwellham_Quay_-_geograph.org.uk_-_381846.jpg","page_title":"National Historic Fleet","context_page_description":"The National Historic Fleet is a list of historic ships and vessels located in the United Kingdom, under the National Historic Ships register. National Historic Ships UK is an advisory body which advises the Secretary of State for Culture, Media and Sport and other public bodies on ship preservation and funding priorities. As part of this remit, National Historic Ships maintains the National Register of Historic Vessels, which as of September 2014 listed over 1,000 vessels. The National Historic Fleet is a sub-grouping of this register, the vessels included on this list are distinguished by:\\nBeing of pre-eminent national or regional significance\\nSpanning the spectrum of UK maritime history\\nIllustrating changes in construction and technology\\nMeriting a higher priority for long term preservation\\nThe National Historic Fleet may also include vessels from the National Small Boat Register which are a minimum of 50 years old and which fit the above criteria.\\nAs of September 2014 there are 206 vessels on the register, including museum ships, those still in active or commercial service, and a number currently laid up. Some are being actively restored, others have an uncertain future."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D0%B4%D0%BE%D0%B2%D0%B0_%D1%80%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0_%D0%B2_%D0%A0%D0%BE%D1%81%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D1%96%D0%B9_%D1%96%D0%BC%D0%BF%D0%B5%D1%80%D1%96%D1%97_(1864)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D0%BE%D0%BA%D1%80%D1%83%D0%B6%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D1%83%D0%B4%D0%B0_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B0_%D0%A1%D1%83%D0%BC%D1%8B.jpg","page_title":"Судова реформа в Російській імперії (1864)","context_page_description":"Судова реформа 1864 р. в Російській імперії — одна з ліберально-демократичних реформ, проведених в 60—70 рр. XIX ст. в Російській імперії. Впроваджена судовими статутами від 20 листопада 1864 р. Серед її важливих нововведень — запровадження чіткої, однакової для всіх частин імперії системи судів, прийняття нових судових статутів, що закріплювали демократичні принципи судівництва, впровадження інститутів мирових судів, присяжних повірених та суду присяжних тощо. Крім безпосередньо суду було реформовано судове слідство, прокуратуру, нотаріат, створено стан присяжних повірених.\\nСудоустрій і судочинство, запроваджені 1864 р., були суттєво змінені в ході судової контрреформи 1889 р., але в основному зберігалися на територіях Російської імперії аж до встановлення радянської влади."},{"page_url":"https://de.wikipedia.org/wiki/Neumarkt_in_der_Oberpfalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Juravolksfest_Neumarkt_2008-08-09.jpg","page_title":"Neumarkt in der Oberpfalz","context_page_description":"Neumarkt in der Oberpfalz ist eine Große Kreisstadt im gleichnamigen Landkreis im bayerischen Regierungsbezirk Oberpfalz sowie der Verwaltungssitz des Landkreises. Sie ist Sitz verschiedener Unternehmen und stellt das wirtschaftliche und kulturelle Zentrum der westlichen Oberpfalz zwischen Nürnberg, Ingolstadt und Regensburg dar. Mit 40.277 Einwohnern ist Neumarkt nach Regensburg, Weiden und Amberg die viertgrößte Stadt in der Oberpfalz und im bayerischen Landesentwicklungsprogramm als Oberzentrum eingetragen.\\nIm 15. und 16. Jahrhundert war Neumarkt eine Residenzstadt der wittelsbachischen Linien Pfalz-Neumarkt und Pfalz-Mosbach. Ab dem 19. Jahrhundert entwickelte sich die Stadt zunehmend zu einem Wirtschafts- und Industriestandort, mehrere größere Unternehmen haben hier heute ihren Sitz. Wahrzeichen der Stadt sind die markanten Kirchtürme der Altstadt und die Burgruine Wolfstein, die auf einem Bergrücken über der Stadt liegt. 1998 fand in Neumarkt die bayerische Landesgartenschau statt."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A8%DA%BE%D8%A7%D8%B1%D8%AA_%D8%AF%DB%92_%D8%B4%DB%81%D8%B1%D8%A7%DA%BA_%D8%AF%DB%8C_%D9%84%D8%B3%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Krishnapatnam_port_Nellore.jpg","page_title":"بھارت دے شہراں دی لسٹ","context_page_description":"بھارت دے مشہور شہراں دے ناں حروف تہجی دے لحاظ نال ایہ نیں۔"},{"page_url":"https://sl.wikipedia.org/wiki/Klaus_Iohannis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Signature_of_Klaus_Iohannis.png","page_title":"Klaus Iohannis","context_page_description":"Klaus Werner Iohannis, romunski politik in fizik, * 13. junij 1959, Sibiu.\\nIohannis je trenutni predsednik Romunije."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%9B%A7%E5%B8%83%E6%9E%97%E5%9C%B0%E5%8D%80%E6%89%98%E9%A6%AC%E8%88%92%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/040-Tomasz%C3%B3w_Lubelski.jpg","page_title":"盧布林地區托馬舒夫","context_page_description":"盧布林地區托馬舒夫是波蘭的城鎮，位於該國東南部，由盧布林省負責管轄，始建於十六世紀末，面積13.29平方公里，海拔高度280米，2006年人口20,118。"},{"page_url":"https://en.wikipedia.org/wiki/Paleobiota_of_the_Yixian_Formation","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Graciliraptor.jpg","page_title":"Paleobiota of the Yixian Formation","context_page_description":"The Yixian Formation is a geological formation in Jinzhou, Liaoning, People's Republic of China, that spans about 5 million years during the early Cretaceous period. It is known for its fossils, listed below.\\nThe Yixian Formation is divided into the following subunits:\\nJingangshan Bed\\nDawangzhangzi Bed\\nJianshangou Bed\\nLujiatun Bed\\nBasalt base"},{"page_url":"https://cs.wikipedia.org/wiki/Baskicko_(autonomn%C3%AD_spole%C4%8Denstv%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Eusko_Jaurlaritzaren_egoitza_nagusia%2C_Gasteiz%2C_Euskal_Herria.jpg","page_title":"Baskicko (autonomní společenství)","context_page_description":"Baskicko je autonomní společenství na severu Španělska, mezi Pyrenejemi a Biskajským zálivem. Území obývá převážně národ Basků, hovořící izolovaným jazykem baskičtinou, která je zde také prvním úředním jazykem, zatímco španělština má postavení druhého úředního jazyka. Metropolí autonomního Baskicka je Vitoria, největším městem pak Bilbao."},{"page_url":"https://de.wikipedia.org/wiki/Arnoldsweiler","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Tafel_Gedenkst%C3%A4tte_Stalag_Arnoldsweiler.jpg","page_title":"Arnoldsweiler","context_page_description":"Arnoldsweiler ist ein Stadtteil und Bezirk der Stadt Düren im Kreis Düren in Nordrhein-Westfalen. Zum Bezirk Arnoldsweiler gehört der Herrensitz Haus Rath."},{"page_url":"https://en.wikipedia.org/wiki/Villasis,_Pangasinan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/VillasisPangasinanjfa.JPG","page_title":"Villasis, Pangasinan","context_page_description":"Villasis, officially the Municipality of Villasis, is a 1st class municipality in the province of Pangasinan, Philippines. According to the 2015 census, it has a population of 62,333 people.\\nVillasis is a farming town situated along the Agno River. On its borders are the towns of Malasiqui, Urdaneta City, Asingan, and Rosales and Santo Tomas. Hemmed between two bustling areas, Urdaneta City and Rosales, Villasis is one of the fastest developing towns in the province. It also thrives on its rice, corn and tobacco plantations. Its hilly barangays situated along the Malasiqui boundary is an ideal place for resort developers and agri-businessmen.\\nThe town holds an annual fiesta in honor of its patron saint, San Antonio de Abad.\\nVillasis is 174 kilometres from Manila and is 67 kilometres from the provincial capital, Lingayen."},{"page_url":"https://fi.wikipedia.org/wiki/Almirante_Condell_(PFG-06)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/DN-SN-97-01703.jpg","page_title":"Almirante Condell (PFG-06)","context_page_description":"Almirante Condell oli Chilen laivaston Condell-luokan fregatti. Se muistuttaa suuresti Britannian Leander-luokan aluksia."},{"page_url":"https://es.wikipedia.org/wiki/Rob_Gray","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Rob_Gray.jpg","page_title":"Rob Gray","context_page_description":"Robert Dejuan \\"Rob\\" Gray Jr. es un baloncestista estadounidense que pertenece a la plantilla del Levallois Metropolitans de la Liga Nacional de Baloncesto de Francia. Con 1,88 metros de estatura, juega en la posición de base."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B2%E0%B5%86%E0%B4%AC%E0%B5%8D%E0%B4%B0%E0%B5%8B%E0%B5%BA_%E0%B4%9C%E0%B5%86%E0%B4%AF%E0%B4%BF%E0%B4%82%E0%B4%B8%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Lebron_wizards_2017_%28cropped%29.jpg","page_title":"ലെബ്രോൺ ജെയിംസ്","context_page_description":"ഒരു അമേരിക്കൻ പ്രൊഫഷണൽ ബാസ്ക്കറ്റ്ബോൾ താരമാണ് ലെബ്രോൺ രയ്മൊനെ ജെയിംസ് സീനിയർ. നിലവിൽ നാഷണൽ ബാസ്ക്കറ്റ്ബോൾ അസോസിയേഷൻ യിൽ ലോസ് ആഞ്ചലസ് ലേക്കേഴ്സ് കളിക്കാരനാണിദ്ദേഹം. എക്കാലത്തെയും മികച്ച ബാസ്കറ്റ്ബോൾ കളിക്കാരനായി കണക്കാക്കപ്പെടുന്ന ഇദ്ദേഹം മൈക്കൽ ജോർദാനുമായി നിരന്തരം താരതമ്യപ്പെടുത്തപ്പെടാറുണ്ട്. മൂന്ന് എൻ‌ബി‌എ ചാമ്പ്യൻ‌ഷിപ്പുകൾ, നാല് എൻ‌ബി‌എ മോസ്റ്റ് വാല്യൂബിൾ പ്ലെയർ അവാർഡുകൾ, മൂന്ന് എൻ‌ബി‌എ ഫൈനൽ‌സ് എം‌വി‌പി അവാർഡുകൾ, രണ്ട് ഒളിമ്പിക് സ്വർണ്ണ മെഡലുകൾ എന്നിവയാണ് ഇ ദ്ദേഹത്തിന്റെ നേട്ടങ്ങൾ. പതിനഞ്ചു എൻ.ബി.എ. ഓൾ-സ്റ്റാർ ഗെയിംസ് ഇൽ പങ്കെടുത്തിട്ടുള്ള ജെയിംസ് എൻ.ബി.എ. ഓൾ-സ്റ്റാർ എംവിപി മൂന്നു തവണ നേടിയിട്ടുണ്ട്. 2008 ലെ എൻ‌ബി‌എ സ്‌കോറിംഗ് കിരീടം നേടിയ ഇദ്ദേഹം, എക്കാലത്തെയും എൻ‌ബി‌എ പ്ലേ ഓഫ് സ്കോറിംഗ് നേതാവാണ്, കൂടാതെ കരിയറിലെ എക്കാലത്തെയും മികച്ച പോയിന്റുകൾ നേടിയവരിൽ നാലാമതുമാണ്. ഓൾ-എൻ‌ബി‌എ ഫസ്റ്റ് ടീമിലേക്കും പന്ത്രണ്ട് തവണയും ഓൾ-ഡിഫെൻസീവ് ഫസ്റ്റ് ടീമിലേക്കും അഞ്ച് തവണ ഇദ്ദേഹത്തെ വോട്ട് ചെയ്തു തിരഞ്ഞെടുക്കപെട്ടിട്ടുണ്ട്.\\n2012 ലും 2013 ലും മിയാമി ഹീറ്റിനായി കളിക്കുന്നതിനിടെ ജെയിംസ് തന്റെ ആദ്യ രണ്ട് എൻ‌ബി‌എ ചാമ്പ്യൻ‌ഷിപ്പുകൾ നേടി; ഈ രണ്ട് വർഷങ്ങളിലും അദ്ദേഹം ലീഗ് എം‌വി‌പിയും ഫൈനൽ‌സ് എം‌വി‌പിയും നേടി."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%AF%E0%A5%8B%E0%A4%86%E0%A4%96%E0%A4%BF%E0%A4%AE_%E0%A4%97%E0%A4%BE%E0%A4%8A%E0%A4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Joachim_Gauck_%282014%29.jpg","page_title":"योआखिम गाऊक","context_page_description":"योआखिम गाऊक हा जर्मनी देशामधील एक राजकारणी व माजी राष्ट्राध्यक्ष आहे. पेशाने ख्रिश्चन धर्मगुरू असलेला गाऊक पूर्व जर्मनीमधील एक कम्युनिस्टविरोधी चळवळवादी म्हणून प्रसिद्धीस आला.\\nराष्ट्राध्यक्ष क्रिश्चियान वुल्फ ह्याने फेब्रुवारी २०१२ मध्ये पदाचा राजीनामा दिल्यानंतर जर्मन संसदेने गाऊकची राष्ट्राध्यक्षपदी निवड केली. तो २०१७ पर्यंत ह्या पदावर होता."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89tui_p%C3%A9nien","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Koteka.jpg","page_title":"Étui pénien","context_page_description":"Un étui pénien, appelé parfois koteka ou horim, est une protection pénienne portée par certains hommes autochtones dans certains groupes ethniques dans les hautes terres de Nouvelle-Guinée. L'étui est généralement fait à partir d'une calebasse vidée et séchée, principalement Lagenaria siceraria, bien que d'autres espèces, telles que Nepenthes mirabilis, soient parfois utilisées. Il est maintenu par une petite boucle de fibre attachée à la base du koteka et placé autour du scrotum. Une deuxième boucle est placée autour de la poitrine ou de l'abdomen et est attachée à la partie principale du koteka. Les hommes choisissent des koteka similaires à celles portées par les autres hommes de leur groupe culturel. Par exemple, les Yali préfèrent des kotekas longues et fines qui aide à retenir les paniers en rotin placé autour de leur taille. Les hommes de Tiom portent une calebasse double, retenue par une bande de tissu et utilisent l'espace entre les deux calebasses pour porter de petits objets tels que de la monnaie ou du tabac."},{"page_url":"https://pt.wikipedia.org/wiki/ONE_Pro_Cycling","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Denain_-_Grand_Prix_de_Denain%2C_14_avril_2016_%28A29%29.JPG","page_title":"ONE Pro Cycling","context_page_description":"ONE Pro Cycling foi um equipa ciclista britânica de categoria Continental que esteve activo desde o ano 2015 até 2018.\\nEm setembro de 2018 fez-se oficial o desaparecimento da equipa masculina a final do ano para criar uma equipa feminina, ainda que um mês mais tarde comunicou-se que finalmente esta equipa não seria criada."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%95%E0%AE%BE%E0%AE%B0%E0%AF%8D_%E0%AE%AE%E0%AE%BE%E0%AE%95%E0%AE%BE%E0%AE%A3%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Wesa_and_Crocker_in_2012.jpg","page_title":"கந்தகார் மாகாணம்","context_page_description":"கந்தகார் மாகாணம், ஆப்கானிஸ்தானின் மாகாணங்களில் ஒன்று. இது பாக்கித்தான் எல்லைக்கு அருகில் உள்ளது. இந்த மாகாணத்தின் மேற்கில் ஹெல்மண்டு மாகாணம், வடக்கில் உருஜ்கான் மாகாணம், கிழக்கில் சாபுல் மாகாணம் ஆகியன உள்ளன. இதன் தலைநகரம் கந்தகார் ஆகும்.\\nஇந்த மாகாணத்தில் 18 மாவட்டங்கள் உள்ளன. மொத்தமுள்ள 1,000 கிராமங்களில், ஏறத்தாழ 1,151,100 மக்கள் வசிக்கின்றனர். இவர்களில் பஷ்தூன் மக்கள் பெரும்பான்மையினர் ஆவர். தாஜிக், கசாரா மக்கள், உஸ்பெக் மக்கள், பலூச் மக்கள் ஆகியோர் கந்தகாரில் வசிக்கின்றனர். இந்த மாகாணத்தின் ஆளுநராக தோர்யலாய் மேசா நியமிக்கப்பட்டுள்ளார்."},{"page_url":"https://en.wikipedia.org/wiki/Josef_Hoffmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Manifattura_jacob_%26_josef_kohn%2C_joseph_hoffmann%2C_sedia_n%C2%B0_728%2C_creata_per_il_cabaret_fledermaus_a_vienna%2C_1904_ca.JPG","page_title":"Josef Hoffmann","context_page_description":"Josef Hoffmann was an Austrian architect and designer. He was among the founders of Vienna Secession and co-establisher of the Wiener Werkstätte. His most famous architectural work is the Palais Stoclet, in Brussels, a pioneering work of Modern Architecture, Art Deco and peak of Vienna Secession architecture."},{"page_url":"https://sv.wikipedia.org/wiki/Svartkummin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Nigella_sativa_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-227.jpg","page_title":"Svartkummin","context_page_description":"Svartkummin är en ettårig ranunkelväxt med ursprung i sydvästra Asien. Dess frön, kalonji, används i olika typer av matlagning och ibland i örtläkemedel, och växten har en lång historia som medicinalväxt i Egypten. Växten har gått under många namn, bland annat svartkummin, men är trots det inte närmare besläktad med kummin. Andra svenska namn för fröna är lökfrön och helvetesfrön."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D0%BF%D0%BE%D0%BB%D0%B5%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/%D0%9A%D0%B8%D0%BC%D1%80%D1%8B%2C_%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A2%D1%83%D0%BF%D0%BE%D0%BB%D0%B5%D0%B2%D1%83.jpg","page_title":"Туполев, Андрей Николаевич","context_page_description":"Андре́й Никола́евич Ту́полев — советский учёный и авиаконструктор, генерал-полковник-инженер, доктор технических наук.\\nАкадемик АН СССР. Герой Труда. Трижды Герой Социалистического Труда. Заслуженный деятель науки РСФСР. Лауреат Ленинской премии, четырёх Сталинских премий и Государственной премии СССР.\\nПод руководством Туполева спроектировано свыше 100 типов самолётов, 70 из которых строились серийно. На его самолётах установлено 78 мировых рекордов, выполнено около 30 выдающихся перелётов.\\nТуполев воспитал плеяду видных авиационных конструкторов и учёных, возглавивших самолётные ОКБ. В их числе В. М. Петляков, П. О. Сухой, В. М. Мясищев, А. И. Путилов, В. А. Чижевский, А. А. Архангельский, М. Л. Миль, А. П. Голубков, И. Ф. Незваль, A. A. Туполев, С. А. Лавочкин, А. С. Шенгардт."},{"page_url":"https://en.wikipedia.org/wiki/Chinzan-s%C5%8D_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Chinzanso_pagoda_-_night_-_2014.jpg","page_title":"Chinzan-sō Garden","context_page_description":"Chinzan-sō Garden is a Japanese garden located in Bunkyō, Tokyo. Founded in 1877, the garden is rich in historic remains and artifacts.\\nThe garden is part of the Hotel Chinzanso Tokyo property and can be accessed by walking from Edogawabashi Station."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D8%A7%D8%BA%D9%84%D9%8A%D9%82_%D9%82%D8%A7%D8%B1%D8%A7%D8%A8%D8%A7%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Agdam-nagorno-karabakh-3.jpg","page_title":"داغليق قاراباغ","context_page_description":"داغلیق قاراباغ، آذربایجانین غرب حیصه‌سینده ائرمنیستان و ایرانلا سرحد بؤلگه، ائرمنیستان طرفیندن ایشغال اولونوب. آذربایجانلیلارین و ائرمنیلرین کومپاکت یاشادیغی بؤلگه‌دیر.\\nائرمنی دیللی ادبیاتلاردا آدی آرساخ کیمی ایشله‌نیر.\\nبؤلگه نین اراضیسی ۴،۴۰۰ کیلومتر مربع -دیر، ۱۹۹۰-نجی ایلده اهالیسی ۱۹۲،۰۰۰-ه چاتمیشدی. بو اهالی ائرمنی‌لردن، آذربایجانلی‌لاردان، کوردلردن، روس‌لاردان عیبارت ایدی. مرکزی خان‌کندی، باشقا بؤیوک شهری ایسه شوشادیر."},{"page_url":"https://sv.wikipedia.org/wiki/Euhesma_altitudinis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Euhesma_altitudinis_f.jpg","page_title":"Euhesma altitudinis","context_page_description":"Euhesma altitudinis är en biart som först beskrevs av Cockerell 1914. Euhesma altitudinis ingår i släktet Euhesma och familjen korttungebin. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B8%E0%B5%82%E0%B4%9A%E0%B4%BF%E0%B4%AA%E0%B5%8D%E0%B4%AA%E0%B4%BE%E0%B4%B1_%E0%B4%B5%E0%B5%86%E0%B4%B3%E0%B5%8D%E0%B4%B3%E0%B4%9A%E0%B5%8D%E0%B4%9A%E0%B4%BE%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Soochipara_Waterfalls.jpg","page_title":"സൂചിപ്പാറ വെള്ളച്ചാട്ടം","context_page_description":"കേരളത്തിലെ വയനാട് ജില്ലയിലെ മേപ്പാടി ഗ്രാമപഞ്ചായത്തിൽ സ്ഥിതി ചെയ്യുന്ന വെള്ളച്ചാട്ടമാണ് സൂചിപ്പാറ വെള്ളച്ചാട്ടം അഥവാ സെന്റിനൽ പാറ വെള്ളച്ചാട്ടം. പല സ്ഥലങ്ങളിലും 100 മുതൽ 300 അടി വരെ ഉയരത്തിൽ നിന്നും വീഴുന്ന വെള്ളം നയനാനന്ദകരമാണ്. താഴെ വെള്ളം വന്നു വീഴുന്ന ചെറിയ തടാകത്തിൽ നീന്തുവാനും കുളിക്കുവാനും കഴിയും. സൂചിപ്പാറയിലുള്ള ഏറുമാടങ്ങളിൽ നിന്ന് പശ്ചിമഘട്ടത്തിന്റെയും താഴെയുള്ള അരുവിയുടെയും മനോഹരമായ കാഴ്ചകൾ കാണാം. 200 മീറ്ററിൽ അധികം ഉയരമുള്ള സൂചിപ്പാ‍റ സാഹസിക മല കയറ്റക്കാർക്ക് പ്രിയങ്കരമാണ്.\\nമൂന്നു തട്ടുകളായി ഉള്ള ഈ വെള്ളച്ചാട്ടത്തിനോടു ചേർന്ന് സാഹസിക തുഴച്ചിൽ ബോട്ട് യാത്രയ്ക്കും നീന്തുവാനും ഉള്ള സൗകര്യം ഉണ്ട്. വെള്ളച്ചാട്ടത്തിലെ വെള്ളം വീണ് ഉണ്ടായ കുളത്തിൽ ചെറിയ കുട്ടികൾക്കു പോലും നീന്താം. വെള്ളച്ചാട്ടത്തിനു ചുറ്റുമുള്ള പ്രകൃതി ദൃശ്യങ്ങൾ മനോഹരമാണ്.\\nകൽ‌പറ്റക്ക് 22 കിലോമീറ്റർ തെക്കായി ആണ് സൂചിപ്പാറ സ്ഥിതിചെയ്യുന്നത്. ഇവിടെ ഏറുമാടങ്ങളിൽ നിന്ന് ഉള്ള പ്രകൃതിദൃശ്യങ്ങൾ മനോഹരമാണ്. പശ്ചിമഘട്ടത്തിന്റെയും മനോഹരമായ ദൃശ്യങ്ങൾ സൂചിപ്പാറയിൽ നിന്നു കാണാം."},{"page_url":"https://es.wikipedia.org/wiki/Tino-Sven_Su%C5%A1i%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/20150331_2219_AUT_BIH_2698.jpg","page_title":"Tino-Sven Sušić","context_page_description":"Tino-Sven Sušić es un futbolista bosnio nacionalizado belga. Se desempeña como centrocampista ofensivo en el FK Sarajevo de la Liga Premier de Bosnia y Herzegovina.​\\nSu padre Sead y su tío Safet Sušić también fueron futbolistas, incluso fueron internacionales con Yugoslavia."},{"page_url":"https://en.wikipedia.org/wiki/Forum_Robinsons","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/02828jfForum_Robinsons_Cybergate_Malls_EDSA_Boni_Pioneer_Street_Mandaluyong_Cityfvf_16.jpg","page_title":"Forum Robinsons","context_page_description":"Forum Robinsons, formerly called as Robinsons Place Pioneer is a shopping mall located in Mandaluyong, Metro Manila, Philippines owned and operated by Robinsons Land. It is the 18th mall opened by Robinsons and the first mall in Mandaluyong City with a gross floor area of 56,000 square metres. The former name Robinsons Place Pioneer was dubbed after its location, Pioneer Street. Back then, the mall was envisioned to become a one stop shop for everyone in Cybergate Complex which was in turn envisioned to become a cyberhub in the city. In 2010, the mall was renamed to its current name to re-position itself as a cyber lifestyle mall focusing on IT products and to align itself with the vision of the Cybergate Complex."},{"page_url":"https://nl.wikipedia.org/wiki/Denis_Sassou-Nguesso","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Denis_Sassou-Nguesso.jpg","page_title":"Denis Sassou-Nguesso","context_page_description":"Denis Sassou-Nguesso is een politicus uit Congo-Brazzaville. Van 1979 tot 1992 was hij voor de eerste maal president van de Republiek Congo. Sedert 1997 is hij voor de tweede maal president."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_8e_arrondissement_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/The_Metro_at_Place_des_Ternes.jpg","page_title":"Liste des monuments historiques du 8e arrondissement de Paris","context_page_description":"Cet article recense les monuments historiques du 8ᵉ arrondissement de Paris, en France."},{"page_url":"https://no.wikipedia.org/wiki/Tussm%C3%B8rke","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Pierre-Auguste_Renoir%2C_Sunset_at_Sea.JPG","page_title":"Tussmørke","context_page_description":"Tussmørke er tiden før soloppgang, som kalles demring, og tiden etter solnedgang, som kalles skumring. Ordet tussmørke brukes særlig om skumring. Sollys spredt og reflektert i jordas øvre atmosfære lyser opp den lavere atmosfæren, og jordas overflate er hverken fullstendig opplyst eller helt mørk. På norsk sier vi ofte skyming eller skumring om kveldsmørket og dagning, gryning eller grålysing om daggryet.\\nPå grunn av den uvanlige, romantiske kvaliteten på lyset ute denne tiden, har tussmørket lenge vært populær blant fotografer og malere, som omtaler den som «den blå timen», etter det franske uttrykket l'heure bleue.\\nHalvmørket skaper en særegen, trolsk stemning, men i ny tid har tussmørket, i stedet for å være tiden da man synes man ser tusser, blitt tiden da det tennes elektrisk lys overalt. I norsk tradisjon er «å holde skyming» det å sitte og hvile innomhus uten tente lys, før det blir så mørkt at man må tenne lys for å få gangsyn."},{"page_url":"https://de.wikipedia.org/wiki/Radfenster","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/SantoDomingo-Roseton.jpg","page_title":"Radfenster","context_page_description":"Ein Radfenster ist ein Rundfenster, bei dem die Fensteröffnung durch „Speichen“ aus Holz oder Stein unterteilt ist. Radfenster sind Vorstufen der gotischen Fensterrosen, die jedoch oft noch die Form eines Radfensters aufnehmen und variieren."},{"page_url":"https://en.wikipedia.org/wiki/LGBT_rights_in_Africa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Cologne_Germany_Cologne-Gay-Pride-2015_Parade-17a.jpg","page_title":"LGBT rights in Africa","context_page_description":"With the exception of South Africa and Cape Verde, lesbian, gay, bisexual, and transgender rights in Africa are limited in comparison to Western Europe and much of the Americas and Oceania.\\nOut of the 54 states recognised by the United Nations or African Union or both, the International Gay and Lesbian Association stated in 2015 that homosexuality is outlawed in 34 African countries. Human Rights Watch notes that another two countries, Benin and the Central African Republic, do not outlaw homosexuality, but have certain laws which apply differently to heterosexual and homosexual individuals.\\nHomosexuality has never been criminalised in Benin, Burkina Faso, Ivory Coast, Democratic Republic of the Congo, Djibouti, Equatorial Guinea, Madagascar, Mali, Niger, and Rwanda. It has been decriminalised in Angola, Botswana, Cape Verde, Gabon, Guinea-Bissau, Lesotho, Mozambique, São Tomé and Príncipe, the Seychelles and South Africa.\\nSince 2011, some developed countries have been considering or implementing laws that limit or prohibit general budget support to countries that restrict the rights of LGBT people."},{"page_url":"https://hu.wikipedia.org/wiki/Leslie_David_Baker","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/LeslieBakerOct07.jpg","page_title":"Leslie David Baker","context_page_description":"Leslie David Baker amerikai színész."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_United_States_dollar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/USCurrency_Federal_Reserve.jpg","page_title":"History of the United States dollar","context_page_description":"The history of the United States Dollar refers to more than 240 years since the Continental Congress of the United States authorized the issuance of Continental Currency in 1775. On April 2, 1792, the United States Congress created the United States dollar as the country's standard unit of money. The term dollar had already been in common usage since the colonial period when it referred to eight-real coin used by the Spanish throughout New Spain."},{"page_url":"https://ca.wikipedia.org/wiki/Santuari_de_Sant_Ramon_Nonat","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Sant_Ramon.JPG","page_title":"Santuari de Sant Ramon Nonat","context_page_description":"El Santuari de Sant Ramon Nonat és un edifici religiós que comprèn un antic convent, una església i un claustre. Situat al municipi de Sant Ramon, és un edifici que ha estat declarat bé cultural d'interès nacional. Cada any, el darrer dia del mes d'agost, festivitat del sant, s'hi celebra la festa dels Tres Tombs."},{"page_url":"https://vi.wikipedia.org/wiki/Brighamia_rockii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Starr_040405-0204_Brighamia_rockii.jpg","page_title":"Brighamia rockii","context_page_description":"Brighamia rockii, được gọi là Pua ʻala trong tiếng Hawai thuộc họ Hoa chuông, là loài đặc hữu của hòn đảo Molokaʻi ở Hawaii."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%83%E5%8B%92%E7%89%B9%E4%BC%8A%E5%A4%A7%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/7_avenue_de_Breteuil%2C_Paris_7e.jpg","page_title":"布勒特伊大街","context_page_description":"布勒特伊大街是法国巴黎的一条街道，属于巴黎第七区和巴黎十五区。长840米，宽70米。始于沃邦广场7号，止于加里波第大道（boulevard Garibaldi）69号和塞夫勒路114号。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%89%9B%E6%B4%A5%E5%A4%A7%E5%AD%A6%E5%A4%A7%E5%AD%A6%E5%AD%A6%E9%99%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/The_Logic_Lane_Bridge_at_University_College_Oxford.jpg","page_title":"牛津大学大学学院","context_page_description":"牛津大学大学学院是牛津大学的一个学院，位于英国牛津。它创建于1249年，是牛津大学最古老的学院。截至2018年，获得捐赠近一亿三千三百万英镑。\\n毕业或修读于大学书院的著名校友有：英国前首相克莱曼·艾德礼及哈罗德·威尔逊、美国前总统比尔·克林顿、著名宇宙学家史蒂芬·霍金、作家C·S·路易斯及V·S·奈波尔及英国诗人珀西·比希·雪莱."},{"page_url":"https://sv.wikipedia.org/wiki/Samk%C3%B6nad_adoption","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Stephaniehaynes_family.jpg","page_title":"Samkönad adoption","context_page_description":"Samkönad adoption, närståendeadoption, homoadoption, är en adoption där adoptivföräldrarna består av ett par av samma kön."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Hale_Center_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/TXMap-doton-HaleCenter.PNG","page_title":"Hale Center (Texas)","context_page_description":"Hale Center sī Bí-kok Texas chiu Hale kūn ê chi̍t ê chng-thâu."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D0%B4%D1%88%D1%82%D1%80%D0%B0%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Hafenstrucklahnungshoern.jpg","page_title":"Нордштранд","context_page_description":"Нордштранд — полуостров и поранешен остров во Северна Фризија на брегот на Северното Море во Германија. Се наоѓа во округот Северна Фризија, во сојузната покраина Шлезвиг-Холштајн. Зафаќа површина од 50 км² со 2.300 жители. На полуостровот се наоѓаат две општини, Нордштранд и помалата Елизабет-Софиен-Ког, кои се дел од општинската заедница Северно Море-Трене. Пред 2008 година, двете општини образувале посебна општинска заедница наречена Нордштранд, со седиште во поголемата општина Нордштранд.\\nВо средновековниот период, Нордштранд бил дел од поголемиот остров Штранд, кој бил потопен на делови во катастрофалната плимна бура во 1634 година. Над 6.000 луѓе се удавиле. Пред 1634 година, површината на островот била 540 км². Други остатоци на Штранд се островот Пелворм и хализите.\\nДо Нордштранд води пат над насип, кој го поврзува со копното и бил изграден во 1936 година. Во 1987 година, полдерот Белтрингхардер Ког бил завршен, со што поранешниот остров станал полуостров."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1963","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Irene_van_staveren-1487608621.jpg","page_title":"Lijst van personen geboren in 1963","context_page_description":"Dit is een lijst van personen die geboren zijn in 1963.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AD%94%E5%BB%9F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Dingzhou_Confucian_Temple_4.jpg","page_title":"孔廟列表","context_page_description":"孔廟，又稱文廟，是祭祀中國古代的偉大思想家、政治家、教育家，儒家的創始人孔子的場所。唐貞觀元年，太宗下詔，令天下學皆建孔廟，使孔廟與學校教育相結合，並遍及全國。孔廟逐漸成為歷代崇孔尊儒和培養人材的重要場所，其建築也遵循嚴格的禮制規范和穩定的結構樣式。到清末，全國已有孔廟1560座。隨著儒家思想的傳播，其他儒家文化圈國家包括朝鮮、越南、日本、琉球也有興建孔廟。歷史上，各地的孔廟一度超過2000座，而至今尚存的各類孔廟尚有400餘座。\\n本表中列舉各地孔廟，主要為朝廷在冊的官立國、府、州、縣級孔廟和孔子家廟，各地書院中的孔廟及其他私立孔子祭祀場所則不列出。"},{"page_url":"https://en.wikipedia.org/wiki/Jack_arch","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Mardin-arch.jpg","page_title":"Jack arch","context_page_description":"A jack arch is a structural element in masonry construction that provides support at openings in the masonry. Alternate names are \\"flat arch\\" and \\"straight arch\\".\\nUnlike regular arches, jack arches are not semicircular in form. Instead, they are flat in profile and are used under the same circumstances as lintels. Unlike lintels, which are subject to bending stress, jack arches are composed of individual masonry elements cut or formed into a wedge shape that efficiently uses the compressive strength of the masonry in the same manner as a regular arch. Like regular arches, jack arches require a mass of masonry to either side to absorb the considerable lateral thrust created by the jack arch.\\nJack arches have the advantage of being constructed from relatively small pieces of material that can be handled by individuals, as opposed to lintels which must necessarily be monolithic and which must be oversized unless reinforced by other means.\\nIn small-scale brick masonry projects, jack arches are typically sawn from an appropriately sized fired-clay lintel, giving a more precise and consistent joint width than field-sawn shapes."},{"page_url":"https://cs.wikipedia.org/wiki/Kr%C3%A1lovice_(Praha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Prague_Kralovice_KUhrinevsi2.jpg","page_title":"Královice (Praha)","context_page_description":"Královice jsou katastrálním územím Prahy, tvořícím území městské části Praha-Královice. Je zde evidováno 12 ulic a 121 adres. Žije zde zhruba 300 obyvatel.\\nDo dnešní doby si Královice zachovaly původní vesnický ráz, díky svým urbanistickým hodnotám se v roce 1991 staly vesnickou památkovou zónou. Mnoho z těchto hodnot je však nyní ohroženo developerskými aktivitami společností Karla Komárka, které se staly vlastníky cca 110 ha okolních pozemků. V územní plánu jsou navržené změny využití části pozemků v Královicích."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A7%A6%E6%B5%B7%E7%92%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/%E7%A7%A6%E6%B5%B7%E7%92%90.jpg","page_title":"秦海璐","context_page_description":"秦海璐，中國大陸女演員、編劇，遼寧大連人，出生於遼寧營口，祖籍山東黃縣。秦海璐曾獲金馬獎最佳新演員、最佳女主角、最佳原著劇本獎，為華語電影圈罕見的演、編俱佳之電影人。"},{"page_url":"https://es.wikipedia.org/wiki/Ardeola_ralloides","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Heron_crabier_MHNT.jpg","page_title":"Ardeola ralloides","context_page_description":"La garcilla cangrejera es una especie de ave pelecaniforme de la familia Ardeidae​​ propia de Europa meridional, Asia sudoccidental y África. Es un ave acuática de hábitos migratorios​ que habita en zonas húmedas, lagunas, estanques y las arboledas circundantes.​"},{"page_url":"https://de.wikipedia.org/wiki/Finissage_(Veranstaltung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Mostra_Wiki_Loves_Monuments_Italia_-_Baselga_di_Pin%C3%A9_-_Finissage_06.jpg","page_title":"Finissage (Veranstaltung)","context_page_description":"Die Finissage ist ein festlicher Anlass zum Abschluss einer Ausstellung oder anlässlich der Schließung einer öffentlich zugänglichen Institution. Sie bildet damit das Gegenstück zur Vernissage. Beide wenden sich oftmals an ein ausgewähltes Publikum, um das Medieninteresse und die Aufmerksamkeit auf die Gegenstände der Ausstellung zu lenken. Zudem findet bei größeren Ausstellungen vereinzelt zur Halbzeit eine Midissage statt."},{"page_url":"https://sv.wikipedia.org/wiki/Odostomia_notilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Odostomia_notilla_001.png","page_title":"Odostomia notilla","context_page_description":"Odostomia notilla är en snäckart som beskrevs av Dall och Bartsch 1909. Odostomia notilla ingår i släktet Odostomia och familjen Pyramidellidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://eu.wikipedia.org/wiki/Gro%C3%9F_Pankow_(Prignitz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Langnow_church.jpg","page_title":"Groß Pankow (Prignitz)","context_page_description":"Groß Pankow Alemaniako udalerria da. Brandenburgo estatuan kokatuta dago, Prignitz barrutian. 2014an 3.999 biztanle zituen 250,76 kilometro koadrotan banatuta."},{"page_url":"https://es.wikipedia.org/wiki/Newark_(Nueva_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Newark_October_2016_panorama.jpg","page_title":"Newark (Nueva Jersey)","context_page_description":"Newark, apodada \\"la ciudad de los ladrillos\\", es una ciudad ubicada en el condado de Essex en el estado de Nueva Jersey. En el año 2010 tenía una población de 277.140 habitantes y una densidad poblacional de 4117,98 personas por km².​ Es la ciudad más poblada de Nueva Jersey y la 68ª del país, y es un importante centro industrial, cultural, comercial, y de transporte.\\nSe encuentra aproximadamente 8 km al oeste de Manhattan y 4 km al norte de Staten Island. Su localización cercana al océano Atlántico sobre la bahía de Newark ha ayudado a que el puerto de Newark sea el mayor puerto de contenedores del puerto de Nueva York. En Newark encontramos al Aeropuerto Internacional Libertad de Newark, el primer gran aeropuerto en atender al área metropolitana de Nueva York."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86%D8%AA%D8%A7_%D9%83%D8%B1%D9%88%D8%B2_%D8%AF%D8%A7_%D8%A7%D8%B3%D9%BE%D9%8A%D8%B1%D8%A7%D9%86%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Igreja_de_Santa_Cruz_em_Santa_Cruz_da_Esperan%C3%A7a_01.jpg","page_title":"سانتا كروز دا اسپيرانكا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nسانتا كروز دا اسپيرانكا مدينه فى برازيل."},{"page_url":"https://pt.wikipedia.org/wiki/Sociedade_Esportiva_Ypiranga_Futebol_Clube","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Costuraradeira_%C3%A0_manivela.JPG","page_title":"Sociedade Esportiva Ypiranga Futebol Clube","context_page_description":"A Sociedade Esportiva Ypiranga Futebol Clube, conhecida popularmente como o Ypiranga ou Ypiranga de Pernambuco, é um clube esportivo brasileiro sediado em Santa Cruz do Capibaribe no estado de Pernambuco que tem como modalidade esportiva principal o futebol, com um dos times mais vencedores da Microrregião do Alto Capibaribe. As cores do clube, presentes no escudo e bandeira oficial, são o azul e branco, tendo como principal mascote uma Máquina de costura, fazendo referência as diversas fabricas têxtil no município e que esta presente no seu escudo até os dias atuais.\\nSeus títulos mais importantes conquistados no futebol são a Campeonato Pernambucano - Série A2 de 2004 e a Copa dos Clubes Profissionais do Interior de 1994, ano que o clube se tornou profissional. Após um 12º lugar, acabou sendo rebaixado. No ano seguinte passou por dificuldades e acabou ficando de fora de duas edições da A2. Em 2018, o clube vem se movimentando para retornar a disputar competições oficiais e seu desafio atual sera o Pernambucano - Série A2 de 2018."},{"page_url":"https://nn.wikipedia.org/wiki/Estisk_kroon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/EST-coins-overview.jpg","page_title":"Estisk kroon","context_page_description":"Estisk kroon eller krone var valutaen i Estland. Valutakoden er EEK. 1 Kroon = 100 senti. Noregs Bank noterer valutakurs for estikse kroner. Ei estisk krone er notert til mellom 50 og 60 øre.\\nValutaen vart innført i 1928 i staden for den tidlegare estiske marken som var innført i 1921. Den estiske krona gjaldt fram til at Estland vart hærteken av Sovjetunionen i 1940, og rubelen vart innført som betalingsmiddel. I juni 1992 vart den estiske krona på nytt innført som valuta istaden for rubelen. Den første tida var ho knytt til D-marken. Då Tyskland innførte euro, vart krona bunden til euroen i staden. Estland vart medlem av EUs pengeunion 1. januar 2011. Etter ein overgangsperiode på to veker er den estiske krona frå og med 15. januar 2011 ikkje lenger gyldig betalingsmiddel, men kan vekslast inn til sentralkurs i sentralbanken."},{"page_url":"https://it.wikipedia.org/wiki/Boston_Manor_(metropolitana_di_Londra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Boston_Manor_Station_1857866_970b320e.jpg","page_title":"Boston Manor (metropolitana di Londra)","context_page_description":"La stazione di Boston Manor è una stazione della linea Piccadilly della metropolitana di Londra."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9arrangement_de_Newman-Kwart","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Phenols-to-thiophenols-via-NKR-2D-skeletal.png","page_title":"Réarrangement de Newman-Kwart","context_page_description":"Le réarrangement de Newman-Kwart est une réaction de réarrangement dans laquelle, à température élevée ou sous catalyse, un groupe aryle d'un O-arylthiocarbamate migre depuis l'atome d'oxygène vers l'atome de soufre, formant un S-arylthiocarbamate. Cette réaction est nommée d'après les chimistes américains Melvin Spencer Newman et Harold Kwart qui l'ont observés pour la première fois sur des thiocarbamates en 1966. Une réaction similaire avait cependant déjà été observée sur les esters de thioacides par le chimiste allemand Alexander Schönberg en 1930."},{"page_url":"https://en.wikipedia.org/wiki/San_Diego_Zoo_Global","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Harry_Wegeforth.jpg","page_title":"San Diego Zoo Global","context_page_description":"San Diego Zoo Global is a not-for-profit organization headquartered in San Diego that operates the San Diego Zoo, the San Diego Zoo Safari Park, the San Diego Zoo Institute for Conservation Research, and the San Diego Zoo Global Wildlife Conservancy. Founded in 1916 as the Zoological Society of San Diego under the leadership of Harry M. Wegeforth, the organization claims the largest zoological society membership in the world, with more than 250,000 member households and 130,000 child memberships, representing more than half a million people. The organization's mission is to save vulnerable species through animal care based in conservation science.\\nIn its first few decades, the Zoological Society of San Diego worked to establish and build up the San Diego Zoo. Members of the organization formed groups that later became the Association of Zoos and Aquariums and American Association of Zoo Keepers. In the early 1970s the society established the San Diego Wild Animal Park in the San Pasqual Valley and the Center for Reproduction of Endangered Species, and expanded its captive breeding and wildlife conservation efforts."},{"page_url":"https://fr.wikipedia.org/wiki/IIIe_si%C3%A8cle_avant_J.C._en_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Palazzolo_Acreide_Theater.jpg","page_title":"IIIe siècle avant J.C. en architecture","context_page_description":"Cet article concerne les événements concernant l'architecture qui se sont déroulés durant le IIIᵉ siècle av. J.-C. :"},{"page_url":"https://eo.wikipedia.org/wiki/Ta%C5%9Fkent","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Ta%C5%9Fkent-Konya%2C_Turkey_-_panoramio_%286%29.jpg","page_title":"Taşkent","context_page_description":"Taşkent [Taŝkent] estas urbo en la azia parto de Turkio. Ĝi apartenas al la provinco Konya kaj la administra regiono Centra Anatolio. En 2013 la urba distrikto havis 7 094 loĝantojn.\\nEkde 2014, la komunumo kongruas kun la distrikto. Ĉiuj antaŭaj vilaĝoj nun estas komunumopartoj de la komunumo. La urbo situas ĉirkaŭ 110 kilometrojn sude de la provinca ĉefurbo Konya.\\nLa distrikto situas en la ekstrema sudo de la provinco. Ĝi bordas al la distrikto Hadim okcidente kaj norde, la provinco Karaman oriente kaj sude, kaj la provinco Antalya sudokcidente. Tra Taşkent kondukas la interregiona vojo D-340, kiu konektas Beyşehir en la nordo kun Mut en la sudoriento. En la sudo de la monteta distrikto estas la monto Bozdağ Tepesi kun 2133 metroj. En la sudoriento, fontas la rivereto Balcılar Çayı, kiuj transiras la distrikton al la nordokcidento kaj fluas pli norde en la riveron Göksu."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%81%E0%AE%A4%E0%AF%81%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AF%87%E0%AE%B0%E0%AE%BF_%E0%AE%95%E0%AE%B2%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%B0%E0%AF%88_%E0%AE%B5%E0%AE%BF%E0%AE%B3%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/New_and_old_lighthouses_-_Pondichery.jpg","page_title":"புதுச்சேரி கலங்கரை விளக்கம்","context_page_description":"புதுவையில் இரண்டு கலங்கரை விளக்கங்கள் உள்ளன.\\nபழைய கலங்கரை விளக்கம் பிரெஞ்சு ஆட்சியாளர்களால் பத்தொன்பதாம் நூற்றாண்டில் கட்டப்பட்டது.\\nபுதிய கலங்கரை விளக்கம் இந்திய அரசாங்கத்தால் இருபதாம் நூற்றாண்டில் கட்டப்பட்டது."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B2%B3%E5%B0%BB%E7%A5%9E%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Kawashiri-jingu.jpg","page_title":"河尻神宮","context_page_description":"河尻神宮は、熊本県熊本市南区に鎮座する神社である。旧社格は県社。"},{"page_url":"https://lv.wikipedia.org/wiki/Ipi%C4%B7i","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Ipiku_kultuurimaja.JPG","page_title":"Ipiķi","context_page_description":"Ipiķi ir ciems Rūjienas novadā, Ipiķu pagasta centrs. Atrodas pagasta dienvidu daļā 18,8 km no novada centra Rūjienas un 171,0 km no Rīgas. Atrodas pie autoceļu V172 V173.\\nIpiķos dzimis politiķis Andris Ārgalis un mākslinieks Ervins Volfeils."},{"page_url":"https://ro.wikipedia.org/wiki/Homo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Australopithecus_afarensis_adult_male_-_head_model_-_Smithsonian_Museum_of_Natural_History_-_2012-05-17.jpg","page_title":"Homo","context_page_description":"Homo este un gen de primate din familia hominidelor care cuprinde specia existentă Homo sapiens și câteva specii dispărute clasificate fie ca fiind ancestrale, fie strâns legate de omul modern, dintre care cele mai notabile sunt Homo erectus și Homo neanderthalensis. Genul a apărut la sfârșitul Pliocenului sau Pleistocenul timpuriu, odată cu Homo habilis, în urmă cu aproximativ 2,8 milioane de ani. Genul Homo, împreună cu genurile Paranthropus și Kenyanthropus, sunt probabil înrudite cu A. africanus și/sau A. Sediba din genul Australopithecus, care la rândul lui s-a despărțit de linia lui Pan. Din punct de vedere taxonomic, Homo este singurul gen atribuit subtribului Hominina care, cu subtriburile Australopithecina și Panina, alcătuiesc tribul Hominini.\\nHomo erectus a apărut cu aproximativ două milioane de ani în urmă și, în câteva migrații timpurii, s-a răspândit în întreaga Africă și în Eurasia. Probabil a fost prima specie umană care a trăit într-o societate de vânători-culegători și care a controlat focul. O specie adaptivă și de succes, Homo erectus, a persistat mai bine de un milion de ani și treptat a deviat în specii noi cu aproximativ 500.000 de ani în urmă."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_l%27Escala","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Edifici_a_la_Pla%C3%A7a_V%C3%ADctor_Catal%C3%A0%2C2.jpg","page_title":"Llista de monuments de l'Escala","context_page_description":"Llista de monuments de l'Escala inclosos en l'Inventari del Patrimoni Arquitectònic Català per al municipi de l'Escala. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics i els béns culturals d'interès local de caràcter arquitectònic."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84485%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/JNR_485_Aizu_2006.JPG","page_title":"国鉄485系電車","context_page_description":"485系電車は、日本国有鉄道が設計・製造した交流直流両用特急形電車である。\\n本項では、交流60 Hz対応の481系・交流50 Hz対応の483系ならびに交流50/60 Hz対応の485系を基本に信越線の協調運転にも対応した489系についても解説を行う。"},{"page_url":"https://it.wikipedia.org/wiki/Peter_Odemwingie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/PeterOdemwingie.jpg","page_title":"Peter Odemwingie","context_page_description":"Osaze Peter Odemwingie è un ex calciatore nigeriano, di ruolo attaccante."},{"page_url":"https://sv.wikipedia.org/wiki/Oskar-Fredriksborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Oskar_Fredriksborg_1900.jpg","page_title":"Oskar-Fredriksborg","context_page_description":"Oskar-Fredriksborg är en historisk befästningsanläggning på östra Rindö i Vaxholms kommun vid inloppet till Stockholm som uppfördes åren 1870–1877. Befästningen är sedan 2002 förklarad som byggnadsminne. Befästningen gav namn åt den intilliggande tätorten Oskar-Fredriksborg, som från tätortsavgränsningen 2015 heter Rindö. Mittemot, på östra sidan om Oxdjupet ligger sedan 1735 Fredriksborgs fästning."},{"page_url":"https://fr.wikipedia.org/wiki/Mesomycetozoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Sphaeroforma_arctica.jpg","page_title":"Mesomycetozoa","context_page_description":"Les Mésomycétozoaires ou Ichtyosporés forment un petit groupe d’organismes unicellulaires opisthocontes, intermédiaires entre les Champignons et les Animaux. Il s'agit principalement de parasites des animaux et notamment des poissons."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_personalidades_do_YouTube","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Whindersson_Nunes_em_2019.png","page_title":"Lista de personalidades do YouTube","context_page_description":"A lista de personalidades do YouTube traz o nome de personalidades com canais no YouTube, também conhecidos como youtubers, que alcançaram notoriedade em sua área de atuação."},{"page_url":"https://en.wikipedia.org/wiki/London","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Transport_in_London.png","page_title":"London","context_page_description":"London is the capital and largest city of England and the United Kingdom. The city stands on the River Thames in the south-east of England, at the head of its 50-mile estuary leading to the North Sea, London has been a major settlement for two millennia. Londinium was founded by the Romans. The City of London, London's ancient core and financial centre − an area of just 1.12 square miles and colloquially known as the Square Mile − retains boundaries that closely follow its medieval limits. The adjacent City of Westminster is an Inner London borough and has for centuries been the location of much of the national government. Thirty one additional boroughs north and south of the river also comprise modern London. London is governed by the mayor of London and the London Assembly.\\nLondon is considered to be one of the world's most important global cities and has been called the world's most powerful, most desirable, most influential, most visited, most expensive, sustainable, most investment-friendly, and most-popular-for-work city."},{"page_url":"https://de.wikipedia.org/wiki/Agnesviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/K%C3%B6ln_Neusser-Stra%C3%9Fe_Kette_Gagat_und_Gold.JPG","page_title":"Agnesviertel","context_page_description":"Das Agnesviertel in Köln ist der nördlichste Teil des Stadtteils Neustadt-Nord und gehört zum Stadtbezirk Innenstadt. Es ist benannt nach der in neugotischem Stil errichteten Pfarrkirche St. Agnes, die zur Wende in das 20. Jahrhundert zentral in dem zuvor durch den Stadtbaumeister Stübben erschlossenen Vorstadtgelände auf dem Neusser Platz errichtet wurde. Das Bauwerk ist die zweitgrößte Kirche Kölns und wurde auf Wunsch seines Stifters Peter Joseph Roeckerath zur Erinnerung an seine verstorbene Frau Agnes der heiligen Agnes geweiht."},{"page_url":"https://no.wikipedia.org/wiki/Joan%C3%B3polis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Cachoeira_dos_Pretos.jpg","page_title":"Joanópolis","context_page_description":"Joanópolis er en kommune i delstaten São Paulo i sørøstregionen av Brasil."},{"page_url":"https://en.wikipedia.org/wiki/List_of_the_Cenozoic_life_of_Colorado","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Empis_livida_%28aka%29.jpg","page_title":"List of the Cenozoic life of Colorado","context_page_description":"This list of the Cenozoic life of Colorado contains the various prehistoric life-forms whose fossilized remains have been reported from within the US state of Colorado and are between 66 million and 10,000 years of age."},{"page_url":"https://fr.wikipedia.org/wiki/Tigre_blanc","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/White_tiger.jpg","page_title":"Tigre blanc","context_page_description":"Le tigre blanc, parfois aussi appelé tigre blanc royal, est un tigre, mammifère carnivore de la famille des félidés, présentant une mutation génétique lui conférant une robe blanche rayée de noir. Il n'est pas une espèce ou une sous-espèce à part entière et n'est donc pas menacé d'extinction en tant que tel, même si l'espèce tigre est elle classée « en danger » par l'Union internationale pour la conservation de la nature.\\nCette anomalie génétique est appelée leucistisme ou leucisme. Les tigres blancs ne sont donc pas des spécimens albinos, qui n'ont quant à eux pas de rayures et des yeux plutôt clairs, apparence due dans ce cas à une autre mutation génétique, l'albinisme.\\nSon élevage en captivité est de plus en plus controversé car la reproduction des tigres blancs entre eux, pratiquée dans le but d'assurer une descendance entièrement leucistique, entraîne une forte consanguinité qui est associée à de nombreux troubles de santé. Cet élevage ne présente par ailleurs aucun intérêt dans la conservation du tigre et peut fausser le rôle pédagogique des parcs zoologiques lorsqu'ils les présentent séparément des autres tigres ou comme une espèce ou une sous-espèce à part entière."},{"page_url":"https://no.wikipedia.org/wiki/Tj%C3%A6rebrenning","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Tervahauta.jpg","page_title":"Tjærebrenning","context_page_description":"Tjærebrenning er utvinning av tjære ved tørrdestillasjon av harpiksholdig trevirke. Tjære lages av tyri som er fettstoffet, harpiksen, i kjerneveden og røttene til furu. Tjære ble brukt som impregneringsmiddel på båter, hus, tau, fiskegarn og også som medisin. Det er flere teknikker for å utvinne tjære som tjæremile, tjærehjell, tjæregrav, myrmiler, tjæreovn og i gryte.\\nDe eldste daterte tjæremilene er fra 1000- tallet, men det kan ikke utelukkes at det kan finnes eldre. Milene var i bruk til innpå 1900- tallet. Tjæreovner er til nå kjent fra 1600- tallet og fremover. De finnes i de fleste deler av landet der det har vært tilgang på furu. Sentrale områder er Oppland, Hedmark og Trøndelag, men også for eksempel i Nordreisa, Skibotn og Bardu i Troms. Myrmiler er kjent i Østerdalen, Nordmøre, Trøndelag og Helgeland."},{"page_url":"https://es.wikipedia.org/wiki/Pedro_Jes%C3%BAs_G%C3%B3mez","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Citola-medieval.jpg","page_title":"Pedro Jesús Gómez","context_page_description":"Pedro Jesús Gómez Lorente., músico español que alcanzó popularidad internacional en Europa y América, gracias y tras su grabación en Berkeley, Estados Unidos y actuación en la Trinity Chapel."},{"page_url":"https://ca.wikipedia.org/wiki/Rei_Art%C3%BAs","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Culhwch.jpg","page_title":"Rei Artús","context_page_description":"El Rei Artús o Artur fou un líder brità dels segles v i vi, el qual, segons les històries i romanços medievals, encapçalà la defensa de Bretanya davant dels invasors saxons a principis del segle vi. Els detalls de les gestes d'Artús provenen principalment del folklore i la invenció literària; els historiadors moderns debaten la seva existència històrica. El seu escàs rerefons històric s'espigola de diverses fonts, entre les quals els Annales Cambriae, la Historia Brittonum i els escrits de Gildas de Rhuys. El nom d'Artús també apareix en fonts poètiques primerenques com ara Y Gododdin.\\nArtús és una figura capital a les llegendes que conformen la matèria de Bretanya. L'Artús llegendari es cultivà com una icona d'interès internacional especialment a través de la popularitat de l'extravagant i imaginativa Historia Regum Britanniae, per Jofre de Monmouth, del segle xii. En alguns contes i poemes gal·lesos i bretons previs a aquesta obra, Artús hi apareix o bé com un gran guerrer que protegeix Bretanya d'enemics humans i fantàstics o bé com una figura màgica del folklore, de vegades associada amb el Més Enllà gal·lès, Annwn."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%B8%AD%E5%B1%B1%E5%8C%97%E8%B7%AF%E5%81%9C%E8%BD%A6%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Shahu_Station.jpg","page_title":"中山北路停车场","context_page_description":"中山北路停車場是武漢地鐵2號線的一處停車場，位於沙湖之濱，是該線一期工程兩個停放地鐵列車的場所，也是一期工程中唯一位於長江南岸武昌區的停車場所。該停車場完全處於地下，位於螃蟹岬站與小龜山站之間，地上有綜合樓一座，另有一條聯絡線連接武九鐵路沙湖站。"},{"page_url":"https://en.wikipedia.org/wiki/West_Hill,_Toronto","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/West_Hill_Collegiate_Institute_%282013%29.jpg","page_title":"West Hill, Toronto","context_page_description":"West Hill is a neighbourhood in Toronto, Ontario, Canada. It is located in the eastern end of the city, in the suburb of Scarborough. It is roughly bounded by Scarborough Golf Club Road and a branch of Highland Creek on the west, the CNR railway tracks and Lake Ontario on the south, and Highland Creek on the north-east. The name comes from its elevated position on the west side of Highland Creek, a deep glacial ravine.\\nThe section east of Manse Road, which roughly splits this neighbourhood in half, is often now referred to as the Manse Valley neighbourhood. It has less commercial development and more industrial development than the western part of the neighbourhood. However, both parts were treated as part of West Hill prior to development."},{"page_url":"https://de.wikipedia.org/wiki/Propionibacterium_acnes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Akne-jugend.jpg","page_title":"Propionibacterium acnes","context_page_description":"Propionibacterium acnes ist ein langsam wachsendes grampositives, anaerobes Bakterium. Das Bakterium ist ein Teil der Hautflora und Kommensal, aber auch als sekundärer Faktor an der Pathogenese der Akne beteiligt. Es wurde früher als Bacillus acnes und Corynebacterium acnes bezeichnet. Von der Art Propionibacterium acnes sind etwa 100 Stämme bekannt, das Genom zahlreicher Stämme wurde bereits vollständig sequenziert. Die Forschung, welche Stämme pathogen sind und z. B. an der Erkrankung Acne vulgaris beteiligt sind, ist derzeit noch nicht abgeschlossen."},{"page_url":"https://en.wikipedia.org/wiki/Sokollu_Mehmed_Pasha_Mosque,_Azapkap%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Sokollu_Mehmet_Pasha_Mosque_Azapkapi_383.jpg","page_title":"Sokollu Mehmed Pasha Mosque, Azapkapı","context_page_description":"The Sokollu Mehmed Pasha Mosque is a 16th-century Ottoman mosque located in Istanbul, Turkey.\\nThe mosque is situated in Azapkapı neighborhood of Beyoğlu district in Istanbul. It is directly beside the Atatürk Bridge across the Golden Horn, but there was no bridge here at the time the mosque was built. It was designed by Ottoman imperial architect Mimar Sinan and built for the grand vizier Sokollu Mehmed Pasha in 1578. It is one of the three mosques with the same name built by Mimar Sinan in Istanbul."},{"page_url":"https://ast.wikipedia.org/wiki/Hermanos_Coen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Coen_brothers_Cannes_2015.jpg","page_title":"Hermanos Coen","context_page_description":"Joel David Coen y Ethan Jesse Coen, conocíos profesionalmente como los hermanos Coen, son dos cineastes estauxunidenses ganadores de cuatro Premiu Óscar, dos BAFTA y un Globu d'Oru, ente otres reconocencies.\\nLos sos entamos na industria del cine remontar a principios de los años 1980, cuando Joel trabayaba como asistente de montaxe en películes de terror de baxu presupuestu y Ethan collaboraba como guionista na serie policiaca Cagney & Lacey. Mentanto empezaron a escribir el guión del que foi'l so debú como direutores, el thriller neo-noir Blood Simple, que'l so modestu ésitu na taquilla y a nivel críticu llogró abrir el camín y dar a conocer como parte d'una nueva xeneración de direutores independientes. Dende entós funcionaron en xunto pa escribir, producir, dirixir y montar los sos propios filmes. Por cuenta de el so enclín a trabayar xuntos y la so similar visión artística, fíxose referencia a ellos como'l direutor bicéfalu» —two-headed direutor—. Ente'l so filmografía destáquense títulos como Miller's Crossing, Barton Fink, Fargo, The Big Lebowski, O Brother, Where Art Thou?, The Man Who Wasn't There, No Country for Old Men y True Grit."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D9%88%DA%A9%D9%88%D8%A6%D9%88%DA%A9%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Fukuoka_dome02.jpg","page_title":"فوکوئوکا","context_page_description":"فوکوئوکا ژاپون اؤلکه‌سینده یئر آلان بیر شهردیر و فوکوئوکا اوستانینده یئرلشیب. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا 1550626 نفر دیر."},{"page_url":"https://it.wikipedia.org/wiki/Viaggio_in_Corsica","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Bocognano_vall%C3%A9e_Gravona.jpg","page_title":"Viaggio in Corsica","context_page_description":"Viaggio in Corsica o Relazione della Corsica è un'opera che il giurista scozzese James Boswell scrisse nel 1766 e pubblicò nel 1768. Il saggio è un resoconto di un Grand Tour che l'autore compì prevalentemente in Italia e poi in Corsica nella seconda metà del 1765 oltre al suo incontro con il politico e militare corso Pasquale Paoli, che lottava per mantenere la Repubblica Corsa libera dai genovesi e dai loro alleati francesi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Kabelsketal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Naundorf_Kirche_Klepziger1.jpg","page_title":"Liste der Kulturdenkmale in Kabelsketal","context_page_description":"In der Liste der Kulturdenkmale in Kabelsketal sind alle Kulturdenkmale der Gemeinde Kabelsketal aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://fi.wikipedia.org/wiki/Imperial_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Imperial_Air_Tupolev_134%3B_OB-1489_CVW_%285403174414%29.jpg","page_title":"Imperial Air","context_page_description":"Imperial Air oli perulainen halpalentoyhtiö, joka operoi Perussa reitillä Lima–Cusco–Arequipa. Vähentyneiden matkustajamäärien ja onnettomuuksien takia yhtiö lopetti toimintansa vuonna 2002."},{"page_url":"https://cs.wikipedia.org/wiki/Farid_Mansurov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Farid_Mansurov_2013.jpg","page_title":"Farid Mansurov","context_page_description":"Farid Mansurov je bývalý ázerbájdžánský zápasník – klasik, olympijský vítěz z roku 2004."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%BAa_(Venezuela)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Ezequiel_Zamora_statue%2C_Cu%C3%A1.jpg","page_title":"Cúa (Venezuela)","context_page_description":"Cúa es una importante ciudad del centro de Venezuela, capital del Municipio Urdaneta, del Estado Miranda. Conocida como «La Perla del Tuy», la ciudad se encuentra en el área de la Gran Caracas conocida como los Valles del Tuy, que incluye otras ciudades importantes como Charallave, Ocumare del Tuy y Santa Teresa del Tuy; las otras áreas de la Gran Caracas incluyen a la Zona Metropolitana, Guarenas-Guatire, Altos Mirandinos y Litoral Central."},{"page_url":"https://jv.wikipedia.org/wiki/Secret_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Secret_Garden1.jpg","page_title":"Secret Garden","context_page_description":"Secret Garden punika duo Irlandia-Nurwègen ingkang mainake musik jaman anyar, ugi saged dipunmangerti déning sabagiyan misuwur dados olah musik neoklasik.\\nSecret Garden kapengkar dumadi juru main biolawati Irlandia Fionnuala Sherry lan pianis/panggubah Rolf Løvland. Duo punika ngasilaké utawi nyathet ing kancah pasar kirang langkung 3 yuta album ugi menang bebungah Lelomban Tembang Eurovision ing nagara Nurwègen kanggé kakalihipun ing taun 1995 minangka gubahan \\"Nocturne\\". Inggih punika kapisanan kanthi saumuripun sajarah minangka kapilihipun karya musik kang kaunggulake ing babagan instrumen dados jawara Kontes Lagu Eurovision, minangka cecampuripun basa Nurwègen, kang dipunserta déning panjenenganipun panggubah Petter Skavlan."},{"page_url":"https://de.wikipedia.org/wiki/Schierstedt_(Adelsgeschlecht)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Wappen_Tornau_vor_der_Heide.png","page_title":"Schierstedt (Adelsgeschlecht)","context_page_description":"Schierstedt bzw. Schierstaedt ist der Name eines Adelsgeschlechts, das dem obersächsischen Uradel entstammt und sein gleichnamiges Stammhaus bei Aschersleben hatte."},{"page_url":"https://en.wikipedia.org/wiki/Five_Forks,_Nelson_County,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Mineral_Springs_Baptist_Church.jpg","page_title":"Five Forks, Nelson County, Virginia","context_page_description":"Five Forks is an unincorporated community in Nelson County, Virginia, United States."},{"page_url":"https://fr.wikipedia.org/wiki/Transformateur_de_puissance","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Bushing_Mounting.jpg","page_title":"Transformateur de puissance","context_page_description":"Un transformateur de puissance est un composant électrique haute-tension essentiel dans l'exploitation des réseaux électriques. Sa définition selon la commission électrotechnique internationale est la suivante : « Appareil statique à deux enroulements ou plus qui, par induction électromagnétique, transforme un système de tension et courant alternatif en un autre système de tension et courant de valeurs généralement différentes, à la même fréquence, dans le but de transmettre de la puissance électrique ». Sa principale utilité est de réduire les pertes dans les réseaux électriques. Il peut être monophasé ou triphasé et recevoir divers couplages : étoile, triangle et zigzag.\\nOn retrouve les transformateurs de puissance dans différents types d'applications : dans les réseaux de transmission électrique, dans la distribution électrique, dans les usines en amont de fours électriques notamment et dans les trains. Chacun répondant à des contraintes et des usages très différents."},{"page_url":"https://fr.wikipedia.org/wiki/Ryan_Hall_(athl%C3%A9tisme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Ryan_Hall.jpg","page_title":"Ryan Hall (athlétisme)","context_page_description":"Ryan Hall, né le 14 octobre 1982 aux États-Unis, est un coureur américain de longue distance. Il a gagné le marathon 2008 de qualification américaine aux jeux olympiques et termina 10ᵉ aux Jeux olympiques de Pékin. Il détient le record américain de semi-marathon."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_projections_cartographiques","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/MercTranEll.png","page_title":"Liste de projections cartographiques","context_page_description":"Cette liste recense différentes méthodes de projection cartographique."},{"page_url":"https://fi.wikipedia.org/wiki/Eug%C3%A8n_H%C3%B6gstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Eugene_Hogstrom.jpg","page_title":"Eugèn Högström","context_page_description":"Eugèn Alexander Nikolai Högström oli suomalainen kenraalimajuri. Hän oli Venäjän 5. armeijan päämajoitusmestari 1917–1918.\\nKäytyään Haminan kadettikoulun Högström palveli vuodesta 1895 upseerina Venäjän armeijassa, ensimmäiset 12 vuotta Turkestanin tykistöprikaatissa. Ensimmäisen maailmansodan aikana hän palveli esikuntaupseerina eri yksiköissä ollen sotilasarvoltaan everstiluutnantti, vuodesta 1916 eversti. Kesällä 1917 hän toimi 45. armeijakunnan esikuntapäällikkönä ja sai ylennyksen kenraalimajuriksi. Högström nimitettiin joulukuussa 1917 Venäjän 5. armeijakunnan päämajoitusmestariksi, missä tehtävässä hän toimi kunnes vanhat keisarillisen armeijan yksiköt lakkautettiin huhtikuussa 1918. Venäjän sisällissodan aikana Högström palveli puna-armeijan riveissä, mutta sivussa rintamilta Galitsian ja Valko-Venäjän alueella. Vuosina 1919–1920 hän oli useiden sotakoulujen opettajana ja johtajana. Hän palasi Suomeen Tarton rauhan jälkeen kesällä 1921.\\nHögström oli vuodesta 1924 valkoisten emigranttien järjestön Venäjän yleissotilaallisen liiton tiedustelujohtaja Suomessa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D1%83%D0%B1_%D0%9C%D0%92%D0%94_%D0%91%D0%B5%D0%BD%D0%BA%D0%B5.jpg","page_title":"Владимирская губерния","context_page_description":"Влади́мирская губе́рния — административно-территориальная единица Российской империи, Российской республики РСФСР и СССР, существовавшая в 1796—1929 годах. Губернский город — Владимир."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%AC%E9%A0%AD%E8%A7%92%E5%8D%81%E4%B8%89%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Hong_Kong_To_Kwa_Wan_Fung_Yi_Street_Road_Sign.JPG","page_title":"馬頭角十三街","context_page_description":"馬頭角十三街，是位於香港九龍馬頭角的一系列街道統稱，而非正式的街道名稱。十三街由13條街道組成，合為馬頭角傳統舊區，兼車房集中地，歷史悠久。它們分別為：\\n街區北面的主要道路木廠街；\\n街區南面的主要道路馬頭角道；\\n以及其中的11條舊區街道：龍圖街、鳳儀街、鹿鳴街、麟祥街、鷹揚街、鵬程街、鴻運街、蟬聯街、燕安街、駿發街及鶴齡街。\\n十三街的最大特色亦在於當中11條全直街道，可見每條街的字首均為中國傳統有吉祥兆頭之動物。而且，所有街道上的建築均為樓齡超過50年的舊樓。近年，由於十三街樓宇連年失修，居民促請政府盡快成立業主立案法團，以解決維修問題，但未能成功。\\n十三街的重建問題，多年來皆存在爭議，項目由香港房屋協會進行樓宇更新大行動。"},{"page_url":"https://en.wikipedia.org/wiki/Ronaldo_(Brazilian_footballer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ronaldinho06Jun2005Abr.jpeg","page_title":"Ronaldo (Brazilian footballer)","context_page_description":"Ronaldo Luís Nazário de Lima, commonly known as Ronaldo, is a Brazilian business owner, president of La Liga club Real Valladolid, and a retired professional footballer who played as a striker. Popularly dubbed in Portuguese O Fenômeno, he is widely considered one of the greatest players of all time. As a multi-functional striker who brought a new dimension to the position, Ronaldo has been the influence for a generation of strikers that have followed. His individual accolades include being named FIFA World Player of the Year three times, and winning two Ballon d'Or awards.\\nRonaldo started his career at Cruzeiro and moved to PSV in 1994. He joined Barcelona in 1996 for a then world record transfer fee, and at 20 years old he was named the 1996 FIFA World Player of the Year, making him the youngest recipient of the award. In 1997, Inter Milan broke the world record fee to sign Ronaldo, making him the first player since Diego Maradona to break the world transfer record twice. At 21 he received the 1997 Ballon d'Or, and he remains the youngest recipient of the award."},{"page_url":"https://lt.wikipedia.org/wiki/Augusto_De_Luca","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/LA3_Roma_di_Augusto_De_Luca.jpg","page_title":"Augusto De Luca","context_page_description":"Augusto De Luca – italų fotografas menininkas, senienų rinkėjas.\\nFotografas dabar žinomas savo fotografijomis, vaizduojančiomis įžymius žmones bei architektūros nuotraukomis. Jo kūrybai svarbus ir stiprus pavyzdys buvo Richard Avedon\`o portretai. Augusto De Luca fotografijos dekoratyvios, simboliškos, eksperimentuojama su spalvomis, fotografijos technikomis. Jis išimtinai naudojo „Hasselblad“ 6x6 mm eksponometro kamerą, aprūpintą 80 mm objektyvu, ir kartais plataus kampo objektyvą peizažams.\\nAugusto De Luca surengė apie 150 tarptautinių parodų. 1996 m. De Luca ir Ennio Morricone gavo prizą Città di Roma už knygos“Roma Nostra”.\\nJo darbų yra įsigiję Prancūzija, JAV, Belgija."},{"page_url":"https://pt.wikipedia.org/wiki/Copa_do_Mundo_FIFA_Sub-20_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Addington_Rugby_Stadium.jpg","page_title":"Copa do Mundo FIFA Sub-20 de 2015","context_page_description":"A Copa do Mundo FIFA Sub-20 de 2015 foi a vigésima edição do torneio organizado pela Federação Internacional de Futebol e disputado na Nova Zelândia entre os dias 30 de maio a 20 de junho com a participação de 24 seleções.\\nA Sérvia conquistou o seu primeiro título como nação independente ao vencer o Brasil por 2–1 na final, com o gol da vitória sendo marcado na prorrogação."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D1%8C%D0%B2%D0%B0%D0%BB%D1%8C_(%D0%90%D1%80%D0%B4%D0%B5%D0%BD%D0%BD%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Belval_%28Ardennes%29_mairie_et_%C3%A9glise.JPG","page_title":"Бельваль (Арденни)","context_page_description":"Бельва́ль — муніципалітет у Франції, у регіоні Шампань-Арденни, департамент Арденни. Населення — 240 осіб.\\nМуніципалітет розташований на відстані близько 195 км на північний схід від Парижа, 95 км на північ від Шалон-ан-Шампань, 6 км на захід від Шарлевіль-Мезьєра."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Tobin_(author)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Paul_Tobin_at_Stumptown_Comics_Festival_2007.jpg","page_title":"Paul Tobin (author)","context_page_description":"Paul Tobin is an American comic writer who has written regularly for Marvel Comics since 2000."},{"page_url":"https://ro.wikipedia.org/wiki/Aldea_del_Rey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Aldea_del_Rey.png","page_title":"Aldea del Rey","context_page_description":"Aldea del Rey este un oraș din Spania, situat în provincia Ciudad Real din comunitatea autonomă Castilia-La Mancha. Are o populație de 2.015 de locuitori."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%BB%D1%8C%D0%B2%D0%B0%D1%80_%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D0%B0_(%D0%9A%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D1%87%D1%83%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/%D0%A4%D0%BE%D0%BD%D1%82%D0%B0%D0%BD_%D1%83_%D1%81%D0%BA%D0%B2%D0%B5%D1%80%D1%96_%D0%9F%D1%83%D1%88%D0%BA%D1%96%D0%BD%D0%B0_%28%D0%9A%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D1%87%D1%83%D0%BA%29.jpg","page_title":"Бульвар Пушкина (Кременчуг)","context_page_description":"Бульвар Пушкина — бульвар протяженностью около 750 метров, расположенный в городе Кременчуг. Бульвар носит имя поэта Александра Сергеевича Пушкина."},{"page_url":"https://pt.wikipedia.org/wiki/Jes%C3%BAs_Malverde","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Jes%C3%BAs_Malverde.JPG","page_title":"Jesús Malverde","context_page_description":"Jesus Malverde, possivelmente nascido como Jesús Juárez Mazo, também conhecido como o \\"bom bandido\\", \\"anjo de pobres\\", ou o \\"narcossanto\\", é um herói folclórico, do estado mexicano de Sinaloa. Ele possuia ascendência Yoreme e espanhola. Ele é um \\"Robin Hood \\", que se supõe ter roubado dos ricos para dar aos pobres.\\nEle é celebrado como um santo popular por alguns, no México e Estados Unidos, especialmente entre aqueles envolvidos no tráfico de drogas."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_des_Barres_(d%27Oissery)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Jean_des_Barres_1282-1.png","page_title":"Jean des Barres (d'Oissery)","context_page_description":"Jean des Barres, dit « d'Oissery », né possiblement vers 1230 et mort en 1289 est un chevalier et croisé français.\\nIl appartient à la branche aînée de la maison des Barres, et à ce titre, il est le dernier seigneur d'Oissery de la famille des Barres.\\nIl doit sa célébrité au fait qu'il est revenu des croisades avec une Égyptienne qu'il épousa en secondes noces."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AF%8B%E0%AE%B0%E0%AE%BF_%E0%AE%85%E0%AE%B0%E0%AE%9A%E0%AE%AE%E0%AE%B0%E0%AE%AA%E0%AF%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Jam_afghan_architecture_brick_decor_ghor_province.jpg","page_title":"கோரி அரசமரபு","context_page_description":"கோரி அரசமரபு அல்லது குரித்து அரசமரபு கிழக்கு பாரசீகத்தின் தற்கால மத்திய ஆப்கானித்தானின் கோர் பிரதேசத்தில் வாழ்ந்த கோரி மக்கள் பௌத்த சமயத்திலிருந்து இசுலாமிய சமயத்திற்கு மதம் மாறியவர்கள். கோரி வம்சத்தின் முதல் பேரரசரான அபு அலி இபினு முகமதுவின்"},{"page_url":"https://en.wikipedia.org/wiki/Jonathan_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Jonathan_Company_Battle_Site_The_Well_IMG_1175.jpg","page_title":"Jonathan Company","context_page_description":"Jonathan Company was a military unit in the Israeli War of Independence composed mainly of youngsters under the age of 18, from the Gadna and their adult instructors. The company is noted for its high casualty rate, and the youth of its members. The company was established in April 1948 in Jerusalem and dissolved in August 1948 due to its heavy losses in combat. It was part of the Etzioni Brigade."},{"page_url":"https://sv.wikipedia.org/wiki/Peter_Stormare","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Peter_Stormare_2015-09-23_001_%28cropped%29.jpg","page_title":"Peter Stormare","context_page_description":"Rolf Peter Ingvar Stormare, ursprungligen Storm, född 27 augusti 1953 i Kumla, Örebro län, är en svensk skådespelare, regissör och musiker."},{"page_url":"https://es.wikipedia.org/wiki/Peque%C3%B1o_Sat%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Portrait_of_Ali_Khamenei%2C_October_2016.jpg","page_title":"Pequeño Satán","context_page_description":"El Pequeño Satán, es un nombre usado por los ayatolas iraníes, para llamar al estado sionista de Israel.​​​"},{"page_url":"https://es.wikipedia.org/wiki/Parque_natural_del_Desierto_de_las_Palmas","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Mapa_DesiertodelasPalmas.png","page_title":"Parque natural del Desierto de las Palmas","context_page_description":"El Desierto de Las Palmas es un parque natural de la provincia de Castellón, en la Comunidad Valenciana, España."},{"page_url":"https://pt.wikipedia.org/wiki/Kristin_Kreuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Kristin_Kreuk_WonderCon_2013.jpg","page_title":"Kristin Kreuk","context_page_description":"Kristin Laura Kreuk é uma atriz e modelo canadense, mais conhecida por interpretar Lana Lang em Smallville e Catherine 'Cat' Chandler em Beauty & the Beast. Ela também protagonizou os filmes Branca de Neve, Street Fighter: A Lenda de Chun-Li e Irvine Welsh's Ecstasy."},{"page_url":"https://war.wikipedia.org/wiki/Chamaedorea_seifrizii","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Chamaedorea_seifrizii0.jpg","page_title":"Chamaedorea seifrizii","context_page_description":"An Chamaedorea seifrizii in uska species han Liliopsida nga ginhulagway ni Karl Ewald Maximilian Burret. An Chamaedorea seifrizii in nahilalakip ha genus nga Chamaedorea, ngan familia nga Arecaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://sr.wikipedia.org/wiki/Kalmodulin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Calmodulin.png","page_title":"Kalmodulin","context_page_description":"Kalmodulin je kalcijum-vezujući protein koji poseduju sve eukariotske ćelije. On može da se veže i reguliše veliki broj različitih proteina, i stoga ima uticaja na brojne ćelijske funkcije."},{"page_url":"https://it.wikipedia.org/wiki/Stewartite","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Stewartite-142744.jpg","page_title":"Stewartite","context_page_description":"La stewartite è un minerale."},{"page_url":"https://bg.wikipedia.org/wiki/37_mm_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%BD%D0%BE_%D0%BE%D1%80%D1%8A%D0%B4%D0%B8%D0%B5_70-%D0%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/70-K-KrasnyyKavkaz2.jpg","page_title":"37 mm автоматично оръдие 70-К","context_page_description":"37 mm автоматично оръдие 70-К е автоматично оръдие калибър 37 mm, на въоръжение във ВМС на СССР от 1940 г. Артилерийската установка е морската версия на армейската 37 mm артустановка 61-К."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9F%AF%E5%88%A9%E5%BC%97%E5%BE%B7%C2%B7%E7%9A%AE%E5%AF%87%E5%BC%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Pickover.jpg","page_title":"柯利弗德·皮寇弗","context_page_description":"柯利弗德·皮寇弗是科普、数学和科幻作家。他写了超过50本书，主题遍及电脑、创意、艺术、数学、黑洞、人类行为、智慧、时间旅行、地外生物及科幻。他拥有大量的专利，是一些杂志的智力游戏提供者。\\n他现为IBM托马斯·Ｊ·沃森研究中心的研究员，并在Odyssey及Discover杂志写专栏。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%81%D0%B5%D0%BD%D0%BE%D0%B2%D0%B0_%D0%BA%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Asenova-fortress-2008-06-01-2.jpg","page_title":"Асенова крепост","context_page_description":"Асеновата крепост, или Петрич, са развалини на средновековна крепост с укрепената църква „Света Богородица Петричка“. Намира се в планината Родопи на 2 km от Асеновград, България.\\nКрепостта е съществувала още по времето на траките, преустроена е от Византия през IX век, за да охранява вратата на Беломорския проход и да осигури византийската граница в този край. Първите писмени сведения за крепостта са от XI век и са получени от устава на тогава построения Бачковски манастир. От тези сведения се вижда, че Асеновата крепост е притежавала собствена охрана и администрация. Превземана е от кръстоносците по времето на Четвъртия кръстоносен поход. Крепостта съществува до 1410 г., разрушена е от нахлуващите османски войски.\\nНаречена е на цар Иван Асен II, който през 1231 г. прави редица поправки по нея с цел заздравяването ѝ. Издълбаният в една скала на крепостта надпис свидетелства за това:\\nТвърдината е сред Стоте национални туристически обекта. Обявена е за национален паметник на културата. Отворена е целогодишно за посещения, има печат."},{"page_url":"https://de.wikipedia.org/wiki/Kabukiza","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Kabukiza_Theater_Tokyo_1907-1911.jpg","page_title":"Kabukiza","context_page_description":"Das Kabukiza, auch Kabuki-za, ist das größte Kabuki-Theater Japans und steht im Tokioter Stadtteil Ginza. Das Theater wurde 1889 eröffnet und zeigt heute als einziges Theater Kabuki-Aufführungen in einer durchgängigen Spielzeit. Das heutige Gebäude ist der fünfte Bau des Theaters."},{"page_url":"https://en.wikipedia.org/wiki/Paula_Wajsman","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Punto_Atr%C3%A1s.jpeg","page_title":"Paula Wajsman","context_page_description":"Paula Wajsman was an Argentine psychologist, writer, translator, and researcher."},{"page_url":"https://en.wikipedia.org/wiki/Nicole_Stenger","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/StengerAngels_left.jpg","page_title":"Nicole Stenger","context_page_description":"Nicole Stenger is a French-born American artist, pioneer in Virtual Reality and Internet movies. In 1989–1991, she was a research Fellow at MIT. In 1991–1992, she was a Visiting Scholar at the Human Interface Technology Laboratory in Seattle. Her works have been featured in the SIGGRAPH Art Show, the FILE Festival, the JavaMuseum, the Cartier Art Foundation and are part of the Archive of Digital Art. In 2013, she was included in the \\"Contemporary women artists on the web\\" collection of the National Museum of Women in the Arts, in Washington DC."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%81%D1%81_%D0%92%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_1966","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Vivian_del_Bianco_003994058.jpg","page_title":"Мисс Вселенная 1966","context_page_description":"Мисс Вселенная 1966 — 15-й ежегодный конкурс красоты, проводился 16 июля 1966 года в Miami Beach Auditorium, Майами-Бич, Флорида, США. За победу на нём соревновалось 58 претенденток. Победительницей стала представительница Швеции, 18-летняя Маргарета Арвидссон."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Sheffield","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Mappin2009.jpg","page_title":"University of Sheffield","context_page_description":"The University of Sheffield is a public research university in Sheffield, South Yorkshire, England. Its history traces back to the foundation of Sheffield Medical School in 1828, Firth College in 1879 and Sheffield Technical School in 1884. University College Sheffield was subsequently formed in 1897 by the amalgamation of the three institutions and gained royal charter as University of Sheffield in 1905.\\nSheffield is a multi-campus university predominantly over two campus areas in close proximity: the Western Bank and the St George's. The annual income of the institution for 2018–19 was £677.2 million of which £154.8 million was from research grants and contracts, with an expenditure of £657.9 million. Sheffield ranks among the top 10 of UK universities for research grant funding, and it has become number one in the UK for income and investment in engineering research according to new data published by the Higher Education Statistics Agency. It is one of the top 7 British universities by postgraduate student enrollment along with UCL, King's, Manchester, Birmingham, Edinburgh and Oxford."},{"page_url":"https://sk.wikipedia.org/wiki/Fran%C3%A7ois_Boucher","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Boucher_autograph.png","page_title":"François Boucher","context_page_description":"François Boucher bol francúzsky maliar, významný predstaviteľ rokoka.\\nPrvý kráľovský maliar, obľúbenec Madame de Pompadour, neskôr rektor Akadémie. Okrem portrétov francúzskej šľachty maľoval mytologické témy lásky v nežných pastelových farbách."},{"page_url":"https://fi.wikipedia.org/wiki/Marie_Antoinette","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Duplessi-Bertaux_-_Arrivee_de_Louis_Seize_a_Paris.png","page_title":"Marie Antoinette","context_page_description":"Maria Antonia Josepha Johanna von Habsburg-Lothringen oli Unkarin ja Böömin prinsessa, Itävallan arkkiherttuatar, Ranskan dauphine ja lopulta kuningatar. Hän oli Itävallan kuningattaren Maria Teresian tytär ja keisari Joosef II:n sisar. Hän oli myös Ranskan kuninkaan Ludvig XVI:n puoliso ja Ludvig XVII:n äiti.\\nPolitiikkansa, käytöksensä ja syntyperänsä vuoksi Marie Antoinette oli vihan kohteena Ranskan vallankumouksen aikana, ja hänet mestattiin lokakuussa 1793."},{"page_url":"https://pl.wikipedia.org/wiki/Resko_P%C3%B3%C5%82nocne_W%C4%85skotorowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Resko_Polnocne_Waskotorowe_%281%29.jpg","page_title":"Resko Północne Wąskotorowe","context_page_description":"Resko Północne Wąskotorowe – nieczynna wąskotorowa stacja kolejowa w Resku, w województwie zachodniopomorskim, w Polsce.\\nW 1947 roku zmieniono niemiecką nazwę stacji – Regenwalde Ldb., na polską nazwę Resko Północne Wąskotorowe."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE_%D0%BF%D1%80%D0%B2%D0%B5%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D0%B2%D0%BE_%D1%80%D0%B0%D0%BA%D0%BE%D0%BC%D0%B5%D1%82_%D0%B7%D0%B0_%D0%BC%D0%B0%D0%B6%D0%B8_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/110220_HA_ext_rampe2-bdef.jpg","page_title":"Светско првенство во ракомет за мажи 2017","context_page_description":"Светско првенство во ракомет за мажи 2017 — 25. светско првенство во ракомет за мажи организирано од Меѓународната ракометна федерација. Првенството се одржало во Франција и траело од 11 јануари до 29 февруари 2017 година."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D1%80%D1%96%D1%94%D0%BB%D1%8C_(%D0%97%D0%BD%D0%B5%D0%B4%D0%BE%D0%BB%D0%B5%D0%BD%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bishop_Myriel_Les_Miserables.jpg","page_title":"Мірієль (Знедолені)","context_page_description":"Шарль-Франсуа́-Б'єнвеню́ Міріє́ль, а також Єпи́скоп Міріє́ль та Монсеньйо́р Б'єнвеню́ — вигаданий персонаж роману-епопеї Віктора Гюго «Знедолені»; єпископ міста Дінь на південному сході Франції. У творі Мірієль є героїчною фігурою, що втілює співчуття та милосердя. Прототипом персонажа Гюго став ординарій діньской єпархії Б'єнвеню де Міолліс, від якого Мірієль успадкував не лише характер, але й одне з імен."},{"page_url":"https://en.wikipedia.org/wiki/Spectral_music","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Harmonic_spectra_theoretical_x_y.png","page_title":"Spectral music","context_page_description":"The spectral approach to musical composition was first given a name in 1979 by Hugues Dufourt, in an article he entitled \\"Musique spectrale\\". In spectral music, the spectrum – or group of spectra – replace harmony, melody, rhythm, orchestration and form. The spectrum is always in motion, and the composition is based on spectra developing through time and exerting an influence on rhythm and formal processes. Spectral music seeks to exteriorize the inner reality of sound, to project its inner dynamics into an acoustic space and time, and to transmit to the public the reality of sound in all its complexity.\\nDefined in technical language, spectral music is an acoustic musical practice where compositional decisions are often informed by sonographic representations and mathematical analysis of sound spectra, or by mathematically generated spectra. The spectral approach focuses on manipulating the spectral features, interconnecting them, and transforming them. In this formulation, computer-based sound analysis and representations of audio signals are treated as being analogous to a timbral representation of sound."},{"page_url":"https://fi.wikipedia.org/wiki/Salzburgin_lentoasema","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Salzburg_Airport_from_the_air.jpg","page_title":"Salzburgin lentoasema","context_page_description":"Salzburgin lentoasema tai W. A. Mozartin lentoasema on Itävallan toiseksi suurin lentoasema Wienin lentoaseman jälkeen. Se sijaitsee 4 kilometriä Salzburgin keskustasta ja 2 kilometriä Saksan vastaiselta rajalta. Lentoasema otettiin käyttöön vuonna 1926.\\nTalvikausina Salzburgin lentoasema palvelee lukuisia turisteja. Tärkeimpiä Salzburgiin liikennöiviä lentoyhtiöitä ovat Austrian Arrows/Austrian Airlines, British Airways ja Ryanair.\\nSalzburgin lentoasema on Euroopan alueellisten lentoyhtiöiden liiton jäsen ja edustettuna tämän johtokunnassa."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A5%8A%E6%A3%AE_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Yeung_Sum_in_2015.jpg","page_title":"楊森 (香港)","context_page_description":"楊森，SBS，JP，生於廣東廣州市區，籍貫廣東廣州市增城，前立法會議員，現為香港大學社會工作及社會行政學系榮譽助理教授及民主黨中常委。\\n他是匯點的創會成員，2002年至2004年擔任民主黨主席。"},{"page_url":"https://ca.wikipedia.org/wiki/Lilla_(Montblanc)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Sant_Joan_de_Lilla.JPG","page_title":"Lilla (Montblanc)","context_page_description":"Lilla és una població de la part sud-est del municipi de Montblanc, a la Conca de Barberà. Situada al peu de la carretera N-240 entre Montblanc i Valls, en el coll de Lilla, a la serra de les Guixeres, que marca el límit entre la Conca i l'Alt Camp. El 2009 tenia 94 habitants.\\nLa seva festa major d'estiu sempre se celebra el darrer diumenge del mes d'agost. I la d'hivern és per sant Sebastià, el 20 de gener."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D1%83%D1%87,_%D0%94%D0%B6%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Jay_Roach_%282013%29.JPG","page_title":"Роуч, Джей","context_page_description":"Мэтью Джей Роуч — американский режиссёр и продюсер. Он наиболее известен как режиссёр фильмов об Остине Пауэрсе, «Знакомство с родителями», «Знакомство с Факерами», «Ужин с придурками», «Грязная кампания за честные выборы», «Трамбо», и «Скандал»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%82%D0%B0%D0%B2%D0%B0%D0%BD_(%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/MATAWAN_STATION%2C_MONMOUTH_COUNTY.jpg","page_title":"Матаван (Нью-Джерсі)","context_page_description":"Матаван — місто в США, в окрузі Монмаут штату Нью-Джерсі. Населення — 8810 осіб."},{"page_url":"https://de.wikipedia.org/wiki/Lichtenstern","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Loewenstein_Lichtenstern_1_20070217.jpg","page_title":"Lichtenstern","context_page_description":"Lichtenstern ist ein Ortsteil von Löwenstein im Landkreis Heilbronn in Baden-Württemberg. Der Ort geht auf das Kloster Lichtenstern zurück, das von 1242 bis 1554 bestand, war anschließend bis 1806 Sitz des württembergischen Klosteramts Lichtenstern und ist seit 1865 Sitz der Evangelischen Stiftung Lichtenstern."},{"page_url":"https://it.wikipedia.org/wiki/Scandalo_Lockheed","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Tanaka_and_Nixon_1973_%28copy%29.png","page_title":"Scandalo Lockheed","context_page_description":"Lo scandalo Lockheed riguarda gravi casi di corruzione avvenuti in diversi Stati del mondo negli anni 1970, e riguardò in particolare, oltre che gli USA, anche i Paesi Bassi, Germania Ovest, Giappone e Italia.\\nNel 1976 la Lockheed Corporation ammise di aver pagato tangenti a politici e militari di alcuni Stati del mondo per vendere i propri aerei militari. Nei Paesi Bassi risultò coinvolta la stessa monarchia, mentre in Germania, Giappone e Italia i corrotti dalla Lockheed risultarono essere le strutture preposte alle valutazioni tecnico-militari dei ministeri della Difesa, i ministri della Difesa, e in Italia e Giappone anche i primi ministri."},{"page_url":"https://it.wikipedia.org/wiki/Niccol%C3%B2_di_Bonaccorso","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Niccolo_di_Buonaccorso._Mystic_Marriage_of_st_Catherine_and_Crusifiction_1380_L%27Aquila%2C_Museo_nazionale%2C_Abruzzo.jpg","page_title":"Niccolò di Bonaccorso","context_page_description":"Niccolò di Bonaccorso, o di Buonaccorso, è stato un pittore e politico italiano della scuola senese, documentato dal 1355."},{"page_url":"https://it.wikipedia.org/wiki/Domenico_Induno","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Artgate_Fondazione_Cariplo_-_Induno_Domenico%2C_Il_ritorno_del_soldato_ferito.jpg","page_title":"Domenico Induno","context_page_description":"Domenico Induno è stato un pittore italiano."},{"page_url":"https://en.wikipedia.org/wiki/Kalipatnam_Ramarao","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Kalipatnam_Ramarao_04.jpg","page_title":"Kalipatnam Ramarao","context_page_description":"Kalipatnam Ramarao known as Kara Mastar, is an Indian poet and writer known for his Telugu short stories.He won Sahitya Akademi Award in Telugu, 1995 for his Short stories Yajnam To Tommidi."},{"page_url":"https://eu.wikipedia.org/wiki/Otxar_basati","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Rubia_peregrina_1.jpg","page_title":"Otxar basati","context_page_description":"Otxar basatia errubiazeoen familiako landare belarkara da. Mediterraneoko Europan, Erresuma Batuan eta iparraldeko Afrikan jatorria du."},{"page_url":"https://sv.wikipedia.org/wiki/Kartfj%C3%A4ril","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Araschnia_levana_MHNT_CUT_2013_3_15_Forme_estivale_Compiegne_Ventre.jpg","page_title":"Kartfjäril","context_page_description":"Kartfjäril, Araschnia levana, är en ganska ny fjärilsart för Sverige. Första upptäckten gjordes 1982 i Skåne. I Finland upptäckte den 15-årige lepidopterologen Jouko E Hokka Araschnia Levana den 30 maj 1973 i Lauritsala, syd-östra delen av landet. Den lever i gläntor i skogsmark och uppträder i två generationer, april-juni samt juli-augusti. De två generationerna är väldigt olika till sitt utseende och Linné trodde att det var två separata arter. Kartfjärilen har brännässla som värdväxt.\\nDen brunaktiga vårgenerationen kan ibland förväxlas med små exemplar av nässelfjäril.\\nKartfjärilen saknar dock nässelfjärilens tydliga gula fläckar längs framkanten.\\nDen brunsvarta och vita andra generationen är typisk och svår att förväxla.\\nNumera är kartfjärilen utbredd i södra Skåne där den också finns i parkmiljö."},{"page_url":"https://nl.wikipedia.org/wiki/Gematigd_naaldwoud_van_de_Alpen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Naturschutzgebiet_Innsbrucker_Kuechenschelle.jpg","page_title":"Gematigd naaldwoud van de Alpen","context_page_description":"Het gematigd naaldwoud van de Alpen is een WWF-ecoregio die de bergketen van de Alpen omspant. De ecoregio is een bergbioom en daarmee een overgangsgebied tussen de ecoregio's van Centraal Europa en het Italiaanse Schiereiland."},{"page_url":"https://en.wikipedia.org/wiki/Fox_Theatres","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Side_and_elevated_view_of_Fabulous_Fox_Threater.JPG","page_title":"Fox Theatres","context_page_description":"Fox Theatres was a large chain of movie theaters in the United States dating from the 1920s either built by Fox Film studio owner William Fox, or subsequently merged in 1929 by Fox with the West Coast Theatres chain, to form the Fox West Coast Theatres chain. Fox West Coast went into bankruptcy and was sold to The National Theatres Corporation, led by Charles Skouras, on November 20, 1933 for $17,000,000.00. Eugene V. Klein later became CEO of National, and turned it into the conglomerate National General. Mann Theatres bought National General's theatres in 1973.\\nThis chain should not be confused with the Reading, Pennsylvania based Fox Theaters, founded by Richard Allen Fox in 1957 and primarily based on the East Coast."},{"page_url":"https://hu.wikipedia.org/wiki/A_magyar_%C3%A1llam_tulajdon%C3%A1ban_%C3%A1ll%C3%B3_m%C5%B1eml%C3%A9kek_list%C3%A1ja_Budapesten","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Lak%C3%B3h%C3%A1z%2C_kislak%C3%A1sos_mintatelep%2C_Napraforg%C3%B3_u._14..jpg","page_title":"A magyar állam tulajdonában álló műemlékek listája Budapesten","context_page_description":"Az alábbi lista a Budapesten található, magyar állam tulajdonában álló, országos műemléki védettségű ingatlanokat tartalmazza, kerületenkénti bontásban.\\nAz alábbi műemléki lista a Magyar Nemzeti Vagyonkezelő Zrt. nyilvántartásának 2013. szeptemberi állapotán alapul, az oldal tartalma csupán tájékoztató jellegű! Az országos műemléki nyilvántartás közhiteles forrása a Lechner Lajos Tudásközpont."},{"page_url":"https://hr.wikipedia.org/wiki/Mikromre%C5%BEe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Microgrid_Hierarchical_Control.png","page_title":"Mikromreže","context_page_description":"Mikromreža je lokalizirana grupacija izvora električne energije i opterećenja koja obično djeluje povezana i sinkronizirana s tradicionalnom centraliziranom električnom mrežom, ali se mogu odvojiti i funkcionirati samostalno, kako joj fizički i / ili ekonomski uvjeti diktiraju.\\nTime se otvara put na učinkovitu integraciju različitih izvora distribuirane električne energije, posebice obnovljivih izvora energije. Ona također pruža dobro rješenje za dodatnu rezervu snage u slučaju nužde jer ima mogućnost izmjene između samostalnog i umreženog načina rada. S druge strane, kontrola i zaštita su veliki izazovi u ovoj vrsti mrežne konfiguracije, koja se općenito tretira kao hijerarhijska kontrola. Mikromreža obuhvaća rasprostranjene izvore energije i opterećenja kojima se može upravljati na kontroliran i koordiniran način; one se mogu povezati s glavnom energetskom mrežom, raditi u izoliranom načinu rada ili biti u potpunosti nepovezane s mrežom.\\nMikromreže su mreže niskog ili srednjeg napona koje se nalaze na mjestima potrošnje energije ili blizu njih."},{"page_url":"https://en.wikipedia.org/wiki/Missal_of_the_Academy_of_Sciences","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Convento_e_Hospital_de_Jesus_%28Grande_Panorama_de_Lisboa%2C_MNAz%29.png","page_title":"Missal of the Academy of Sciences","context_page_description":"The Missal of the Academy of Sciences is a notable Portuguese 17th-century Roman Pontifical codex, profusely illuminated by Estêvão Gonçalves Neto.\\nOriginally commissioned for João Manuel de Ataíde, at the time Bishop of Viseu, its iconographic programme reflects the ideas of the Counter-Reformation. Bishop Ataíde had it deposited in the library of the Convent of Our Lady of Jesus in Lisbon and, since 1834, it has belonged to the collection of the Lisbon Academy of Sciences.\\nIt is widely considered the finest specimen of Portuguese miniature, and has been called by historian Joaquim Veríssimo Serrão a \\"veritable masterpiece of the national genius\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%98%BE%E5%BE%AE%E5%9B%BE%E8%B0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Micrographia_title_page.gif","page_title":"显微图谱","context_page_description":"《显微图谱》是罗伯特·胡克的一部著作。这本书于1665年9月出版，曾经风靡一时，是皇家学会第一份主要的出版物。"},{"page_url":"https://nl.wikipedia.org/wiki/Cats_(musical)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Koty.jpg","page_title":"Cats (musical)","context_page_description":"Cats is een musical gecomponeerd door Andrew Lloyd Webber in 1981 en gebaseerd op de dichtbundel Old Possum's Book of Practical Cats van T.S. Eliot."},{"page_url":"https://et.wikipedia.org/wiki/Sugin%C4%8Diai_vald","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Verbiskes.JPG","page_title":"Suginčiai vald","context_page_description":"Suginčiai vald on 2. järgu haldusüksus Leedus Molėtai rajooni territooriumil.\\nValla pindala on 220 km². 2011. aasta seisuga elas seal 1816 inimest. Valla keskus on Suginčiai küla. Vallamaja asub aadressil Darželio g., 1. Vallavanem on Nijolė Jauneikienė.\\nLisaks küladele on vallas ka mõned huutorid"},{"page_url":"https://cs.wikipedia.org/wiki/Westland_Sea_King","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Westland_Commando_Mk1_Egypt_1980.jpeg","page_title":"Westland Sea King","context_page_description":"Westland WS-61 Sea King je britský víceúčelový vrtulník vyvinutý v 60. letech 20. století firmou Westland na základě licence amerického typu Sikorsky S-61 Sea King. S ním má společnou konstrukci draku a hlavice rotoru. Dalšími prvky, například konstrukcí rotorových listů, použitými motory Rolls-Royce Gnome, avionikou a jiným palubním elektronickým vybavením se od něj podstatně odlišuje.\\nZákladní varianta vznikla jako námořní hlídkový stroj určený především k boji proti ponorkám, ale některé odvozené verze slouží jako pátrací a záchranné anebo stroje včasné vzdušné výstrahy a varování. Podstatně upravená verze Westland Commando byla zkonstruována pro plnění transportních úkolů.\\nBritskými Fleet Air Arm a Royal Air Force byl typ v různých rolích nasazen v řadě konfliktů, počínaje válkou o Falklandy. Nachází se, nebo se dříve nacházel, i ve stavu ozbrojených sil dalších zemí."},{"page_url":"https://ca.wikipedia.org/wiki/Esgl%C3%A9sia_de_Nostra_Senyora_de_l%27Assumpci%C3%B3_de_R%C3%A0fels","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Iglesia_de_Nuestra_Se%C3%B1ora_de_la_Asunci%C3%B3n%2C_R%C3%A1fales_03.JPG","page_title":"Església de Nostra Senyora de l'Assumpció de Ràfels","context_page_description":"L'església de La Nostra Senyora de l'Assumpció de Ràfels és un edifici pertanyent al grup de construccions en estil gòtic llevantí que van poblar el Baix Aragó durant el segle xiv.\\nConsta d'una àmplia i elevada nau única, capelles laterals entre els contraforts i capçalera poligonal. Al Segle XVI es va ampliar amb un tram més i les seves corresponents capelles laterals i ja al Segle XVII es va tornar a ampliar amb un altre tram més, el cor i la nova portada, respectant-se a tot moment el seu estil original. A l'interior destaca la varietat de les voltes de creueria emprades: senzilles, estrelades, en ventall, etc., únic element que alleugereix l'austeritat decorativa.\\nA l'exterior destaca de nou la seva sobrietat, només interrompuda per la presència de potents contraforts realitzats en pedra de carreu, igual que la resta de la construcció, i una imposta amb canetes que recorre el seu perímetre en la part superior, assenyalant el lloc a partir del qual s'elevà la coberta al segle xvii.\\nEn aquest moment va ser quan es va afegir també la gran espadanya del front meridional."},{"page_url":"https://et.wikipedia.org/wiki/Transistor","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Replica-of-first-transistor.jpg","page_title":"Transistor","context_page_description":"Transistor on kolme väljaviiguga pooljuhtseadis ehk triood elektriahelate lülitamiseks ja elektrisignaalide võimendamiseks. Transistori abil saab ühe elektrisignaali ‒ sisendsignaali ‒ abil juhtida ehk tüürida teist elektrisignaali ‒ väljundsignaali.\\nTransistor on elektroonikalülituste tähtsaim koostisosa elektroonikas, info- ja sidetehnikas ning jõuelektroonikas. Peamiselt valmistatakse transistore integraallülituste ehk mikrokiipide sees, kuid ka eraldi seadistena.\\nEnamiku transistoride alusmaterjal on pooljuht räni. Kõrgsagedusseadiste jaoks on kasutusel ka galliumarseniid ja teised pooljuhtmaterjalid. Ka jõutransistorides on kasutusel peamiselt räni, kuigi kasutatakse ka teisi kõrgema sulamistemperatuuriga pooljuhtmaterjale."},{"page_url":"https://hu.wikipedia.org/wiki/Sittard","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Station_Sittard2.jpg","page_title":"Sittard","context_page_description":"Sittard, limburgi nyelvváltozatban Zitterd, település Hollandia Limburg tartományában, melynek 2016-ban mintegy 37 000 lakosa volt. Keleten a német Selfkanttal határos. Itt található a SABIC petrolkémiai cég európai központja, valamint a DSM vállalat egyik nagy irodája. Labdarúgócsapata a Fortuna Sittard."},{"page_url":"https://pl.wikipedia.org/wiki/Okres_prenatalny","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Human_Embryo.JPG","page_title":"Okres prenatalny","context_page_description":"Okres prenatalny - okres od powstania zygoty do narodzin. Dzieli się na trzy okresy:\\nokres zygoty - od poczęcia do czasu zagnieżdżenia zygoty w ścianie macicy, 3-4 dzień ciąży,\\nokres zarodkowy - do czasu wytworzenia łożyska, 5-10 tydzień ciąży,\\nokres płodowy - do porodu, 11-40 tydzień ciąży.\\nPodział ciąży na trymestry, miesiące i tygodnie:\\nI trymestr\\n1 miesiąc – od 0 do 4 tygodnia ciąży\\n2 miesiąc – od 5 do 9 tygodnia ciąży\\n3 miesiąc – od 10 do 13 tygodnia ciąży\\nII trymestr\\n4 miesiąc – od 14 do 18 tygodnia ciąży\\n5 miesiąc – od 19 do 22 tygodnia ciąży\\n6 miesiąc – od 23 do 26 tygodnia ciąży\\nIII trymestr\\n7 miesiąc – od 27 do 31 tygodnia ciąży\\n8 miesiąc – od 32 do 36 tygodnia ciąży\\n9 miesiąc – od 37 do 40 tygodnia ciąży."},{"page_url":"https://oc.wikipedia.org/wiki/Sent_Julian","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Parc_%C3%A9olien_du_Lauragais_vu_de_SaintJulia.jpg","page_title":"Sent Julian","context_page_description":"Pels articles omonims, vejatz Sent Julian.\\nSent Julian es una comuna lengadociana, situada dins lo departament de la Nauta Garona e la region administrativa d'Occitània, ancianament de Miègjorn-Pirenèus."},{"page_url":"https://sv.wikipedia.org/wiki/Guldpannad_bladf%C3%A5gel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Golden_Fronted_Leafbird_Mukulhinge.jpg","page_title":"Guldpannad bladfågel","context_page_description":"Guldpannad bladfågel är en tätting i familjen bladfåglar som förekommer i Sydasien och Sydostasien."},{"page_url":"https://nl.wikipedia.org/wiki/Seychellenwever","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Seychelles_fody_1979_stamp.jpg","page_title":"Seychellenwever","context_page_description":"De seychellenwever is een zangvogel uit de familie Ploceidae."},{"page_url":"https://en.wikipedia.org/wiki/Mysterion_Rises","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/TreyParkerHWOFApr2013.jpg","page_title":"Mysterion Rises","context_page_description":"\\"Mysterion Rises\\" is the twelfth episode of the fourteenth season of animated television series South Park, and the 207th episode of the series overall. It aired on Comedy Central on November 3, 2010, and is the second of a three-part arc that began with the episode \\"Coon 2: Hindsight\\".\\nThe episode was written and directed by series co-creator Trey Parker, and was rated TV-MA L in the United States. In its original American broadcast on November 3, 2010, \\"Mysterion Rises\\" was watched by 3.263 million viewers. According to Nielsen ratings, \\"Mysterion Rises\\" was seen by 2.85 million overall households.\\nThe episode is notable for revealing the secret identity of Mysterion, which was deliberately left unresolved in \\"The Coon\\" and \\"Coon 2: Hindsight.\\""},{"page_url":"https://hu.wikipedia.org/wiki/Alf%C3%B6ldi_kisvas%C3%BAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/AEGV_%C3%A1llom%C3%A1s%C3%A9p%C3%BClet.JPG","page_title":"Alföldi kisvasút","context_page_description":"Az Alföldi kisvasút egy kisvasúti hálózat volt Békés megyében. 1894 és 1971 között üzemelt, legnagyobb kiterjedését 1956-ra érte el, amikor 152 kilométernyi vágányhálózattal rendelkezett. Több más kisvasúti és nagyvasúti vonal csatlakozott hozzá. A hálózat központja Békéscsaba volt."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_s%C3%A9nateurs_des_%C3%89tats-Unis_pour_le_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/William_Smathers.jpg","page_title":"Liste des sénateurs des États-Unis pour le New Jersey","context_page_description":"Depuis l'indépendance des États-Unis, l'État du New Jersey élit deux sénateurs, membres du Sénat fédéral."},{"page_url":"https://uk.wikipedia.org/wiki/Strobilanthes_dyeriana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Persian_Shield_Night.jpg","page_title":"Strobilanthes dyeriana","context_page_description":"Перський щит - вид рослини родини."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%82%A3%E3%83%83%E3%82%AD%E3%83%BC_(%E8%A1%A3%E6%9C%8D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/1915_Vorhemd_anagoria.JPG","page_title":"ディッキー (衣服)","context_page_description":"ディッキー、またはタキシード・フロントとは、タキシードやホワイトタイを着るときに着用する、シャツの前部分の形をした胸当てである。"},{"page_url":"https://de.wikipedia.org/wiki/Ni%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/%C4%86ele_Kula.jpg","page_title":"Niš","context_page_description":"Niš ist die drittgrößte Stadt in Serbien und gleichzeitig der Hauptverwaltungssitz des Okrug Nišava. 2011 zählte die Stadt 260.237 Einwohner. Niš ist Industrie- und Handelsstadt und Sitz eines orthodoxen Bischofs. In Niš befinden sich eine Universität, ein Symphonie-Orchester, Museen, Theater und verschiedene Kultureinrichtungen."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1963","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Paul_Way.JPG","page_title":"Lijst van personen geboren in 1963","context_page_description":"Dit is een lijst van personen die geboren zijn in 1963.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%92%99%E5%85%8B%E5%90%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Map_commune_FR_insee_code_30175.png","page_title":"蒙克吕","context_page_description":"蒙克呂是法國加爾省的一個市鎮，位於該省北部偏東，屬於尼姆區。該市鎮總面積21.88平方公里，2009年時的人口為146人。"},{"page_url":"https://fr.wikipedia.org/wiki/Henri_Djombo","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Henri_Djombo_-_Salon_du_livre_de_Paris_2015.jpg","page_title":"Henri Djombo","context_page_description":"Henri Djombo, né en 1952, est un écrivain et homme politique congolais. Membre du Parti congolais du travail, il exerça les fonctions de ministre de l'Économie forestière au sein du gouvernement de la République du Congo du 2 novembre 1997 au 7 mai 2016, date où il devient ministre de l'Agriculture, de l'Élevage et de la Pêche."},{"page_url":"https://nl.wikipedia.org/wiki/Miss_Angola","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Miss-universe-2011-leila-lopes.jpg","page_title":"Miss Angola","context_page_description":"Miss Angola is de nationale missverkiezing van het Zuidwest-Afrikaanse land Angola. Hierbij worden 's lands afgevaardigden voor de internationale missverkiezingen verkozen. De wedstrijd bestond al voor 1970. Van de onafhankelijkheid van Angola in 1975 tot 1991 werd de missverkiezing niet georganiseerd. Voordien werden wel kleine verkiezingen gehouden op initiatief van onder meer hotels. In 1998 kende het Angolese ministerie van hotels en toerisme de rechten op de missverkiezing toe aan het Comité Miss Angola. Vanaf dan mocht elke Angolese provincie een afgevaardigde naar de nationale verkiezing sturen. Ook stuurde het comité de verkozen Miss Angola naar de twee grootste internationale missverkiezingen; Miss Universe en Miss World. Miss Angola werd in 2007 eerste eredame bij Miss World en Miss Angola 2011, Leila Lopes, werd verkozen tot Miss Universe 2011."},{"page_url":"https://sv.wikipedia.org/wiki/Land%C3%A9bia","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Map_commune_FR_insee_code_22096.png","page_title":"Landébia","context_page_description":"Landébia är en kommun i departementet Côtes-d'Armor i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Plancoët som tillhör arrondissementet Dinan. År 2009 hade Landébia 479 invånare."},{"page_url":"https://nl.wikipedia.org/wiki/Wanja_Lundby-Wedin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Wanja_Lundby-Wedin.jpg","page_title":"Wanja Lundby-Wedin","context_page_description":"Wanja Lundby-Wedin is de huidige voorzitster van de Landsorganisationen i Sverige en de voormalige voorzitster van het Europees Verbond van Vakverenigingen. Daarnaast is ze lid van de partijraad van de Arbetarepartiet-Socialdemokraterna."},{"page_url":"https://en.wikipedia.org/wiki/Status_Quo_(Jerusalem_and_Bethlehem)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Treaty_of_Berlin_Article_62_Status_Quo.png","page_title":"Status Quo (Jerusalem and Bethlehem)","context_page_description":"The Status Quo is an understanding among religious communities with respect to nine shared religious sites in Jerusalem and Bethlehem. Other Holy Places in Israel and Palestine were not deemed subject to the Status Quo because the authorities of one religion or of one community within a religion are in recognized or effective possession.\\nThe status quo stemmed from a firman of Ottoman sultan Osman III in 1757 that preserved the division of ownership and responsibilities of various Christian holy places. Further firmans issued in 1852 and 1853 affirmed that no changes could be made without consensus from all six Christian communities; these firmans received international recognition in Article 9 of the Treaty of Paris.\\nThe term \\"status quo\\" was first used in regards to the Holy Places in the Treaty of Berlin.\\nThe 1929 summary prepared by L. G. A. Cust, The Status Quo in the Holy Places, became the standard text on the subject, and the details were further formalized in the 1949 United Nations Conciliation Commission after the 1947–1949 Palestine war."},{"page_url":"https://sl.wikipedia.org/wiki/Tlak_(arhitektura)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Rasenpflasterstein_1.jpg","page_title":"Tlak (arhitektura)","context_page_description":"Tlak je v gradbeništvu in arhitekturi talna površina na prostem ali površinska obloga v notranjosti stavb. Materiali za tlakovanje so asfalt, beton, kamen, kot so kocke, prodniki, umetni kamen, opeka, ploščice in včasih les. V krajinski arhitekturi je tlak del poti in se uporablja na pločnikih, cestnih površinah, dvoriščih, itd.\\nV angleščini pavement izvira iz latinskega pavimentum, kar pomeni, da so tla utrjena, ali v stari francoščini pavement - pločnik.\\nTlak, narejen z vzorci, kot so mozaiki, so običajno uporabljali Rimljani."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Central_Baltimore","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Heiser_Rosenfeld_Strauss_MD1.jpg","page_title":"National Register of Historic Places listings in Central Baltimore","context_page_description":"This is a list of National Register of Historic Places properties and districts in downtown Baltimore, Maryland, United States. Many other properties are located in other parts of the city; for these, see National Register of Historic Places listings in Baltimore, Maryland.\\nThe locations of the National Register properties and districts listed below may be seen in a map by clicking on \\"Map of all coordinates\\".\\nMuch of the central portion of the city and significant portions of the waterfront and city park system are included in the federally designated Baltimore National Heritage Area.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://af.wikipedia.org/wiki/Atlas_of_Peculiar_Galaxies","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/NGC_4618_I_FUV_g2006.jpg","page_title":"Atlas of Peculiar Galaxies","context_page_description":"Die Atlas of Peculiar Galaxies is ’n sterrekundekatalogus van ongewone sterrestelsels wat deur die Amerikaanse sterrekundige Halton Arp opgestel is. Daar is altesaam 338 stelsels in die katalogus, wat oorspronklik in 1966 deur die Kaliforniese Instituut vir Tegnologie gepubliseer is.\\nDie hoefdoel daarvan was om foto's van die verskillende soorte nabygeleë, ongewone sterrestelsels te verskaf. Arp het besef die rede hoekom sterrestelsels spiraal- of elliptiese stelsels word, is nie baie duidelik nie. Hy het ongewone stelsels beskou as klein \\"eksperimente\\" wat sterrekundiges kon bestudeer om die fisiese prosesse te verstaan wat spiraal- of elliptiese stelsels verwring. Die atlas is nie ’n algehele oorsig oor al die ongewone stelsels in die ruimte nie, maar verskaf eerder voorbeelde van die verskillende verskynsels soos wat hulle in nabygeleë stelsels gesien kan word.\\nOmdat min destyds bekend was oor die fisiese prosesse wat die verskillende vorms veroorsaak, word die sterrestelsels gerangskik volgens hul voorkoms. Voorwerpe 1-101 is individuele spiraalstelsels wat ongewoon is of oënskynlik klein metgeselle het. Voorwerpe 102-145 is elliptiese en elliptiesagtige stelsels."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%86%E0%A4%9C%E0%A4%BC%E0%A4%BE%E0%A4%A6_%E0%A4%B9%E0%A4%BF%E0%A4%A8%E0%A5%8D%E0%A4%A6_%E0%A4%AB%E0%A4%BC%E0%A5%8C%E0%A4%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/A_Sikh_Soldier_of_the_Azad_Hind_Fauj_at_a_function_in_Berlin.jpg","page_title":"आज़ाद हिन्द फ़ौज","context_page_description":"आज़ाद हिन्द फ़ौज का गठन पहली बार राजा महेन्द्र प्रताप सिंह द्वारा 29 अक्टूबर 1915 को अफगानिस्तान में हुआ था। मूल रूप से उस वक्त यह आजाद हिन्द सरकार की सेना थी, जिसका लक्ष्य अंग्रेजों से लड़कर भारत को स्वतंत्रता दिलाना था। जब दक्षिण-पूर्वी एशिया में जापान के सहयोग द्वारा नेताजी सुभाषचंद्र बोस ने क़रीब 40,000 भारतीय स्त्री-पुरुषों की प्रशिक्षित सेना का गठन शुरू किया और उसे भी आजाद हिन्द फौज नाम दिया तो उन्हें आज़ाद हिन्द फौज़ का सर्वोच्च कमाण्डर नियुक्त करके उनके हाथों में इसकी कमान सौंप दी गई।"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B4%D9%88%D8%AA%D8%A7_%D8%A7%D9%8A%D8%B4%D9%8A%D9%85%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Shouta_Ishimine.jpg","page_title":"شوتا ايشيمين","context_page_description":"شوتا ايشيمين لاعب بيسبول من اليابان."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Cl%C3%A9ophas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Saint-Cl%C3%A9ophas_-_Statue_devant_l%27%C3%A9glise.JPG","page_title":"Saint-Cléophas","context_page_description":"Saint-Cléophas est une municipalité de paroisse dans la municipalité régionale de comté de La Matapédia au Québec, située dans la région administrative du Bas-Saint-Laurent."},{"page_url":"https://nds.wikipedia.org/wiki/Pablo_Picasso","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Portrait_of_Henri_Matisse_1933_May_20.jpg","page_title":"Pablo Picasso","context_page_description":"Pablo Picasso, eegentlich Pablo Ruiz Picasso, weer en spaansch Maler, Grafiker un Bildhauer.\\nSien umfangriek Gesamtwark, dessen Gesamttall up 50.000 schätzt wurrd, umfaat Gemälde, Teknungen, Grafiken, Plastiken un Keramiken. Dat is präägt dör en groot Völfalt vun künstlerisch Utdrucksformen.\\nDe Warken ut sien Blau un Rosa Periood, un de Begrünnen vun den Kubismus tosommen mit Georges Braque billen den Anfang vun sien besünner Künstlerloopbahn.\\nTo den bekanntst Warken vun Picasso hörrt dat Bild Les Demoiselles d’Avignon. Dat wurr to'n Slötelbild vun de Klassische Moderne. Mit Utnahm vun dat monumental Gemälde Guernica, en künstlerisch Ümsetten vun de Schrecken vun den Spaanschen Börgerkriegs, hett kien anner Kunstwark vun dat 20. Johrhunnert de Forschung so herutfordert as de Demoiselles. Dat Motiv vun de Freedensduuv up dat Plakat, dat he 1949 för den Pariser Weltfreedenskongress schafft hett, wurr weltwiet to en Freedenssymbol.\\nPicasso ist neben Salvador Dalí en Künstler vun dat 20. Johrhunnert, för de sien Wark all to Levenstieden twee Museen inricht wurrn, dat Museu Picasso in Barcelona un dat Musée Picasso in Antibes."},{"page_url":"https://fr.wikipedia.org/wiki/Environnement_au_Bhoutan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Bhutan_IMG_3937.JPG","page_title":"Environnement au Bhoutan","context_page_description":"L'environnement au Bhoutan est l'environnement du pays Bhoutan."},{"page_url":"https://de.wikipedia.org/wiki/Siebbein","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Gray194.png","page_title":"Siebbein","context_page_description":"Das Siebbein ist ein Knochen des Hirnschädels. Er liegt am Ende der Nasenhöhle an der Grenze zur Schädelhöhle in der Tiefe und ist daher bei äußerer Betrachtung des Schädels nicht sichtbar."},{"page_url":"https://en.wikipedia.org/wiki/Dauphin_Island,_Alabama","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Fort_Gaines_06May2010.JPG","page_title":"Dauphin Island, Alabama","context_page_description":"Dauphin Island is a town in Mobile County, Alabama, United States, on a barrier island of the same name, at the Gulf of Mexico. It incorporated in 1988. The population was 1,238 at the 2010 census. The town is included in the Mobile metropolitan area. The island was renamed for Louis XIV of France's great-grandson and heir, the dauphin, the future Louis XV of France. The name of the island is often mistaken as Dolphin Island; dauphin means “prince” or “oldest son of the king” in French.\\nThe Gulf of Mexico is to the south of the island; the Mississippi Sound and Mobile Bay are to the north. The island's eastern end helps define the mouth of Mobile Bay. The eastern, wider portion of the island is shaded by thick stands of pine trees and saw palmettos, but the narrow, western part of the island features scrub growth and few trees.\\nDauphin Island is home to Fort Gaines, Dauphin Island Sea Lab, The Estuarium public aquarium, the Dauphin Island Airport, boat ramps, a large public pier that sits on dry land, historic sites, several restaurants, new condominium developments, and numerous private homes."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_riksintressen_f%C3%B6r_kulturmilj%C3%B6v%C3%A5rden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%C3%85rsunda_S%C3%B6rby_gravf%C3%A4lt_%28Ra%C3%A4-nr_%C3%85rsunda_9-1%29_0566.jpg","page_title":"Lista över riksintressen för kulturmiljövården","context_page_description":"Detta är en lista över riksintressen för kulturmiljövården."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%94%D0%B5%D1%81%D0%BA%D0%B0%D1%82%D0%B8_(%D0%BE%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Dimos_Hasion_Grevenon.png","page_title":"Дескати (општина)","context_page_description":"Дескати — општина во Гребенскиот округ на југозападот на Егејска Македонија, денес во областа Западна Македонија, Грција. Административен центар е гратчето Дескати, чие име има влашко потекло. На југ општината се граничи со Тесалија."},{"page_url":"https://nl.wikipedia.org/wiki/Hans_Truijen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Interieur%2C_overzicht_kapel_met_moderne_muurschilderingen_%28Hans_Truijen%2C_1978%29_-_Lemiers_-_20001662_-_RCE.jpg","page_title":"Hans Truijen","context_page_description":"Johannes Paulus Franciscus Truijen was een Nederlands kunstschilder en glazenier."},{"page_url":"https://fr.wikipedia.org/wiki/Litt%C3%A9rature_britannique_de_langue_anglaise_au_XIXe_si%C3%A8cle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Queen_Victoria_60._crownjubilee.jpg","page_title":"Littérature britannique de langue anglaise au XIXe siècle","context_page_description":"La littérature britannique de langue anglaise au XIXᵉ siècle comprend toutes les œuvres littéraires anglaises publiées - ou écrites - entre le 1ᵉʳ janvier 1801 et le 31 décembre 1900. Elle rassemble également les littératures écossaises, galloises, ou irlandaises écrites en anglais car elles sont considérées comme très proches de la littérature anglaise, que ce soit au niveau de la langue ou des idées."},{"page_url":"https://pt.wikipedia.org/wiki/Geografia_de_Santa_Helena","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/SH-St_Helena.png","page_title":"Geografia de Santa Helena","context_page_description":"Santa Helena consiste-se de um número de ilhas, no meio do Oceano Atlântico do Sul, entre a América do Sul e a África. Santa Helena ocupa uma área de 420 km², que incluem a Ilha de Santa Helena, Ascensão, e o grupo de ilhas de Ilha de Tristão da Cunha, que consitem o Arquipélago Tristão da Cunha, Ilha Gough, Ilha Inacessível e as três Ilhas Nightingale. Há 60 km de praia em Santa Helena. Em termos marítimos, Santa Helena tem uma exclusiva zona pesqueira de 200 minhas náuticas, e um território marítimo de doze milhas náuticas."},{"page_url":"https://de.wikipedia.org/wiki/Radrennbahn_Bielefeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Radrennbahn_Bielefeld_Denkmal.jpg","page_title":"Radrennbahn Bielefeld","context_page_description":"Die Bielefelder Radrennbahn befindet sich in Bielefeld an der Heeper Straße im Osten des Stadtbezirks Mitte. Die Bahn ist 333,33 Meter lang und aus fugenlos gegossenem Spannbeton. Sie gilt aufgrund ihrer hohen Steilkurven als eine der schnellsten Betonpisten Europas und ist besonders geeignet für Steher- aber auch für Sprint-Rennen."},{"page_url":"https://it.wikipedia.org/wiki/Grattacieli_pi%C3%B9_alti_di_Dallas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Magnolia_Dallas.jpg","page_title":"Grattacieli più alti di Dallas","context_page_description":"Dallas, la terza città più grande dello stato americano del Texas, è il sito di 36 grattacieli più alti di 107 metri, 19 dei quali sono più alti di 150 metri. L'edificio più alto della città è la Bank of America Plaza, alta 281 metri e completata nel 1985. Esso è inoltre il 3 ° edificio più alto del Texas e il 40 ° edificio più alto degli Stati Uniti. Il secondo grattacielo più alto della città è la Renaissance Tower, alta 270 metri e completata nel 1974. Tre dei dieci edifici più alti del Texas si trovano a Dallas."},{"page_url":"https://es.wikipedia.org/wiki/Convento_de_los_Jacobinos_(calle_Saint-Honor%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Club-des-jacobins.jpg","page_title":"Convento de los Jacobinos (calle Saint-Honoré)","context_page_description":"El Convento de la Anunciación​ o Convento de los Jacobinos de la calle Saint-Honoré​ era un convento de dominicos situado en la calle Saint-Honoré de París. Actualmente, en su ubicación se encuentra la Place du Marché-Saint-Honoré."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%D8%AF%DB%8C%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Gardez_paktya.jpg","page_title":"گردیز","context_page_description":"گَردیز شهری است در جنوب افغانستان و مرکز ولایت پکتیا است.\\nاین شهر در منتهی الیه دره رودخانه گردیز و در ارتفاع ۲۳۰۰تا۲۵۰۰ متری از سطح دریا قرار دارد.\\nبازار قدیمی شهر در سال ۱۹۴۳ میلادی بنا شده‌است و بعد آسفالت شدن جاده کابل - گردیز حمل و نقل مصنوعات چوبی افزون یافت و باعث رونق آن شهر گردید.\\nبالاحصار گردیز از آثار تاریخی آنست.\\nزمین‌های هموار ولایت پکتیا بیشتر در پیرامون گردیز زرمت قرار دارد و بیشتر آب زمین‌های کشاورزی آن از کاریزها تأمین می‌شود."},{"page_url":"https://fr.wikipedia.org/wiki/Lavash","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Pan_armenio_en_el_mercado_de_Yerevan.JPG","page_title":"Lavash","context_page_description":"Le lavash est une fine galette moelleuse faite de farine, de sel et d'eau, cuite dans un tandoor et consommée dans toute la Transcaucasie, l'Asie de l'Ouest et les zones entourant la mer Caspienne. Le lavash est l'un des types de pain les plus répandus en Arménie, en Azerbaïdjan, en Iran, en Turquie et dans tout le Moyen-Orient."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88%DA%AF%DB%8C%D8%AA%D8%A7_%DA%AF%D9%86%D9%BE%D8%A7%DA%A9%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Sugita_Genpaku.jpg","page_title":"سوگیتا گنپاکو","context_page_description":"سوگیتا گنپاکو زبان‌شناس، نویسنده، و مترجم اهل ژاپن بود."},{"page_url":"https://en.wikipedia.org/wiki/Least_tern","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Least_Tern_%28Sternula_antillarum%29_RWD3.jpg","page_title":"Least tern","context_page_description":"The least tern is a species of tern that breeds in North America and locally in northern South America. It is closely related to, and was formerly often considered conspecific with, the little tern of the Old World. Other close relatives include the yellow-billed tern and Peruvian tern, both from South America.\\nIt is a small tern, 22–24 cm long, with a wingspan of 50 cm, and weighing 39–52 g. The upper parts are a fairly uniform pale gray, and the underparts white. The head is white, with a black cap and line through the eye to the base of the bill, and a small white forehead patch above the bill; in winter, the white forehead is more extensive, with a smaller and less sharply defined black cap. The bill is yellow with a small black tip in summer, all blackish in winter. The legs are yellowish. The wings are mostly pale gray, but with conspicuous black markings on their outermost primaries. It flies over water with fast, jerky wingbeats and a distinctive hunchback appearance, with the bill pointing slightly downward.\\nIt is migratory, wintering in Central America, the Caribbean and northern South America. Many spend their whole first year in their wintering area."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monastic_houses_in_County_Mayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/KillalaRoundTower.jpg","page_title":"List of monastic houses in County Mayo","context_page_description":"In this article, smaller establishments such as monastic cells and notable monastic granges and camerae of the military orders of monks are included. The numerous monastic hospitals per se are not included here unless at some time the foundation had, or was purported to have, the status or function of an abbey, priory, friary or preceptory/commandery."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%AC%E6%88%90%E6%88%90%E7%94%B0%E7%A9%BA%E6%B8%AF%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Skyaccesssign.JPG","page_title":"京成成田空港線","context_page_description":"成田空港線は、東京都葛飾区の京成高砂駅と千葉県成田市の成田空港駅を結ぶ鉄道路線である。京成電鉄によって「成田スカイアクセス」という愛称が付けられ、各種掲示物などで成田スカイアクセス線という名称とオレンジ色の案内色を用いて旅客案内を行っている。駅ナンバリングで使われる路線記号はKS。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D0%BE%D0%B2%D0%BE_(%D1%83%D1%81%D0%B0%D0%B4%D1%8C%D0%B1%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D0%BE%D0%B2%D0%BE.JPG","page_title":"Станиславово (усадьба)","context_page_description":"Станиславово — загородная усадьба короля Станислава Августа Понятовского, созданная на рубеже 1760-х и 1770-х гг. по проекту придворного архитектора Джузеппе де Сакко под наблюдением Антония Тизенгауза. Теперь в черте Гродно. Последнему польско-литовскому монарху принадлежали в округе также частично сохранившиеся усадьбы Понемунь и Августовек.\\nНебольшой двухэтажный кирпичный господский дом выдержан в стиле позднего барокко. Ризалит в середине главного фасада декорирован пилястрами и завершён фронтоном, ранее имевшим высокий элемент в форме обелиска. Оконные проёмы ризалита оформлены наличниками, над ними размещены сандрики. Главный вход в здание выделен лоджией. Полукруглый эркер, в центре дворового фасада, декорирован монограммой SAR на аттике. В вестибюле сохранились две печи XIX века в стиле неоготики. Перед главным зданием расположены два флигеля под высокими вальмовыми крышами. Частично сохранились ворота ведущие в курдонёр. Хозяйственные постройки находятся к востоку и западу от дворца. Вокруг барского дома раскинулся пейзажный парк.\\nВ 1814 г. усадьбу приобрёл гродненский губернатор Ф. К. Друцкий-Любецкий."},{"page_url":"https://es.wikipedia.org/wiki/Beckingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Wappen_Beckingen.svg","page_title":"Beckingen","context_page_description":"Beckingen es un municipio situado en el distrito de Merzig-Wadern, en el estado federado de Sarre, con una población a finales de 2016 de unos 15 147 habitantes.​\\nSe encuentra ubicado al oeste del estado, cerca de la orilla del río Sarre —un afluente del río Mosela— y de la frontera con Francia."},{"page_url":"https://de.wikipedia.org/wiki/Torre_Palas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Torre_Palas_Talseite2.jpg","page_title":"Torre Palas","context_page_description":"Der Torre Palas, auch Tor di Pala genannt, steht oberhalb der Gemeinde San Vittore im schweizerischen Kanton Graubünden im unteren Teil des Misox. Der Name der Festung leitet sich vom unterhalb der Burg liegenden Dorfteil Pala ab."},{"page_url":"https://it.wikipedia.org/wiki/Audrey_Horne_(gruppo_musicale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/W0783-Hellfest2013_AudreyHorne_IceDale_ArveIsdal_68876.JPG","page_title":"Audrey Horne (gruppo musicale)","context_page_description":"Gli Audrey Horne sono una band hard rock/post-grunge di Bergen, Norvegia."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%A4seglocke_(Dresden)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Fotothek_df_ps_0002929_Stadt_%5E_Stadtlandschaften_%5E_Haltestellen.jpg","page_title":"Käseglocke (Dresden)","context_page_description":"Käseglocke ist der umgangssprachliche Name eines 1927/28 auf dem Postplatz in Dresden als Wartehalle errichteten Gebäudes, das mit Unterbrechungen von 1994 bis 2013 als Servicepunkt der Dresdner Verkehrsbetriebe diente. Der pavillonartige Bau steht unter Denkmalschutz und fungiert als Café."},{"page_url":"https://it.wikipedia.org/wiki/Old_Law","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Guile_Point_-_geograph.org.uk_-_226932.jpg","page_title":"Old Law","context_page_description":"East Old Law e West Old Law sono una coppia di dromi, distanti tra loro 122 metri, situati sulla punta detta \\"Guile Point\\", all'ingresso del porto di Lindisfarne, una piccola isola tidale sulla costa del Northumberland. Consistono in due obelischi in pietra alti rispettivamente 21 metri e 25 metri aventi la funzione di segnalamenti marittimi ottici, il cui allineamento indica la direzione che le imbarcazioni devono mantenere per l'avvicinamento al porto. Su quello ad est, East Old Law, è stato installato un segnale luminoso, rendendolo così un fanale noto come Guile Point East Lighthouse."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%B4%AB%E9%9C%B2%E8%8D%89%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Spiderwort_Blue_Flower_2.JPG","page_title":"紫露草屬","context_page_description":"紫露草屬（粵拼：zi² lou⁶ cou² suk⁶；學名：Tradescantia）係鴨跖草科下面嘅一個分支，大約有71個物種，原產地係加拿大南部同埋阿根廷北部。"},{"page_url":"https://tr.wikipedia.org/wiki/Bastia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/VP-Bastia.jpg","page_title":"Bastia","context_page_description":"Bastia Fransa'nın Akdeniz'deki adası olan Corsica adasında yer alan önemli bir liman şehri."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B7%B4%E5%8B%92%E6%96%AF%E5%9D%A6%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Bethlehengirlsintraditionaldresspre1918.jpg","page_title":"巴勒斯坦人","context_page_description":"巴勒斯坦人或称为巴勒斯坦阿拉伯人，泛指长期以来定居在巴勒斯坦地区的民族，人口约1,200万，当中约49%居住在巴勒斯坦地区，其中包含加沙地带的所有人口、约旦河西岸大部分的人口以及以色列16.5%的人口，其中一些人是被驱逐出境的难民，其余逾半数的巴勒斯坦人成为侨民，而一半以上的侨民为无国籍人士。海外侨民约有190万居住在邻国约旦。海外侨民大多是在大离散之后迁移出巴勒斯坦的，约有324万居住在邻国约旦，占了将近约旦总人口数的一半。另外，约有150万人居住在叙利亚及黎巴嫩，约25万人居住在沙特阿拉伯。此外，智利拥有约50万人的巴勒斯坦社群，是巴勒斯坦人在阿拉伯世界外最大的侨居地。\\n大部分的巴勒斯坦人为逊尼派穆斯林，也有少数基督徒居住在巴勒斯坦的周边地区。巴勒斯坦人主要使用巴勒斯坦阿拉伯语，以色列的巴勒斯坦人主要是希伯来文和巴勒斯坦阿拉伯语共用。\\n基因证据显示，巴勒斯坦人与以色列人和南黎凡特人，有相当密切的关系。一项有关高分辨率单倍型的研究指出，以色列犹太人与巴勒斯坦人的Y染色体有许多部分是来自同一个基因池。随着7世纪阿拉伯世界的扩张，大部分巴勒斯坦人逐渐涵化为逊尼派穆斯林，而也有为数不少的巴勒斯坦人信仰基督教。然而，由于大多数巴勒斯坦人在语言上和文化上也接受了阿拉伯文化的洗礼，因此虽然巴勒斯坦犹太人在以色列建国之前即居住于巴勒斯坦地区，惟他们鲜少自认为是巴勒斯坦人。因此，在下文中所叙说的巴勒斯坦人是指“世代居住在巴勒斯坦地区的穆斯林”。而如果是血缘相关，而且世代居住在巴勒斯坦地区但非穆斯林者，本文则会另外注明，例如巴勒斯坦犹太人。\\n巴勒斯坦人大多使用巴勒斯坦阿拉伯语，而许多居住在以色列的巴勒斯坦人更通晓希伯来语。\\n第一次广泛使用“巴勒斯坦人”这个名词是在第一次世界大战后的民族自决思潮中诞生。法律历史学家阿萨夫·李克霍夫斯基认为“巴勒斯坦人”这个概念是从20世纪初年开始萌芽的。民族主义者希望在巴勒斯坦建立一个伊斯兰国家。巴勒斯坦人在1921年9月21日的叙利亚─巴勒斯坦国会讨论希望可以在黎凡特地区建国。以色列建国后，巴勒斯坦人1948年和1967年的大逃亡让“巴勒斯坦”成为“祖国”的代名词。根据拉希德·卡里迪的说法，现今的巴勒斯坦人明白他们的文化，是一种自圣经时期，延续到奥斯曼土耳其帝国时期的珍贵资产。\\n1964年，巴勒斯坦解放组织成立，成为保护巴勒斯坦人民的重要组织。而巴勒斯坦民族权力机构则是应奥斯陆协议的内容而成立，是一个名义上统治西岸和加沙地带的巴勒斯坦人的过渡机构。1978年起的每一年，联合国开始庆祝“国际声援巴勒斯坦人民日”。"},{"page_url":"https://en.wikipedia.org/wiki/Lafarre,_Ard%C3%A8che","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Lafarre_ard%C3%A8che_1.jpg","page_title":"Lafarre, Ardèche","context_page_description":"Lafarre is a commune in the Ardèche department in southern France."},{"page_url":"https://es.wikipedia.org/wiki/Bicicleta","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/BicycleSpokeTool.JPG","page_title":"Bicicleta","context_page_description":"La bicicleta, coloquialmente llamada bici​, es un vehículo de transporte personal de propulsión humana. Es impulsada por el propio viajero, que acciona el vehículo con el esfuerzo muscular de las piernas, en particular mediante pedales o manivelas.​ Sus componentes básicos son dos ruedas, ​ generalmente de igual diámetro y dispuestas en línea, un sistema de transmisión de pedales, un cuadro que le da la estructura e integra los componentes, un manillar para controlar la dirección y un sillín para sentarse. El desplazamiento se obtiene al girar con las piernas los pedales dispuestos de forma simétrica, cada uno con una palanca conocida como manivela están ensamblados en el cuadro, y en general el pedal derecho es el que tiene la estrella mayor o plato donde se monta la cadena que a su vez hace girar el piñón, el cual finalmente hace girar la rueda trasera sobre el suelo provocando entonces el desplazamiento. El diseño y la configuración básicos de la bicicleta han cambiado poco desde el primer modelo de transmisión de cadena desarrollado alrededor del año 1885.​\\nLa paternidad de la bicicleta se le atribuye al barón Karl Drais, inventor alemán nacido en 1785."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_c%E1%BA%A7u_th%E1%BB%A7_b%C3%B3ng_%C4%91%C3%A1_Vi%E1%BB%87t_Nam_thi_%C4%91%E1%BA%A5u_%E1%BB%9F_n%C6%B0%E1%BB%9Bc_ngo%C3%A0i","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/%C4%90%E1%BA%B7ng_V%C4%83n_L%C3%A2m_20191201.jpg","page_title":"Danh sách cầu thủ bóng đá Việt Nam thi đấu ở nước ngoài","context_page_description":"Cầu thủ Việt Nam thi đấu ở nước ngoài bao gồm những cầu thủ được sinh ra ở Việt Nam và sau đó ra nước ngoài thi đấu hoặc những cầu thủ có gốc là người Việt Nam nhưng sinh ra và lớn lên ở nước ngoài."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_de_Podol","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Night_battle_by_Podoli_1866.jpg","page_title":"Bataille de Podol","context_page_description":"Podol en Bohême fut, les 26-27 juin 1866, le théâtre d'une bataille de la Guerre austro-prussienne. Les Prussiens parvinrent à regrouper leurs forces tout en forçant le passage de l’Iser."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_de_la_FEUC_en_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Logo_de_la_Nueva_Acci%C3%B3n_Universitaria.jpg","page_title":"Elecciones de la FEUC en 2016","context_page_description":"Las elecciones de la Federación de Estudiantes de la Universidad Católica para el periodo 2017 tuvieron lugar los días 25 y 26 de octubre de 2016 y el balotaje se realizó los días 8 y 9 de noviembre del mismo año. En ellas se disputó la Directiva de la Federación, el Consejero Superior, 32 Consejeros Territoriales y los presupuestos participativos para el periodo 2017.\\nLa segunda vuelta dio como vencedora de la disputa federativa a la lista de la Nueva Acción Universitaria con un 51.08%. Por otra parte, la consejería superior fue ganada por Juan Echaurren, en representación del movimiento Solidaridad, con 55.12% de los votos.​"},{"page_url":"https://fr.wikipedia.org/wiki/Tr%E1%BA%A7n_Tr%E1%BB%8Dng_V%C5%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%22Viva_la_Politica%22_une_installation_de_Tran_Trong_Vu.jpg","page_title":"Trần Trọng Vũ","context_page_description":"Trần Trọng Vũ est un artiste-peintre vietnamien né en 1964 à Hanoï. Il vit et travaille en France depuis 1990. Il est fils du poète Trần Dần.\\nSon travail, au-delà de l’esthétisme, témoigne de l’obsession d’un passé qui se prolonge, de la dérision politique et humaine. Il peint sur les grandes feuilles de plastique transparent puis les installe dans l’espace pour créer des œuvres en trois dimensions. Ses réalisations suscitent une participation du public, une complicité ou au moins une acceptation d’entrer dans l’œuvre. Les visiteurs y cherchent leur chemin dans le transparent, entre les images, les figures, les couleurs, et se comportent comme s’ils étaient sur une scène. Son travail se joue sur des effets visuels et psychologiques provoqués par son labyrinthe virtuel de l’image…\\nIl reçoit « Le Prix Pollock-Krasner », pour la saison 2011-2012, avec une dotation de 20 000 US$, attribué par la Fondation Jackson Pollock - Lee Krasner à New York."},{"page_url":"https://fi.wikipedia.org/wiki/D%C3%ADkaios_(kunnallisyksikk%C3%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Lagoudi_Church_1.jpg","page_title":"Díkaios (kunnallisyksikkö)","context_page_description":"Díkaios on yksi Kosin kunnan kunnallisyksiköistä ja entinen itsenäinen Kreikan kunta. Se sijaitsee Kosin saarella, Kosin alueyksikössä Etelä-Egean saarten alueella. Kunnallisyksikön väkiluku on 7 130.\\nDíkaios käsittää Kosin saaren keskiosan. Kunnallisyksikkö on saanut nimensä sen alueella sijaitsevasta Díkaios-vuoresta, joka on saaren korkein vuori. Díkaios oli itsenäinen kunta vuoden 2010 loppuun saakka. Vuoden 2011 alussa se yhdistettiin Kallikrates-suunnitelmana tunnetun aluehallintouudistuksen myötä Kosin kunnaksi yhdessä Irakleídeen ja Kosin kaupungin kanssa, jolloin se muuttui yhdeksi Kosin kunnan kunnallisyksiköistä."},{"page_url":"https://pt.wikipedia.org/wiki/Westerland_(Alemanha)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Sylt_Postkarte_005.jpg","page_title":"Westerland (Alemanha)","context_page_description":"Westerland é uma cidade da Alemanha, localizado no distrito de Nordfriesland, Schleswig-Holstein."},{"page_url":"https://de.wikipedia.org/wiki/Louis_Maimbourg","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Louis_Maimbourg.jpg","page_title":"Louis Maimbourg","context_page_description":"Louis Maimbourg war ein lothringischer Kleriker, der 1626 bis 1681 dem Jesuitenorden angehörte, und Historiker."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Schutzgebiete_der_Trustees_of_Reservations","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Slocum%27s_River_Reserve%2C_Dartmouth_MA.jpg","page_title":"Liste der Schutzgebiete der Trustees of Reservations","context_page_description":"Die Liste der Schutzgebiete der Trustees of Reservations beinhaltet alle Naturschutzgebiete sowie Natur- und Kulturdenkmale, die im Bundesstaat Massachusetts der Vereinigten Staaten von der Organisation The Trustees of Reservations verwaltet werden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Burgen,_Schl%C3%B6sser,_Ansitze_und_wehrhaften_St%C3%A4tten_im_Bezirk_V%C3%B6lkermarkt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Turm_Pudlach_01.jpg","page_title":"Liste der Burgen, Schlösser, Ansitze und wehrhaften Stätten im Bezirk Völkermarkt","context_page_description":"Diese Liste nennt die Burgen, Schlösser, Ansitze und wehrhaften Stätten im Bezirk Völkermarkt in Kärnten."},{"page_url":"https://en.wikipedia.org/wiki/Lila_Downs","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Lila_Downs_at_Ferrocarril_Museum.JPG","page_title":"Lila Downs","context_page_description":"Ana Lila Downs Sánchez is a Mexican singer-songwriter and actress. She performs her own compositions and the works of others in multiple genres, as well as tapping into Mexican traditional and popular music. She also incorporates indigenous Mexican influences and has recorded songs in many indigenous languages such as Mixtec, Zapotec, Mayan, Nahuatl and Purépecha. Born and raised in Oaxaca, she primarily studied at the Institute of Arts by Oaxaca and briefly attended University of Minnesota, before withdrawing to focus on her musical career. She soon began performing in the traditional music scene of Oaxaca City.\\nHer first album, Ofrenda, was released in 1994. In 1999, Downs came to prominence with her debut studio album, La Sandunga, which was a critical and commercial success. She achieved international success in 2001 with the album Border which emerged in the music scene of Mexico and Latin America in the early 2000s. Downs's seventh album, Pecados y milagros, topped album charts in most major markets and generated chart-topping world music albums. Her eighth album, \\"Balas y Chocolate\\", was released in 2015. \\"Salón Lágrimas y Deseo\\", her ninth album, came out in 2017."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%9B%B7%E5%85%8B%E7%BA%B3%C2%B7%E8%AF%BA%E6%92%92%E5%8B%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Celeste_I.JPG","page_title":"雷克纳·诺撒勒","context_page_description":"何塞·雷克納·諾撒勒，生於西班牙薩拉戈薩，是一個自學成才的藝術家，畫家，誰使用不同的技術。他的作品散落在西班牙，歐洲和美國。他多次出展覽，為公眾和評論家。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B1%89%E5%A8%9C%C2%B7%E8%B4%BE%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Hanna_Jaffa.jpg","page_title":"汉娜·贾夫","context_page_description":"汉娜·贾兹明·贾夫·博斯代特是电视名人、政治家、慈善家、演讲者、作家、活动家。"},{"page_url":"https://de.wikipedia.org/wiki/Dirk_Wiese","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/2020-02-13_Dirk_Wiese_%28KPFC%29_01.jpg","page_title":"Dirk Wiese","context_page_description":"Dirk Wiese ist ein deutscher Politiker der SPD. Seit 2013 ist Wiese Mitglied des Deutschen Bundestages, von 2017 bis zur Ernennung des vierten Kabinetts Merkel 2018 war er Parlamentarischer Staatssekretär bei der Bundesministerin für Wirtschaft und Energie. Vom 11. April 2018 bis zum 26. August 2020 war er Koordinator für die zwischengesellschaftliche Zusammenarbeit mit Russland, Zentralasien und den Ländern der Östlichen Partnerschaft der Bundesregierung. Wiese wurde im Mai 2020 zum stellvertretenden Vorsitzenden der SPD-Bundestagsfraktion gewählt."},{"page_url":"https://it.wikipedia.org/wiki/Castello_di_Skenfrith","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Ruined_curtain_wall_of_Skenfrith_Castle_-_geograph.org.uk_-_714667.jpg","page_title":"Castello di Skenfrith","context_page_description":"Il castello di Skenfrith è un castello fortificato in rovina della cittadina gallese di Skenfrith, nel Monmouthshire, risalente alla prima metà del XIII secolo e costruito per volere di Hubert de Burgh sulle rovine di una preesistente fortezza normanna del XII secolo. Insieme al castello di Grosmont e al White Castle di Llantilio Crossenny, è uno dei cosiddetti \\"Tre castelli\\" realizzati in zona."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B8%E0%B3%8B%E0%B2%AE%E0%B2%A8%E0%B2%BE%E0%B2%A5%E0%B2%AA%E0%B3%81%E0%B2%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/The_Chennakeshava_temple_at_Somanathapura.jpg","page_title":"ಸೋಮನಾಥಪುರ","context_page_description":"ಸೋಮನಾಥಪುರ ಮೈಸೂರು ನಗರದಿಂದ ೩೦ ಕಿ.ಮಿ ದೂರದಲ್ಲಿರುವ ಒಂದು ಪಟ್ಟಣ. ಇದು ಹೊಯ್ಸಳರು ಕಟ್ಟಿಸಿದ ಚೆನ್ನಕೇಶವ ದೇವಾಲಯಕ್ಕೆ ಹೆಸರುವಾಸಿ. ಈ ದೇವಾಲಯವನ್ನು ೧೨೬೮ರಲ್ಲಿ ಹೊಯ್ಸಳ ಸಾಮ್ರಾಜ್ಯದಲ್ಲಿ ದಂಡನಾಯಕನಾಗಿದ್ದ ಸೋಮ ಎಂಬಾತನು ಕಟ್ಟಿಸಿದನು. ಇದು ಇಂದು ಕರ್ನಾಟಕದ ಪ್ರೇಕ್ಷಣೀಯ ಸ್ಥಳವಾಗಿ ಬೆಳೆದಿದೆ.\\nಕೈ ಮುಗಿದು ಒಳಗೆ ಬಾ ಯಾತ್ರಿಕನೆ ಶಿಲೆಯಲ್ಲವೀ ಗುಡಿಯು ಕಲೆಯ ಬಲೆಯು....ರಾಷ್ಟ್ರಕವಿ ಕುವೆಂಪು ತಮ್ಮ ಭಾವಪೂರ್ಣ ಕವನದ ಒಂದೇ ಒಂದು ಸಾಲಿನಲ್ಲಿ ಕರ್ನಾಟಕದ ಶಿಲ್ಪಕಲೆಗೆ ಸೂಕ್ತ ಗೌರವ ಮನ್ನಣೆ ನೀಡಿದ್ದಾರೆ. ಕರ್ನಾಟಕ ಕಲೆಗಳ ತವರು, ಶಿಲ್ಪಕಲೆಗಳ ಬೀಡು, ಬೇಲೂರು, ಹಳೆಬೀಡು, ಸೋಮನಾಥಪುರಗಳನ್ನು ನೋಡಿದಾಗ ಕುವೆಂಪು ಹೇಳಿದಂತೆ ಪ್ರತಿಯೊಬ್ಬ ಪ್ರವಾಸಿಗನೂ ಶಿಲ್ಪಿಯ ಕಲಾತ್ಮಕತೆಗೆ ತಲೆ ಬಾಗಿಯೇ ಬಾಗುತ್ತಾನೆ.ಇಂಥ ಒಂದು ಕಲಾಶ್ರೀಮಂತಿಕೆಯ ತಾಣ ಮೈಸೂರಿಗೆ 38 ಕಿ.ಮೀ. ದೂರದಲ್ಲಿರುವ ಸೋಮನಾಥಪುರ. ಪ್ರಶಾಂತ ಪರಿಸರದಲ್ಲಿರುವ ಈ ಶಿಲ್ಪಕಲಾವೈಭವದ ದೇಗುಲವನ್ನು ಪ್ರವೇಶಿಸಿದರೆ ಆಗುವ ಸಂತೋಷ ಅಪರಿಮಿತ. ಹುಲ್ಲುಹಾಸಿನ ನಡುವೆ ಸಾಗಿ ನಾಲ್ಕು ಮೆಟ್ಟಿಲೇರುತ್ತಿದ್ದಂತೆಯೇ ಹೊಸದೊಂದು ಶಿಲ್ಪಕಲಾಲೋಕವೇ ತೆರೆದುಕೊಳ್ಳುತ್ತದೆ. ಜೀವಕಳೆಯಿಂದ ಕಂಗೊಳಿಸುತ್ತಿರುವ ಶಿಲ್ಪವೈಭವವನ್ನು ಕಂಡಾಗ ರೋಮಾಂಚನವಾಗುತ್ತದೆ. ಶಿಲ್ಪಿಯ ಜಾಣ್ಮೆ, ಚಾಕಚಕ್ಯತೆ ಕೌಶಲಕ್ಕೆ ಶಿರಬಾಗುತ್ತದೆ.\\nಐತಿಹ್ಯ: 13ನೆಯ ಶತಮಾನದಲ್ಲಿ ಸೋಮನಾಥಪುರ ಒಂದು ಪುಟ್ಟ ಅಗ್ರಹಾರವಾಗಿತ್ತು. ಚತುರ್ವೇದಿಮಂಗಲ ವಿದ್ಯಾನಿಧಿಪ್ರಸನ್ನ ಸೋಮನಾಥಪುರ ಎಂಬುದು ಇದರ ಪೂರ್ವ ಹೆಸರು. ಇಲ್ಲಿರುವ 7 ಶಾಸನಗಳು ಈ ಅಪೂರ್ವ ದೇವಾಲಯದ ಬಗ್ಗೆ ಹಾಗೂ ಕಲೆಗೆ ಹಾಗೂ ವಿದ್ಯೆಗೆ ಆಗರವಾಗಿದ್ದ ಈ ಊರಿನ ಬಗ್ಗೆ ಮಹತ್ವದ ಮಾಹಿತಿ ಒದಗಿಸುತ್ತವೆ."},{"page_url":"https://sv.wikipedia.org/wiki/Pojkarnas_Super-G_i_alpin_skid%C3%A5kning_vid_olympiska_vinterspelen_f%C3%B6r_ungdomar_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/2020-01-10_Men%27s_Super_G_%282020_Winter_Youth_Olympics%29_by_Sandro_Halank%E2%80%930274.jpg","page_title":"Pojkarnas Super-G i alpin skidåkning vid olympiska vinterspelen för ungdomar 2020","context_page_description":"Pojkarnas Super-G i alpin skidåkning vid olympiska vinterspelen för ungdomar 2020 hölls på Les Diablerets Alpine Centre, Schweiz, den 10 januari 2020."},{"page_url":"https://cs.wikipedia.org/wiki/Gibon_%C4%8Dern%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Black_Crested_Gibbon_area.png","page_title":"Gibon černý","context_page_description":"Gibon černý je druh gibonů, který se vyskytuje v Číně, Laosu a na severu Vietnamu. Dělí se na čtyři poddruhy. Jde o kriticky ohrožený druh.\\nDospělí jedinci jsou velcí 43–54 cm a váží od 6,9 do 10 kg. Samci jsou téměř celí černí, samice mají hnědožlutou či slámovou barvu."},{"page_url":"https://de.wikipedia.org/wiki/Monodora_myristica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Monodora_myristica_seeds.png","page_title":"Monodora myristica","context_page_description":"Monodora myristica ist eine Pflanzenart innerhalb der Familie der Annonengewächse. Die Samen dieses tropischen Baumes werden weithin als Gewürz, früher vor allem als kostengünstiger Muskatersatz, verkauft. Trivialnamen sind Afrikanische oder auch Falsche Muskatnuss, Jamaika-Muskatnuss und Kalabassenmuskat."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E6%B4%B2%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Japanese_Crest_janome.svg","page_title":"大洲城","context_page_description":"大洲城は、四国の伊予国喜多郡大洲にあった日本の城である。別名としては地蔵ヶ嶽城、比志城、大津城などがある。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Helloween_members","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Helloween_2016-8.jpg","page_title":"List of Helloween members","context_page_description":"Helloween are a German power metal band from Hamburg. Formed in 1984, the group was originally a quartet featuring Kai Hansen on lead vocals and rhythm guitar, Michael Weikath on lead guitar and backing vocals, Markus Grosskopf on bass and backing vocals, and Ingo Schwichtenberg on drums. The band's current lineup includes constant members Weikath and Grosskopf, alongside Hansen, co-lead vocalists Michael Kiske and Andreas \\"Andi\\" Deris, rhythm guitarist and backing vocalist Sascha Gerstner, and drummer Daniel \\"Dani\\" Löble."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%BA%D1%81%D0%B8%D1%8F_%D0%91%D1%80%D0%BE%D1%83%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Banksia_brownii_shrubby.jpg","page_title":"Банксия Броуна","context_page_description":"Банксия Броуна — вид банксии семейства протейных.\\nВид представляет собой кустарник или дерево высотой около 2 метров, с длинными зелёными листьями, формой напоминающих птичье перо, и крупными красными соцветиями. Однако, ветви могут достигать длины до шести метров.\\nОбитает в диком виде лишь на двух небольших участках Западной Австралии в районе города Олбани и хребта Стерлинг, однако, в Австралии банксия Броуна популярна среди садоводов как декоративное растение.\\nРастение было классифицировано У.Бакстером и названо в честь шотландского ботаника Роберта Броуна."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B7%91%E3%83%B6%E4%B8%98%E5%85%AC%E5%9C%92_(%E5%B8%AF%E5%BA%83%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/ja/7/75/Obihiro_ZOO.jpg","page_title":"緑ヶ丘公園 (帯広市)","context_page_description":"緑ヶ丘公園は、北海道帯広市にある公園。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B5%D1%81,_%D0%99%D0%BE%D0%B7%D0%B5%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/History_of_N%C3%A1chod_09_-_Hosrk%C3%A9_periphery_of_N%C3%A1chod.jpg","page_title":"Манес, Йозеф","context_page_description":"Йо́зеф Ма́нес — чешский художник, представитель романтического течения в живописи."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%B8%D1%86_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_(%D0%BA%D0%BD%D1%8F%D0%B7%D1%8C_%D0%9D%D0%B0%D1%81%D1%81%D0%B0%D1%83-%D0%A5%D0%B0%D0%B4%D0%B0%D0%BC%D0%B0%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Moritz_Heinrich_von_Nassau-Hadamar.jpg","page_title":"Мориц Генрих (князь Нассау-Хадамара)","context_page_description":"Мориц Генрих Нассау-Хадамарский — второй князь Нассау-Хадамара из Нассауской династии."},{"page_url":"https://es.wikipedia.org/wiki/Entrecruzamiento_cromos%C3%B3mico","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Morgan_crossover_2.jpg","page_title":"Entrecruzamiento cromosómico","context_page_description":"El sobrecruzamiento, crossing-over o entrecruzamiento cromosómico es el proceso por el cual las cromátidas de cromosomas homólogos se aparean e intercambian secciones de su ADN durante la profase I de la meiosis. La sinapsis comienza antes de que se estimule un desarrollo complejo sinaptonémico, y no está completo hasta cerca del final de la profase 1. El entrecruzamiento usualmente se produce cuando se aparean las regiones en las rupturas del cromosoma y luego se reconectan al otro cromosoma. El resultado de este proceso es un intercambio de genes, llamado recombinación genética. Los entrecruzamientos cromosómicos también suceden en organismos asexuales y en células somáticas, ya que son importantes formas de reparación del ADN.​\\nEl entrecruzamiento fue descrito, en forma teórica, por Thomas Hunt Morgan. Se apoyó en el descubrimiento del profesor belga Frans Alfons Janssens de la Universidad de Lovaina que describió el fenómeno en 1909. El término quiasma está relacionado, si no es idéntico, al entrecruzamiento cromosómico."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Dufy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Portrait_de_Jean_Dufy_en1935.jpg","page_title":"Jean Dufy","context_page_description":"Jean Dufy, né le 12 mars 1888 au Havre et mort le 12 mai 1964 à Boussay, est un peintre français."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Coppet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Ch%C3%A2teau_de_Coppet%2C_papier_peint_d%C3%A9corant_la_chambre_de_Mme_R%C3%A9camier.jpg","page_title":"Château de Coppet","context_page_description":"Le château de Coppet est un château vaudois situé sur le territoire de la commune de Coppet, en Suisse."},{"page_url":"https://ceb.wikipedia.org/wiki/Protvino","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Coat_of_Arms_of_Protvino_%28Moscow_oblast%29.png","page_title":"Protvino","context_page_description":"Lungsod ang Protvino sa Rusya. Nahimutang ni sa lalawigan sa Moscow Oblast, sa kasadpang bahin sa nasod, 100 km sa habagatan sa Moscow ang ulohan sa nasod. 134 metros ibabaw sa dagat kahaboga ang nahimutangan sa Protvino, ug adunay 37,329 ka molupyo.\\nAng yuta palibot sa Protvino kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 234 ka metro ug 6.6 km sa kasadpan sa Protvino. Dunay mga 2,811 ka tawo kada kilometro kwadrado sa palibot sa Protvino may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Serpukhov, 13.5 km sa sidlakan sa Protvino. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Protvino.\\nAng klima hemiboreal. Ang kasarangang giiniton 3 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Pebrero, sa -14 °C."},{"page_url":"https://nl.wikipedia.org/wiki/Visarend","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Wiki-Pandion_haliaetus.png","page_title":"Visarend","context_page_description":"De visarend is een roofvogel uit de familie van de visarenden. De wetenschappelijke naam van de soort werd als Falco haliaetus in 1758 gepubliceerd door Carl Linnaeus. De soort werd in 1809 door Marie Jules César Savigny in het geslacht Pandion geplaatst. Daarin was het lang de enige soort, en daarmee ook de enige soort die in de familie werd geplaatst. Inmiddels is echter de voorheen als ondersoort opgevatte Australische visarend P. h. cristatus opgewaardeerd tot een aparte soort, waarmee de visarend in het geslacht en in de familie dus gezelschap heeft gekregen."},{"page_url":"https://sv.wikipedia.org/wiki/Acraea_pharsalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Ward%27s_glorious_acraea_%28Acraea_pharsalus%29.jpg","page_title":"Acraea pharsalus","context_page_description":"Acraea pharsalus är en fjärilsart som beskrevs av Ward 1871. Acraea pharsalus ingår i släktet Acraea och familjen praktfjärilar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://eo.wikipedia.org/wiki/Antoine_Griezmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Antoine_Griezmann_-_CdR_-_RM_v_ATL_%28edited%29_-_1.jpg","page_title":"Antoine Griezmann","context_page_description":"Antoine GRIEZMANN estas franca profesia futbalisto.\\nLia patro estas alzacano, tial la germana familia nomo. Ekde la jaro 2014 li estas membro de la vira franca nacia teamo de futbalo, post kiam antaŭe li jam membris en la naciaj teamoj de sub-19-, sub-20- kaj sub-21-jaruloj. Li partoprenis kadre de la nacia teamo en la matĉoj de la futbala mondpokalo de 2014, de la Eŭropa Futbal-Ĉampionado 2016 en Francio kaj de la Futbala Mondpokalo 2018 en Rusio."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AD%AB%E7%B9%BC%E7%9A%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/%E5%AD%99%E7%BB%A7%E7%9A%8B%E5%A2%93_-_panoramio_%281%29.jpg","page_title":"孫繼皐","context_page_description":"孙继皋，字以德，号柏潭，直隶无锡人，明朝政治人物、状元。"},{"page_url":"https://de.wikipedia.org/wiki/Schneller_zu_Lottstetten","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Wp_schneller1747.gif","page_title":"Schneller zu Lottstetten","context_page_description":"Die Schneller stamm aus Lottstetten im heutigen Klettgau, Baden-Württemberg. Bis 1806 gehörte die Landgrafschaft Klettgau zur Herrschaft Schwarzenberg und fiel in der Folge der Mediatisierung an das Großherzogtum Baden. Die Familie war über Generationen als Ministerialen und Vögte der Grafen von Sulz und der Propstei Öhningen tätig. Neben Eigenbesitz hatten die Schneller in Lottstetten durch das Spital und Spendamt der Stadt Schaffhausen, die Propstei Öhningen und das Kloster Rheinau stets Erblehen inne."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%B8%D0%BF_%D0%A2%D0%BE%D2%B3%D0%B8%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Dalip_Tahil.JPG","page_title":"Долип Тоҳил","context_page_description":"Долип Тоҳил — ҳунарпешаи синамо, сериёл ва театри ҳинд. Ӯ дар Коллеҷи Шервуди Уттаранчал таҳсил намудааст."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Bad_Cannstatt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Zanth%2C_Karl_Ludwig_von%2C_Wilhelma%2C_Kassenpavillon_frontal.jpg","page_title":"Liste der Kulturdenkmale in Bad Cannstatt","context_page_description":"In der Liste der Kulturdenkmale in Bad Cannstatt sind alle unbeweglichen Bau- und Kunstdenkmale in Bad Cannstatt aufgelistet, die in der Liste der Kulturdenkmale. Unbewegliche Bau- und Kunstdenkmale der Unteren Denkmalschutzbehörde für diesen Stadtbezirk Stuttgarts verzeichnet sind. Stand dieser Liste ist der 25. April 2008.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Stuttgart erhältlich."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%B4%D0%BE%D1%88,_%D0%9B%D0%B0%D0%B9%D0%BE%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/B%C3%A1rdos_Lajos_%281948%29.jpg","page_title":"Бардош, Лайош","context_page_description":"Ла́йош Ба́рдош — венгерский композитор, хоровой дирижёр, музыковед и педагог."},{"page_url":"https://ba.wikipedia.org/wiki/%D3%98%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B6%D0%B0%D0%BD_%D0%B4%D3%99%D2%AF%D0%BB%D3%99%D1%82_%D0%B0%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0_%D2%BB%D3%99%D0%BC_%D0%B1%D0%B0%D0%BB%D0%B5%D1%82_%D1%82%D0%B5%D0%B0%D1%82%D1%80%D1%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Stamps_of_Azerbaijan%2C_2012-1024.jpg","page_title":"Әзербайжан дәүләт академия опера һәм балет театры","context_page_description":"Әзербайжан дәүләт академия опера һәм балет театры — 1920 йылдан Әзербайжандың баш ҡалаһы Баҡыла эшләп килгән опера һәм балет театры, 1959 йылдан — «академия театры» маҡтаулы исемен йөрөтә."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AC%D9%84%D8%A9_%D9%83%D9%8A%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Q_%28magazine%29_logo.png","page_title":"مجلة كيو","context_page_description":"كيو هي مجلة موسيقية شائعة في المملكة المتحدة تصدر شهريا.\\nأسسها مارك إليم وديفيد هيبورث بعد استيائهم من الصحافة الموسيقية في ذلك الوقت، بعد أن شعروا بتجاهل جيل كامل من الذين يشترون الأقراض المدمجة CD حيث أنها كانت لا تزال تكنولوجيا جديدة.\\nأول نشر لمجلة كيو من قبل مجموعة East Midland Allied Press في أكتوبر 1986."},{"page_url":"https://war.wikipedia.org/wiki/Cymbidium_finlaysonianum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Cymbidium_finlaysonianum_-_Flickr_003.jpg","page_title":"Cymbidium finlaysonianum","context_page_description":"An Cymbidium finlaysonianum in uska species han Liliopsida nga ginhulagway ni John Lindley. An Cymbidium finlaysonianum in nahilalakip ha genus nga Cymbidium, ngan familia nga Orchidaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/Max_Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Max_Martin.jpg","page_title":"Max Martin","context_page_description":"Karl Martin Sandberg, known professionally as Max Martin, is a Swedish singer, songwriter, and record producer. He rose to prominence in the late 1990s after making a string of hit singles such as Britney Spears' \\"...Baby One More Time\\", the Backstreet Boys' \\"I Want It That Way\\", and NSYNC's \\"It's Gonna Be Me\\".\\nMartin has written or co-written 23 Billboard Hot 100 number-one songs, most of which he has also produced or co-produced, including Katy Perry's \\"I Kissed a Girl\\", Maroon 5's \\"One More Night\\", Taylor Swift's \\"Shake It Off\\" and \\"Blank Space\\", and The Weeknd's \\"Blinding Lights\\". Martin is the songwriter with the third-most number-one singles on the chart, behind only Paul McCartney and John Lennon. In addition, he is tied for the most Hot 100 number-one singles as a producer, 23, along with George Martin, who had achieved 23 by the time of his death.\\nIn early 2013, his single sales were tallied by The Hollywood Reporter to be at over 135 million. According to Variety, his net worth was approximately $260 million in 2017. The previous year he achieved approximately an income of $54 million and a profit of $19 million for his services."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%A7%91%E6%9E%97%E5%BE%B7%E7%9B%AE%E9%8C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/NGC_1444_DSS.jpg","page_title":"科林德目錄","context_page_description":"科林德目录是瑞典天文学家佩尔·科林德收录471个疏散星团的目录。这本目录于1931年出版，是科林德论文《疏散星团的结构特性及其在空间的分布》中的附录。目录中的物件用\\"Collinder\\"标示，例如\\"Collinder 399\\"。数值序号的前置码包括Col + 目录序号，或Cr +目录序号，例如\\"Cr 399\\"。"},{"page_url":"https://no.wikipedia.org/wiki/Iso_Grifo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Iso_Grifo_Front.JPG","page_title":"Iso Grifo","context_page_description":"Iso Grifo er en bilmodell fra den italienske bilprodusenten Iso Rivolta, som ble produsert mellom 1963 og 1975.\\nModellen var utstyrt med amerikanske V8-motorer med støtstenger, og designet av Bertone har blitt ansett som meget vellykket, spesielt for den lett modifiserte Series II. Modellen rakk bare å bli produsert i 412 eksemplarer før fabrikken fikk økonomiske problemer og gikk konkurs i 1975.\\nIso Grifo er i dag en ettertraktet samlermodell, som i god stand har oppnådd priser på over én million kroner."},{"page_url":"https://sv.wikipedia.org/wiki/Villa_Fridhem,_V%C3%A4sterhejde","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Villa_Fridhem_1890s.jpg","page_title":"Villa Fridhem, Västerhejde","context_page_description":"Villa Fridhem är en villa i Västerhejde socken, nära Högklint på Gotland, omkring sex kilometer söder om Visby. Den byggdes på 1860-talet som sommarresidens för svenska prinsessan Eugénie, dotter till Oscar I. Från början av 1860-talet och framåt bodde hon om somrarna på Villa Fridhem som hon själv lät uppföra efter att ha tillbringat somrarna på ön sedan 1859."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E5%8C%97%E5%B8%82%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/%E4%B8%AD%E5%B1%B1%E5%8D%80%E5%BB%BA%E5%9C%8B%E5%8C%97%E8%B7%AF%E4%B8%80%E6%AE%B511%E5%B7%B712%E8%99%9F.jpg","page_title":"臺北市文化資產","context_page_description":"台北市文化资产是台北市各级古迹与其他文化资产。本表表列原则如下：\\n章节分类依中华民国《文化资产保存法》条文。\\n名称依照中华民国行政院文化部文化资产局所登录的名称。"},{"page_url":"https://de.wikipedia.org/wiki/Galgentor","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Frankfurt_Stadtmauer_1750.jpg","page_title":"Galgentor","context_page_description":"Das Galgentor, in der frühen Neuzeit auch Gallustor, war eines von fünf Stadttoren der spätmittelalterlichen Frankfurter Stadtbefestigung, welche den Zugang zur Frankfurter Neustadt erlaubten, deren Umfriedung Kaiser Ludwig der Bayer der Stadt 1333 gestattete."},{"page_url":"https://no.wikipedia.org/wiki/Fayette_kullkraftverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Fayette_power_project.jpg","page_title":"Fayette kullkraftverk","context_page_description":"Fayette kullkraftverk, også kalt Sam Seymour kullkraftverk, er et varmekraftverk ved La Grange i delstaten Texas i det sørlige USA. Det har en installert produksjonskapasitet på 1690 MW. Brenselkilden er bitumenøst kull, herudner lignitt.\\nUtslippene av CO2 i 2006 var totalt 12,0 millioner tonn."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B8%D0%B4%D0%BE%D1%82%D0%B8%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Museo_de_La_Plata_-_Peridotita_con_crisotilo.jpg","page_title":"Перидотит","context_page_description":"Перидотиты — общее название семейства ультраосновных плутонических горных пород нормально-щелочного ряда, в составе которых преобладают оливин и пироксен."},{"page_url":"https://sv.wikipedia.org/wiki/Vattenblinkar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Hottonia_-_coupe_de_la_tige.jpg","page_title":"Vattenblinkar","context_page_description":"Vattenblinkar är ett släkte av viveväxter. Vattenblinkar ingår i familjen viveväxter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://lv.wikipedia.org/wiki/Eir%C4%81zijas_kurmji","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Close-up_of_mole.jpg","page_title":"Eirāzijas kurmji","context_page_description":"Eirāzijas kurmji, Eirāzijas kurmju ģints ir kurmju dzimtas ģints, kas pieder pie kurmju apakšdzimtas. Tā apvieno 9 mūsdienās dzīvojošas sugas. Šīs ģints sugas sastopamas tikai Eirāzijā, galvenokārt Eiropā un Āzijas rietumos. Latvijā mājo viena Eirāzijas kurmju ģints suga — Eiropas kurmis. Dažām sugām ir ļoti lieli izplatības areāli, piemēram Eiropas kurmim, bet dažas sugas sastopamas nelielos, ierobežotos reģionos. Viena no tādām ir Irānas kurmis, kura izdzīvošana ir kritiski apdraudēta. Ir sugas, kas mīt tikai kalnos, piemēram, Ibērijas kurmis un Kaukāzas kurmis."},{"page_url":"https://fr.wikipedia.org/wiki/Quettreville-sur-Sienne_(commune_d%C3%A9l%C3%A9gu%C3%A9e)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/%C3%89glise_Notre-Dame-et-Sainte-Agathe_de_Quettreville-sur-Sienne_%282%29.jpg","page_title":"Quettreville-sur-Sienne (commune déléguée)","context_page_description":"Quettreville-sur-Sienne est une ancienne commune française, située dans le département de la Manche en région Normandie, peuplée de 1 482 habitants.\\nLe 1ᵉʳ janvier 2016 elle devient une commune déléguée de la commune nouvelle de Quettreville-sur-Sienne après sa fusion avec Hyenville."},{"page_url":"https://nn.wikipedia.org/wiki/Istria","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Porec_riva.jpg","page_title":"Istria","context_page_description":"Istria er den største halvøya i Adriahavet. Halvøya ligg inst i Adriahavet mellom Triestebukta og Kvarnerbukta.\\nDet meste av området ligg i Istria fylke vest i Kroatia, medan eit lite område høyrer til Slovenia og Italia.\\nViktige byar på Istria er Pula, Poreč, Rovinj, Pazin, Labin, Motovun, Buzet og Buje, i tillegg til mindre landsbyar som Višnjan, Roč, and Hum. Ein liten del i nord, inkludert kystlandsbyane Izola, Piran, Portorož og Koper ligg i Slovenia, og eit lite område av landsbyen Muggia høyrer til Italia.\\nFjellkjeda Učka ligg i austlege delar av Istria. Av elvar finn ein Dragonja, Mirna, Pazinčica og Raša, i tillegg til Limbukta."},{"page_url":"https://uz.wikipedia.org/wiki/Uddaburon_bolalar_3-D:_O%CA%BByin_tugadi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/3d-brille_spykids_3.jpg","page_title":"Uddaburon bolalar 3-D: Oʻyin tugadi","context_page_description":"Uddaburon bolalar 3-D: O‘yin tugadi 2003-yil Amerika tomonidan ishlangan josuslik haqidagi sarguzasht komediya film."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%85%A7%E7%89%B9%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Mayen-Nette1-Bubo.JPG","page_title":"內特河","context_page_description":"內特河是德國的河流，屬於萊茵河的左支流，發源自紐堡以南的艾菲爾山，流經邁恩，河口處在魏森圖爾姆和安德爾納之間，河道全長59公里，流域面積372平方公里，"},{"page_url":"https://it.wikipedia.org/wiki/Esafluoroplatinato_di_diossigenile","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Dioxygenyl_hexafluoroplatinate-3D-balls.png","page_title":"Esafluoroplatinato di diossigenile","context_page_description":"L'esafluoroplatinato di diossigenile è il composto inorganico con formula O₂PtF₆. In condizioni normali il composto è un solido paramagnetico di colore rosso, che contiene l'inusuale catione diossigenile O₂⁺, mentre nell'anione PtF₆– il platino è nello stato di ossidazione inusuale +5."},{"page_url":"https://de.wikipedia.org/wiki/Leonhardskirche_(Erfurt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Fundament_Leonhardskirche_Erfurt.JPG","page_title":"Leonhardskirche (Erfurt)","context_page_description":"Die Leonhardskirche war eine Pfarrkirche auf dem Petersberg in Erfurt."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%96%D0%BD%D0%BA%D0%B3%D0%BE_%D0%B4%D0%B2%D0%BE%D0%BB%D0%BE%D0%BF%D0%B0%D1%82%D0%B5%D0%B2%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Ginkgo_biloba_male_flower.jpg","page_title":"Гінкго дволопатеве","context_page_description":"Гінкго, гінкго дволопатеве — реліктова рослина, єдиний сучасний вид роду гінкго, що є єдиним представником родини гінкгові, яка, в свою чергу, є єдиною у класі Ginkgoopsida. Викопних видів у родині відомо близько 18."},{"page_url":"https://pl.wikipedia.org/wiki/Kazlje","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Kazlje1.jpg","page_title":"Kazlje","context_page_description":"Kazlje – wieś w Słowenii, w gminie Sežana. W 2018 roku liczyła 182 mieszkańców."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%A1%E1%80%95%E1%80%AD%E1%80%AF%E1%80%9C%E1%80%AD%E1%80%AF_%E1%81%81%E1%81%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/The_Apollo_10_Prime_Crew_-_GPN-2000-001163.jpg","page_title":"အပိုလို ၁၀","context_page_description":"အပိုလို ၁၀ သည် အမေရိကန်ပြည်ထောင်စု၏ လူလိုက်ပါသော ၄ ခုမြောက် လပေါ်ဆင်းသက်ရေး အာကာသမက်ရှင်တစ်ခု ဖြစ်သည်။ အပိုလို ၈ နောက်ပိုင်း လကမ္ဘာအား လှည့်ပတ်သည့် အပိုလိုစီမံကိန်းတစ်ခုဖြစ်သည်။ ၁၉၆၉ ခုနှစ် မေလ ၁၈ ရက်နေ့တွင် လွှတ်တင်ခဲ့ပြီး လကမ္ဘာပေါ်သို့ခြေချရန် အစမ်းလေ့ကျင့်သည့် F အမျိုးအစားမက်ရှင်တစ်ခုဖြစ်သည်။ ယာဉ်၏ Lunar Module သည် လမျက်နှာပြင်အပေါ်မှ ၁၅.၆ ကီလိုမီတာအကွာတွင် ပျံသန်းခဲ့သည်။ ယင်းသည် ၁၉၆၉ ခုနှစ် ဇူလိုင်လတွင် ဆင်းသက်သော အပိုလို ၁၁ ၏ လမျက်နှာပြင်ဆင်းသက်ရာတွင် အောင်မြင်စေခဲ့သည်။ ၂ဝဝ၂ ခုနှစ် ဂင်းနစ်စံချိန်အရ အပိုလို ၁ဝ သည် ကမ္ဘာ့လူလုပ်ယာဉ်များတွင် အမြင့်ဆုံးအမြန်နှုန်းစံချိန်အား ရရှိခဲ့သည်။"},{"page_url":"https://pl.wikipedia.org/wiki/Biriusinsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Birjusinsk.jpg","page_title":"Biriusinsk","context_page_description":"Biriusinsk – miasto w Rosji, w obwodzie irkuckim. W 2010 roku liczyło 8981 mieszkańców. Leży nad rzeką Biriusą."},{"page_url":"https://es.wikipedia.org/wiki/Tinamus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Tinamus_guttatus.JPG","page_title":"Tinamus","context_page_description":"Los inambúes, yutos, tinamúes o \\"perdices americanas\\" incluyen varias aves de la familia de los tinámidos que habitan principalmente en los pastizales de Sudamérica."},{"page_url":"https://tl.wikipedia.org/wiki/Yurihonj%C5%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Yurihonjo_City_Hall.JPG","page_title":"Yurihonjō","context_page_description":"Ang Yurihonjō ay isang lungsod na matatagpuan sa Prepektura ng Akita, Hapon. Magmula noong 31 Enero 2020, may tinatayang populasyon na 76,077 katao ang lungsod sa 30,639 mga kabahayan, at may densidad na 63 tao sa bawat kilometro kuwadrado. Ang kabuoang lawak ng lungsod ay 1,209.60 square kilometre."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%B0%D0%B7%D0%B8%D1%98_(%D0%95%D1%80_%D0%B8_%D0%9B%D0%BE%D0%B0%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Eglise_de_Croisilles%2C_Eure-et-Loir_%28France%29.jpg","page_title":"Кроазиј (Ер и Лоар)","context_page_description":"Кроазиј насеље је и општина у централној Француској у региону Центар, у департману Ер и Лоар која припада префектури Дре.\\nПо подацима из 2011. године у општини је живело 468 становника, а густина насељености је износила 81,82 становника/km². Општина се простире на површини од 5,72 km². Налази се на средњој надморској висини од 125 метара."},{"page_url":"https://en.wikipedia.org/wiki/European_External_Action_Service","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Insignia_of_the_European_External_Action_Service.svg","page_title":"European External Action Service","context_page_description":"The European External Action Service is the diplomatic service and combined foreign and defence ministry of the European Union. The EEAS is led by the High Representative for Foreign Affairs and Security Policy, who is also President of the Foreign Affairs Council and Vice-President of the European Commission, and carries out the EU's Common Foreign and Security Policy, including the Common Security and Defence Policy.\\nThe EEAS does not propose or implement policy in its own name, but prepares acts to be adopted by the High Representative, the European Commission or the Council. The EEAS is also in charge of EU diplomatic missions and intelligence and crisis management structures.\\nThe EEAS, as well as the office of the HR, was initiated following the entry into force of the Treaty of Lisbon on 1 December 2009. It was formally established on 1 December 2010. The EEAS was formed by merger of the external relations departments of the European Commission and of the Council, which were joined by staff seconded from national diplomatic services of the Member States."},{"page_url":"https://fr.wikipedia.org/wiki/Biblioth%C3%A8que_municipale_de_Chamb%C3%A9ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Fa%C3%A7ade_de_la_m%C3%A9diath%C3%A8que_Jean-Jacques_Rousseau.JPG","page_title":"Bibliothèque municipale de Chambéry","context_page_description":"La bibliothèque municipale de Chambéry est une bibliothèque municipale classée, fondée en 1783 et située en France sur la commune de Chambéry, chef-lieu du département de la Savoie en région Rhône-Alpes.\\nSon action s’organise autour de deux établissements particulièrement vastes au regard de la population à desservir : la médiathèque Jean-Jacques Rousseau située en centre-ville, la bibliothèque Georges Brassens dans le quartier des Hauts-de-Chambéry, et le service hors les murs de la « Bibliothèque Voyageuse ». Elle assure les missions de lecture publique et la conservation du troisième fonds patrimonial de la région Rhône-Alpes composé de manuscrits, d’incunables, de livres anciens, de livres d’artistes, d’estampes, de cartes géographiques et de cartes postales."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B0_%D0%91%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Serbia_Beograd_SANU_-_Feb_2006.jpg","page_title":"Култура Београда","context_page_description":"Београд је домаћин многим културним манифестацијама, укључујући ФЕСТ, БИТЕФ, БЕЛЕФ, БЕМУС, Београдски сајам књига, и Београдски фестивал пива. Добитник Нобелове награде Иво Андрић је написао своја најпознатија дела: „На Дрини ћуприја“ и „Проклета авлија“ у Призренској улици у Београду. Остали истакнути српски књижевници који су живели и радили у Београду су: Бранислав Нушић, Милош Црњански, Борислав Пекић, Милорад Павић, Меша Селимовић и многи други.\\nВећина српске филмске индустрије се налази у Београду, а један од најпознатијих филмова снимљених овде је и филм Емира Кустирице из 1995, добитник Златне палме на Канском фестивалу — Подземље. Град је био један од главних центара југословенског „новог таласа“: ВИС Идоли, Екатарина Велика и Шарло Акробата музички бендови који су сви из Београда. Остали познати београдски рок уметници: Рибља чорба, Бајага и инструктори и остали. Током деведесетих, град је био главни центар музичког жанра турбофолк. Данас је центар српске хип хоп сцене, са извођачима као што су Београдски Синдикат, Шкабо, Марчело и многи други."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%94%D1%80%D0%BE%D0%BC%D0%BE%D0%BB%D0%B5%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Bush_walks_with_Bertie_Ahern_and_Romano_Prodi_in_Ireland.jpg","page_title":"Замок Дромоленд","context_page_description":"Замок Дромоленд — замок Дром Олайнн — один із замків Ірландії, розташований в графстві Клер. Нині це п'ятизірковий готель з полем для гольфу, стоїть біля селища Ньюмаркет-на-Фергюс. Замок має ресторан «Граф Томонд», що у 1995 році був відзначений нагородою «Міхелін» за роботу кращого кухаря цього ресторану — Жана-Батиста Молінарі.\\nНинішня будівля замку Дромоленд була завершена 1835 року. Але ця будівля була побудована на місці старовинного замку, що датувався XV століттям. Цей старовинний замок збудував Томас — син Шейна Мак Анергені. Існувало як мінімум три замки, що в різний час називались замком Дромоленд. У свій час замок Дромоленд був резиденцією восьми поколінь вождів клану О'Браєн. Крім цього, у цьому замку жили люди ірландського клану Мак Інерней у XVI столітті. Згідно праць історика Джеймса Фроста назва замку Дром Олайнн перекладається як «Пагорб Суду»."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AF%8C%E5%A3%AB%E9%9B%BB%E6%A9%9F%E3%82%B7%E3%82%B9%E3%83%86%E3%83%A0%E3%82%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Gate_city_ohsaki_shinagawa_tokyo_2009-3.JPG","page_title":"富士電機システムズ","context_page_description":"富士電機システムズ株式会社は、過去に存在した富士電機グループの中核事業会社の一つで電力・産業システムや半導体などの電子デバイスを製造・設置する企業である。\\n2011年4月1日付で親会社の富士電機ホールディングス株式会社に吸収合併され、消滅した。"},{"page_url":"https://de.wikipedia.org/wiki/Derbi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Derbi_drd_pro.jpg","page_title":"Derbi","context_page_description":"Derbi ist eine spanische Motorradmarke aus Martorell in Katalonien, sie ist Teil des zum Piaggio-Konzern gehörenden Motorradherstellers Nacional Motor S.A.U.\\nDie Firma wurde 1922 von Simeón Rabasa i Singla in Spanien als Fahrradwerkstatt gegründet. Der Name setzt sich aus den Anfangsbuchstaben von „derivado de bicicleta“ zusammen. Nach dem Zweiten Weltkrieg begann Derbi mit der Serienproduktion des ersten Mopeds, der nach den Initialen des Firmengründers benannten SRS.\\nEin bekanntes Modell der 1990er Jahre war der Derbi Vamos. Bis heute werden von Derbi in erster Linie Mofas, Mopeds, Motorroller, Leichtkrafträder von 50 bis 125 cm³ produziert. 2006 bis 2008 war auch ein großes Motorrad, der Scrambler Mulhacén 659, in der Produktpalette.\\nSeit dem 22. März 2013 ist die Fabrik von Derbi in Martorelles geschlossen. Das letzte Fahrzeug, das vom Band rollte, war eine Senda DRD 50."},{"page_url":"https://fr.wikipedia.org/wiki/Croisades","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/1099jerusalem.jpg","page_title":"Croisades","context_page_description":"Les croisades du Moyen Âge sont des expéditions militaires organisées pour pouvoir mener le pèlerinage des chrétiens en Terre sainte afin d'aller prier sur le Saint-Sépulcre. À cette époque, elles sont d'ailleurs conçues comme une forme très particulière de pèlerinage, un « pèlerinage en armes ». Elles ont été prêchées par des papes, par des autorités spirituelles de l'Occident chrétien comme Bernard de Clairvaux, ou par des souverains comme Frédéric Barberousse.\\nLa première croisade est lancée en 1095 par le pape Urbain II pour rétablir l'accès aux lieux de pèlerinages chrétiens en Terre sainte, autorisé jusque-là par les Arabes Abbassides, mais interdit par les nouveaux maîtres de Jérusalem à partir de 1071, les Turcs Seldjoukides, de nouveaux venus provenant des steppes de l'Asie. À l'époque, Jérusalem n'était plus aux mains des chrétiens depuis de nombreux siècles. La croisade répond aussi à une demande de l'empereur d'Orient, inquiet de l'expansion turque qui menace son empire."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%AB%E6%9C%88%E5%AE%97%E6%B4%BE%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/NamIl1951.jpg","page_title":"八月宗派事件","context_page_description":"八月宗派事件是指1956年8月30日期間朝鮮政府內部一些高級官員試圖在朝鮮勞動黨第三次代表大會8月中央全會罷黜時任勞動黨委員長兼內閣首相的金日成並取得對政府的控制，然最終未遂的一場政變。政變的領導人包括內閣副首相、最高人民會議常任委員長、建設省相、商業省相和職業總同盟委員會委員長等，均為勞動黨內的改革派成員。他們反對金日成進行個人崇拜，又認為他所推行的經濟政策和路線出現嚴重的問題。此次政變僅在短短半天內便被瓦解，金日成的權力不但未有受到挑戰，反而逐步鞏固起來，更間接奠定了金氏家族對朝鮮長久的獨裁統治，也影響到該國與蘇聯和中華人民共和國的關係。故此，這政變被歷史學家視為是對朝鮮影響最為深遠的事件之一。"},{"page_url":"https://fr.wikipedia.org/wiki/A%C3%A9roport_de_Visakhapatnam","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Vizag_airport_terminal_full_view.jpg","page_title":"Aéroport de Visakhapatnam","context_page_description":"L'Aéroport de Visakhapatnam est un aéroport international desservant le District de Visakhapatnam, le District de Vizianagaram, le District de Srikakulam ainsi qu'une partie du District du Godavari oriental dans l'Andhra Pradesh. C'est l'aéroport le plus important de l'Andhra Pradesh. Il se situe à 12 km de Visakhapatnam. Il a connu une très forte croissance ces dix dernières années, ce qui lui a permis de construire un terminal international, proposant ainsi des vols à destination de Dubaï, Singapour et Kuala Lumpur."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A0%9C3%EC%B0%A8_%ED%8E%98%EC%8A%A4%ED%8A%B8_%EB%B2%94%EC%9C%A0%ED%96%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Picture_of_Manchurian_Plague_victims_in_1910_-1911.jpg","page_title":"제3차 페스트 범유행","context_page_description":"제3차 페스트 범유행은 1855년 중국 윈난 성에서 발생했다. 페스트는 인간이 거주하는 모든 대륙에 확산되었고, 인도와 중국 두 나라에서만 1천 2백만 명 이상이 사망했다. 세계보건기구에 의하면 제3차 범유행은 페스트 사망자가 연간 200명 이하로 떨어진 1959년까지 계속된 것으로 상정된다."},{"page_url":"https://hsb.wikipedia.org/wiki/Mykolajiwka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Nikolaevka_city_fl.png","page_title":"Mykolajiwka","context_page_description":"Mykolajiwka je město w Donjeckej oblasći na Ukrainje. Leži při rěce Siwerskyj Donec něhdźe 20 kilometrow wuchodnje Slowjanska.\\nMa něhdźe 15 tysac wobydlerjow.\\nSydlišćo je so w lěće 1730 załožiło a ma wot lěta 2003 měšćanske prawa."},{"page_url":"https://en.wikipedia.org/wiki/Lyman_Lemnitzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Republic_of_Korea_War_Service_Medal_ribbon.png","page_title":"Lyman Lemnitzer","context_page_description":"Lyman Louis Lemnitzer was a United States Army general, who served as Chairman of the Joint Chiefs of Staff from 1960 to 1962. He then served as Supreme Allied Commander Europe of NATO from 1963 to 1969."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Eustache_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/F0536_Paris_Ier_eglise_St-Eustache_chapelle_St-Louis-de-Gonzague_rwk.jpg","page_title":"Église Saint-Eustache de Paris","context_page_description":"L’église Saint-Eustache est une église de Paris. Elle est située 146 rue Rambuteau dans le 1ᵉʳ arrondissement au cœur du quartier des Halles."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B0_%D0%B3%D0%B2%D0%B0%D1%80%D0%B4%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Armeria001.JPG","page_title":"Швейцарська гвардія","context_page_description":"Швейца́рська гва́рдія — особиста охорона Папи Римського. Швейцарська гвардія була створена в 1506 спеціально для охорони понтифіків за наказом тодішнього Папи Римського Юлія II."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B5%D0%B3_%D0%92%D0%B5%D1%89%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/A05_Pokhod_Olega_v_Tsargrad.jpg","page_title":"Олег Вещий","context_page_description":"Оле́г — князь Новгородский с 879 года и великий князь Киевский с 882 года.\\nПолучив власть над новгородскими землями после смерти Рюрика, как регент его малолетнего сына Игоря, Олег захватил Киев и перенёс туда столицу, объединив тем самым два главных центра восточных славян. Поэтому нередко именно он, а не Рюрик, объявляется основателем Древнерусского государства.\\nВ летописи «Повесть временных лет» приводится его прозвище Вещий."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_avioanelor_%C8%99i_elicopterelor_militare_ale_Uniunii_Sovietice_%C8%99i_ale_CSI","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Ka-26_Riga.jpg","page_title":"Lista avioanelor și elicopterelor militare ale Uniunii Sovietice și ale CSI","context_page_description":"Aceasta este o Listă a avioanelor și elicopterelor militare ale Uniunii Sovietice și ale CSI care includ avioane experimentale și prototipuri, și tipuri operaționale indiferent de eră.\\nLista include de asemenea avioane proiectate în URSS, proiecte străine sau avioane străine care au servit în aviația militară a URSS."},{"page_url":"https://es.wikipedia.org/wiki/Caf%C3%A9_Novelty","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Centenario_Caf%C3%A9_Novelty_Salamanca_2005.jpg","page_title":"Café Novelty","context_page_description":"El Café Novelty es una famosa cafetería de Salamanca de más de cien años, la más antigua de esta ciudad.​​ Inaugurado en mayo de 1905, y situado en la plaza Mayor, ​ sus primeros propietarios fueron los hermanos García, ​ que lo dotaron con lujo y aire palaciego, como uno de los cafés mejor dotados de España. Inicialmente ocupaba una superficie 4 veces mayor que la actual y pronto se convirtió en el punto de encuentro de escritores, artistas y políticos, debido a su posición privilegiada en la ciudad.\\nJunto con el Café Gijón y el Café de Fornos de Madrid, es considerado una institución y entre sus asiduos más ilustres destacan: Miguel de Unamuno, que hizo del Café Novelty su tertulia diaria, ​ Ortega y Gasset, Antonio Tovar, Juan Benet, Pedro Laín Entralgo, Francisco Umbral, Carmen Martín Gaite, Torrente Ballester o Víctor García de la Concha. También era habitual ver a Agustín de Foxá, en cuyas mesas escribió su novela Madrid, de Corte a checa.\\nEs además conocido porque entre sus mesas se gestó y fundó la Unión Deportiva Salamanca en 1923 y Radio Nacional de España por Dionisio Ridruejo entre 1936 y 1937.​"},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%95%E0%A4%BE%E0%A4%B0%E0%A5%87%E0%A4%99%E0%A5%8D%E0%A4%97%E0%A5%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/DerrisPinnataFl.jpg","page_title":"कारेङ्गी","context_page_description":"कारेङ्गी वा करञ्जको रूख केराउको प्रजातिको रूख हो। यो एसियाका नेपाल, भारत, चिन, जापान र मलेशिया लगायत अष्ट्रेलियाको उष्ण तथा समशितोष्ण भूभागमा पाइने गर्छ।"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B3_%D8%AE%DB%8C%D9%84%DB%8C%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Bastiaan_Giling.jpg","page_title":"باس خیلینگ","context_page_description":"باس خیلینگ دوچرخه‌سوار اهل هلند است."},{"page_url":"https://ca.wikipedia.org/wiki/Torneig_d%27escacs_Memorial_Mikha%C3%AFl_Tal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Mamedyarov_Shakhriyar_3_cropped.jpg","page_title":"Torneig d'escacs Memorial Mikhaïl Tal","context_page_description":"El Torneig d'escacs Memorial Mikhaïl Tal és un torneig d'escacs que es disputa a Moscou cada any des de 2006, per honorar la memòria de l'exCampió del món Mikhaïl Tal, mort el 1992.\\nNormalment es juga durant la primera meitat del mes de novembre, i hi competeixen molts dels millors jugadors del món. Les primeres tres edicions varen assolir la Categoria XX de la FIDE."},{"page_url":"https://en.wikipedia.org/wiki/Uta_Hick%27s_bearded_saki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Uta_Hick%27s_Bearded_Saki_area.png","page_title":"Uta Hick's bearded saki","context_page_description":"Uta Hick's bearded saki is an endangered species of bearded saki, a type of New World monkey. It is endemic to Brazil, where restricted to the Amazon between the Xingu and Tocantins Rivers. It was formerly treated as a subspecies of the more easterly C. satanas, but its back is pale brownish. The specific name is often modified to utahickae, but this has been discouraged."},{"page_url":"https://fr.wikipedia.org/wiki/Sonate_pour_piano_n%C2%BA_32_de_Beethoven","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Beethoven_opus_111_Mvt1_ThemeA2.png","page_title":"Sonate pour piano nº 32 de Beethoven","context_page_description":"La Sonate pour piano nᵒ 32 en ut mineur, opus 111, de Ludwig van Beethoven, a été composée entre 1820 et 1822, parallèlement à la Sonate pour piano nᵒ 31, opus 110, et à la Missa solemnis.\\nŒuvre de la dernière période créative du compositeur, elle opère une synthèse entre la forme sonate, la fugue et la variation. Elle ne comporte que deux mouvements très contrastés dont le second, une Arietta à variations, a été consacré par la formule de Thomas Mann, « l'adieu à la sonate ».\\nEn raison de sa difficulté technique et de ses caractéristiques visionnaires, particulièrement rythmiques, la sonate a été presque ignorée des contemporains du compositeur et a mis longtemps à s'imposer au répertoire. Ce n'est qu'à partir de la seconde moitié du XIXᵉ siècle qu'elle a trouvé sa place au concert, passant au répertoire des plus grands pianistes et comptant parmi les œuvres les plus commentées de Beethoven."},{"page_url":"https://la.wikipedia.org/wiki/Iacobus_Hector","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/James_Hector_1858.jpg","page_title":"Iacobus Hector","context_page_description":"Iacobus Hector Edimburgi natus die 16 Martii 1834; obiit in Nova Zelandia die 16 Augusti 1907 fuit geologiae, naturae studiosus et chirurgus scoticus.\\nHector apud Universitas Academica Edinburgensis: medicinae studuit et anno 1856 doctoris insigne consecutus est.\\nAb anno 1884 Canadae mons honoris eius nomen Mons Hector fert."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A0%D7%92%D7%95%D7%9C%D7%99%D7%A0%D7%90%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Manis_ranges.png","page_title":"פנגולינאים","context_page_description":"פַּנְגּוֹלִינָאִים היא סדרה במחלקת היונקים, ובה קיימת בימינו משפחה אחת, הכוללת שלושה סוגים ושמונה מינים.\\nמשקלם של הפנגולינים נע בין ארבעה קילוגרם ל-33 קילוגרם. אורכם נע בין 30 ל-100 סנטימטר."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A3%BC%EC%A7%80%EC%9C%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Zhu_Zhi-Yu.jpg","page_title":"주지유","context_page_description":"주지유는 명나라의 문신이다. 자는 노서 혹은 초서, 호는 순수이다. 호를 따서 주순수로도 통칭된다. 나중에 일본에 정착하였다."},{"page_url":"https://pt.wikipedia.org/wiki/Fanny_Ayton","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Fanny_Ayton%2C_engraving_by_Holl.jpg","page_title":"Fanny Ayton","context_page_description":"Fanny Ayton foi uma soprano inglesa conhecida por suas grandes apresentações em Londres no final da década de 1820."},{"page_url":"https://gl.wikipedia.org/wiki/Tartaruga_xigante_de_Aldabra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Aldabrachelys_gigantea.JPG","page_title":"Tartaruga xigante de Aldabra","context_page_description":"A tartaruga xigante de Aldabra, é unha especie de tartaruga endémica do atol de Aldabra nas Seychelles e outras illas do Índico, que é unha das tartarugas de maior tamaño do mundo. Historicamente as tartarugas xigantes vivían en moitas das illas do océano Índico occidental, como Madagascar e as illas Mascareñas, e o rexistro fósil indica que antes había tartarugas xigantes en todos os continentes e en moitas illas con excepción de Australia e a Antártida. Pénsase que moitas das especies do océano Índico foron levadas á extinción pola sobreexplotación que fixeron delas os mariñeiros europeos, e practicamente estaban todas extinguidas arredor de 1840 coa excepción da tartaruga xigante do atol de Aldabra."},{"page_url":"https://pl.wikipedia.org/wiki/Stara_Obra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/MOs810%2C_WG_2014_20%2C_Obra_Stara_%282%29.JPG","page_title":"Stara Obra","context_page_description":"Stara Obra – wieś w Polsce położona w województwie wielkopolskim, w powiecie krotoszyńskim, w gminie Koźmin Wielkopolski, położona na północ od Koźmina Wielkopolskiego, 6 km od miasta, przy linii kolejowej do Jarocina. Przez wieś przepływa jeden ze strumieni, łączących się dalej z rzeką Obrą.\\nPo raz pierwszy wzmiankowana w I połowie XV wieku, należała do dóbr koźmińskich do połowy wieku XIX. Obok dziewiętnastowiecznych zabudowań dworskich zachował się 11-hektarowy park z okazami sosny czarnej i lipy amerykańskiej.\\nW okresie Wielkiego Księstwa Poznańskiego miejscowość wzmiankowana jako Obra należała do wsi większych w ówczesnym pruskim powiecie Krotoszyn w rejencji poznańskiej. Obra należała do okręgu koźmińskiego tego powiatu i stanowiła odrębny majątek, którego właścicielem był wówczas Szmolke. Według spisu urzędowego z 1837 roku wieś liczyła 367 mieszkańców, którzy zamieszkiwali 39 dymów.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa kaliskiego.\\nPrzystanek kolejowy Obra Stara wybudowano tu w czynie społecznym w 1970.\\nZobacz też: Obra"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%AC%CF%83%CF%84%CF%81%CE%BF_%CF%84%CE%BF%CF%85_%CE%A3%CE%B5%CE%BD%CE%BF%CE%BD%CF%83%CF%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Ch%C3%A2teau_de_Chenonceau_1914_%C3%A0_1918_%2815%29.jpg","page_title":"Κάστρο του Σενονσώ","context_page_description":"Το κάστρο του Σενονσώ βρίσκεται στην κοινότητα του Σενονσώ στην περιοχή Αντρ-ε-Λουάρ. Είναι ένα από τα κάστρα που είναι γνωστά σαν κάστρα του Λίγηρα.\\nΤο Σενονσώ είναι κτισμένο, επιπλωμένο, και διαμορφωμένο από γυναίκες πολύ διαφορετικές κατά την ιδιοσυγκρασία τους. Χτίστηκε από την Κατρίν Μπρισονέ το 1513, εμπλουτίστηκε από τη Ντιαν ντε Πουατιέ και διευρύνθηκε από την Αικατερίνη των Μεδίκων. Έγινε χώρος περισυλλογής της βασίλισσας Λουίζας της Λωρραίνης, έπειτα διασώθηκε από την Λουίζ Ντυπάν κατά τη διάρκεια της γαλλικής Επανάστασης και τέλος, μεταμορφώθηκε από την κυρία Πελούζ. Έτσι, απέκτησε το χαρακτηρισμό το κάστρο των Κυριών, διότι \\"αυτό το θηλυκό αποτύπωμα είναι παρόν παντού, προστατεύοντάς το από τις συγκρούσεις και τους πολέμους για να είναι για πάντα ένας τόπος ειρήνης\\".\\nΤο κάστρο είναι επιπλωμένο, διακοσμημένο με σπάνιες ταπετσαρίες και παλιούς πίνακες, είναι το πιο επισκέψιμο ιδιωτικό ιστορικό μνημείο της Γαλλίας. Έχει αρκετούς κήπους, ένα πάρκο και έναν αμπελώνα.\\nΌλη η περιοχή, ιδιοκτησία σήμερα της οικογένειας Μενιέ, δέχεται ετησίως 850.000 επισκέπτες[5]. Το κάστρο ανήκει στα ιστορικά μνημεία της Γαλλίας από το 1840 και το πάρκο από το 1962."},{"page_url":"https://sv.wikipedia.org/wiki/Kalmar_%C3%A5ngkvarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kalmar_County_Museum.jpg","page_title":"Kalmar ångkvarn","context_page_description":"Kalmar ångkvarn grundades 1847. Kalmar Ångkvarns byggnad är placerad på Kvarnholmen i södra delen av Kalmar centrum mellan Skeppsbrogatan och Södra Långgatan, samt mellan Proviantgatan och Östra Vallgatan.\\nIdag återfinns Kalmar läns museum, regionens största konferensanläggning Kalmarsalen och en rad andra företag i den forna ångkvarnens byggnad vid hamnen. Kalmar läns museum är det kulturhistoriska museet för Kalmar län. Huvuddelen av utställningen ägnas åt Regalskeppet Kronan, som sjönk i ett sjöslag vid Ölands södra udde år 1676, och det arkeologiska arbetet i regionen."},{"page_url":"https://it.wikipedia.org/wiki/Oleksandr_Sydorenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/RIAN_archive_487096_Alexander_Sidorenko%2C_USSR_Merited_Master_of_Sports.jpg","page_title":"Oleksandr Sydorenko","context_page_description":"Oleksandr Oleksandrovyč Sydorenko è un ex nuotatore sovietico, specializzato nei misti, e vincitore della medaglia d'oro nei 400 m misti alle Olimpiadi di Mosca."},{"page_url":"https://hu.wikipedia.org/wiki/Hosztomeli_rep%C3%BCl%C5%91t%C3%A9r","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Gostomel-airport.jpg","page_title":"Hosztomeli repülőtér","context_page_description":"A Hosztomeli repülőtér, vagy másik közismert nevén Antonov-repülőtér nemzetközi teherforgalmi repülőtér Ukrajnában. A Kijevi területen, a fővárostól, Kijevtől északnyugatra elterülő előváros, Hosztomel közelében fekszik. Kijevtől 25 km-re, Hosztomeltől 2 km-re található. A repülőtér üzemeltetője az Antonov tervezőiroda, melynek ez a fő kísérleti repülőtere is. Ez a bázisrepülőtere a tervezőiroda légitársaságának, az Antonov légitársaságnak.\\nA repülőtér egy betonozott, 3500 m hosszú és 56 m széles kifutópályával rendelkezik. ICAO I-es kategóriába tartozik, mely minden időjárási körülmény mellett használható. 1992-től határőr ellenőrző pont is működik a repülőtéren, így ettől kezdve nemzetközi forgalomra is alkalmas.\\nA repülőtéren több, az Antonov tervezőiroda repülőgépeinek tesztelésére szolgáló berendezés is található, így pl. a gépek villámcsapás elleni védelmének vizsgálatára alkalmas nagyfeszültségű impulzus-generátor is.\\nA repülőtér két nagyméretű hangárral rendelkezik: az egyik 80×40 m alapterületű és 28 m belmagasságú, a másik 96×104 m alapterületű és 40 m belmagasságú. Mindkettő alkalmas nagyméretű repülőgépek – így akár An–225, An–124 – tárolására és javítására."},{"page_url":"https://fr.wikipedia.org/wiki/The_Contours","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/TheContourspromo.jpg","page_title":"The Contours","context_page_description":"The Contours est un groupe américain de musique soul qui a travaillé avec la Motown.\\nLe nombre et l'identité de ses membres ont changé régulièrement. La chanson la plus connue du groupe est Do You Love Me."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%88%A9%E5%AE%89%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Lee_On_Estate_overview_2017.jpg","page_title":"利安邨","context_page_description":"利安邨是香港房屋委員會轄下的一個公共屋邨，於1993年入伙，位於新界沙田區烏溪沙的北部，但已列入擴展市區配屋區內，是馬鞍山以至沙田區最北及最東的公共屋邨，亦是馬鞍山第三個入伙的屋邨。現由雅居物業管理有限公司負責屋邨管理。"},{"page_url":"https://pl.wikipedia.org/wiki/Aleksander_I_Battenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Ribbon_for_Romanian_Military_Virtue_%28non_wartime%29.png","page_title":"Aleksander I Battenberg","context_page_description":"Aleksander I Battenberg, właśc. Aleksander Józef von Battenberg z dynastii Hessen-Darmstadt – syn księcia Aleksandra Heskiego z morganatycznego małżeństwa z Julią Hauke. Jego młodszym bratem był Henryk Battenberg.\\nPierwszy władca niepodległej Bułgarii od 29 kwietnia 1879 roku, panujący do 6 września 1886, wybrany przez pierwsze wielkie Zgromadzenie Narodowe w Wielkim Tyrnowie. Niedoświadczony jeszcze wówczas młodzieniec przyjął imię Aleksandra I.\\n18 września 1885 dokonano zamachu stanu w sąsiedniej Rumelii Wschodniej i proklamowano zjednoczenie z Bułgarią. Ostrożny Battenberg obawiając się reakcji mocarstw, nie przyjął tytułu księcia Rumelii, tylko został jej generałem-gubernatorem. Niespełna rok później 21 sierpnia 1886 grupa liberalnych oficerów prorosyjskiej orientacji przejęła władzę w Sofii, wymuszając na nim abdykację, ten chociaż namaszczony przez Rosję księciem Bułgarii, został przez nią zmuszony do wyjazdu do Lwowa. Pucz zorganizowany przez stronnictwo rusofilów, pozostających w opozycji do dominującej partii liberalnej. Przywódca kontrreformistów – Stefan Stambołow, uzyskawszy poparcie wojska oraz narodu, odmówił legalności puczystom."},{"page_url":"https://nl.wikipedia.org/wiki/Grobi%C5%86as_novads","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Grobi%C5%86as_pils%C4%93tas_dome_2000-06-11.jpg","page_title":"Grobiņas novads","context_page_description":"Grobiņas novads is een gemeente in Koerland in het westen van Letland. De gemeente ontstond in 2009 na een herindeling waarbij de volgende steden en landelijke gemeenten werden samengevoegd:\\nBārta\\nGavieze\\nGrobiņa landelijk gebied\\nGrobiņa stad, het administratieve centrum\\nMedze"},{"page_url":"https://uk.wikipedia.org/wiki/EnerJew","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Enerjew_Logo.png","page_title":"EnerJew","context_page_description":"EnerJew єврейська молодіжний рух, який було створено в 2013 році, це рух активний країнах Співдружності незалежних держав, їх діяльність спрямована на створення глибокий зв'язок між єврейськими підлітків і їх культурної спадщини. EnerJew виросла зі значною швидкістю і в 2015 році була 1800 членів підлітки у віці від 13 до 18, в 25 містах в різних країнах регіону. EnerJew намагається набирати молодих людей, щоб вони стати активним і невід'ємною частиною єврейської громади. EnerJew розробляє заходи для молодих і просуває практику юдаїзму, щоб вони поступово інтегруватися в суспільстві. EnerJew дає молодим людям знання і навички, щоб стати в один прекрасний день майбутні лідери громад. Рух фокусується на трьох ключових областях: підключення, безперервності і ініціативних."},{"page_url":"https://fr.wikipedia.org/wiki/Andres_Serrano","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Andres_Serrano_cropped.jpg","page_title":"Andres Serrano","context_page_description":"Andres Serrano, né le 15 août 1950 à New York, est un photographe contemporain américain connu principalement pour ses photos et portraits de corps."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D1%84%D1%82_%D0%9D%D0%91%D0%90_1973","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/012308-TC-Twolves002-MikeDantoni.jpg","page_title":"Драфт НБА 1973","context_page_description":"Драфт НБА 1973 року відбувся 24 квітня і 5 травня. 17 команд Національної баскетбольної асоціації по черзі вибирали найкращих випускників коледжів, а також інших кандидатів, офіційно зареєстрованих для участі в драфті, зокрема іноземців. Перші два права вибору належали командам, які посіли останні місця у своїх конференціях, а їхній порядок визначало підкидання монети. Філадельфія Севенті-Сіксерс виграли підкидання монети і отримали перший загальний драфт-пік, а Портленд Трейл-Блейзерс - другий. Решту драфт-піків першого раунду команди дістали у зворотньому порядку до їхнього співвідношення перемог до поразок у сезоні 1972–1973. Перед драфтом Балтимор Буллетс переїхали до Лендовера і змінили назву на Кепітал Буллетс. Філадельфія Севенті-Сіксерс отримала як компенсацію ще одне право вибору в першому раунді, коли Сіетл Суперсонікс підписали Джона Бріскера. Гравець, який завершував четвертий рік у коледжі отримував право на участь у драфті. Перед драфтом 11 гравців, які завершили менш як чотири роки навчання, оголосили такими, що можуть бути вибрані на драфті за правилом \\"hardship\\"."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%84%AD%E6%95%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Gyeomjae-Yangcheon-Gwiraejeong.jpg","page_title":"鄭敾","context_page_description":"鄭敾，字元伯、號謙齋，本貫光州鄭氏，朝鮮王朝中期畫家，與尹斗緒和沈師正並稱為「士人三齋」。\\n鄭敾是朝鮮真景山水畫的代表性畫家，有「東方真景山水畫家」之稱。他的代表作《金剛全圖》通過垂直線皴法描繪出其遊覽的金剛山，顯示出與中國畫截然不同的朝鮮風格。。"},{"page_url":"https://pl.wikipedia.org/wiki/S%C3%A9bastien_Castellion","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Castellio_De_haereticis.jpg","page_title":"Sébastien Castellion","context_page_description":"Sébastien Castellion – protestancki biblista i humanista."},{"page_url":"https://pt.wikipedia.org/wiki/Yury_Luzhkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Yuri_Luzhkov_2010_Moscow_Unesco_02.jpg","page_title":"Yury Luzhkov","context_page_description":"Yury Luzhkov foi um político russo.\\nPrefeito Moscovita de 1992-2010. Destacou-se na nova fase de reestruturação pós-soviética, através da promoção de grande renovação urbanística da capital russa. Desde que assumiu seu posto, grande número de edifícios históricos e inclusive tombados pelo Patrimônio Histórico, foram demolidos e substituídos por novos empreendimentos imobiliários modernos, dos quais se destacam os dois maiores arranha-céus da Europa.\\nFicou famoso após proibir a manifestação pública de grupos sociais e a Parada Gay de Moscou, nas ruas da cidade e em especial na Praça Vermelha. Grupos ativistas dos Direitos Humanos denunciam sua intolerância e sua postura social ultra-conservadora.\\nEntretanto, em 28 de setembro de 2010, foi destituído do cargo pelo então presidente do país Dmitri Medvedev, \\"por ter perdido a confiança do presidente russo\\" segundo comunicado oficial. Medvedev nomeou Sergey Sobyanin para substituí-lo.\\nSua esposa, Helena Baturina, que figura entre os bilionários da Rússia, é dona de uma empresa construtora na cidade. Faleceu em 10 de dezembro de 2019 aos 83 anos de idade em Munique, Alemanha."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%B5%D8%A7%D8%B1_%D8%B9%D9%83%D8%A7_(1799)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Sir_William_Sidney_Smith_by_John_Eckstein.jpg","page_title":"حصار عكا (1799)","context_page_description":"حصار عكا عام 1799، كان محاولة غير ناجحة للجيش الفرنسي بقيادة نابليون بونابرت لحصار مدينة عكا، حيث نجح العثمانيون بمعاونة الاسطول الإنجليزي في هزيمة الجيش الفرنسي، وكانت نقطة تحول لغزو نابليون بونابرت لمصر والشام."},{"page_url":"https://en.wikipedia.org/wiki/Scottish_diaspora","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Macdonald1872.jpg","page_title":"Scottish diaspora","context_page_description":"The Scottish diaspora consists of Scottish people who emigrated from Scotland and their descendants. The diaspora is concentrated in countries such as the United States, Canada, Australia, England, New Zealand, Ireland and to a lesser extent Argentina, Chile and Brazil."},{"page_url":"https://nv.wikipedia.org/wiki/Gin%C3%AD_yist%C5%82%CA%BCin%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Greater_Kestrel_Namibia.jpg","page_title":"Giní yistłʼinígíí","context_page_description":"Giní yistłʼinígíí éí atsáłbáí dah yikahjí atah yisdzoh, áádóó éí Naakaii Łizhiní Bikéyahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Falco rupicoloides\\" deiłníigo dayózhí."},{"page_url":"https://es.wikipedia.org/wiki/H%C5%8Dfu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Hofu.jpg","page_title":"Hōfu","context_page_description":"Hōfu es una ciudad de la prefectura de Yamaguchi, Japón.\\nA 30 de septiembre de 2016, la ciudad tenía una población estimada de 117.387 y una densidad demográfica de 622,44 habitantes por km². El área total es de 188,59 km²."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%97%D1%8C%D0%B1%D1%96%D0%B3%D0%BD%D0%B5%D1%9E_%D0%90%D0%BB%D1%8F%D1%81%D1%8C%D0%BD%D1%96%D1%86%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Zbigniew_Olesnicki.jpg","page_title":"Зьбігнеў Алясьніцкі","context_page_description":"Зьбі́гнеў Кардынал Алясьні́цкі — польскі рэлігійны і дзяржаўны дзяяч, дыплямат."},{"page_url":"https://sv.wikipedia.org/wiki/Luzarches","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Map_commune_FR_insee_code_95352.png","page_title":"Luzarches","context_page_description":"Luzarches är en kommun i departementet Val-d'Oise i regionen Île-de-France i norra Frankrike. Kommunen ligger i kantonen Luzarches som tillhör arrondissementet Sarcelles. År 2009 hade Luzarches 4 220 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_saints_de_l%27%C3%89glise_orthodoxe","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Saint_Matthias.PNG","page_title":"Liste des saints de l'Église orthodoxe","context_page_description":"La présente liste ne se veut pas exhaustive. Elle se propose de mentionner un choix de saints parmi les plus vénérés par l'Église orthodoxe selon les dates du calendrier grégorien. Les dates du calendrier julien sont les mêmes mais correspondent, dans le calendrier grégorien, à une date postérieure de 13 jours. Elle les classe par collège, selon une logique qui prévaut lors de la composition du programme iconographique destiné à décorer les murs d'une église. Quelques saints peuvent figurer dans deux collèges différents."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Frankfurt_(Main)_Taunusanlage","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/ET_423_Taunusanlage.jpg","page_title":"Bahnhof Frankfurt (Main) Taunusanlage","context_page_description":"Der Bahnhof Frankfurt (Main) Taunusanlage ist ein unterirdischer S-Bahn-Haltepunkt des City-Tunnels Frankfurt im Zentrum von Frankfurt am Main. Der Bahnhof befindet sich im Stadtteil Westend-Süd an der Grenze zur benachbarten Innenstadt und dem Bahnhofsviertel. Namensgeber der Station ist der in der Nähe gelegene Park Taunusanlage, ein Teilstück der Frankfurter Wallanlagen, die ringförmig die Innenstadt umgeben.\\nDie Station gehört zur Bahnhofskategorie 3 und wurde zusammen mit dem ersten Abschnitt des City-Tunnels im Mai 1978 eröffnet. Sie besteht aus zwei Gleisen, die an einem Mittelbahnsteig liegen. 2001 wurden die bis dahin grün gefliesten Bahnsteigsäulen grün gestrichen sowie die grünen Streifen auf den Hintergleiswänden dunkelblau überstrichen.\\nDie Fahrtreppen liegen rund um das Deutsche-Bank-Hochhaus. Die Station ist ein wichtiger Knotenpunkt für Berufspendler, da in unmittelbarer Nähe viele Unternehmen, vor allem aus der Finanzbranche, ihren Sitz haben. Der Bereich rund um den S-Bahnhof wird daher auch als Bankenviertel bezeichnet.\\nZwischen 2014 und 2016 wurde die Station optisch modernisiert sowie die Böden erneuert."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D0%BA%D1%83%D0%B4%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Beaucoudray_-_Mairie_et_%C3%A9glise_Saint-Laurent.JPG","page_title":"Бокудре","context_page_description":"Бокудре́ — муніципалітет у Франції, у регіоні Нижня Нормандія, департамент Манш. Населення — 156 осіб.\\nМуніципалітет розташований на відстані близько 260 км на захід від Парижа, 65 км на південний захід від Кана, 18 км на південь від Сен-Ло."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%B0%D0%BB%D0%BB%D0%B5%D0%BB%D0%BB%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ultraparallel.png","page_title":"Параллеллек","context_page_description":"Параллеллек — тура һыҙыҡтар араһындағы бәйләнеш.\\nТөрлө геометрия бүлектәрендә төрлөсәрәк билдәләмә бирелә."},{"page_url":"https://fr.wikipedia.org/wiki/Mobilier_dans_l%27%C3%89gypte_antique","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Senet_anagoria.JPG","page_title":"Mobilier dans l'Égypte antique","context_page_description":"Les tombes de l'Égypte antique ont permis de découvrir le mobilier de l'époque."},{"page_url":"https://fr.wikipedia.org/wiki/Renault_Master","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/1981-92_Renault_Master_%28rl%29.jpg","page_title":"Renault Master","context_page_description":"Le Renault Master est la désignation commerciale de trois générations de véhicules utilitaires de 3,5 tonnes de PTAC fabriqués par Renault depuis septembre 1980 dans l'usine SOVAB."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Berkeley_Software_Distribution","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/SPEC-1_VAX_05.jpg","page_title":"History of the Berkeley Software Distribution","context_page_description":"The History of the Berkeley Software Distribution begins in the 1970s."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Brighton_and_Hove","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Sussex_Square_%28North_Side%29%2C_Kemp_Town_02_%28IoE_Code_481313%29.JPG","page_title":"Grade I listed buildings in Brighton and Hove","context_page_description":"There are 24 Grade I listed buildings in the city of Brighton and Hove, England. The city, on the English Channel coast approximately 52 miles south of London, was formed as a unitary authority in 1997 by the merger of the neighbouring towns of Brighton and Hove. Queen Elizabeth II granted city status in 2000.\\nIn England, a building or structure is defined as \\"listed\\" when it is placed on a statutory register of buildings of \\"special architectural or historic interest\\" by the Secretary of State for Culture, Media and Sport, a Government department, in accordance with the Planning Act 1990. English Heritage, a non-departmental public body, acts as an agency of this department to administer the process and advise the department on relevant issues. There are three grades of listing status: Grade I, the highest, defined as being of \\"exceptional interest\\"; Grade II*, \\"particularly important buildings of more than special interest\\"; and Grade II, the lowest, used for buildings of \\"special interest\\".\\nBrighton and its westerly neighbour Hove developed independently as fishing villages on the English Channel coastline."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Ludlow_(northern_area)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/12_Castle_Street%2C_Ludlow.jpg","page_title":"Listed buildings in Ludlow (northern area)","context_page_description":"Ludlow is a civil parish in Shropshire, England. It contains over 420 listed buildings that are recorded in the National Heritage List for England. Of these, nine are listed at Grade I, the highest of the three grades, 25 are at Grade II*, the middle grade, and the others are at Grade II, the lowest grade. Most of the listed buildings are grouped around the centre of the town, from a line stretching from Castle Square, along High Street and King Street to Tower Street, and southwards to the River Teme, and to the north along Bull Ring and Corve Street.\\nThe listed buildings reflect the history of the town from the medieval period to the present. The oldest significant buildings are the remains of Ludlow Castle, Broad Gate, a former gateway to the town, St Laurence's Church, and surviving sections of the Town Walls. Most of the listed buildings are houses, cottages, shops, public buildings, hotels and public houses, the earlier ones timber framed, or basically timber framed and later refronted or encased in brick. During the 18th century larger and grander houses were built, most of them in brick."},{"page_url":"https://en.wikipedia.org/wiki/Tim_Pawlenty","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/USPS-E85_fuel-St_Paul-20070127.jpg","page_title":"Tim Pawlenty","context_page_description":"Timothy James Pawlenty is an American businessman and politician. A Republican, he served as 39th Governor of Minnesota from 2003 to 2011. He served in the Minnesota House of Representatives, where he was majority leader for two terms. In 2011, he entered the campaign for the Republican presidential nomination and was subsequently a leading contender to be a vice presidential nominee before serving as co-chair of the Mitt Romney campaign.\\nPawlenty was born in Saint Paul, Minnesota and raised in nearby South St. Paul. He graduated from University of Minnesota with a B.A. in political science and a J.D. His early career included stints as a labor law attorney and as the vice president of a software as a service company. After settling in the city of Eagan with his wife, Pawlenty was appointed to the city's Planning Commission and was elected to the Eagan City Council at the age of 28. He won a seat as a state representative in 1992, representing District 38B in suburban Dakota County. He was re-elected four times and was voted majority leader by House Republicans in 1998."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%96%80%E4%BB%80%E5%9C%B0%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/%E3%82%AB%E3%82%B7%E3%83%A5%E3%82%AC%E3%83%AB%E9%A7%85%E3%81%AE%E9%A7%85%E5%90%8D%E6%A8%99.jpg","page_title":"喀什地区","context_page_description":"喀什地區是中華人民共和國新疆維吾爾自治區下轄的地區，位於新疆西部。全區總面積111,398平方公里。"},{"page_url":"https://lt.wikipedia.org/wiki/Arauka_(up%C4%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Rio_arauca.jpg","page_title":"Arauka (upė)","context_page_description":"Arauka – upė Kolumbijoje ir Venesueloje; Orinoko kairysis intakas. Prasideda Andų kalnuose, apie 4000 m aukštyje, centrinėje šiaurės Kolumbijoje. Aukštupyje dažnai vadinama Chitagá. Teka į rytus Kolumbijos-Venesuelos siena. Toliau teka Ljanoso lygumomis kur vaga išplatėja, skaidosi į atšakas, sudaro šlapynes.\\nDidžiausi intakai: Karabas, Kakota, Negras, Koloradas, San Lorensas, Kubugonas, Kobaras, Rojata, Bochaba, Banadija, Kutufi.\\nVasarą ir rudenį patvinsta. Potvynių metu laivai upe gali pakilti 600 km. Svarbiausi pakrantės miestai – Arauka, Araukita, El Amparo de Apūrė, Elorsa."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%B9%BD%E5%9F%95%E5%A4%A9%E5%90%8E%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/%E9%87%8D%E8%84%A9%E7%80%A8%E5%8C%97%E5%A0%B4%E7%A2%91%E8%A8%98.JPG","page_title":"鹽埕天后宮","context_page_description":"盐埕天后宫位于台湾台南市南区盐埕，主祀天上圣母，配祀武惠尊王，现今庙貌为民国六十六年重建后的样子。过去附近居民多经由庙后的“帆港”将盐场产出的盐运往安平，故此庙亦称为“帆港天后宫”。该庙为盐埕地区的公庙，其庙境相当于台南市南区的日新、明亮、府南三里。庙埕立有“重脩濑北场碑记”，据说已修成正果，被附近信众称为石头公并享用香火。\\n盐埕天后宫重要的活动除了天上圣母与武惠尊王诞辰外，亦配合政府单位举办文化祭，于妈祖诞辰举办“海盐礼赞”、“平安盐山”等活动，延续昔日盐埕濑北盐场的记忆。"},{"page_url":"https://de.wikipedia.org/wiki/Fl%C3%BCgelaltar_von_Schloss_Tirol","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Fl%C3%BCgelau%C3%9Fenseite_rechts%2C_Altar_von_Schloss_Tirol.jpg","page_title":"Flügelaltar von Schloss Tirol","context_page_description":"Der Flügelaltar von Schloss Tirol gilt als der älteste fast vollständig erhaltene Flügelaltar des Alpenraums. Er entstand 1370/72 für die dem hl. Pankratius geweihte Oberkapelle der landesfürstlichen Residenz Schloss Tirol bei Meran. Der Altar ist ein Werk des Wiener Hofmalers Meister Konrad. Seine Höhe beträgt 2,49 Meter. Wenn die Flügel geöffnet sind, ist er 2,79 Meter breit.\\nBis 1809 befand sich der Flügelaltar auf Schloss Tirol. Seit 1942 steht der Altar dauerhaft im Tiroler Landesmuseum Ferdinandeum in Innsbruck. Als Meisterwerk gotischer Kunst und als Dokument der Tiroler Landesgeschichte wird der Flügelaltar von Schloss Tirol seit Februar 2017 im Ferdinandeum als umfassendes Forschungsprojekt in einem separaten Ausstellungsraum des Museums präsentiert. In der Oberkapelle von Schloss Tirol ersetzt eine von der Künstlergruppe Unika aus Gröden geschaffene originalgetreue Replik den historischen Flügelaltar."},{"page_url":"https://es.wikipedia.org/wiki/Centro_Cultural_BOD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Contraste_Urbano.jpg","page_title":"Centro Cultural BOD","context_page_description":"El Centro Cultural BOD, ​​​ originalmente denominado Centro Cultural Consolidado​, fundado en 1990 con el patrocinio de la Fundación Banco Consolidado, ​ tomó después el nombre de Centro Cultural Corp Group y posteriormente Centro Cultural BOD-Corpbanca. Actualmente conserva las mismas características arquitectónicas del original Centro Cultural Consolidado: las de un espacio multifuncional, que ocupa distintos niveles de la Torre Financiera BOD.​ Se encuentra frente a la Plaza La Castellana, también conocida como Plaza Isabel La Católica, entre las Avenidas Blandín y Los Chaguaramos, en el Municipio Chacao del Estado Miranda al este del Distrito Metropolitano de Caracas, ​ capital de Venezuela.\\nEsta habilitado para recibir conciertos, obras teatrales, ​ espectáculos, foros, seminarios, eventos culturales, ferias, exposiciones de arte, recepciones y una variedad de actividades de diversa índole.\\nPosee una sala originalmente diseñada por el arquitecto del Teatro Teresa Carreño, Tomás Lugo, de capacidad total de 450 lugares, ​ la cual, gracias a su particular configuración en escuadra permite el uso independiente de cada ala."},{"page_url":"https://pt.wikipedia.org/wiki/Castelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Attack_on_a_castle%2C_circa_1460._Wellcome_M0008015.jpg","page_title":"Castelo","context_page_description":"Castelo é um tipo de estrutura fortificada, construída na Europa e Oriente Médio durante a Idade Média pelos nobres europeus. A palavra castelo é definida pelos estudiosos, como sendo a residência particular fortificada de um lorde ou nobre, sendo diferente de palácio, que não é fortificado; é diferente também de fortaleza, que nem sempre é a residência da nobreza; e é também diferente de um assentamento fortificado, que era uma estrutura de defesa coletiva, embora existam muitas semelhanças entre todos estes tipos de construção. O uso do termo tem se modificado ao longo do tempo e tem sido aplicado a diferentes estruturas como os castros. Durante aproximadamente novecentos anos em que os castelos foram construídos, tiveram uma grande variedade de formas, com muitas características diferentes, tais como defesas por muralha, e seteiras, que eram as mais comuns.\\nUma inovação europeia, foram os castelos originados depois da queda do Império Carolíngio no século X, cujo território foi dividido entre lordes e príncipes. Eram construídos castelos para controlar a área circunvizinha a eles."},{"page_url":"https://en.wikipedia.org/wiki/Dawndraco","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Pteranodonts.png","page_title":"Dawndraco","context_page_description":"Dawndraco is a controversial genus of pteranodontid pterosaur from the Late Cretaceous of North America. It is likely synonymous with the contemporary pteranodontid Pteranodon sternbergi.\\n'Dawndraco' was named by Alexander W.A. Kellner in 2010. The type species is Dawndraco kanzai. The generic name combines the Dawn deity of the Iroquois with a Latin draco, \\"dragon\\". The specific name refers to the Kanza tribe of Kansas.\\n'Dawndraco' is based on the holotype specimen UALVP 24238, a partial skeleton including an almost complete skull and lower jaws. It was recovered in 1974 by Richard C. Fox and Allen Lindoe from rocks of the lower part of the Smoky Hill Chalk Member of the Niobrara Formation in Utica, Kansas. These rocks date to the late Coniacian or early Santonian stage, about 86 million years ago.\\nThe specimen was earlier referred to Pteranodon sternbergi. However, when Kellner in 2010 assigned this latter species to the genus Geosternbergia, he concluded that specimen UALVP 24238 was too different from it to be accounted for by individual variation or sexual dimorphism and therefore named a separate genus."},{"page_url":"https://hr.wikipedia.org/wiki/Matija_Korvin","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Esztergom.matyas.kiraly.JPG","page_title":"Matija Korvin","context_page_description":"Matija Korvin, poznat i kao Matijaš, hrvatsko-ugarski kralj, protukralj Češke. Osvojio je dio habsburških nasljednih zemalja, kojima je vladao iz Beča s naslovom austrijskog vojvode. Bio je jedan od najznačajnijih ugarskih i hrvatskih vladara te posljednji koji je uspješno oslabio moć velikaša i ojačao središnju kraljevsku vlast. Iako su mu pozornost odvlačili vlastiti interesi na Zapadu i sukobi s njemačkim carom Fridrikom III. i češkim kraljem Vladislavom, zaslužan je za usporavanje osmanlijskog napredovanja na zapad, što je postigao osnivanjem obrambenih teritorijalnih jedinica na istoku kraljevstva. Bio je pokrovitelj umjetnosti i kulture i njegov dvor je bio središte okupljanja i djelovanja najistaknutijih književnih i likovnih stvaratelja humanističkog perioda. Umro je bez legitimnog nasljednika, a u narodnoj predaju je ostao upamćen kao velik i pravedan vladar."},{"page_url":"https://de.wikipedia.org/wiki/Kermit_Roosevelt_junior","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Theodore_roosevelt_with_kim_roosevelt_1916.jpg","page_title":"Kermit Roosevelt junior","context_page_description":"Kermit „Kim“ Roosevelt junior war ein Mitarbeiter der CIA, Sohn von Kermit Roosevelt und Enkel von US-Präsident Theodore Roosevelt.\\nZusammen mit dem britischen Agenten Christopher Montague Woodhouse leitete er 1953 die Operation TPAJAX, die zum Sturz des iranischen Premierministers Mohammad Mossadegh führte. Während der Präsidentschaft von Harry S. Truman war es nicht möglich, diese Aktion durchzuführen, da Truman ein solches Unterfangen ablehnte. Erst unter dessen Nachfolger Dwight D. Eisenhower gelang es den beiden Agenten, die Zustimmung zu dieser Operation zu erhalten."},{"page_url":"https://es.wikipedia.org/wiki/Organizaci%C3%B3n_territorial_de_Mauricio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Mauritius_districts_numbered.svg","page_title":"Organización territorial de Mauricio","context_page_description":"La República de Mauricio se divide en 10 distritos y varias dependencias:\\nDistritos\\nBlack River\\nFlacq\\nGrand Port\\nMoka\\nPamplemousses\\nPlaines Wilhems\\nPort Louis\\nRivière du Rempart\\nSavanne\\nDependencias de Mauricio\\nRodrigues, considerado informalmente como décimo distrito de Mauricio\\nAgalega\\nCargados Carajos\\nDatos: Q5283489\\nMultimedia: Districts of Mauritius"},{"page_url":"https://en.wikipedia.org/wiki/John_C._Heenan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/John_Camel_Heenan%2C_circa_1863.jpg","page_title":"John C. Heenan","context_page_description":"John Camel Heenan, also known as the Benicia Boy was an American bare-knuckle prize fighter. Though highly regarded, he had only three formal fights in his career, losing two and drawing one.\\nHeenan is best remembered for his second contest, when he traveled to England to fight British champion Tom Sayers. The bout ended in chaos when spectators broke into the ring and the police intervened. The referee finally called a draw. The Benicia Boy came home to a hero's welcome, but later returned to England where he had just one more fight, losing controversially to new British champion, Tom King. He died at Green River Station, Wyoming Territory in October 1873, and is buried at St Agnes Cemetery, Albany, New York."},{"page_url":"https://vi.wikipedia.org/wiki/Bulgaria","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Oilcape.jpg","page_title":"Bulgaria","context_page_description":"Bulgaria, tên chính thức là Cộng hòa Bulgaria là một quốc gia nằm tại khu vực đông nam châu Âu. Bulgaria giáp với România về phía bắc, giáp với Serbia và Cộng hòa Macedonia về phía tây, giáp với Hy Lạp và Thổ Nhĩ Kỳ về phía nam và cuối cùng giáp với Biển Đen về phía đông.\\nDãy núi Balkan chạy từ đông sang tây phía bắc Bulgaria. Người Bulgaria gọi dãy núi này là \\"Núi Già\\". Sông Donau tạo thành phần lớn biên giới phía bắc Bulgaria.\\nGiữa Sofia ở phía tây và Biển Đen là một vùng đồng bằng thấp gọi là thung lũng hoa hồng, trong 3 thế kỷ đã trồng ở khu vực này. Hoa hồng Kazanluk được ưa chuộng và được xuất khẩu do mùi hương riêng biệt của nó, dùng để sản xuất nước hoa. Về phía đông là bờ biển Hắc Hải với những mỏm đá phía bắc và các bãi cát phía nam thu hút du khách khắp thế giới.\\nVị trí của Bulgaria ở giao lộ quan trọng của hai châu lục khiến đây là nơi tranh giành quyền lực trong nhiều thế kỷ. Là một vương quốc độc lập trong nhiều thế kỷ, Bulgaria đã là một cường quốc lớn trong thời gian dài thời Trung cổ.\\nBulgaria là một nước có truyền thống lịch sử và văn hóa lâu đời tại châu Âu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_companies_of_Cape_Verde","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Praia-March%C3%A9.jpg","page_title":"List of companies of Cape Verde","context_page_description":"Cape Verde, officially the Republic of Cabo Verde, is an island country spanning an archipelago of 10 volcanic islands in the central Atlantic Ocean. Located 570 kilometres off the coast of West Africa, the islands cover a combined area of slightly over 4,000 square kilometres.\\nMost of the nation's GDP comes from the service industry. Cape Verde's economy has been steadily growing since the late 1990s, and it is now officially considered a country of average development, being only the second country to have achieved such transition, after Botswana in 1994. Cape Verde has significant cooperation with Portugal at every level of the economy, which has led it to link its currency first to the Portuguese escudo and, in 1999, to the euro."},{"page_url":"https://pl.wikipedia.org/wiki/Ob%C3%B3z_przy_ulicy_Przemys%C5%82owej_w_%C5%81odzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Plan_obozu_przy_ul._Przemyslowej_w_Lodzi_2013.jpg","page_title":"Obóz przy ulicy Przemysłowej w Łodzi","context_page_description":"Obóz prewencyjny dla młodych Polaków Policji Bezpieczeństwa w Łodzi, również potocznie Kinder-KL Litzmannstadt – obóz utworzony na obszarze wydzielonym z łódzkiego getta, przeznaczony dla dzieci i młodzieży polskiej od 6 do 16 roku życia. Formalnie utworzony około połowy 1942, operacyjną działalność rozpoczął 11 grudnia 1942 roku. Funkcjonował do końca okupacji niemieckiej w Łodzi, do 19 stycznia 1945 roku.\\nObóz prewencyjny dla młodych Polaków Policji Bezpieczeństwa w Łodzi nie był obozem koncentracyjnym, choć tego określenia użył Józef Witkowski – autor jedynej monografii dotyczącej tego obozu z 1975 roku. Nie ma ono uzasadnienia historycznego i formalnego.\\nJego popularna, powojenna nazwa pochodzi od ulicy, na której znajdowała się jego brama główna i która dalej, na odcinku obozowym, była wykorzystywana jako plac apelowy."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%BE%D9%88%D9%84_%D8%A7%D9%88%D8%AC%D8%B1%D8%A7%D8%AF%D9%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Paul_O%27Grady_%28footballer%29.jpg","page_title":"پول اوجرادى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nپول اوجرادى لاعب كورة قدم من اوستراليا."},{"page_url":"https://jv.wikipedia.org/wiki/Triceratops","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Triceratops_prorsus_-_IMG_0697.jpg","page_title":"Triceratops","context_page_description":"Triceratops punika setunggaling genus saking dinosaur hèrbivor ceratopsid ingkang urip wonten jaman Maastrichtian akhir saking Periode Kapur Akhir, kinten-kinten 68 ngantos 65 yuta warsa kepengker wonten ing napa ingkang sapunika Amerika Utara. Triceratops punika inggih minangka setunggaling generasi ingkang pungkasan saderengipun kepunahan ageng-agengan wonten ing jaman Cretaseous-Tersier."},{"page_url":"https://fr.wikipedia.org/wiki/Galaxie_de_Seyfert","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/NGC_262.png","page_title":"Galaxie de Seyfert","context_page_description":"Les galaxies de Seyfert sont des galaxies spirales caractérisées par un noyau extrêmement brillant et compact. D'une brillance de surface très élevée, leur noyau représente l'une des plus grandes sources de rayonnement électromagnétique connues de l'Univers, possiblement liée au trou noir supermassif en leur centre. Ces galaxies présentent des émissions fortes dans les domaines radio, ultraviolet, infrarouge et rayons X du spectre électromagnétique. Elles représenteraient plus de 5 % de l'ensemble des galaxies de l'univers observable.\\nElles forment un des deux groupes importants de galaxies actives, l'autre groupe étant les quasars. Elles ont été nommées d'après Carl Seyfert, qui a étudié ces objets au cours des années 1940."},{"page_url":"https://lt.wikipedia.org/wiki/Erodas_I_Didysis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Prise_de_J%C3%A9rusalem_par_H%C3%A9rode_le_Grand.jpg","page_title":"Erodas I Didysis","context_page_description":"Erodas I Didysis – Judėjos, Galilėjos ir Batanėjos valdovas, valdė nuo 37 m. pr. m. e. iki mirties. Nuo 47 m. pr. m. e. buvo Romos vietininkas Galilėjoje, nuo 46 m. pr. m. e. – Samarijoje.\\nKonflikte tarp Oktaviano ir Antonijaus palaikė pastarąjį, tačiau po Antonijaus pralaimėjimo Akcijaus mūšyje persimetė prie Oktaviano, kuris patvirtino jo valdžią Judėjoje. 20 m. pr. m. e. Erodo karalystė be Palestinos taip pat apėmė dabartinės Jordanijos, Libano ir Sirijos dalį.\\nPasak Naujojo Testamento, išgirdęs apie Jėzaus Kristaus gimimą, liepęs išžudyti visus naujagimius, tarp kurių turėjęs būti galimas Erodo I Didžiojo konkurentas dėl sosto. Istorinių tai patvirtinančių duomenų nėra.\\nErodas Didysis turėjo tris sūnus, kuriems po jo mirties atiteko jo karalystė – Archelajus, Erodas Antipas ir Erodas Pilypas II."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%B7%E5%9C%8B%E9%99%B8%E8%BB%8D%E7%89%B9%E7%A8%AE%E9%83%A8%E9%9A%8A%E5%8F%B8%E4%BB%A4%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/H%26K_MP7.jpg","page_title":"德國陸軍特種部隊司令部","context_page_description":"特種部隊司令部是德國聯邦國防軍陸軍的特種部隊指揮機構。該部隊曾多次的獲得美國和北約的嘉許，它亦經常奉命參與聯合反恐行動，最顯著的是在波赫和中東地區的行動。"},{"page_url":"https://no.wikipedia.org/wiki/Strondafjorden","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Fagernes%2C_Nord-Aurdal.JPG","page_title":"Strondafjorden","context_page_description":"Strondafjorden er en innsjø som ligger i kommunene Nord-Aurdal og Vestre Slidre i Innlandet. Innsjøen er en del av Begnavassdraget."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A8%D7%95%D7%A9%D7%9C%D7%99%D7%9D_%D7%91%D7%AA%D7%A7%D7%95%D7%A4%D7%94_%D7%94%D7%9E%D7%9E%D7%9C%D7%95%D7%9B%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Tomb_of_Zechariah_PA180078.JPG","page_title":"ירושלים בתקופה הממלוכית","context_page_description":"העיר ירושלים הייתה תחת שלטון הממלוכים החל משנת 1260 ועד שנת 1516. תקופה זו בתולדות העיר חופפת את שנות שלטונם של הממלוכים בארץ ישראל. ירושלים הממלוכית הייתה עיר שולית מבחינה אסטרטגית, מדינית וכלכלית, ועם זאת בעלת חשיבות דתית גבוהה, הן עבור השלטון הממלוכי המוסלמי והן עבור היהודים והנוצרים.\\nהשלטון בירושלים בתקופה הממלוכית היה נתון בידי פקידים שהיו אנשי דת והתרכזו בבניית מבני דת מוסלמיים בעיר. הפן המנהלי של העיר הוזנח, ואוכלוסייתה הייתה ברובה ענייה, וחיה בְּצִלָּם של ארמונות ומבנים מפוארים, ששימשו כמרכזי לימוד לתורת האסלאם. ירושלים היוותה מרכז חשוב של עלייה לרגל עבור שלוש הדתות, והתקיימו בה קהילות קטנות של נוצרים ויהודים, שאמנם סבלו מהגבלות רבות, אך זכו לזכויות הגנה מסוימות. רבים מהמבנים המפוארים בעיר העתיקה ובהר הבית נבנו בתקופה הממלוכית, והשפעתה של האדריכלות הממלוכית ניכרת בעיר עד היום. פרטי עיצוב ואדריכלות בסגנון ממלוכי משמשים את אדריכלי העיר בתקופה המודרנית על מנת ליצור \\"מראה ירושלמי\\"."},{"page_url":"https://de.wikipedia.org/wiki/Rootes_Arrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/1975.humber.sceptre.arp.jpg","page_title":"Rootes Arrow","context_page_description":"Rootes Arrow war der Projektname eines in der unteren Mittelklasse angesiedelten Pkw-Modells der britischen Rootes-Gruppe, das von 1966 bis 1979 von mehreren Konzernmarken unter diversen Modellbezeichnungen verkauft wurde. Der bekannteste Ableger des Arrow war der Hillman Hunter."},{"page_url":"https://eo.wikipedia.org/wiki/Johano_la_3-a_Sobieski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Sobieski_Monument_Warsaw.jpg","page_title":"Johano la 3-a Sobieski","context_page_description":"Johano la 3-a Sobieski, naskiĝinta la 17-an de aŭgusto 1629 en Olesko kaj mortinta la 17-an de junio 1696 en Wilanów, estis reĝo de la Respubliko de Ambaŭ Nacioj de 1674. Li estas konata kiel reĝo-heroo pro lia venko apud Vieno super Otomana Imperio en 1683 danke al kio li efike haltis la ekspansion de tiu imperio al Eŭropo. Tial turkoj ofte nomis lin la Leono de Lehistan kaj eŭropanoj la Defendanto de la Kredo."},{"page_url":"https://nl.wikipedia.org/wiki/Logny-Bogny","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Map_commune_FR_insee_code_08257.png","page_title":"Logny-Bogny","context_page_description":"Logny-Bogny is een gemeente in het Franse departement Ardennes en telt 192 inwoners. De plaats maakt deel uit van het arrondissement Charleville-Mézières."},{"page_url":"https://ca.wikipedia.org/wiki/Coala","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Koala.jpg","page_title":"Coala","context_page_description":"El coala és un marsupial arborícola endèmic d'Austràlia."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A5%D5%BD%D5%BF%D5%B4%D5%AB%D5%B6%D5%BD%D5%BF%D5%A5%D6%80%D5%AB_%D5%B3%D5%A1%D6%80%D5%BF%D5%A1%D6%80%D5%A1%D5%BA%D5%A5%D5%BF%D5%A1%D5%AF%D5%A1%D5%B6_%D6%84%D5%A1%D5%B6%D5%A4%D5%A1%D5%AF%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Prospero_and_Ariel_%2894216050%29.jpg","page_title":"Վեստմինստերի ճարտարապետական քանդակների ցանկ","context_page_description":"Վեստմինստերում կան բազմաթիվ ճարտարապետական կառույցներ՝ անկրկնելի և գեղեցիկ քանդակներով։"},{"page_url":"https://en.wikipedia.org/wiki/Personal_transporter","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Airwheel-Q5.jpg","page_title":"Personal transporter","context_page_description":"A personal transporter is a class of compact, mostly recent, motorised vehicle for transporting an individual at speeds that do not normally exceed 25 km/h. They include electric skateboards, kick scooters, self-balancing unicycles and Segways, as well as gasoline-fueled motorised scooters or skateboards, typically using two-stroke engines of less than 49 cc displacement. Many newer versions use recent advances in vehicle battery and motor-control technologies. They are growing in popularity, and legislators are in the process of determining how these devices should be classified, regulated and accommodated during a period of rapid innovation.\\nGenerally excluded from this legal category are electric bicycles; electric motorbikes and scooters; and powered mobility aids with 3 or 4 wheels on which the rider sits."},{"page_url":"https://en.wikipedia.org/wiki/Pas_de_Bellecombe-Jacob","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/ReunionFournaise_ParkingBellecombe2.JPG","page_title":"Pas de Bellecombe-Jacob","context_page_description":"Pas de Bellecombe-Jacob is a mountain pass and vista point overlooking Enclos Fouqué, the last caldera formed by Piton de la Fournaise, the active volcano on the eastern side of Réunion island in the Indian Ocean.\\nIt is named after Guillaume Léonard de Bellecombe, governor of La Réunion during the 18th century, and Jacob, the slave that actually discovered the pass."},{"page_url":"https://nl.wikipedia.org/wiki/CAL_Cargo_Air_Lines","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/4X-ICA_LLBG_Micha_Sender.jpg","page_title":"CAL Cargo Air Lines","context_page_description":"CAL Cargo Air Lines is een Israëlische luchtvrachtmaatschappij met haar thuisbasis de luchthaven Ben-Gurion te Tel Aviv."},{"page_url":"https://de.wikipedia.org/wiki/Peter_Halm","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Peter_Halm.jpg","page_title":"Peter Halm","context_page_description":"Peter Halm, auch Peter von Halm, war Professor für Radierkunst an der Münchner Kunstakademie von 1901 bis 1923. Dort unterrichtete er bereits seit 1896 als Hilfslehrer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B8%D0%B4%D1%80%D0%BE%D0%BF%D0%BE%D0%BD%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D0%BA%D0%B0%D0%BF%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BF%D0%BE%D0%BB%D0%B8%D0%B2%D0%B0.jpg","page_title":"Гидропоника","context_page_description":"Гидропо́ника — это способ выращивания растений на искусственных средах без почвы. Питание растения получают из питательного раствора, окружающего корни. Гидропоника позволяет регулировать условия выращивания растений — создавать режим питания для корневой системы, полностью обеспечивающий потребности растений в питательных элементах, концентрацию углекислого газа в воздухе, наиболее благоприятную для фотосинтеза, а также регулировать температуру воздуха и корнеобитаемого пространства, влажность воздуха, интенсивность и продолжительность освещения. Создание оптимальных условий для роста и развития растений обеспечивает получение очень высоких урожаев, лучшего качества и за более короткие сроки. Выращивание растений этим способом менее трудоемко, чем в почвенной культуре, вода и питательные вещества расходуются экономнее. Подача питательного раствора легко автоматизируется. В условиях гидропоники практически отпадает борьба с сорняками."},{"page_url":"https://de.wikipedia.org/wiki/La_Chapelle-au-Riboul","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/La_Chapelle-au-Riboul_%2853%29_%C3%89glise.JPG","page_title":"La Chapelle-au-Riboul","context_page_description":"La Chapelle-au-Riboul ist eine französische Gemeinde mit 501 Einwohnern im Département Mayenne in der Region Pays de la Loire. Die Gemeinde gehört zum Kanton Lassay-les-Châteaux und zum Arrondissement Mayenne. Die Einwohner werden Chapellois genannt."},{"page_url":"https://es.wikipedia.org/wiki/Gabriella_Giacobbe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Mario_Valgoi_and_Gabriella_Giacobbe_1972.jpg","page_title":"Gabriella Giacobbe","context_page_description":"Gabriella Giacobbe fue una actriz italiana de cine, teatro y televisión.\\nNacida en L'Aquila, Giacobbe se graduó en la escuela de teatro de Giorgio Strehler y trabajó mucho tiempo en su compañía en el Teatro Piccolo en Milán, ​ debutando en 1953 en la obra La sei giorni.​ Sus créditos en el escenario incluyen obras de Luchino Visconti y Eduardo De Filippo.​ También tuvo una prolífica carrera en la televisión, apareciendo en series y en películas para televisión como A come Andromeda y La donna di picche. Su aparición en el cine fue algo más esporádica, trabajando con directores como Luigi Magni, Dino Risi y Nelo Risi. Murió de cáncer el 8 de enero de 1979, a los 55 años.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D1%83%D1%82%D0%B5-%D0%A3%D1%80%D1%88%D1%82%D1%80%D0%BE%D0%BC%D1%82%D0%B0%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Hammerfliess1_Schoenefeld.JPG","page_title":"Нуте-Урштромталь","context_page_description":"Нуте-Урштромталь — коммуна в Германии, в земле Бранденбург.\\nВходит в состав района Тельтов-Флеминг. Население составляет 6790 человек. Занимает площадь 337,69 км². Официальный код — 12 0 72 312.\\nКоммуна подразделяется на 23 сельских округа."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D9%86%D8%AF%DB%8C%D9%88%D9%84%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Candiolo01.JPG","page_title":"کاندیولو","context_page_description":"کاندیولو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۵۶۳۳ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۲۳۷ متر یۇکسک‏لیکده یئر آلیب. و پیمونت اوستانیندا دا یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Cedar_Mesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/ArchCanyonUT.jpg","page_title":"Cedar Mesa","context_page_description":"Cedar Mesa is a plateau in San Juan County in the southeastern portion of the U.S. state of Utah. It extends from Elk Ridge in the north, Comb Wash to the east, the gorge of the San Juan River to the south, and Grand Gulch to the west, an area of over 400 square miles. The center of the mesa is located at approximately 37°26'N and 109°55'W, at an elevation of 6,500 feet. The surrounding terrain has a typical elevation of just 4,200 feet Most of Cedar Mesa is included in the newly declared Bears Ears National Monument.\\nThis large difference in elevation has led to the formation of numerous canyons, cliffs, and other erosional features on the edges of the mesa. To the east are several canyons draining into Comb Wash, including Arch, Texas, Mule, Owl, Fish, McCloyd, and Road Canyons. Scattered throughout these canyons are cliff dwellings of the Ancient Puebloans.\\nTo the southeast is an eroded area called the Valley of the Gods, and to the southwest is a deep gorge of the San Juan River, called the Goosenecks. High above, on the southern edge of Cedar Mesa, are Muley and Cedar Points."},{"page_url":"https://de.wikipedia.org/wiki/Kaiserstein_(Gestein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Geb.haus_Nestroys_Stiege.jpg","page_title":"Kaiserstein (Gestein)","context_page_description":"Der Kaiserstein ist ein besonders dichter und widerstandsfähiger Leithakalk aus den Brüchen von Kaisersteinbruch. Diese Steinbrüche lagen bis 1921 auf ungarischem Boden, so ist vom „harten ungarischen Stein“ zu lesen, im Gegensatz zum „weichen ungarischen Stein“, wie der Margarethener Stein bezeichnet wurde. Das war aus Konkurrenzgründen mitunter abwertend gemeint, vor allem von Seiten des Eggenburger Steinmetzhandwerkes mit dem Zogelsdorfer Stein. Trotzdem heirateten mehrere Eggenburger Gesellen in die italienisch-schweizerischen Meisterfamilien im kaiserlichen Steinbruch ein und waren danach sehr erfolgreich.\\nDie Ausgrabung des römischen Gutshofs, Grabsteine, unter anderem im Schloss Königshof, bezeugen, dass bereits die Römer hier dieses Gestein gebrochen und bearbeitet haben. Steinmetzmeister Friedrich Opferkuh forschte nach dem „Römersteinbruch“ von Kaisersteinbruch und ortete ihn im Waldbruch."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B7%D0%BE%D0%BD_(%D0%92%D0%B5%D1%80%D1%85%D0%BD%D0%B8%D0%B5_%D0%9F%D0%B8%D1%80%D0%B5%D0%BD%D0%B5%D0%B8)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Map_commune_FR_insee_code_65353.png","page_title":"Озон (Верхние Пиренеи)","context_page_description":"Озо́н — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Верхние Пиренеи. Входит в состав кантона Турне. Округ коммуны — Тарб.\\nКод INSEE коммуны — 65353."},{"page_url":"https://sv.wikipedia.org/wiki/Design","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/M-T4.jpg","page_title":"Design","context_page_description":"Formgivning, eller design, är ett begrepp som beskriver ett föremåls konstruktion, utseende eller den skapandeprocess som används från idéstadiet till färdig produkt. Dessa produkter utvecklas efter funktionella och estetiska krav med utgångspunkt från brukarens behov. Design tillämpas för utveckling av varor, tjänster, processer och miljöer. Då inkluderas funktioner som teknik, användarvänlighet, miljövänlighet, utseende, affärslösningar och även marknadsföring. Det finns emellertid ingen allmänt accepterad definition av ordet design, då termen har olika betydelser inom olika designdiscipliner och användarområden.\\nOrdet design kommer från latinets designo = peka ut, avbilda, framställa. Design är en engelsk term med den ursprungliga innebörden för plan, skiss, ritning, vilken motsvarades av desseIn i 1600-talets Sverige. År 1650 sägs exempelvis att drottning Kristina hade fullföljt sin faders \\"högberömlige och förnäme desseiner\\". Man syftade då på den pågående stadsplaneringen i Stockholm och att Gustav II Adolf själv aktivt hade påverkat den."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D8%B1%D8%A7%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Jrust.JPG","page_title":"جان راست","context_page_description":"جان راست آمریکالی بیلیم اینسانی. ۲۳ مئی ۱۹۵۵ تاریخینده دۆنیایا گؤز آچیب. جان راست ماساچوست تکنولوژی انستیتوسودا درس اوْخویوب. چالیشدیغی یئرلریندن بیری جورج‌تاون بیلیم‌یوردو, ‌دیر."},{"page_url":"https://fr.wikipedia.org/wiki/Monument_%C3%A0_la_R%C3%A9publique","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Proclamation_de_la_R%C3%A9publique.jpg","page_title":"Monument à la République","context_page_description":"Le Monument à la République, dit aussi Statue de la République, est un ensemble statuaire monumental, œuvre de Léopold Morice. Inaugurée en 1883 sur la place de la République à Paris, en France, elle représente une allégorie de la République."},{"page_url":"https://es.wikipedia.org/wiki/Loricariinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Rineloricaria_sp_3.jpg","page_title":"Loricariinae","context_page_description":"Los loricarinos es una subfamilia de peces siluriformes de agua dulce integrante de la familia Loricariidae. Las especies que incluye habitan en aguas templadas y cálidas del Neotrópico y son denominadas comúnmente viejas del agua."},{"page_url":"https://en.wikipedia.org/wiki/Glyndebourne_Festival_Opera:_A_Gala_Evening","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Elisabeth_S%C3%B6derstr%C3%B6m.jpg","page_title":"Glyndebourne Festival Opera: A Gala Evening","context_page_description":"Glyndebourne Festival Opera: A Gala Evening was a 111-minute concert staged by Glyndebourne Festival Opera on 24 July 1992, performed by Kim Begley, Montserrat Caballé, Cynthia Haymon, Felicity Lott, Benjamin Luxon, Ruggero Raimondi and Frederica von Stade with the Glyndebourne Festival Chorus and the London Philharmonic Orchestra under the direction of Sir Andrew Davis and Sir Bernard Haitink. It was televised in the United Kingdom by the BBC and released on VHS Videocassette by Kultur Video and on DVD by Image Entertainment, Arthaus Musik and Geneon."},{"page_url":"https://ga.wikipedia.org/wiki/Niocl%C3%A1s_II_na_R%C3%BAise","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Nicholas_II_of_Russia_as_a_child_with_his_mother.jpg","page_title":"Nioclás II na Rúise","context_page_description":"B'é Nioclás II Sár deireanach na Rúise. Chaill sé a choróin sa bhliain 1917, tar éis Réabhlóid na Feabhra, agus chuir Léinín agus an páirtí Boilséiveach é chun báis sa bhliain 1918, i ndiaidh Réabhlóid Dheireadh Fómhair.\\nB'é an t-ainm iomlán a bhí air Nikolai Aleksandrovich Romanov, ach thugtaí Nioclás II, Impire agus Uathlathaí na hUile Rúise. Tugtar na leasainmneacha An Mairtíreach Nioclás agus Nioclás Fuilteach air freisin."},{"page_url":"https://de.wikipedia.org/wiki/Magdalena_Andersson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Magdalena_Andersson.jpg","page_title":"Magdalena Andersson","context_page_description":"Magdalena Andersson ist eine schwedische Politikerin der Sveriges socialdemokratiska arbetareparti. Seit 2014 ist sie Finanzministerin in Schweden."},{"page_url":"https://fr.wikipedia.org/wiki/Randonn%C3%A9e_en_Gironde","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Circuit_d%C3%A9partemental_%2B_chemin_de_Compostelle_-_1.jpg","page_title":"Randonnée en Gironde","context_page_description":"Réalisé dans le cadre du PDIPR, le site web officiel de l’Agence Départementale du Tourisme de la Gironde publie actuellement plusieurs balades de randonnée et boucles de randonnée. Des nouvelles boucles viennent s'ajouter de temps en temp.\\nIl y a des autres chemins de randonnée réalisé anciennement par le conseil départemental mais il ne distribue plus les cartes de ces chemins de randonnée. Néanmoins, beaucoup de ces cartes sont accessibles au site web des amateurs de VTT Rando VTT 33 - Les sentiers VTT de la Gironde.\\nCes chemins de randonnées furent aussi publiées dans des plan-guides et des topoguides.\\nLes anciennes balades de randonnée sont composées de boucles locales et de circuits départementaux. Les boucles locales sont les plus courtes et retournent à la point de départ ou sont les simples allers-retours. Les circuits départementaux sont plus longs et/ou font des liens entre plusieurs boucles locales.\\nOn peut trouver des autres chemins de randonnée en Gironde au site web de L’Union Touristique du Médoc."},{"page_url":"https://en.wikipedia.org/wiki/Barbara_Gilmour","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Creameryrow.JPG","page_title":"Barbara Gilmour","context_page_description":"Barbara Gilmour was a significant figure in 17th century Ayrshire having introduced a method of cheese making which became common throughout Ayrshire and beyond, providing employment and extra income for farmers and others. She lived near Dunlop, a village in East Ayrshire, Scotland, lying between the village of Lugton and the town of Stewarton on the old turnpike road to Glasgow. Cheese made by her method became known as \\"Dunlop cheese\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Zwolle_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Pakhuis_met_herstelde_puntgevel.jpg","page_title":"Lijst van rijksmonumenten in Zwolle (plaats)","context_page_description":"De stad Zwolle telt ten minste 443 inschrijvingen in het rijksmonumentenregister, hieronder een overzicht."},{"page_url":"https://vi.wikipedia.org/wiki/Jatropha_scaposa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/136_DAS_Jatropha_scaposa_x_curcas_inflorescence_2_%284611889972%29.jpg","page_title":"Jatropha scaposa","context_page_description":"Jatropha scaposa là một loài thực vật có hoa trong họ Đại kích. Loài này được Radcl.-Sm. mô tả khoa học đầu tiên năm 1991."},{"page_url":"https://pt.wikipedia.org/wiki/Crocodilo-de-morelet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Morelets.crocodile.arp.jpg","page_title":"Crocodilo-de-morelet","context_page_description":"O crocodilo-mexicano, também chamado de crocodilo-de-morelet, é uma espécie relativamente pequena de crocodilo, encontrada no México."},{"page_url":"https://en.wikipedia.org/wiki/Sleeping_Beauty_Peak","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Sleeping_Beauty_in_Winter_-_Gifford_Pinchot_%2823931386785%29.jpg","page_title":"Sleeping Beauty Peak","context_page_description":"Sleeping Beauty is a 4,907-foot mountain summit located in the Gifford Pinchot National Forest of Skamania County in Washington state. It is situated in the Cascade Range, 10.73 mi southwest of Mount Adams. Sleeping Beauty is so named because its profile as seen from the east side of the Trout Lake Valley somewhat resembles a sleeping woman. Precipitation runoff from Sleeping Beauty drains into tributaries of the White Salmon River. The peak is composed of andesitic magma that intruded up into older volcanic rocks more than 25 million years ago and is now surrounded by a forest of old-growth Douglas fir and mountain hemlock. Sleeping Beauty Peak Trail is a 1.4 mile steep trail that ends at the base of the rock outcrop known as Sleeping Beauty. The peak was the site of a former fire lookout tower that was constructed in 1931."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%DB%8C%D8%B3%D9%87%D8%A7%D9%88%D9%BE%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Seeshaupt_am_Starnberger_See.JPG","page_title":"زیسهاوپت","context_page_description":"زیسهاوپت یک شهر در آلمان است که در بایرن واقع شده‌است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%B0%D0%B4_%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/RIAN_archive_94459_A_parade_of_WWII_veterans_in_Red_Square.jpg","page_title":"Парад Победы","context_page_description":"Пара́д войск Кра́сной а́рмии на Кра́сной пло́щади Москвы́ 24 ию́ня 1945 го́да — исторический парад, прошедший на Красной площади в честь победы СССР над Германией в Великой Отечественной войне. Мероприятие принимал маршал Георгий Жуков, командовал войсками маршал Константин Рокоссовский. Специально для парада из Берлина было доставлено Знамя Победы, установленное над Рейхстагом, однако его так и не вынесли. На мероприятии проводилась церемония повержения вражеских знамён и штандартов, после парада они были отправлены в Центральный музей Вооружённых Сил. Всего в торжественном шествии приняли участие около 35 тысяч человек. В советский период Парад Победы проводился лишь в юбилейные 1965, 1985 и 1990 годы. С 1995-го парад проходит ежегодно на главной площади страны."},{"page_url":"https://sv.wikipedia.org/wiki/Det_sjungande_tr%C3%A4det_(m%C3%A5lning)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Gr%C3%BCnewald%2C_Sjungande_tr%C3%A4det.jpg","page_title":"Det sjungande trädet (målning)","context_page_description":"Det sjungande trädet är en oljemålning av den svenske konstnären Isaac Grünewald från 1915. Målningen ingår i Norrköpings konstmuseums samlingar.\\nGrünewalds poetiska målning föreställer Berzelii park i Stockholm. Bakom det dekorativa trädet i förgrunden syns Berns salongers uteserveringar och den stora synagogan.\\nGrünewald ingick i konstnärsgruppen De unga som introducerade modernismen till Sverige. De var inspirerade av Henri Matisse och de franska fauvisterna vars stil utmärktes av starka och djärva färger och ett förenklat formspråk.\\nMauro Scoccos tredje studioalbum från 1992 har hämtat sitt namn från Grünewalds målning."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B2%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Flag_of_Nevelsky_rayon_%28Pskov_oblast%29.png","page_title":"Невельскі раён","context_page_description":"Невельскі раён — адміністрацыйна-тэрытарыяльная адзінка на поўдні Пскоўскай вобласьці Расеі. Адміністрацыйны цэнтар — места Невель."},{"page_url":"https://lmo.wikipedia.org/wiki/Campello_sul_Clitunno","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Campello_alto.JPG","page_title":"Campello sul Clitunno","context_page_description":"Campello sul Clitunno l'è 'n cümü italià, de la regiù de l'Umbria, en Pruvìncia de Perugia. El g'ha presapóch 2.369 abitàncc, 'na superfìce de 49 km² e 'na densità de 48 ab./km². El cunfìna coi cümü de Cerreto di Spoleto, Sellano, Spoleto, Trevi, Vallo di Nera. L'è póch delóns de 'ndóche nas el fiöm Clitunno."},{"page_url":"https://sv.wikipedia.org/wiki/Pierre-Joseph_Redout%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Portrait_de_Pierre-Joseph_Redout.jpg","page_title":"Pierre-Joseph Redouté","context_page_description":"Pierre-Joseph Redouté, född deb 10 juli 1759 i Saint-Hubert nära Liège, död den 19 juni 1840 i Paris, var en belgisk målare, av sin samtid kallad \\"blomstrens Rafael\\".\\nRedouté visade tidigt stora anlag för måleriet och blev under en studieresa bekant med holländaren Jan van Huysums blomstertavlor, varigenom han kom att rikta in sig på naturhistoriska målningar. Redan då han 1780 flyttade till Paris ådagalade han en dittills aldrig uppnådd exakt återgivning av blommornas detaljer. Han blev Marie-Antoinettes, sedermera även kejsarinnorna Joséphines och Marie Louises lärare i målning samt 1792 tecknare vid Académie des sciences och 1822 professor i växtavbildning vid Jardin du roi och Muséum national d'histoire naturelle. Bland de vetenskapliga arbeten, i vilka Redouté medverkat, märks \\"Flora atlantica\\" av René Desfontaines, \\"La botanique\\" av Jean-Jacques Rousseau samt \\"Histoire des chênes de l'Amérique septentrionale\\" och \\"Flora boreali-americana\\" av André Michaux. Hans mest fulländade verk är dock \\"Les Liliacées\\", \\"Les roses\\" och \\"Choix des plus belles fleurs\\"."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_de_Merville","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Map_canton_code_59_46.svg","page_title":"Cantón de Merville","context_page_description":"El cantón de Merville era una división administrativa francesa, que estaba situada en el departamento de Norte y la región de Norte-Paso de Calais.​"},{"page_url":"https://hr.wikipedia.org/wiki/Marksizam","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Engels.jpg","page_title":"Marksizam","context_page_description":"Marksizam je teorija i politička djelatnost tj. praxis dobivena iz radova Karla Marxa i Friedricha Engelsa. Svaka politička praksa koja je temeljena na radovima Marxa i Engelsa može se zvati marksizam; u to spadaju različiti oblici politika i misli kao onih od komunističkih stranaka i komunističkih država kao i akademsko istraživanje unutar mnogih polja. Iako postoje mnoge teorijske i praktične razlike između različitih oblika marksizma većina marksizama se dijele:\\npažnju na materijalne uvjete ljudskih života i društvene odnose među ljudima\\nvjerovanje da svijest ljudi o uvjetima njihovih života odražava te materijalne uvjete i odnose\\nrazumijevanje klase u pogledu različitih ekonomskih proizvodnih odnosa i kao određeni položaj unutar tih odnosa\\nrazumijevanje materijalnih uvjeta i društvenih odnosa kao povijesno promjenjive\\npogled na povijest prema kojemu klasna borba, tj. razvijajući sukob između klasa sa suprotnim interesima, izgrađuje svako povijesno razdoblje i pokreće povijesnu promjenu\\nsimpatija prema radničkoj klasi i proletarijatu"},{"page_url":"https://sv.wikipedia.org/wiki/Pycnophallium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Roxus.jpg","page_title":"Pycnophallium","context_page_description":"Pycnophallium är ett släkte av fjärilar. Pycnophallium ingår i familjen juvelvingar.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://vi.wikipedia.org/wiki/Horus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Eye_of_Horus.svg","page_title":"Horus","context_page_description":"Horus là tên một vị thần cổ đại quan trọng nhất trong Thần thoại Ai Cập. Ông ta được tôn thờ từ ít nhất cuối thời tiền sử Ai Cập cho đến thời Ai Cập thuộc Hy Lạp và Ai Cập thuộc La Mã. Các hình dáng khác nhau của Horus được ghi lại trong lịch sử và những hình dáng này được xem như là các vị thần riêng biệt bởi các nhà Ai Cập học. Những hình dạng khác nhau này có thể có nhận thức khác nhau của cùng một vị thần nhiều tầng lớp trong đó các tính cách nào đó hoặc các mối quan hệ tổng hợp được nhấn mạnh, không nhất thiết phải đối lập nhưng bổ sung cho nhau, phù hợp với cách người Ai Cập cổ đại nhìn về nhiều khía cạnh của thực tại. Ông ta thường được miêu tả như một con chim cắt, hoặc như một người đàn ông với một cái đầu chim cắt.\\nHình thức được ghi lại sớm nhất của Horus là vị thần bảo hộ của Nekhen ở Thượng Ai Cập, là vị thần đầu tiên của Ai Cập được biết đến, đặc biệt liên quan đến các vị vua, trải qua thời gian được xem là một biểu hiện của Horus trong cuộc sống và Osiris trong cái chết."},{"page_url":"https://is.wikipedia.org/wiki/Go%C3%B0areynir","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sorbus_latifolia_a1.jpg","page_title":"Goðareynir","context_page_description":"Goðareynir er tegund reyniviðar sem vex í Evrópu og verður rúmlega 15 metrar að hæð. Hann er með breiða krónu og gljáandi greinar."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BC%8A%E8%B1%86%E7%AE%B1%E6%A0%B9%E9%89%84%E9%81%937000%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Izuhakone_7000_Series_7501F_20190520.jpg","page_title":"伊豆箱根鉄道7000系電車","context_page_description":"伊豆箱根鉄道7000系電車は、伊豆箱根鉄道駿豆線用の電車である。1991年と翌1992年に各1編成が新製された。"},{"page_url":"https://sh.wikipedia.org/wiki/Amilorid","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Amiloridebigger.png","page_title":"Amilorid","context_page_description":"Amilorid je organsko jedinjenje, koje sadrži 6 atoma ugljenika i ima molekulsku masu od 229,627 Da."},{"page_url":"https://en.wikipedia.org/wiki/Ames_Research_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/NASA_Ames_Research_Center_Map.png","page_title":"Ames Research Center","context_page_description":"The Ames Research Center, also known as NASA Ames, is a major NASA research center at Moffett Federal Airfield in California's Silicon Valley. It was founded in 1939 as the second National Advisory Committee for Aeronautics laboratory. That agency was dissolved and its assets and personnel transferred to the newly created National Aeronautics and Space Administration on October 1, 1958. NASA Ames is named in honor of Joseph Sweetman Ames, a physicist and one of the founding members of NACA. At last estimate NASA Ames has over US$3 billion in capital equipment, 2,300 research personnel and a US$860 million annual budget.\\nAmes was founded to conduct wind-tunnel research on the aerodynamics of propeller-driven aircraft; however, its role has expanded to encompass spaceflight and information technology. Ames plays a role in many NASA missions. It provides leadership in astrobiology; small satellites; robotic lunar exploration; the search for habitable planets; supercomputing; intelligent/adaptive systems; advanced thermal protection; and airborne astronomy. Ames also develops tools for a safer, more efficient national airspace. The center's current director is Eugene Tu."},{"page_url":"https://sk.wikipedia.org/wiki/629_Bernardina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/629Bernardina_%28Lightcurve_Inversion%29.png","page_title":"629 Bernardina","context_page_description":"629 Bernardina je planétka s priemerom 139 km, ktorú objavil August Kopff 7. marca 1907."},{"page_url":"https://en.wikipedia.org/wiki/Colca_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/ValleColca_lou.jpg","page_title":"Colca River","context_page_description":"Colca River which downstream is called Majes and Camaná is a Peruvian river in the Arequipa Region that flows deep in the rugged Andes of southern Peru. It originates south-east of the village Janq'u Lakaya in the Callalli District of the Caylloma Province. On its way from Chivay to Cabanaconde it flows through one of the deepest canyons of the world known as the Colca Canyon. Near the town of Camaná the river empties into the Pacific Ocean."},{"page_url":"https://sv.wikipedia.org/wiki/Cinnobertyrann","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Vermillion-flycatcher-%28J%29.jpg","page_title":"Cinnobertyrann","context_page_description":"Cinnobertyrann är en fågel i familjen tyranner inom ordningen tättingar."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Joyn-Primetime-Sendungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Joyn_Primetime.png","page_title":"Liste der Joyn-Primetime-Sendungen","context_page_description":"Die Liste der Joyn-Primetime-Sendungen enthält eine Aufzählung aller Serien, die bei dem Internetsender Joyn Primetime ausgestrahlt werden bzw. wurden.\\nDas Serien-Programm von Joyn Primetime ist von US-amerikanischen Fernsehserien geprägt. Gesendet werden neben deutschsprachigen Erstausstrahlungen ebenfalls Serien in deutschsprachiger Free-TV-Erstausstrahlung. Nach den Erstausstrahlungen werden einige Serie wiederholt. Ferner werden auch Wiederholungen einer bisher schon auf einem anderen Sender oder Video-on-Demand-Dienst begonnenen Serie gezeigt. Teilweise beziehen sich Ausstrahlungen nur auf einzelne Staffeln oder beginnen nicht mit der ersten Staffel, diese sind entsprechend gekennzeichnet."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D0%B4%D1%80%D0%BE%D0%BC_%D1%81%D1%82%D1%83%D0%B4%D0%B5%D0%BD%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%D0%A1%D0%B8%D0%BD%D0%B4%D1%80%D0%BE%D0%BC_%D1%81%D1%82%D1%83%D0%B4%D0%B5%D0%BD%D1%82%D0%B0.svg","page_title":"Синдром студента","context_page_description":"Синдром студента — форма прокрастинації, яка полягає в тому, що людина, якій дали завдання, починає повністю зосереджуватись на ньому якомога пізніше до того моменту, коли завдання треба закінчити. Це призводить до втрати всього запасного часу, який був врахований при оцінці трудомісткості та ризиків проєкту, та збільшенню рівня стресу. Це пов'язано з тим що цінність отримана від роботи очікується в майбутньому, цінність роботи яка сприймається в даний момент занижена."},{"page_url":"https://hu.wikipedia.org/wiki/Aequipecten","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Aequipecten_opercularis_MHNT_CON_2003_1171_de_Roquemaurel.jpg","page_title":"Aequipecten","context_page_description":"Az Aequipecten a kagylók osztályának Pectinida rendjébe, ezen belül a Pectinidae családjába tartozó nem."},{"page_url":"https://es.wikipedia.org/wiki/Silke_Rottenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Silke_Rottenberg_03.jpg","page_title":"Silke Rottenberg","context_page_description":"Silke Rottenberg, es una ex-futbolista alemana, se desempeñaba como guardameta. Actualmente ejerce de entrenadora."},{"page_url":"https://vi.wikipedia.org/wiki/Mutiny_on_the_Bounty_(phim_1935)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Mutiny_bounty_15.jpg","page_title":"Mutiny on the Bounty (phim 1935)","context_page_description":"Mutiny on the Bounty là một phim do hãng MGM sản xuất năm 1935, do Frank Lloyd đạo diễn, với các ngôi sao Charles Laughton và Clark Gable, dựa trên tiểu thuyết cùng tên của Charles Nordhoff và James Norman Hall.\\nPhim này là một trong các phim thành công nhất trong thời đó và ngày nay vẫn còn đưọoc coi là một phim cổ điển. Mặc dù có nhiều điểm không chính xác về lịch sử, nhưng các nhà phê bình phim vẫn coi là ´một phim dựa trên cuộc nổi loạn trên tàu hay nhất."},{"page_url":"https://fr.wikipedia.org/wiki/Sport_en_France","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Tour_de_France_2004%2C_Champs_Elys%C3%A9es.jpg","page_title":"Sport en France","context_page_description":"Le sport en France est marqué par plusieurs phénomènes : une tradition sportive ancienne, un rôle prépondérant dans l'organisation du sport moderne et une grande variété de disciplines pratiquées à haut niveau. Si le palmarès international n'est pas au même rang, la tendance paraît s'inverser depuis la fin du XXᵉ siècle. La France pèse en effet moins qu'avant sur les enjeux du sport mondial, alors que le palmarès des sportifs français, depuis les années 1990, la place désormais clairement dans les toutes meilleures nations sportives.\\nEn 1986 déjà, L'Équipe magazine publie un classement mondial prenant en compte de très nombreuses disciplines. La France est classée quatrième derrière les États-Unis, l'URSS et l'Allemagne en profitant de sa présence, même moyenne, dans de nombreux sports. Aujourd'hui, les sportifs français n'ont pas abdiqué leurs volontés omnisports, colonisant même de nouveaux territoires, mais ils s'imposent aussi parmi les tout meilleurs dans des disciplines comme le football, le rugby à XV, le handball ou encore le basket-ball. Avec 39 titres olympiques, l'escrime reste le sport le plus titré devant le cyclisme."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lost_buildings_and_structures_in_Toronto","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Toronto_Star_Building_1929.JPG","page_title":"List of lost buildings and structures in Toronto","context_page_description":"This is a list of heritage, historic or simply notable older buildings that were demolished or lost due to fire or other causes in what is now Toronto, Ontario, Canada. In some cases, facades or portions of the original buildings have been retained or reconstructed."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BD%D0%B0%D0%BB_%D0%A1%D0%B5%D0%BD-%D0%9C%D0%B0%D1%80%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Paris_Canal_St-Martin_%C3%A9cluses_R%C3%A9collets_2013.jpg","page_title":"Канал Сен-Мартен","context_page_description":"Канал Сен-Мартен — канал у Парижі, довжиною 4,55 км, прокопаний в 1822—1826 для водопостачання паризьких фонтанів й розвантаження річкового судноплавства. Тоді з цією метою було вирішено перетворити притоку Марни — Урк — в канал, що перетинає східну частину столиці на правому березі Сени аж до Бастилії, де канал з'єднується з Сеною. Для фінансування проекту було запроваджено паризький податок на продаж вина. За Наполеона III канал був частково накритий для створення паризьких бульварів, і двокілометрова частина каналу стала підземною."},{"page_url":"https://pl.wikipedia.org/wiki/Atlantoraphidia_maculicollis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Atlantoraphidia_maculicollis_-_Reeenberg20090525_female_69.jpg","page_title":"Atlantoraphidia maculicollis","context_page_description":"Atlantoraphidia maculicollis – gatunek wielbłądki z rodziny wielbłądkowatych związany z lasami iglastymi.\\nW Polsce jest gatunkiem bardzo rzadkim, ostatnio wykazanym na początku XX wieku."},{"page_url":"https://uk.wikipedia.org/wiki/PJA1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/PBB_GE_PJA1_218667_at_fs.png","page_title":"PJA1","context_page_description":"PJA1 – білок, який кодується однойменним геном, розташованим у людей на X-хромосомі. Довжина поліпептидного ланцюга білка становить 643 амінокислот, а молекулярна маса — 71 002.\\nКодований геном білок за функціями належить до трансфераз, фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як убіквітинування білків, альтернативний сплайсинг.\\nБілок має сайт для зв'язування з іонами металів, іоном цинку."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D1%81%D0%BE%D0%B2%D0%B0_%D0%BF%D1%96%D1%81%D0%BD%D1%8F_(%D0%BF%D0%BE%D1%82%D1%8F%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/88%D0%9B_1.jpg","page_title":"Лісова пісня (потяг)","context_page_description":"«Лісовá пíсня» — нічний швидкий потяг № 88/87 Львівської залізниці сполученням Ковель — Новоолексіївка.\\nПротяжність маршруту складає — 1343 км.\\nНа даний потяг є можливість придбати електронний квиток."},{"page_url":"https://en.wikipedia.org/wiki/Charles_and_Ray_Eames","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Eames_chair-IMG_4624.jpg","page_title":"Charles and Ray Eames","context_page_description":"Charles Ormond Eames, Jr. and Bernice Alexandra \\"Ray\\" Kaiser Eames were an American married couple of industrial designers who made significant historical contributions to the development of modern architecture and furniture through the work of the Eames Office. They also worked in the fields of industrial and graphic design, fine art, and film. Charles was the public face of the Eames Office, but Ray and Charles worked together as creative partners and employed a diverse creative staff. Among their most recognized designs is the Eames Lounge Chair and the Eames Dining Chair.\\nCharles Eames and Ray Kaiser met at Cranbrook Academy of Art in 1940. Charles arrived at the school on an industrial design fellowship as recommended by Eliel Saarinen, but soon became an instructor. Ray enrolled in various courses to expand upon her previous education in abstract painting in New York City under the guidance of Hans Hofmann. Charles entered into a furniture competition—with his “best friend” Eero Saarinen—hosted by the Museum of Modern Art. Eames and Saarinen’s goal was to mold a single piece of plywood into a chair; the Organic Chair was born out of this attempt."}]`),L={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},I={class:"card-container"},F={key:0,class:"empty-state"},G=["disabled"],R={key:0},H={key:1};function N(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",T,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",I,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),f(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",F,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",H,"Loading...")):(t(),n("span",R,"See more"))],8,G)):p("",!0)])}const K=g(L,[["render",N],["__scopeId","data-v-db4ecfbf"]]),V=JSO